import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as D}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},C=["src","alt"],j={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,C)]),i("div",j,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(v,[["render",x],["__scopeId","data-v-ac14b898"]]),M=JSON.parse(`[{"page_url":"https://cs.wikipedia.org/wiki/Thomas_D%27Urfey","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/ButlersGhost1682.jpg","page_title":"Thomas D'Urfey","context_page_description":"Thomas D'Urfey, také Tom Durfey byl anglický spisovatel, dramatik, skladatel a humorista."},{"page_url":"https://lv.wikipedia.org/wiki/Meln%C4%81_klija","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Milvus_migrans_MHNT.ZOO.2006.11.86.jpg","page_title":"Melnā klija","context_page_description":"Melnā klija ir vidēji liels vanagu dzimtas plēsīgais putns. Izdala 5 pasugas. Melnā klija ir plaši izplatīta Eirāzijas mērenajā un tropu joslā, kā arī Austrālāzijā un Okeānijā. Nelielā skaitā sastopama arī Latvijā. Valda uzskats, ka tas ir visbiežāk sastopamais vanagu dzimtas plēsīgais putns pasaulē, lai gan dažas populācijas ir piedzīvojušas dramatiskas izmaiņas. Pasaulē dzīvo apmēram 6 miljoni melno kliju. Mazākā ir Eiropas populācija, toties Dienvidāzijas populācija ir ļoti liela. Mērenajā joslā ligzdojošās melnās klijas ir gājputni."},{"page_url":"https://cy.wikipedia.org/wiki/Lokfiliberzh","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Saint-Philibert-Morbihan.jpg","page_title":"Lokfiliberzh","context_page_description":"Mae Lokfiliberzh yn gymuned yn department Mor-Bihan, Llydaw. Mae'n ffinio gyda Crach, Locmariaquer, La Trinité-sur-Mer ac mae ganddi boblogaeth o tua 1,496.\\nYn yr erthygl hon, cyfieithir y termau brodorol kumunioù a communes i \\"gymuned\\" yn Gymraeg."},{"page_url":"https://es.wikipedia.org/wiki/Cultura_chav%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Oro_de_Chongoyape.jpg","page_title":"Cultura chavín","context_page_description":"Chavín de Huántar o cultura chavín es una cultura arqueológica del Antiguo Perú que se desarrolló durante el Horizonte Temprano ​​ Tuvo su centro de desarrollo en la ciudad de Chavín de Huántar, que está ubicada a 2 km de la confluencia de los ríos Huachecsa y Mosna, en la cuenca alta del río Marañón.\\nTradicionalmente, el desarrollo principal de Chavín se considera como un «horizonte cultural» debido a sus influencias artísticas y religiosas presentes en otras culturas contemporáneas a ella. Gran parte de aquel desarrollo histórico corresponde al Periodo Formativo específicamente al Formativo Medio y al Formativo Superior que tiene como características la intensificación del culto religioso, la aparición de la cerámica estrechamente relacionada con los centros ceremoniales, la intensificación del cultivo del maíz y la papa, el perfeccionamiento de las técnicas agrícolas y el desarrollo de la metalurgia y la textilería.\\nFue el arqueólogo Julio César Tello quien la descubrió y consideró como la «cultura matriz» o «madre de las civilizaciones andinas», ​ y que eran de origen amazónico."},{"page_url":"https://fr.wikipedia.org/wiki/Posnania","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Posnania_Gallery_in_Poznan_%285%29.jpg","page_title":"Posnania","context_page_description":"Posnania est un centre commercial situé à Poznań en Pologne. Dédié au shopping et aux loisirs, il se trouve non loin du centre historique de la ville et à l'intersection d'axes majeurs. Le centre est géré par la foncière commerciale Apsys"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%8A%D8%AA%D9%89_%D8%A7%D9%84%D8%A3%D9%88%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Seti1-ColumnFragment-CloseUp.png","page_title":"سيتى الأول","context_page_description":"سيتى الاول - Seti I -، ملك مصر. تانى ملوك الاسرة 19، و ابو رمسيس التانى. قاد حملات عسكرية عشان يستعيد امبراطورية مصر فى اسيا و لمقاومة نفوذ الحيثيين اللى زحفوا على سوريا. بنى معبد أبيدوس و مقبرته الفريده الرائعه فى وادى الملوك. بدأ تشييد بهو الاعمدة الضخم فى الكرنك اللى كمله رمسيس التانى بعد وفاته. اكتشف مقبرته المصرولوجى الطليانى جيوفانى بيلزونى فى اكتوبر 1817."},{"page_url":"https://sl.wikipedia.org/wiki/Grumman_F9F_Panther","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Grumman_F9F_Panther_BuAer_drawing.jpg","page_title":"Grumman F9F Panther","context_page_description":"Grumman F9F Panther je bil enomotorni palubni lovski bombnik, ki so ga zasnovali po 2. svetovni vojni. Panther je Grummanov prvi reaktivni lovec in en izmed prvih uspešnih palubnih reaktivnih lovcev. F9F se je veliko uporabljal v Korejski vojni, med drugim ga je uporabljala tudi ameriška akrobatska skupina Blue Angels. Skupno so zgradili 1382 letal, edini izvozni uporabnik je bila Argentinska mornarica. Na podlagi Pantherja so razvili Grumman F-9 Cougarja s puščastim krilom."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%84%B1%E9%98%B3%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/201901_Tracks_at_Poyang_Station.jpg","page_title":"鄱阳站","context_page_description":"鄱阳站，位于中华人民共和国江西省上饶市鄱阳县田畈街镇，是衢九铁路上的火车站，2017年12月28日开通启用，由南昌铁路局九江车务段管辖。"},{"page_url":"https://la.wikipedia.org/wiki/Ursula_Schmidt","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Ulla_Schmidt_%282007%29.jpg","page_title":"Ursula Schmidt","context_page_description":"Ulla Schmidt femina rei publicae et sodalis Socialis Democraticae Factionis Germaniae est."},{"page_url":"https://es.wikipedia.org/wiki/Krasnoselski","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Coats_of_arms_of_Krasnoselsky_%28Krasnodar_krai%29.png","page_title":"Krasnoselski","context_page_description":"Krasnoselski es un asentamiento de tipo urbano del raión de Gulkévichi del krai de Krasnodar, en el sur de Rusia. Está situado en la orilla izquierda del río Kubán, 9 km al noroeste de Gulkévichi y 132 km al este de Krasnodar, la capital del krai. Tenía 7 792 habitantes en 2010​\\nEs cabeza del municipio Krasnosélskoye."},{"page_url":"https://ca.wikipedia.org/wiki/Ex%C3%A8rcit_d%27Egipte","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/ACV-300_Adnan.jpg","page_title":"Exèrcit d'Egipte","context_page_description":"L'Èxercit d'Egipte és el component terrestre de les Forces Armades d'Egipte. En 2014, l'Exèrcit estava format per 310.000 soldats, dels quals aproximadament entre 90.000 i 120.000 eren voluntaris i la resta eren reclutes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D1%80%D0%B5%D0%BB%D0%BA%D0%BE%D0%B2%D0%BE%D0%B5_%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D0%B5_%D0%B3%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B_%D0%B2_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Soviet_Maxim_Machin_Gun.jpg","page_title":"Стрелковое оружие гражданской войны в Испании","context_page_description":"Во время Гражданской войны в Испании противоборствующие стороны использовали весьма разнообразный стрелковый арсенал. Место находилось как для новейших на тот момент пистолет-пулемётов, так и для архаичных игольчатых ружей. Для многих образцов факт боевого применения является предположительным, о других известно что они применялись, но неизвестно когда и где именно, в каких количествах и с какими результатами."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2_%D0%B2_1971_%D0%B3%D0%BE%D0%B4%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Kim_Jong-pil_1999.png","page_title":"Список глав государств в 1971 году","context_page_description":"В списке перечислены лидеры государств по состоянию на 1971 год. В том случае, если ведущую роль в государстве играет коммунистическая партия, указан как де-юре глава государства — председатель высшего органа государственной власти, так и де-факто — глава коммунистической партии.\\nВ список не включены главы ассоциированных государств и автономных территорий.\\nЕсли в 1971 году в каком-либо государстве произошла смена руководителя, в списке указываются оба из них. В случае если государство сменило флаг, указываются также оба флага.\\nСправа от текста даются изображения политиков, впервые пришедших к власти в 1971 году.\\nТочные даты смены правлений даются только для 1971 года. Прочие года смены власти даны ссылками на соответствующие списки глав государств и правительств по годам.\\nЦветом выделены страны, в которых в данном году произошли смены власти вследствие следующих событий:\\nСтраны, получившие независимость и новообразованные государства;\\nВоенный переворот, революция, всеобщее восстание;\\nПрезидентские выборы;\\nпарламентские выборы, парламентский кризис;\\nСмерть одного из руководителей страны;\\nИные причины."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B4%9B%E9%98%B3%E5%9F%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Dingding_gate.jpg","page_title":"洛阳城","context_page_description":"洛陽城是指在今洛陽市境內所建的古城。歷史上曾多次修建洛陽城：一是在今洛陽市東白馬寺東洛水北岸的漢魏故城；另一為在漢魏故城西18里今洛陽市區的隋唐故城；金元時期修築的城牆；明清時期在金元舊城上重築的城池。"},{"page_url":"https://en.wikipedia.org/wiki/Buildings_and_architecture_of_Brighton_and_Hove","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Former_Brighton_Hippodrome%2C_Middle_Street%2C_Brighton_%28IoE_Code_482157%29.jpg","page_title":"Buildings and architecture of Brighton and Hove","context_page_description":"Brighton and Hove, a city on the English Channel coast in southeast England, has a large and diverse stock of buildings \\"unrivalled architecturally\\" among the country's seaside resorts. The urban area, designated a city in 2000, is made up of the formerly separate towns of Brighton and Hove, nearby villages such as Portslade, Patcham and Rottingdean, and 20th-century estates such as Moulsecoomb and Mile Oak. The conurbation was first united in 1997 as a unitary authority and has a population of about 253,000. About half of the 20,430-acre geographical area is classed as built up.\\nBrighton's transformation from medieval fishing village into spa town and pleasure resort, patronised by royalty and fashionable high society, coincided with the development of Regency architecture and the careers of three architects whose work came to characterise the 4-mile seafront."},{"page_url":"https://it.wikipedia.org/wiki/Storia_di_Dorgali","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Ruderi_Canonicato_di_San_Pietro%2C_Girifai%2C_Dorgali_%28NU%29.jpg","page_title":"Storia di Dorgali","context_page_description":"La storia di Dorgali riguarda le vicende del paese di Dorgali, in Sardegna, dalla sua fondazione sino ad oggi."},{"page_url":"https://cs.wikipedia.org/wiki/Lucie_%C5%A0af%C3%A1%C5%99ov%C3%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/LucieSafarovaRG2009.JPG","page_title":"Lucie Šafářová","context_page_description":"Lucie Šafářová je bývalá česká tenistka hrající levou rukou, která se na profesionálních okruzích pohybovala v letech 2001–2019. Na Grand Slamu vybojovala pět deblových trofejí s Američankou Mattekovou-Sandsovou a finále dvouhry si zahrála na French Open 2015. Z Letních olympijských her 2016 v Riu de Janeiru si po boku Strýcové odvezla bronz z deblové soutěže. V srpnu 2017 se na šest týdnů stala světovou jedničkou ve čtyřhře, čtvrtou českou a třicátou pátou od zavedení klasifikace v roce 1984. S českým týmem pětkrát triumfovala ve Fed Cupu. Kariéru ukončila květnovou čtyřhrou na French Open 2019.\\nDo sezóny 2005 se pohybovala pouze na okruhu ITF, kde získala sedm singlových a jeden deblový titul. Na okruh WTA Tour vstoupila lednovým ASB Classic 2005 a průlom do první světové stovky zaznamenala v červnu téhož roku. Celkově na něm vyhrála patnáct turnajů ve čtyřhře a sedm ve dvouhře včetně Qatar Total Open 2015 z kategorie Premier.\\nNa grandslamu zvítězila s Bethanií Mattekovou-Sandsovou ve všech pěti deblových finále, když dvakrát ovládly Australian Open i French Open a jednou US Open. Jako sedmý pár otevřené éry vyhrály dva úvodní majory v jediné sezóně, a to dvakrát."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%8A%B9%E5%A4%AA%E4%BC%9A%E5%A0%82%E7%BA%AA%E5%BF%B5%E7%A2%91","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Synagoge_N%C3%BCrnberg.jpg","page_title":"犹太会堂纪念碑","context_page_description":"猶太會堂紀念碑位於紐倫堡市中心的醫院橋，紀念昔日的漢斯-薩克斯廣場猶太會堂。這座猶太教改革派會堂於1874年9月8日開放，由建築師阿道夫·沃爾夫設計，是該市主要的猶太會堂。1938年8月10日, 還在11月的水晶之夜之前, 在尤利烏斯·施特萊徹的指示下，它和市政廳一起被拆除，因為它「擾亂了美麗的德國城市景觀。」。\\n猶太會堂紀念碑的左邊是一塊紀念利奧·卡贊伯格被謀殺的牌。"},{"page_url":"https://en.wikipedia.org/wiki/Albany_Bulb","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Lead_Photo_For_Special-DonateImage0-2856860763859004.JPG","page_title":"Albany Bulb","context_page_description":"The Albany Bulb is a former landfill largely owned by the City of Albany, in California. The Bulb is the west end of a landfill peninsula jutting west from the east shore of San Francisco Bay. The term \\"Bulb\\" is often used to refer to the entire peninsula, which includes the Albany Plateau, north of Buchanan Street at its base; the high narrow \\"Neck,\\" and the round \\"Bulb.\\" The Bulb is part of the City of Albany, and can be reached via Buchanan Street or the Bay Trail along the east side of San Francisco Bay."},{"page_url":"https://en.wikipedia.org/wiki/12th_World_Festival_of_Youth_and_Students","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Fmje-12.jpg","page_title":"12th World Festival of Youth and Students","context_page_description":"The 12th World Festival of Youth and Students was a festival held in Moscow from July 27 to August 3, 1985. The festival was attended by 26,000 people from 157 countries. The slogan of the festival was \\"For anti-imperialist solidarity, peace and friendship\\"."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%85%D9%84%D9%83_%D8%A5%D8%AF%D8%B1%D9%8A%D8%B3_%D8%B9%D8%A7%D9%87%D9%84_%D9%84%D9%8A%D8%A8%D9%8A%D8%A7_%D8%AD%D9%8A%D8%A7%D8%AA%D9%87_%D9%88%D8%B9%D8%B5%D8%B1%D9%87_(%D9%83%D8%AA%D8%A7%D8%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/King_Idris_Book_cover.jpg","page_title":"الملك إدريس عاهل ليبيا حياته وعصره (كتاب)","context_page_description":"الملك ادريس عاهل ليبيا حياته وعصره يعد هذا الكتاب من أهم المصادر عن حياة الملك محمد ادريس السنوسي، نقل عنه جميع من تناول سيرة الملك ادريس منذ صدوره سنة 1989، كونه الكتاب الوحيد الذي رافق مؤلفه \\"إريك آرمر فوللي دي كاندول\\" الملك ادريس في مراحل هامة من حياته السياسية منذ أن كان يشغل منصب المقيم المفوض لحكومة صاحبة الجلالة البريطانية في برقة {{وإو|عر=List_of_colonial_governors_of_Cyrenaica]|تر=List_of_colonial_governors_of_Cyrenaica]|لغ=en|نص=أثناء فترة الإدارة العسكرية البريطانية للإقليم عقب انتهاء [[الحرب العالمية الثانية}}]] بانتصار قوات الحلفاء وطرد إيطاليا عن البلاد، ثم خلال مرحلة المساعي السياسية والدبلوماسية لنيل الاستقلال الذي أنجز في 24 ديسمبر 1951. وبعد ذلك طوال فترة حكم الملك ادريس حتى أطيح به بالانقلاب العسكري الذي قاده الملازم أول معمر القذافي في 1 سبتمبر 1969. وقد استمرت الصداقة المتينة بين الرجلين حتى وفاة الملك ادريس في 25 مايو 1983. فصار هذا الكتاب بمثابة ترجمة لحياة الملك في كثير من أجزاءه جعلت منه مصدرا أولياً للمعلومات عن حياة الملك الخاصة والعامة على مدى أكثر من 4 عقود تنقل فيها من كونه أميراً لبرقة إلى ملك المملكة الليبية المتحدة ثم إلى لاجئ في مصر."},{"page_url":"https://ro.wikipedia.org/wiki/Mitologie_slav%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Chislobog_by_Andrey_Shishkin.jpg","page_title":"Mitologie slavă","context_page_description":"Mitologia slavă reprezintă ansamblul credințelor, miturilor și practicilor culturale ale slavilor din perioada pre-creștină a acestora. Acest ansamblu se caracterizează printr-un sistem religios politeist cu anumite nuanțe panteiste. Nu prea s-au conservat izvoare istorice referitoare la religia slavilor din perioada pre-creștină a acestora. Prin urmare, sursele care furnizează informații despre acest subiect vin de la cronicarii și autorii creștini care au trăit în epoca ce a urmat după creștinarea slavilor. Astfel, în aceste condiții, reconstituirea panteonului slav pre-creștin este greu de realizat. Cel mai adesea, demersurile făcute în direcția cercetării acestui domeniu eșuează din cauza faptului că metodele folosite sunt puse la îndoială. În această situație, rămâne valabilă cercetarea tradițiilor vechi păstrate în folclor și a obiceiurilor populare, dar și analiza atentă a teoriei religiei."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%BE%E0%A6%82%E0%A6%B2%E0%A6%BE%E0%A6%A6%E0%A7%87%E0%A6%B6%E0%A7%87%E0%A6%B0_%E0%A6%AA%E0%A6%BE%E0%A6%96%E0%A6%BF%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Loriculus_vernalis_-Ganeshgudi%2C_Karnataka%2C_India_-male-8-1c.jpg","page_title":"বাংলাদেশের পাখির তালিকা","context_page_description":"বাংলাদেশের পাখির তালিকায় মোট ৭৪৪টি পাখি অন্তর্ভুক্ত করা হয়েছে। এ সমস্ত পাখির মধ্যে গত দুই শতকে বাংলাদেশে ছিল এবং বর্তমানে আছে এমন পাখিও অন্তর্ভুক্ত। এমন পাখির সংখ্যা মোট ৬৫০টি। এ ৬৫০টি পাখির মধ্যে ৩০টি বাংলাদেশে বর্তমানে বিলুপ্ত, অতীতে বাংলাদেশে ছিল। ৩০টি পাখির মধ্যে ২৯টি অন্য দেশে পাওয়া গেলেও একটি- গোলাপীশির হাঁস, সম্ভবত সারা পৃথিবীতেই বিলুপ্ত। অবশিষ্ট ৬২০টি প্রজাতির পাখি সাম্প্রতিককালে এদেশে দেখা গেছে এবং এরা বাংলাদেশে থাকে বা আসে বলে নিশ্চিত হওয়া গেছে। এই ৬২০টি প্রজাতির মধ্যে ১৪৩টি প্রজাতির পাখি বাংলাদেশে 'অনিয়মিত' আখ্যায়িত হয়েছে, কারণ কালেভদ্রে এদের দেখা যায়। বাকি ৪৭৭ প্রজাতির পাখি বাংলাদেশে নিয়মিত দেখা যায়। এই ৪৭৭ প্রজাতির মধ্যে ৩০১টি বাংলাদেশের 'আবাসিক' পাখি যেগুলো স্থায়ীভাবে এ দেশে বাস করে। বাকি ১৭৬টি বাংলাদেশের 'পরিযায়ী' পাখি যেগুলো খণ্ডকালের জন্য নিয়মিতভাবে এ দেশে থাকে। এই ১৭৬ প্রজাতির নিয়মিত আগন্তুকের মধ্যে ১৬০টি শীতে এবং ৬টি গ্রীষ্মে বাংলাদেশে থাকে; বাকি ১০টি বসন্তে এদেশে থাকে যাদেরকে 'পান্থ-পরিযায়ী' নামে আখ্যায়িত করা হয়েছে।\\n৭৪৪টি পাখির মধ্যে বাকি রইল ১৯৪টি পাখি। বিভিন্ন সময়ে বিভিন্ন লেখক বাংলাদেশে এ সব পাখির অস্তিত্ব থাকতে পারে বললে অনুমান করেছেন, কিন্তু কোন অকাট্য প্রমাণ দেখাতে পারেননি বা পরবর্তীতে এদেরকে এ অঞ্চলে কখনো দেখা যায় নি।"},{"page_url":"https://fi.wikipedia.org/wiki/Kari_Arkivuo","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Kari_Arkivuo_cropped.jpg","page_title":"Kari Arkivuo","context_page_description":"Kari Arkivuo suomalainen jalkapalloilija, joka edustaa Veikkausliigassa pelaavaa FC Lahtea ja Suomen A-maajoukkuetta. Hän on pelipaikaltaan vasen laitapuolustaja, mutta kykenee pelaamaan myös oikealla."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D8%B5%D9%88%D9%81%DB%8C%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/D-ALEA_Boeing_757_DHL_%2814601000619%29.jpg","page_title":"فرودگاه صوفیه","context_page_description":"فرودگاه صوفیه یک فرودگاه همگانی مسافربری با کد یاتا SOF است که یک باند فرود آسفالت دارد و طول باند آن ۳۶۰۰ متر است. این فرودگاه در شهر صوفیه کشور بلغارستان قرار دارد و در ارتفاع ۵۳۱ متری از سطح دریا واقع شده‌است."},{"page_url":"https://fi.wikipedia.org/wiki/Evanston","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Northwestern_University_Evanston_campus.jpg","page_title":"Evanston","context_page_description":"Evanston on Chicagon pohjoinen esikaupunki Yhdysvaltojen Illinois’n osavaltion Cookin piirikunnassa, noin 19 kilometriä Chicagon keskustasta pohjoiseen. Se on yksi North Shoreksi kutsutun, Michiganjärven rannalla sijaitsevan esikaupunkivyöhykkeen kaupungeista. Vuoden 2010 väestölaskennassa Evanstonissa oli 74 486 asukasta.\\nMichiganjärven lisäksi Evanston rajoittuu etelässä Chicagoon, lännessä Skokieen ja pohjoisessa Wilmetteen."},{"page_url":"https://it.wikipedia.org/wiki/Montelabbate","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Panorama_di_Montelabbate.jpg","page_title":"Montelabbate","context_page_description":"Montelabbate è un comune italiano di 6 951 abitanti della provincia di Pesaro e Urbino."},{"page_url":"https://pl.wikipedia.org/wiki/Autostrada_A10_(Belgia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/A_10_-_R_4_Ringweg_Gent.jpg","page_title":"Autostrada A10 (Belgia)","context_page_description":"Autostrada A10 – autostrada w Belgii w ciągu trasy europejskiej E40.\\nAutostrada łączy Brukselę z Gandawą, Brugią i portem w Ostendzie. Jest główną drogą umożliwiającą dojazd ze stolicy Belgii nad Morze Północne, dzięki czemu pełni ważną rolę turystyczną."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_slott_och_herrg%C3%A5rdar_i_Uppland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Antuna_g%C3%A5rd_2009.jpg","page_title":"Lista över slott och herrgårdar i Uppland","context_page_description":"Lista över slott och herrgårdar i Uppland.\\nListan visar ett urval av de viktigaste slott och herrgårdarna och redovisar även numera försvunna egendomar. Listan bygger huvudsakligen på Historiskt-geografiskt och statistiskt lexikon öfver Sverige i 7 band, Stockholm 1856-1870 och Carl Martin Rosenbergs Geografiskt-statistiskt handlexikon öfver Sverige, Stockholm 1882-1883 samt Slott och herresäten i Sverige, Allhems förlag, Malmö, 1966-1971."},{"page_url":"https://de.wikipedia.org/wiki/Das_Slawische_Epos","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Mucha_Skola_Ivancice.jpg","page_title":"Das Slawische Epos","context_page_description":"Das Slawische Epos, im Originaltitel Slovanská Epopej, ist ein Gemäldezyklus und das Hauptwerk des tschechischen Malers Alfons Mucha. Es zeigt die Geschichte der slawischen Völker und besteht aus 20 großformatigen Tempera-auf-Leinwand-Bildern, die in den Jahren 1911 bis 1928 entstanden."},{"page_url":"https://de.wikipedia.org/wiki/Kreide_(Gestein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Caspar_David_Friedrich%27s_Chalk_Cliffs_on_R%C3%BCgen.jpg","page_title":"Kreide (Gestein)","context_page_description":"Kreide ist die eher umgangssprachlich genutzte Bezeichnung für hauptsächlich in der Oberkreide entstandene, sehr feinkörnige, meist weiße oder hellgraue Kalksteine. Eine sehr weiche und hochporöse Variante dieser Kalksteine, die mit dem Messer geschnitten werden kann, wird Schreibkreide genannt."},{"page_url":"https://fr.wikipedia.org/wiki/Belb%C3%A8ze-de-Lauragais","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Belbezelau_font.JPG","page_title":"Belbèze-de-Lauragais","context_page_description":"Belbèze-de-Lauragais est une commune française située dans le département de la Haute-Garonne, en région Occitanie.\\nSes habitants sont appelés les Belbézois et les Belbézoises."},{"page_url":"https://nl.wikipedia.org/wiki/Sandwichplaat","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Scotia_Plate_map-en.png","page_title":"Sandwichplaat","context_page_description":"De Sandwichplaat is een zeer kleine tektonische plaat die uit oceanische korst bestaat. De Sandwichplaat bevindt zich tussen de Zuid-Amerikaanse Plaat en de Scotiaplaat in, ten zuidoosten van Zuid-Amerika, in de Scotiazee in de Zuidelijke Atlantische Oceaan. Het oppervlak van de plaat bedraagt ongeveer 170.000 km². Ze beweegt - relatief ten opzichte van de Afrikaanse Plaat - met een snelheid van ongeveer 47 mm per jaar naar het oosten. De Zuidelijke Sandwicheilanden liggen op de Sandwichplaat.\\nDe westelijke rand is een divergente plaatgrens in de vorm van een mid-oceanische rug met de naburige Scotiaplaat. In het oosten subduceert de Sandwichplaat onder de Zuid-Amerikaanse Plaat. Vermoed wordt dat de Sandwich- en Scotiaplaten ooit één geheel vormden en dat de spreidingsrug tussen beide ontstond uit backarc spreading in de regio achter de subductiezone."},{"page_url":"https://de.wikipedia.org/wiki/Musikjahr_1745","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Georg_Philipp_Telemann_by_Georg_Lichtensteger.jpg","page_title":"Musikjahr 1745","context_page_description":"Johann Sebastian Bach ist seit dem 30. Mai 1723 Thomaskantor und musikalischer Leiter der Thomaskirche in Leipzig. Von 1729 bis ins Jahr 1741, vielleicht sogar bis 1746, hat er außerdem die Leitung des 1701 von Georg Philipp Telemann gegründeten Collegium musicum inne. Die Konzerte finden ein- bis zweimal pro Woche im Zimmermannischen Caffee-Hauß oder im dazugehörigen Garten statt.\\nIn den 1740er Jahren zieht sich Bach – mit wenigen Ausnahmen – von Neukompositionen für die Kirche zurück. Neben Auftragsarbeiten für weltliche Anlässe konzentriert er sich ganz auf umfangreiche Werke für das Cembalo. Auch verschlechtert sich sein Augenlicht immer mehr."},{"page_url":"https://en.wikipedia.org/wiki/Missouri%27s_5th_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/JohnHublerStover.jpg","page_title":"Missouri's 5th congressional district","context_page_description":"Missouri's 5th congressional district has been represented in the United States House of Representatives by Democrat Emanuel Cleaver, the former Mayor of Kansas City, since 2005.\\nThe district primarily consists of the inner ring of the Kansas City metropolitan area, including nearly all of Kansas City south of the Missouri River. The district stretches east to Marshall."},{"page_url":"https://nl.wikipedia.org/wiki/Honda_Legend","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/2001_Honda_Legend_%28KA9_MY01%29_sedan_%282012-08-09%29_01.jpg","page_title":"Honda Legend","context_page_description":"De Honda Legend is een limousine in de hogere middenklasse van Honda, die in Noord-Amerika en Hong Kong tot 1996 als Acura Legend aangeboden werd en aldaar sindsdien Acura RL heet.\\nDe Legend kan gezien worden als de eerste aanval van een Japanse fabrikant op de gevestigde orde van Europese luxemerken. Enkele jaren later volgden auto's als de Lexus LS400, de Infiniti Q45 en Mitsubishi's Diamante en Sigma."},{"page_url":"https://sv.wikipedia.org/wiki/Lourquen","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Map_commune_FR_insee_code_40160.png","page_title":"Lourquen","context_page_description":"Lourquen är en kommun i departementet Landes i regionen Nouvelle-Aquitaine i sydvästra Frankrike. Kommunen ligger i kantonen Montfort-en-Chalosse som tillhör arrondissementet Dax. År 2009 hade Lourquen 218 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Lendenschurz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/AoM_loincloth_01.jpg","page_title":"Lendenschurz","context_page_description":"Der Lendenschurz ist ein Kleidungsstück, meist aus Leder oder Stoff gefertigt. Der Schurz stellt ein Basiskleidungsstück dar, welches weltweit in verschiedenen Formen Verbreitung fand, etwa als String, Dhoti oder Lungi.\\nDer Lendenschurz war z. B. das typische Kleidungsstück der Indianer Nordamerikas. Auch in Japan war der Lendenschurz, dort Fundoshi genannt, die typische Unterwäsche der Männer. Neuerdings werden Fundoshis in Japan auch für Frauen angeboten.\\nEin typischer Lendenschurz wird zwischen den Beinen und unter einem Gürtel durchgezogen, über den er dann frei hinunterhängt und so den Schambereich schützt und bedeckt. Andere Formen bestehen aus einem Teil, das von einem Gürtel über den Schambereich hängt. Eine weitere Form besteht in einem längeren Stoffstreifen, der um die Hüfte geschlungen und dann durch die Beine gezogen wird. Die beiden Enden hängen dann über die Genitalien und das Gesäß hinunter.\\nEin Lendenschurz kann neben dem Verbergen der Geschlechtsteile auch als Ausdruck einer Zugehörigkeit zu einer Gesellschafts-, Berufs- oder Altersgruppe dienen.\\nVereinzelt kommt der Lendenschurz auch als Kleidung für den Bottom im BDSM zum Einsatz."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B2%D8%B1%D8%A7%D9%81%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Giraffa_camelopardalis_Kruger_Park.JPG","page_title":"زرافه","context_page_description":"زرافه خوْردالیلار تیپینه عایید حئیوان نؤعو.\\nخوْردالیلار ۵۰۰ میلیون ایل بۇندان اوّل عمله گلیب. خوْردالیلارین قدیملیینه و مۆختلیفلیینه باخمایاراق اوْنلاری بیرلشدیرن عۆمومی‌لیک وار:\\n۱. اوْنلارین بدنی‌نین اساسینی بۆتؤو و یا بوغوم‌لو بئل سوْتونو تشکیل ائدیر. بۇنا اوْخ ایسکلت و یا خوْردا دا دئییلیر.\\n۲. بۇ سوْتونون اۆستون‌ده بوْرو فوْرمالی مرکزی اعصاب سیستمی یئرلشیر.\\n۳. بئل سوْتونونون آلتی ایله هضم بوْروسو اۇزانیر. بۇ بوْرونون اؤن طرفی آغیزلا، آرخا طرفی ایسه آنوس دلیی ایله قۇرتاریر. هضم بوْروسونون اؤن حیصّه سی اۇدلاق آدلانیر. اۇدلاغین یانلاریندا سیرا ایله دۆزولموش قلسمه یاریقلاری وار. بۇ سبب‌دن اۇدلاق هم قیدالانمادا، هم ده تنفوس‌ده ایشتیراک ائدیر.\\n۴. هضم بوْروسونون اۇدلاق حیصّه سینین آلتیندا قان-دامار سیستمینین مرکزی اوْلان اۆرک یئرلشیر، خوْردالیلار تیپی‌نین ۴۳ مینه یاخین نؤعو معلوم‌دور."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AA%E0%A6%B6%E0%A7%8D%E0%A6%9A%E0%A6%BF%E0%A6%AE%E0%A6%AC%E0%A6%99%E0%A7%8D%E0%A6%97%E0%A7%87%E0%A6%B0_%E0%A6%B6%E0%A6%B9%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/New_Digha_Beach_0221.JPG","page_title":"পশ্চিমবঙ্গের শহর","context_page_description":"পশ্চিমবঙ্গ ভারতের সর্বাধিক জনঘনত্ববিশিষ্ট রাজ্য। এই রাজ্যে অসংখ্য ছোটো ও মাঝারি আকারের শহর বিদ্যমান। অতীতে, পশ্চিমবঙ্গের অধিবাসীদের আয়ের প্রধান উৎস ছিল কৃষি। এই কারণে সেই সময় রাজ্যের গ্রামীণ জনসংখ্যা অধিক ছিল। যদিও বিংশ শতাব্দীতে পশ্চিমবঙ্গে শিল্পের গুরুত্ব বৃদ্ধি পায় এবং তার ফলে শহরাঞ্চলের জনসংখ্যাও উত্তরোত্তর বাড়তে থাকে।\\n১৯৪৭ সালে ভারত বিভাগের সময় ব্রিটিশ বাংলা প্রদেশটিও ধর্মের ভিত্তিতে দ্বিধাবিভক্ত হয়। মুসলমান-প্রধান পূর্ববঙ্গ পাকিস্তানে যোগ দেয় এবং হিন্দুপ্রধান পশ্চিমবঙ্গ যোগ দেয় ভারতে। এর পর পূর্ববঙ্গ থেকে লক্ষাধিক হিন্দু শরণার্থী পশ্চিমবঙ্গে চলে আসেন। এর ফলে একাধারে যেমন কলকাতা সহ শহরগুলির জনসংখ্যার চাপ বাড়তে থাকে তেমনই রাজ্যে সৃষ্টি হতে থাকে নতুন নতুন নগরাঞ্চল।"},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%B3th_Erzs%C3%A9bet_(k%C3%B6lt%C5%91)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/T%C3%B3th_Erzs%C3%A9bet_1979.jpg","page_title":"Tóth Erzsébet (költő)","context_page_description":"Tóth Erzsébet József Attila-díjas magyar költőnő. A Magyar Művészeti Akadémia levelező tagja."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%B9%BF%E4%B9%89%E7%9B%B8%E5%AF%B9%E8%AE%BA%E7%9A%84%E5%AE%9E%E9%AA%8C%E9%AA%8C%E8%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Cassini-science-br.jpg","page_title":"广义相对论的实验验证","context_page_description":"1915年广义相对论最初被发表之时，并没有得到稳固的实验证据支持，已知道的是它正确地解释了水星近日点的反常进动，并且在哲学层面，它令人满意地结合了艾萨克·牛顿的万有引力定律和阿尔伯特·爱因斯坦的狭义相对论。1919年，光波在引力场中的轨迹被发现似乎会弯曲，正如广义相对论所预测；但一直要等到1959年，一系列精确度实验才开始进行，从而准确地检验了许多广义相对论在弱引力场极限中的预测，并大大降低了理论于现实偏差的可能性。1974年起，拉塞尔·赫尔斯、约瑟夫·泰勒等人研究脉冲双星的物理行为，其所受到的引力比在太阳系之中要大得多。无论是太阳系中的弱引力场极限，或是脉冲星系统中更强的引力场，广义相对论的预测已有相当优良的实验证据。"},{"page_url":"https://ca.wikipedia.org/wiki/Xotis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Madrid_-_Fiestas_de_San_Isidro_-_chulapos_-_20070515-06.jpg","page_title":"Xotis","context_page_description":"El xotis és un ball de parella d'origen bohemi de ritme binari i de moviment moderat; amb un pretès origen escocès es volgué veure'l com a transformació de l'antiga escocesa.\\nIntroduït a París l'any 1849 i ballat de diverses maneres, va mantindre la seua acceptació a nivell popular fins al començament del segle XX.\\nEl 1920 formà part del programa de competició dels Campionats Mundials de Ball, i se'l considera en l'origen del maxixe i del txa-txa-txa.\\nLa seva influència a Madrid, on es ballava en molt poc espai pels pinxos de la vila, ha fet que, sovint, tothom el consideri típic d'aquella ciutat espanyola."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B0%E0%B8%9A%E0%B8%9A%E0%B8%82%E0%B8%99%E0%B8%AA%E0%B9%88%E0%B8%87%E0%B8%97%E0%B8%B2%E0%B8%87%E0%B8%A3%E0%B8%B2%E0%B8%87%E0%B8%82%E0%B8%99%E0%B8%B2%E0%B8%94%E0%B8%81%E0%B8%A5%E0%B8%B2%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/%EC%9D%98%EC%A0%95%EB%B6%80%EA%B2%BD%EC%A0%84%EC%B2%A0.JPG","page_title":"ระบบขนส่งทางรางขนาดกลาง","context_page_description":"ในการขนส่งระบบราง คำว่า ระบบขนส่งทางรางขนาดกลาง เป็นศัพท์ไม่สากล ที่ใช้แยกความแตกต่าง โดยใช้เป็นตัวกลางระหว่างรถไฟฟ้าใต้ดินและรถไฟฟ้ารางเบา โดยมีลักษณะคล้าย ไลท์เมโทร ที่พบในประเทศแถบยุโรป"},{"page_url":"https://es.wikipedia.org/wiki/Vincenzo_Maltempo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Vincenzo_Maltempo.jpg","page_title":"Vincenzo Maltempo","context_page_description":"Vincenzo Maltempo es un pianista italiano. Se especializa en la interpretación de obras de Charles Valentin Alkan, Franz Liszt y otros compositores románticos y contemporáneos."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Giacomo_Apostolo_(Gaeta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Gaeta%2C_chiesa_di_San_Giacomo_-_Acquasantiera_con_i_simboli_di_Santa_Caterina_d%27Alessandria.jpg","page_title":"Chiesa di San Giacomo Apostolo (Gaeta)","context_page_description":"La chiesa di san Giacomo Apostolo, originariamente di San Giacomo di Terra Rossa, è un luogo di culto cattolico di Gaeta situato nel quartiere di Porto Salvo, lungo via della Indipendenza; è sede dell'omonima parrocchia, retta dal clero diocesano dell'arcidiocesi di Gaeta, e della locale fraternità dell'Ordine francescano secolare."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%DB%8C%D8%B3%D8%A7%D9%85%D8%B3_%D8%B4%D8%B1%D9%82%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Ph_seal_misamis_oriental.2.png","page_title":"میسامس شرقی","context_page_description":"میسامس شرقی فلپائن کا ایک فلپائن کے صوبے جو شمالی مینداناؤ میں واقع ہے۔"},{"page_url":"https://es.wikipedia.org/wiki/Arte_rom%C3%A1nico_en_Inglaterra","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/VA23Oct10_116-crop.jpg","page_title":"Arte románico en Inglaterra","context_page_description":"El arte anglonormando, a veces conocido como arte románico en Inglaterra, es la denominación historiográfica con la que se designa la producción artística —fundamentalmente arquitectónica y que se corresponde con el arte románico en el resto del continente— que se dio en la Inglaterra medieval, desde la década de los años 1040 —en especial tras la conquista normanda de 1066— y hasta el advenimiento de la arquitectura gótica, alrededor de 1180.​ Tras la destrucción en 1174 en un incendio de la catedral de Canterbury, los arquitectos normandos introdujeron la nueva arquitectura gótica. Hacia 1191, la catedral de Wells y la catedral de Lincoln impusieron el modelo gótico inglés, con lo que el estilo normando pasó a quedar cada vez más reservado a las construcciones provincianas de escasa envergadura.\\nEl románico ya había llegado al país de la mano del rey Eduardo el Confesor, que había sido educado en Normandía, donde estuvo exiliado, y que hizo llegar maestros albañiles desde el continente en 1042 para trabajar en la abadía de Westminster, primer edificio de estilo románico en el país consagrado en 1065."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B6%E0%A7%8D%E0%A6%B0%E0%A7%87%E0%A6%B7%E0%A7%8D%E0%A6%A0_%E0%A6%85%E0%A6%AD%E0%A6%BF%E0%A6%A8%E0%A7%87%E0%A6%A4%E0%A6%BE_%E0%A6%AC%E0%A6%BF%E0%A6%AD%E0%A6%BE%E0%A6%97%E0%A7%87_%E0%A6%8F%E0%A6%95%E0%A6%BE%E0%A6%A1%E0%A7%87%E0%A6%AE%E0%A6%BF_%E0%A6%AA%E0%A7%81%E0%A6%B0%E0%A6%B8%E0%A7%8D%E0%A6%95%E0%A6%BE%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Gregory_Peck_1948.jpg","page_title":"শ্রেষ্ঠ অভিনেতা বিভাগে একাডেমি পুরস্কার","context_page_description":"শ্রেষ্ঠ অভিনেতা বিভাগে একাডেমি পুরস্কার হচ্ছে যুক্তরাষ্ট্রের একাডেমি অব মোশন পিকচার আর্টস অ্যান্ড সায়েন্সেস কর্তৃক প্রদানকৃত একটি বার্ষিক পুরস্কার। একজন অভিনেতার মুখ্য চরিত্রে অসাধারণ অভিনয়শৈলীর জন্য এ পুরস্কার প্রদান করা হয়। প্রথাগতভাবে পূর্বের বছরের শ্রেষ্ঠ অভিনেত্রী বিভাগে একাডেমি পুরস্কার বিজয়ী এই পুরস্কার প্রদান করে থাকেন।\\nএমিল জ্যানিংস এই পুরস্কারের প্রথম বিজয়ী, যিনি ১৯২৯ সালে ১ম একাডেমি পুরস্কার অনুষ্ঠানে তার অভিনীত দ্য লাস্ট কমান্ড এবং দ্য ওয়ে অব অল ফ্লেশ চলচ্চিত্রে অনবদ্য অভিনয়ের জন্য এই বিভাগে পুরস্কার লাভ করেন। একাডেমি পুরস্কার প্রদানের প্রথম তিন বছর এই বিভাগে সেরা অভিনেতাগণ মনোনয়ন লাভ করতেন। সে সময়ে তাদের সকল কাজ পুরস্কার প্রদানের পর তালিকাভুক্ত করা হত। তবে ৩য় আয়োজনের পর থেকে বিজয়ীকে চূড়ান্ত পুরস্কার প্রদানের পর একটি মাত্র চলচ্চিত্রের উল্লেখ করা হত, এমনকি প্রত্যেক বিজয়ীর ব্যালটে তার নামের পাশে দুটি করে চলচ্চিত্রের উল্লেখ থাকত। পরের বছর থেকে এই পদ্ধতি বাদ দিয়ে এএমপিএএসের অভিনয়শিল্পীদের শাখার একক হস্তান্তরযোগ্য ভোটের মাধ্যমে মনোনীতদের নির্বাচিত করা শুরু হয়। একাডেমির সমগ্র যোগ্য ভোটদাতা সদস্যগণের ভোটের আধিক্য অনুসারে বিজয়ী নির্বাচিত হয়। বর্তমান পদ্ধতি অনুযায়ী একজন অভিনেতা একটি চলচ্চিত্রের জন্যই মনোনয়ন পেয়ে থাকেন।"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%AB%D5%A4%D5%A5%D6%80%D5%AC%D5%A1%D5%B6%D5%A4%D5%B6%D5%A5%D6%80%D5%AB_%D5%A1%D5%A6%D5%A3%D5%A1%D5%B5%D5%AB%D5%B6_%D5%A3%D6%80%D5%A1%D5%A4%D5%A1%D6%80%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/GLAM_Wiki_2015_NL%2C_0001_%2821%29.jpg","page_title":"Նիդերլանդների ազգային գրադարան","context_page_description":"Նիդերլանդների ազգային գրադարան, գտնվում է Հաագայում, հիմնադրվել է 1798 թվականին։ Նիդերլանդների ազգային գրադարանի առաքելությունն է ապահովել գիտելիքի և մշակույթի հասանելությունը՝ ապահովելով բարձրորակ ծառայություն հետազոտության և մշակութային փորձի ձեռքբերման համար։"},{"page_url":"https://pl.wikipedia.org/wiki/R%C3%B3w_Natoli%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/RowNatolinski3.jpg","page_title":"Rów Natoliński","context_page_description":"Rów Natoliński – rów wodny w Warszawie, w dzielnicy Wilanów."},{"page_url":"https://fr.wikipedia.org/wiki/Ceratocystis_fimbriata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Sweet_potato_ceratocystis.jpg","page_title":"Ceratocystis fimbriata","context_page_description":"Ceratocystis fimbriata est une espèce, ou plus vraisemblablement un complexe d'espèces, de champignons ascomycètes de la famille des Ceratocystidaceae.\\nC'est un champignon phytopathogène, attaquant des plantes très variées, qui vont du cacaoyer à la patate douce."},{"page_url":"https://de.wikipedia.org/wiki/Albrecht_Daniel_Thaer","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Im_G%C3%BCldenen_Winkel_Celle_%283x2%29.jpg","page_title":"Albrecht Daniel Thaer","context_page_description":"Albrecht Daniel Thaer [tɛːɐ̯] war Polywissenschaftler und gilt als Begründer der Agrarwissenschaften."},{"page_url":"https://sv.wikipedia.org/wiki/Maria_Miloslavskaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/KiyskiyKrest_detail01.jpg","page_title":"Maria Miloslavskaja","context_page_description":"Maria Iljinitjna Miloslavskaja född 1625, död 1669, var en rysk kejsarinna, gift med tsar Aleksej Michajlovitj och mor till Fjodor III, Ivan V och Sofia Aleksejevna."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1991","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Mario_bilate-1470841626.jpg","page_title":"Lijst van personen geboren in 1991","context_page_description":"Dit is een lijst van personen die geboren zijn in 1991.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://no.wikipedia.org/wiki/Buemaskeedderkopp","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Tapinocyba_pallens_%2839995455162%29.jpg","page_title":"Buemaskeedderkopp","context_page_description":"Buemaskeedderkopp er en av edderkoppene i gruppen mattevevere og dvergedderkopper."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D9%BE%D9%88%D8%B1%DB%8C%DB%8C%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/%C5%98eporyje-u_viaduktu.jpg","page_title":"رپورییه","context_page_description":"رپورییه یک منطقهٔ مسکونی در جمهوری چک است که در پراگه ۵ واقع شده‌است. رپورییه ۲٬۱۲۸ نفر جمعیت دارد."},{"page_url":"https://is.wikipedia.org/wiki/Georg_6._Bretlandskonungur","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/King_George_VI_LOC_matpc.14736_%28cleaned%29.jpg","page_title":"Georg 6. Bretlandskonungur","context_page_description":"Georg 6. varð konungur breska heimsveldisins og keisari Indlands þann 11. desember 1936 og ríkti til dauðadags. Hann tók við völdum er eldri bróðir hans, Játvarður 8. afsalaði sér konungdómi til þess að geta gifst unnustu sinni, en hún var fráskilin. Georg var síðasti keisari Indlands og síðasti konungur Írlands til 1948, er Írland yfirgaf heimsveldið. Hann var þriðji breski konungurinn sem notaði nafnið Windsor, en faðir hans, Georg 5., tók það upp.\\nGeorg VI fæddist í York Cottage í Norfolk. Foreldrar hans voru Georg prins, hertogi af York og kona hans María hertogaynja af York. Föðurforeldrar hans voru Játvarður prins af Wales, síðar konungur, og kona hans Alexandra prinsessa af Danmörku og síðar drottning. Móðurforeldrar Georgs voru Francis prins og hertogi af Teck og María Adelaide prinsessa af Cambridge.\\nHann giftist 26. apríl 1923 og var kona hans Lafði Elísabet Bowes-Lyon. Hún taldist til almennings samkvæmt reglum hirðarinnar, þó svo að hún væri afkomandi bæði Róberts I Skotakonungs og Hinriks VII Englandskonungs, en við giftingu þeirra hlaut hún titilinn Her Royal Highness The Duchess of York."},{"page_url":"https://nl.wikipedia.org/wiki/Wit_naaldkwastje","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Ocnerostoma_friesei%2C_Hafod_Bonc%2C_North_Wales%2C_May_2013_%2820767173200%29.jpg","page_title":"Wit naaldkwastje","context_page_description":"Het wit naaldkwastje is een vlinder uit de familie van de stippelmotten. De spanwijdte van de vlinder bedraagt 8 tot 10 millimeter. De soort lijkt sprekend op het grijs naaldkwastje en wordt daarmee vaak verward. In het algemeen is microscopisch onderzoek aan de genitaliën nodig om te komen tot een zekere determinatie. Er is sprake van seksueel dimorfisme, de vrouwtjes hebben witte en de mannetjes vaalgrijze vleugels. Het vlindertje komt verspreid over Europa en Japan voor. De soort overwintert als rups."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E5%B0%94%E5%BC%97%E9%9B%B7%E5%A4%9A%C2%B7%E5%85%8B%E9%87%8C%E6%96%AF%E8%92%82%E4%BA%9A%E5%B0%BC%C2%B7%E5%B8%83%E5%B0%94%E5%8D%A1%E5%BE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Alfredo_Cristiani.jpg","page_title":"阿尔弗雷多·克里斯蒂亚尼·布尔卡德","context_page_description":"阿爾弗雷多·克里斯蒂亞尼·布爾卡德 從1989年到1994年之間擔任薩爾瓦多總統。"},{"page_url":"https://fr.wikipedia.org/wiki/Field-Map","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Medici%C3%B3n8.jpg","page_title":"Field-Map","context_page_description":"Field-Map est un nom de marque de l'Institut de recherche sur les écosystèmes forestiers. Il est utilisé pour un ensemble de produits logiciels et matériels pour la cartographie. Ces outils proposent une solution pour la cartographie des écosystèmes forestiers en temps réel et la collecte des données lors des examens sur le terrain. L'application travaille avec la base de données relationnelle multi-niveaux et est capable de communiquer avec des périphériques externes tels qu'un GPS, un télémètre laser et un inclinomètre."},{"page_url":"https://en.wikipedia.org/wiki/371st_Infantry_Regiment_(United_States)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Red_Hand_Division.jpg","page_title":"371st Infantry Regiment (United States)","context_page_description":"The 371st Infantry Regiment was a segregated African American regiment, nominally a part of the 93rd Division, that served in World War I under French Army command, and also in World War II in the Italian Campaign as part of the 92nd Infantry Division. In both wars the unit had primarily African American enlisted men and white officers."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%B8%D6%82%D5%A1%D5%B6%D5%AB_%D5%BF%D5%A1%D5%B3%D5%A1%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Claude_Monet_-_Cath%C3%A9drale_de_Rouen._Harmonie_bleue_et_or.jpg","page_title":"Ռուանի տաճար","context_page_description":"Ռուանի տաճար, կաթոլիկ տաճար Ռուան քաղաքում։ Ռուանի և Նորմանդիայի արքեպիսկոպոսության մայր տաճարն է։ Ֆրանսիայի ազգային ժառանգության հուշարձան է: 1876-1880 թվականներին եղել է աշխարհի ամենաբարձր կառույցը \` այդ տիտղոսը հետագայում զիջելով Քյոլնի տաճարին:"},{"page_url":"https://sv.wikipedia.org/wiki/Les_Bordes,_Loiret","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Map_commune_FR_insee_code_45042.png","page_title":"Les Bordes, Loiret","context_page_description":"Les Bordes är en kommun i departementet Loiret i regionen Centre-Val de Loire strax norr Frankrikes mitt. Kommunen ligger i kantonen Ouzouer-sur-Loire som tillhör arrondissementet Orléans. År 2009 hade Les Bordes 1 732 invånare."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Scottish_breeds","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Luing_Cattle.jpg","page_title":"List of Scottish breeds","context_page_description":"This is a list of domesticated animal breeds originating from Scotland. To be considered domesticated, a population of animals must have their behaviour, life cycle, or physiology systemically altered as a result of being under human control for many generations.\\nScotland has produced some of the longest established breeds of domesticated animals still in existence. There are 37 individual breeds of animals from Scotland still in existence and three extinct breeds. The Soay Sheep has prehistoric origins, and the Galloway breed of beef cattle dates back several hundred years. New breeds have also been developed more recently in Scotland, such as the Scottish Fold cat, which dates from 1961.\\nThe North Ronaldsay Sheep is a most unusual breed, subsisting largely on a diet of seaweed, and the Boreray is the UK's rarest sheep, having been listed as \\"Category 2: Endangered\\" by the Rare Breeds Survival Trust. Some breeds, such as the Shetland Pony and the Border Collie are well known throughout much of the Western world, whilst others such as the Scots Dumpy chicken are little-known, even at home. Fifteen breeds of dog have Scottish origins, including six terrier breeds."},{"page_url":"https://pl.wikipedia.org/wiki/Czo%C5%82gi_Wojska_Polskiego","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/7_TP_tank.PNG","page_title":"Czołgi Wojska Polskiego","context_page_description":"Czołgi Wojska Polskiego – czołgi znajdujące się na wyposażeniu Wojska Polskiego od roku 1919 do dnia dzisiejszego.\\nW liście ujęto czołgi będące na wyposażeniu Wojska Polskiego II RP, Wojska Polskiego we Francji, Polskich Sił Zbrojnych na Zachodzie, ludowego Wojska Polskiego oraz Sił Zbrojnych RP. Nie umieszczono natomiast prototypów czołgów opracowanych w Polsce, a także czołgów zdobycznych."},{"page_url":"https://en.wikipedia.org/wiki/Sid_McMath","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Outside_the_Gates_of_Governor%27s_Mansion_-_Little_Rock_-_Arkansas_-_USA.jpg","page_title":"Sid McMath","context_page_description":"Sidney Sanders McMath was a decorated U.S. Marine, attorney and the 34th governor of Arkansas who, in defiance of his state's political establishment, championed rapid rural electrification, massive highway and school construction, the building of the University of Arkansas for Medical Sciences, strict bank and utility regulation, repeal of the poll tax, open and honest elections and broad expansion of opportunity for black citizens in the decade following World War II.\\nMcMath remained loyal to President Harry S. Truman during the \\"Dixiecrat\\" rebellion of 1948, campaigning throughout the South for Truman's re-election. As a former governor, McMath led the opposition to segregationist Governor Orval Faubus following the 1957 Little Rock school crisis. He later became one of the nation's foremost trial lawyers, representing thousands of injured persons in precedent-setting cases and mentoring several generations of young attorneys. At the time of his death, he was the earliest-serving former governor."},{"page_url":"https://sh.wikipedia.org/wiki/Alta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Alta_rock_carvings_02.jpg","page_title":"Alta","context_page_description":"Alta je grad i istoimena općina; sedma po veličini u Norveškoj. Grad je smješten na krajnjoj sjevernoj obali Norveške, u administrativnoj regiji Finnmark, čije je upravno središte.\\nAlta je dobila ime po fjordu Altafjordenu, u čijem se zaljevu nalazi, na utoku rijeke Altaelva čiji je kanjon najveći u Skandinaviji.\\nPrapovijesni petroglifi Alte su upisani na UNESCO-v popis mjesta svjetske baštine u Europi 1985. godine."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%9C%E1%83%98%E1%83%99%E1%83%9D%E1%83%9A%E1%83%9D%E1%83%96_%E1%83%9B%E1%83%90%E1%83%A0%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Nikolai_Marr_1905.jpg","page_title":"ნიკოლოზ მარი","context_page_description":"ნიკოლოზ იაკობიშ სქი მარი, ნინეფიშმენცარი, ფილოლოგი, ბჟაეიოლიშმარჩქენჯი, არქეოლოგი, კულტურაშ ისტორიკოსი. რუსეთიშ მენცარობეფიშ აკადემიაშ თახმი მაკათური."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1866","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Prosper_de_barante.jpg","page_title":"Lijst van personen overleden in 1866","context_page_description":"Dit is een lijst van personen die overleden zijn in 1866.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Sniff_(Moomin_character)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Sniff%27s_family_portrait%2C_Moominworld.jpg","page_title":"Sniff (Moomin character)","context_page_description":"Sniff is a character in the Moomin stories created by Tove Jansson. His debut is in the first Moomin-book The Moomins and the Great Flood. In addition to books he is also a prominent character in the Moomin comics and animations."},{"page_url":"https://en.wikipedia.org/wiki/Christopher_Street_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Huk.jpg","page_title":"Christopher Street Day","context_page_description":"Christopher Street Day is an annual European LGBT celebration and demonstration held in various cities across Europe for the rights of LGBT people, and against discrimination and exclusion. It is Germany's and Switzerland's counterpart to Gay Pride or Pride Parades. Austria calls their Pride Parade Rainbow Parade. The most prominent CSD events are Berlin Pride, CSD Hamburg, CSD Cologne, Germany and Zürich in Switzerland."},{"page_url":"https://pt.wikipedia.org/wiki/Centro_Universit%C3%A1rio_Internacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Campus_Garcez_-_Uninter.jpg","page_title":"Centro Universitário Internacional","context_page_description":"O Centro Universitário Internacional é uma instituição de ensino superior do Grupo Uninter com sede em Curitiba. A instituição oferece cursos superiores de graduação e pós-graduação, nas modalidades presencial, semipresencial e a distância, além de cursos de extensão.\\nWilson Picler é o fundador e presidente do Grupo Uninter, e chanceler do Centro Universitário Internacional Uninter. O Professor Dr. Benhur Etelberto Gaio é o reitor."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Gablenz_(Oberlausitz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Gablenz%2C_Gefallenendenkmal_WK_I_%282%29.jpg","page_title":"Liste der Kulturdenkmale in Gablenz (Oberlausitz)","context_page_description":"In der Liste der Kulturdenkmale in Gablenz sind sämtliche Kulturdenkmale der sächsischen Gemeinde Gablenz verzeichnet, die bis September 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Görlitz."},{"page_url":"https://eu.wikipedia.org/wiki/Myiotheretes_fumigatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Smoky_Bush-tyrant.jpg","page_title":"Myiotheretes fumigatus","context_page_description":"Myiotheretes fumigatus Myiotheretes generoko animalia da. Hegaztien barruko Tyrannidae familian sailkatua dago."},{"page_url":"https://es.wikipedia.org/wiki/Andy_Roddick","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Andy_Roddick_2004.jpg","page_title":"Andy Roddick","context_page_description":"Andrew Stephen Roddick, más conocido como Andy Roddick, es un extenista profesional estadounidense, que llegó a ser número 1 del Ranking ATP en 2003, con tan sólo 21 años de edad, y además terminando la temporada en esa posición.\\nEs reconocido como uno de los mejores sacadores de la historia del tenis. De hecho, logró el servicio más rápido registrado en la historia del tenis profesional hasta ese momento, alcanzando los 249 km/h en la Copa Davis 2004, ​ aunque actualmente ocupa el sexto lugar. También terminó su carrera con un total de 9068 aces, siendo actualmente el cuarto tenista con más aces en la historia del tenis detrás de Ivo Karlovic, Goran Ivanisevic y Roger Federer, respectivamente. ​ En canchas duras terminó primero, con un total de 6429 aces.\\nGanó el Abierto de Estados Unidos 2003​ y fue finalista en otros 4 torneos de Grand Slam; en el Abierto de Estados Unidos 2006, ​ y en Wimbledon 2004, ​ 2005​ y 2009, ​ en las cuatro ocasiones siendo derrotado por Roger Federer. También fue campeón en 5 torneos de la serie Masters 1000 y finalista en otras cuatro ocasiones. Además ganó 4 torneos ATP 500 y 22 ATP 250."},{"page_url":"https://fr.wikipedia.org/wiki/Personnages_de_The_Walking_Dead","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Merritt_Wever_2010_cropped.jpg","page_title":"Personnages de The Walking Dead","context_page_description":"Cet article présente les personnages de fiction de la série télévisée américaine The Walking Dead."},{"page_url":"https://hu.wikipedia.org/wiki/Tuha%C5%88_(%C4%8Cesk%C3%A1_L%C3%ADpa-i_j%C3%A1r%C3%A1s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Tuha%C5%88_%28okres_%C4%8Cesk%C3%A1_L%C3%ADpa%29_znak.jpg","page_title":"Tuhaň (Česká Lípa-i járás)","context_page_description":"Tuhaň település Csehországban, Česká Lípa-i járásban. Tuhaň Úštěk, Snědovice, Blíževedly és Dubá településekkel határos. Lakosainak száma 269 fő."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_orgues_de_Champagne-Ardenne_class%C3%A9s_dans_la_base_Palissy_des_monuments_historiques","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Orgues_st-Loup_488.JPG","page_title":"Liste des orgues de Champagne-Ardenne classés dans la base Palissy des monuments historiques","context_page_description":"Cette liste prend en compte les orgues de Champagne-Ardenne classés uniquement, au titre objet ou immeuble, que ce soit pour leur buffet ou leur partie instrumentale et répertoriés dans la base Palissy des Monuments Historiques Français. La section Reprises recense les modifications les plus importantes. Dans certains cas le classement du buffet intègre également la tribune. À défaut de précision, le classement est réputé acquis au titre objet mais les initiales I.D. signifient au titre Immeuble par Destination et I. au titre Immeuble."},{"page_url":"https://ca.wikipedia.org/wiki/Jordi_Lafebre","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Jordi_Lafebre_october_2014.jpg","page_title":"Jordi Lafebre","context_page_description":"Jordi Lafebre és un dibuixant de còmics i il·lustrador català. Professor d'il·lustració i disseny gràfic a l'escola Joso. Fou alumne a l'escola de còmic Joso de Barcelona i a la facultat de Belles Arts de la Universitat de Barcelona. El 2001 comença l'inici professional, publicant il·lustracions i dibuixant còmics per a publicacions vinculades a Joso, publicacions eròtiques i treballs publicitaris.\\nDesprés de conèixer Zidrou, guionista belga establert a Espanya, comença a treballar per al mercat franc-belga, inicialment a la revista Spirou. Posteriorment inicia les col·laboracions amb Zidrou, primer en les obres col·lectives La vieille dame qui n'avait jamais Joué au tennis et autres nouvelles qui font du bé i Joyeuses nouvelles pour petits adultes et grands enfants, i posteriorment iniciant amb Lydie les seves obres conjuntes. El seu treball de còmic més recent és La Mondaine, també amb Zidrou.\\nAlterna la seva obra dins el món del còmic amb treballs d'il·lustració i de professor a l'escola Joso, i ha realitzat el cartell del Saló Internacional del Còmic de Barcelona 2015."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1992","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/John_Cage_%281988%29.jpg","page_title":"Lijst van personen overleden in 1992","context_page_description":"Dit is een lijst van personen die zijn overleden in 1992."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%9E%97%E8%AF%AD%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Ren_jianshi-19.JPG","page_title":"林语堂","context_page_description":"林语堂，中华民国文学家、发明家。福建漳州龙溪人，生于漳州市平和县坂仔镇，基督徒，乳名和乐，名玉堂，后改为语堂，圣约翰大学英文学士、美国哈佛大学比较文学硕士、德国莱比锡大学语言学博士，曾任北京大学英文系教授、厦门大学文学院院长、南洋大学首位校长。最后定居香港，任香港中文大学研究教授、联合国教科文组织美术与文学主任、国际笔会副会长等职，1940年和1950年两度获得诺贝尔文学奖的提名。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%82%A3%E3%83%A0%E3%83%BB%E3%82%AB%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Tim_Curry_01.jpg","page_title":"ティム・カリー","context_page_description":"ティム・カリーは、イングランドのウォリントン出身の俳優。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D9%84%D8%B3_(%D8%B4%D9%87%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Veles_panoram.JPG","page_title":"ولس (شهر)","context_page_description":"ولس (شهر) یک شهر در جمهوری مقدونیه است که در ولس مونیکیپلیتی واقع شده‌است."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A7%D8%B2%D8%A7%D8%AF%DB%8C_%D9%84%D9%88%DA%A9%D8%A7%DA%BA_%D9%86%D9%88%DA%BA_%D8%B1%D8%A7%DB%81_%D8%AF%D8%B3%D9%86_%D9%88%D8%A7%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Eug%C3%A8ne_Delacroix_-_La_libert%C3%A9_guidant_le_peuple.jpg","page_title":"ازادی لوکاں نوں راہ دسن والی","context_page_description":"ازادی لوکاں نوں راہ دسن والی فرانس دے پینٹر یوجین ڈیلاکراۓ دی اک مشہور پینٹنگ اے۔ اے جولائی 1830 دے انقلاب تے اے جیدے چ چارلس دسویں دے راج نوں انت کردتا گیا سی۔\\nایس پینٹنگ چ اک زنانی جیہڑی کہ ازادی دا نشان اے اودے اک ہتھ چ فرانس دا تن رنگا چنڈا اے تے دوجے ہتھ ج اک بندوق اے۔ اوہ لاشاں دے اتوں لنگدیاں ہویاں لوکاں نوں اگے لے کے جا رئی اے۔ اے نین سر تے فرائیگین ٹوپی لئی ہوئی اے جیہڑی ازادی دا نشان اے۔"},{"page_url":"https://simple.wikipedia.org/wiki/Jason_Elam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Jason_Elam_2009.jpg","page_title":"Jason Elam","context_page_description":"Jason Elam is a retired American football placekicker. He was drafted by the Denver Broncos in the third round of the 1993 NFL Draft. He played college football at Hawaii.\\nElam also played for the Atlanta Falcons. He was selected three-times for the Pro Bowl. With the Broncos, Elam won two Super Bowls. He is tied with Tom Dempsey, Sebastian Janikowski, and David Akers for the longest field goal in NFL history at 63 yards."},{"page_url":"https://vi.wikipedia.org/wiki/M%C4%83neciu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Manastirea_Suzana_-_comuna_Maneciu_Ungureni.JPG","page_title":"Măneciu","context_page_description":"Măneciu là một xã thuộc hạt Prahova, România. Dân số thời điểm năm 2002 là 11215 người."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D8%B1%D9%81%D8%A7%D8%B1%D9%8A%D9%86%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Phalaris_arundinacea_1.jpg","page_title":"خرفارينة","context_page_description":"الخرفارينة هي عمارة نباتية تتبع الفصيلة النجيلية من رتبة القبئيات."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A0%88%E7%94%B0%E8%BE%B0%E6%AC%A1%E9%83%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Tatsujiro_Suda%2C_5th_director_of_the_Fukuoka_Normal_School.jpg","page_title":"須田辰次郎","context_page_description":"須田 辰次郎は、明治期の教育者。師範学校校長を歴任。"},{"page_url":"https://de.wikipedia.org/wiki/82nd_Airborne_Division_(Vereinigte_Staaten)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/82nd_Airborne_troops_jump_from_C-141B_over_Honduras_1988.JPEG","page_title":"82nd Airborne Division (Vereinigte Staaten)","context_page_description":"Die 82nd Airborne Division, genannt All American oder America’s Guard of Honor, ist die erste Luftlandedivision der United States Army und mit etwa 14.000 Soldaten der größte Luftlandeverband der Welt.\\nDie seit dessen Aufstellung 1944 zum XVIII Airborne Corps gehörende Division ist seit 1942 in Fort Bragg, North Carolina, stationiert und hat den Auftrag, innerhalb von 18 Stunden nach Alarmierung an jedem Ort der Welt gefechtsbereit zu sein.\\nSie zeichnete sich im Zweiten Weltkrieg besonders bei der Landung in der Normandie, der Operation Market Garden, der Operation Varsity und der Schlacht in den Ardennen aus. Einheiten der Division kämpften im Vietnamkrieg und in der Karibik, sie waren 1991 an der Befreiung Kuwaits beteiligt, dienten im Kosovo und in Afghanistan und nahmen im Jahre 2003 an der Eroberung des Irak teil."},{"page_url":"https://sk.wikipedia.org/wiki/%C5%BDelezni%C4%8Dn%C3%A1_stanica_Medzilaborce","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/N%C3%A1dra%C5%BE%C3%AD_Medzilaborce.jpg","page_title":"Železničná stanica Medzilaborce","context_page_description":"Železničná stanica Medzilaborce je železničná stanica v Medzilaborciach. Leží na trati Michaľany – Łupków. Obsahuje 5 dopravných, 4 manipulačné, 5 odstavných a 1 ostatnú koľaj.\\nV stanici je k dispozícii osobná pokladňa s Komplexným vybavením cestujúcich. Pre ZSSK Cargo ide o pohraničnú priechodovú stanicu.\\nVo februári bol vyhlásený zámer označiť 55 železničných staníc názvami v menšinovom jazyku. Popri 54 maďarských názvoch bol jeden aj v rusínčine. Táto stanica bola Medzilaborce. Stanica tak bude jediná kde označenie bude v cyrilike. Nápis bol v priebehu mája 2017 osadený.\\nV roku 2017 ZSSK sezónne obnovila dopravu v úseku Medzilaborce - Łupków v termíne od 1. júla do 3. septembra 2 pármi vlakov premávajúcimi v sobotu a v nedeľu. Poľské súpravy premávajú s poľským personálom z miest Sanok a Rzeszów."},{"page_url":"https://ca.wikipedia.org/wiki/Qu%C3%A8_li_passa_a_Helen%3F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/What%27s_the_Matter_With_Helen_Shelley_Winters_1971.jpg","page_title":"Què li passa a Helen?","context_page_description":"Què li passa a Helen? és una pel·lícula estatunidenca dirigida per Curtis Harrington el 1971. Ha estat doblada al català."},{"page_url":"https://hu.wikipedia.org/wiki/Z%C3%A1ra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Zadar_PortaTerraferma.jpg","page_title":"Zára","context_page_description":"Zára város Horvátországban, Dalmácia fővárosa."},{"page_url":"https://sv.wikipedia.org/wiki/Bivr%C3%A5k","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Bondr%C3%A9e_apivore_MHNT.jpg","page_title":"Bivråk","context_page_description":"Bivråk är en rovfågel som trots sitt namn inte är nära besläktad med vråkarna. Den är en långflyttare som häckar i Europa och delar av Asien och övervintrar i tropiska Afrika. Bivråken lever främst av larver och puppor av bin och getingar, och av fullt utvecklade getingar och termiter. Den minskar i antal globalt, men beståndet anses ändå vara livskraftigt."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_d%27Amiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%C3%89glise_Saint-Leu%2C_Amiens-3477.jpg","page_title":"Histoire d'Amiens","context_page_description":"L'Histoire d'Amiens commence au Paléolithique selon les vestiges archéologiques mis au jour depuis le XIXᵉ siècle qui démontrent que, le site de double confluence où s'est construit Amiens était occupé par l'homme, il y a 500 000 ans. Mais c'est Jules César qui nomma pour la première fois le lieu dans La Guerre des Gaules. Au Iᵉʳ siècle, les Romains fondèrent la ville de Samarobriva qui devint Amiens au IVᵉ siècle. La ville se développa au Moyen Âge et à l'époque moderne grâce à son activité textile. L'arrivée du chemin de fer au XIXᵉ siècle raffermit sa position de ville du textile. La Seconde Guerre mondiale devait la mutiler sévèrement. La reconstruction des années 1950 permit un accroissement et une diversification de ses activités."},{"page_url":"https://en.wikipedia.org/wiki/Richard_Knight_(1659%E2%80%931745)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/LeaCastleWolverley.jpg","page_title":"Richard Knight (1659–1745)","context_page_description":"Richard Knight, of Downton Hall, in the parish of Downton on the Rock in Herefordshire, England, was a wealthy ironmaster who operated the Bringewood Ironworks, on the Downton estate, and founded a large fortune and family dynasty."},{"page_url":"https://hu.wikipedia.org/wiki/Orsz%C3%A1gos_j%C3%A9gk%C3%A1rm%C3%A9rs%C3%A9kl%C5%91_rendszer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Hagelkanone.JPG","page_title":"Országos jégkármérséklő rendszer","context_page_description":"Az Országos jégkármérséklő rendszer egy Magyarországon működő időjárás befolyásoló rendszer, amelyet a mezőgazdasági területeken okozott jégkárok csökkentésére hoztak létre hazai, illetve uniós forrásból. A rendszer teljes kapacitással 2018. május elseje óta üzemel. A rendszer minden évben május elseje és szeptember 30-a között üzemel, de a működtetés időszakának meghosszabbításáról már tárgyalnak."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B4%D1%80%D0%B5-%D0%B4%D0%B5-%D0%94%D1%8C%D0%BE%D1%81_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Madredediosrivermap.png","page_title":"Мадре-де-Дьос (река)","context_page_description":"Ма́дре-де-Дьос — река в Перу и Боливии, в бассейне Амазонки.\\nРека имеет длину около 640 километров. Беря начало в перуанских Андах, затем на территории Боливии впадает слева в реку Бени в бассейне Мадейры, которая, в свою очередь, впадает в Амазонку.\\nМадре-де-Дьос является важной водной артерией в верховьях Амазонки, на реке расположен портовый город Пуэрто-Мальдонадо, вниз от которого начинается судоходство. В долине реки широко развито сельское хозяйство, основной культурой для выращивания является манго. Также в долине реки развита промышленность, ведётся добыча золота и заготовка леса. Сельское хозяйство, а также промышленность создают большую проблему для экологии региона.\\nНа реке расположено несколько национальных парков и природоохранных зон."},{"page_url":"https://en.wikipedia.org/wiki/Slavkovsk%C3%BD_les","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Chodov%C3%A1_Plan%C3%A1%2C_Czech_Republic_-_panoramio_%2821%29.jpg","page_title":"Slavkovský les","context_page_description":"Slavkovský les, also called the Emperor's Forest, is a mountain range in the Czech Republic in the triangle formed by the towns of Karlovy Vary, Mariánské Lázně and Františkovy Lázně.\\nSlavkovský Les is a huge water source with direct importance for a large surrounding area, with many notable springs. Some of the water from Slavkovský Les is used in spas in the western parts of the country."},{"page_url":"https://cs.wikipedia.org/wiki/Mensdorff-Pouilly","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/De_Pouilly_-_Cimeti%C3%A8re_de_Cornay.JPG","page_title":"Mensdorff-Pouilly","context_page_description":"Mensdorff-Pouilly [-puji] je původem šlechtický rod pocházející z Lotrinska."},{"page_url":"https://hu.wikipedia.org/wiki/Sebasti%C3%A1n_de_Belalc%C3%A1zar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Sebastian_de_Belalcazar.jpg","page_title":"Sebastián de Belalcázar","context_page_description":"Sebastián de Belalcázar spanyol konkvisztádor volt.\\n1479-ben vagy 1480-ban született eredetileg Sebastián Moyano néven a spanyolországi Córdobában. A Belalcázar vagy Benalcázar nevet egy córdobai vár után később vette fel. Egyes források szerint az 1498 elején Kolumbusszal utazott az Újvilágba, míg Juan de Castellanos írása szerint 1507-ben egy öszvér megölése miatt -mivel nem kívánta tettének következményét viselni- volt kénytelen szülőhazáját elhagyni.\\n1524-ben Francisco Hernández de Córdoba oldalán bevonult a mai Nicaraguába és León városának első polgármestere lett. 1527-ig töltötte be ezt a tisztséget, utána Hondurasba távozott. Rövid időre visszatért Leónba, majd 1532-ben Peru partjaihoz hajózott és csatlakozott Francisco Pizarro expedíciójához.\\n1534-ben Pizarronak segít az őslakos indiánok legyőzésében, majd ezt követően útnak indul, hogy elfoglalja az ecuadori Quitót.\\nQuito az Inka Birodalom legészakibb városa volt, de Belalcázar megérkezése előtt az inka parancsnok Rumiñahui elrendelte az értékek elrejtését, majd felgyújtatta a várost. Belalcázar Diego de Almagróval megalapította az új Quitót, és Pizarro után „San Francisco de Quitónak” nevezte el."},{"page_url":"https://no.wikipedia.org/wiki/Munkholmen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Jekt_ved_munkholmen_wilse.jpg","page_title":"Munkholmen","context_page_description":"Munkholmen er en liten øy på 13 dekar som ligger ca. 2 km utenfor Trondheim sentrum i Trondheimsfjorden. I sommersesongen er øya nå et populært utfartssted, med muligheter for bading og soling. Det er også en café der og en liten restaurant med uteservering. Det går båt fra Ravnkloa i Trondheim. Munkholmen har en rik historie og er fredet.\\nMan hører om Munkholmen i Snorre, der den heter Nidarholm og ble brukt som rettersted. Fram til reformasjonen var Nidarholm kloster på øya. På 1600-tallet ble navnet Munkholmen tatt i bruk, og Munckholm festning ble anlagt. Deler av festningen er i dag en severdighet. Festningen ble brukt som statsfengsel, og den mest kjente fangen som satt der, var Peder Schumacher Griffenfeld. Den franske forfatteren Victor Hugo skrev romanen Fangen på Munkholmen om hans fangenskap her. Under andre verdenskrig bygde tyskerne faste luftvernstillinger på Munkholmen."},{"page_url":"https://de.wikipedia.org/wiki/Kran","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Mobile_telescopic_crane_of_the_JSDF_salvaging_a_fuel_tanker.jpg","page_title":"Kran","context_page_description":"Ein Kran ist eine manuell oder durch Motoren betriebene Einrichtung zur vertikalen und horizontalen Verladung oder Bewegung von Lasten. Er wird in der Regel zum Be- und Entladen von Schiffen, Eisenbahn- und Lastkraftwagen sowie in Montage-, Fertigungs- und Lagerhallen sowie im Hochbau eingesetzt.\\nIn der Ausführung zum Umschlagen von Schüttgütern wird er meist als Bagger bezeichnet.\\nDer Unterschied zu einem einfachen Hebezeug, das Bestandteil des Kranes sein kann, ist, dass der Kran flurfrei arbeitet und mehr als zwei Bewegungsrichtungen ausführen kann- d. h. die Last an einem anderen Punkt abzusetzen, als er sie aufgenommen hat.\\nHauptanwendung ist das Be- und Entladen, auch Güterumschlag genannt, sowie die Verlastung von Gütern an einen bestimmten Punkt. Letztere Anwendung ist vor allem auf Baustellen sehr wichtig."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9ho_Cyrila_a_Metod%C4%9Bje_(Praha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Olt%C3%A1%C5%99_Cyril_a_Metod%C4%9Bj_Praha.jpg","page_title":"Kostel svatého Cyrila a Metoděje (Praha)","context_page_description":"Kostel svatých Cyrila a Metoděje v Praze 8-Karlíně na Karlínském náměstí patří mezi největší církevní stavby 19. století v Čechách. Byl zbudován v polovině 19. století a řadí se k nejvýznamnějším architektonickým památkám novorománského slohu.\\nKostel je postaven ve stylu pozdně románské baziliky se silně převýšenou hlavní lodí a dvěma věžemi. Půdorys je rozvržen na předsíň, tři lodi a presbytář, který je zakončen polokruhovou apsidou mezi dvěma kaplemi v podvěží, rovněž s polokruhovou apsidou. Stavba není orientovaná, sleduje pravoúhlou uliční síť, takže presbytář směřuje k jihojihovýchodu."},{"page_url":"https://uk.wikipedia.org/wiki/Palm_(%D0%9A%D0%9F%D0%9A)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/PDA_Palm_III.jpg","page_title":"Palm (КПК)","context_page_description":"Palm — сім'я кишенькових комп'ютерів і комунікаторів, що працюють під управлінням операційної системи Palm OS. Виробляється компанією Palm Computing, а також іншими фірмами.\\nВ даний час існує близько 40 млн пристроїв, вироблених Palm Inc. та іншими виробниками — Samsung, Lenovo, Aceeca, AlphaSmart, Fossil, Inc., Garmin, GSPDA, IBM, Kyocera, PiTech, Sony і Symbol."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_4_oktober","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Vincenz_Priessnitz%2C_supporter_of_hydrotherapy.jpg","page_title":"Lijst van personen geboren op 4 oktober","context_page_description":"Dit is een lijst van personen die geboren zijn op 4 oktober.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n1160 - Adelheid van Vexin, Franse gravin, feodaal bewerken\\n1268 - Erik II van Noorwegen, Noorse koning bewerken\\n1274 - Rudolf I van de Palts, Duitse hertog, aristocraat bewerken\\n1276 - Margaretha van Brabant, Duitse gemalin bewerken\\n1289 - Lodewijk X van Frankrijk, Franse graaf, koning bewerken\\n1437 - Johan IV van Beieren, hertog, hertog van Beieren uit het Heilige Roomse Rijk bewerken\\n1462 - Francisco Roldán, Spaanse ontdekkingsreiziger bewerken\\n1472 - Lucas Cranach de Oude, burgemeester en hofschilder, kunstschilder uit het Heilige Roomse Rijk bewerken\\n1515 - Lucas Cranach de Jongere, Duitse burgemeester, kunstschilder, graveur bewerken\\n1516 - Archangelo de' Bianchi, kardinaal, rooms-katholiek priester bewerken\\n1534 - Willem van Schwarzburg-Frankenhausen, graaf, aristocraat bewerken"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_von_nationaler_Bedeutung_im_Kanton_Appenzell_Ausserrhoden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Evangelisch_reformierte_Kirche_Gais_AR.JPG","page_title":"Liste der Kulturgüter von nationaler Bedeutung im Kanton Appenzell Ausserrhoden","context_page_description":"Diese Liste enthält alle national bedeutenden Kulturgüter im Kanton Appenzell Ausserrhoden, die in der Ausgabe 2009 des Schweizerischen Inventars der Kulturgüter von nationaler und regionaler Bedeutung vermerkt sind. Sie ist nach politischen Gemeinden sortiert; enthalten sind 35 Einzelbauten und sechs Sammlungen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Hood_River_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Hill_House_-_Pine_Grove_Oregon.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Hood River County","context_page_description":"Liste der Einträge im National Register of Historic Places im Hood River County, Oregon in das National Register of Historic Places eingetragenen Gebäude, Bauwerke, Objekte, Stätten oder historischen Distrikte."},{"page_url":"https://en.wikipedia.org/wiki/Quini_(footballer,_born_1980)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/QuiniAlvarez.JPG","page_title":"Quini (footballer, born 1980)","context_page_description":"Joaquín Álvarez Álvarez, known as Quini, is a Spanish retired footballer who played as a striker.\\nHe only started his professional career at the age of 30, and appeared in 120 Segunda División matches over four seasons, scoring a combined 38 goals for Alcorcón and Racing de Santander."},{"page_url":"https://en.wikipedia.org/wiki/Quini_(footballer,_born_1980)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/QuiniAlvarez.JPG","page_title":"Quini (footballer, born 1980)","context_page_description":"Joaquín Álvarez Álvarez, known as Quini, is a Spanish retired footballer who played as a striker.\\nHe only started his professional career at the age of 30, and appeared in 120 Segunda División matches over four seasons, scoring a combined 38 goals for Alcorcón and Racing de Santander."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%99%D7%95%D7%95%D7%99%D7%90%D7%99_%D7%97%D7%95%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Circaetus-cinereus-Kenya.JPG","page_title":"חיוויאי חום","context_page_description":"חיוויאי חום הוא מין של דורס יום ממשפחת הנציים החי באפריקה שמדרום לסהרה."},{"page_url":"https://eu.wikipedia.org/wiki/Douvres","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Douvres.JPG","page_title":"Douvres","context_page_description":"Douvres Ain departamenduko udalerria da, Frantziako Auvernia-Rhône-Alpeak eskualdean."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B9%BF%E6%B2%BC%E4%B8%AD%E7%B6%99%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Map_of_Tochigi_Prefecture_Ja.svg","page_title":"鹿沼中継局","context_page_description":"鹿沼中継局は栃木県鹿沼市に置かれているテレビ中継局。デジタルテレビ中継局では、NHKの他に民放も設置している。"},{"page_url":"https://fr.wikipedia.org/wiki/Pollution_lumineuse","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Acervo_de_Entomologia_-_Museu_Nacional_01.jpg","page_title":"Pollution lumineuse","context_page_description":"L’expression pollution lumineuse désigne à la fois la présence nocturne anormale ou gênante de lumière et les conséquences de l'éclairage artificiel nocturne sur la faune, la flore, la fonge, les écosystèmes ainsi que les effets suspectés ou avérés sur la santé humaine.\\nComme celle de pollution du ciel nocturne qui la remplace parfois et qui désigne particulièrement la disparition des étoiles du ciel nocturne en milieu urbain, la notion de pollution lumineuse est apparue dans les années 1980 et a évolué depuis.\\nÀ la fois piège écologique, barrière immatérielle et perturbateur endocrinien pour de nombreuses espèces, elle se distingue des nuisances lumineuses en ce qu'elle affecte également les écosystèmes et les humains ; l'Union internationale pour la conservation de la nature recommande en 2014 aux collectivités de l'inclure parmi les indicateurs de pression sur la biodiversité. Elle est souvent associée à la notion de gaspillage d'énergies, dans le cas d'un éclairage artificiel inadapté et s'il constitue une dépense évitable d’énergie.\\nLa pollution lumineuse est souvent évaluée par l'échelle de Bortle."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BD%93%E4%B8%96%E5%85%B7%E8%B6%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/%E4%BB%81%E7%8E%8B%E8%83%B4%E5%85%B7%E8%B6%B3.jpg","page_title":"当世具足","context_page_description":"当世具足とは、日本の甲冑の分類名称の一つ。鉄砲伝来や戦闘の大規模化による武器と戦術の進歩、南蛮貿易などによる西洋甲冑の影響などの要因により、室町時代後期の戦国時代から安土桃山時代に生じた甲冑の一形式。「当世」とは「現代」の意味で、戦国時代当時の人々が伝統的な鎧に比べて「今様」の新しい甲冑という含意をもって用いた呼称が形式化したものである。単に具足とも称する。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D1%96%D0%B2%D0%BA%D0%B0_(%D0%9A%D0%BE%D1%81%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/uk/1/15/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%B2_%D1%81._%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D1%96%D0%B2%D0%BA%D0%B0_%28%D0%9A%D0%BE%D1%81%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80-%D0%BD%29.JPG","page_title":"Соколівка (Косівський район)","context_page_description":"Соколі́вка — село Косівського району Івано-Франківської області."},{"page_url":"https://fr.wikipedia.org/wiki/Course_en_ligne_masculine_des_moins_de_23_ans_aux_championnats_du_monde_de_cyclisme_sur_route_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/20180928_UCI_Road_World_Championships_Innsbruck_Men_under_23_Road_Race_Award_Ceremony_850_0899.jpg","page_title":"Course en ligne masculine des moins de 23 ans aux championnats du monde de cyclisme sur route 2018","context_page_description":"La course en ligne masculine des moins de 23 ans aux championnats du monde de cyclisme sur route 2018 a lieu sur 179,9 kilomètres le 28 septembre 2018 à Innsbruck, en Autriche."},{"page_url":"https://fr.wikipedia.org/wiki/Antonio_Beltr%C3%A1n_Casa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Beltrbobiels1938.jpg","page_title":"Antonio Beltrán Casaña","context_page_description":"Antonio Beltrán Casaña était un militant communiste espagnol, membre du Parti communiste d'Espagne et dirigeant\\nmilitaire des forces républicaines pendant la guerre civile espagnole."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B8%D0%BD%D0%B0%D1%80_(%D0%94%D0%B0%D0%B3%D0%B5%D1%81%D1%82%D0%B0%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/%D0%A7%D0%B8%D0%BD%D0%B0%D1%80.%D0%92%D0%B8%D0%B4_%D1%81%D0%BE_%D1%81%D1%82%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D1%81%D0%B5%D0%BB%D0%B0_%D0%91%D0%B8%D0%BB%D1%8C%D0%B3%D0%B0%D0%B4%D0%B8.jpg","page_title":"Чинар (Дагестан)","context_page_description":"Чинар — село в Дербентском районе Дагестана. Административный центр сельского поселения «Чинарский сельсовет»."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B8%83%E5%B9%B2%E7%BB%B4%E5%B0%94%E8%87%AA%E6%B2%BB%E5%8C%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Un-bougainville.png","page_title":"布干维尔自治区","context_page_description":"布干維爾自治區是巴布亞紐幾內亞唯一的自治區。自治區由布干維爾島、布卡島及鄰近小島組成，面積9384平方千米，人口249358，臨時首府布卡。由於是地理概念上索羅門群島的一部分，歷史上曾被稱作北所羅門。\\n1768年，法國海軍上將路易斯·安東尼·布干維爾率船隊抵達該地區，布干維爾島由此得名。1886年，該地區成為德屬新幾內亞的一部分。在德國殖民時期，天主教傳入該地區，並成為該地區的主流宗教。根據1919年《凡爾賽條約》，澳洲得到國際聯盟授權，從1920年起對該地區實行託管統治，該地區成為新幾內亞領地的一部分。1975年，在巴布亞紐幾內亞宣布獨立前不久，該地區宣布成立北所羅門共和國，但沒有得到國際社會承認。1976年，該地區被併入巴布亞紐幾內亞。圍繞潘古納銅礦區產生的衝突成為布干維爾內戰的主要誘因，內戰導致多達20000人死亡。2000年，巴布亞紐幾內亞政府與游擊隊布干維爾革命軍簽訂和平協議。2002年，布干維爾自治政府成立。自治區的立法機構是布干維爾眾議院。\\n根據與巴布亞紐幾內亞中央政府達成的協議，布干維爾自治政府決定於2019年6月15日舉行獨立公投，後與巴布亞紐幾內亞政府協商延遲至10月19日，隨後又延遲至11月23日舉行獨立公投；12月11日公投結果出爐，超過98%的有效選票支持獨立；公投結果需經巴布亞紐幾內亞國民議會批准通過後才會具備法律效力。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B7%DB%8C%D9%81_%DA%AF%D8%B3%D8%B3%D8%AA%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Hydrogen_spectrum.svg","page_title":"طیف گسسته","context_page_description":"گفته می‌شود یک کمیت فیزیکی دارای طیف گسسته‌ای است اگر فقط مقادیر متمایزی را، با یک فاصله بین یک مقدار و مقدار دیگر، داشته باشد.\\nنمونه کلاسیکی یک طیف گسسته مجموعه خطوط طیفی نوری گسسته هستند که در طیف گسیلی و طیف بینی جذبی اتمهای جدا شده از یک عنصر شیمیایی یافت می‌شوند، که فقط در طول موج خاصی نور را جذب و ساطع می‌کند. تکنیک طیف‌سنجی مبتنی بر این پدیده است. طیفهای گسسته در مقابل طیف‌های پیوسته قرار می‌گیرند که در آزمایش‌هایی مانند:تابش گرمایی، تشعشعات سنکروترون و بسیاری دیگر از پدیده‌های تولیدکننده نور، دیده می‌شوند. طیفهای گسسته در بسیاری از پدیده‌های دیگر، مانند سیم‌های ارتعاش کننده، مایکروویو در یک حفره فلزی، امواج صوتی در یک ستاره متغیر و تشدیددر فیزیک ذرات پر انرژی دیده می شوند.\\nدر حالت کلی پدیده طیفهای گسسته در سیستمهای فیزیکی را می‌توان با استفاده از ابزارهای آنالیز تابعی، به‌طور خاص با تجزیه طیفی یک نگاشت خطی که بر روی یک فضای تابعی عمل می‌کند مدل‌سازی کرد"},{"page_url":"https://de.wikipedia.org/wiki/Saint_Ninian%E2%80%99s_Cave","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/St_Ninian%27s_Cave.jpg","page_title":"Saint Ninian’s Cave","context_page_description":"Saint Ninian’s Cave ist eine meernahe Höhle am Solway Firth, auf der The Machars-Halbinsel, etwa 6,0 km westlich von Whithorn und der Whithorn Priory in Dumfries and Galloway in Schottland.\\nEs wird angenommen, dass die kleine Meereshöhle Rückzugsort von Saint Ninian, Schottlands erstem Heiligen, war. Im Frühmittelalter wurde die Höhle zum Wallfahrtsort.\\nBei einer Ausgrabung wurden unter dem eingestürzten Höhlendach viele christliche Symbole gefunden, darunter Grabsteine und Kreuze aus dem 10. und 11. Jahrhundert, die im Priory Museum in Whithorn ausgestellt sind. Darüber hinaus sind weitere, in den Fels gehauene Symbole, vor allem Kreuze, innerhalb und außerhalb der Höhle gefunden worden.\\nHeute ist die Höhle immer noch Ziel jährlicher Wallfahrten."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%8B%D1%85%D1%96%D1%9E%D1%81%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD_(%D0%9B%D1%8C%D0%B2%D0%BE%D1%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/%D0%A1%D0%B8%D1%85%D0%BE%D0%B2%D0%A1%D0%B0%D0%BD%D1%82%D0%B0.jpg","page_title":"Сыхіўскі раён (Львоў)","context_page_description":"Сыхіўскі раён — раён горада Львова, які ахоплівае паўднёва-ўсходнюю частку горада: мясцовасці Боднарыўка, Казэльныкы, Новы Львоў, Пірагіўка, Пэрсэнкіўка, Сыхіў, часткова Пасікы і Снопкіў."},{"page_url":"https://en.wikipedia.org/wiki/Rozelle_Bay","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Rozelle_Bay_cove.JPG","page_title":"Rozelle Bay","context_page_description":"Rozelle Bay is a bay located to the south of Glebe Island and the west of Blackwattle Bay, on Sydney Harbour.\\nThe naming of the bay is derived from either the Rosella bird or the Rosella plant, with the latter being more likely, due to the other names in the area that have botanic origins.\\nA light rail station on the Dulwich Hill Line is named after the bay.\\nRozelle Bay is fed by Johnstons Creek and Whites Creek.\\nThe dockyard of the Sydney Heritage Fleet is located on the western shore of Rozelle Bay."},{"page_url":"https://pt.wikipedia.org/wiki/Ta%C3%A7a_Paulista_de_Futebol_de_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Bandeira_Rancharia.jpg","page_title":"Taça Paulista de Futebol de 2016","context_page_description":"A Taça Paulista de Futebol de 2016, foi a primeira edição da competição. Em organização da Liga de Futebol Paulista. O intuito desse campeonato é impor os times que no caso foram licenciados da Federação Paulista de Futebol."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AC%E0%B5%8D%E0%B4%B0%E0%B5%86%E0%B5%BB%E0%B4%B1%E0%B5%8D%E2%80%8D%E0%B4%B5%E0%B5%81%E0%B4%A1%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Contra_Costa_County_California_Incorporated_and_Unincorporated_areas_Brentwood_Highlighted_0608142.svg","page_title":"ബ്രെൻറ്‍വുഡ്","context_page_description":"അമേരിക്കൻ ഐക്യനാടുകളിലെ കാലിഫോർണിയ സംസ്ഥാനത്തെ കോണ്ട്രാ കോസ്റ്റ കൗണ്ടിയിലുള്ള ഒരു നഗരമാണ് ബ്രെൻറ്‍വുഡ്. സാൻ ഫ്രാൻസിസ്കോ ഉൾക്കടൽ മേഖലയിലെ ഈസ്റ്റ് ബേ പ്രദേശത്താണ് ഇത് സ്ഥിതി ചെയ്യുന്നത്. 2010 ലെ കണക്കുകൾ പ്രകാരം ഈ നഗരത്തിലെ ആകെ ജനസംഖ്യ 51,481 ആയിരുന്നു. ഇത് 2000 ലെ സെൻസസിലെ 23,302 ൽ നിന്ന് 121 ശതമാനം വർദ്ധനവായിരുന്നു. പത്തൊൻപതാം നൂറ്റാണ്ടിന്റെ അവസാനത്തിൽ ബ്രെൻറ്‍വുഡ് ഒരു സമൂഹമായി അറിയപ്പെട്ടുതുടങ്ങിയിരുന്നു. കാർഷിക ഉത്പന്നങ്ങളിൽ പ്രാഥമികമായി ചെറി, ചോളം, പീച്ച് എന്നിവയുടെ പേരിൽ ഉൾക്കടൽ മേഖലയിലാകെ ഇപ്പോഴും ഈ നഗരം അറിയപ്പെടുന്നു."},{"page_url":"https://es.wikipedia.org/wiki/Pabllo_Vittar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Pabllo_Vittar_em_Bras%C3%ADlia_3.jpg","page_title":"Pabllo Vittar","context_page_description":"Phabullo Rodrigues da Silva, más conocido como Pabllo Vittar, es un drag queen y cantautor brasileño. Nacido en São Luís y criado en ciudades del interior de Maranhão y Pará, a Vittar le gustaba la música influenciada por su madre y se interesó por el arte de las drag queens en su adolescencia. Sus primeras presentaciones profesionales tuvieron lugar en un club nocturno en Uberlandia, Minas Gerais, y ganó atención en Internet luego del lanzamiento de la canción «Open Bar» en octubre de 2015. En diciembre del mismo año, se lanzó su primer extended play, también llamado Open Bar. Al año siguiente, se unió al elenco del programa Amor & Sexo de Rede Globo, haciendo números musicales durante dos temporadas. En 2017, Vittar ganó un reconocimiento al lanzar su álbum debut Vai Passar Mal, que recibió la certificación platino de Pro-Música Brasil y generó sencillos como «Todo Dia», «K.O» y «Corpo Sensual». En 2018, lanzó su segundo álbum de estudio, Não Para Não, certificado oro por la PMB.\\nVittar también es conocido por su indiferencia hacia los pronombres específicos de género utilizados para dirigirse a él y hace apariciones públicas con y sin su caracterización artística."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D5%BE%D5%BD%D5%A5%D5%BD_%D4%BF%D5%A1%D5%B2%D5%A1%D5%B6%D5%AF%D5%A1%D5%BF%D5%BE%D5%A1%D6%81%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Patmutyun_Aghuanits_ashkharhi.JPG","page_title":"Մովսես Կաղանկատվացի","context_page_description":"Մովսես Կաղանկատվացի, 7-րդ դարի հայ պատմիչ։ Ծնվել է Կաղանկատույք գյուղում։ Համարվում է «Աղուանից աշխարհի պատմութիւն» գրքի շարահարողը, որը կազմված է տարբեր դարերում գրված կարճ պատմություններից, նամակներից, իշխանների և սրբերի կենսագրություններից։ Մովսես Կաղանկատվացու աշխատության մեջ հարուստ տեղեկություններ կան Հայաստանի, հատկապես «արևելից կողմանց»՝ Արցախի և Ուտիքի վաղ միջնադարյան պատմության մասին։ Արժեքավոր են նաև նրա հայտնած տեղեկությունները Անդրկովկասի, Բյուզանդիայի և Պարսկաստանի մասին։\\nԳրքի հետագա՝ 10-րդ դարի ենթադրյալ շարահարողը Մովսես Դասխուրանցին է։"},{"page_url":"https://en.wikipedia.org/wiki/Igor_Shuvalov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Igor_Shuvalov_-_World_Economic_Forum_Annual_Meeting_2011.jpg","page_title":"Igor Shuvalov","context_page_description":"Igor Ivanovich Shuvalov is a Russian politician. Since May 2018 he became the Chairman of State Development Corporation VEB.RF. From May 2012 to May 2018 he was First Deputy Prime Minister in Dmitry Medvedev's Cabinet. Previously, he served in the same capacity in Vladimir Putin's Second Cabinet. As First Deputy Prime Minister, he was the most senior member of the cabinet after the Prime Minister and was responsible for the federal budget and economic policies. He serves as a member of the Council of the Eurasian Economic Commission."},{"page_url":"https://no.wikipedia.org/wiki/Robert_Schumann","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Robert-Schumann-Haus.JPG","page_title":"Robert Schumann","context_page_description":"Robert Schumann var en tysk romantisk komponist. Hans komposisjoner hadde begrenset suksess i samtiden, men i dag regnes han som en av den tyske høyromantikkens fremste representanter. Opprinnelig komponerte han hovedsakelig for klaver, men senere skrev han verker i nesten alle musikkformer som var vanlige på hans tid.\\nSchumann fikk pianoundervisning fra han var sju år gammel. Meningen var at han skulle studerte jus i årene 1828–1830, men i realiteten komponerte han, studerte musikkteori og fikk undervisning i pianospill hos Friedrich Wieck. En fingerskade ødela karrieren som pianovirtuos, og han satset i stedet på å komponere.\\nI 1834 grunnla Schumann musikktidsskriftet Neue Zeitschrift für Musik, hvor han gav uttrykk sine ideer om en «høyere», poetisk musikk. Schumann sto oppriktig og bestemt på sitt romantisk-idealistiske kunstsyn, på denne tiden var han mest kjent som musikkritiker – som komponist var han nesten ukjent.\\nMot pianolærerens vilje giftet hans datter, Clara Wieck, og Schumann seg i 1840. Hun var allerede en av Europas største klavervirtuoser. Samme år komponerte Schumann et stort antall lieder."},{"page_url":"https://eo.wikipedia.org/wiki/Ordinara_polipodio","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Polypodium_vulgare.jpg","page_title":"Ordinara polipodio","context_page_description":"La ordinara polipodio aǔ latine estas filiko el la familio de la Polipodiacoj"},{"page_url":"https://pl.wikipedia.org/wiki/Akron_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/AkronPanorama.jpg","page_title":"Akron (Ohio)","context_page_description":"Akron – miasto w Stanach Zjednoczonych w stanie Ohio, nad rzeką Cuyahoga. Zostało założone w 1807 roku.\\nW granicach miasta liczba mieszkańców wynosi 199 110, natomiast na obszarze metropolitalnym zameldowanych jest 701 456 osób. Północno-wschodni region stanu Ohio, składający się ze statystycznych obszarów metropolitalnych – Greater Cleveland, Akron, Canton–Massillon, Youngstown–Warren–Boardman, Mansfield i Sandusky – zamieszkuje 4 335 920 ludzi."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%AA_(%D4%B1%D6%80%D5%A4%D5%A5%D5%B6%D5%B6%D5%A5%D6%80%D5%AB_%D5%A3%D5%A1%D5%BE%D5%A1%D5%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Auge_%28Ardennes%29_city_limit_sign.JPG","page_title":"Օժ (Արդենների գավառ)","context_page_description":"Օժ, համայնք Ֆրանսիայի Շամպայն-Արդեն մարզի Արդեններ գավառում:\\nԲնակչությունը 2010 թվականի դրությամբ կազմում է 52 մարդ, բնակչության խտությունը\` 11.56 մարդ/կմ²: Բնակավայրը զբաղեցնում է 4.5 կմ² տարածք:"},{"page_url":"https://de.wikipedia.org/wiki/Liste_historischer_Geb%C3%A4ude_in_Neumorschen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Neumorschen-Marktstra%C3%9Fe_15-Fr%C3%BChjahr-2017.jpg","page_title":"Liste historischer Gebäude in Neumorschen","context_page_description":"Die Liste historscher Gebäude in Neumorschen gibt einen Überblick über Bauwerke in der historischen Marktstraße, im Zentrum von Neumorschen, die überwiegend unter Denkmalschutz stehen. Größtenteils handelt es sich um giebelständige Fachwerkhäuser aus dem 17., 18. und 19. Jahrhundert.\\nVon den früheren fünf Mühlen sind noch drei erhalten: die Wogmühle, die im landgräflichen Besitz stand, die Heckmühle und die Obermühle an der Wichte. Neumorschen ist ein Ortsteil der Gemeinde Morschen in Hessen und erstreckt sich an den Ausläufern des Knüllgebirges.\\nKarte mit allen Koordinaten in Neumorschen: OSM"},{"page_url":"https://it.wikipedia.org/wiki/Yahya_Jammeh","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Yahya_Jammeh_with_Obamas.jpg","page_title":"Yahya Jammeh","context_page_description":"Yahya Abdul-Aziz Jemus Junkung Jammeh è un politico e militare gambiano, Presidente del Gambia dal luglio 1994 al gennaio 2017."},{"page_url":"https://fr.wikipedia.org/wiki/Adelina_Ismajli","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Adelina_Ismajli_KM2009.jpg","page_title":"Adelina Ismajli","context_page_description":"Adelina Ismajli est une chanteuse kosovare, née le 14 décembre 1979 à Pristina, au Kosovo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%81%D1%82%D0%B0_%D0%A1%D0%BB%D0%BE%D0%B2%D0%B0%D1%87%D1%87%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Coat_of_arms_of_%C4%8Cadca.png","page_title":"Міста Словаччини","context_page_description":"Це список міст та містечок Словаччини."},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A9giale_Saint-Hippolyte_du_Malzieu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Eglise_St_Hippolyte_3004.jpg","page_title":"Collégiale Saint-Hippolyte du Malzieu","context_page_description":"La collégiale Saint-Hippolyte est une ancienne collégiale située au Malzieu, dans le département français de la Lozère. La collégiale est désormais une église paroissiale rattachée à la paroisse Saint-Jacques, l'une des cinq paroisses du diocèse de Mende."},{"page_url":"https://hu.wikipedia.org/wiki/Szjarhej_Uladzimiravics_Barovszki","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Sergei_Borovsky_2015.png","page_title":"Szjarhej Uladzimiravics Barovszki","context_page_description":"Szjarhej Uladzimiravics Barovszki fehérorosz labdarúgóedző, korábban szovjet válogatott labdarúgó."},{"page_url":"https://tr.wikipedia.org/wiki/Tatl%C4%B1_su_akvaryumu_bal%C4%B1k_t%C3%BCrleri_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Kakadua_male.jpg","page_title":"Tatlı su akvaryumu balık türleri listesi","context_page_description":"Tatlı su akvaryumlarında birçok türden çok sayıda balık başarıyla yetiştirilir. Bu listede tatlı su akvaryumlarında en sıklıkla bulunan türlerden kimileri bulunmaktadır."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%B7%B4%E8%A5%BF%E5%A0%85%E6%9E%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Castanha-copl6.JPG","page_title":"巴西堅果","context_page_description":"巴西坚果，又名巴西果、巴西栗、帕拉果、黄油果、奶油果、鲍鱼果，高大的贝尔托莱氏木的可食种子。贝尔托莱氏木是玉蕊科巴西坚果属的植物，巴西坚果属只有巴西坚果一个种，植物名Bertholletia是以法国化学家克劳德·贝托莱的名字命名的。是世界上主要商业坚果和果仁类之一。原产于南美洲的圭亚那、委内瑞拉、巴西、哥伦比亚东部、秘鲁东部、玻利维亚东部。零星的分布在亚马逊河、内格罗河、奥利诺科河沿岸的森林里。"},{"page_url":"https://es.wikipedia.org/wiki/Parroquia_de_Red_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Red_River_Parish_courthouse%2C_LA.jpg","page_title":"Parroquia de Red River","context_page_description":"La parroquia de Red River, fundada en 1871, es una de las 64 parroquias del estado estadounidense de Luisiana. En el año 2000 tenía una población de 9.622 habitantes con una densidad poblacional de 10 personas por km². La sede de la parroquia es Coushatta.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Museen_und_Denkm%C3%A4lern_%C3%BCber_den_Deutsch-Franz%C3%B6sischen_Krieg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Cimeti%C3%A8reCh%C3%A2telaine-Guerre-1870-1871-a.jpg","page_title":"Liste von Museen und Denkmälern über den Deutsch-Französischen Krieg","context_page_description":"Diese Liste gibt einen Überblick über Museen und Gedenkstätten, die sich schwerpunktmäßig der Geschichte des Deutsch-Französischen Krieges von 1870/1871 widmen.\\nSie ist nach Ländern sortiert und erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://en.wikipedia.org/wiki/Walter_Hayes","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Cosworth_DFV.jpg","page_title":"Walter Hayes","context_page_description":"Walter Leopold Arthur Hayes CBE was an English journalist, and later public relations executive for Ford.\\nHayes was key in developing Ford's Formula One program, by signing Jackie Stewart and funding the building of the Cosworth DFV V8 Formula One racing engine; and the creation of the Premier Automotive Group with the purchases of classic English brands Jaguar and Aston Martin."},{"page_url":"https://it.wikipedia.org/wiki/Martin_Schmitt","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Martin_Schmitt_%282011%29.jpg","page_title":"Martin Schmitt","context_page_description":"Martin Schmitt è un ex saltatore con gli sci tedesco, vincitore di quattro titoli mondiali, due Coppe del Mondo e un oro olimpico a squadre.\\nÈ fratello del combinatista nordico Thorsten, a sua volta sciatore nordico di alto livello."},{"page_url":"https://fr.wikipedia.org/wiki/Sisseton-Wahpeton","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Dakotatribesmap.jpg","page_title":"Sisseton-Wahpeton","context_page_description":"Les tribus Sioux Sisseton-Wahpeton vivent dans le Dakota du Nord et le Dakota du Sud autour de la route Interstate 29. Ils vivent essentiellement dans la Réserve indienne de Lake Traverse Indian Reservation.\\nLes tribus Sisseton-Wahpeton se répartissent en plusieurs petites communautés ou villages :\\nOld Agency\\nLake Traverse\\nBuffalo Lake\\nVeblen\\nBig Coulee\\nLong Hollow\\nEnemy Swim"},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Hardinxveld-Giessendam","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/MerwedeLingelijnHardinxveldGiessendam1.JPG","page_title":"Gare de Hardinxveld-Giessendam","context_page_description":"La gare de Hardinxveld-Giessendam est une gare ferroviaire néerlandaise située à Hardinxveld-Giessendam, en Hollande-Méridionale.\\nElle est située sur la ligne Merwede-Linge, dans les provinces de la Hollande-Méridionale et le Gueldre, sur le trajet reliant Dordrecht à Elst via Geldermalsen.\\nLes trains s'arrêtant à cette gare font partie du service assuré par la compagnie Arriva reliant Dordrecht à Geldermalsen.\\nLa gare a été ouverte le 16 juillet 1885 et est toujours en service. Au cours de l'histoire, elle a eu plusieurs noms :\\nHalte de Giessendam-Oudekerk, de 1885 à 1927\\nGare de Giessendam-Neder Hardinxveld, de 1927 à 1957\\nGare de Hardinxveld-Giessendam, depuis 1957."},{"page_url":"https://es.wikipedia.org/wiki/La_Brava","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Entrada_a_La_Brava_en%2C_25_de_Mayo_de_2013_-_panoramio.jpg","page_title":"La Brava","context_page_description":"La Brava es una localidad argentina ubicada en el Departamento San Javier de la Provincia de Santa Fe. Se encuentra en el cruce de las rutas provinciales 39 y 60, a 3 km del río Saladillo, y a 7 km al sur de la laguna La Brava.\\nFue fundada en 1878, y tres años más tarde llegaron sus primeros pobladores para aprovechar la donación de las tierras fiscales. La comuna se creó en 1965.​ La caza de patos atrae muchos turistas europeos, aunque es resistida por parte de la localidad.​ Cuenta con una subcomisaría.​"},{"page_url":"https://en.wikipedia.org/wiki/Hokuriku_Railroad_Ishikawa_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Hokutetsu7011.JPG","page_title":"Hokuriku Railroad Ishikawa Line","context_page_description":"The Hokuriku Railroad Ishikawa Line is a railway line owned and operated by Hokuriku Railroad in Ishikawa Prefecture, Japan. The line extends 13.8 km from the city of Kanazawa to Hakusan with a total of 16 stations."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%BD%D0%B8%D0%B7%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Map_commune_FR_insee_code_70545.png","page_title":"Венизе","context_page_description":"Венизе́ — коммуна во Франции, находится в регионе Франш-Конте. Департамент — Верхняя Сона. Входит в состав кантона Аманс. Округ коммуны — Везуль.\\nКод INSEE коммуны — 70545."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%96%AC%E7%99%BB%C2%B7%E7%9A%AE%E7%88%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Jordan_Peele_2012.jpg","page_title":"喬登·皮爾","context_page_description":"喬登·哈沃斯·皮爾是一位美國男演員、喜劇演員、編劇、導演和製片人。較著名的是在電視劇《瘋電視》中擔任常駐演員，以及喜劇中心頻道的電視劇《阿奇與阿皮》中跟基根-麥可·奇合作，擔任主演、創作者、編劇和執行製片人。2014年，他參演了FX頻道的電視劇《冰血暴》第一季。\\n皮爾的導演處女作《逃出絕命鎮》於2017年上映，並獲得了相當好評，同時得到四項奧斯卡金像獎提名，其中贏得了最佳原創劇本。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D1%83%D0%B2%D0%B0%D1%88%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/The_Chuvash_with_traditional_headware_for_married_women.jpg","page_title":"Чуваши","context_page_description":"Чува́ши — тюркский народ, коренное население Чувашской Республики. Численность 1,5 млн, из них в России 1 млн. 435 тысяч. В Чувашии проживает примерно половина всех чувашей, живущих в России, остальные проживают практически во всех регионах России, а небольшая часть — за пределами Российской Федерации, наибольшие группы в Казахстане, Узбекистане и на Украине.\\nСогласно последним исследованиям, чуваши делятся на три этнографические группы:\\nверховые чуваши — северо-запад Чувашии;\\nсредненизовые чуваши — северо-восток Чувашии;\\nнизовые чуваши — юг Чувашии и за её пределами;\\nЯзык — чувашский. Является единственным живым представителем булгарской группы тюркских языков. Имеет два диалекта: верховой и низовой.\\nОсновное вероисповедание религиозной части чувашей — православное христианство, есть приверженцы традиционных верований и мусульмане."},{"page_url":"https://et.wikipedia.org/wiki/Nikita_Gussev","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Nikita_Gusev_2013-01-30.jpeg","page_title":"Nikita Gussev","context_page_description":"Nikita Andrejevitš Gussev on Venemaa jäähokimängija, ründaja. Ta mängib NHL-i klubis New Jersey Devils.\\nGussev alustas profikarjääri hooajal 2010–11 KHL-i klubis Moskva CSKA, kus mängis kuni 2012. aastani. Seejärel mängis ta mõnda aega Venemaa tugevuselt teise liiga klubis Tver, kuid suurema osa hooajast 2012–13 veetis ta Habarovski Amuris. Aastatel 2013–2016 mängis ta Hantõ-Mansiiski Jugra ridades.\\nAlates hooaja 2015–16 teisest poolest mängis ta Peterburi SKA-s. Hooajal 2016–17 võitis ta klubiga Gagarini karika. Sama hooaja põhihooajal andis ta 47 väravasöötu, millega oli liigas teisel kohal, ning kogus kokku 71 punkti, millega oli liigas neljandal kohal. Väga edukaks kujunes ka järgmine hooaeg, kui ta oli 40 väravasööduga põhihooaja parim mängija ja 63 kogutud punktiga alla ainult klubikaaslasele Ilja Kovaltšukilw. Kuigi Peterburi SKA lõpetas põhihooaja oma konverentsi meistrina, kaotati väljalangemismängudes poolfinaalis Moskva CSKA-le. Samal hooajal tunnistati ta põhihooaja väärtuslikumaks mängijaks ning valiti hooaja sümboolsesse koosseisu. 2018–19 põhihooajal kogus ta 81 punkti, millega oli KHL-i edukaim mängija."},{"page_url":"https://en.wikipedia.org/wiki/Michael_Beaumont,_22nd_Seigneur_of_Sark","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Michael_Beaumont.jpg","page_title":"Michael Beaumont, 22nd Seigneur of Sark","context_page_description":"John Michael Beaumont OBE was the twenty-second Seigneur of Sark in the Channel Islands. He worked as a civil engineer before succeeding his paternal grandmother, Sibyl Hathaway, the 21st Dame of Sark, in 1974. During his rule, Beaumont saw the loss of many feudal rights enjoyed by the seigneurs, and he was consequently often described as the \\"last feudal baron\\"."},{"page_url":"https://sv.wikipedia.org/wiki/Banisteriopsis_nummifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Banisteriopsis_nummifera_%28A.Juss.%29_B.Gates_%286139970172%29.jpg","page_title":"Banisteriopsis nummifera","context_page_description":"Banisteriopsis nummifera är en tvåhjärtbladig växtart som först beskrevs av Adrien Henri Laurent de Jussieu, och fick sitt nu gällande namn av B. Gates. Banisteriopsis nummifera ingår i släktet Banisteriopsis och familjen Malpighiaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D8%B1%D8%B3%D8%A7%D9%89_%D8%A8%D8%A7%D8%AF%D8%A7%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mircea_Badea.jpg","page_title":"ميرساى باداى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nميرساى باداى صحفى من رومانيا."},{"page_url":"https://it.wikipedia.org/wiki/Carles_Puigdemont","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Flickr_-_Converg%C3%A8ncia_Democr%C3%A0tica_de_Catalunya_-_Debat_de_Pol%C3%ADtica_General_-_Parlament_de_Catalunya_%281%29.jpg","page_title":"Carles Puigdemont","context_page_description":"Carles Puigdemont i Casamajó è un politico e giornalista spagnolo, presidente della Generalitat de Catalunya dal 12 gennaio 2016 al 28 ottobre 2017, giorno del commissariamento regionale.\\nEletto Presidente della Generalitat nel 2016, dopo un'esperienza da sindaco di Girona ed una lunga carriera giornalistica, è membro del Partito Democratico Europeo Catalano e dunque fermo sostenitore dell'indipendenza catalana. In seguito al referendum sull'indipendenza del 1º ottobre 2017, il 27 ottobre dello stesso anno dichiara l'indipendenza della Catalogna dalla Spagna; ciò determina l'immediata applicazione, da parte del Primo ministro spagnolo Mariano Rajoy, dell'articolo 155 della Costituzione, in base al quale la Catalogna viene commissariata e Puigdemont destituito con tutto il suo governo. Denunciato per ribellione, sedizione e appropriazione indebita di denaro, per sottrarsi all'arresto Puigdemont, insieme ad altri quattro ex consiglieri, si rifugia in Belgio."},{"page_url":"https://nl.wikipedia.org/wiki/Vendat","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Map_commune_FR_insee_code_03304.png","page_title":"Vendat","context_page_description":"Vendat is een gemeente in het Franse departement Allier en telt 2094 inwoners. De plaats maakt deel uit van het arrondissement Vichy."},{"page_url":"https://en.wikipedia.org/wiki/Arawacus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Fine-lined_stripe-streak_%28Arawacus_sito%29_underside.jpg","page_title":"Arawacus","context_page_description":"Arawacus is a genus of butterflies in the family Lycaenidae. They are commonly called stripestreaks. The species of this genus are found in the Neotropic ecozone.\\nSpecies include:\\nArawacus aethesa Brazil\\nArawacus aetolus Columbia, Venezuela, Trinidad, Bolivia, Suriname\\nArawacus binangula Brazil\\nArawacus dolylas Surinam, Venezuela, Colombia, Bolivia\\nArawacus dumenilii Venezuela, Trinidad\\nArawacus ellida Venezuela, Paraguay, Colombia, Peru, Argentina, Brazil\\nArawacus euptychia"},{"page_url":"https://no.wikipedia.org/wiki/Holmenkollbanen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Oslo_Holmenkollbanen_end_1.jpg","page_title":"Holmenkollbanen","context_page_description":"Holmenkollbanen er en forstadsbane i Oslo mellom Majorstuen og Frognerseteren. Alle stasjonene banen ligger i bydel Vestre Aker, med unntak av de to siste, som ligger i Nordmarka. Holmenkollen stasjon ligger nær nasjonalanlegget i Holmenkollen hvor ski-VM 2011 ble arrangert. Banen betjenes idag av T-banens linje 1, som går mellom Frognerseteren og Bergkrystallen."},{"page_url":"https://fi.wikipedia.org/wiki/Tulostin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Apple_scribe.jpg","page_title":"Tulostin","context_page_description":"Tulostin on tietokoneen lisälaite, jolla kirjainmerkkejä ja symboleita tai kuvia tallennetaan sähköisestä muodosta paperille tai muulle materiaalille. Nykyisillä tulostimilla voidaan tulostaa usein hyvinkin monenlaisille alustoille, muun muassa piirtoheitinkalvolle, valokuvapaperille, kartongille, tarra-arkille, CD:lle tai kankaalle. Tulostinta on verrattu kirjapainoon, koska sen avulla voidaan tuottaa useita kappaleita alkuperäisestä teoksesta.\\nRahanväärennyksen estämiseksi uudemmat väritulostimet tunnistavat rahan tulostamisyritykset. Lisäksi tulostimet jättävät paperiin näkymättömän sarjanumeromerkinnän ja kellonajan.\\nTulostinta, joka on yhdistetty skannerin ja kopiokoneen kanssa, sanotaan monitoimilaitteeksi.\\nNopeimmat tulostimet tulostavat jopa 100 arkkia minuutissa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B7%D0%B0%D0%BB%D0%BE%D0%B2_%D0%AD%D1%80%D0%BC%D0%B8%D1%82%D0%B0%D0%B6%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Ermit%C3%A1%C5%BE_%2827%29.jpg","page_title":"Список залов Эрмитажа","context_page_description":"Список залов Главного музейного комплекса Эрмитажа включает в себя залы зданий Зимнего дворца, Малого Эрмитажа, Большого Эрмитажа и Нового Эрмитажа, а также фойе Эрмитажного театра. Все эти помещения имеют единую сквозную нумерацию, официально принятую в 1961 году. Служебные помещения в общую нумерацию не включены. Залы других подразделений Эрмитажа, таких как Здание Главного штаба, Зимний дворец Петра I, Запасной дом Зимнего дворца, Меншиковский дворец, РХЦ «Старая деревня», музей Императорского фарфорового завода, имеют свою отдельную нумерацию залов, независимую от нумерации главного комплекса."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89cole_navale_militaire_(Espagne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Brigadier3a.png","page_title":"École navale militaire (Espagne)","context_page_description":"L'École Navale Militaire est le centre de formation des futurs officiers de la marine espagnole. Elle est située à Marín depuis 1943, date à laquelle elle a été transférée de son ancien emplacement dans la ville navale de San Carlos, San Fernando, Cadix. Le roi Felipe VI et son père ont tous deux effectué une partie de leur formation militaire à l'École Navale Militaire de Marín. Le commandant directeur de l'École navale est le capitaine Ignacio Cuartero Lorenzo.\\nDepuis la suppression du service militaire obligatoire par le gouvernement de José María Aznar en 2001, l'utilisation de ces installations n'a pas beaucoup diminué et, ces dernières années, des actions de modernisation ont été menées, telles que l'installation d'un Centre de Mesures Électromagnétiques ou l'adaptation d'une partie de l'ancien hôpital en résidence pour sous-officiers."},{"page_url":"https://de.wikipedia.org/wiki/Bioladen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/12-05-01-eberswalde-by-RalfR-05.jpg","page_title":"Bioladen","context_page_description":"Ein Bioladen ist ein Lebensmittelladen, dessen zum Verkauf angebotene Produkte aus ökologischer Landwirtschaft und umweltfreundlicher Verarbeitung stammen. Neben Lebensmitteln, bei denen der Schwerpunkt auf Naturkost liegt, werden häufig auch Körperpflege- und Reinigungsmittel, Bekleidung und andere Produkte des täglichen Bedarfs angeboten – wesentliche Aspekte dabei sind eine möglichst geringe Schadstoffbelastung der angebotenen Waren sowie deren umweltgerechte Herstellung. Die Lebensmittel stammen nahezu alle aus ökologischer Landwirtschaft. Konventionell angebaute Lebensmittel werden fast nie in Bioläden verkauft; wenn doch, dann sind sie in der Regel gekennzeichnet. Gentechnisch veränderte Lebensmittel sind in Bioläden nicht zu finden."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%86%D8%B1%D9%8A_%D8%A7%D9%84%D8%AB%D8%A7%D9%85%D9%86_%D9%85%D9%84%D9%83_%D8%A5%D9%86%D8%AC%D9%84%D8%AA%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Catalina_de_Arag%C3%B3n%2C_por_un_artista_an%C3%B3nimo.jpg","page_title":"هنري الثامن ملك إنجلترا","context_page_description":"هنري الثامن، ملك إنجلترا منذ 21 أبريل 1509 وحتى وفاته، ولورد أيرلندا ثم ملكها بعد ذلك، والمطالب بحقه في تاج مملكة فرنسا. كان هنري الثامن ثاني ملوك أسرة تيودور خلفًا لوالده هنري السابع.\\nإلى جانب زيجاته الست، لعب هنري الثامن دورًا هامًا في انفصال كنيسة إنجلترا عن الكنيسة الكاثوليكية. أدى الصدام بين هنري الثامن وروما إلى انفصال كنيسة إنجلترا عن سلطة الباباوية وحل الأديرة وتعيينه لنفسه رأسًا لكنيسة إنجلترا. لكنه ظل مؤمنًا في داخله بالتعاليم الدينية الكاثوليكية، حتى بعد قطع الصلة مع الكنيسة الكاثوليكية. أشرف هنري الثامن أيضًا على الاتحاد القانوني بين إنجلترا وويلز عن طريق سن قوانين تقنن الاتحاد بين عامي 1535-1542.\\nكان هنري الثامن جذابًا متعلمًا بارع في الخطابة، ويعده البعض \\"أحد أكثر الحكام الذين جلسوا على عرش إنجلترا كاريزما.\\" أدت رغبته في إنجاب وريث ذكر لعرشه، -لاعتقاده أن البنات لا يصلحن للحكم والمحافظة على وحدة أسرة تيودور وفرض السلام الذي تحقق بعد حرب الوردتين- إلى شيئين خلدا ذكر هنري الثامن: زيجاته الست والإصلاح الإنجليزي، والذي حوّل إنجلترا إلى أمة معظمها من البروتستانت. وفي نهاية حياته، عانى هنري من البدانة المفرطة، وتدهورت صحته. وقد كانت نظرة العامة إليه أنه ملك شهواني وقاسٍ وأناني وغير مأمون الجانب."},{"page_url":"https://sv.wikipedia.org/wiki/Epiniac","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Map_commune_FR_insee_code_35104.png","page_title":"Epiniac","context_page_description":"Epiniac är en kommun i departementet Ille-et-Vilaine i regionen Bretagne i nordvästra Frankrike. Kommunen ligger i kantonen Dol-de-Bretagne som tillhör arrondissementet Saint-Malo. År 2009 hade Epiniac 1 345 invånare."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%AA_%D7%94%D7%A1%D7%A4%D7%A8_%D7%9C%D7%A7%D7%A6%D7%99%D7%A0%D7%99_%D7%99%D7%9D_%D7%A2%D7%9B%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/KesherYami1997.jpg","page_title":"בית הספר לקציני ים עכו","context_page_description":"בית ספר הימי לפיקוד ומנהיגות קציני ים עכו ע\\"ש כ\\"ג יורדי הסירה הוא כפר נוער במסגרת המנהל לחינוך התיישבותי הכולל בית ספר ימי תיכוני, מכללה טכנית ופנימייה, המלמד, מחנך ומכשיר את הנוער בנים ובנות לתפקידי מנהיגות מקצועית בים ובחוף."},{"page_url":"https://sv.wikipedia.org/wiki/Sveriges_milit%C3%A4rhistoria","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Gustavus_Adolphus_at_the_Battle_at_Breitenfeld.jpg","page_title":"Sveriges militärhistoria","context_page_description":"Sveriges militärhistoria. Sverige har en nästan obruten suveränitet sedan tusen år tillbaka och har varit inblandat i många krig.\\nDen längsta ännu pågående fredsperiod mellan nu existerande stater i världen observeras i Sverige, som har haft fred sedan 15 januari 1814, efter förlusten av stora delar av landet i Napoleonkrigen. Svensk fred kan delvis förklaras av dess geografiska läge, dels av de längre perioder av relativ fred i Europa och världen kända som Pax Britannica och Pax Europaea/Pax Americana, dels av militär alliansfrihet innan världskrigen och neutralitetslinje under första och andra världskriget."},{"page_url":"https://cs.wikipedia.org/wiki/Tatra_T4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/DVB_Tatra_T4D_Altmarkt.jpg","page_title":"Tatra T4","context_page_description":"Tatra T4 je československá tramvaj vyráběná od konce 60. let do 2. poloviny 80. let 20. století. Jedná se o poslední model podniku ČKD Praha, závod Tatra Smíchov, který přímo vychází z americké koncepce PCC."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Koblenz-Oberwerth","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Gedenkstein_H%C3%A4ndelplatz_Oberwerth_Koblenz_2014.jpg","page_title":"Liste der Kulturdenkmäler in Koblenz-Oberwerth","context_page_description":"In der Liste der Kulturdenkmäler in Koblenz-Oberwerth sind alle Kulturdenkmäler im Stadtteil Koblenz-Oberwerth der rheinland-pfälzischen Stadt Koblenz aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz.\\nDie Kulturdenkmäler sind Teil des seit 2002 bestehenden UNESCO-Welterbes Oberes Mittelrheintal."},{"page_url":"https://pt.wikipedia.org/wiki/Lactarius_indigo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Lactarius_indigo%2C_Guatemala.jpg","page_title":"Lactarius indigo","context_page_description":"Lactarius indigo é um fungo da família de cogumelos Russulaceae. Pode ser facilmente distinguido dos outros integrantes do gênero devido a sua característica cor azul. A espécie forma corpos de frutificação cujo tronco mede até 6 cm de altura. O píleo, o \\"chapéu\\" do cogumelo, é inicialmente convexo e com as margens enroladas para baixo, mas quando o fungo amadurece ele adquire um formato semelhante a um funil. Pode atingir 15 cm de diâmetro e sua superfície, pegajosa ao toque, tem faixas concêntricas com diferentes tons de azul. A face inferior do chapéu apresenta as lamelas. Inicialmente azuis, com o passar do tempo ficam mais pálidas e manchadas de verde pelo látex que escorre quando são danificadas.\\nA espécie foi descrita pela primeira vez em 1822 por Lewis von Schweinitz. A princípio batizada de Agaricus indigo, teve seu nome modificado para o atual em 1838 pelo sueco Elias Magnus Fries, considerado o \\"pai da micologia\\". O epíteto específico \\"indigo\\" é derivado da palavra latina que significa \\"azul índigo\\", uma referência à cor predominante do cogumelo."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%83%D0%B4%D0%B0%D0%B5%D1%80%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Buda%C5%91rs_-_K%C5%91hegy.jpg","page_title":"Будаерш","context_page_description":"Будаерш град је у Мађарској. Будаерш је значајан град у оквиру жупаније Пешта, а истовремено и важно предграђе престонице државе, Будимпеште.\\nГрад има 27.665 становника према подацима из 2008. године.\\nУ Геделу се налзи један од најзначајнијих двораца у Мађарској из времена Хабзбурга."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8F%AF%E7%9B%9B%E9%A0%93%E9%8E%AE%E5%8D%80_(%E5%8D%B0%E5%9C%B0%E5%AE%89%E7%B4%8D%E5%B7%9E%E9%96%80%E7%BE%85%E7%B8%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Hindustan_Christian_Church_-_P1080642.jpg","page_title":"華盛頓鎮區 (印地安納州門羅縣)","context_page_description":"華盛頓鎮區是位於美國印地安納州門羅郡的一個行政鎮區。"},{"page_url":"https://fr.wikipedia.org/wiki/Costume_de_ballet","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Costume_de_%22Castor_et_Pollux%22%2C_Louis-Ren%C3%A9_Boquet_%281737%29.jpg","page_title":"Costume de ballet","context_page_description":"Le costume de ballet est le costume utilisé par les danseurs classiques."},{"page_url":"https://de.wikipedia.org/wiki/Taubenturm_Ch%C3%A2teau_de_Rosanbo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Ch%C3%A2teau_de_Rosanbo_-_Lanvellec_08.JPG","page_title":"Taubenturm Château de Rosanbo","context_page_description":"Der Taubenturm des Château de Rosanbo in Lanvellec, einer französischen Gemeinde im Département Côtes-d’Armor in der Region Bretagne, wurde im 17. Jahrhundert errichtet. Der Taubenturm steht seit 1995 als Monument historique auf der Liste der Baudenkmäler in Frankreich.\\nDer runde Taubenturm aus Haustein besitzt ein Dach, das aus dem gleichen Stein ausgeführt ist wie das Mauerwerk."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Jugoslavias_regjeringssjefer","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Josip_Broz_Tito_uniform_portrait.jpg","page_title":"Liste over Jugoslavias regjeringssjefer","context_page_description":"Under følger en liste over Jugoslavias regjeringssjefer:\\nNRS DS SLS JRSD / JNS JRZ Uavhengig HSS KPJ / SKJ SRSJ SPS"},{"page_url":"https://nl.wikipedia.org/wiki/Kruisgang_van_de_Sint-Servaasbasiliek","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/2016-Maastricht%2C_St-Servaasbasiliek%2C_hoek_noordelijke-oostelijke_kruisgang%2C_maquette_bij_diaruimte_2.jpg","page_title":"Kruisgang van de Sint-Servaasbasiliek","context_page_description":"De kruisgang van de Sint-Servaasbasiliek is een gotische kruisgang of kloostergang in de Sint-Servaasbasiliek in de Nederlandse stad Maastricht. In feite bestaat de kruisgang uit een drietal gangen met bijgebouwen rondom een pandhof, die als tuin is ingericht."},{"page_url":"https://pl.wikipedia.org/wiki/NHL_(2017/2018)_Play-off","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/T.J._Oshie_2016-04-07_2.JPG","page_title":"NHL (2017/2018) Play-off","context_page_description":"NHL (2017/2018) Play-off – rozgrywka finałowa sezonu 2017/2018 w amerykańsko-kanadyjskiej lidze hokejowej NHL o Puchar Stanleya. Mecze odbywały się od 11 kwietnia do 7 czerwca. Puchar Stanleya zdobyła po raz pierwszy w historii drużyna Washington Capitals."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%87%E9%99%8D%E6%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/HK_Wan_Chai_Immagration_Bldg_Floors_The_38th_floor_Lift_Hall.JPG","page_title":"升降机","context_page_description":"升降機，其他地區亦稱電梯。在香港、新加坡和馬來西亞俗稱「𨋢」，是一種垂直運送行人或貨物的運輸工具。據統計，2002年全球電梯總數超過600萬部，是現代使用最多的垂直運輸工具。\\n電梯具有一個轎廂，運行在至少兩列垂直的或傾斜角小於15°的剛性導軌之間。轎廂尺寸與結構形式便於乘客出入或裝卸貨物。習慣上不論其驅動方式如何，將電梯作為建築物內垂直交通運輸工具的總稱。按速度可分低速電梯、快速電梯和高速電梯。"},{"page_url":"https://fr.wikipedia.org/wiki/Gymnostoma_chamaecyparis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Gymnostoma_chamaecyparis.jpg","page_title":"Gymnostoma chamaecyparis","context_page_description":"Gymnostoma chamaecyparis est un arbre endémique de Nouvelle-Calédonie. Il est appelé localement « bois de fer »."},{"page_url":"https://en.wikipedia.org/wiki/Huashan_1914_Creative_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Huashan_1914_Creative_Park_View_2015.jpg","page_title":"Huashan 1914 Creative Park","context_page_description":"The Huashan 1914 Creative Park is a multi-purpose park in Zhongzheng District, Taipei, Taiwan."},{"page_url":"https://es.wikipedia.org/wiki/%C3%89poca_progresista_(Ecuador)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Ecuador1893.png","page_title":"Época progresista (Ecuador)","context_page_description":"La época progresista es un periodo de la historia ecuatoriana comprendido entre la muerte de García Moreno en 1875 y la llegada al poder de la revolución liberal en 1895. Nombrado así por la existencia e influencia del Partido Progresista, grupo que tenía una posición intermedia entre los liberales y los conservadores, por lo cual se lo puede considerar como una transición entre el régimen de García Moreno y el de Eloy Alfaro.​"},{"page_url":"https://ca.wikipedia.org/wiki/Mildstedt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Mildstedt_St._Lamberti-Kirche.JPG","page_title":"Mildstedt","context_page_description":"Mildstedt és un municipi del districte de Nordfriesland, dins l'Amt Nordsee-Treene, a l'estat alemany de Slesvig-Holstein. Es troba al sud-est de Husum.\\nEs troba al geest, travessat pel Mühlenau. Limita a l'est amb el Treene i al nord amb l'Arlau. El municipi del qual la principal activitat econòmica era l'agricultura, a poc a poc esdevé un dormitori d'Husum. El 2004 va celebrar el setcentenari del primer esment escrit que data del 1304."},{"page_url":"https://pl.wikipedia.org/wiki/Historia_Marii_Medycejskiej_(cykl_obraz%C3%B3w)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Peter_Paul_Rubens_035.jpg","page_title":"Historia Marii Medycejskiej (cykl obrazów)","context_page_description":"Historia Marii Medycejskiej – cykl obrazów autorstwa flamandzkiego malarza Petera Paula Rubensa."},{"page_url":"https://en.wikipedia.org/wiki/Morus_nigra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%D8%AB%D9%85%D8%B1%D8%A9_%D8%AA%D9%88%D8%AA.jpg","page_title":"Morus nigra","context_page_description":"Morus nigra, called black mulberry or blackberry, is a species of flowering plant in the family Moraceae, native to southwestern Asia and the Iberian Peninsula, where it has been cultivated for so long that its precise natural range is unknown. It is known for its large number of chromosomes, 308. Other mulberry species are sometimes confused with black mulberry, particularly black-fruited individuals of the white mulberry, but black mulberry can be distinguished by the uniformly hairy lower leaf surface."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%82%A4%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Baydhabo7890989.jpg","page_title":"ベイ州","context_page_description":"ベイ州は、ソマリアの旧行政区画のひとつ。州都はバイドア。ソマリアの旧行政区画では唯一インド洋と他国に接しておらず、周囲はすべて他州に囲まれている。接している州は北から時計回りにバコール、下部シェベリ、中部ジュバ、ゲドの4つではあるが、北東部に位置するヒーラーンも含める場合もある。人口は約79万人で、18つある旧行政区画の中では4番目とかなり多いほうである。\\nソマリア内戦勃発後、州都バイドアは統一ソマリ会議、ラハンウェイン抵抗軍、ソマリア暫定連邦政府、アル・シャバブと支配勢力が変わっており、バイドア以外の州域でもイスラム法廷会議などが支配下に置いたこともある。\\n近年ではソマリア連邦政府及びエチオピア連合軍が州都バイドアをアル・シャバブから奪還しており、2014年にはソマリア連邦政府側として再建された南西ソマリア自治政府の領域にベイ州は組み込まれた。"},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Dijon-Ville","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Gare_de_Dijon-Ville2.jpg","page_title":"Gare de Dijon-Ville","context_page_description":"La gare de Dijon-Ville est une gare ferroviaire française de la ligne de Paris-Lyon à Marseille-Saint-Charles et d'une étoile ferroviaire comprenant plusieurs lignes. Dite aussi Gare Foch, elle est la gare principale de la ville de Dijon, dans le département de la Côte-d'Or, en région Bourgogne-Franche-Comté. La gare secondaire de Dijon-Porte-Neuve est située sur la ligne de Dijon-Ville à Is-sur-Tille.\\nElle est mise en service en 1849 par l'Administration des chemins de fer de l'État, avant de devenir en 1852 une gare du réseau de la Compagnie du chemin de fer de Lyon à la Méditerranée.\\nC'est une gare de la Société nationale des chemins de fer français, desservie par le TGV depuis 1981. Elle est également la principale gare du réseau régional TER Bourgogne-Franche-Comté."},{"page_url":"https://en.wikipedia.org/wiki/Deadpool_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Deadpool%2C_Georgia_Viaduct%2C_Vancouver%2C_April_6_2015_-_3.jpg","page_title":"Deadpool (film)","context_page_description":"Deadpool is a 2016 American superhero film based on the Marvel Comics character of the same name. Distributed by 20th Century Fox, it is the eighth film in the X-Men film series. Directed by Tim Miller from a screenplay by Rhett Reese and Paul Wernick, it stars Ryan Reynolds in the title role alongside Morena Baccarin, Ed Skrein, T. J. Miller, Gina Carano, and Brianna Hildebrand. In the film, Wade Wilson hunts the man who gave him mutant abilities and a scarred physical appearance, becoming the wisecracking antihero Deadpool.\\nDevelopment of a Deadpool film starring Reynolds began in February 2004, before he went on to play the character in X-Men Origins: Wolverine in 2009. Reese and Wernick were hired for a spinoff in 2010. They worked with Reynolds to adapt the character more faithfully after the portrayal in Wolverine was criticized for not doing so. Miller was hired in 2011, marking his directorial debut. An enthusiastic response to leaked test footage he created with Reynolds led to a green-light from Fox in 2014. Additional casting began in early 2015, and filming took place in Vancouver, Canada, from March to May of that year."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%91%A1%E8%90%84%E5%B9%B2%E8%9B%8B%E7%B3%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Teekuchen%2C_Miltenberg%2C_Germany.JPG","page_title":"葡萄干蛋糕","context_page_description":"葡萄干蛋糕主要的成分是使用葡萄干。有时使用其他成分，如巧克力和兰姆酒。最早可追溯至约前1010年至前970年的大卫王时期，而烘烤过的葡萄干蛋糕至少可以追溯至南北战争时期。"},{"page_url":"https://pl.wikipedia.org/wiki/Cesarze_rzymscy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ingenuus.jpg","page_title":"Cesarze rzymscy","context_page_description":"Chronologiczna lista władców Rzymu okresu cesarstwa."},{"page_url":"https://en.wikipedia.org/wiki/Meanwood","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Meanwood_Park_Sign.jpg","page_title":"Meanwood","context_page_description":"Meanwood is a suburb and former village in north-east Leeds, West Yorkshire, England.\\nThe area sits in the Moortown ward of Leeds City Council and Leeds North East parliamentary constituency."},{"page_url":"https://de.wikipedia.org/wiki/Kanton_B%C3%A9thune","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Locator_map_of_Kanton_B%C3%A9thune_2019.png","page_title":"Kanton Béthune","context_page_description":"Der Kanton Béthune ist ein französischer VWahlkreis im Arrondissement Béthune, im Département Pas-de-Calais und in der Region Hauts-de-France; sein Hauptort ist Arras.\\nDer Kanton Berck ist 43,13 km² groß und hat 41.920 Einwohner, was einer Bevölkerungsdichte von 972 Einwohnern pro km² entspricht."},{"page_url":"https://eu.wikipedia.org/wiki/Saint-Martin-du-Tilleul","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Saint-Martin-du-Tilleul_%28Eure%29_%C3%A9glise.JPG","page_title":"Saint-Martin-du-Tilleul","context_page_description":"Saint-Martin-du-Tilleul Frantziako udalerria da, Eure departamenduan dagoena, Normandia Garaia eskualdean. 2013an 259 biztanle zituen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Ludwigslust","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/LwlNeust%C3%A4dter5.jpg","page_title":"Liste der Baudenkmale in Ludwigslust","context_page_description":"In der Liste der Baudenkmale in Ludwigslust sind alle Baudenkmale der Stadt Ludwigslust und ihrer Ortsteile aufgelistet."},{"page_url":"https://ro.wikipedia.org/wiki/Banca_Mondial%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/World_Bank_building_at_Washington.jpg","page_title":"Banca Mondială","context_page_description":"Banca Mondială este o bancă susținută cu finanțări internaționale care oferă asistență financiară și tehnică țărilor sărace.\\nGrupul Băncii Mondiale este o instituție formată din alte cinci instituții financiare internaționale, și anume:\\nBanca Internațională pentru Reconstrucție și Dezvoltare - BIRD\\nCorporația Financiară Internațională - IFC\\nAsociația Internațională de Dezvoltare - IDA\\nAgenția de Garantare Multilaterală a Investițiilor - MIGA\\nCentrul Internațional de Reglementare a Diferendelor din Domeniul Investițiilor - ICSID.\\nFiecare instituție are un rol distinct în lupta împotriva sărăciei și îmbunătățirea condițiilor de viață pentru populația din statele în curs de dezvoltare.\\nTermenul generic de Banca Mondială se referă în principal la BIRD și IDA, iar proiectele principale de finanțare se derulează prin IBRD."},{"page_url":"https://en.wikipedia.org/wiki/Taronga_Zoo_Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/TarongaZooWharf1.jpg","page_title":"Taronga Zoo Sydney","context_page_description":"Taronga Zoo Sydney is Australia's largest zoo, located in Sydney, New South Wales, Australia in the suburb of Mosman, on the shores of Sydney Harbour.\\nIt was officially opened on 7 October 1916. Taronga Zoo Sydney is managed by the Zoological Parks Board of New South Wales, under the trading name Taronga Conservation Society, along with its sister zoo, the Taronga Western Plains Zoo in Dubbo.\\nDivided into eight zoogeographic regions, the 28-hectare Taronga Zoo Sydney is home to over 4,000 animals of 350 species. It has a zoo shop, a cafe, and information centre."},{"page_url":"https://de.wikipedia.org/wiki/Larrelter_M%C3%BChle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Larrelter_M%C3%BChle.JPG","page_title":"Larrelter Mühle","context_page_description":"Die Larrelter Mühle ist eine zweistöckige Holländerwindmühle mit Galerie, Segelflügeln und Windrose im Stadtteil Larrelt von Emden in Niedersachsen. Die Mühle am Mühlenhörn trägt den Namen „Kost Winning“, wurde 1732 gebaut und ist eine der ältesten erhaltenen Mühlen ihrer Art in Deutschland. Sie ist vom Erdboden bis zur Kappe 19,20 Meter hoch."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdische_Gemeinde_Neustadt_an_der_Waldnaab","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/JudenViertelNeustadtWN.jpg","page_title":"Jüdische Gemeinde Neustadt an der Waldnaab","context_page_description":"Die Jüdische Gemeinde Neustadt an der Waldnaab bestand in Neustadt an der Waldnaab vom 14. Jahrhundert bis 1684."},{"page_url":"https://fr.wikipedia.org/wiki/Horloge_Colgate_(New_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Colgate_Clock_Jersey_City_%281_of_2%29_%283157735699%29.jpg","page_title":"Horloge Colgate (New Jersey)","context_page_description":"L'horloge Colgate est une horloge octogonale située devant le fleuve Hudson, à proximité du district d'Exchange Place, à Jersey City. Elle est présentement située à 400 mètres au sud de l'ancien emplacement du siège social du conglomérat Colgate-Palmolive, déplacé en 1985.\\nL'horloge est élevée en 1924, pour remplacer l'ancienne horloge, déplacée sur une nouvelle usine à proximité de Jeffersonville dans l'Indiana. Lors de l'inauguration, le pôle publicité de Colgate dit qu'il s'agit de la plus grande horloge du monde.\\nElle a un diamètre d'environ 15 mètres. Son aiguille des minutes pèse un peu moins de 1 000 kg."},{"page_url":"https://fr.wikipedia.org/wiki/L%27Europe_de_Rubens","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Louvre-Lens_-_L%27Europe_de_Rubens_-_017_-_Francisco_de_Sandoval_y_Rojas%2C_duc_de_Lerme%2C_%C3%A0_cheval.JPG","page_title":"L'Europe de Rubens","context_page_description":"L'Europe de Rubens est une exposition temporaire du Louvre-Lens qui a lieu dans la Galerie des expositions temporaires, du 22 mai au 23 septembre 2013, succédant ainsi à l'exposition inaugurale Renaissance. L'exposition rassemble 170 œuvres autour de Pierre Paul Rubens et de ses contemporains, la majorité de celles-ci proviennent de prêts de la part d'autres musées.\\nL'exposition s'achève après quatre mois d'ouverture au public, ce sont ainsi 127 956 visiteurs qui y ont assisté, soit un peu plus de 20 000 de moins que l'exposition inaugurale, pourtant ouverte trois semaines de moins. Le bilan de l'exposition en termes de visiteurs est décrit comme un « succès » et « un bilan satisfaisant », bien que les critiques des journalistes comme des spécialistes soient très mitigées, voire parfois négatives, sur le contenu de celle-ci, bien qu'ils reconnaissent la qualité des œuvres exposées. L'Europe de Rubens est remplacée par Les Étrusques et la Méditerranée à partir du 5 décembre 2013."},{"page_url":"https://en.wikipedia.org/wiki/Mark_Levin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Mark_Levin.jpg","page_title":"Mark Levin","context_page_description":"Mark Reed Levin is an American lawyer, author, and radio personality. He is the host of syndicated radio show The Mark Levin Show, as well as Life, Liberty & Levin on Fox News. Levin worked in the administration of President Ronald Reagan and was a chief of staff for Attorney General Edwin Meese. He is the former president of the Landmark Legal Foundation, a New York Times best-selling author of seven books, and contributes commentary to media outlets such as National Review Online. Since 2015, Levin has been editor-in-chief of the Conservative Review and is known for his incendiary commentary.\\nHe has been described as \\"right-wing\\" by The New York Times, CNN, and Politico He is known for his incendiary criticisms of Democrats and encouragement of primary challenges to congressional Republicans that he considers to be \\"Republican In Name Only\\". He endorsed Ted Cruz in the 2016 Republican presidential primary and declared himself \\"Never Trump\\", but reluctantly endorsed Donald Trump after Trump won the Republican nomination. Since the start of the Trump presidency, Levin's commentary has become strongly pro-Trump."},{"page_url":"https://ms.wikipedia.org/wiki/Radhika_Apte","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Radhika_Apte_snapped_on_the_sets_of_Midnight_Misadventures_with_Mallika_Dua_%2806%29_%28cropped%29.jpg","page_title":"Radhika Apte","context_page_description":"Radhika Apte ialah seorang pelakon wanita India. Dilahirkan dan dibesarkan di Pune, Maharashtra, Apte memulakan kerjaya lakonan dengan muncul dalam penerbitan teater sebelum beralih ke filem."},{"page_url":"https://es.wikipedia.org/wiki/Glorioso_Colegio_Nacional_de_San_Carlos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Colegio_Glorioso_San_Carlos_Puno_%28Emblem%C3%A1tico%29.jpg","page_title":"Glorioso Colegio Nacional de San Carlos","context_page_description":"El colegio más antiguo de la ciudad de Puno;​ creado por decreto de Simón Bolívar, en fecha 7 de agosto de 1825 como Colegio de Ciencias y Artes de Puno, ​​​​ de acuerdo a la Ley General de Educación peruana, Ley N.º 28044, ​ Decreto Supremo N° 66 de 1966 y la Resolución Ministerial N.º 0050-2009-Ed, es denominada como Institución Educativa Emblemática Secundaria “Glorioso Colegio Nacional de San Carlos” de Puno; y de forma abreviada para fines administrativos, Institución Educativa \\"Glorioso San Carlos\\".​"},{"page_url":"https://ca.wikipedia.org/wiki/Rhipsalis_baccifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Rhipsalis_baccifera_01_ies.jpg","page_title":"Rhipsalis baccifera","context_page_description":"Rhipsalis baccifera, és una espècie de cactus epífit que és l'única espècie de cactus que es troba de forma natural també fora d'Amèrica, concretament a l'Àfrica Tropical, Madagascar i Sri Lanka, probablement els ocells migradors van transportar les llavors o propàguls d'aquest cactus. La seva distribució a Amèrica comprèn Amèrica central i Amèrica del Sud incloent el Carib i Florida."},{"page_url":"https://de.wikipedia.org/wiki/Medaille_Leninaufgebot_der_FDJ","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Medaille_Leninaufgebot_der_FDJ.jpg","page_title":"Medaille Leninaufgebot der FDJ","context_page_description":"Die Medaille Leninaufgebot der FDJ war eine Auszeichnung der Freien Deutschen Jugend der Deutschen Demokratischen Republik, welche anlässlich des 100. Geburtstages von Lenin sowie des 25. Jahrestages der Befreiung vom Faschismus am 14. Oktober 1969 in einer Stufe gestiftet und 1970 an die FDJler des Festivalaufgebotes verliehen wurde. Das Leninaufgebot selbst dauerte von Oktober 1969 bis Sommer 1970 an."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B6%E0%A6%BE%E0%A6%B9_%E0%A6%87%E0%A6%B8%E0%A6%AE%E0%A6%BE%E0%A6%87%E0%A6%B2_%E0%A6%B6%E0%A6%B9%E0%A7%80%E0%A6%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Grave_of_Shah_Ismail_Shahid_%282%29_%2C_Balakot.jpg","page_title":"শাহ ইসমাইল শহীদ","context_page_description":"শাহ ইসমাইল শহীদ ছিলেন একজন ইসলামী পন্ডিত। উনিশ শতকে পাঞ্জাবের শিখ রাজ্যের বিরুদ্ধে সৈয়দ আহমদ শহীদ-এর ডাক দেয়া জিহাদের তিনি একজন যোদ্ধা ছিলেন।"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%84%9B%E7%9F%A5%E7%9C%8C%E9%81%93331%E5%8F%B7%E4%B8%80%E8%89%B2%E5%B0%8F%E4%B9%85%E7%94%B0%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Aichi_Pref_r-331_Isshiki.JPG","page_title":"愛知県道331号一色小久田線","context_page_description":"愛知県道331号一色小久田線は、愛知県岡崎市内を通る一般県道である。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%9E%D7%A8%D7%99%D7%AA_%D7%9C%D7%95%D7%A1%D7%98%D7%99%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Les_Fourberies_de_Scapin_22.JPG","page_title":"שמרית לוסטיג","context_page_description":"שמרית לוסטיג היא שחקנית ישראלית."},{"page_url":"https://fi.wikipedia.org/wiki/Uusklassinen_arkkitehtuuri","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Monticello.jpg","page_title":"Uusklassinen arkkitehtuuri","context_page_description":"Uusklassinen arkkitehtuuri on arkkitehtuurin suuntaus, joka syntyi suurin piirtein 1700-luvun puolivälissä lähes yhtä aikaa Ranskassa, Saksassa ja Englannissa. Uusklassismi otti vaikutteensa suoraan antiikin Kreikan ja Rooman rakennustaiteesta sekä renessanssiajan palladiolaisesta arkkitehtuurista. Rönsyilevän barokki- ja rokokooarkkitehtuurin jälkeen uusklassismi pyrki takaisin \\"puhtaaseen\\" klassiseen arkkitehtuuriin, ja se palautti rakennuksiin yksinkertaiset ja suoraviivaiset muodot sekä antiikista tutut pylväsjärjestelmät. Sen nousuun vaikutti antiikin taiteen ja arkkitehtuurin kasvanut tuntemus, sekä varsinkin sisätilojen suunnittelussa Pompejissa tehdyt löydöt. Antiikista tuli tuolloin muoti-ilmiö kasvavien arkeologisten löytöjen ansiosta.\\nSuomessa ja Ruotsissa varhaisin uusklassismi tunnetaan kustavilaisena tyylinä. Sitä seurasi Napoleonin ajan keisarityyli eli empire. Helsingin keskusta-arkkitehtuuri edustaa etenkin Carl Ludvig Engelin suunnitelmien ansiosta suurelta osin uusklassismia. Samoin Pietari ja München ovat likimain uusklassismin ulkomuseoita."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A6%E3%83%BC%E3%83%95%E3%82%A9%E3%83%AA%E3%82%A2/EUPHORIA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Alexa_Demie_Honk_2019.png","page_title":"ユーフォリア/EUPHORIA","context_page_description":"『ユーフォリア/EUPHORIA』は、2019年から放送しているアメリカ合衆国のテレビドラマシリーズ。ソーシャルメディア時代を生きるZ世代のティーンエイジャーを描く。制作はサム・レヴィンソン、出演はゼンデイヤなど。製作会社にA24、製作総指揮にドレイクらが参加している。アメリカでは2019年6月からHBOで放送された。日本では2019年10月からスターチャンネルで日本語字幕・吹き替え版が放送された。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1994","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/CharlieHeaton2017.jpg","page_title":"Lijst van personen geboren in 1994","context_page_description":"Dit is een lijst van personen die geboren zijn in 1994.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/List_of_ant_genera","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Myopopone_castanea_casent0104581_profile_1.jpg","page_title":"List of ant genera","context_page_description":"Ants are the most species-rich of all social insects, with more than 12,000 described species and many others awaiting description. Formicidae is divided into 21 subfamilies, of which 17 are extant and four subfamilies are extinct, described from fossils. In total more than 300 genera have been described. Ants have come to occupy virtually all major terrestrial habitats, with the exception of tundra and cold ever-wet forests. They display a wide range of social behaviors, foraging habits and associations with other organisms, which has generated scientific and public interest.\\nThe following is a list of worldwide ant genera organised by subfamily."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B5%E0%B0%BE%E0%B0%A3%E0%B0%BF_%E0%B0%B5%E0%B0%BF%E0%B0%B2%E0%B0%BE%E0%B0%B8_%E0%B0%B8%E0%B0%BE%E0%B0%97%E0%B0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Mari_Kanive_Vani_Vilasa_Sagara.jpg","page_title":"వాణి విలాస సాగర","context_page_description":"వాణి విలాస సాగర, కర్ణాటక రాష్ట్రంలోని చిత్రదుర్గ జిల్లాలో హిరియుత్ తాలూకాలో నిర్మించబడిన ఆనకట్ట. ఇది రాష్ట్రంలో పురాతన ఆనకట్ట.\\nఈ ఆనకట్టను మైసూరు మహారాజులు భారత స్వాంత్ర్యానికి పూర్వం వేదావతి నదిపై నిర్మించారు. ఈ మనోరంజకమైన నిర్మాణం ఆ కాలంలో ఇంజనీరింగ్ లో ఒక అద్భుతంగా చెప్పుకోవచ్చు. మధ్య కర్ణాటక దక్కన్ ప్రాంతంలో విస్తారమైన బీడు భూములైన పరిసర నగరాలు, పట్టణాలు, గ్రామాలకు ఇది నీటిని అందిస్తుంది."},{"page_url":"https://hu.wikipedia.org/wiki/Reardan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Reardan.jpg","page_title":"Reardan","context_page_description":"Reardan az Amerikai Egyesült Államok északnyugati részén, Washington állam Lincoln megyéjében elhelyezkedő város. A 2010. évi népszámlálási adatok alapján 571 lakosa van.\\nAz 1882-ben alapított település névadója C. F. Reardan mérnök. Reardan 1903. április 14-én kapott városi rangot.\\nA helységben egy általános- és egy középiskola működik."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D8%B4%D9%82_%D8%A3%D9%88%D8%B1%D8%A7%D8%B3%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Accipiter_nisus_9194.JPG","page_title":"باشق أوراسي","context_page_description":"البَاشِق الأوراسيّ أو البَاشِق الشِّماليّ، أو مجرَّد البَاشِق هو أحد أنواع الجوارح صغيرة الحجم المُنتمية لفصيلة البازية، وهو واسع الانتشار في القسم الأعظم من أوراسيا وفي شمال أفريقيا. تختلف الذكور والإناث عن بعضها من ناحية الهيئة الخارجيَّة، فالبوالغ من الذكور تتمتع بريشٍ رماديّ مُزرق ذي شرائط برتقاليَّة على القسم السفلي من جسدها؛ بينما الإناث والفراخ اليافعة بُنيَّة على القسم العلوي ومُخططة بخطوطٍ بُنيَّة على القسم السُفليّ. والأنثى أكبر حجمًا من الذكر بحوالي 25%، مما يجعل من فارق الحجم بين الجنسين أحد أعظم الفوارق عند أي نوعٍ آخر من الطيور. الباشق الأوراسي صيَّادٌ حُرجيّ بالمقام الأوَّل، يفتك بالطيور الحرجيَّة الصغيرة غالبًا، غير أنَّه يمكن العثور عليه في عدَّة أشكال من الموائل الطبيعيَّة والاصطناعيَّة بما فيها الحدائق العامَّة والحدائق المنزليَّة والقرى والمُدن، حيث يعيش على صيد الطيور قاطنتها. تميلُ الذكور إلى صيد الطيور الصغيرة من شاكلة القراقف والشراشير وعصافير الدوري؛ أمَّا الإناث فقادرة على الإمساك بطيورٍ أكبر حجمًا مثل السمنات والزرازير وأي نوعٍ آخر يصل وزنه إلى حوالي 500 غرام أو أكثر بقليل."},{"page_url":"https://en.wikipedia.org/wiki/Mill_Creek_Zanja","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Mill_Creek_Zanja.jpg","page_title":"Mill Creek Zanja","context_page_description":"The Mill Creek Zanja, also known as the Sankey, is a historic irrigation canal, or zanja, in Redlands, California. The Serrano people dug the canal in 1819 to provide water from Mill Creek for their farms east of the city. The zanja also provided water for the San Bernardino de Sena Estancia mission outpost, which was built near the canal to access its water. The canal's water became a highly desirable resource in the area; it fueled a local agricultural boom and was the subject of several legal disputes over water rights in the 1800s. The City of Redlands covered the western half of the zanja in the 1920s.\\nThe zanja was designated a California Historical Landmark in 1932 and placed on the National Register of Historic Places in 1977. The canal now carries drainage water and storm runoff out of the city; it is the oldest irrigation canal in California which is still in use and the oldest civil engineering project in Southern California. The city, along with several other local groups, is building a trail and greenway alongside the canal."},{"page_url":"https://da.wikipedia.org/wiki/Deloitte","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/2013-03-26_Ny_T%C3%B8jhusgrunden_Deloitte_1.jpg","page_title":"Deloitte","context_page_description":"Deloitte Touche Tohmatsu er det største konsulentfirma i verden og en af de fire store revisionsvirksomheder sammen med PricewaterhouseCoopers, Ernst & Young og KPMG. Ifølge firmaets hjemmeside pr. 2010 har Deloitte ca. 170.000 ansatte i 140 lande, der leverer rådgivning inden for revision, skat, konsulentvirksomhed og finansielle ydelser. I 2009/2010 havde Deloitte en omsætning på 26,6 mia. dollar.\\nVirksomheden blev grundlagt af William Welch Deloitte i 1845.\\nDeloitte er organiseret som en frivillig medlemskabsorganisation under den schweiziske civillov, hvor hvert medlemsfirma er separat og uafhængigt. Firmaets verdenshovedkvarter ligger i New York City og det europæiske hovedkvarter i London.\\nI Danmark er Deloitte det største revisonsfirma og beskæftiger i alt 2.500 ansatte."},{"page_url":"https://es.wikipedia.org/wiki/Batalla_de_Sahag%C3%BAn_(1808)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Henry_William_Paget00a.jpg","page_title":"Batalla de Sahagún (1808)","context_page_description":"La batalla de Sahagún fue un choque de caballería en el que el 15.º Regimiento ligero de dragones británico derrotó a dos regimientos franceses durante la Campaña de La Coruña de la Guerra de la Independencia española, uno de los cuales fue completamente desbaratado. Esta acción marcó el final del avance del ejército británico hacia el interior de España, y fue seguido por la retirada de sus fuerzas hacia la costa y posterior evacuación."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%AC%E0%B1%8B%E0%B0%B0%E0%B0%B5%E0%B1%86%E0%B0%B2%E0%B1%8D%E0%B0%B2%E0%B0%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Njn1047%E0%B0%AC%E0%B1%8B%E0%B0%B0%E0%B0%B5%E0%B1%86%E0%B0%B2%E0%B1%8D%E0%B0%B2%E0%B0%BF.jpg","page_title":"బోరవెల్లి","context_page_description":"బోరవెల్లి, తెలంగాణ రాష్ట్రం, జోగులాంబ గద్వాల జిల్లా, మానవపాడ్ మండలంలోని గ్రామం.\\nఇది మండల కేంద్రమైన మానోపాడ్ నుండి 7 కి. మీ. దూరం లోను, సమీప పట్టణమైన కర్నూలు నుండి 28 కి. మీ. దూరంలో హైదరాబాద్ నుండి కర్నూలుకు వెళ్ళు 7 వ నెంబరు జాతీయ రహదారి మార్గంలో ఉంది. రహదారిపై ఎడమవైపు కర్నూలుకు 25 కిలో మీటర్లకు ముందుగానే ఈ గ్రామం స్టేజి వస్తుంది. అక్కడి నుండి ఉత్తరానికి మూడు కిలో మీటర్ల దూరంలో ఈ గ్రామం ఉంది."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D0%B5%D1%80-%D0%BF%D1%80%D0%BE%D0%BA%D1%83%D1%80%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Protasov_Nikolay_Alexandrovich.jpg","page_title":"Обер-прокурор","context_page_description":"О́бер-прокуро́р — должность в Российской империи. Существовали должности синодального и сенатского обер-прокурора."},{"page_url":"https://pl.wikipedia.org/wiki/Alberto_Giacometti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Alberto_Giacometti%2C_par_sa_femme_Annette_%C2%A9_Succession_Alberto_Giacometti_%28Fondation_Giacometti%2C_Paris_%2B_ADAGP%2C_Paris%29_2019.jpg","page_title":"Alberto Giacometti","context_page_description":"Alberto Giacometti – szwajcarski rzeźbiarz i malarz.\\nUchodził za jednego z pionierów rzeźby modernistycznej na pograniczu ekspresjonizmu i surrealizmu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_im_Okres_D%C4%9B%C4%8D%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Jansk%C3%A1%2C_sloup_se_sochou_svat%C3%A9ho_Jana_Nepomuck%C3%A9ho.jpg","page_title":"Liste der denkmalgeschützten Objekte im Okres Děčín","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte im Okres Děčín ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt.\\nDie folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalbehörde.\\nDie denkmalgeschützten Objekte werden hier für die einzelnen Gemeinden aufgelistet.\\nAußerdem gibt es separate Listen für folgende Orte:\\nListe der denkmalgeschützten Objekte in Benešov nad Ploučnicí\\nListe der denkmalgeschützten Objekte in Česká Kamenice\\nListe der denkmalgeschützten Objekte in Děčín\\nListe der denkmalgeschützten Objekte in Františkov nad Ploučnicí\\nListe der denkmalgeschützten Objekte in Chřibská\\nListe der denkmalgeschützten Objekte in Jetřichovice\\nListe der denkmalgeschützten Objekte in Jiřetín pod Jedlovou\\nListe der denkmalgeschützten Objekte in Krásná Lípa\\nListe der denkmalgeschützten Objekte in Merboltice\\nListe der denkmalgeschützten Objekte in Mikulášovice\\nListe der denkmalgeschützten Objekte in Rumburk\\nListe der denkmalgeschützten Objekte in Srbská Kamenice\\nListe der denkmalgeschützten Objekte in Šluknov\\nListe der denkmalgeschützten Objekte in Valkeřice"},{"page_url":"https://de.wikipedia.org/wiki/Gerstungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Kirche_Sallmannshausen.jpg","page_title":"Gerstungen","context_page_description":"Gerstungen ist eine Gemeinde im Wartburgkreis in Thüringen. Gerstungen ist durch die Fusion mit den Gemeinden Wolfsburg-Unkeroda und Marksuhl am 6. Juli 2018 die flächengrößte und mit rund 9100 Einwohnern einwohnerreichste Gemeinde Thüringens ohne Stadtrecht."},{"page_url":"https://sco.wikipedia.org/wiki/Balmaghie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Picture_of_Little_Duchrae.jpg","page_title":"Balmaghie","context_page_description":"Balmaghie, fae the Scots Gaelic Baile Mhic Aoidh, is an ecclesiastical an ceevil pairish in the historical coonty o Kirkcoubrieshire in Dumfries an Gallowa, Scotland, an wis the seat o the McGhee familie. It is maircht bi the River Dee til the north an east. Threave Castle staunds on an island in the river. The River Dee is kent common as The Black Watter o Dee on the northren mairch, the name chainges wi the meetin o the Watter o Ken til the northwast, an is kent as Loch Ken alang the eastlin mairch. Balmaghie pairish mairches Girthon til the wast, an Tongland an Twynholm til the sooth. The nearest mercat toon is Castle Douglas that is aboot 6 mile fae Balmaghie Kirk.\\nThe ecclesiastical pairish kivers the same aurie as the ceevil pairish an the twa is nae conseedert tae be different.\\nBalmaghie pairish is main landwart an conteens juist a haundfu o wee settlements: Clachanpluck, Brig o Dee, an Glenlochar, as weel as a nummer o ferms an hooses scaitert aboot the pairish. Fermin is the main industry o the aurie, houiver thare is a muckle aurie o commercial forestation operatit bi the Forestry Commission til the wast o Laurieston."},{"page_url":"https://es.wikipedia.org/wiki/Coalici%C3%B3n_de_las_Bombas_de_Racimo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/B1-B_Lancer_and_cluster_bombs.jpg","page_title":"Coalición de las Bombas de Racimo","context_page_description":"{{no neutralidad}}\\nLa Coalición contra las Bombas de Racimo es una organización de sociedad civil internacional, comprometida al paro del uso de la bomba de racimo, un tipo de arma que ha matado a gran cantidad de civiles, que frecuentemente tiene efectos indiscriminados{{[Cita requerida]}}, y que se encuentra almacenado en los miles de millones en más de 70 países{{[Cita requerida]}}.\\nLa Coalición, formada en noviembre del 2003, es una red de organizaciones de la sociedad civil, incluyendo ONG, grupos de fe, y organizaciones profesionales. Incluye a organizaciones a nivel mundial como Amnistía Internacional, Human Rights Watch, así como a organizaciones nacionales como la Swedish Peace and Arbitration Society{{[Cita requerida]}}.\\nTodas estas organizaciones comparten el objetivo común de encontrar la forma de que estas armas dejen de causar heridos y muertos entre las poblaciones civiles. A través de sus actividades, la gente que forma la Coalición, ha seguido y ha aprendido sobre el impacto que tienen las bombas de racimo contra los civiles{{polémico}}."},{"page_url":"https://en.wikipedia.org/wiki/Jay_Zeamer_Jr.","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Zeamer.jpg","page_title":"Jay Zeamer Jr.","context_page_description":"Jay Zeamer Jr. was a pilot of the United States Army Air Forces in the South Pacific during World War II, and received the Medal of Honor for valor during an air mission on June 16, 1943. After the war, he became an aeronautical engineer and worked in the aerospace industry."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AB%E3%82%AD%E3%83%8A%E3%83%95%E3%82%A1%E3%82%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/MossiCavalry.jpg","page_title":"ブルキナファソ","context_page_description":"ブルキナファソは、西アフリカに位置する共和制国家。北にマリ、東にニジェール、南東にベナン、トーゴ、南にガーナ、南西にコートジボワールと国境を接する内陸国である。首都はワガドゥグー。\\n第二次世界大戦後、1960年にオートボルタ共和国として独立した。独立後、フランスから離れて非同盟路線を歩み、東側諸国と友好関係を築いたが、1987年以降はフランスとの関係を最重視している。現在の国名ブルキナファソは1984年に旧来の国名のオートボルタから改称された。"},{"page_url":"https://nl.wikipedia.org/wiki/Van_Assendelft","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Willem_van_Assendelft_wapen.svg","page_title":"Van Assendelft","context_page_description":"Van Assendelft is een in 1668 uitgestorven adellijke familie uit Holland."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%89%A6%E8%BC%89%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Dassault_Rafale_landing_aboard_USS_Theodore_Roosevelt_%28CVN-71%29_080719-N-4519D-010.jpg","page_title":"艦載機","context_page_description":"艦載機是配備在航空母艦上的主要武器，其性能決定著航空母艦的戰鬥能力，載機數量越多者實力也相對越強，航空母艦本身也是為了讓飛機起降、維修以及使其能長期作戰而存在，相較於傳統最大攻擊距離僅有40公里的戰艦艦砲武器，現代艦載機有著1,000公里以上的作戰半徑，還可以空中加油的方式延長航程，並能在攻擊完後回到航艦上裝載彈藥，再度起飛攻擊，其作戰持續性和任務多樣的作戰能力也是艦載機與巡弋飛彈在海戰所扮演的角色最大的不同。"},{"page_url":"https://eu.wikipedia.org/wiki/Hamarkada_Moderatua","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Portrait_of_Isabella_II_of_Spain.png","page_title":"Hamarkada Moderatua","context_page_description":"Espainiako historiografian, Hamarkada Moderatua 1844ko maiatzaren eta 1854ko uztailaren arteko Elisabet II.a Espainiakoaren erregealdiaren aldia da. Hamarkada horretan, Alderdi Moderatuaren liberal kontserbadoreek bakarrik- koroaren babesari esker- boterea izan zuten eta progresistek ez zuten gobernatzeko aukera bakar bat ere izan. 1844ko maiatzaren 4an hasi zen, Ramón María Narváez jeneralak boterea eskuratu zuenean hasi zen eta Vicalvarada izeneko altxatze militarrak bukatu zuen. Hurrengo aldiak Biurteko Progresista zuen izena."},{"page_url":"https://tr.wikipedia.org/wiki/Hacc%C3%A2c_bin_Y%C3%BBsuf_es-Sekaf%C3%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Siria%2C_hajjaj_bin_yusuf%2C_drahm_arabo-sasanide%2C_695.JPG","page_title":"Haccâc bin Yûsuf es-Sekafî","context_page_description":"Haccâc bin Yûsuf es-Sekafî bilinen adıyla Haccâc-ı Zâlim, Emevî valisi.\\n661'de Taif'te doğdu. Sâkif kabilesine mensuptu ve bu kabilenin Emevî hanedanıyla ilişkileri oldukça iyiydi. Ancak Emevî halifesi II. Muaviye'nin ölümünden sonra Abdullah bin Zübeyr halifeliğini ilan etti ve tüm Arap yarımadası -ve bu arada Taifliler de- Abdullah bin Zübeyr'e biat etti. Bunun üzerine Haccâc ve kabilesi Taif'i terk ederek Suriye'ye yerleşti.\\nHaccâc, Taif'ten ayrılana dek öğretmenlik yaptı. Hitabetinin ileri düzeyde oluşu da buna bağlanmaktadır."},{"page_url":"https://de.wikipedia.org/wiki/Nitroimidazole","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/5-Nitroimidazole_condensed.png","page_title":"Nitroimidazole","context_page_description":"In der Pharmakologie sind Nitroimidazole eine Stoffgruppe, die zur Behandlung von Infektionen mit Bakterien und/oder Protozoen dienen und deren Kernmerkmal ein mit einer Nitrogruppe substituiertes Imidazol ist. Imidazol ist eine fünfgliedrige heterocyclische organische Verbindung mit zwei Stickstoffatomen.\\nMedizinisch bedeutsam sind vor allem die Abkömmlinge des 5-Nitroimidazols. Der wichtigste Vertreter ist das Metronidazol.\\nDie ebenfalls den Nitroimidazolen zuzurechnenden neueren Wirkstoffe Delamanid und Pretomanid werden in der Behandlung der Tuberkulose eingesetzt."},{"page_url":"https://az.wikipedia.org/wiki/Dorema","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Dorema_ammoniacum_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-201.jpg","page_title":"Dorema","context_page_description":"Dorema — çətirkimilər fəsiləsinə aid bitki cinsi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%B5%D1%81%D1%81%D0%B0%D0%BB%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Meteore.jpg","page_title":"Фессалія","context_page_description":"Фесса́лія або Тесса́лія — історична область і периферія в середній частині Греції, на узбережжі Егейського Моря, столиця — місто Лариса.\\nЗа адміністративним поділом 1997 року, включала номи: Лариса, Кардиця, Магнисія, Трикала. Площа — 14 037 км². Населення — 760 714."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A6%96%E9%83%BD%E5%9C%8F%E6%96%B0%E9%83%BD%E5%B8%82%E9%89%84%E9%81%93%E3%81%A4%E3%81%8F%E3%81%B0%E3%82%A8%E3%82%AF%E3%82%B9%E3%83%97%E3%83%AC%E3%82%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/TX_Nagareyama-centralpark_station_east_20121007b.jpg","page_title":"首都圏新都市鉄道つくばエクスプレス","context_page_description":"つくばエクスプレスは、東京都千代田区の秋葉原駅と茨城県つくば市のつくば駅を結ぶ首都圏新都市鉄道 の鉄道路線である。『鉄道要覧』における正式路線名は常磐新線であるが、案内上は全く使用されない。"},{"page_url":"https://en.wikipedia.org/wiki/Michigan_Heritage_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Fur_Trader_Cabin.jpg","page_title":"Michigan Heritage Park","context_page_description":"The Michigan Heritage Park was an open-air museum that spanned 10,000 years of Michigan history. It consisted of a half-mile trail loop that started with a pre-historic mastodon exhibit and ended at a Civilian Conservation Corps camp exhibit. The historical exhibits are recreations. The park was operated by Muskegon's Lakeshore Museum Center."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%AB%D5%AC%D5%B5%D5%A1%D5%A3%D5%B8%D5%B4%D5%A5%D5%BD_%D5%AC%D5%A1_%D5%86%D5%B8%D6%82%D6%87%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Iglesia_de_San_Nicol%C3%A1s_de_Bari%2C_Villag%C3%B3mez_la_Nueva_02.jpg","page_title":"Վիլյագոմես լա Նուևա","context_page_description":"Վիլյագոմես լա Նուևա մունիցիպալիտետ Իսպանիայում\` Վալիադոլիդ պրովինցիայում ։ Մունիցիպալիտետը գտնվում է Մոնտես Տորոսոս շրջանում։ Զբաղեցնում է 12.53 կմ² տարածք։ Բնակչությունը\` 71 մարդ ։ Գտնվում է պրովինցիայի վարչական կենտրոնից 80 կմ հեռավորության վրա։"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_T%C3%BDni%C5%A1ti_nad_Orlic%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/T%C3%BDni%C5%A1t%C4%9B_nad_Orlic%C3%AD%2C_K%C5%99ivice%2C_house_No_42.jpg","page_title":"Seznam kulturních památek v Týništi nad Orlicí","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Týniště nad Orlicí v okrese Rychnov nad Kněžnou vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%84%D8%AF%D8%A9_%D9%84%D9%8A%D9%83_(%D9%85%D9%82%D8%A7%D8%B7%D8%B9%D8%A9_%D8%B1%D9%88%D8%B3%D9%83%D9%88%D9%85%D9%88%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Lake_Township_Hall_%28Roscommon_County%2C_MI%29.jpg","page_title":"بلدة ليك (مقاطعة روسكومون)","context_page_description":"ليك، مقاطعة روسكومون ‏ هي بلدة تقع بولاية ميشيغان في الولايات المتحدة. تبلغ مساحتها 92.2، وترتفع عن سطح البحر 348 م، بلغ عدد سكانها 1351 نسمة في عام تعداد الولايات المتحدة 2000 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 21.9 نسمة/كم²."},{"page_url":"https://nl.wikipedia.org/wiki/Troonplein","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Statue_%C3%A9questre_de_L%C3%A9opold_II_-_01.JPG","page_title":"Troonplein","context_page_description":"Het Troonplein is een plein in de Belgische stad Brussel. Het Troonplein ligt in de Vijfhoek van Brussel kortbij het Koninklijk Paleis, het Academiënpaleis, het Warandepark en het Centraal station van Brussel."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A5%D0%BE%D1%98%D0%B5%D1%80%D1%81%D0%B2%D0%B5%D1%80%D0%B4%D0%B0%D0%B5%D1%80_%D0%A8%D0%B2%D0%B0%D1%80%D1%86%D0%B2%D0%B0%D1%81%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Schwarzwasser_Muendung.jpg","page_title":"Хојерсвердаер Шварцвасер","context_page_description":"Хојерсвердаер Шварцвасер е река во Саксонија, Германија."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%91%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Scandinavia-12th_century.png","page_title":"Гёты","context_page_description":"Гёты — древнегерманское племя, в период с II в. до н. э по рубеж I и II тысячелетия населяли южную часть Скандинавии, в районе озёр Венерн и Веттерн. Вместе со свеями сформировали шведскую нацию."},{"page_url":"https://no.wikipedia.org/wiki/Panev%C4%97%C5%BEys","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Vezys.jpg","page_title":"Panevėžys","context_page_description":"Panevėžys betyr Stedet ved elva Nevėžis er den femte største byen i Litauen og fylkessentrum. Byens befolkning er blant landets etnisk mest homogene da hele 96% er litauere."},{"page_url":"https://en.wikipedia.org/wiki/Rhododendron_calophytum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Rhododendron_calophytum_%281%29.jpg","page_title":"Rhododendron calophytum","context_page_description":"Rhododendron calophytum, the beautiful-face rhododendron, is a species of flowering plant in the heath family Ericaceae that is native to the forests of central and eastern China, where it lives at altitudes of 1,400–4,000 m. Growing to 12 m tall and 8 m broad, it is a substantial evergreen shrub. The leathery leaves are narrow and up to 30 cm long. In early Spring trusses of bell-shaped, white or pale pink flowers, spotted with maroon inside, are produced.\\nIn cultivation in the UK, Rhododendron calophytum has gained the Royal Horticultural Society’s Award of Garden Merit. Like most rhododendrons it prefers an acid soil. It is hardy down to −15 °C."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Bergen_in_der_Schweiz","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Signinagruppe_von_Norden.jpg","page_title":"Liste von Bergen in der Schweiz","context_page_description":"Diese Liste von Bergen in der Schweiz enthält mehrheitlich Berge in den Schweizer Alpen. Die Schweizer Alpen umfassen 48 Viertausender, 1161 Dreitausender und 2132 Zweitausender."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AE%E3%83%AA%E3%82%A7%E3%83%AB%E3%83%A1%E3%83%BB%E3%82%B3%E3%82%B9%E3%82%BF%E3%83%BB%E3%83%9E%E3%83%AB%E3%82%B1%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Met-legia_%286%29.jpg","page_title":"ギリェルメ・コスタ・マルケス","context_page_description":"ギリェルメ ことギリェルメ・コスタ・マルケスは、ブラジル・リオデジャネイロ州トレス・リオス出身のサッカー選手。イェニ・マラティヤスポル所属。ポジションはFW。"},{"page_url":"https://nl.wikipedia.org/wiki/Warnice_(gemeente)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Warnice_gm.png","page_title":"Warnice (gemeente)","context_page_description":"De gemeente Warnice maakt deel uit van powiat Pyrzycki. Aangrenzende gemeenten:\\nPrzelewice en Pyrzyce\\nStare Czarnowo\\nStargard Szczeciński, Dolice en Stargard Szczeciński\\nDe zetel van de gemeente is in het dorp Warnice.\\nDe gemeente beslaat 11,8% van de totale oppervlakte van de powiat.\\nDe gemeente heeft 9,0% van het aantal inwoners van de powiat."},{"page_url":"https://ro.wikipedia.org/wiki/Saussay,_Eure-et-Loir","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Map_commune_FR_insee_code_28371.png","page_title":"Saussay, Eure-et-Loir","context_page_description":"Saussay este o comună în departamentul Eure-et-Loir, Franța. În 2009 avea o populație de 1060 de locuitori."},{"page_url":"https://cy.wikipedia.org/wiki/Enfield,_Connecticut","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/EHCO-Cup%2C_Gen%C3%A8ve-Servette_HC_vs._Krefeld_Pinguine%2C_24th_August_2016_27.JPG","page_title":"Enfield, Connecticut","context_page_description":"Tref yn Hartford County, yn nhalaith Connecticut, Unol Daleithiau America yw Enfield, Connecticut. ac fe'i sefydlwyd ym 1679."},{"page_url":"https://sw.wikipedia.org/wiki/Kochi,_Kochi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Flag_of_Kochi%2C_Kochi.png","page_title":"Kochi, Kochi","context_page_description":"Kochi ndiyo mji mkuu katika mkoa wa Kochi. Kwa mujibu wa sensa iliyofanyika mnamo mwaka wa 2009, mji una wakazi wapatao 340 000 wanaoishi katika mji huu."},{"page_url":"https://sk.wikipedia.org/wiki/Dev%C3%ADnske_Karpaty","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Sandberg_08.jpg","page_title":"Devínske Karpaty","context_page_description":"Devínske Karpaty je geomorfologický podcelok Malých Karpát a zaberá západnú, prihraničnú časť pohoria. Najvyšší bod Devínskych Karpát sa nachádza v masíve Devínskej Kobyly."},{"page_url":"https://en.wikipedia.org/wiki/Marnes_de_Dives","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Piveteausaurus_divesensis_jmallon.jpg","page_title":"Marnes de Dives","context_page_description":"The Marnes de Dives is a geological formation in Normandy, France. It dates back to the upper part of the Callovian stage of the Middle Jurassic. And is partially equivalent to the Oxford Clay in England. It predominantly consists of ooidal marl, rich in pyrite and lignite, interbedded with thin limestone horizons. It is best exposed at the base of the Falaises des Vaches Noires as well as the foreshore at low tide. It is known for its fossils, notablity those of ammonites, marine crocodiles and fragmentary remains of dinosaurs, mostly theropods."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B8%D0%BA%D0%BE%D1%80%D0%B4%D0%BE%D0%BD%D0%BD%D1%96_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/MQ-9_Reaper_CBP.jpg","page_title":"Прикордонні війська","context_page_description":"Прикордонні війська — державна служба з військовими формуваннями, призначеними для охорони сухопутних і морських кордонів держави.\\nЗародження прикордонних військ відноситься до стародавніх часів. З утворенням державності і створенням в його системі спеціальних органів та установ примушення з'явилися перші озброєнні загони, які здійснювали контроль на дорогах за в'їздом осіб і ввезенням вантажів до територіальних кордонів тій чи іншої країни."},{"page_url":"https://en.wikipedia.org/wiki/Church_of_St_Leonard_the_Less,_Samlesbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/St_Leonard_the_Less%2C_Samlesbury_-_geograph.org.uk_-_574223.jpg","page_title":"Church of St Leonard the Less, Samlesbury","context_page_description":"The Church of St Leonard the Less is an Anglican church in the village of Samlesbury, Lancashire, England, situated close to the banks of the River Ribble. It is an active parish church in the Diocese of Blackburn. It dates predominantly from 1558, with a tower added 1899–1900, and is protected as a Grade I listed building."},{"page_url":"https://da.wikipedia.org/wiki/Sk%C3%A5nemarkedet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Vellinge_vapen.svg","page_title":"Skånemarkedet","context_page_description":"Sildemarkedet ved Skanør og Falsterbo i Skåne var i middelalderen Danmarks største indkomstkilde efter Øresundstolden. Det sydvestligste Skåne var i flere århundreder i merkantil henseende det vigtigste sted i Danmark. Der blev betalt skat af saltet til konserveringen. Det kom fra Lüneburg og blev leveret af hansekøbmændene fra Lübeck.\\nDet angives i 1300-tallet, at der under markedet lå omkring 40.000 både i Øresund, og at 300.000 mennesker deltog i kommersen. Disse tal er dog nok voldsomt overdrevne – som mange andre tal opgivet i middelalderlige kilder.\\nIfølge Adam af Bremen stod silden ved den skånske kyst så tæt, at fisken lod sig øse af havet med de bare næver.\\nKvalitetskontrollen på sildemarkedet var hård; der var dødsstraf for at pakke silden forkert. Det var nødvendigt for at holde den høje pris, at varen var af bedste kvalitet.\\nDen skånske sild eksporteredes over hele Europa og var i middelalderen en meget populær luksusfødevare, især i fastetiden, hvor ingen måtte spise kød.\\nPå kontinentet skulle en fiskehandler, som solgte sild, der ikke var skånske, sætte et rødt flag på sin bod."},{"page_url":"https://sv.wikipedia.org/wiki/Anders_Broddesson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/%C3%84lgar%C3%A5s_int_2.JPG","page_title":"Anders Broddesson","context_page_description":"Mäster Anders Broddesson, även Broddson, från Fredsberg var en svensk kyrkomålare som levde vid mitten av 1700-talet och var verksam i Västergötland.\\nBroddesson var 1749 utsänd som gesäll av Sven Kinnander. Han målade under 1750-talet bland annat stora delar av interiören i den medeltida träkyrkan i Älgarås i Västergötland. I kyrkoarkiven finns dokument som visar att han år 1750 fick betalt för att \\"kiöpa gull och silfwer\\" som skulle användas vid målningen av predrikstolen. Några år senare gjorde han även kyrkans takmålningarna. På predrikstolen är de fyra evangelisterna Matteus, Markus, Lukas och Johannes med sina symboler avbildade. I taket har Broddesson målat tre scener ur bibeln: Jesu uppståndelse, Jesu himmelsfärd och Yttersta domen."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B5%A4%E5%82%99%E3%81%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Akazonae_Sanada.jpg","page_title":"赤備え","context_page_description":"赤備えは、戦国時代から江戸時代にかけて行われた軍団編成の一種。構成員が使用する甲冑や旗指物などの武具を、赤や朱を主体とした色彩で整えた編成を指す。戦国時代では赤以外にも黒色・黄色等の色で統一された色備えがあったが、当時の赤色は高級品である辰砂で出されており、戦場でも特に目立つため、赤備えは特に武勇に秀でた武将が率いた精鋭部隊であることが多く、後世に武勇の誉れの象徴として語り継がれた。\\n赤備えを最初に率いた武将は甲斐武田氏に仕えた飯富虎昌とされ、以後赤備えは専ら甲斐武田軍団の代名詞とされる。"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_chefes_de_estado_da_Rom%C3%AAnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Nicolae_V%C4%83c%C4%83roiu.jpg","page_title":"Lista de chefes de estado da Romênia","context_page_description":"Esta é uma lista de todas as personalidades que foram chefes de Estado da Romênia desde 1859. Isto inclui tanto líderes monarquicos e republicanos, bem como os membros das duas regências."},{"page_url":"https://it.wikipedia.org/wiki/Hennessey_Performance","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Hennessey_Venom_F5_Genf_2018.jpg","page_title":"Hennessey Performance","context_page_description":"La Hennessey Performance Engineering è una casa automobilistica statunitense fondata nel 1991 da John Hennessey a Sealy nei pressi di Houston, in Texas.\\nLa casa è specializzata nel tuning e nella personalizzazione di auto sportive come Ferrari, Porsche, McLaren, Chevrolet, Dodge, Cadillac, Lotus, Jeep, Ford, GMC, Lincoln e Lexus."},{"page_url":"https://eo.wikipedia.org/wiki/Volva%C4%B5o","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Anker_Universalmotor_Beschriftet.jpg","page_title":"Volvaĵo","context_page_description":"Volvaĵo nomiĝas la aro de la volvoj de bobeno.\\nEn elektrotekniko la bobeno povas esti parto de transformatoro, de elektra motoro, de generatoro, de relajso aŭ de elektra magneto. Bobenoj povas esti ankaŭ parto de elektronika cirkvito, kie ĝi funkcias kiel induktanco."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenbahn_Ravensburg%E2%80%93Weingarten%E2%80%93Baienfurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Ravensburg_Gr%C3%BCner_Turm_Kiosk.jpg","page_title":"Straßenbahn Ravensburg–Weingarten–Baienfurt","context_page_description":"Die Straßenbahn Ravensburg–Weingarten–Baienfurt – seltener auch Schmalspurbahn Ravensburg–Weingarten–Baienfurt – verband bis 1959 als meterspurige Überlandstraßenbahn die drei genannten Orte miteinander. Sie wurde 1888 von der privaten Lokalbahn Aktien-Gesellschaft eröffnet und verkehrte zunächst als dampfbetriebene Sekundärbahn bis Weingarten. 1910 wurde sie elektrifiziert und 1911 bis nach Baienfurt verlängert. Die ursprüngliche Bezeichnung lautete Lokalbahn Ravensburg–Weingarten–Baienfurt – LRWB.\\n1938 wurde die im Volksmund auch Zügle, Mühle, Bähnle oder Bodensee-Blitz genannte Bahn verstaatlicht und fortan gemäß der im selben Jahr in Kraft getretenen Verordnung über den Bau und Betrieb der Straßenbahnen auch offiziell als Straßenbahn klassifiziert. Die Strecke war nach 1938 der einzige Straßenbahnbetrieb im Besitz der Deutschen Reichsbahn, nach dem Zweiten Weltkrieg der einzige Straßenbahnbetrieb im Besitz der Deutschen Bundesbahn."},{"page_url":"https://it.wikipedia.org/wiki/Lohkirchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Mari%C3%A4_Himmelfahrt_Lohkirchen.jpeg","page_title":"Lohkirchen","context_page_description":"Lohkirchen è un comune tedesco di 679 abitanti, situato nel land della Baviera."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AA%D8%A7%D8%AD%D9%81_%D8%AA%D8%B4%D9%8A%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/San-Pedro-de-Atacama_R-P-Gustavo_Le_Paige_Museum.JPG","page_title":"متاحف تشيلي","context_page_description":"تحتوي هذه المقالة على قائمة المتاحف في دولة تشيلي. ؛"},{"page_url":"https://pl.wikipedia.org/wiki/Straszyk_nowogwinejski","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Thorny_Devil_001.jpg","page_title":"Straszyk nowogwinejski","context_page_description":"Straszyk nowogwinejski - owad z rzędu straszyków."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%88%D9%86%D8%AA%D8%B2%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Monza_Stazione_Reale.jpg","page_title":"مونتزا","context_page_description":"مونتزا ایتالیانین لمباردی بؤلگه سینده یئر آلان بیر شهردیر. 2016-جی ایلين نۆفوس ساییمی اساسیندا 122 728 نفر دیر. بۇ باخیم‌دان اۆلکه‌نین 34_اینجی شهری سایاگلیر."},{"page_url":"https://sv.wikipedia.org/wiki/Forshaga_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Distrikt_Forshaga.jpg","page_title":"Forshaga kommun","context_page_description":"Forshaga kommun är en kommun i Värmlands län. Centralort är Forshaga."},{"page_url":"https://ast.wikipedia.org/wiki/Dallas-Fort_Worth_metroplex","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Platinum_Corridor_-_Arapaho_Road.jpg","page_title":"Dallas-Fort Worth metroplex","context_page_description":"El Dallas/Fort Worth Metroplex ye'l nome informal que los habitantes d'esta área metropolitana diéron-y a la rexón nel norte de Texas. Otros llamatos que recibe inclúin el \\"Metroplex\\", \\"North Texas\\", \\"DFDub\\" y \\"DFW\\". Debíu a la gran crecedera del área, especialmente'l de los suburbios, la Oficina del Censu de los Estaos Xuníos designó-y el títulu d'área metropolitana Dallas–Fort Worth–Arlington. La área metropolitana pue ser estremada entá más en dos divisiones metrópolitanas: Dallas–Planu–Irving y Fort Worth–Arlington. Dallas ye una de 11 ciudaes estauxunidenses que foi clasificada como ciudá global de tipo gamma.\\nSegún el censu del 2013, la área metropolitana tenía una población de cuasi 6.6 millones. Dallas–Fort Worth ye la área metropolitana más grande de Texas y cuenta con 6 de les 12 ciudaes más grandes del estáu. Ye la cuarta área metropolitana más grande nos Estaos Xuníos dempués de Nueva York, Los Angeles y Chicago y la más grande ensin accesu al mar. El Metroplex toma a 12 condaos y 26.500 km², faciéndola un área más grande que los estaos de Nueva Jersey y Rhode Island combinaos."},{"page_url":"https://pl.wikipedia.org/wiki/Czes%C5%82aw_Kozon","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Czeslaw_Kozon.jpg","page_title":"Czesław Kozon","context_page_description":"Czesław Kozon, – duński duchowny katolicki, ordynariusz kopenhaski od 1995."},{"page_url":"https://en.wikipedia.org/wiki/Romer%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Plaza_de_Armas%2C_Guadalajara%2C_Jalisco%2C_M%C3%A9xico.jpg","page_title":"Romería","context_page_description":"A romería or romaria is a type of yearly, short distance Roman Catholic religious pilgrimage practiced in the Iberian Peninsula and countries formerly colonized by Spain and Portugal. The term comes from romero/romeiro, meaning a person travelling to Rome. The travelling can be done in cars, floats, on horseback or on foot, and its destination is a sanctuary or hermitage consecrated to a religious figure honored in that day's feast. Besides attending religious services and processions, the pilgrims may also engage in social events like singing, feasting and dancing."},{"page_url":"https://tr.wikipedia.org/wiki/SEAT","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/F%C3%A0brica_SEAT_Martorell.JPG","page_title":"SEAT","context_page_description":"SEAT, S.A. merkezi Martorell İspanya'da bulunan bir İspanyol otomobil üreticisidir. 9 Mayıs 1950 tarihinde, bir devlet kurumu olan Instituto Nacional de Industria tarafından kurulmuştur. Volkswagen AG kuruluşudur.\\nAudi ve Lamborghini ile birlikte artık varlığını sürdürmeyen bir şirket olan Audi Marka Grubu'nun bir üyesi iken, bugün tamamıyla Alman Volkswagen Grubu'na bağlıdır. Genç ve sportif profile sahip bir otomobil üreticisi olarak tanımlanmaktadır.\\nSEAT, S.A. şirketinin merkezi, İspanya'nın Barselona kenti yakınlarındaki Martorell'de bulunan SEAT kompleksinde yer almaktadır. 2000 yılında üretim 500.000 adedi aşmıştır; 2006 yılına kadar, 6 milyondan fazlası Martorell tesisinde olmak üzere 16 milyondan fazla otomobil üretilmiştir ve yıllık üretimin üçte ikisi, dünya çapında yetmişten fazla ülkeye ihraç edilmiştir.\\nSEAT, önceden Sociedad Española de Automóviles de Turismo için bir kısaltmaydı."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%98%D9%88%D8%AC%DB%8C%D8%A7%D8%AC%DB%8C%D8%A7%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Zhujiajiao_canal_4.JPG","page_title":"ژوجیاجیاو","context_page_description":"ژوجیاجیاو یک شهرک در جمهوری خلق چین است که در کینگپو واقع شده‌است. ژوجیاجیاو ۶۰٬۰۰۰ نفر جمعیت دارد."},{"page_url":"https://sv.wikipedia.org/wiki/Pa%C5%A1man","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Pasman_2.JPG","page_title":"Pašman","context_page_description":"Pašman är en ö i skärgården söder om Zadar vid Kroatiens kust till Adriatiska havet. Den omges av öarna Ugljan, Iž, Dugi otok och Kornati. Det bor 2004 personer i kommunen Pašman. Det finns 11 byar på Pašman, från sydöst till nordväst: Tkon, Ugrinić, Kraj, Pašman, Mali Pašman, Barotul, Mrljane, Neviđane, Dobropoljana, Banj och Ždrelac.\\nBland alla öar i den kroatiska skärgården är det Pašman som har den största gröna ytan med tanke på dess totala yta. Det är dessutom den tolfte största ön i den kroatiska skärgården."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%84%D8%A7%D9%8A%D8%A9_%D8%A3%D8%AF%D8%B1%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Mauretania_et_Numidia.jpg","page_title":"ولاية أدرار","context_page_description":"ولاية أدرار هي ولاية حدودية تقع في الجنوب الغربي للجزائر. هي الولاية رقم 01 في تصنيف الولايات حسب التنظيم الإداري الجزائري. لها حدود مع كل من مالي وموريتانيا، والصحراء الغربية ويسود في الولاية المناخ الصحراوي، وأغلبية تضاريسها رملية مع مناطق جرداء صخرية في شمال الولاية تسمى الحمادات، وكما يغلب الطابع الريفي الحضري على الولاية، وحجم السكان فيها صغير نسبيا مقارنة بمساحتها.\\nأهم مدنها أدرار، تيميمون، رقان، تسابيت، زاوية كنتة، تمنطيط، أولف فنوغيل وزاوية الدباغ، برج باجي مختار على الحدود مع مالي، وتيميمون."},{"page_url":"https://pt.wikipedia.org/wiki/Commando_Cody","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Codyframe.jpg","page_title":"Commando Cody","context_page_description":"Commando Cody era o nome original de um herói de um seriado de ficção científica de 12 capítulos de 1952 da Republic Pictures denominado Radar Men from the Moon, estrelado por George Wallace. Em 1953 foi feita uma sequência de 12 capítulos: Commando Cody: Sky Marshal of the Universe, estrelado por Judd Holdren.\\nOutro seriado da Republic de 1952, chamado Zombies of the Stratosphere, foi escrito com a intenção de ser uma sequência para Radar Men from the Moon mas, por razões não explicadas, o nome do personagem protagonista foi mudado de Commando Cody para Larry Martin, também interpretado por Holdren. O nome voltou em \\"Commando Cody: Sky Marshal of the Universe\\", que passou na TV em 1955. Esse seriado de fato fora planejado para ser uma série de TV, com cada episódio durando 25 minutos, mas acabou por ser lançado nos cinemas dois anos antes. Devido a diferenças do formato tradicional dos seriados de cinema, muitos fãs se recusam a classificar esses filmes de seriado, mas é claro haver nos mesmos uma história linear e um roteiro que vai evoluindo de capítulo em capítulo."},{"page_url":"https://en.wikipedia.org/wiki/Bombus_quadricolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Bombus_quadricolor03.jpg","page_title":"Bombus quadricolor","context_page_description":"Bombus quadricolor is a species of cuckoo bumblebee.\\nThe bumblebee is present in most of Europe except Britain, Ireland, and Iceland. It is also found in Turkey."},{"page_url":"https://de.wikipedia.org/wiki/Mike_Candys","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Mike_Candys_during_an_interview.jpg","page_title":"Mike Candys","context_page_description":"Mike Candys ist ein Schweizer House-DJ und Produzent, der 2011 mit dem Lied One Night in Ibiza seinen Durchbruch feierte."},{"page_url":"https://fr.wikipedia.org/wiki/Oak_Park_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Oak_park_lake_theater.jpg","page_title":"Oak Park (Illinois)","context_page_description":"Oak Park est une banlieue à l'ouest de Chicago, dans l'État de l'Illinois. Il s'agit de la 29e municipalité la plus peuplée de l'Illinois selon le recensement de 2010 aux États-Unis. Selon le recensement des États-Unis de 2010, le village comptait 51 878 habitants.\\nOak Park a été créé à partir des années 1830, avec une croissance rapide plus tard au 19e siècle et au début du 20e siècle. Il a incorporé en 1902, en rupture de Cicero. Le développement a été stimulé par les chemins de fer et les tramways reliant le village aux emplois à Chicago. L'architecte Frank Lloyd Wright et son épouse s'installèrent ici en 1889. La population atteignit un sommet de 66 015 habitants en 1940. Le nombre de familles plus réduites entraîna la chute de la population dans le même nombre de maisons et d'appartements. Dans les années 1960, Oak Park a été confronté au défi de l'intégration raciale en élaborant de nombreuses stratégies pour intégrer le village plutôt que de le réorganiser. Oak Park comprend trois districts historiques pour les maisons historiques: Ridgeland, Frank Lloyd Wright et Seward Gunderson, ce qui témoigne de l’importance accordée à la préservation historique."},{"page_url":"https://eu.wikipedia.org/wiki/Umeki","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Fetus_3_months.jpg","page_title":"Umeki","context_page_description":"Umekia garapen fasean dagoen ornodun bibiparoa da, fase enbrionario eta erditzearen artean dagoena. Umekiaren fasean ez da organo edo ehun berririk eratzen, jadanik daudenak garatzen dira.\\nGizakiaren kasuan, umekiaren fasea ernalketa gertatu eta 9. astean hasi eta erditu arteko tartea da."},{"page_url":"https://en.wikipedia.org/wiki/Regent_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Regent_College.jpg","page_title":"Regent College","context_page_description":"Regent College is a graduate school of Christian studies, located next to the campus of the University of British Columbia in the University Endowment Lands west of Vancouver, British Columbia, and is an affiliated college of that university. Not affiliated with a particular religious denomination, Regent College is a transdenominational evangelical Protestant institution in its general outlook. The school's stated mission is to \\"cultivate intelligent, vigorous, and joyful commitment to Jesus Christ, His church, and His world.\\"\\nAbout 500 students are enrolled in full- or part-time studies. In any given year, one-third to one-half of students are Canadian, another one-quarter to one-third are American, and the remaining twenty to thirty per cent come from around the globe. Chinese students make up a considerable proportion of the latter group, whether from the Mainland, Taiwan, or the Chinese diaspora. Hong Kong is home to more Regent alumni/ae than any other city in the world after Vancouver."},{"page_url":"https://nl.wikipedia.org/wiki/Grote_of_Sint-Maartenskerk_(Tiel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Melaatsenluikje_Sint_Maartenskerk_Tiel.jpg","page_title":"Grote of Sint-Maartenskerk (Tiel)","context_page_description":"De Grote of Sint-Maartenskerk is een kerk in Tiel in de provincie Gelderland. Het is een onvoltooide laatgotische kruiskerk, bestaande uit een schip met klokkentoren en een losstaande sacristie. De kerk liep in 1944/45 zware oorlogsschade op.\\nDe klokkentoren is van tufsteen, de schepen zijn van baksteen. De hoofdbeuk en noordbeuk dateren uit 1420–1430, de dubbele zuidbeuk uit 1450 en de doopkapel in de zuidelijke zuidbeuk uit 1558. Deze werd onder een vier jaar eerder tot stand gekomen librije gebouwd.\\nIn 1558 werd onder Cornelis Frederiks begonnen met een grootscheepse uitbreiding, maar het koor en transept werden ten gevolge van de Reformatie niet voltooid en werden in 1731 weer afgebroken. Alleen de sacristie bleef als vrijstaand gebouw behouden.\\nDe kerk wordt door de Protestantse Gemeente Tiel nog maandelijks voor diensten gebruikt en is tevens in gebruik als concertlocatie."},{"page_url":"https://ca.wikipedia.org/wiki/Giovanni_Sgambati","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Buste_de_Giovanni_Sgambati_%28parc_pincio%29.JPG","page_title":"Giovanni Sgambati","context_page_description":"Giovanni Sgambati fou un compositor i pianista italià.\\nFill d'un advocat italià i de mare anglesa prengué les primeres lliçons de piano, amb només cinc anys, amb el mestre Amerigo Barbieri i ja llavors mateix des dels cinc anys es revelà com a concertista. I el 1848 amb 7 anys d'edat actuà en un concert per al príncep Lucien Bonaparte, component també diverses peces sacres. En la mort del seu pare que s'havia traslladat a Trevi el 1849, estudià piano i harmonia amb C. Natalucci, alumne de Zingarelli. El 1856 estrenà amb èxit un quartet per a instruments d'arc i el mateix any dirigí a Roma la Simfonia Dante, de Liszt. També donà a conèixer a Itàlia Schumann, Brahms i altres compositors alemanys. El 1860 continuava a Roma, estudiant contrapunt amb Aldega, mestre de capella de Santa Maria la Major i aconseguint el títol de soci honorari de l'Acadèmia de Santa Cecília.\\nLlavors començà la seva carrera oficial com a pianista, que ben aviat li procurà, tant a Roma com a Florència, una gran notorietat tant per la seva qualitat dels programes com pel seu rigor interpretatiu."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D9%84%D9%88%D9%8A%D8%AF_%D9%81%D9%88%D9%84%D9%83%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Floyd_Volker.jpeg","page_title":"فلويد فولكر","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nفلويد فولكر كان لاعب كرة سله من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Oberkail","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Oberkail_St._Michael_92.JPG","page_title":"Oberkail","context_page_description":"Oberkail ist eine Ortsgemeinde im Eifelkreis Bitburg-Prüm in Rheinland-Pfalz. Sie gehört der Verbandsgemeinde Bitburger Land an."},{"page_url":"https://pt.wikipedia.org/wiki/Laguna_(Santa_Catarina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Santa_Marta_Lighthouse_in_Laguna_-_SanTa_Catarina_-_Brazil.jpg","page_title":"Laguna (Santa Catarina)","context_page_description":"Laguna é um município brasileiro do estado de Santa Catarina. Localiza-se a uma latitude 28º28'57\\" sul e a uma longitude 48º46'51\\" oeste, estando a uma altitude de 2 metros. Sua população estimada em 2016 era de 44 982 habitantes. Possui uma área de 336,396 km². Em primeiro de janeiro de 2013 perdeu 1/5 de sua população com a instalação do município de Pescaria Brava."},{"page_url":"https://ca.wikipedia.org/wiki/%C3%80guila_d%27estepa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Aquila_nipalensis_distribution_map.png","page_title":"Àguila d'estepa","context_page_description":"L'àguila d'estepa és un ocell de la família dels accipítrids que habita zones boscoses i estepes d'Euràsia, des de l'est d'Alemanya cap a l'est, per Finlàndia i Rússia occidental, els Balcans, Grècia, Turquia, el Caucas, Azerbaidjan i nord d'Iran. En hivern arriba fins al sud d'Àfrica, i l'Índia."},{"page_url":"https://ca.wikipedia.org/wiki/Requisits_de_visat_per_als_xilens","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Visa_requirements_for_Chilean_citizens.png","page_title":"Requisits de visat per als xilens","context_page_description":"Els requisits de visat per als ciutadans xilens són les restriccions d'entrada administratives per part de les autoritats d'altres estats sobre els ciutadans de Xile. Des del gener del 2017, els ciutadans xilens no necessiten visat per entrar a 157 països i territoris, sent el passaport xilè el dissetè al rànquing que permet l'entrada lliure dels seus ciutadans a altres països.\\nActualment, els ciutadans xilens i els de Corea del sud són els únics del món que tenen accés lliure a tots els països membres del G8. A més, juntament amb els ciutadans d'Israel també son els únics que poden viatjar per tot Europa sense necessitat de visat.\\nEls ciutadans de Xile no necessiten fer servir el seu passaport per viatjar a l'Argentina, Bolívia, Brasil, Colòmbia, Equador, Paraguai, Perú, Uruguai i Veneçuela. És suficient presentant la cèdula d'identitat."},{"page_url":"https://de.wikipedia.org/wiki/Jungferntaube","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/White-Throated_Ground-Dove_wild.jpg","page_title":"Jungferntaube","context_page_description":"Die Jungferntaube, auch Marianen-Erdtaube genannt, ist eine Art der Taubenvögel. Sie kommt ausschließlich auf einigen kleineren Inseln in Südostasien vor. Die Art wird von der IUCN als potentiell gefährdet eingestuft. Eine verlässliche Schätzung der Bestandszahlen liegen zwar nicht vor, die Bestände gehen aber zurück. Auf einigen Inseln des Verbreitungsgebietes ist die Jungferntaube durch die dort eingeführte Boiga irregularis gefährdet."},{"page_url":"https://fr.wikipedia.org/wiki/Ometepe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Nicaragua_Ometepe_p%C3%A9troglyphes_1.jpg","page_title":"Ometepe","context_page_description":"Ometepe est une île située dans le lac Nicaragua, au Nicaragua. Elle est constituée de deux stratovolcans, le Concepción, actif, et le Maderas, sans activité historique. Son nom vient du nahuatl : ōme et tepētl. Sur le plan administratif, l'île appartient au département de Rivas.\\nGéographiquement elle est constituée par la réunion de deux anciennes îles volcaniques qui forment aujourd'hui la partie Maderas et la partie Concepción.\\nLa plus grande ville se nomme Moyogalpa et est reliée par ferry à la ville de San Jorge sur la rive ouest du lac Nicaragua. La seconde ville est Altagracia, reliée à Granada par un traversier hebdomadaire.\\nL'écosystème est très riche, on y trouve de nombreuses espèces d'oiseaux, comme l'urraca, et des singes hurleurs.\\nL'île est aussi connue pour ses pétroglyphes, notamment au pied du Maderas, et à Altagracia."},{"page_url":"https://pt.wikipedia.org/wiki/%C8%98ugag","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Sugag_jud_Alba.png","page_title":"Șugag","context_page_description":"Șugag é uma comuna romena localizada no distrito de Alba, na região histórica da Transilvânia. A comuna possui uma área de 249.61 km² e sua população é de 2932 habitantes, segundo o censo realizado em 2007."},{"page_url":"https://en.wikipedia.org/wiki/Ashbury,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/en/2/2c/Cheviot_Street%2C_Leadlight_Window_and_Awning.jpg","page_title":"Ashbury, New South Wales","context_page_description":"Ashbury is a suburb in the Inner West of Sydney, in the state of New South Wales, Australia. It lies in the local government area of City of Canterbury-Bankstown with some areas in the Inner West Council and is about 10 kilometres south-west of the Sydney central business district. The postcode is 2193, the same as neighbouring Canterbury.\\nAshbury is mostly residential and has no commercial centre, although there are a few shops on King Street. Its major landmark is Peace Park, the highest point in the Canterbury local government area. Ashbury derived its name from the two neighbouring suburbs Ashfield and Canterbury. It is near Canterbury Park Racecourse."},{"page_url":"https://de.wikipedia.org/wiki/Ch%C3%A2teau_Raymond-Lafon","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/RayLafon08.jpg","page_title":"Château Raymond-Lafon","context_page_description":"Château Raymond-Lafon ist ein Weingut in der französischen Appellation d’Origine Contrôlée Sauternes. Innerhalb dieser Appellation werden mit Hilfe der die Edelfäule Botrytis cinerea weiße Dessertweine höchster Qualität hergestellt; die Erträge sind in der Appellation auf maximal 25 hl/Hektar festgelegt. Château Raymond-Lafon jedoch beschränkt sich durch rigorose Auslese auf nur 8,5 hl/Hektar.\\nDas Gut wurde Mitte des 19. Jahrhunderts von Raymond Lafon gegründet. Aufgrund des Zeitpunkts der Gründung konnte das Château nicht mehr in der Bordeauxwein-Klassifikation von 1855 berücksichtigt werden.\\n1972 wurde Château Raymond-Lafon vom Ehepaar Francine und Pierre Meslier übernommen. Zuvor leitete Pierre Meslier jahrelang als Technischer Direktor das weltberühmte Nachbargut Château d’Yquem. Er übertrug die hohen Qualitätsstandards auf sein eigenes Gut. Seit 1979 werden mit großer Regelmäßigkeit erstklassige Weine hergestellt. Hinter Château d’Yquem und Château de Fargues gehört Château Raymond-Lafon häufig zu den besten, wenn auch keineswegs zu den teuersten Sauternes, obwohl dem Gut jegliche Anerkennung zum Grand Cru fehlt."},{"page_url":"https://es.wikipedia.org/wiki/Certhia_brachydactyla","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Short-toed_Treecreeper_%28Certhia_brachydactyla%29_%28cropped_version%29.jpg","page_title":"Certhia brachydactyla","context_page_description":"El agateador común o europeo​ es una especie de ave de la familia Certhiidae que vive principalmente en el sur de la Europa Occidental y alrededor del resto de la cuenca del Mediterráneo. Se caracteriza por tener las partes superiores parduzcas, que lo mimetizan con los troncos de los árboles, y las parte inferiores blanquecinas, con el pico largo, fino y curvado hacia abajo. Trepa con facilidad por los árboles ayudado de su cola rígida que le sirve de apoyo."},{"page_url":"https://hu.wikipedia.org/wiki/Mihalik_D%C3%A1niel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Mihalik_D%C3%A1niel_1898-_50.jpg","page_title":"Mihalik Dániel","context_page_description":"Mihalik Dániel festőművész, a Szolnoki művésztelep egyik alapítója."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%80%D8%A7%D9%86_%D9%85%D9%8A%D9%84%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Van_Miller_at_Ralph_Wilson_Stadium_11-16-08_crop.JPG","page_title":"فـان ميلر","context_page_description":"فـان ميلر ‏ هو معلق رياضي أمريكي، ولد في 22 نوفمبر 1927، وتوفي في 17 يوليو 2015."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%8E%D0%B7%D0%B0%D0%BD%D1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Le_palais_d%C3%A9t%C3%A9_Sitori-i-Mokhi_Khosa_%28Boukhara%2C_Ouzb%C3%A9kistan%29_%285712665232%29.jpg","page_title":"Сюзанэ","context_page_description":"Сюзанэ, сюзані — від дэкаратыўна-прыкладнога мастацтва, які ўяўляе сабой ручную вышыўку па баваўнянай тканіне шаўковымі ці баваўнянымі ніткамі, распаўсюджаны ў Таджыкістане, Узбекістане і Іране. Слова сюзанэ з персідскай мовы азначае іголку. Мастацтва вырабу такіх тканін у Іране называецца сузандозі."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%8F%A4%E5%B7%96%E6%B7%A8%E8%8B%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Phra_Phrom_of_Koon_Ngam_Ching_Yuen.JPG","page_title":"古巖淨苑","context_page_description":"古岩净苑位于香港新界沙田大围车公庙路1号，该苑于一九五一年创建。净苑由自小追随先师虚云和尚的意昭法师，以虚云的别号“古岩”为净苑而命名。净苑最核心的地方，是千佛宝殿，于一九九五年，意昭法师在宝殿四周墙壁上，加上四大菩萨以及五百罗汉像。\\n以释智超方丈为团长，古岩净苑的37人朝圣团在1980年6月25日，在中华人民共和国四川省成都市新都区宝光寺做了一小时佛教法事。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Historic_Civil_Engineering_Landmarks","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Cleveland_Hopkins_International_Airport_recent_satellite_view.png","page_title":"List of Historic Civil Engineering Landmarks","context_page_description":"The following is a list of Historic Civil Engineering Landmarks as designated by the American Society of Civil Engineers since it began the program in 1964. The designation is granted to projects, structures, and sites in the United States and the rest of the world. As of 2019, there are over 280 landmarks that have been approved by the ASCE Board of Direction.\\nSections or chapters of the American Society of Civil Engineers may also designate state or local landmarks within their areas; those landmarks are not listed here."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D8%AC%D9%88_%D9%85%D9%88%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Paris_-_Salon_du_livre_de_Paris_2017_-_Jojo_Moyes_-_001_%28cropped%29.jpg","page_title":"جوجو مويس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجوجو مويس صحفيه من المملكه المتحده."},{"page_url":"https://de.wikipedia.org/wiki/V%C3%B6lkermord_in_Ruanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/RPF_Buergerkrieg_Ruanda_1994.jpg","page_title":"Völkermord in Ruanda","context_page_description":"Als Völkermord in Ruanda werden umfangreiche Gewalttaten in Ruanda bezeichnet, die am 6. April 1994 begannen und bis Mitte Juli 1994 andauerten. Sie kosteten circa 800.000 bis 1.000.000 Menschen das Leben, die niedrigsten Schätzungen gehen von mindestens 500.000 Toten aus. In annähernd 100 Tagen töteten Angehörige der Hutu-Mehrheit etwa 75 Prozent der in Ruanda lebenden Tutsi-Minderheit sowie moderate Hutu, die sich am Völkermord nicht beteiligten oder sich aktiv dagegen einsetzten. Die Täter kamen aus den Reihen der ruandischen Armee, der Präsidentengarde, der Nationalpolizei und der Verwaltung. Zudem spielten die Milizen der Impuzamugambi sowie vor allem der Interahamwe eine besonders aktive Rolle. Auch weite Teile der Hutu-Zivilbevölkerung beteiligten sich am Völkermord. Der Genozid ereignete sich im Kontext eines langjährigen Konflikts zwischen der damaligen ruandischen Regierung und der Rebellenbewegung Ruandische Patriotische Front.\\nIm Verlauf und im Nachgang der Ereignisse wurden die Vereinten Nationen und Staaten wie die USA, Großbritannien und Belgien wegen ihrer Untätigkeit kritisiert."},{"page_url":"https://no.wikipedia.org/wiki/M%C3%A9xico_(delstat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Mexico-Popocatepetl.jpg","page_title":"México (delstat)","context_page_description":"México er en delstat i De forente meksikanske stater. Delstaten hadde 15 175 862 innbyggere i 2010, og er dermed landets mest folkerike. Arealet er på 21 461 km². Delstaten ligger som en omvendt U rundt Distrito Federal, som er en del av Mexico by. Store deler av Mexico by befinner seg også i delstaten México. México grenser for øvrig til delstaten Hidalgo i nord, Puebla og Tlaxcala i øst, Morelos og Guerrero i sør og Michoacán i vest. Delstatshovedstaden er Toluca."},{"page_url":"https://cs.wikipedia.org/wiki/Ternopilsk%C3%A1_n%C3%A1rodn%C3%AD_zdravotnick%C3%A1_univerzita_I._Horbaczewsk%C3%A9ho","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/%D0%A2%D0%94%D0%9C%D0%A3_-_%D0%A1%D0%B8%D0%BC%D1%83%D0%BB%D1%8F%D1%86%D1%96%D0%B9%D0%BD%D0%B8%D0%B9_%D1%86%D0%B5%D0%BD%D1%82%D1%80_-_%D0%A1%D1%82%D1%83%D0%B4%D0%B5%D0%BD%D1%82%D0%B8_%D0%BD%D0%B0_%D0%B7%D0%B0%D0%BD%D1%8F%D1%82%D1%82%D1%8F%D1%85_-_16093658.jpg","page_title":"Ternopilská národní zdravotnická univerzita I. Horbaczewského","context_page_description":"Ternopilská národní zdravotnicka univerzita I. Horbaczewského je univerzita sídlící v západoukrajinském Ternopole, jedna z nejlepších zdravotnických škol na Ukrajině."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_and_towns_in_Romania","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Cazinoul_din_Slanic_Moldova_in_HDR.jpg","page_title":"List of cities and towns in Romania","context_page_description":"This is a list of cities and towns in Romania, ordered by population according to the 2002 and 2011 censuses. For the major cities, average altitude is also given. Cities in bold are county capitals. The list includes major cities with the status of municipiu, as well as towns with the status of oraș.\\nRomania has 1 city with more than 1 million residents, 19 cities with more than 100,000 residents, and 178 towns with more than 10,000 residents."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D1%8C%D1%80%D0%B0%D0%BC_(%D0%B3%D1%80%D0%B0%D1%84_%D0%AE%D0%BB%D0%B8%D1%85%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Battle_of_Furnes.jpg","page_title":"Вальрам (граф Юлиха)","context_page_description":"Вальрам — граф Юлиха с 1278 года. Второй сын Вильгельма IV и Рихардис Гельдернской.\\nВступил на престол после убийства в Ахене отца и старшего брата.\\nВраждовал с кёльнским архиепископом Зигфридом фон Вестербургом. В войне за Лимбургское наследство поддерживал брабантского герцога Жана I и в 1288 году в битве при Воррингене взял в плен своего врага — архиепископа. В результате получил во владение Цюльпих.\\nВоевал с французским королём на стороне фландрского графа Ги де Дампьера и 20 августа 1297 года убит в битве при Фюрне.\\nЕму наследовал младший брат Герхард."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A7%D9%86%DA%AF%D9%88%D9%84%D8%A7_%DA%A9%D9%88%D9%84%D9%88%D8%A8%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Angola_Colobus_area.png","page_title":"انگولا کولوبس","context_page_description":"انگولا کولوبس لیندے افریقہ دا اک باندر اے۔"},{"page_url":"https://it.wikipedia.org/wiki/Accademia_Etrusca","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Acta_Eruditorum_-_V_alfabeti%2C_1741_%E2%80%93_BEIC_13404239.jpg","page_title":"Accademia Etrusca","context_page_description":"L'Accademia Etrusca ha sede a Cortona, nel Palazzo Casali."},{"page_url":"https://en.wikipedia.org/wiki/Architecture_of_Baku","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Landau_house_in_Baku.jpg","page_title":"Architecture of Baku","context_page_description":"The architecture of Baku is not characterized by any particular architectural style, having accumulated its buildings over a long period of time.\\nIn itself, Baku contains a wide variety of styles, progressing through Masud Ibn Davud's 12th century Maiden Tower and the educational institutions and buildings of the Russian Imperial era.\\nLate Modern and Postmodern architecture began to appear in the early-2000s. With the economic development, old buildings such as Atlant House have been razed to make way for new ones. Buildings with all glass shell appear around the city, with the most prominent examples being the SOCAR Tower and Flame Towers.\\nSeveral monuments pay homage to people and events in the city. The Martyrs' Lane provides views of the surrounding area whilst commemorating the victims of Black January and Nagorno-Karabakh War."},{"page_url":"https://en.wikipedia.org/wiki/Defensive_wall","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Jaisalmer_citadelle.jpg","page_title":"Defensive wall","context_page_description":"A defensive wall is a fortification usually used to protect a city, town or other settlement from potential aggressors. The walls can range from simple palisades or earthworks to extensive military fortifications with towers, bastions and gates for access to the city. From ancient to modern times, they were used to enclose settlements. Generally, these are referred to as city walls or town walls, although there were also walls, such as the Great Wall of China, Walls of Benin, Hadrian's Wall, Anastasian Wall, and the Atlantic Wall, which extended far beyond the borders of a city and were used to enclose regions or mark territorial boundaries. In mountainous terrain, defensive walls such as letzis were used in combination with castles to seal valleys from potential attack. Beyond their defensive utility, many walls also had important symbolic functions – representing the status and independence of the communities they embraced.\\nExisting ancient walls are almost always masonry structures, although brick and timber-built variants are also known."},{"page_url":"https://fr.wikipedia.org/wiki/W%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/WeeSpoon.jpg","page_title":"Wés","context_page_description":"Les Wés sont un peuple africain vivant dans l'ouest de la Côte d'Ivoire et dans l'est du Libéria où ils sont plus généralement appelés Krous.\\nCe peuple est installé dans cette partie de la grande forêt guinéenne depuis près de sept siècles au moins. De fait, le pays Wé précolonial, même s'il n'a jamais constitué un quelconque état propre, s'étend entre Guézon en Cote d'Ivoire et l'est du Libéria. Au Libéria, les Wés sont souvent appelés plus simplement \\"Krou\\" et constituent l'un des principaux groupes autochtones, dont la langue et la culture est très largement répandue dans ce pays. Malgré cette frontière artificielle, les Wés du Libéria et ceux de Côte d'Ivoire ont encore assez souvent des liens culturels et familiaux.\\nLes Wés sont parfois nommés Wegnons, qui signifie en langue Wé « l'homme qui pardonne », ou « l'homme au cœur noble »."},{"page_url":"https://nl.wikipedia.org/wiki/Den_Haag-Tempel","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Zoetermeer_Den_Haag-Tempel_Oostgevel.JPG","page_title":"Den Haag-Tempel","context_page_description":"De Den Haag-Tempel van de Kerk van Jezus Christus van de Heiligen der Laatste Dagen in de Nederlandse gemeente Zoetermeer is ontworpen door de architecten van Meijer & Van Eerden uit Zoetermeer en opgetrokken uit Olympia White graniet. Onder de 141 tempels van dit genootschap in de wereld, is het de enige die enkele meters onder de zeespiegel is gebouwd. De bouw werd aangekondigd in augustus 1999 en maakt deel uit van een plan om leden van de Kerk wereldwijd binnen bereik van een tempel te brengen. De Den Haag-Tempel is een klein model tempel met één serie zalen voor verordeningen en twee verzegelkamers voor huwelijken.\\nDe tempel is gebouwd op de locatie waar voorheen een kerkgebouw stond van de kerkgemeente Zoetermeer. De Kerk is sinds 1861 in Nederland gevestigd, de gemeente Zoetermeer is in de jaren 70 opgericht.\\nVoor leden van de Kerk zijn een kerkgebouw en de tempel twee verschillende gebouwen met ieder een eigen functie. Hierin volgen zij de gebruiken van Joden en vroege Christenen die naast de plaatselijke synagoge ook de tempel hadden. Een kerkgebouw is bedoeld als gemeenschapshuis, om wekelijks samen te komen voor de verordening van het avondmaal en als zondagsschool."},{"page_url":"https://sh.wikipedia.org/wiki/Beata_Tyszkiewicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Beata_Tyszkiewicz_TZG.JPG","page_title":"Beata Tyszkiewicz","context_page_description":"Beata Maria Helena Tyszkiewicz-Kalenicka je poljska glumica, najpoznatija po ulogama u nekim od najvažnijih poljskih filmova 1950-ih, 1960-ih, 1970-ih i 1980-ih. Bila je u braku sa režiserom Andrzejem Wajda kome je rodila kćer."},{"page_url":"https://de.wikipedia.org/wiki/1498","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Schr_1498-1500.jpg","page_title":"1498","context_page_description":"Der portugiesische Seefahrer Vasco da Gama, der sich seit Mitte letzten Jahres im Auftrag von König Manuel I. auf der Suche nach dem Seeweg nach Indien befindet, befährt seit Anfang des Jahres mit seiner aus nur noch drei Schiffen bestehenden Flotte die afrikanische Ostküste Richtung Norden. Am 10. Januar ankert er in der Delagoabucht, die er aufgrund der freundlichen Bewohner Terra da Boa Gente nennt. Am 22. Januar gelangt er zur Mündung des Sambesi und errichtet dort ein Padrão. Im März entdecken die Portugiesen die Ilha de Moçambique, die von da Gama nach dem dortigen Scheich Moussa Ben Mbiki benannt wird, und am 7. April erreicht die Flotte Mombasa. Hier versuchen arabische Kaufleute, die Angst um ihr Monopol im Gewürzhandel haben, da Gamas Weiterfahrt zu verhindern.\\nDie Portugiesen segeln daraufhin weiter nach Malindi, die in Konkurrenz mit Mombasa steht, und wo sie Unterstützung finden. Ab hier führt ein arabischer Lotse Vasco da Gama durch die Gewässer. Am 17. oder 18. Mai kommt das indische Gebirge der Westghats in Sicht und das Geschwader ankert schließlich am 20. Mai in der Nähe von Kalikut."},{"page_url":"https://af.wikipedia.org/wiki/Becky_G","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Becky_G.jpg","page_title":"Becky G","context_page_description":"Becky G is 'n Amerikaanse aktrise. Sy is bekend vir haar rolle in die rolprente Hotel Transylvania, Neighbors 2: Sorority Rising, Power Rangers, en Gnome Alone."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Ingolstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Ingolstadt_Matth%C3%A4uskirche_2012_01.jpg","page_title":"Liste der Baudenkmäler in Ingolstadt","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen kreisfreien Stadt Ingolstadt zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/List_of_churches_in_the_Roman_Catholic_Diocese_of_Cleveland","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Saint_Francis_Xavier_Church.jpg","page_title":"List of churches in the Roman Catholic Diocese of Cleveland","context_page_description":"This is a list of current and former Roman Catholic churches in the Roman Catholic Diocese of Cleveland. The diocese covers Ashland, Cuyahoga, Geauga, Lake, Lorain, Medina, Summit and Wayne in northeastern Ohio. The cathedral church of the diocese is the Cathedral of St. John the Evangelist in Cleveland."},{"page_url":"https://es.wikipedia.org/wiki/Corona_(her%C3%A1ldica)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Bonnet_d%60honneur.png","page_title":"Corona (heráldica)","context_page_description":"El uso de las coronas como un distintivo o marca de soberanía es muy antiguo. La primera que se fabricó con rayos derechos y ondeados fue para Apolonio. El rey latino, que se decía nieto de Apolo, cuando se formaron los artículos del combate entre Eneas y Turno. Traía una corona de oro de doce rayos, según Virgilio en el párrafo VIII de su Eneida.\\nDiodoro de Sicilia nos manifiesta que el pabellón de Alejandro y su casco fueron adornados de una corona de oro. David ganó una del rey Melcom, toda enriquecida de piedras preciosas, que se la puso después sobre la cabeza. Y Salomón su hijo y sucesor trajo otra rayonada de oro y engastada de piedras preciosas."},{"page_url":"https://pl.wikipedia.org/wiki/Ismaning","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/F%C3%BCrstengang_Freising_-_Ismaning.jpg","page_title":"Ismaning","context_page_description":"Ismaning – miejscowość i gmina w Niemczech, w kraju związkowym Bawaria, w rejencji Górna Bawaria, w regionie Monachium, w powiecie Monachium. Leży około 15 km na północny wschód od centrum Monachium, nad Izarą, przy drodze B388, B471 i linii kolejowej Monachium – Port lotniczy.\\nW mieście znajduje się stacja kolejowa Ismaning.\\nSiedzibę mają przedsiębiorstwo Junkers i Zeppelin i sportowy kanał telewizyjny Sport1."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%85%E0%A4%B2%E0%A4%AB%E0%A4%BE%E0%A4%82%E0%A4%9C%E0%A5%8B_%E0%A4%B2%E0%A5%87%E0%A4%97%E0%A5%8D%E0%A4%B0%E0%A5%8B%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Alphonse_Legros_-_le_calvaire.jpg","page_title":"अलफांजो लेग्रोस","context_page_description":"अलफांजो लेग्रोस फ्रांस का चित्रकार एवं मूर्तिकार था।\\nइसके चित्रों का प्रथम प्रदर्शन १८५७ में हुआ लेकिन इसे प्रोत्साहन नहीं मिला। परिणामस्वरूप वह लन्दन चला आया। १८७० में युनिवर्सिटी कालेज में प्राध्यापक बना और १७ वर्ष तक रहा। इसके अधिकांश चित्रों का विषय फ्रांसीसी ग्राम्य जीवन है। इसकी कतिपय प्रसिद्ध रचनाएँ हैं - तीर्थयात्री, समुद्र का आशीर्वाद, बपतिस्मा, मृत ईसा तथा उपासिका।"},{"page_url":"https://en.wikipedia.org/wiki/Wei%C3%9Fach_(Bregenzer_Ach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Gschwendm%C3%BChlbr%C3%BCcke_%C3%BCber_die_Wei%C3%9Fach_Vbg_unweit_Aach%2C_von_Osten.jpg","page_title":"Weißach (Bregenzer Ach)","context_page_description":"The Weißach is a 33.5-kilometre-long, right-hand, eastern tributary of the Bregenzer Ach in the German and Austrian Alps. It flows into the Bregenzer Ach near Doren."},{"page_url":"https://ast.wikipedia.org/wiki/Patrimoniu_de_la_Humanid%C3%A1_n%27Europa_y_Am%C3%A9rica_del_Norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Stonehenge_Total.jpg","page_title":"Patrimoniu de la Humanidá n'Europa y América del Norte","context_page_description":"La Organización de les Naciones Xuníes pa la Educación, la Ciencia y la Cultura propunxo un plan de proteición de los bienes culturales del mundu, al traviés de la \\"Convención sobre la Proteición del Patrimoniu Mundial Cultural y Natural\\", aprobáu en 1972. Presenta una llista de bienes que pertenecen al Patrimoniu Mundial, más conocíu como Patrimoniu de la Humanidá."},{"page_url":"https://fr.wikipedia.org/wiki/Aburaage","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Abura-age.jpg","page_title":"Aburaage","context_page_description":"L’aburaage est un aliment japonais produit à partir de soja. On l'obtient en coupant du tofu en fines tranches et en le mettant à frire, d'abord à 110−120 °C, puis dans un second bain à 180−200 °C. L'aburaage est souvent utilisé pour envelopper des inarizushi et peut être ajouté à la soupe miso.\\nOn en met aussi sur des plats de nouilles udon, qui sont alors appelés kitsuneudon car la légende veut que les renards aiment le tofu frit. L'aburaage peut aussi être farci de nattō avant d'être à nouveau frit.\\nIl existe aussi une version coupée en tranches plus épaisses, appelée atsuage ou namaage.\\nLes Japonais ont été les premiers à préparer des poches de tofu frites. Toutefois, on connaît peu de choses sur leur apparition dans l'histoire. Le livre de recettes Tofu hyakuchin de 1782 donne une recette de tofu frit, mais il n'est pas clair si le résultat obtenu était une poche de tofu.\\nOn sait que les poches de tofu existaient en 1853, date à laquelle les inarizushi ont commencé à être préparées."},{"page_url":"https://de.wikipedia.org/wiki/Taillades","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Vue_sur_Taillades_2.JPG","page_title":"Taillades","context_page_description":"Taillades ist eine französische Gemeinde mit 1909 Einwohnern im Département Vaucluse in der Region Provence-Alpes-Côte d’Azur. Sie gehört zum Kanton Cheval-Blanc im Arrondissement Apt."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1960","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Dean_Malenko_with_Paul_Billets.jpg","page_title":"Lijst van personen geboren in 1960","context_page_description":"Dit is een lijst van personen die geboren zijn in 1960.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Olle_%C3%85hlund","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Olle_Ahlund.jpg","page_title":"Olle Åhlund","context_page_description":"Olle Åhlund was a Swedish footballer.\\nHe played for Degerfors IF. He won the bronze medal at the 1952 Summer Olympics.\\nHe was capped 34 times for the Sweden national football team."},{"page_url":"https://ca.wikipedia.org/wiki/Fleur%C3%A9_(Orne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Ch%C3%A2teau_de_la_Marre.png","page_title":"Fleuré (Orne)","context_page_description":"Fleuré és un municipi francès, situat al departament de l'Orne i a la regió de Normandia. L'any 2007 tenia 240 habitants."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E6%A0%B9%E5%AF%BF%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Yunomachi.jpg","page_title":"山根寿子","context_page_description":"山根 寿子は、日本の女優。本名は小川 寿子。東京市出身。身長156cm。\\n母はオペラ女優の山根千世子で、飲食店も経営していた。幼少よりピアノ、童謡、洋舞、日舞を習い、文化学院女学部に在学中の1936年、P.C.L.へ入社。本名でデビュー。P.C.L.は東宝に吸収される。\\n1939年、渡辺邦男監督『白蘭の歌』で長谷川一夫・李香蘭と共演。\\n1940年、衣笠貞之助監督『蛇姫様』で長谷川一夫の相手役となり人気スターの座へ。同年、『姑娘の凱歌』に初めて主演。その後もスターとして多くの主演作が作られる。\\n1946年、東宝争議の際、大河内伝次郎らと十人の旗の会を結成し、翌年3月の新東宝創立に参加。創立第一作の渡辺邦男監督『今日は踊って』でヒロインに。\\n1949年、フリーとなる。\\n1954年、プロデューサー小川吉衛と結婚する。1990年、69歳で死去した。"},{"page_url":"https://vi.wikipedia.org/wiki/Chiconi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Mayotte_administrative1.PNG","page_title":"Chiconi","context_page_description":"Chiconi là một xã thuộc tỉnh hải ngoại Mayotte của Pháp, trên Ấn Độ Dương."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B4%D0%BD%D1%94_%D1%8F%D0%B9%D1%86%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/The_Easter_Exhibition_at_the_Cultural_Miner%27s_House_in_Sanok_03.JPG","page_title":"Великоднє яйце","context_page_description":"Велико́днє яйце — невід'ємний атрибут святкування Великодня або приходу весни. За давньою традицією до цієї нагоди фарбували або розписували курячі яйця. Однак згодом їм на заміну прийшли декоровані гусячі, страусині, дерев'яні, скляні, пластмасові або навіть шоколадні яйця. У різних країнах світу існують різноманітні техніки декорування великодніх яєць."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_della_Madonna_delle_Grazie_(Cuglieri)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Graziecuglieri.JPG","page_title":"Chiesa della Madonna delle Grazie (Cuglieri)","context_page_description":"La chiesa della Madonna delle Grazie è un edificio religioso di Cuglieri. Si trova nella parte più antica dell'abitato, ai margini del rione Crabòla."},{"page_url":"https://hu.wikipedia.org/wiki/A_K%C3%A1rp%C3%A1t-medence_telep%C3%BCl%C3%A9sf%C3%B6ldrajza_a_13._sz%C3%A1zadig","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/A_k%C3%A9r_elterjed%C3%A9se.jpg","page_title":"A Kárpát-medence településföldrajza a 13. századig","context_page_description":"A Kárpát-medence sajátságos földrajzi egység Európa közepén. Magashegységekkel három oldalról körbevett, negyedik oldalán nagy folyók által határolt szabályos alakú térség, ami már az ember legkorábbi időszakaiban is lakott volt. Földrajzi adottságai által kialakult településhálózata az ókor óta folytonosan fejlődik. A fejlődés azonban több alkalommal megakadt vagy megszakadt, ebből is a tatárjárás időszakának alig kétéves pusztítása volt a legnagyobb hatású.\\nA Kárpát-medencei településfejlődés három nagy korszakra oszlik, amik nem követik a kronológia hagyományos történeti felosztását, hanem attól teljesen függetlenek. A térség benépesítése és az itt lakó emberek települései az őskortól a hunok koráig töretlen fejlődést mutatnak. A hunok korában gyakorlatilag megszűnt a településhálózat, amit a későbbi népek lassanként újraépítettek, ennek része volt az Árpád-kor eleje is. A 13. században azonban a tatárjárás nemcsak a népesség pusztulásával járt, hanem a településhálózat újabb összeomlásával. Ennek mértéke azon a tényen mérhető fel, hogy a Kárpát-medence egyes részein a településsűrűség és a lakosságszám csak a 18–19. században érte el újra a 13. századi szintet."},{"page_url":"https://en.wikipedia.org/wiki/Th%C3%A9%C3%A2tre_d%27Orl%C3%A9ans","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Orleans_Theater_New_Orleans_1813.jpg","page_title":"Théâtre d'Orléans","context_page_description":"The Théâtre d'Orléans was the most important opera house in New Orleans in the first half of the 19th century. The company performed in French and gave the American premieres of many French operas. It was located on Orleans Street between Royal and Bourbon. The plans for the theatre were drawn up by Louis Tabary, a refugee from the French colony of Saint-Domingue. Construction began in 1806, but the opening was delayed until October 1815. After a fire, it was rebuilt and reopened in 1819, led by another émigré from Saint-Domingue, John Davis. Davis became one of the major figures in French theatre in New Orleans. The theatre was destroyed by fire in 1866, but the ballroom is still used."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%83%88%E3%83%A9%E3%82%AB%E3%83%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/V%C5%AFz_P.JPG","page_title":"タトラカー","context_page_description":"タトラカーは、チェコ・プラハに存在したタトラ国営会社スミーホフ工場で開発・製造された路面電車車両の総称である。チェコスロバキアや東ドイツ、ソビエト連邦などの東側諸国を中心に世界各国に導入された。\\nこの項目では、他社によるライセンス生産で製造された同型の路面電車車両や、東ドイツに導入されたČKDタトラ製の二軸車T2D、B2Dについても記す。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EB%A5%B4%ED%88%AC%EB%A5%B4_%EB%8B%A4_%EC%BD%94%EC%8A%A4%ED%83%80_%EC%9D%B4_%EC%8B%9C%EC%9A%B0%EB%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Costa_e_Silva.jpg","page_title":"아르투르 다 코스타 이 시우바","context_page_description":"아르투르 다 코스타 이 시우바는 브라질의 군인이자 정치인으로, 제27대 대통령이다. 1964년 브라질 쿠데타와 관련된 인물이며, 공산주의를 탄압하는 등 파시스트 정치를 실시했다."},{"page_url":"https://fi.wikipedia.org/wiki/Fates_Warning","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Fates_Warning.jpg","page_title":"Fates Warning","context_page_description":"Fates Warning on yhdysvaltalainen progressiivista metallia soittava yhtye, joka on vaikuttanut vahvasti kyseisen genren kehitykseen 1980-luvun puolivälistä alkaen. Yhtye on tunnettu hyvin teknisestä ja kokeilevasta progerockin tyylilajin, spacerockin futuristisen psykedelian, Itämaisen musiikin ja jazzin erikoisien rytmien ja kappale-melodioiden rakenteen perinteiseen heavy metaliin taiteellisesta yhteen fuusioinnista."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AF%D8%B1%D9%88%D8%A8%D8%A7%D9%84_%D9%83%D8%A7%D8%A8%D8%B1%D9%8A%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Asdr%C3%BAbal_Cabrera_on_July_14%2C_2011.jpg","page_title":"اسدروبال كابريرا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاسدروبال كابريرا لاعب بيسبول من فنيزويلا."},{"page_url":"https://gl.wikipedia.org/wiki/Agn%C3%A8s_Varda","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Agn%C3%A8s_Varda_%28Berlinale_2019%29_%28cropped%29.jpg","page_title":"Agnès Varda","context_page_description":"Agnès Varda, nada o 30 de maio de 1928 en Ixelles e finada en París o 29 de marzo de 2019, foi unha fotógrafa e directora francesa de cinema.\\nFoi a única muller directora da Nouvelle Vague. Entre a súa filmografía destacan La Pointe courte, Cleo de 5 a 7, Ulysse, Sans toit ni loi, Jacquot de Nantes, Les Glaneurs et la Glaneuse, Deux ans après, Les Plages d'Agnès e Visages, villages.\\nFoi galardoada co premio César en 2001, co René-Clair da Academia Francesa en 2002, coa Palma de Honra do Festival de Cannes en 2015 e co Óscar honorífico en 2017, e coa Cámara da Festival Internacional de Cinema de Berlín en 2019, todos destinados a homenaxear o conxunto da súa carreira cinematográfica."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%80%E5%93%81%E7%B4%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/%E4%B8%80%E5%93%81%E7%B4%85%EF%BC%88%E4%B8%8D%E5%90%8C%E5%93%81%E7%A8%AE%EF%BC%89_20191117165211_03.jpg","page_title":"一品紅","context_page_description":"聖誕紅，又名為一品紅、聖誕花，大戟科大戟屬植物，在聖誕節用來擺設的著名紅色花卉。大紅大綠的葉片相間，外觀色彩充滿聖誕節的應景氣氛，因而稱為聖誕紅。\\n那些被人認為是花朵的紅色部份其實是苞葉，而真正的花是在葉束中間的部份。被栽培的品系的葉通常會被製成橙色、淺綠色、奶油色及大理石花紋，要達到這效果，在十月至聖誕節時，它們不可以在晚上被燈光照射。即使是少量燈光照亦會阻止其開「花」。\\n聖誕紅通常高六十公分至三米，其深綠色的葉長約七至十六公分。其最頂層的葉是火紅色、紅色或白色的，因此經常被誤會為花朵。\\n聖誕紅的花朵構造奇特，花序呈聚繖花序排列，雌雄花生在同一總苞內，雌花單一位於眾多雄花的中央，有的花序只開雄花。\\n總苞外有一、二明顯的腺體/蜜槽，黃色，二唇裂。\\n聖誕紅原來生長於南墨西哥及中美洲，其英語俗名「波因塞特」源於第一任美國駐墨西哥大使約爾·羅伯茲·波因塞特在1828年將其引進美國。"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_ministros_do_Mar_e_das_Pescas_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Antonio_Barreto_na_Exponor.JPG","page_title":"Lista de ministros do Mar e das Pescas de Portugal","context_page_description":"Esta é uma lista de ministros do Mar e de ministros das Pescas em Portugal, entre a criação do Ministério da Agricultura e Pescas a 26 de março de 1975, e a atualidade.\\nA lista cobre o atual período democrático."},{"page_url":"https://de.wikipedia.org/wiki/Pamela_Anderson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Pam_Anderson_2009_%28cropped%29.jpg","page_title":"Pamela Anderson","context_page_description":"Pamela Denise Anderson ist eine kanadisch-US-amerikanische Schauspielerin und ein Pin-up-Girl. In ihrer Rolle als Rettungsschwimmerin in der Erfolgsserie Baywatch wurde sie international zum Star. Sie gilt als das Sexsymbol der 1990er Jahre."},{"page_url":"https://fi.wikipedia.org/wiki/Florence_Arthaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Florence_Arthaud_d%C3%A9dicace.JPG","page_title":"Florence Arthaud","context_page_description":"Florence Arthaud oli ranskalainen kilpapurjehtija. Arthaud sai surmansa Villa Castellin helikopterionnettomuudessa maaliskuussa 2015. Samassa onnettomuudessa kuolivat myös ranskalainen nyrkkeilijä Alexis Vastine ja uinnin olympiavoittaja Camille Muffat."},{"page_url":"https://de.wikipedia.org/wiki/Costa_Concordia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Karte_der_Havarie_der_Costa_Concordia_%2813-1-2012%29.png","page_title":"Costa Concordia","context_page_description":"Die Costa Concordia war ein Post-Panamax-Kreuzfahrtschiff und zum Zeitpunkt der Indienststellung das größte italienische Kreuzfahrtschiff. Es gehörte der italienischen Reederei Costa Crociere, die Teil des britisch-US-amerikanischen und weltgrößten Kreuzfahrtunternehmens, Carnival Corporation & plc, ist. Das Schiff kollidierte am 13. Januar 2012 vor der Insel Giglio im Mittelmeer mit einem Felsen, schlug leck und wurde manövrierunfähig vom Wind in Richtung Insel gedrückt, wo es unmittelbar nördlich des kleinen Hafens der Insel auf Grund lief und mit der Zeit auf 65 Grad Schlagseite kippte. Der Unfall forderte 32 Todesopfer. Nachdem das Wrack über 18 Monate lang vor Giglio gelegen hatte, wurde es am 17. September 2013 aufgerichtet und ruhte bis zum 15. Juli 2014 auf einer am Meeresboden verankerten Plattform. Das havarierte Schiff wurde zur Verschrottung ab dem 23. Juli 2014 mit geringer Geschwindigkeit nach Genua geschleppt, wo es am 27. Juli 2014 eintraf. Die Verschrottung war im Juli 2017 abgeschlossen."},{"page_url":"https://hu.wikipedia.org/wiki/2010-es_U20-as_n%C5%91i_labdar%C3%BAg%C3%B3-vil%C3%A1gbajnoks%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Nigeria_Japan_U-20_Women_2010_Teams.jpg","page_title":"2010-es U20-as női labdarúgó-világbajnokság","context_page_description":"A 2010-es U20-as női labdarúgó-világbajnokság az 5. ilyen jellegű torna volt. A tornát 16 válogatott részvételével július 13-a és augusztus 1-je között rendezték Németországban. A vb-t a házigazda német csapat nyerte."},{"page_url":"https://en.wikipedia.org/wiki/Louveciennes","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Louveciennes_Ch%C3%A2teau_du_Pont.JPG","page_title":"Louveciennes","context_page_description":"Louveciennes is a commune in the Yvelines department in the Île-de-France region in north-central France. It is located in the western suburbs of Paris, between Versailles and Saint-Germain-en-Laye, and adjacent to Marly-le-Roi."},{"page_url":"https://vi.wikipedia.org/wiki/Costco","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Costcostorehenderson.jpg","page_title":"Costco","context_page_description":"Costco Wholesale Corporation, hay Costco, là một tập đoàn đa quốc gia Mỹ, điều hành một chuỗi các câu lạc bộ bán buôn chỉ dành cho các thành viên. Tính đến năm 2015, Costco là nhà bán lẻ lớn thứ hai trên thế giới sau Walmart, và tính đến năm 2006, Costco là nhà bán lẻ lớn nhất thế giới về thịt bò, thực phẩm hữu cơ, thịt gà quay và rượu vang. Costco được xếp hạng #15 trên Fortune 5,00 xếp hạng các tập đoàn Hoa Kỳ lớn nhất theo tổng doanh thu.\\nTrụ sở chính của Costco nằm ở Issaquah, Washington, ngoại ô phía đông Seattle; công ty đã mở kho hàng đầu tiên tại Seattle vào năm 1983. Tính đến ngày 7 tháng 3 năm 2019, Costco có tổng cộng 770 kho hàng: 531 ở Hoa Kỳ và 4 ở Puerto Rico, 100 ở Canada, 39 ở Mexico, 28 ở Anh, 26 ở Nhật Bản, 15 ở Hàn Quốc, 13 ở Đài Loan, 10 ở Úc, 2 ở Tây Ban Nha, 1 ở Iceland và 1 ở Pháp."},{"page_url":"https://cy.wikipedia.org/wiki/Dryw_prysgoed_pigwelw","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Slaty-backed_Thornbill_-_Christopher_Watson.jpg","page_title":"Dryw prysgoed pigwelw","context_page_description":"Aderyn a rhywogaeth o adar yw Dryw prysgoed pigwelw a adnabyddir hefyd gyda'i enw gwyddonol Sericornis spilodera; yr enw Saesneg arno yw Pale-billed sericornis. Mae'n perthyn i deulu'r Dreinbig sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn S. spilodera, sef enw'r rhywogaeth."},{"page_url":"https://es.wikipedia.org/wiki/Cuerno_de_Oro","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Topkapi_B15-06.jpg","page_title":"Cuerno de Oro","context_page_description":"El Cuerno de Oro es un histórico estuario a la entrada del estrecho del Bósforo, que divide la ciudad turca de Estambul. Este emplazamiento, que forma un puerto natural espectacular, ha protegido a los griegos, romanos, bizantinos y otomanos y otros barcos durante miles de años. Fue primero acondicionado por los colonos griegos para formar la ciudad de Bizancio y bajo el Imperio bizantino los canteros navales construyeron en él un muro a lo largo de la costa protegiendo la ciudad de los ataques navales.\\nSe trata de un estuario en forma de cimitarra que se une al Bósforo justo en el punto en que el estrecho entra en el mar de Mármara, formando una península en cuya punta está la vieja Estambul. Su nombre, en griego y español, significan lo mismo, pero a qué hace referencia la denominación «de oro» aún hoy es poco clara. Ha sido testigo de muchos incidentes históricos tumultuosos y sus espectaculares vistas han sido objeto de innumerables obras de arte."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Knights_of_the_Royal_Order_of_the_Seraphim","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Guilherme_Alexandre%2C_pr%C3%ADncipe_de_Orange.jpg","page_title":"List of Knights of the Royal Order of the Seraphim","context_page_description":"This is a list of the Knights and Members of the Royal Order of the Seraphim:"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%BE%D0%B6%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%B0_%D0%BA%D0%BE%D0%BC%D0%B5%D0%B4%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Manetti_The_Lair_of_Geryon_1506_Cornell_CUL_PJM_1004_06.jpg","page_title":"Божанствена комедија","context_page_description":"„Божанствена комедија“ је књижевно дело Дантеа Алигијерија, које се сматра највећом епском поемом италијанске литературе, као и једним од највећих дела светске литературе. Написана је између 1308. и 1321. године. Данте је дело назвао само „Комедија\\" зато што је био под утицајем тадашњих схватања да дела која трагично почну а срећно се заврше су комедије, а дела која трагично почну и у истом контексту се заврше су трагедије. Епитет \\"Божанствена\\" додао је Бокачо у његовом делу о Дантеовом животу, али он се званично употребљава тек од 1555. године."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_der_Oberpfalz","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Schloss_Sattelpeilnstein-2.JPG","page_title":"Liste von Burgen und Schlössern in der Oberpfalz","context_page_description":"Die Liste von Burgen und Schlössern in Bayern/Regierungsbezirk Oberpfalz ist ein Verzeichnis von historischen Orten, wie Burgen, Schlössern, Herrensitzen, Festungen, Motten, Burgställen und Wehrkirchen auf dem Territorium des heutigen Regierungsbezirks Oberpfalz, aufgeteilt in kreisfreie Städte und Landkreise. Es gibt weitere Listen für die Regierungsbezirke Oberbayern, Niederbayern, Oberfranken, Mittelfranken, Unterfranken und Schwaben. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://pl.wikipedia.org/wiki/Cadney_cum_Howsham","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/All_Saints_Church%2C_Cadney.jpg","page_title":"Cadney cum Howsham","context_page_description":"Cadney cum Howsham – były civil parish w Anglii, w hrabstwie ceremonialnym Lincolnshire, w dystrykcie North Lincolnshire. Leży 33 km na północ od miasta Lincoln i 225 km na północ od Londynu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_National_Historic_Landmarks_im_District_of_Columbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/US_Naval_Observatory_%28Washington%2C_District_of_Columbia%29.jpg","page_title":"Liste der National Historic Landmarks im District of Columbia","context_page_description":"Die Liste der National Historic Landmarks im District of Columbia führt alle Objekte und Stätten im US-amerikanischen District of Columbia auf, die vom National Register of Historic Places zur National Historic Landmark erklärt wurden."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%DB%8C%D8%B2%D9%84%D8%8C_%DA%A9%D9%86%D8%AA%D8%A7%DA%A9%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/KYMap-doton-Hazel.PNG","page_title":"هیزل، کنتاکی","context_page_description":"هیزل شهری در ایالت کنتاکی کشور ایالات متحده آمریکا است که جمعیت آن در سرشماری سال ۲۰۱۰ میلادی، ۴۱۰ نفر بوده‌است."},{"page_url":"https://pl.wikipedia.org/wiki/Teodoret_z_Cyru","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Theodoret_of_Cyr_%28in_A._Thevet1584%29.png","page_title":"Teodoret z Cyru","context_page_description":"Teodoret z Cyru, Theodoretus – grecki pisarz, historyk Kościoła starożytnego, teolog, biskup Cyrrhus, ojciec Kościoła, egzegeta i teolog oryginalny.\\nWystępował przeciw różnym herezjom i poglądom religijno-historiozoficznym, takim jak millenaryzm czy monofizytyzm Eutychesa."},{"page_url":"https://de.wikipedia.org/wiki/Lythria_sanguinaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Lythria_sanguinaria._Geometridae_Sterrhinae_Lythriini_%284367685420%29.jpg","page_title":"Lythria sanguinaria","context_page_description":"Lythria sanguinaria ist ein Schmetterling aus der Familie der Spanner. Das Artepitheton basiert auf dem lateinischen Wort sanguinarius mit der Bedeutung „blutdürstig“ und bezieht sich auf die rote Färbung auf der Vorderflügeloberseite der Falter."},{"page_url":"https://es.wikipedia.org/wiki/Elmira_Heights","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Elmira_Heights_Village_Hall.jpg","page_title":"Elmira Heights","context_page_description":"Elmira Heights es una villa ubicada en el condado de Chemung en el estado estadounidense de Nueva York. En el año 2000 tenía una población de 4,170 habitantes y una densidad poblacional de 1,414.9 personas por km²."},{"page_url":"https://de.wikipedia.org/wiki/Mannheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/MannheimQuadrat-D4-1-6.jpg","page_title":"Mannheim","context_page_description":"Die Universitätsstadt Mannheim ist ein Stadtkreis mit 309.370 Einwohnern im Regierungsbezirk Karlsruhe in Baden-Württemberg. Sie ist nach Stuttgart und Karlsruhe die drittgrößte Stadt des Landes. Die ehemalige Residenzstadt der Kurpfalz mit ihrem stadtprägenden Barockschloss, einer der größten Schlossanlagen der Welt, bildet das wirtschaftliche und kulturelle Zentrum der Metropolregion Rhein-Neckar mit 2,35 Millionen Einwohnern.\\nMannheim liegt unmittelbar im Dreiländereck mit Baden-Württemberg, Rheinland-Pfalz und Hessen. Von seiner rheinland-pfälzischen Schwesterstadt Ludwigshafen am Rhein, mit der es ein zusammenhängendes Stadtgebiet bildet, ist Mannheim durch den Rhein getrennt.\\nErstmals 766 im Lorscher Codex urkundlich erwähnt, erhielt Mannheim 1607 die Stadtprivilegien, nachdem Kurfürst Friedrich IV. von der Pfalz den Grundstein zum Bau der Festung Friedrichsburg gelegt hatte. Das damals für die mit der Festung verbundene Bürgerstadt Mannheim angelegte gitterförmige Straßennetz mit Häuserblöcken statt Straßenzügen ist in der Innenstadt erhalten geblieben. Darauf ist die Bezeichnung Quadratestadt zurückzuführen."},{"page_url":"https://fr.wikipedia.org/wiki/Wairoa_(fleuve_de_la_Baie_de_l%E2%80%99Abondance)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Wairoa_Extreme_Race_Roller_Coaster.JPG","page_title":"Wairoa (fleuve de la Baie de l’Abondance)","context_page_description":"Le fleuve Wairoa est un cours d’eau de l’île du Nord de la Nouvelle-Zélande."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%A3%E0%B8%84%E0%B8%AA%E0%B8%AB%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%8A%E0%B8%B2%E0%B9%84%E0%B8%97%E0%B8%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/%E0%B8%97%E0%B8%A7%E0%B8%B5_%E0%B9%81%E0%B8%A3%E0%B8%87%E0%B8%82%E0%B8%B3.jpg","page_title":"พรรคสหประชาไทย","context_page_description":"พรรคสหประชาไทย พรรคการเมืองในอดีตของประเทศไทยที่เคยเป็นพรรคที่ชนะการเลือกตั้งและเป็นพรรคที่เป็นแกนนำในการจัดตั้งรัฐบาลก่อตั้งเมื่อวันพฤหัสบดีที่ 24 ตุลาคม พ.ศ. 2511 หลังจากมีพระราชบัญญัติพรรคการเมือง พุทธศักราช 2511 ออกมาใช้มี จอมพล ถนอม กิตติขจร นายกรัฐมนตรี รัฐมนตรีว่าการกระทรวงกลาโหม และ ผู้บัญชาการทหารสูงสุด เป็นหัวหน้าพรรค มีรองหัวหน้าพรรค 3 คน คือ พลเอกประภาส จารุเสถียร รองนายกรัฐมนตรี รัฐมนตรีว่าการกระทรวงมหาดไทย และ ผู้บัญชาการทหารบก พลตำรวจเอก ประเสริฐ รุจิรวงศ์ อธิบดีกรมตำรวจ และนาย พจน์ สารสิน อดีตนายกรัฐมนตรี โดยมี พลอากาศเอก ทวี จุลละทรัพย์ เป็นเลขาธิการพรรค\\nในการเลือกตั้งเมื่อปี พ.ศ. 2512 พรรคสหประชาไทย ได้รับเลือกตั้งด้วยจำนวนเสียงมากที่สุด คือ 75 เสียง ได้เป็นแกนนำในการจัดตั้งรัฐบาล แต่ยังไม่ถึงกึ่งหนึ่งของสมาชิกสภาผู้แทนราษฎร จำต้องหาเสียงสนับสนุนเพิ่มเติม โดยมีข้อต่อรองเรื่องผลประโยชน์เป็นการตอบแทน\\nพรรคสหประชาไทยจึงได้เป็นแกนกลางจัดตั้งรัฐบาลเมื่อวันที่ 7 มีนาคม พ.ศ. 2512 โดยมีจอมพลถนอม กิตติขจร เป็นนายกรัฐมนตรี แต่รัฐบาลก็มีปัญหาวุ่นวายตามมาไม่สิ้นสุด อันเนื่องจากการต่อรองขอผลประโยชน์ของสมาชิกพรรคเองรวมถึงงบประมาณรายจ่ายประจำปีงบประมาณ 2515"},{"page_url":"https://en.wikipedia.org/wiki/Hypsibiidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Waterbear.jpg","page_title":"Hypsibiidae","context_page_description":"The Hypsibiidae are a family of water bears or moss piglets, tardigrades in the class Eutardigrada."},{"page_url":"https://da.wikipedia.org/wiki/Park_All%C3%A9_(Aarhus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Park_All%C3%A9_ved_Baneg%C3%A5rdspladsen_Aarhus_C.jpg","page_title":"Park Allé (Aarhus)","context_page_description":"Park Allé er en gade beliggende i centrum af Aarhus.\\nGaden, der strækker sig over 300 m, forbinder Rådhuspladsen/Sønder Allé i nord med Banegårdsgade/Banegårdspladsen i syd. Park Allé blev anlagt i 1921 og er blandt andet kendt for et af byens fineste hoteller, Hotel Ritz. Desuden ligger Aarhus Rådhus også ud til gaden, der har navn efter den tilknyttede park, Rådhusparken.\\nGaden er et knudepunkt for den offentlige trafik i Aarhus, idet mange bybuslinjer har stoppested her."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D1%80%D1%82%D1%8D%D0%BC,_%D0%A0%D0%B0%D0%BB%D1%8C%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Ralph_Northam_signature.png","page_title":"Нортэм, Ральф","context_page_description":"Ральф Ши́рер Но́ртэм — американский врач и политик, член Демократической партии, губернатор штата Виргиния с 2018 года."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%AC%CF%81%CE%BD%CE%B7%CE%B8%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Parnitha_satellite_map-blank.jpg","page_title":"Πάρνηθα","context_page_description":"Η Πάρνηθα είναι βουνό της Αττικής, βόρεια των Αθήνων, με συνολική έκταση 300 περίπου τετραγωνικά χιλιόμετρα και ψηλότερη κορυφή την Καραβόλα. Καλύπτεται από πεύκα στα χαμηλότερα και από έλατα στα υψηλότερα σημεία της. Η Πάρνηθα έχει ανακηρυχθεί περιοχή ιδιαίτερου φυσικού κάλλους και ένα σημαντικό της τμήμα απαρτίζει τον ομώνυμο Εθνικό Δρυμό, ο οποίος ιδρύθηκε το 1961. Έχει ενταχθεί στο δίκτυο Natura 2000, αποτελεί σημαντική περιοχή για τα πουλιά και έχει ανακηρυχθεί τοπίο ιδιαίτερου φυσικού κάλλους, ενώ μετά την πυρκαγιά του 2007 καθορίστηκαν περιοχές προστασίας με Προεδρικό Διάταγμα.\\nΤαυτόχρονα όμως, η Πάρνηθα αποτελεί βάση στρατιωτικών εγκαταστάσεων στις δύο υψηλότερες κορυφές της.\\nΣε μία από τις κορυφές του βουνού, το Μαυροβούνι, έχει χτιστεί το Καζίνο της Πάρνηθος, στο οποίο μπορεί να φτάσει κανείς είτε με αυτοκίνητο είτε με τελεφερίκ. Στην περιοχή λειτουργούν τα ορειβατικά καταφύγια Μπάφι και Φλαμπούρι.\\nΑπό τον τοπικό πληθυσμό η Πάρνηθα αποκαλούταν στο παρελθόν και Οζιά, ονομασία άγνωστης ετυμολογίας και προέλευσης σήμερα."},{"page_url":"https://nl.wikipedia.org/wiki/Bispira_variegata","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Bispira_variegata_%28variegated_feather_duster_worms%29_%28San_Salvador_Island%2C_Bahamas%29_1_%2816141719351%29.jpg","page_title":"Bispira variegata","context_page_description":"Bispira variegata is een borstelworm uit de familie Sabellidae. De soort leeft in riffen en omliggende gebieden verspreid over het Caribisch gebied op een diepte variërend van zes tot vijfentwintig meter.\\nBispira variegata kan een lengte van zes centimeter bereiken en telt één kroon die drie centimeter lang kan worden. De kleur van deze kroon varieert van zwart tot bruin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D1%80%D1%82_%D0%9A%D0%B0%D1%80%D0%B8%D0%BB%D1%8C%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Fort_Carillon_1.jpg","page_title":"Форт Карильон","context_page_description":"Форт Карильоном был построен Пьером де Риго де Водрёй, губернатором французской Канады, чтобы защитить озеро Шамплейн от британского вторжения. Расположен на берегу озера в пятнадцати милях к югу от форта Сен-Фредерик, он был построен для защиты от нападения как опорный пункт в возможной будущей войне.\\nСтроительство началось в октябре 1755 года."},{"page_url":"https://es.wikipedia.org/wiki/Hibiscus_heterophyllus","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Hibiscus_heterophyllus_foliage.jpg","page_title":"Hibiscus heterophyllus","context_page_description":"Hibiscus heterophyllus, también conocida como balibago de Filipinas​ y rosela australiana, es una especie de hibiscus que es endémico de Nueva Gales del Sur y Queensland en Australia."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86_%D8%A8%D9%8A%D8%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Jean_Paige_Trading_Card.jpg","page_title":"جان بيج","context_page_description":"جان بيج ‏ هي ممثلة أمريكية، ولدت في 3 يوليو 1895 في الولايات المتحدة، وتوفيت في 15 ديسمبر 1990 بلوس أنجلوس في الولايات المتحدة."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9B%BE%E5%B0%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/France_Autoroutes_SSW_Tours.svg","page_title":"图尔","context_page_description":"都爾，法國中西部城市，中央-羅亞爾河谷大區安德爾-羅亞爾省的一個市鎮和該省的省會，下轄都爾區，其市鎮面積34.36平方公里，2017年1月1日時人口數量為135,787人，是該省乃至整個大區人口數量最多的城市。2018年，都爾-羅亞爾河谷都會區成立，代替了原來的城市圈公共社區，成為了法國22個都會區之一。\\n都爾位於法國巴黎盆地西南部，市區地勢平坦，法國第一大河羅亞爾河和其第二大支流謝爾河自東向西平行穿越市區，使得都爾市區呈現出「兩水三岸」的城市面貌。都爾也是法國西部重要的交通樞紐之一，三條高速公路和十個方向的鐵路線在此交匯，由此前往周邊多個大城市的路程均在一小時以內。都爾-羅亞爾河谷機場亦是中央-羅亞爾河谷大區境內唯一的開闢常規航線的客運機場。\\n都爾是法國歷史文化名城，其築城史始於公元一世紀，自建城以來一直為這一地區的政治和文化中心，中世紀時成為軍事要塞和聖雅各朝聖之路上的重要驛站，文藝復興前期則因瓦盧瓦國王路易十一的長居而一度成為了「法蘭西的首都」。都爾市中心的傳統房屋多以石灰華和板岩作為外牆和屋頂的裝飾材料，因此都爾又被譽為「白藍之城」，其所在的羅亞爾河谷也被稱為「法蘭西花園」，並於2000年被列入世界文化遺產。"},{"page_url":"https://da.wikipedia.org/wiki/Danmarks_geografi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Sea_beach_cliff_2004_ubt.jpeg","page_title":"Danmarks geografi","context_page_description":"Danmark er det mindste og sydligste af de nordiske lande, lige nord for sit eneste naboland, Tyskland, sydvest for Sverige og syd for Norge. Danmark betegnes som et skandinavisk land, selv om det ikke hører til den skandinaviske halvø, både fordi det tidligere i historien omfattede områder på den skandinaviske halvø, og pga. det tætte kulturelle slægtskab med Norge og Sverige. Vest for Danmark ligger Nordsøen, mens Østersøen ligger i sydøst. Mellem Danmark og Sverige ligger Øresund og Kattegat, mens Skagerrak skiller Danmark fra Norge.\\nDanmark består af halvøen Jylland og omkring 1.419 øer på over 100 m², hvoraf 443 er navngivne. Af disse er 72 øer beboede, og de største er Sjælland, Nørrejyske Ø og Fyn. Øen Bornholm ligger øst for resten af landet i Østersøen. Mange af de større øer er forbundet med broer. Øresundsbroen forbinder Sjælland med Sverige, Storebæltsbroen forbinder Fyn med Sjælland, og Lillebæltsbroerne forbinder Fyn med Jylland. Færger og småfly forbinder de mindre øer. De største byer i Danmark er København, Århus, Aalborg og Esbjerg og Odense. Sammen med Ækvatorialguinea er Danmark det eneste land forbundet til et kontinent, hvor hovedstaden ligger på en ø."},{"page_url":"https://en.wikipedia.org/wiki/George_Bullough","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/George_Bullough_%281870-1939%29_%28A%29.jpg","page_title":"George Bullough","context_page_description":"Sir George Bullough, 1st Baronet was a late Victorian playboy and was an owner and breeder of thoroughbred racehorses."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%82%A3%E3%82%A2%E3%83%96%E3%83%AD%E3%83%BB%E3%82%AD%E3%83%A3%E3%83%8B%E3%82%AA%E3%83%B3%E5%8E%9F%E5%AD%90%E5%8A%9B%E7%99%BA%E9%9B%BB%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Diablo_Canyon_NPP_above.jpg","page_title":"ディアブロ・キャニオン原子力発電所","context_page_description":"ディアブロ・キャニオン発電所は、カリフォルニア州 サンルイスオビスポ郡アビラ･ビーチに位置する原子力発電所である。発電所には、ウェスティングハウス社設計の加圧水型原子炉があり、パシフィック・ガス・アンド・エレクトリックが運用を行っている。施設はカリォルニア州アビラ･ビーチの約750エーカーの敷地を占める。\\n2つの1,100MWの原子炉が毎年約18,000GWhの発電を行い、5 500 kV の送電線を通じて約220 万人に電気を供給する。施設は断層の上に建てられており、近くに別の断層もある。\\n発電所は原子力規制委員会リージョンIVの管轄圏内にある。 2009年11月、PG&Eは原子力規制委員会に20年間の免許更新を申請した。\\n2016年6月、PG&Eは2025年までに閉鎖することを発表した。"},{"page_url":"https://id.wikipedia.org/wiki/Pierre-Emerick_Aubameyang","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/1_Pierre-Emerick_Aubameyang.jpg","page_title":"Pierre-Emerick Aubameyang","context_page_description":"Pierre-Emerick Aubameyang adalah pemain sepak bola profesional yang bermain sebagai striker dan kapten tim untuk tim Premier League Inggris Arsenal dan tim nasional Gabon. Aubameyang dalam permainan tim lebih sering berada di posisi penyerang, meski juga pernah bermain pada posisi penyerang sayap."},{"page_url":"https://sco.wikipedia.org/wiki/28_Julie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Young_Beatrix.jpg","page_title":"28 Julie","context_page_description":"The 28t o Julie is the 209t day o the year in the Gregorian Calendar, wi 156 days ti come."},{"page_url":"https://en.wikipedia.org/wiki/Serbian_Despotate","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Dizdar%27s_Tower.jpg","page_title":"Serbian Despotate","context_page_description":"The Serbian Despotate was a medieval Serbian state in the first half of the 15th century. Although the Battle of Kosovo in 1389 is generally considered the end of medieval Serbia, the Despotate, a successor of the Serbian Empire and Moravian Serbia, survived for another 60 years, experiencing a cultural and political renaissance before it was conquered by the Ottomans in 1459. Before its conquest the Despotate nominally had a suzerain status to the Ottoman Empire, Byzantine Empire and Kingdom of Hungary. After being fully subjugated to the Ottoman Empire in 1459, it continued to exist in exile in the medieval Kingdom of Hungary until the mid-16th century. Pavle Bakić was the last Despot of Serbia to be recognized by both the Ottoman and the Habsburg Monarchy."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A9%D7%95%D7%97%D7%99%D7%AA_%D7%9C%D7%91%D7%A0%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Picea_glauca-bark.jpg","page_title":"אשוחית לבנה","context_page_description":"אשוחית לבנה הוא עץ מחטני ירוק-עד ממשפחת האורניים. תחום התפוצה של העץ משתרע על צפון אזורי האקלים הממוזג ויערות הטייגה של אמריקה הצפונית עד קו העצים של הטונדרה. תחום התפוצה המקורי השתרע ממרכז אלסקה ועד מזרחה, דרומה לרוחב רוב שטחה של קנדה, והוא מצוי בכל עשר הפרובינציות ושלוש הטריטוריות של המדינה. העץ התאזרח במדינות הגובלות בקנדה גם בחלקים הצפוניים של ארצות הברית: מונטנה, מינסוטה, ויסקונסין, מישיגן, ורמונט, ניו המפשייר ומיין; יש גם אוכלוסייה מבודדת בגבעות השחורות של דקוטה הדרומית וויומינג. העץ הוא אחד מקרוב ל-40 מינים של הסוג אשוחית, ואחד העמידים ביותר לתנאי האקלים הקשים של האזור הארקטי.\\nאשוחית לבנה היא העץ הרשמי של הפרובינציה מניטובה של קנדה, ושל מדינת דקוטה הדרומית בארצות הברית."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D1%85%D0%BE%D0%BF%D1%83%D1%82%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA%D0%B0_%D0%9C%D0%B0%D1%80%D0%BE%D0%BA%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/AMX-13_155mm_F3%2C_Tanks_in_the_Mus%C3%A9e_des_Blind%C3%A9s%2C_France%2C_pic-2.JPG","page_title":"Сухопутные войска Марокко","context_page_description":"Сухопутные войска Марокко или Королевская марокканская армия — один из видов войск Вооружённых сил Марокко, созданы в 1956 году.\\n2 военных округа: Северный и Южный.\\n6 бригад, 8 механизированных и мотопехотных полков, 64 отдельных батальона, 11 отдельных артиллерийских дивизионов и 1 дивизион ПВО.\\nВ королевской гвардии — 1 батальон и 1 кавалерийский эскадрон."},{"page_url":"https://ceb.wikipedia.org/wiki/Facelina_annulicornis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Facelina_annulicornis_%28Chamisso_%26_Eisenhart%2C_1821%29.jpg","page_title":"Facelina annulicornis","context_page_description":"Espesye sa hilahila nga una nga gihulagway ni Adelbert von Chamisso ug Karl Wilhelm Eysenhardt ni adtong 1821 ang Facelina annulicornis. Ang Facelina annulicornis sakop sa kahenera nga Facelina sa kabanay nga Facelinidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%88%D9%84%D9%85%D8%A8%D9%8A%D8%A7%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Antikes_Olympia_Stadion.JPG","page_title":"أولمبياد","context_page_description":"الأولمبياد ‏ هي تسمية يونانية قديمة لفترة زمنية مدتها أربع سنوات، تقام فيها سلسلة من المنافسات في اليونان القديمة، إذ كان يطلق على الفترة الزمنية بين دورتين من تلك الألعاب اسم أولمبياد.\\nيستخدم هذا التعبير الزمني في الألعاب الأولمبية الحديثة، إذ تسمى بالألمبياد، والتي تبدأ من بداية السنة الميلادية في 1 كانون الثاني/يناير والتي ستقام فيها الألعاب الأولمبية الصيفية باسم أولمبياد. فعلى سبيل المثال، وفق التاريخ الحديث، كان أول أولمبياد بين سنتي 1896 و 1900؛ بالتالي فسنة 2016 تمثل الأولمبياد الحادي والثلاثين."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Presiden_Partai_Bharatiya_Janata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Nitin_Gadkari_1_%28cropped%29.JPG","page_title":"Daftar Presiden Partai Bharatiya Janata","context_page_description":"Berikut ini adalah Daftar Presiden Partai Bharatiya Janata, salah satu dari dua partai besar dalam sistem politik India, bersama dengan Kongres Nasional India. Hingga 2018, partai tersebut menjadi partai politik terbesar di negara tersebut dalam hal jumlah perwakilan dalam parlemen nasional dan majelis-majelis tingkat negara bagian, dan merupakan partai terbesar di dunia dalam hal jumlah anggota primer. PBJ adalah sebuah partai sayap kanan, dan kebijakan-kebijakannya dulunya merefleksikan posisi nasionalis Hindu. Partai tersebut memiliki hubungan organisasional dan ideologi yang dekat dengan Rashtriya Swayamsevak Sangh.\\nPada 1951, Syama Prasad Mukherjee meninggalkan Kongres Nasional India untuk membentuk Bharatiya Jana Sangh dengan kolaborasi dari RSS. Pada 1977, Jana Sangh bergabung dengan beberapa partai lain untuk membentuk Partai Janata, yang bubar tiga tahun kemudian. Setelah itu, para anggota Jana Sangh kembali berkumpul untuk membentuk PBJ. Partai tersebut hanya memenangkan dua kursi dalam pemilihan umum parlementer India 1984, namun bertumbuh kuat pada bekingan gerakan Ram Janmabhoomi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D0%B5%D0%BD%D0%B5%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Genetta_angolensis.jpg","page_title":"Ангольская генета","context_page_description":"Ангольская генета — вид хищных животных из семейства виверровых."},{"page_url":"https://es.wikipedia.org/wiki/Ostrander_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Buckeye_Valley_West_Elementary_School.jpg","page_title":"Ostrander (Ohio)","context_page_description":"Ostrander es una villa ubicada en el condado de Delaware en el estado estadounidense de Ohio. En el Censo de 2010 tenía una población de 643 habitantes y una densidad poblacional de 294,85 personas por km².​"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A9%E6%B4%A5%E5%B8%82%E5%8E%86%E5%8F%B2%E9%A3%8E%E8%B2%8C%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/%E5%93%88%E5%B0%94%E6%BB%A8%E9%81%9367-71%E5%8F%B7.jpg","page_title":"天津市历史风貌建筑列表","context_page_description":"天津市歷經600多年的建城史和近代租界的都市計畫發展，出現了一大批具有較高的歷史、文化、科學、藝術和人文價值並反映時代特色和地域特色的建築和著名建築師的代表作，市中心城區形成了包括法國、義大利、英國風格等在內的濃郁的異國風情以及民國時期的建築風格，具有與中國其他城市截然不同的城市風情。儘管一直遭到自然和人為的損毀，這些建築中完好保留下來的仍有很多。傳統上，城市通過設立「文物保護單位」的方法對其進行保護，但隨著21世紀初中國城市房地產開發的熱潮，這些建築的存在受到嚴重威脅。為了平衡對這些建築的保護同市中心土地開發之間的關係，天津市第十四屆人民代表大會常務委員會第二十一次會議於2005年7月20日通過名為《天津市歷史風貌建築保護條例》的地方性法規，受其保護的建築則稱為天津市歷史風貌建築。"},{"page_url":"https://pt.wikipedia.org/wiki/Wilshire_Grand_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Wilshire_Grand2017.jpg","page_title":"Wilshire Grand Center","context_page_description":"Wilshire Grand Central é um arranha-céu de 73 andares de 335 metros de altura localizado no centro de Los Angeles, Califórnia. É o edifício mais alto de Los Angeles e da Califórnia, e o edifício mais alto à oeste do Rio Mississippi e fora da cidade de Nova York, Chicago e Filadélfia, e o 10º edifício mais alto dos Estados Unidos. Sua altura ultrapassa a altura do U.S. Bank Tower 25 metros. O edifício faz parte de um complexo de hotéis, varejos, plataformas de observação, shopping centers e escritórios, construído para revitalizar o centro de Los Angeles e a área ao redor do edifício. O desenvolvimento do complexo teve custo estimado de US$ 1,2 bilhão. O edifício possui uma área de 6 225 metros quadrados de varejo, 62 895 metros quadrados de escritórios Classe A e de 900 quartos de hotel. O InterContinental é a rede hoteleira que atua no edifício, composto de 900 quartos e suites."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Feldafing","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/FeldafingVilla-01.jpg","page_title":"Liste der Baudenkmäler in Feldafing","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Gemeinde Feldafing zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Giuseppe_Pozzobonelli","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/St.Card.Pozzobonelli.JPG","page_title":"Giuseppe Pozzobonelli","context_page_description":"Giuseppe II Pozzobonelli was an Italian Cardinal and the Archbishop of Milan from 1743 to 1783."},{"page_url":"https://sv.wikipedia.org/wiki/Parides_sesostris","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/CramerAndStoll-uitlandsche_kapellen_vol._3-_pl_211.jpg","page_title":"Parides sesostris","context_page_description":"Parides sesostris är en fjärilsart som först beskrevs av Pieter Cramer 1779. Parides sesostris ingår i släktet Parides och familjen riddarfjärilar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/K%C3%B6nigslutter","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/K%C3%B6nigslutter_Dom_Vor.jpg","page_title":"Königslutter","context_page_description":"Königslutter am Elm es una ciudad alemana de casi 16.000 habitantes, ​ localizada en el distrito de Helmstedt en el Estado federal de Baja Sajonia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A9%E4%B8%BB%E6%95%99%E9%AD%AF%E5%AE%89-%E8%AB%BE%E8%98%AD%E9%81%94%E6%95%99%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Roman_Catholic_Diocese_of_Rouyn-Noranda_in_Canada.jpg","page_title":"天主教魯安-諾蘭達教區","context_page_description":"天主教魯安-諾蘭達教區是加拿大一個羅馬天主教教區，屬加蒂諾總教區。1973年11月29日升為教區。\\n教區位於魁北克西部，2004年有教友58,901人。教區下轄卅九堂區，有卅三名司鐸。\\n現任教區主教為若瑟·威田南·谷里·布朗哲，榮休主教為多里拉·莫羅。"},{"page_url":"https://es.wikipedia.org/wiki/Peucaea_humeralis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Peucaea_humeralis_1902.jpg","page_title":"Peucaea humeralis","context_page_description":"El zacatonero de pecho negro o chingolo pechinegro ​​ es una especie de ave paseriforme de la familia Passerellidae endémica de México, en la cuenca del río balsas, que abarca a los estados de Jalisco, Oaxaca, Guerrero, México, Morelos y Puebla, aunque también se le encuentra en Colima​​."},{"page_url":"https://en.wikipedia.org/wiki/Collins,_Wisconsin","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/CollinsWisconsinSignWIS32WIS67.jpg","page_title":"Collins, Wisconsin","context_page_description":"Collins is an unincorporated census-designated place in the town of Rockland, Manitowoc County, Wisconsin, United States, in the east central part of the state. Its zip code is 54207, although its post office is being studied for closure. As of the 2010 census, its population is 164. The Collins Marsh Wildlife Area is located east of the community. Wisconsin Highway 32 ran through the community; the route later became Wisconsin Highway 67 before it became County Highway W. County Highway JJ and the Wisconsin Central Ltd. railroad runs east–west through the community. Collins has an area of 0.496 square miles, all of it land. The community was named for Sumner J. Collins, who was the general superintendent of the Wisconsin Central Railroad in the 1890s."},{"page_url":"https://en.wikipedia.org/wiki/Frederick_Robson","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Adelaide_Ristori_in_Ernest_Legouv%C3%A9%27s_M%C3%A9d%C3%A9e.jpg","page_title":"Frederick Robson","context_page_description":"Frederick Robson, born Thomas Brownbill was an English comedian, actor and ballad singer. During his acting career, he combined outstanding comic gifts with the power of moving an audience to a sense of tragedy or pathos. Although Robson's career spanned more than two decades, the period of his greatest success was at the Olympic Theatre, beginning in 1853 and lasting only a few years."},{"page_url":"https://en.wikipedia.org/wiki/Suzuki_Vitara","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/99-01_Suzuki_Grand_Vitara.jpg","page_title":"Suzuki Vitara","context_page_description":"The Suzuki Vitara is a compact SUV produced by Suzuki in four generations since 1988. The second and third generation models were known as the Suzuki Grand Vitara, with the fourth and current series eschewing the \\"Grand\\" prefix. In Japan and a number of other markets, all generations have used the name Suzuki Escudo.\\nThe original series was designed to fill the slot above the Suzuki Jimny. The first generation was known as Suzuki Sidekick in the United States. The North American version was produced as a joint venture between Suzuki and General Motors known as CAMI. The Sidekick was sold in various badges such as the Geo Tracker in the United States, and as the GMC Tracker, Chevrolet Tracker, Asüna Sunrunner and Pontiac Sunrunner in Canada. It was also sold as the Santana 300 and 350 in Spain. In the Japanese market, it was also sold as the Mazda Proceed Levante.\\nThe second generation was launched in 1998 under the \\"Grand Vitara\\" badge in most markets. It was accompanied by a still larger SUV known as the Suzuki XL-7. The third generation was launched in 2005."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_obci_Bernol%C3%A1kovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Bernol%C3%A1kovo_kaplnka_01.jpg","page_title":"Zoznam kultúrnych pamiatok v obci Bernolákovo","context_page_description":"Zoznam kultúrnych pamiatok v obci Bernolákovo v okrese Senec.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A0%D7%93%D7%A8%D7%90%D7%94_%D7%93%D7%95%D7%91%D7%99%D7%A6%D7%99%D7%95%D7%96%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Andrea_DOVIZIOSO_-_Ducati_Team_-_MotoGP_2014_-_Le_Mans_%2814217890902%29.jpg","page_title":"אנדראה דוביציוזו","context_page_description":"אנדראה דוביציוזו הוא רוכב מרוצי אופנועים איטלקי המתחרה כיום בסדרת ה-MotoGP, בקבוצת דוקאטי. בשנת 2004 זכה באליפות העולם בקטגוריית 125 סמ\\"ק.\\nמשנת 2013 החל לרכב עבור קבוצת המפעל של דוקאטי וידוע גם בכינויו דזמו דובי."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Ferrovi%C3%A1ria_de_Pinhal_Novo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Flickr_-_nmorao_-_Regional_3702%2C_Esta%C3%A7%C3%A3o_de_Pinhal_Novo%2C_2008.07.09.jpg","page_title":"Estação Ferroviária de Pinhal Novo","context_page_description":"A Estação Ferroviária de Pinhal Novo é uma gare da Linha do Alentejo, que funciona como interface com a Linha do Sul, e que serve a localidade de Pinhal Novo, no concelho de Palmela, em Portugal."},{"page_url":"https://ca.wikipedia.org/wiki/Vincent_van_Gogh","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Hiroshige_Van_Gogh_2.JPG","page_title":"Vincent van Gogh","context_page_description":"Vincent Willem van Gogh fou un pintor postimpressionista neerlandès, autor d'uns 900 quadres i uns 1.600 dibuixos. A més, deixà 800 cartes, 650 d'aquestes adreçades al seu germà petit, Theo van Gogh. La figura central en la vida de Van Gogh fou aquest germà, que contínuament i desinteressada li donà suport financer. La gran amistat que tota la vida els uní es troba documentada en les nombroses cartes que s'intercanviaren a partir de l'agost del 1872. Van Gogh fou un pioner de l'expressionisme.\\nMalgrat la qualitat de l'obra, calgué esperar a la seva mort perquè els mèrits li fossin reconeguts i es convertís en una gran figura de la pintura. Tingué una gran influència en l'art del segle xx, especialment entre els fauvistes i els expressionistes alemanys. El seu art fou seguit per Derain, Vlaminck i Van Dongen."},{"page_url":"https://de.wikipedia.org/wiki/Leibnizschule_Hannover","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Leibniz_Schule_Hannover.jpg","page_title":"Leibnizschule Hannover","context_page_description":"Die Leibnizschule ist ein Gymnasium in Hannover im Stadtteil List. Es hat die Schwerpunkte Sprachen, Mathematik/Naturwissenschaften, Gesellschaftswissenschaften, sowie seit ein paar Jahren Kunst/Musik. Als „offene Ganztagsschule“ unterhält sie eine eigene Mensa und hat sich der Thematik der Ökologie verpflichtet."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Danmarks_statsministre","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/MadsenMygdal.jpg","page_title":"Liste over Danmarks statsministre","context_page_description":"Liste over Danmarks statsministre er en liste over statsministre og lignende embeder i Danmark. Embedet ble opprettet under enevoldstiden, ved utnevnelsen av lensgreve Frederik Ahlefeldt til storkansler i 1676. I 1730 ble embedstittelen endret til statsminister. Gjennom Danmarks grunnlov av 1849 ble landet omdannet til et konstitusjonelt monarki, og i sin nåværende form begynner statsministerrekken 22. mars 1848, da Adam Wilhelm Moltke ble utnevnt til premierminister. I 1855 ble embedstittelen endret til konseilspresident, og siden 1918 har den vært statsminister.\\nDen danske monarken er i henhold til grunnloven landets statsoverhode, mens statsministeren er regjeringssjef. Under enevoldstiden var det 17 regjeringssjefer. I sin nåværende form under et konstitusjonelt monarki, har Danmark hatt 41 regjeringssjefer, hvorav 9 har regjert i to adskilte perioder. 15 av dem har vært leder av to eller flere regjeringer.\\nDanmarks nåværende statsminister er Mette Frederiksen fra Socialdemokratiet. Hun ble statsminister 27. juni 2019."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%BCro_Fellner_%26_Helmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Mesto_Brno_-_Mahenovo_divadlo.jpg","page_title":"Büro Fellner & Helmer","context_page_description":"Das Architektur-Büro Fellner & Helmer in Wien wurde 1873 von den Architekten Ferdinand Fellner d. J. und Hermann Helmer gegründet und bis 1919 betrieben."},{"page_url":"https://de.wikipedia.org/wiki/Chicor%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Chicor%C3%A9e_Fabrik_in_Gelsdorf_06.jpg","page_title":"Chicorée","context_page_description":"Chicorée gehören zur Varietät Cichorium intybus var. foliosum der Art Gemeine Wegwarte. Sie gehören zur Familie der Korbblütler. Chicorée bildet eine Rübe und eine dem Boden aufliegende Blattrosette."},{"page_url":"https://zh.wikipedia.org/wiki/2017%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B6%E9%A2%A8%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Adrian_2017-05-09_1912Z.jpg","page_title":"2017年太平洋颶風季","context_page_description":"2017年太平洋颶風季是每年一度全球熱帶氣旋產生週期的一部分。東太平洋颶風季從2017年6月開始；而中太平洋颶風季從2017年1月開始。本條目的範圍僅侷限於赤道以北及國際換日線以東的太平洋，於赤道以北及國際換日線以西的太平洋水域產生的風暴則被稱為颱風，並被列入2017年太平洋颱風季。在東、中太平洋產生的熱帶風暴分別是由美國國家颶風中心及中太平洋颶風中心命名，國際編號分別為xxE或xxC。\\n2017年太平洋颶風季第一個氣旋生成於2017年5月9日的熱帶風暴阿德里安。以下各熱帶氣旋資訊以熱帶氣旋存在期間的最強形態為準。"},{"page_url":"https://en.wikipedia.org/wiki/Goodwin_House_(Ottawa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Goodwin_House2.JPG","page_title":"Goodwin House (Ottawa)","context_page_description":"Goodwin House is a prominent heritage building in Ottawa, Ontario, Canada. Located at 312 Laurier Avenue East it was built by railway executive George Goodwin from 1899 to 1900. It is one of the largest mansions ever built in the city. It later became a convent for the Grey Nuns, and during the Second World War was used as the headquarters of the Canadian Women's Army Corps. In 1978 it was bought and restored by St. John Ambulance, which used it as its national headquarters. Recently it was sold to Amnesty International which today uses it as its Canadian headquarters."},{"page_url":"https://de.wikipedia.org/wiki/Loussous-D%C3%A9bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Loussous_d%C3%A9bat_-_MM.JPG","page_title":"Loussous-Débat","context_page_description":"Loussous-Débat ist eine französische Gemeinde mit 62 Einwohnern im Département Gers in der Region Okzitanien; sie gehört zum Arrondissement Mirande."},{"page_url":"https://en.wikipedia.org/wiki/Pinene","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/%281S%29-%28-%29-beta-pinene-2D-projected-skeletal.png","page_title":"Pinene","context_page_description":"Pinene is a bicyclic monoterpene chemical compound. There are two structural isomers of pinene found in nature: α-pinene and β-pinene. As the name suggests, both forms are important constituents of pine resin; they are also found in the resins of many other conifers, as well as in non-coniferous plants such as camphorweed and big sagebrush. Both isomers are used by many insects in their chemical communication system. The two isomers of pinene constitute the major component of turpentine."},{"page_url":"https://hu.wikipedia.org/wiki/Alekszandra_Pavlovna_s%C3%ADrk%C3%A1poln%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/%C3%9Cr%C3%B6m_Alexandra_Pavlovna_s%C3%ADrk%C3%A1polna_altemplom.jpg","page_title":"Alekszandra Pavlovna sírkápolnája","context_page_description":"Alekszandra Pavlovna sírkápolnája József nádor fiatalon elhunyt feleségének, I. Pál orosz cár lányának nyughelyeként épült, a nagyhercegnő 1801-es halálát követően Pest megyében, Üröm község központja közelében; ma a település egyik legfontosabb látnivalója és műemléke."},{"page_url":"https://fr.wikipedia.org/wiki/Arvillers","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Arvillers_%28Somme%29_France_%2811%29.JPG","page_title":"Arvillers","context_page_description":"Arvillers est une commune française située dans le département de la Somme en région Hauts-de-France."},{"page_url":"https://ca.wikipedia.org/wiki/Subprefectura_de_Hachij%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Tokyo_metropolitan_government_Hachijo_Island_Branch_Office.jpg","page_title":"Subprefectura de Hachijō","context_page_description":"La Subprefectura de Hachijō és una subprefectura de Tòquio, a la regió de Kanto, Japó. La subprefectura és responsabilitat del Departament d'Afers Generals del Govern Metropolità de Tòquio. La subprefectura abarca una sèrie d'illes habitades i de rocs a l'arxipielag d'Izu."},{"page_url":"https://sl.wikipedia.org/wiki/Cerkev_sv._Janeza_Krstnika,_Steingadnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Steingaden_Kirche_3.jpg","page_title":"Cerkev sv. Janeza Krstnika, Steingadnen","context_page_description":"Nekdanja premonstratenska samostanska cerkev sv. Janeza Krstnika je bila uporabljena od sekularizacije samostana Steingaden kot katoliška župnijska cerkev Steingadna v okrožju Weilheim-Schongau v Zgornji Bavarski. Romanska bazilika, Welfenmünster, je bila barokizirana v 17. in 18. stoletju in danes velja za enega najpomembnejših spomenikov Pfaffenwinkla."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%86%D8%A7%D8%B5%D9%88%D8%B1%D8%A7%D8%AA_%D9%85%D8%AF%D8%B1%D8%B9%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Scelidosaurus_harrisonii.png","page_title":"ديناصورات مدرعة","context_page_description":"الديناصورات المدرعة أو حاملات الدروع هي مجموعة من الديناصورات المدرعة طيرية الورك التي تعود إلى العصر الجوراسي وحتى نهاية العصر الطباشيري. تتميز الديناصورات المدرعة بوجود دروع الجسم التي تصطف في صفوف طولية على طول الجسم. كان للأشكال البدائية بقع بسيطة أو منخفضة أو عظمية، في حين أن الأشكال المشتقة أكثر طورت هياكل أكثر تفصيلا بما في ذلك المسامير واللوحات. كانت معظم الديناصورات المدرعة عاشبة وكانت تتميز بحجم دماغ صغير نسبة لحجم الجسم. تشمل الديناصورات المدرعة مجموعات فرعية مختلفة بما في ذلك الأنكيلوصوريات والستيغوصوريات. في حالة الرتيبتين هاتين كانت مقدم القدمين أقصر بكثير من القوائم الخلفية وخاصة في الستيغوصور. تم تعريف هذه الأصنوفة على أنها المجموعة التي تتكون من جميع الأنواع التي ترتبط ارتباطًا وثيقًا بالأنكيلوصور مقارنة بالديناصور ثُلاثيُّ القُرون. الديناصورات المدرعة هي المجموعة الشقيقة لطيريات الورك الحديثة داخل العظائيات الوجنية."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_fortificat%C4%83_din_Brateiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Color%2C_Biserica_fortificata_din_Brateiu.jpg","page_title":"Biserica fortificată din Brateiu","context_page_description":"Biserica evanghelică fortificată din Brateiu, județul Sibiu, a fost construită în secolul XIV. Figurează pe lista monumentelor istorice 2010, cod LMI SB-II-a-A-12339, cu următoarele obiective:\\ncod LMI SB-II-a-A-12339.01 - Biserica evanghelică fortificată, secolul XIV - XVI, transformată în secolul al XVIII-lea, 1845 - 18469;\\ncod LMI SB-II-a-A-12339.02 - Incintă fortificată, cu turn de poartă și bastion, cca. 1500;"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A2%85%E5%9F%BA%C2%B7%E5%8D%A1%E5%B8%83%E7%91%9E%E6%8B%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Melky_Cabrera_on_the_basepaths_in_May_2008.jpg","page_title":"梅基·卡布瑞拉","context_page_description":"梅基·卡布瑞拉為多明尼加的棒球選手之一，目前效力於匹茲堡海盜隊。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_members_of_the_19th_Bundestag","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Andrew_Ullmann.jpg","page_title":"List of members of the 19th Bundestag","context_page_description":"This is a list of members of the 19th and current Bundestag, the parliament of Germany. The session started on 24 October 2017 with members determined in the 2017 federal election. The legislative period is four years; the Next German federal election is expected to be held between August and October 2021."},{"page_url":"https://it.wikipedia.org/wiki/Campagna_di_Germania_(1805)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Mortier%2C_Edouard.jpg","page_title":"Campagna di Germania (1805)","context_page_description":"La campagna di Germania del 1805 fu una delle principali campagne militari condotte da Napoleone nel corso della guerra della terza coalizione."},{"page_url":"https://ceb.m.wikipedia.org/wiki/Pavanden%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Sprudeskalnas1.JPG","page_title":"Pavandenė","context_page_description":"Lungsod ang Pavandenė sa Lyetuwanya. Nahimutang ni sa kasadpang bahin sa nasod, 210 km sa amihanan-kasadpan sa Vilnius ang ulohan sa nasod. 174 metros ibabaw sa dagat kahaboga ang nahimutangan sa Pavandenė, ug adunay 323 ka molupyo.\\nAng yuta palibot sa Pavandenė kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 211 ka metro ug 2.0 km sa amihanan sa Pavandenė. Dunay mga 24 ka tawo kada kilometro kwadrado sa palibot sa Pavandenė medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Varniai, 8.0 km sa kasadpan sa Pavandenė. Hapit nalukop sa kaumahan ang palibot sa Pavandenė. Sa rehiyon palibot sa Pavandenė, mga lanaw, ug mga lasang talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Disyembre, sa -8 °C."},{"page_url":"https://es.wikipedia.org/wiki/Cant%C3%B3n_de_Saint-Calais","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Sarthe_-_Canton_Saint-Calais_2015.svg","page_title":"Cantón de Saint-Calais","context_page_description":"El cantón de Saint-Calais es una división administrativa francesa, situada en el departamento de Sarthe y la región de Pays de la Loire.\\nEste cantón se organiza alrededor de la población de Saint-Calais en el distrito de Mamers. Dispone de una altitud media de 123 metros siendo de 64 metros en Bessé-sur-Braye que es la parte más baja y de 182 metros en Montaillé."},{"page_url":"https://cs.wikipedia.org/wiki/N%C3%A1rodn%C3%AD_parky_v_Nizozemsku","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/NP-OosterscheldeKaart.jpg","page_title":"Národní parky v Nizozemsku","context_page_description":"Následující přehled zahrnuje národní parky v Nizozemském království. Je rozdělen na dvě části - evropské Nizozemsko a Nizozemské Antily. Parky v evropské části Nizozemska zabírají přibližně 3 % rozlohy státu a spravuje je státní organizace Samenwerkingsverband Nationale Parken. Chráněná území v Karibiku spravují různé nevládní neziskové organizace."},{"page_url":"https://de.wikipedia.org/wiki/St%C3%A4dtisches_Lapidarium_Stuttgart","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/St%C3%A4dtisches_Lapidarium_Stuttgart%2C_Nr._A175.jpg","page_title":"Städtisches Lapidarium Stuttgart","context_page_description":"Das Städtische Lapidarium Stuttgart ist ein Freilichtmuseum im Park der ehemaligen Villa Ostertag-Siegle in Stuttgart. In dem Lapidarium sind über 200 meist steinerne Zeugnisse aus fünf Jahrhunderten Stuttgarter Stadtgeschichte ausgestellt, außerdem die römische Antikensammlung von Carl von Ostertag-Siegle.\\nAußer dem Städtischen Lapidarium gibt es in Stuttgart noch das Römische Lapidarium des Landesmuseums Württemberg im Neuen Schloss, dessen Fundus aus römischen Steindenkmälern aus Südwestdeutschland besteht."},{"page_url":"https://pl.wikipedia.org/wiki/Lublin_(KL)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Majdanek_mauzoleum.jpg","page_title":"Lublin (KL)","context_page_description":"Konzentrationslager Lublin, Vernichtungslager Lublin, Kriegsgefangenenlager Maydanek, KL Majdanek – niemiecki nazistowski obóz koncentracyjny i jeniecki w Lublinie, funkcjonujący w latach 1941-1944.\\nNazwa właściwa obozu brzmiała KL Lublin i tak obóz był nazywany oficjalnie od 1943 roku. Potoczna nazwa „Majdanek” pochodzi od dzielnicy Lublina i powstała pośród mieszkańców GG. Nazwy „Majdanek” używali jednak niekiedy w oficjalnych dokumentach również i sami Niemcy.\\nW 1947 utworzono Państwowe Muzeum na Majdanku, w 1969 odsłonięto pomnik Walki i Męczeństwa na Majdanku."},{"page_url":"https://en.wikipedia.org/wiki/N%C3%A9psz%C3%ADnh%C3%A1z_Street_37","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/N%C3%A9psz%C3%ADnh%C3%A1z_utca_37_%E2%80%93_Erk%C3%A9ly_2017.jpg","page_title":"Népszínház Street 37","context_page_description":"The residential building of number 37, Népszínház street, is located in the 8th district of Budapest, Hungary, on the odd side of the street between Nagyfuvaros and Kisfuvaros street."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%89%E0%B2%B7%E0%B3%8D%E0%B2%A3%E0%B2%A4%E0%B3%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Heat_to_work.png","page_title":"ಉಷ್ಣತೆ","context_page_description":"ಉಷ್ಣದ ಸ್ವರೂಪ\\nಉಷ್ಣತೆ ನೀವು ಬೆಳಗಿನಿಂದ ಸಂಜೆಯವರೆಗೆ ಹವಾಮಾನದಲ್ಲಿ ಆಗುವ ಬದಲಾವಣೆಗಳ ಅನುಭವವನ್ನು ಪಡೆದಿರುವೀರಾ? ಯಾವಾಗ ತಂಪಿನ ಅನುಭವ ಮತ್ತು ಯಾವಾಗ ಬೆಚ್ಚಗಿನ ಅನುಭವ ವಾಗುವುದು? ಇದು ಏಕೆ ಆಗುತ್ತದೆ? ಬೆಳಗ್ಗೆ ಮತ್ತು ಸಂಜೆ ವೇಳೆಯಲ್ಲಿ ತಂಪಾದ ಅನುಭವವನ್ನು ಮತ್ತು ಮಧ್ಯಾಹ್ನದ ವೇಳೆಯಲ್ಲಿ ಬೆಚ್ಚಗಿನ ಅನುಭವವನ್ನು ಪಡೆಯುತ್ತೇವೆ. ಇದಕ್ಕೆ ಕಾರಣ ನಾವು ಪಡೆಯುವ ಸೂರ್ಯನ ವಿಕಿರಣಗಳಲ್ಲಿನ ವ್ಯತ್ಯಾಸ. ಉಷ್ಣತೆ \\"ಕಾವು\\" ಅಥವಾ \\"ಬಿಸಿ\\" ಅಥವಾ \\"ಉಷ್ಣ\\" ಒಂದು ಶಕ್ತಿರೂಪವಾಗಿದೆ. ಭೌತಶಾಸ್ತ್ರ ಥೆರ್ಮೋಡೈನಾಮಿಕ್ಸ್ ನಲ್ಲಿ ಇದನ್ನು ಶಕ್ತಿಯನ್ನು ಒಂದು ವಸ್ತು ಅಥವಾ ವ್ಯವಸ್ಥೆಯಿಂದ ಬೇರೆಡೆಗೆ ಪ್ರಸಾರಿಸುವ ಕ್ರಿಯೆಯೆಂದು ಅರ್ಥೈಸಲಾಗುತ್ತದೆ. ಒಂದು ವ್ಯವಸ್ಥೆಯಲ್ಲಿನ ಅಸಂಖ್ಯಾತ ಅಣುಗಳ ಚಲನೆಯ ಸಮಗ್ರ ಪರಿಣಾಮವಾಗಿ ಪ್ರಕಟವಾಗುವ ಶಕ್ತಿಯ ಒಂದು ರೂಪ. ಉಷ್ಣತಾವ್ಯತ್ಯಸವಿರುವ ಎರಡು ವ್ಯವಸ್ಥೆಗಳಲ್ಲಿ ಒಂದರಿಂದ ಇನ್ನೊಂದಕ್ಕೆ ವರ್ಗವಾಗುವ ಶಕ್ತಿಯೇ ಉಷ್ಣ. ಈ ವರ್ಗಾವಣೆ ಅಧಿಕ ಉಷ್ಣತೆಯ ಉಗಮದಿಂದ ಕಡಿಮೆ ಉಷ್ಣತೆಯ ಗ್ರಾಹಕದೆಡೆಗೆ ನಡೆಯುವುದು. ಉಷ್ಣಶಕ್ತಿಯ ಈ ಚಲನೆಗೆ ಉಷ್ಣವಹನವೆಂದು ಹೆಸರು. ಉಷ್ಣತೆಯಿಂದ ಶಕ್ತಿ ಪ್ರಸರಣವು ಔಷ್ಣ ಸಂಪರ್ಕದಿಂದಾಗುತ್ತದೆ. ಔಷ್ಣ ಸಂಪರ್ಕವೆಂದರೆ ವಸ್ತುವಿನ ಮೇಲೆ ಯಾವುದೇ ರೀತಿಯ ಬಲ ಪ್ರಯೋಗಿಸದೇ ಅದರಲ್ಲಿ ಶಕ್ತಿಯನ್ನು ರವಾನಿಸುವುದು ಅಥವಾ ಪ್ರಸರಿಸುವುದು.\\nಅತ್ಯಂತ ಸಣ್ಣ ಪ್ರಮಾಣದ ಉಷ್ಣತೆ δQ ಯನ್ನು ತನ್ನ ಕನಿಷ್ಟ ತಾಪಮಾನ T, ಮತ್ತು ಔಷ್ಣೀಯ ಸ್ತಿತಿಸ್ಥಾಪಕತ್ವ ದಲ್ಲಿರುವ ವಸ್ತುವಿಗೆ ರವಾನಿಸಿದರೆ, ಅ ಉಷ್ಣತೆಯ ಪ್ರಮಾಣವು TdS ಎಂದು ಪರಿಗಣಿಸಲ್ಪಡುತ್ತದೆ. ಇಲ್ಲಿ S ವಸ್ತುವಿನ \\"ಎಂಟ್ರೋಪಿ\\""},{"page_url":"https://de.wikipedia.org/wiki/Anderson_County_(Tennessee)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Oliver-springs-banking-company-tn1.jpg","page_title":"Anderson County (Tennessee)","context_page_description":"Das Anderson County ist ein County im US-Bundesstaat Tennessee. Bei der Volkszählung im Jahr 2010 hatte das County 75.129 Einwohner und eine Bevölkerungsdichte von 86 Einwohnern pro Quadratkilometer. Der Verwaltungssitz ist Clinton, das nach George Clinton, dem früheren Gouverneur von New York und zweiten Vizepräsidenten der Vereinigten Staaten, benannt wurde.\\nDas County ist Bestandteil der Knoxville Metropolitan Statistical Area, der Metropolregion um die Stadt Knoxville."},{"page_url":"https://ast.wikipedia.org/wiki/Guerra_civil_siria","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/SDF_at_Jabar_Castle_3.png","page_title":"Guerra civil siria","context_page_description":"Plantía:Llargu\\nLa guerra civil siria ye un conflictu bélicu empecipiáu a principios de 2011 y que se desenvuelve na actualidá en Siria. Nel so entamu les Fuercies Armaes de Siria enfrentar contra grupos armaos rebalbos, conocíos n'Occidente como la oposición siria. Más palantre, numberosos grupos y combatientes rebalbos xunir al Estáu Islámicu d'Iraq y el Llevante — Estáu Islámicu n'español; ISIS n'inglés, Daesh, lo que-y dexó invadir vastes estensiones de Siria dende Iraq. Pa 2017, el Gobiernu siriu entamó una gran campaña contra Daesh recuperando los territorios al oeste del Éufrates, el 6 d'avientu tantu autoridaes siries como ruses, proclamaron el final de la operación contra Estáu Islámicu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%83%D0%B3%D1%80%D0%BE%D0%B6%D0%B0%D0%B5%D0%BC%D1%8B%D1%85_%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2_%D0%B3%D0%BE%D0%BB%D0%BE%D1%81%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D1%8B%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Podocarpus_henkelii.jpg","page_title":"Список угрожаемых видов голосеменных","context_page_description":"Список угрожаемых видов голосеменных содержит перечень видов семенных растений из отделов хвойных, саговниковидных, гинкговидных и гнетовидных, традиционно объединяемых в группу голосеменных, которым Международным союзом охраны природы и природных ресурсов присвоены охранные статусы «Уязвимый вид», «Вымирающий вид» либо «Вид на грани исчезновения». В настоящее время в Красный список угрожаемых видов МСОП занесено 400 редких и исчезающих видов голосеменных растений, из них 156 видов — уязвимые, 163 вида — вымирающие и 81 вид — находящиеся на грани исчезновения. Ещё 4 вида саговниковых из рода энцефаляртосов значатся в данном списке как исчезнувшие в дикой природе. Они также представлены в этом перечне. Всего известно 1104 вида современных голосеменных. Таким образом, каждый третий вид этих растений находится в опасности, а почти 8 % — на грани полного исчезновения."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E5%BB%BA%E7%AF%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/13-08-09-hongkong-by-RalfR-093.jpg","page_title":"香港建築","context_page_description":"香港建築是變化多端的。由於土地有限，很少市區內的歷史建築能夠保存下來。可是，作為現代建築的中心，很多古老的建築物都被拆卸讓出空間給新的建築物。香港建築的歷史可以粗略分成三個時期，中國傳統建築時期、歐美建築時期及現代建築時期。"},{"page_url":"https://en.wikipedia.org/wiki/The_Little_Outfit_Schoolhouse","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/LO_Sch_Hou_Dean_19_2x2_300ppi.jpg","page_title":"The Little Outfit Schoolhouse","context_page_description":"The Little Outfit Schoolhouse is a ranch school that was built in 1940 in southeastern Arizona. It is located on the Little Outfit Ranch in San Rafael Valley, about ten miles east-southeast of Patagonia, in Santa Cruz County, which borders Mexico on the south and is about 80 miles from Arizona's eastern border with New Mexico.\\nIn the early and mid-twentieth century ranch schools became an important part of the educational system in many western states and Arizona led the nation in total number. The concept set high academic standards but also put strong emphasis on the ideals of the American Old West, rugged outdoor activities, and independence of spirit. The Little Outfit Ranch School provides an excellent example this approach to education and in 2009 the schoolhouse itself was placed on the National Register of Historic Places. The schoolhouse is managed by the Little Outfit Preservation Group, Inc."},{"page_url":"https://id.wikipedia.org/wiki/Ayam_hutan_sailan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Gallus_lafayetii.jpg","page_title":"Ayam hutan sailan","context_page_description":"Ayam hutan sailan adalah sejenis ayam hutan anggota dari ordo burung Galliformes yang endemik dari wilayah Sri Lanka, dimana hewan ini dijadikan burung nasional. Ayam ini berkerabat dengan ayam hutan merah, leluhur dari ayam ternak di dunia. Nama binomial dari ayam ini diambil dari bangsawan Prancis Lafayette. Dalam Bahasa Sinhala, ayam ini dikenal dengan nama Wali kukula sedangkan dalam Bahasa Tamil dikenal dengan nama Ilaṅkaik kāṭṭukkōḻi."},{"page_url":"https://sh.wikipedia.org/wiki/Twistringen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/25104200018_Twistringen_Grundschule.jpg","page_title":"Twistringen","context_page_description":"Tvistringen je grad u njemačkoj saveznoj državi Donja Saksonija. Jedno je od 47 opštinskih središta okruga Dipholc. Prema procjeni iz 2010. u gradu je živjelo 12.417 stanovnika. Posjeduje regionalnu šifru 3251042."},{"page_url":"https://fr.wikipedia.org/wiki/Pr%C3%A9sident_de_l%27Assembl%C3%A9e_des_repr%C3%A9sentants_du_peuple","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Fouad_Mebazaa_15_jan_2011.jpg","page_title":"Président de l'Assemblée des représentants du peuple","context_page_description":"Le président de l'Assemblée des représentants du peuple est le président du Parlement monocaméral tunisien.\\nLe président est élu parmi les membres de l'Assemblée à la première réunion qui suit son renouvellement. L'élection du premier président de l'Assemblée des représentants du peuple a lieu le 4 décembre 2014 : il s'agit de Mohamed Ennaceur du parti Nidaa Tounes.\\nAvant l'adoption de la Constitution de 2014, la Tunisie a connu des présidents de l'Assemblée constituante de 1956, de l'Assemblée nationale, de la Chambre des députés, de la Chambre des conseillers puis de l'Assemblée constituante de 2011."},{"page_url":"https://pl.wikipedia.org/wiki/Ruch_2_Czerwca","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Logo_Bewegung_2._Juni.png","page_title":"Ruch 2 Czerwca","context_page_description":"Ruch 2 Czerwca – organizacja terrorystyczna z Niemiec."},{"page_url":"https://de.wikipedia.org/wiki/Houetteville","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Houetteville_-_Chateau.JPG","page_title":"Houetteville","context_page_description":"Houetteville ist eine französische Gemeinde mit 204 Einwohnern im Département Eure in der Region Normandie; sie gehört zum Arrondissement Bernay und zum Kanton Le Neubourg. Die Einwohner nennen sich Houettevillais."},{"page_url":"https://fr.wikipedia.org/wiki/La_Foi_des_hommes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/THE_FAITH_OF_MEN.jpg","page_title":"La Foi des hommes","context_page_description":"La Foi des hommes est un recueil de nouvelles de Jack London paru en 1904."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%BD%D5%A1%D5%AF%D5%A1%D5%B5%D5%AB_%D5%A1%D5%B4%D5%A5%D5%B6%D5%A1%D5%A2%D5%A1%D6%80%D5%B1%D6%80_%D5%B7%D5%A5%D5%B6%D6%84%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Crystal_Tower_Osaka_20060321-001.jpg","page_title":"Օսակայի ամենաբարձր շենքերի ցանկ","context_page_description":"Այս ցանկում բերված են Օսակա քաղաքի 150 մետր ստանդարտ հարթություններում կառուցված շենքեր:"},{"page_url":"https://en.wikipedia.org/wiki/Eimi_Naruse","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Sumire_Uesaka_cropped_3_Sumire_Uesaka_and_Yoshio_Higuchi_20191006.jpg","page_title":"Eimi Naruse","context_page_description":"Eimi Naruse is a Japanese singer and voice actress who is currently a member of Dempagumi.inc.\\nBorn in Kōriyama, she switched from having interests in manga to music as a teenager, and moved to Akihabara where she worked at a maid cafe before joining Dempagumi.inc. In addition to her work with the idol group, she has done some solo activities, including appearing in the TV drama OL desu ga, Kyabajō Hajimemashita and voicing the lead character of Star Twinkle PreCure, Hikaru Hoshina/Cure Star."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%92%D0%BE%D0%B5%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/EGLISE_DE_Wo%C3%ABl_%2855%29.jpg","page_title":"Воель","context_page_description":"Воель — Францин гӀала-коммуна, лаьтта Гранд-Эст регионехь. Коммунан департамент — Мез. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://fr.wikipedia.org/wiki/Sinice_de_Reims","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Sinicius_de_Reims_602.JPG","page_title":"Sinice de Reims","context_page_description":"Sinice de Reims ou Sinice de Soissons, ou plus simplement saint Sinice, est évêque de Soissons au IIIᵉ siècle."},{"page_url":"https://en.wikipedia.org/wiki/Quite_Universal_Circuit_Simulator","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Logo_QUCS.png","page_title":"Quite Universal Circuit Simulator","context_page_description":"Quite Universal Circuit Simulator is a free-software electronics circuit simulator software application released under GPL. It offers the ability to set up a circuit with a graphical user interface and simulate the large-signal, small-signal and noise behaviour of the circuit. Pure digital simulations are also supported using VHDL and/or Verilog.\\nQucs supports a growing list of analog and digital components as well as SPICE sub-circuits. It is intended to be much simpler to use and handle than other circuit simulators like gEDA or PSPICE."},{"page_url":"https://en.wikipedia.org/wiki/Eubazus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Eubazus.sigalphoides9.-.lindsey.jpg","page_title":"Eubazus","context_page_description":"Eubazus is a genus of braconid wasps in the family Braconidae. There are at least 140 described species in Eubazus."},{"page_url":"https://fr.wikipedia.org/wiki/Horatio_Walker","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Horatio_Walker_-_Noce_Canadienne_-_1930.jpg","page_title":"Horatio Walker","context_page_description":"Horatio Walker, est un peintre et photographe canadien."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%BF%E0%AE%B7%E0%AF%8D,_%E0%AE%9A%E0%AF%81%E0%AE%AE%E0%AF%87%E0%AE%B0%E0%AE%BF%E0%AE%AF%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Ruins_of_the_ziggurat_of_the_ancient_city_of_Kish%2C_Tell_al-Uhaymir%2C_Mesopotamia%2C_Iraq.jpg","page_title":"கிஷ், சுமேரியா","context_page_description":"கிஷ் தற்கால ஈராக் நாட்டின் தெற்கு மெசொப்பொத்தேமியாவில் பண்டைய சுமேரியாவின் கிமு 3,100 காலத்திய நகரம் ஆகும். இந்நகரத்தில் தோன்றிய கிஷ் பண்பாடு லெவண்ட் பிரதேசத்தின் எப்லா இராச்சியம் மற்றும் மாரி இராச்சியங்களில் பரவியது. இப்பண்டைய நகரம் தற்போது தொல்லியல் களமாக, பாபிலோனின் கிழக்கில் 80 கிலோ மீட்டர் தொலைவிலும், பாக்தாத் நகரத்திலிருந்து தெற்கில் 80 கிலோ மீட்டர் தொலைவிலும் உள்ளது."},{"page_url":"https://nds.wikipedia.org/wiki/Veltenhoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/BS_Eiche_Veltenhof_ND-B9.JPG","page_title":"Veltenhoff","context_page_description":"Veltenhoff is een Dörp in Neddersassen, siet 1931 en Stadtdeel vun Bronswiek, mit 2.762 Innwohners, waar siet 1750 Pälzer wohnen.\\nAl im Johr 1007 werd en Dörp mit de Naam Theletunnum erwähnt, im Johr 1031 as Velittunum. Dat Dörp was lang verswunnen, as de Pälzer komen sünd, de Naam hett sik man hollen. Im Johr 1750 sünd op Veranlaten vun’n Hertog vun Bronswiek Carl I. twölf pälzsch Familjen in’n Oort trocken. Dor sullen se Wien un Toback anplanten. De Hertog wull sik so dat Inföhren un de Inföhrtoll sporen. Dat weer aver man sturer maakt as docht. Wieldat de Eer dor sannig is, hebbt de Lüü na swore Tieden 1850 de Idee hatt, Spargel to setten. Dat hett jem önnig Erfolg brocht. Butendem hebbt se sik im Huusbo as Steensetter een Naam maakt.\\n1933 is de Middellandkanaal, de de Eems, de Werser un de Elv verbinnt, bit Bronswiek boot worrn. Up de Mark vun Veltenhoff sünd dör’n Kanaal un een Havenbecken een Hümpel Spargelfeller wegfallen. Todem hett de Stadt Bronswiek natürlich een Egenbelang hatt, Veltenhoff mitsamt de tokunftigen Havenrebeed intomenen. So is Veltenhoff 1931 gegen den Will vun de Lüü an Bronswiek komen."},{"page_url":"https://sk.wikipedia.org/wiki/Smetn%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Popelnice.jpg","page_title":"Smetník","context_page_description":"Smetník alebo smetiak je buď všeobecne nádoba na smeti alebo v užšom zmysle len nádoba na odpadky pri budove či na ulici na prechodné uloženie odpadkov pred ich definitívnym odvozom. Zastarané označenie smetníka v užšom zmysle je popolnica, odborné označenie je zberná nádoba a vyskytuje sa aj označenie nádoba na odpad."},{"page_url":"https://de.wikipedia.org/wiki/Dorfkirche_Karbow","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Karbow_Kirche_2008-04-24_068.jpg","page_title":"Dorfkirche Karbow","context_page_description":"Die Dorfkirche in Karbow, einem Ortsteil der Gemeinde Gehlsbach im Landkreis Ludwigslust-Parchim in Mecklenburg-Vorpommern, ist ein Feldsteinbau mit Fachwerkelementen. Sie ist eine der Kirchen der Kirchgemeinde Gnevsdorf-Karbow mit Pfarrsitz in Gnevsdorf in der Propstei Parchim des Kirchenkreises Mecklenburg der Evangelisch-Lutherischen Kirche in Norddeutschland."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BF%D1%96%D1%82%D0%B5%D0%BB%D0%B0%D0%BD%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Epithelantha_micromeris_SB63_%288988713723%29.jpg","page_title":"Епітеланта","context_page_description":"Епітеланта — рід сукулентних рослин з родини кактусових."},{"page_url":"https://sv.wikipedia.org/wiki/Marina_Silva","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/MarinaSilva2010.jpg","page_title":"Marina Silva","context_page_description":"Marina Silva, född 8 februari 1958 i Rio Branco, är en brasiliansk politiker. Mellan år 2003 och 2008 var hon miljöminister i regeringen Lula.\\nSilvas föräldrar var gummitappare och hon har politiskt engagerat sig i sociala rättigheter och miljöfrågor, särskilt mot den illegala skogsavverkningen i Amazonas. Som ung kämpade hon mot skövlingen av regnskog tillsammans med miljöaktivister som Chico Mendes. 1994 blev hon invald i senaten och 2003 blev hon miljöminister. 2008 avgick hon från den posten och återgick till senaten. Hon var medlem i partiet Partido dos Trabalhadores från 1986 till 19 augusti 2009, då hon övergick till det gröna partiet Partido Verde. Silva lämnade PV år 2011 och blev 2013 istället medlem i Socialistpartiet. I april 2014 blev hon utsedd till vicepresidentkandidat av Socialistpartiets presidentkandidat Eduardo Campos, men när Campos avled i en flygolycka 13 augusti samma år fick Silva själv ersätta honom som partiets presidentkandidat.\\n1996 tilldelades hon Goldman Enviromental Prize, tillsammans med Cristina Narbona Ruiz, 2007 ”Champion of the Earth\\" och 2009 mottog hon Sofie-priset.\\nSilva är medlem i den brasiliansk pingstkyrkan Assembleias de Deus."},{"page_url":"https://fr.wikipedia.org/wiki/Youngstown_(Alberta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Youngstown_AB_sign.JPG","page_title":"Youngstown (Alberta)","context_page_description":"Youngstown est un village de l'Aire spéciale Nᵒ 3, situé dans la province canadienne d'Alberta."},{"page_url":"https://nl.wikipedia.org/wiki/Doug_Ducey","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/DougDucey.jpg","page_title":"Doug Ducey","context_page_description":"Douglas Anthony Ducey is een Amerikaans politicus van de Republikeinse Partij. Sinds 2015 is hij de gouverneur van de Amerikaanse staat Arizona."},{"page_url":"https://de.wikipedia.org/wiki/HMS_Zulu_(F18)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/HMS_Zulu_FL21966.jpg","page_title":"HMS Zulu (F18)","context_page_description":"HMS Zulu war ein Zerstörer der Tribal-Klasse der britischen Royal Navy. Sie gehörte zu den ersten sieben am 10. März 1936 bestellten Schiffen und kam anfangs bei der Mittelmeerflotte zum Einsatz.\\nNach Kriegsbeginn wurde das Schiff mit der 4. Zerstörerflottille zur Home Fleet befohlen und war von April bis Juni 1940 mit den Schwesterschiffen zur Abwehr des deutschen Angriffs auf Norwegen im Einsatz. Im September 1941 kehrte das Schiff ins Mittelmeer zurück.\\nNach einem missglückten Angriff auf Tobruk sank die durch Luftangriffe schwerbeschädigte Zulu im Schlepp eines Geleitzerstörers am 14. September 1942. Am Morgen hatte sie noch versucht, ihr durch eine Küstenbatterie außer Gefecht gesetztes Schwesterschiff Sikh aus der Gefahrenzone zu schleppen, das dabei sank. Danach musste die Zulu noch den durch einen Luftangriff schwer getroffenen Flugabwehrkreuzer Coventry nach der Bergung der Mannschaft mit einem Torpedo versenken, ehe sie selbst als drittes Schiff neben sechs MTB´s Opfer dieser Operation wurde. Bis auf 36 Mann konnte die Besatzung der Zulu geborgen werden."},{"page_url":"https://es.wikipedia.org/wiki/Parque_de_la_Ciudadela","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Ciutadella_-_Havel.jpg","page_title":"Parque de la Ciudadela","context_page_description":"El parque de la Ciudadela se encuentra en el distrito de Ciutat Vella, en Barcelona. Durante muchos años fue el único parque público de la Ciudad Condal. Fue trazado en los antiguos terrenos de la fortaleza de la Ciudadela —de ahí su nombre—, a imagen y semejanza del jardín de Luxemburgo de París. Fue diseñado por José Fontseré e inaugurado en 1881. Pocos años después, en 1888, acogió a la Exposición Universal de Barcelona.\\nEstá situado en el barrio de la Ribera, en el triángulo comprendido entre la estación de Francia, el Arco de Triunfo y la Villa Olímpica. Está delimitado por cuatro vías principales: el paseo de Pujades, el paseo de Picasso, el paseo de Circunvalación y la calle de Wellington. Dispone de diez accesos y tiene una extensión de 17,42 hectáreas. Es el parque urbano más grande de Barcelona después del de Montjuic.​\\nEn el parque se encuentra el antiguo Arsenal de la Ciudadela, actual sede del Parlamento de Cataluña, además de diversos edificios: dos antiguos museos que forman parte del Museo de Ciencias Naturales de Barcelona, una iglesia y un colegio, además del Umbráculo y el Invernáculo, dedicados a la conservación de especies botánicas."},{"page_url":"https://it.wikipedia.org/wiki/Concertazione_dei_Partiti_per_la_Democrazia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Ricardo_Lagos_despedida_%28cropped%29.jpg","page_title":"Concertazione dei Partiti per la Democrazia","context_page_description":"La Concertación de Partidos por la Democracia più conosciuta come Concertación, è stata una coalizione di partiti di centro e di sinistra che ha governato il Cile dall'11 marzo 1990 e concluso il suo governo il 11 marzo 2010.\\nFu all'opposizione del governo militare di Augusto Pinochet che sconfisse attraverso il Plebiscito nazionale cileno del 1988. Nacque come Concertación de Partidos por el No in merito all'opzione presente sulla scheda referendaria. La coalizione terminerà la sua lunga esperienza governativa l'11 marzo 2010 esattamente dopo 20 anni dal ritorno alla democrazia dopo la sconfitta alle elezioni presidenziali del 2009 con il 48,5% dei voti conseguiti dall'ex presidente Eduardo Frei Ruiz-Tagle contro il 51,5% del candidato della Coalizione per il Cambiamento Sebastián Piñera.\\nIl suo simbolo è l'arcobaleno che rappresenta le varie ideologie presenti nella coalizione che generalmente comprende socialdemocratici e democristiani. I partiti fondatori della coalizione sono il Partito Democratico Cristiano del Cile, Partito per la Democrazia, Partito Socialista del Cile e Partito Radicale Social Democratico."},{"page_url":"https://pl.wikipedia.org/wiki/Kapela_janczarska","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Mehter_zurna.jpg","page_title":"Kapela janczarska","context_page_description":"Kapela janczarska – rodzaj orkiestry wojskowej w dawnej Rzeczypospolitej. Pod wpływem kontaktów i wojen z Turcją, w XVII wieku pojawiły się kapele wojskowe, popularne od czasów Jana III Sobieskiego, królowie polscy utrzymywali zespół muzyków grających na instrumentach tureckich. W skład kapeli janczarskiej wchodziły instrumenty melodyczne podwójnostroikowe: surmy, szałamaje i małe flety, oraz rozbudowana grupa instrumentów perkusyjnych złożona z kotłów, talerzy i bębnów podłużnych."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%94%B0%E7%95%91%E6%94%BF%E6%B2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Tabata_Masaji_1929.jpg","page_title":"田畑政治","context_page_description":"田畑 政治は、日本の教育家、新聞記者、水泳指導者。静岡県浜名郡浜松町成子出身。\\n長きに渡り日本水泳連盟会長を務めた他、1964年東京オリンピックの招致活動におけるキーマンの一人として知られている。"},{"page_url":"https://de.wikipedia.org/wiki/Arthur_Sifton","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Arthur_Sifton2.jpg","page_title":"Arthur Sifton","context_page_description":"Arthur Lewis Watkins Sifton, PC, KC war ein kanadischer Politiker und Richter. Vom 26. Mai 1910 bis zum 30. Oktober 1917 war er Premierminister der Provinz Alberta und Vorsitzender der Alberta Liberal Party. Anschließend stand er verschiedenen Ministerien auf Bundesebene vor. Von Dezember 1919 bis zu seinem Tod war er Außenminister Kanadas."},{"page_url":"https://it.wikipedia.org/wiki/Raduno_di_Norimberga","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Bundesarchiv_Bild_183-1982-1130-502%2C_N%C3%BCrnberg%2C_Reichsparteitag%2C_Lichtdom.jpg","page_title":"Raduno di Norimberga","context_page_description":"Il termine Raduno di Norimberga si riferisce ai congressi tenuti dal Partito nazista in Germania dal 1923 al 1938. Dopo l'ascesa al potere di Adolf Hitler nel 1933 fu definitivamente stabilito di tenere i raduni a Norimberga con cadenza annuale e di trasformarli in imponenti manifestazioni propagandistiche circondate da imponenti elementi scenografici progettati dall'architetto Albert Speer in un'apposita area della città."},{"page_url":"https://hu.wikipedia.org/wiki/2018-as_magyar_f%C3%A9rfi_v%C3%ADzilabdakupa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Rosso_e_Bianco_diagonale.png","page_title":"2018-as magyar férfi vízilabdakupa","context_page_description":"A 2018-as magyar férfi vízilabdakupa a magyar vízilabda-bajnokság után a második legrangosabb hazai versenysorozat. A Magyar Vízilabda-szövetség írta ki és 17 csapat részvételével bonyolította le. A mérkőzéssorozat győztese a LEN-Európa-kupában indulhat. A kupát a Ferencvárosnyerte, története során 18. alkalommal."},{"page_url":"https://id.wikipedia.org/wiki/Air_terjun_Shivanasamudra","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/ShivanasamudraFalls_7660.JPG","page_title":"Air terjun Shivanasamudra","context_page_description":"Shivanasamudra adalah sebuah kota kecil di Distrik Chamarajanagar di negara bagian Karnataka, India. Kota kecil ini berada di tepi Sungai Kaveri, yang menjadi perbatasan dengan Distrik Mandya. Air Terjun Shivanasamudra adalah lokasi salah satu pembangkit listrik tenaga air pertama di Asia, yang mulai dibangun pada tahun 1902. Proyeknya didesain oleh Diwan Sheshadri Iyer."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A8%D7%91_%D7%A4%D7%95%D7%A8%D7%98_%D7%A1%D7%90%D7%9E%D7%98%D7%A8_%D7%94%D7%A9%D7%A0%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/FortSumter1865_retouched.jpg","page_title":"קרב פורט סאמטר השני","context_page_description":"קרב פורט סאמטר השני היה קרב אשר נערך ב-7 בספטמבר 1863 - 8 בספטמבר 1863 במפרץ צ'ארלסטון אשר בקרוליינה הדרומית במהלך מלחמת האזרחים האמריקנית. קרב זה היה ניסיון כושל של כוחות צבא האיחוד בפיקודו של מייג'ור גנרל קווינסי גילמור להשתלט מחדש על פורט סאמטר אשר שוכן בפתחו של המפרץ.\\nהקרב נערך לאחר סיומו של קרב מפרץ צ'ארלסטון השני בו הופגז פורט סמאטר קשות, אולם חיל המצב, אשר כלל חיילי ארטילריה הוחלף על ידי הגנרל פ.ג.ט. בורגארד בכוח של 320 רגלים שכן בורגארד חשד בניסיון פלישה אמפיבי.\\nהקרב הסתיים בניצחון הקונפדרציה ודגלה המשיך להתנופף מעל חומות המצודה ההרוסה."},{"page_url":"https://ht.wikipedia.org/wiki/Colrain,_Massachusetts","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Colrain-Green_River.JPG","page_title":"Colrain, Massachusetts","context_page_description":"Colrain, Massachusetts se yon vil Etazini. Li sitye nan leta Massachusetts.\\nChèf-lye li se York."},{"page_url":"https://nl.wikipedia.org/wiki/Schellerberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Schellerberg.jpg","page_title":"Schellerberg","context_page_description":"Schellerberg is een landgoed met landhuis bij de Nederlandse stad Zwolle. Het is gelegen op een oude rivierduin aan de Schellerbergerweg. Het wordt voor het eerst genoemd in een akte in 1379. Eeuwenlang was het erve op het goed bij de landeigenaar in gebruik als spieker, pas na ongeveer 1740 is er sprake van een buitenplaats. Het tegenwoordige pand dateert van 1876 en is een rijksmonument."},{"page_url":"https://en.wikipedia.org/wiki/List_of_active_Republic_of_Korea_Navy_ships","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/2011.11.22_%ED%95%B4%EA%B5%B0_2011_%EC%88%9C%ED%95%AD%ED%9B%88%EB%A0%A8%EC%A0%84%EB%8B%A8_%287633935838%29.jpg","page_title":"List of active Republic of Korea Navy ships","context_page_description":"The Republic of Korea Navy has about 150 ships in commission.\\nThere are four ship ratings. A first-rate ship is commanded by a captain; a second-rate ship by a commander; a third-rate ship by a lieutenant commander; and a fourth-rate ship is commanded by a lieutenant or a warrant officer.\\nThe ROK Navy employs the U.S. Navy-style letter based hull classification symbols to designate the types of its ships and hull numbers to uniquely identify its vessels. The names are that of the historical figures, provinces, cities, counties, peaks, lakes, islands, and birds. The Chief of Naval Operations selects the names of ships.\\nThe ship prefix for all the commissioned ROK Navy ship is ROKS when the names of ships are written in English."},{"page_url":"https://uk.wikipedia.org/wiki/Kawasaki_Ki-61","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Kawasaki_Ki-61_China.jpg","page_title":"Kawasaki Ki-61","context_page_description":"Ki-61 Hien — одномісний армійський одномоторний винищувач суцільнометалевої конструкції Імперської армії Японії періоду Другої світової війни. Вирізнявся серед інших японських винищувачів дизайном, що робив його схожим на європейські винищувачі, а також мав додаткове бронювання. Під час перших контактів союзники помилково вважали його ліцензійною копією Messerschmitt Bf 109 або якогось італійського літака.\\nРозроблений під керівництвом Такео Дої. Це був єдиний серійний винищувач японської армії з V-подібним двигуном рідинного охолодження. Перший політ прототипу відбувся в грудні 1941 року. Прийнятий на озброєння в кінці 1942 під найменуванням винищувач армійський тип 3. Всього було побудовано більше 3000 літаків.\\nКодове ім'я союзників — «Тоні»."},{"page_url":"https://da.wikipedia.org/wiki/Sankt_Johannes_Kirke_(Aarhus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Sankt_Johannes_Kirke_02.jpg","page_title":"Sankt Johannes Kirke (Aarhus)","context_page_description":"Skt. Johannes Kirke er en kirke på den nordvestlige del af Trøjborg i Aarhus, beliggende mellem Århus Kommunehospital og Nordre Kirkegård: Den er tegnet af Kongelig bygningsinspektør Hack Kampmann, og blev indviet i 1905 som den fjerde kirke i Aarhus. Kirken har et orgel fra Marcussen & Søn fra 1979 med 36 stemmer. Kirkeruderne er udsmykket af Arne Haugen Sørensen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D0%9F%D0%BE%D0%BA%D1%80%D0%BE%D0%B2%D0%B8_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D1%97_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%96_(%D0%91%D0%B0%D1%82%D1%83%D1%80%D0%B8%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%E2%80%93%D0%9F%D0%BE%D0%BA%D1%80%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_XVII_%D1%81%D1%82._C%D0%BF%D0%BE%D0%B2i%D0%B4%D0%B0%D0%BB%D1%8C%D0%BD%D1%8F_I%D0%B2%D0%B0%D0%BD%D0%B0_%D0%9C%D0%B0%D0%B7%D0%B5%D0%BF%D0%B8%2C_%D0%A7%D0%B5%D1%80%D0%BD%D1%96%D0%B3%D1%96%D0%B2%D1%89%D0%B8%D0%BD%D0%B0_%D0%BCi%D1%81%D1%82%D0%BE_%D0%91%D0%B0%D1%82%D1%83%D1%80%D0%B8%D0%BD.jpg","page_title":"Церква Покрови Пресвятої Богородиці (Батурин)","context_page_description":"Церква Покрови Пресвятої Богородиці, також Свято–Покровська церква, також Покро́вська це́рква в Батурині — парафіяльний храм Чернігівської єпархії ПЦУ.\\nПротягом своєї історії двічі руйнувалася і двічі відбудовувалася."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B4%D0%B8%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D1%83%D1%85%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Vista_aerea_bahia_Cadiz.JPG","page_title":"Кадисская бухта","context_page_description":"Ка́дисская бухта — бухта Атлантического океана на юго-западе Андалусии, часть Кадисского залива.\\nОт открытого океана закрыта островом Леон и защищена от волн. Длина более 15 км, ширина у входа 10 км, глубина составляет 10—15 м, в северной части имеются отмели.\\nБерега Кадисской бухты низменные, густо заселены. На территории бухты образован природный парк Баия-де-Кадис. Бухта дала название одной комарке Испании."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_jude%C8%9Bul_Prahova_-_N","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Nedelea%2C_cruce_de_pomenire_din_piatra.jpg","page_title":"Lista monumentelor istorice din județul Prahova - N","context_page_description":"Lista monumentelor istorice din județul Prahova - N cuprinde monumentele istorice înscrise în Patrimoniul cultural național al României și aflate în localități din județul Prahova al căror nume începe cu litera N.\\nLista completă este menținută și actualizată periodic de către Ministerul Culturii, Cultelor și Patrimoniului Național din România, prin intermediul Institutului Național al Patrimoniului, ultima versiune datând din 2015. Această listă cuprinde și actualizările ulterioare, realizate prin ordin al ministrului culturii.\\nPuteți căuta un monument din județul Prahova folosind formularul de mai jos sau puteți naviga prin toate monumentele din județ la lista monumentelor istorice din județul Prahova."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%BE%BD%E6%9D%9F%E5%B7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Hatsukagawa3.JPG","page_title":"羽束川","context_page_description":"羽束川は、兵庫県南東部を流れる二級水系武庫川の支流。武庫川の支流としては最大である。本項では上流である天王川と併せての記述としている。"},{"page_url":"https://es.wikipedia.org/wiki/Bicicleta_de_monta%C3%B1a","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Downhill_kicker_Specialized.JPG","page_title":"Bicicleta de montaña","context_page_description":"La bicicleta de montaña o bici de montaña es un tipo de bicicleta diseñada para viajes por la montaña o el campo. Se le denomina, en español, bicicleta todoterreno​, o bicicleta montañera, como se le conoce en Venezuela, República Dominicana y otros países hispanoamericanos.\\nLa bicicleta de doble suspensión representa el más importante avance del ciclismo en el siglo XX; dado que proporciona a los ciclistas la posibilidad de llegar a lugares que en otro tiempo se consideraban inaccesibles para dicho vehículo. mejorando la maniobrabilidad y control en terrenos irregulares. A través de ella han aparecido nuevas modalidades de ciclismo, acercándolo hacia el campo de los deportes extremos."},{"page_url":"https://en.wikipedia.org/wiki/Salawat_Yulayev","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/%D0%A1%D0%B0%D0%BB%D0%B0%D0%B2%D0%B0%D1%82_%D0%AE%D0%BB%D0%B0%D0%B5%D0%B2._%28%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B3%D0%B5%D1%80%D0%BE%D0%B9_%D0%91%D0%B0%D1%88%D0%BA%D0%B8%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%B0%29..jpg","page_title":"Salawat Yulayev","context_page_description":"Salawat Yulayev is a Bashkir national hero who participated in Pugachev's Rebellion, warrior, poet and singer."},{"page_url":"https://sv.wikipedia.org/wiki/Erica_mauritanica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Erica_mauritanica_flowers.jpg","page_title":"Erica mauritanica","context_page_description":"Erica mauritanica är en ljungväxtart som beskrevs av Carl von Linné. Erica mauritanica ingår i släktet klockljungssläktet, och familjen ljungväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Chester_Crocker","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Chester_Crocker_2006.jpg","page_title":"Chester Crocker","context_page_description":"Chester Arthur Crocker is an American diplomat and scholar who served as Assistant Secretary of State for African Affairs from June 9, 1981, to April 21, 1989, in the Reagan administration. Crocker, architect of the U.S. policy of \\"constructive engagement\\" towards Southern Africa including apartheid-era South Africa, is credited with setting the terms of Namibian independence."},{"page_url":"https://nl.wikipedia.org/wiki/Seixas_(Caminha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Caminha_277.PNG","page_title":"Seixas (Caminha)","context_page_description":"Seixas is een plaats in de Portugese gemeente Caminha en telt 1 578 inwoners."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%AD%D0%B4%D0%B2%D0%B0%D1%80%D0%B4_%D0%9C%D1%83%D0%BD%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Edvard_Munch_1933-2.jpg","page_title":"Эдвард Мунк","context_page_description":"Эдвард Мунк — Норвегиялық экспрессионизм суретшісі және графикшісі. Оның шығармалары адам жанының налаға толы мұңлы кескінін айқын бедерлеп көрсетуімен ерекшеленеді және кейінгі неміс экспрессионизміне айырықша ықпал етті. Оның өнері мен өміріне анасының өлімі, балалық шағындағы ағасы мен әпкесінің өлімі, әкесі мен екінші әпкесінің психикалық ауруы із қалдырған. Болмашы білім алады, бірақ Христианидегі суретшілер тобының қолдауымен имперссионизмге және постимрессионизмге бейімделуі оның керемет стиль қалыптастыруына мүмкіндік берді."},{"page_url":"https://eu.wikipedia.org/wiki/Cerverako_eskualdea","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Comarca_of_Cervera_-_La_Rioja_%28Spain%29.svg","page_title":"Cerverako eskualdea","context_page_description":"Cerverako eskualdea Errioxan dago kokatuta, Espainian. Errioxa Beherean dagoen eskualdea da, mendialdearen aldean.\\nAlhama-Linares eskualdea izenaz ere ezaguna da.\\nUdalerri kopurua: 5\\nAzalera: 291,23 Km²\\nBiztanleria: 4.254 biztanle\\nDentsitatea: 14,61 bizt/Km²\\nBatez besteko latitudea: 41º 59' 52\\" I\\nBatez besteko longitudea: 02º 01' 40\\" M\\nBatez besteko altuera: 725,2 m"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BB%D0%B8%D1%86%D0%B0_%D0%A0%D1%8E%D0%B9%D1%82%D0%BB%D0%B8_(%D0%A2%D0%B0%D1%80%D1%82%D1%83)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Tartu-Jaani-church-2012-06_4.png","page_title":"Улица Рюйтли (Тарту)","context_page_description":"Улица Рюйтли — улица в Тарту. Находится в исторической части города, от Ратушной площади до улицы Лай.\\nВ настоящее время превращена в пешеходную зону, один из главных туристических маршрутов города."},{"page_url":"https://en.wikipedia.org/wiki/Gogia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Gogia_kitchnerensis_01.jpg","page_title":"Gogia","context_page_description":"Gogia is a genus of primitive eocrinoid blastozoan from the early to middle Cambrian.\\nG. ojenai dates to the late Early Cambrian; other species come from various Middle Cambrian strata throughout North America, but the genus has yet to be described outside this continent. Notable localities where species are found include the Wheeler Shale of Utah, and the Burgess Shale of British Columbia.\\nThe species of Gogia, like other eocrinoids, were not closely related to the true crinoids, instead, being more closely related to the blastoids.\\nGogia is distinguished from sea lilies, and most other blastoids, in that the plate-covered body was shaped like a vase, or a bowling pin, and that the five ambulacra were split into pairs of coiled or straight, ribbon-like strands. Six specimens of Gogia are known from the Greater Phyllopod bed, where they comprise < 0.1% of the community.\\nAs a whole, the Eocrinoids are regarded as basal blastozoans very close to the ancestry of the entire subphylum."},{"page_url":"https://en.wikipedia.org/wiki/Samuel_W._King_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Samuel_W._King_House_Portland.JPG","page_title":"Samuel W. King House","context_page_description":"The Samuel W. King House is a house located in southwest Portland, Oregon listed on the National Register of Historic Places."},{"page_url":"https://de.wikipedia.org/wiki/Tavant","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Tavant03.jpg","page_title":"Tavant","context_page_description":"Tavant ist eine französische Gemeinde mit 263 Einwohnern im Département Indre-et-Loire in der Region Centre-Val de Loire."},{"page_url":"https://sk.wikipedia.org/wiki/Distinguished_Flying_Cross_(Spojen%C3%A9_kr%C3%A1%C4%BEovstvo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Medal%2C_decoration_%28AM_2001.25.766.1-1%29.jpg","page_title":"Distinguished Flying Cross (Spojené kráľovstvo)","context_page_description":"Distinguished Flying Cross je vojenské vyznamenanie udeľované vo Veľkej Británii pilotom Royal Air Force alebo skôr dôstojníkom letectiev krajín Commonwealthu, či ďalších spojeneckých krajín, za odvážny čin alebo činy, hrdinstvo, odvahu a statočnosť alebo príkladnú službu vo vzdušných operáciách proti nepriateľovi.\\nOcenenie vzniklo 3. júna 1918, krátko po založení RAF. Jeho nositelia majú oprávnenie používať za svojim menom skratku DFC.\\nZo slovenských nositeľov je pravdepodobne najznámejší generálmajor Otto Smik, z českých generál František Fajtl a Karel Kuttelwascher."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AB%E0%A7%81%E0%A6%B2%E0%A6%9A%E0%A7%8C%E0%A6%95%E0%A6%BF_%E0%A6%AE%E0%A6%B8%E0%A6%9C%E0%A6%BF%E0%A6%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Back_side_of_Fulchouki_Mosque_from_South-West_angle_01.jpg","page_title":"ফুলচৌকি মসজিদ","context_page_description":"ফুলচৌকি মসজিদ বাংলাদেশের রংপুর জেলার মিঠাপুকুর উপজেলার একটি প্রাচীন মসজিদ। এটি মোঘল আমলের দিকে তৈরি। এটি বাংলাদেশ প্রত্নতত্ত্ব অধিদপ্তরের তালিকাভুক্ত একটি প্রত্নতাত্ত্বিক স্থাপনা।"},{"page_url":"https://hu.wikipedia.org/wiki/Bet%C5%B1t%C3%ADpus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Palatino.png","page_title":"Betűtípus","context_page_description":"A tipográfiában a betűtípus egy, az elemeivel összhangba hozott betűtervsorozat, ami egy teljes ábécét alkot, és amelyet nyomtatásban vagy a számítógép képernyőjén meg lehet jeleníteni. Máshogyan fogalmazva a betűtípus olyan betűrajzolatok sorozata, melyek egy bizonyos stílusnak megfelelő, egységesen megtervezett karaktereket írnak le egy karakterkészletben.\\nA számítógépes környezetben használt font szó a francia fonte szóból ered, amelynek jelentése 'olvadt', és a hajdani nyomdászok ólomból öntött betűsorozatára utal. Ma a font egy adott betűtípust jelent, amelynek karakterei egy közös fájlban vannak tárolva. A fontfájlok gyártójától függ, hogy az adott betűtípusban a fájl mely karakterek rajzolatát tartalmazza; csak az angol \\"írógép-betűkészlet\\", a magyar ékezetes betűk is, egyéb nyelvek betűi, vagy akár a Unicode jelkészlet nagy része. Egy fontban minden tárolt karakter rajzolata egyazon betűtípus tipográfiai jellegzetességeit mutatja. A raszterfontok a betűképeket csak néhány méretben definiálják, a vektorfontok karakterei viszont bármilyen méretben megjeleníthetők a minőség változása nélkül."},{"page_url":"https://en.wikipedia.org/wiki/Spangled_drongo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Spangled_Drongo_nest.jpg","page_title":"Spangled drongo","context_page_description":"The spangled drongo is a bird of the family Dicruridae. It is the only drongo to be found in Australia where it can be recognised by its black, iridescent plumage and by its characteristic forked tail. It feeds on insects and small vertebrates. It has complex and varied calls and is a mimic of the sounds it hears. It arrives in Queensland in late spring and breeds high in an isolated tree, producing three to five young each year."},{"page_url":"https://en.wikipedia.org/wiki/Kinetic_Isotope_Effects_of_RuBisCO","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Intrinsic_KIE_of_RuBisCO_-_Carboxylation_of_RuBP_with_active_site_of_RuBisCO.png","page_title":"Kinetic Isotope Effects of RuBisCO","context_page_description":"The kinetic isotope effect of ribulose-1,5-bisphosphate carboxylase oxygenase is the isotopic fractionation associated solely with the step in the Calvin-Benson Cycle where a molecule of carbon dioxide is attached to the 5-carbon sugar ribulose-1,5-bisphosphate to produce two 3-carbon sugars called 3-phosphoglycerate. This chemical reaction is catalyzed by the enzyme RuBisCO, and this enzyme-catalyzed reaction creates the primary kinetic isotope effect of photosynthesis. It is also largely responsible for the isotopic compositions of photosynthetic organisms and the heterotrophs that eat them. Understanding the intrinsic KIE of RuBisCO is of interest to earth scientists, botanists, and ecologists because this isotopic biosignature can be used to reconstruct the evolution of photosynthesis and the rise of oxygen in the geologic record, reconstruct past evolutionary relationships and environmental conditions, and infer plant relationships and productivity in modern environments."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%94%A6%E6%B1%9F%E5%8E%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Thitranlaicach2.jpg","page_title":"锦江县","context_page_description":"锦江县是越南海阳省下辖的一个县。"},{"page_url":"https://en.wikipedia.org/wiki/Nancy-Universit%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Nancy-Universit%C3%A9.JPG","page_title":"Nancy-Université","context_page_description":"Nancy-Université federated the three principal institutes of higher education of Nancy, in Lorraine, France before their merger into the University of Lorraine:\\nHenri Poincaré University: natural sciences, wrapping several faculties and engineering schools\\nÉcole Supérieure des Sciences et Technologies de l'Ingénieur de Nancy: general engineering\\nÉcole Supérieure d'Informatique et Applications de Lorraine: Computer Science engineering\\nNancy 2 University: social sciences\\nInstitut national polytechnique de Lorraine: engineering schools, notably:\\nENSEM: electrical and mechanical engineering\\nMines de Nancy: general engineering\\nENSIC: chemistry\\nENSAIA: agricultural engineering\\nWith over 50 000 students, Nancy has the fifth largest student population in France."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9A%E0%A7%80%E0%A6%A8%E0%A6%BE_%E0%A6%85%E0%A6%95%E0%A7%8D%E0%A6%B7%E0%A6%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Chinese_typefaces.svg","page_title":"চীনা অক্ষর","context_page_description":"চীনা অক্ষর বা হানসি এক ধরনের শব্দলিপি-একক । এগুলি চীনা ভাষা লিখতে ব্যবহার করা হয়। এই অক্ষরগুলি এশিয়ার অন্য কিছু ভাষা লিখতেও ব্যবহৃত হয়। অক্ষরগুলি জাপানি লিখন পদ্ধতির মূল উপাদান; জাপানি ভাষাতে এগুলি কাঞ্জি নামে পরিচিত। অতীতে এগুলিকে কোরীয় ভাষা, ভিয়েতনামীয় ভাষা এবং চুয়াং ভাষা লিখতেও ব্যবহার করা হত। সমষ্টিগতভাবে এগুলিকে ইংরেজিতে সিজেকে ক্যারেক্টারস নামে ডাকা হয়।\\nচীনা অক্ষরগুলি যে চীনা লিখন পদ্ধতির অংশ, সেটি অবিচ্ছিন্নভাবে প্রাচীনকাল থেকে আজ অবধি ব্যবহৃত বিশ্বের লিখন পদ্ধতিগুলির মধ্যে সবচেয়ে প্রাচীন। পূর্ব এশিয়ার বিস্তীর্ণ এলাকাতে বর্তমানে ব্যাপকভাবে ব্যবহৃত হয় বলে এবং ঐতিহাসিকভাবে চৈনিক মণ্ডলের সর্বত্র ব্যবহৃত হত বলে চীনা অক্ষরগুলি ব্যবহারকারীর সংখ্যা অনুযায়ী বিশ্বের সবচেয়ে বেশি ব্যবহৃত লিখন পদ্ধতির একটি গঠন করেছে।\\nচীনা অক্ষরগুলির সংখ্যা প্রায় অর্ধলক্ষ হলেও এগুলির সিংহভাগই গৌণ চিত্রলৈখিক রূপভেদ যেগুলি কেবল ঐতিহাসিক পাঠ্যবস্তুতেই দেখতে পাওয়া যায়। চীনে সম্পাদিত গবেষণায় দেখা গেছে যে চীনা লিখন পদ্ধতিতে কাজ চালানোর মত সাক্ষরতা অর্জন করার জন্য ৩০০০ থেকে ৪০০০ অক্ষরের জ্ঞান থাকা প্রয়োজন। জাপানে মাধ্যমিক বিদ্যালয়গুলিতে ২, ১৩৬টি কাঞ্জি অক্ষর শেখানো হয়, যাদের নাম \\"জোইয়ো কাঞ্জি\\"; এছাড়া জাপানের দৈনন্দিন জীবনে আরও শত শত অক্ষর ব্যবহৃত হয়।"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_amfibie%C3%ABn_in_Panama","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Pristimantis_cerasinus_%28Limon_Robber_Frog%29.jpg","page_title":"Lijst van amfibieën in Panama","context_page_description":"Onderstaande lijst van amfibieën in Panama bestaat uit een totaal van 221 in Panama voorkomende soorten die zijn onderverdeeld in drie ordes: de wormsalamanders, salamanders en kikkers. Deze lijst is ontleend aan de databank van Amphibian Species of the World, aangevuld met enkele soorten die recent zijn ontdekt door de wetenschap of wiens aanwezigheid in Panama recent is vastgesteld."},{"page_url":"https://et.wikipedia.org/wiki/Louis_XI","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Map_France_1477-en.svg","page_title":"Louis XI","context_page_description":"Louis XI oli Prantsusmaa kuningas 1461–1483.\\nLouis sündis Prantsusmaa kuninga Charles VII ja Anjou printsessi Marie pojana. Ta kuulus Valois' dünastiasse.\\nLouis krooniti kuningaks 15. augustil 1461 Reimsi katedraalis. Talle meeldis vandenõusid ja intriige sepitseda, mis tekitas talle palju vaenlasi, kelle seas olid ka tema isa ja vend.\\nTa osales isa valitsusajal Saja-aastase sõja lõpetamise järel alanud perioodil, Charles VII vastases mässus 1439–1440, koos Bourboni hertsogi Charles I, Alençoni hertsogi Jean II, Vendôme krahvi Louis'ga.\\n1441. aastal juhtis ta Prantsuse vägesid Šveitsi vastu. Šveitslastega sõdinud Saksa kuningas Friedrich III kutsus Prantsusmaalt abivägesid, kus sel ajal oli palju tööta sõjamehi – armanjakke. Baseli lähedal sulges armanjakkide tee kakskümmend korda väiksem mägilaste sõjavägi. See sõjavägi hukkus peaaegu täielikult, sest keegi ei tahtnud taganeda. Šveitslaste kangelasmeel äratas prantsuse palgasõdurites nii suurt lugupidamist, et kallaletungijad läksid tagasi olles arvamisel, et selliste kangelaste isamaad on võimatu võita. Friedrich ei suutnud oma sõjameestega ka midagi teha ja oli sunnitud tegema rahu Ensisheimis."},{"page_url":"https://lv.wikipedia.org/wiki/J%C5%ABlija_Vilhelm%C4%ABne_H%C4%81gena-%C5%A0varca","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Hagen-Schwarz%2C_Julie._Kunstnik_August_Hageni_portree.jpg","page_title":"Jūlija Vilhelmīne Hāgena-Švarca","context_page_description":"Jūlija Vilhelmīne Hāgena-Švarca bija vācbaltiešu gleznotāja."},{"page_url":"https://pl.wikipedia.org/wiki/Richard_Mead","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/W._MacMichael%2C_The_gold-headed_cane._Wellcome_L0030451.jpg","page_title":"Richard Mead","context_page_description":"Richard Mead – angielski lekarz. Jego praca o występowaniu chorób zakaźnych i ich zapobieganiu, A Short Discourse concerning Pestilential Contagion, and the Method to be used to prevent it, wydana w 1720 roku, ma historyczną wartość dla zrozumienia mechanizmów chorób zakaźnych."},{"page_url":"https://es.wikipedia.org/wiki/Earl_Metcalfe","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/White_Eagle_poster_1922.jpg","page_title":"Earl Metcalfe","context_page_description":"Earl Metcalfe fue un actor y director cinematográfico de nacionalidad estadounidense, activo en la época del cine mudo."},{"page_url":"https://es.wikipedia.org/wiki/Concorezzo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Concorezzo--Oratorio_di_Sant%27Antonio--3.JPG","page_title":"Concorezzo","context_page_description":"Concorezzo es una localidad y comune italiana de la provincia de Monza y Brianza, región de Lombardía, con 15 161 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Yellowknife_Historical_Society","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/NWT_Mining_Heritage_Site_Panorama.jpg","page_title":"Yellowknife Historical Society","context_page_description":"The Yellowknife Historical Society, in the Northwest Territories, Canada, was first formed in 2002 as the NWT Mining Heritage Society and began planning for the creation of a mining museum for Yellowknife and the Northwest Territories and Nunavut as a whole. In 2017, the society was renamed the Yellowknife Historical Society to broaden its mandate to create a community museum for Yellowknife that would include all cultural aspects of the city's history."},{"page_url":"https://nl.wikipedia.org/wiki/Giry","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Map_commune_FR_insee_code_58127.png","page_title":"Giry","context_page_description":"Giry is een gemeente in het Franse departement Nièvre en telt 217 inwoners. De plaats maakt deel uit van het arrondissement Cosne-Cours-sur-Loire."},{"page_url":"https://en.wikipedia.org/wiki/Rietavas_Manor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Rietavo_muziejus_2007-06-12.jpg","page_title":"Rietavas Manor","context_page_description":"Rietavas Manor is a former Ogiński residential manor in Rietavas city, Lithuania. The primary manor building did not remained until nowadays, however many parts of the ensemble did, including the former musicians dormitory, water tower, park, a few outbuildings, guard house, part of the wall, two gates, Ogiński Family Chapel, where Bogdan Ogiński and his brother duke Mykolas Ogiński are buried."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Beovoz_stations","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Vukov_spomenik_plato.png","page_title":"List of Beovoz stations","context_page_description":"There are six lines in Belgrade Beovoz City Railway System:\\nStara Pazova-Batajnica-Beograd Centar-Pančevo Vojlovica\\nRipanj-Resnik-Rakovica-Pančevo Vojlovica\\nStara Pazova-Batajnica-Beograd Centar-Rakovica-Resnik-Ripanj\\nZemun-Beograd Centar-Rakovica-Valjevo\\nNova Pazova-Batajnica-Beograd Centar-Rakovica-Resnik-Mladenovac\\nStara Pazova-Batajnica-Beograd Centar-Rakovica-Mala Krsna\\nList of stations:\\nLine 1:\\nStara Pazova\\nNova Pazova\\nBatajnica\\nZemunsko Polje\\nZemun\\nTošin Bunar\\nNovi Beograd\\nBeograd Centar\\nKarađorđev park\\nVukov Spomenik\\nPančevački most\\nKrnjača\\nSebeš\\nOvča\\nPančevo Glavna\\nPančevo Varoš\\nPančevo Strelište\\nPančevo Vojlovica\\nLine 2:\\nRipanj\\nRipanj Kolonija\\nPinosava\\nResnik\\nKijevo\\nKneževac\\nRakovica\\nKarađorđev park\\nVukov Spomenik\\nPančevački most\\nKrnjača\\nSebeš\\nOvča\\nPančevo Glavna\\nPančevo Varoš\\nPančevo Strelište\\nPančevo Vojlovica\\nLine 3:\\nStara Pazova\\nNova Pazova\\nBatajnica\\nZemunsko Polje\\nZemun\\nTošin Bunar\\nNovi Beograd\\nBeograd Centar\\nRakovica\\nKneževac\\nKijevo\\nResnik\\nPinosava\\nRipanj Kolonija\\nRipanj\\nLine 4:\\nZemun\\nTošin Bunar\\nNovi Beograd\\nBeograd Centar\\nmerge with Pančevo branch at Rakovica\\nLine 4:\\nPančevo Glavna\\nPančevo Varoš\\nOvča\\nSebeš\\nKrnjača\\nPančevački most\\nVukov Spomenik\\nKarađorđev park"},{"page_url":"https://no.wikipedia.org/wiki/Tennessee_Valley_Authority","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/BellefonteDecay.JPG","page_title":"Tennessee Valley Authority","context_page_description":"Tennessee Valley Authority er en statseiet virksomhet i USA, som ble oprettet ved et vedtak i Kongressen i mai 1933 for å skape seilingsmulihghet og kontroll over Tennessee River, generere elektrisitet og økonomisk utvikling i Tennessee Valley, et område som i særlig grad var rammet av nødsårene på 1930-tallet. TVA var ikke bare tenkt som et kraftselskap, men også som et regionalt økonomisk utviklingsområde son kunne bruke statlige eksperter og elektrisitet for hurtig å kunne modernisere regionens økonomi og samfunn\\nTVAs ansvarsområde dekker det meste av Tennessee, deler av Alabama, Mississippi og Kentucky, samt mindre områder i Georgia, Nord-Carolina og Virginia. Det er en politisk enhet med et område som en stor stat og med noen statlig myndighrt, men i motsettning til en stat har den ingen borgere eller valgte ledere. Det var det første store regionale planlegningsforetak under den føderale regjering og er fortsatt det største. Under ledelse av David Lilienthal ble foretaket en modell for den amerikanske regjerings innsats for å modernisere landbruket i den tredje verden."},{"page_url":"https://en.wikipedia.org/wiki/Rail_services_in_the_West_of_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Stapleton_Road_railway_station_MMB_03.jpg","page_title":"Rail services in the West of England","context_page_description":"Rail services in the West of England refer to passenger rail journeys made in the Bristol commuter area. 26 million passenger rail journeys were made in 2018-19 within the Gloucestershire, Wiltshire and Bristol/Bath region."},{"page_url":"https://az.wikipedia.org/wiki/Makl%C9%99van","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Kados_maklawan_12.jpg","page_title":"Makləvan","context_page_description":"Makləvan — İranın Gilan ostanında yerləşən şəhər. Makləvan əhalisinin əksəriyyətini talışlar təşkil edir."},{"page_url":"https://nl.wikipedia.org/wiki/Marcel_Wilmet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Marcel_wilmet.jpg","page_title":"Marcel Wilmet","context_page_description":"Marcel Wilmet is een Belgisch voormalig redacteur en journalist."},{"page_url":"https://cs.wikipedia.org/wiki/Syrsk%C3%A1_libra","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/NewSyrian50back.png","page_title":"Syrská libra","context_page_description":"Syrská libra je oficiální měna Sýrie. Mezinárodní kód měny podle normy ISO 4217 je SYP.\\nBěhem syrské občanské války hodnota syrské libry rychle poklesla kvůli odlivu kapitálu do sousedních zemí a kvůli sankcím USA a Evropské unie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Stuttgart-West","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/20180508_Stuttgart_-_Traubenstra%C3%9Fe_45.jpg","page_title":"Liste der Kulturdenkmale in Stuttgart-West","context_page_description":"In der Liste der Kulturdenkmale in Stuttgart-West sind alle unbeweglichen Bau- und Kunstdenkmale in Stuttgart-West aufgelistet, die in der Liste der Kulturdenkmale. Unbewegliche Bau- und Kunstdenkmale der Unteren Denkmalschutzbehörde für diesen Stadtbezirk Stuttgarts verzeichnet sind. Stand dieser Liste ist der 25. April 2008.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Stuttgart erhältlich."},{"page_url":"https://tr.wikipedia.org/wiki/Sten","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Sten_Mk_II_dorsal_view.JPG","page_title":"Sten","context_page_description":"Sten, Britanyalı yapımı bir hafif makineli silah. 1940 yılında Birleşik Krallık'ta yaşanan silah sıkıntısına binaen üretilmiş olan, 9 mm kalibreli, basit tasarımlı, kolay üretilebilen ve oldukça güvenilir bir silahtır. Adını, tasarımcıların soyadının baş harflerinden ve yapıldığı yerden almaktadır. İlk aşamada 100.000 adet üretilerek İngiliz askerlerine hafif, az yer kaplayan, onarımı ve bakımı kolay bir silah sağlanmıştır. SAS komandoları ve baskın ekipleri için de sınırlı sayıda susturuculu MK II'ler üretilmiştir. Sten, kısa menzilli, yüksek atış hızına, kabul edilir derecede hasar gücüne sahip, hareket kabiliyeti yüksek bir silahtır. Mermileri 9 mm çapında olduğu için yakın menzilli bir silahtır. Ancak yere düştüğü an, içindeki 32 mermiyi etrafa saçar. Tabanca türünden olduğu için tam otomatik atış yapma yeteneği kısıtlı bir silahtır. II. Dünya Savaşı'nda tüm İngiliz askerleri tarafından hafifliği, az yer kaplaması, onarım kolaylığı ve basitçe temizlenebilir bir silah olduğundan dolayı çok tutulmuştur. Kore Savaşı'nda da yine aynı şekilde Birleşmiş Milletler saflarında olan Birleşik Krallık tarafından kullanılmıştır."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%90%D7%9C%D7%A6%27%D7%94_%D7%A1%D7%90%D7%A4%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Balcha_Aba_Nefso.JPG","page_title":"באלצ'ה סאפו","context_page_description":"דאג'אזמאץ' באלצ'ה סאפו היה מושל וגנרל אתיופי, שנלחם במלחמה האתיו-איטלקית הראשונה והשנייה. הוא הגיע ממשפחה לא אריסטוקרטית.\\nבאלצ'ה היה בן לעם הגוראגה שנפל בשבי חיילי מנליק סורס והועבר לשרת בחצרו באדיס אבבה\\nעלה לגדולה כגזבר והצטיין כאיש ארטילריה בקרב אדווה נגד האיטלקים, ולאחר קרב זה הועלה לדרגת דאג'זמץ\\n. לאחר מכן כיהן כמושל סידאמו ולאחר מות דאג'זמץ יאלמה מקונן היה מושל הרר בשנים 1908-1910.\\nב-1916 עזר להכות את ליג' ייאסו נכדו ויורשו של מנליק ויריבו של טפרי מקונן. מאוחר יותר דאג'זמץ באלצ'ה שהיה שמרן התנגד לרפורמות של טפרי מקונן וב-1928 נאלץ להיכנס למנזר\\n. הוא נהרג ב-1935 בקרבות מול צבאות הפלישה הפאשיסטיים.\\nבאזור גוראגה."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Vega_Spitzer.jpg","page_title":"Вега","context_page_description":"Ве́га — найяскравіша зоря в сузір'ї Ліри, п'ята за яскравістю зоря нічного неба, друга після Арктура в північній півкулі. Порівняно близька, та, разом з Арктуром і Сіріусом, одна з найяскравіших зір.\\nБлизько 12 000 року до н. е. Вега була поляриссимою і приблизно через 12 000 років знову стане нею. Вона була першою зорею, в якої сфотографували спектр, та однією з перших зір, відстань до якої виміряли за допомогою паралаксу.\\nУкраїнська народна назва Веги — Ткаля. У ніч на Івана Купала вона зустрічається з Альтаїром — Пастухом."},{"page_url":"https://it.wikipedia.org/wiki/Wanda_Tettoni","image_url":"https://upload.wikimedia.org/wikipedia/it/a/a7/Wanda_Tettoni.png","page_title":"Wanda Tettoni","context_page_description":"Wanda Tettoni è stata un'attrice e doppiatrice italiana."},{"page_url":"https://war.wikipedia.org/wiki/Shinisaurus_crocodilurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Chin-krokodilschwanzechse-01.jpg","page_title":"Shinisaurus crocodilurus","context_page_description":"An Shinisaurus crocodilurus in uska species han Reptilia nga ginhulagway ni Ahl hadton 1930. An Shinisaurus crocodilurus in nahilalakip ha genus nga Shinisaurus, ngan familia nga Xenosauridae. Waray hini subspecies nga nakalista."},{"page_url":"https://pt.wikipedia.org/wiki/Flossie_Wong-Staal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Flossie_Wong-Staal_%28cropped%29.jpg","page_title":"Flossie Wong-Staal","context_page_description":"Flossie Wong-Staal, née Wong Yee Ching, foi uma virologista e bióloga molecular de origem chinesa e norte-americana. Ela foi a primeira cientista a clonar o HIV e a determinar a função de seus genes, fato este que foi um grande passo para a prova que o HIV é o vírus causador da AIDS. De 1999 a 2002, ela ocupou a cadeira Florence Riford, referente à pesquisa de AIDS na Universidade da Califórnia em San Diego. Flossie se tornou diretora científica da Immusol, que era, antigamente, a renomada ITherX Pharmaceuticals, em 2007, quando esta estava se transformando em uma companhia de desenvolvimento de remédios focados em hepatite C. Desse modo, nessa empresa, Flossie permaneceu como diretora científica."},{"page_url":"https://pt.wikipedia.org/wiki/Espor%C3%A2ngio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/XN_Polytrichum_spec.jpg","page_title":"Esporângio","context_page_description":"Esporângio é a estrutura anatómica no interior da qual os esporos são formados. Pode ser composta por uma única célula ou ser multicelular. Todas as plantas"},{"page_url":"https://hu.wikipedia.org/wiki/Foltos_sasr%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Dubai_Atlantis_Aquarium_1201200712552_Aetobatus_narinari_Spotted_Eagle_Ray.jpg","page_title":"Foltos sasrája","context_page_description":"A foltos sasrája a porcos halak osztályának sasrájaalakúak rendjébe, ezen belül az Aetobatidae családjába tartozó faj."},{"page_url":"https://fr.wikipedia.org/wiki/Bjarte_Myrhol","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Bjarte_Myrhol-GoldenLeague-20160110_5.JPG","page_title":"Bjarte Myrhol","context_page_description":"Bjarte Håkon Myrhol, né le 29 mai 1982 à Oslo, est un joueur de handball international norvégien évoluant au poste de pivot."},{"page_url":"https://en.wikipedia.org/wiki/The_Trout_Inn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/The_Trout_Inn_Wolvercote.jpg","page_title":"The Trout Inn","context_page_description":"The Trout Inn is a historic public house in Lower Wolvercote north of Oxford, close to Godstow Bridge, directly by the River Thames."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B0%D1%82%D1%81%D0%BA%D0%BE-%D1%8D%D1%81%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Denmark_Estonia_Locator.png","page_title":"Датско-эстонские отношения","context_page_description":"Датско-эстонские отношения — двусторонние дипломатические отношения между Данией и Эстонией."},{"page_url":"https://nl.wikipedia.org/wiki/Michael_Nesmith","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Michael_Nesmith_at_the_Chiller_Theatre_Expo_2017.jpg","page_title":"Michael Nesmith","context_page_description":"Robert Michael Nesmith is een Amerikaans muzikant, songschrijver, acteur, producent, auteur, zakenman en filantroop. Hij is bekend geworden als gitarist en zanger van The Monkees."},{"page_url":"https://fr.wikipedia.org/wiki/Cirque_de_Barrosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cirque-de-Barrosa-coupe-Pyrenees.jpg","page_title":"Cirque de Barrosa","context_page_description":"Le cirque de Barrosa est un cirque glaciaire situé au centre de la chaîne des Pyrénées, en Espagne, dans la comarque du Sobrarbe. Une partie de sa ligne de crête forme la frontière avec la France.\\nIl s’agit d’un beau cirque de montagne, attrayant pour des montagnards, mais il se singularise par sa structure géologique en deux étages, l’étage supérieur faisant partie d’un chevauchement, et par les vestiges d’un ancien chemin muletier qui le traverse de part en part. Or ces deux singularités sont intimement liées puisque ce chemin a été aménagé sur une corniche naturelle qui court, dans les falaises, à la limite entre les deux étages, ce qui confère à son parcours un grand intérêt sur le plan géologique.\\nDe plus le cirque de Barrosa fournit l’occasion de s’intéresser à plusieurs histoires : celles de l’exploitation minière dans la région du cirque, à laquelle ce chemin est lié ; celle des relations humaines entre la France et la vallée de Bielsa, par ce chemin ou des cols voisins ; celle d’un épisode de la guerre d’Espagne, dont la vallée de Bielsa a été le théâtre ; et celle du pyrénéisme, dont les pionniers découvrent le cirque à la fin du XIXᵉ siècle."},{"page_url":"https://es.wikipedia.org/wiki/Gryffin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Griffyn_%2843228990201%29.jpg","page_title":"Gryffin","context_page_description":"Dan Griffith, conocido por su nombre artístico Gryffin, es un DJ, productor discográfico y músico estadounidense. Obtuvo reconocimiento por remezclar algunas canciones conocidas como \\"Talking Body\\" de Tove Lo, \\"Animals\\" de Maroon 5 y \\"Desire\\" de Years & Years.​​"},{"page_url":"https://simple.wikipedia.org/wiki/United_States_Secretary_of_the_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Adolph_Borie%2C_Brady-Handy_bw_photo_portrait%2C_ca1860-1875.jpg","page_title":"United States Secretary of the Navy","context_page_description":"The United States Secretary of the Navy is the civilian head of the Department of the Navy. The position was a member of the President's Cabinet until 1947, when the Navy, Army, and newly created Air Force were placed in the Department of Defense and the Secretary of the Navy was placed under the Secretary of Defense."},{"page_url":"https://en.wikipedia.org/wiki/Phycomyces_blakesleeanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Phycomyces_blakesleeanus1.jpg","page_title":"Phycomyces blakesleeanus","context_page_description":"Phycomyces blakesleeanus is a filamentous fungus in the Order Mucorales of the phylum Zygomycota or subphylum Mucoromycotina. The spore-bearing sporangiophores of Phycomyces are very sensitive to different environmental signals including light, gravity, wind, chemicals and adjacent objects. They exhibit phototropic growth: most Phycomyces research has focused on sporangiophore photobiology, such as phototropism and photomecism. Metabolic, developmental, and photoresponse mutants have been isolated, some of which have been genetically mapped. At least ten different genes are required for phototropism. The madA gene encodes a protein related to the White Collar 1 class of photoreceptors that are present in other fungi, while madB encodes a protein related to the White Collar 2 protein that physically bind to White collar 1 to participate in the responses to light.\\nPhycomyces also exhibits an avoidance response, in which the growing sporangiophore avoids solid objects in its path, bending away from them without touching them, and then continuing to grow upward again."},{"page_url":"https://de.wikipedia.org/wiki/Strawberry_Fields","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Straberry_Fields_Schild.jpg","page_title":"Strawberry Fields","context_page_description":"Strawberry Fields ist eine Gedenkstätte im New Yorker Central Park.\\nNach John Lennons Tod gestaltete Yoko Ono einen kleinen Bereich im Central Park, der ihm gewidmet und nach seinem Lied Strawberry Fields Forever benannt ist. Er befindet sich im Central Park West nahe der Eighth Avenue auf Höhe der West 72nd Street, unweit des Dakota Buildings, in dem Lennon und Ono lebten und vor dem John Lennon am 8. Dezember 1980 einem Attentat zum Opfer fiel. Die Einweihung fand am 9. Oktober 1985 statt, Lennon wäre an diesem Tag 45 Jahre alt geworden. Besonderes Merkmal der Strawberry Fields ist das von Yoko Ono gestaltete und von italienischen Handwerkern ausgeführte kreisrunde Mosaik aus schwarzen und weißen Steinchen. In dessen Zentrum ist in Anlehnung an Lennons vielleicht berühmtesten Titel Imagine zu lesen. Jedes Jahr an seinem Todestag versammeln sich dort Menschen, um seiner zu gedenken. Anlässlich seines 70. Geburtstags wurde dort am 9. Oktober 2010 eine Plakette aus Bronze im Boden eingeweiht, auf der die Namen der 121 Staaten verzeichnet sind, die 1985 die Idee der Gedenkstätte im Namen des Friedens unterstützten."},{"page_url":"https://sh.wikipedia.org/wiki/Kaducej","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Lekythos_of_Hermes.jpg","page_title":"Kaducej","context_page_description":"Kaducej ili Hermesov štap tipično je prikazan kao kratki glasnički štap isprepleten dvjema zmijama u obliku dvostruke uzvojnice, a ponekad nadvišen krilima. Tijekom kasne antike kaducej je vjerojatno služio kao osnova za astrološki znak koji je predstavljao planet Merkur, a u rimskoj ikonografiji često je bio prikazivan kako stoji u lijevoj ruci grčkog boga Hermesa, glasnika bogova, vodiča mrtvih i zaštitnika trgovaca, kockara, lažljivaca i kradljivaca.\\nKaducej se često koristi kao simbol medicine, posebice u Sjevernoj Americi, zbog miješanja s tradicionalnim simbolom medicine Asklepijevim štapom koji ima samo jednu zmiju, a nema krila."},{"page_url":"https://war.wikipedia.org/wiki/Laur","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Ph_locator_nueva_ecija_laur.png","page_title":"Laur","context_page_description":"An Laur usa nga ika-upat nga klase nga bungto ha lalawigan han Nueva Ecija ha Luzon, ha Pilipinas. Sumala han census han tuig 2000, mayda ini populasyon nga 26,902 ka tawo ha 5,500 nga mga panimalay."},{"page_url":"https://sl.wikipedia.org/wiki/Galakti%C4%8Dna_Republika","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Galactic_Republic.JPG","page_title":"Galaktična Republika","context_page_description":"Galaktična Republika je ime za obliko medplanetarne vlade v znanstveno fantastični triologiji Vojna zvezd.\\nRepublika je trajala 25 000 let in postopoma je postajala šibka, zato so jo spremenili Galaktični imperij. Zgodovina Galaktične Republike obsega kar 10 000 knjižnic."},{"page_url":"https://de.wikipedia.org/wiki/Wurm_(Rur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Sogrothen_1573wurm.jpg","page_title":"Wurm (Rur)","context_page_description":"Die Wurm ist ein 53 Kilometer langer Nebenfluss der Rur in der Euregio Maas-Rhein. Sie ist namensgebend für das ehemalige Wurmrevier, welches einen Teil des Aachener Steinkohlenreviers ausmachte."},{"page_url":"https://pl.wikipedia.org/wiki/Mari_El","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Coat_of_Arms_of_Mari_ASSR.png","page_title":"Mari El","context_page_description":"Mari El; pełna nazwa Republika Mari El – autonomiczna republika w Federacji Rosyjskiej, położona nad środkową Wołgą."},{"page_url":"https://cs.wikipedia.org/wiki/Josef_Gross","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Biskup_Gross_Josef.jpg","page_title":"Josef Gross","context_page_description":"Josef Jindřich Gross byl český katolický duchovní a od roku 1910 až do své smrti 15. biskup litoměřický. Provedl důkladnou opravu litoměřické katedrály."},{"page_url":"https://pt.wikipedia.org/wiki/Thesouro_de_Nobreza","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Fl-_11_Thesouro_de_Nobreza%2C_Armas_das_Cidades.jpg","page_title":"Thesouro de Nobreza","context_page_description":"O Thesouro de Nobreza é um manuscrito datado de 1675, quando durante o reinado de D. Afonso VI, vigésimo segundo rei de Portugal, governava como Príncipe Regente o seu irmão, o futuro D. Pedro II.\\nA obra é um armorial, isto é, uma colectânea de armas heráldicas, e foi executada por Francisco Coelho, Rei de Armas Índia, conforme se pode ler na folha de rosto."},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%A9corations_militaires_interarm%C3%A9es_am%C3%A9ricaines","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Medalsofhonor.jpg","page_title":"Décorations militaires interarmées américaines","context_page_description":"Les décorations interarmées américaines sont des récompenses et des décorations qui sont attribuées par les forces armées des États-Unis aux membres de ses cinq branches. Ces médailles sont considérées comme « inter service » et attribuées selon les mêmes critères pour les différentes composantes de l'armée.\\nLa première médaille interarmée à être créée est la World War I Victory Medal, suivie par la Purple Heart et la Silver Star, créée en 1932 par un ordre général du Département de l'armée des États-Unis. En 1942, l'United States Navy a consent à que ces deux décorations soient décernées aux forces de la Marine et du corps des marines. Avant cette date, plusieurs décorations maintenant obsolètes étaient décernées à l'Armée et à la Marine, mais dans différentes versions pour chacun des services. La « World War I Victory Medal », la « Silver Star » et la Purple Heart sont les premières médailles à être indépendantes du service qui les décerne.\\nLes médailles interservices, créées par la suite, sont la Legion of Merit et l'Air Medal."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B4%D8%B7%D8%A9_%D8%AF%D9%86%D8%AF%D8%B1%D9%88%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Monstera_deliciosa_fruit.JPG","page_title":"قشطة دندروم","context_page_description":"قشطة دندروم، هو نبات ينتمي إلى قلقاسية."},{"page_url":"https://es.wikipedia.org/wiki/Prymors%27ke_(Rai%C3%B3n_de_Kiliya)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Prymorskoe_church_skyline.jpg","page_title":"Prymors'ke (Raión de Kiliya)","context_page_description":"Prymors'ke es una localidad del Raión de Kiliya en el Óblast de Odesa de Ucrania. Según el censo de 2001, tiene una población de 1895 habitantes."},{"page_url":"https://de.wikipedia.org/wiki/Totentempel_des_Ramses_III.","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Medinet_Habu_Ramses_III._Tempel_16a.JPG","page_title":"Totentempel des Ramses III.","context_page_description":"Der Totentempel des Ramses III. ist ein im 12. Jahrhundert v. Chr. durch König Ramses III. im altägyptischen Ort Tahut, heute Medînet Hâbu, errichtetes Millionenjahrhaus, ein vor allem der gottähnlichen Erhebung des Königs dienender Kultbau. Die Tempelruine befindet sich innerhalb einer nicht mehr vollständig erhaltenen Umfassungsmauer eines Tempelkomplexes, zu dem neben dem Haupttempel Ramses’ III. noch ein Amun-Tempel, die Grabkapellen der Gottesgemahlinnen des Amun aus der 23. bis 26. Dynastie und ein Heiliger See gehörten. Das in weiten Teilen gut erhaltene Gebäude des Haupttempels auf einer Grundfläche von über 7000 m² ist unter anderem bekannt durch die Reliefdarstellungen des Sieges Ramses’ III. über die Seevölker zu Beginn des 12. Jahrhunderts v. Chr."},{"page_url":"https://it.wikipedia.org/wiki/Autobus_Atac_turistici_e_sperimentali_(1928-1945)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Autobus_atac_turistico_1.jpg","page_title":"Autobus Atac turistici e sperimentali (1928-1945)","context_page_description":"I veicoli sperimentali del periodo 1928-1945 della rete di Roma sono stati un gruppo di 31 motrici e 3 rimorchi automobilistici adibiti al servizio urbano ed extraurbano della città."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A3%E9%9B%85%E5%85%8B_(%E4%B8%8A%E6%99%AE%E7%BD%97%E6%97%BA%E6%96%AF%E9%98%BF%E5%B0%94%E5%8D%91%E6%96%AF%E7%9C%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Map_commune_FR_insee_code_04180.png","page_title":"圣雅克 (上普罗旺斯阿尔卑斯省)","context_page_description":"圣雅克是法国上普罗旺斯阿尔卑斯省的一个市镇，属于迪涅莱班区。该市镇的总面积为4.66平方公里，2009年时的人口为78人。"},{"page_url":"https://nl.wikipedia.org/wiki/RAF_Tangmere","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Military_Aviation_Museum-Tangmere_-_geograph.org.uk_-_1729366.jpg","page_title":"RAF Tangmere","context_page_description":"RAF Tangmere is een voormalig militair vliegveld bij Tangmere, nabij Chichester in West Sussex. De luchtmachtbasis speelde een belangrijke role in de Slag om Engeland in 1940.\\nIn het Tangmere Military Aviation Museum staan in twee hangars en in de openlucht staan verschillende vliegtuigen, waaronder de Gloster Meteor waarmee Teddy Donaldson in 1946 voor het eerst sneller dan 1000 km per uur vloog, en de Hawker Hunter waarmee Neville Duke in 1953 het snelheidsrecord van 1170 km per uur vloog."},{"page_url":"https://it.wikipedia.org/wiki/Giuliano_Palma_%26_the_Bluebeaters","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Giuliano_palma2_%28live%29.jpg","page_title":"Giuliano Palma & the Bluebeaters","context_page_description":"Giuliano Palma & the Bluebeaters sono un stati gruppo musicale italiano attivo dal 1994 al 2012 fino all'abbandono del cantante Giuliano Palma.\\nThe Bluebeaters si sono riformati nel 2013 riunendo alcuni dei membri del precedente gruppo e con Patrick \\"Pat Cosmo\\" Benifei come nuovo frontman e cantante.\\nLa principale caratteristica di entrambi i gruppi è quella di essere composti da musicisti provenienti da altre realtà della scena musicale italiana ed allo stesso tempo di essere una cover band che reinterpreta in chiave ska e rocksteady famosi brani reggae, rock e pop italiani e internazionali. Tra i numerosi brani si ricordano infatti Messico e nuvole di Paolo Conte, portata al successo da Enzo Jannacci, Jealous Guy di John Lennon, Che cosa c'è di Gino Paoli, Over My Shoulder di Mike + The Mechanics, Tutta mia la città degli Equipe 84, Testarda io di Cristiano Malgioglio portata al successo da Iva Zanicchi, State of the Nation degli Industry, Pensiero d'amore di Mal dei Primitives e nel 2009, Per una lira di Lucio Battisti."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_uit_Tegelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Koningin_Beatrix_brengt_bezoek_aan_Eerste_Kamer_%2C_4_en_Kamervoorzitter_Thurlings_%2C_Koningin_Beatrix_en_Prins_Claus%2C_Bestanddeelnr_931-4206.jpg","page_title":"Lijst van personen uit Tegelen","context_page_description":"De alfabetische lijst van personen uit Tegelen bevat mensen die in deze Limburgse plaats zijn geboren.\\nMenke Koos van der Beek, verzetsstrijder\\nHuub Beurskens, schrijver\\nCarla Beurskens, atlete\\nGuido Beurskens, voetballer\\nJac Bongaerts, kunstenaar\\nHans Coort, voetballer\\nNicolas Dings, beeldhouwer\\nDaan Doesborgh, dichter\\nDries Engelen, beeldhouwer en keramist\\nGeert van Eijk, hockeyer\\nCaspar Franssen, architect\\nRonald Goedemondt, cabaretier\\nPatricia de Groot, schrijfster\\nHanneke Hendrix, schrijfster\\nAndré van den Heuvel, acteur\\nBernard Hofstede, voetballer\\nJos Hol, zanger\\nChantal Janzen, musicalster en presentatrice\\nChip Jones, basketballer\\nPiet Killaars, beeldhouwer\\nMarion Koopmans, hoogleraar virologie\\nDries Kreijkamp, kunstenaar\\nPieter Kuijpers, filmregisseur\\nTed Noten, sieradenontwerper\\nJos Oehlen, beeldhouwer\\nHarry Opheij, politicus\\nPiet Peters, kunstenaar\\nNiek Pas, historicus\\nTies Poeth, beeldend kunstenaar\\nFrans Pollux, zanger\\nMike Roelofs, jazzmuzikant\\nPiet Schroemges, voetballer\\nFrans Simons, bisschop\\nJeu Sprengers, voorzitter KNVB\\nHuub Stapel, acteur\\nHarry Storms, beeldhouwer\\nFrans Swinkels, voetballer\\nTheo Thurlings, politicus\\nBen Verbong, filmregisseur"},{"page_url":"https://eu.wikipedia.org/wiki/Funkley_(Minnesota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Funkley%2C_Minnesota_Road_Sign.jpeg","page_title":"Funkley (Minnesota)","context_page_description":"Funkley Minnesotako hiri bat da. Beltrami konderrian kokatua dago. 2010ean 5 biztanle zituen, 1,55 kilometro koadrotan banatuta."},{"page_url":"https://tr.wikipedia.org/wiki/Abraham_Lincoln","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Lincoln-as-a-boy-reading-at-night.jpeg","page_title":"Abraham Lincoln","context_page_description":"Abraham Lincoln, Amerikalı siyasetçi, devlet başkanı, hukukçu.\\nAmerika Birleşik Devletleri'nin 16. başkanı ve Cumhuriyetçi Parti'nin ilk başkanıdır. Lincoln, Amerikan İç Savaşı'nda Amerika Konfedere Devletleri'ne karşı büyük bir galibiyet elde etti. Ülkenin birliğini korudu ve köleliği bitirdi. 1860 Başkanlık Seçimleri'nden önce savcılık, Illinois Temsilciler Meclisi üyeliği ve bir dönemde ABD Temsilciler Meclisi üyeliği yapmıştır. İki kez de ABD Senatosu'na girmek için adaylığını koymuştur fakat başarısız olmuştur. Lincoln ABD'de köleliğe karşı olduğunu resmen dile getirdi. 1860 yılında Başkanlık için resmen adaylığını koydu. Ertesi yıl oyların büyük çoğunluğunu alarak Cumhuriyetçi Parti'nin ilk başkanı oldu. 1863 yılında köleliğin kaldırılması için gerekenleri ve tedbirler konusunda önlemleri belirtti. Ardından Serbest Bırakma Beyannamesi ve On Üçüncü Yasa değişikliği bildirilince Haziran 1863 tarihinde ABD'den kölelik resmen kalkmış oldu. Lincoln, suikast sonucu ölen ilk ABD başkanı oldu. Tarihsel değerlendirmelerde en iyi Amerika Birleşik Devletleri başkanları'ndan biri olarak kabul edilir."},{"page_url":"https://de.wikipedia.org/wiki/NS-Sonderstandesamt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/JuliuszZielinski-KLDachau-Sterbeurkunde.jpg","page_title":"NS-Sonderstandesamt","context_page_description":"Ein NS-Sonderstandesamt war ein Standesamt, das für spezielle Zwecke in der NS-Zeit geschaffen wurde. Meist kümmerte es sich um die standesamtliche Abwicklung von Todesfällen. Als Namensanhang trugen sie meist die „II“."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BF%D1%81%D0%B0%D0%B4%D0%B0_%D0%9B%D0%BE%D0%B7%D0%BD%D0%B8%D1%86%D0%B5_(1813)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Petar_Nikolajevi%C4%87_Moler1.jpg","page_title":"Опсада Лознице (1813)","context_page_description":"Опсада Лознице (1813) је једна од битака која је означила слом Првог српског устанка."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D9%87%D9%88%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Jewry-ar.PNG","page_title":"يهود","context_page_description":"اليهود هم أبناء شعب أو قومية دينية أو أمة، يتميزون بأتباع الدين اليهودي، أو بالثقافة والتراث النابعة من هذا الدين. يعدّ اليهود العصريين أنفسهم من نسل أهالي مملكة يهوذا الذين كانوا ينسبون إلى أربعة من بين أسباط بني إسرائيل الإثني عشر: يهوذا، سمعون، بنيامين ولاوي، افترقوا بعد سبي بابل إلى يهود وإلى سامريين. الديانة مرت بتطورات كثيرة عبر التاريخ وخاصة بعد انهيار مملكة يهوذا ودمار الهيكل الثاني في القرن الأول للميلاد.\\nنشأ اليهود كمجموعة عرقية ودينية في الشرق الأوسط خلال الألفية الثانية قبل الميلاد، في جزء من بلاد الشام المعروفة بإسم أرض إسرائيل في الأدبيات اليهودية. ومنذ القرن الثاني للميلاد أخذ اليهود ينتشرون في أنحاء العالم حيث توجد معلومات عن جاليات يهودية في بلدان كثيرة عبر التاريخ، منذ منتصف القرن ال20 يتركز اليهود في إسرائيل وأمريكا الشمالية مع وجود جاليات أصغر في أوروبا، أمريكا الجنوبية وإيران. في عام 2010 شكل اليهود حوالي 14 مليون نسمة أي ما يعادل 0.2% من سكان العالم. ويعيش 41% من يهود العالم في الولايات المتحدة، في حين أنّ إسرائيل هي موطن لحوالي 40.5% من مجمل يهود العالم، ويعيش حوالي 13.3% من يهود العالم في كندا، وفرنسا، والمملكة المتحدة، وألمانيا، وروسيا، والأرجنتين، وأستراليا والبرازيل."},{"page_url":"https://de.wikipedia.org/wiki/Higer_Bus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Higer.jpg","page_title":"Higer Bus","context_page_description":"HIGER BUS Company Ltd. ist ein chinesischer Hersteller von Reise-, Stadt- und Kleinbussen sowie Pick-ups. Das erst 1998 gegründete Unternehmen gehört zum King Long-Konzern und hat eine jährliche Produktionskapazität von 35.000 Bussen."},{"page_url":"https://fr.wikipedia.org/wiki/Casariche","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Casariche_%28Sevilla%29.PNG","page_title":"Casariche","context_page_description":"Casariche est une commune située dans la province de Séville de la communauté autonome d’Andalousie en Espagne."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_landaanwinningsprojecten","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/North_view_from_the_Castle_of_Good_Hope%2C_Cape_Town_3.JPG","page_title":"Lijst van landaanwinningsprojecten","context_page_description":"In deze lijst van landaanwinningsprojecten zijn per werelddeel en land de landwinningsprojecten weergegeven."},{"page_url":"https://lt.wikipedia.org/wiki/Gvadalup%C4%97s_mergel%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Guadalupe_3_hands.jpg","page_title":"Gvadalupės mergelė","context_page_description":"Gvadalupė, Gvadalupės Mergelė – tai XVI amžiaus Marijos paveikslas, esantis Gvadalupės bazilikoje šiaurės Meksiko mieste. Tai pats populiariausias Meksikos katalikų atvaizdas, tapęs Meksikos religiniu ir kultūriniu simboliu. Gvadalupės Mergelės bazilika yra lankomiausia pasaulyje katalikų šventovė ir trečia pagal lankomumą iš visų pasaulio šventų vietų.\\nVisgi šis Marijos apsireiškimas ir paveikslas sulaukė daug prieštaringų nuomonių. Netgi daugelis dvasininkų tam tikru metu dėl įvairių priežasčių priešinosi pamaldumui į Gvadalupės Mergelę Mariją. 1999 m. buvęs Gvadalupės bazilikos kuratorius monsinjoras Guillermo Schulemburg laiške Vatikano Šventųjų skelbimo kongregacijai abejojo Chuano Diego istoriškumu ir prieštaravo planams jį paskelbti šventuoju, pavadindamas jį veikiau \\"simboliu, o ne realybe\\" ir kad jo kanonizacija būtų \\"kulto pripažinimas, o ne fizinio, realaus asmens egzistavimo pripažinimas.\\"\\n2002 m. liepos 31 d. Vatikanas po atlikto tyrimo pripažino Chuaną Diegą istorine asmenybe ir paskelbė jį šventuoju.\\nPasak religinių pasakojimų 1531 m. tarp gruodžio 9 ir 12 d."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%82%E8%B0%B7%E5%85%AB%E5%B9%A1%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Ichigaya-hachimancho.jpg","page_title":"市谷八幡町","context_page_description":"市谷八幡町是東京都新宿區的町名。未實施住居表示。2013年8月1日為止的人口有110人。郵遞區號為162-0844。"},{"page_url":"https://it.wikipedia.org/wiki/F%C3%A4llanden","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Karte_Gemeinde_F%C3%A4llanden_2007.png","page_title":"Fällanden","context_page_description":"Fällanden è un comune svizzero di 8 417 abitanti del Canton Zurigo, nel distretto di Uster."},{"page_url":"https://en.wikipedia.org/wiki/Ultrasound","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/CRL_Crown_rump_length_12_weeks_ecografia_Dr._Wolfgang_Moroder.jpg","page_title":"Ultrasound","context_page_description":"Ultrasound is sound waves with frequencies higher than the upper audible limit of human hearing. Ultrasound is not different from \\"normal\\" sound in its physical properties, except that humans cannot hear it. This limit varies from person to person and is approximately 20 kilohertz in healthy young adults. Ultrasound devices operate with frequencies from 20 kHz up to several gigahertz.\\nUltrasound is used in many different fields. Ultrasonic devices are used to detect objects and measure distances. Ultrasound imaging or sonography is often used in medicine. In the nondestructive testing of products and structures, ultrasound is used to detect invisible flaws. Industrially, ultrasound is used for cleaning, mixing, and accelerating chemical processes. Animals such as bats and porpoises use ultrasound for locating prey and obstacles."},{"page_url":"https://en.wikipedia.org/wiki/Mts_(Telekom_Srbija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Telekom_Srbija_%28TKC%29.jpg","page_title":"Mts (Telekom Srbija)","context_page_description":"Mts, doing business as Telekom Srbija a.d. Beograd, is a Serbian telecommunications company headquartered in Belgrade. The company offers a range of fixed-line, mobile, and internet communication services in Serbia, Bosnia and Herzegovina, Montenegro, Kosovo and Austria. In April 2015, Telekom Srbija started providing all services in Serbia under the mts brand."},{"page_url":"https://fi.wikipedia.org/wiki/Aquileia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/AquileiaSabucco.jpg","page_title":"Aquileia","context_page_description":"Aquileia on Italian kunta Friuli-Venezia Giulian autonomisella alueella Udinen maakunnassa kymmenisen kilometriä Adrianmeren rannalta. Kunnassa on arviolta 3 359 asukasta ja sen pinta-ala on 36,83 neliökilometriä.\\nAquileia oli muinaisten roomalaisten perustama kaupunki. Siellä uskotaan olevan runsaasti arkeologisia kohteita roomalaisajalta, mutta kaikkia niistä ei ole vielä kaivettu esiin. Keskusaukio, joenvarteen tehty satama ja asuintaloja on selvästi nähtävissä. Kaupungissa on myös uudempaa historiaa, ja sen arkeologiset kohteet sekä tuomiokirkko muodostavat UNESCOn maailmanperintökohteen.\\nAquileian katedraali on alun perin tasakattoinen basilika vuodelta 1031. Vuoden 1379 paikkeilla se uudistettiin goottilaiseen tyyliin. Kirkossa on vaikuttava mosaiikkilattia. Aquileian hiippakunnalla oli keskiajan alussa tärkeä rooli, kun kristinuskoa levitettiin itäiseen Keski-Eurooppaan."},{"page_url":"https://it.wikipedia.org/wiki/Bandar-e_Deylam","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Bushehr_-_Bandar_Deylam_%28Always_Persian_Gulf%29_-_panoramio_%281%29.jpg","page_title":"Bandar-e Deylam","context_page_description":"Bandar-e Deylam è una città portuale, capoluogo dello shahrestān di Deylam, circoscrizione Centrale, nella provincia di Bushehr."},{"page_url":"https://vec.wikipedia.org/wiki/Climbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Climbach-Ecole-Mairie-02-gje.jpg","page_title":"Climbach","context_page_description":"Climbach el xé on comun de 440 abitanti del departemento de Bas-Rhin che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A6%B0%EB%93%A0_B._%EC%A1%B4%EC%8A%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/JFK_Griffith_Stadium_1961.jpg","page_title":"린든 B. 존슨","context_page_description":"린든 베인스 존슨은 미국의 36대 대통령이다. 그는 별명인 LBJ로 알려졌다. 베트남 전쟁과 관련된 국외정책은 실패한 것으로 여겨지나, 인권향상을 비롯한 국내정책은 성공적이었다고 평가받는다. 신장 192cm로 미국 역대대통령 중에 2번째로 키가 크다.\\n민주당 대통령 후보 경선에서 케네디 후보에게 패배하였으나 케네디 정부의 부통령이 되었다. 그러던 1963년 대통령으로 재임하던 케네디가 피살되자 제36대 대통령직을 승계했으며, 1964년 선거에서 공화당의 배리 골드워터 후보를 꺾고 재선되었다.\\n그는 '위대한 사회' 건설을 주장하여 교육, 주택과 도시 개발, 교통, 환경보호주의, 이민 정책의 의안 제출권에 책임을 맡았으나, 베트남 전쟁에서는 사태의 심각화를 초래하였다. 또한 남부 출신의 지도자로서 흑인에 대한 차별을 없애야 한다고 주장하며, 인권운동 결의서를 세웠다. 1965년에는 흑인들이 투표할 권리를 얻을 법안을 청하여 투표권법을 승인시켰다.\\n하지만 베트남 전쟁이 장기화 되면서 국내에서 반전 운동이 일어나 인기를 잃게 되자, 1968년 두 번 이상 대통령 선거에 출마하지 않겠다는 발표를 하여 이듬해 임기 종료와 함께 퇴임했다."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E3%83%88%E3%83%A9%E3%83%B3%E3%82%B9%E3%82%AA%E3%83%BC%E3%82%B7%E3%83%A3%E3%83%B3%E8%88%AA%E7%A9%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Southwest_Air_Lines_NAMC_YS-11A-213_%28JA8775_2158%29_%289482825511%29.jpg","page_title":"日本トランスオーシャン航空","context_page_description":"日本トランスオーシャン航空株式会社は、日本の航空会社である。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%9C%D7%94_%D7%90%D7%99%D7%95%D7%95%D7%90%D7%A0%D7%99-%D7%92%D7%A8%D7%99%D7%A0%D7%95%D7%95%D7%9C%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Iwanyi_Grunwald_Bela_TVL_1906_marc_18_Nr12..jpg","page_title":"בלה איוואני-גרינוולד","context_page_description":"בלה איוואניי-גרינוולד היה צייר יהודי-הונגרי ידוע."},{"page_url":"https://de.wikipedia.org/wiki/Ardusat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Catedrala_Ortodoxa_Ardusat.jpg","page_title":"Ardusat","context_page_description":"Ardusat ist eine Gemeinde im Kreis Maramureș im Norden Rumäniens. Zu der Gemeinde Ardusat gehören auch die Dörfer Arieșu de Câmp und Colțirea."},{"page_url":"https://ast.wikipedia.org/wiki/A._J._P._Taylor","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Birkdale_village_centre.JPG","page_title":"A. J. P. Taylor","context_page_description":"Alan John Percivale \\"A. J. P.\\" Taylor, FBA foi un historiador, periodista y escritor inglés especializáu na diplomacia europea de los sieglos XIX y XX. Tantu como periodista y como llocutor, fíxose bien conocíu por millones de televidentes al traviés de les sos conferencies per televisión. La so combinación de rigor académico y curiosu popular llevó al historiador Richard Overy a describilo como \\"el Macaulay de la nuesa dómina\\"."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D1%8F%D1%80%D1%8D%D1%81%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Miensk%2C_Piarespa%2C_Urevi%C4%8D._%D0%9C%D0%B5%D0%BD%D1%81%D0%BA%2C_%D0%9F%D1%8F%D1%80%D1%8D%D1%81%D0%BF%D0%B0%2C_%D0%A3%D1%80%D1%8D%D0%B2%D1%96%D1%87_%281912%29.jpg","page_title":"Пярэспа","context_page_description":"Пярэ́спа, прадмесце Пярэ́спа — гістарычная мясцовасць Мінска, размешчаная ў паўночнай частцы горада, пры ўтоку ракі Пярэспы ў Свіслач. Месцілася за Старажоўскай заставай, паміж старадаўнімі паштовымі шляхамі на Вільню і Даўгінава. Часам Пярэспу аб’ядноўваюць з суседнім Старажоўскім прадмесцем, якое насамрэч размяшчалася бліжэй да цэнтру горада. У сённяшні час тэрыторыю Пярэспы можна вызначыць як раён на правым беразе Свіслачы, на поўнач ад сучаснай вуліцы Максіма Багдановіча.\\nНа паўднёвым захадзе ад Пярэспы месціцца Людамонт, на паўднёвым усходзе — Старажоўка, на поўдні — Старосцінская Слабада."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%82%D9%88%D8%A7%D8%AA_%D8%A7%D9%84%D9%85%D8%B3%D9%84%D8%AD%D8%A9_%D8%A7%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Royal_Saudi_Air_Force_-Air_Chief_Marshal.png","page_title":"القوات المسلحة السعودية","context_page_description":"'القُوَّات المُسَلَّحَة المَلكِيَّة السُّعُودِيَّة،\\nمنذ نشأتها في منتصف القرن الثاني عشر الهجري المتصلة بإعلان قيام الدولة السعودية في قلب شبه الجزيرة العربية على يد محمد بن سعود، لعبت الجيوش العربية السعودية دورًا حاسمًا في مـد نفوذ الدولة وحدودها، ولأكثر من مرة، ما بين ساحل الخليج العربي شرقًا، إلى ساحل البحر الأحمر غربًا، وامتلاكها لموانئ بحرية، مما مكنها من الاتصال التجاري بالعالم الخارجي، وكانت الحاميات البرية والبحرية، تدخل في عداد الجند الثابت في الوظيفة العسكرية. حيث يتبين أن مفهوم الخدمة العسكرية كان حاضرًا قبل ميلاد القوانين والتوسع الإداري للدولة الحديثة التي تعتبر مرحلة تكوينها، الأهم في تاريخ القوات المسلحة، إِذ قضت أكثر من ثلاثين عامًا في معارك وحروب طاحنة، على أكثر من جبهة. ولقد كانت البداية عبارة عن قطاعات غير منظمة، قليلة التسليح والعتاد، لكنها استطاعت شق طريقها، وقد خرجت برقعة جغرافية شاسعة، فكان أن تأسس سلاح الطيران إلى جانب تنظيم الدائرة العسكرية القائمة منذ أواسط عام 1344ھ في الطائف، ثم أُقيمت الدفاع، فنظمت أطر الجيش العليا، وصهرت فرق المقاتلين في بوتقة عسكرية حديثة.\\nينضوي تحت وصاية وزارة الدفاع كبار المساعدين التنفيذيين وقادة الأركان، والمناطق، والأساطيل، والقواعد، والكليات، إضافةً إلى وكالات وإدارات متنوّعة."},{"page_url":"https://fr.wikipedia.org/wiki/Baptist%C3%A8re_San_Giovanni_de_Volterra","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Battistero_di_San_Giovanni%2C_Volterra-8305.jpg","page_title":"Baptistère San Giovanni de Volterra","context_page_description":"Le baptistère San Giovanni est situé dans le centre historique de Volterra, en face du Duomo, dans la province de Pise, dans le diocèse de Volterra."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%BA%D8%B3%D8%B7%D8%B3_%D9%86._%D8%B3%D8%A7%D9%85%D8%B1%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Augustus_N._Summers_002.png","page_title":"أغسطس ن. سامرز","context_page_description":"أغسطس ن. سامرز ‏ هو قاضي ومحامي أمريكي، ولد في 13 يونيو 1856 في شيلبي في الولايات المتحدة، وتوفي في 19 مايو 1927 في سبرينغفيلد في الولايات المتحدة."},{"page_url":"https://az.wikipedia.org/wiki/Yer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Growing_earth.gif","page_title":"Yer","context_page_description":"Yer — Günəşə yaxınlığına görə Günəş sistemindəki üçüncü planet və həyat aşkar olunan yeganə göy cismidir. Radiometrik tanışlıq və digər dəlillərə görə Yer 4.5 milyard il əvvəl yaranmışdır. Yerin cazibə qüvvəsi kainatdakı digər cisimlərə, xüsusən də Yerin yeganə təbii peyki olan Aya və Günəşə qarşılıqlı təsir göstərir. 365,256 gün ərzində Yer Günəş ətrafında öz orbiti boyu hərəkət edir. Bu müddət ərzində Yer öz oxu ətrafında 365,256 dəfə fırlanır.\\nYerin fırlanma oxunun sabit müstəviyə əyilməsinə görə Yerdə fəsillər yaranır. Yer ilə Ay arasındakı qravitasiya qarşılıqlı əlaqəsi qabarma və çəkilmələrə səbəb olur. Yer Günəş sistemindəki ən sıx planetdir və dörd daxili planetin ən böyüyü və ən ağırıdır.\\nYerin xarici təbəqəsi milyonlarla ildir ki səth boyunca hərəkət edən bir neçə sərt tektonik plitələyə bölünmüşdür. Yer səthinin təxminən 29%-i qitələr və adalardan ibarət torpaqdır. Qalan 71%-i su ilə, əsasən dünya okeanı və eyni zamanda hamısı birlikdə hidrosferi təşkil edən göllər, çaylar və digər təmiz su mənbələri ilə örtülüdür. Yer kürəsinin qütb bölgələrinin əksəriyyəti Antarktida buz təbəqəsi və Arktikanın dəniz buzları da daxil olmaqla buzla örtülmüşdür."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D1%8F%D0%BA_%D0%B7%D0%B5%D0%BB%D0%B5%D0%BD%D0%BE%D0%B2%D0%B0%D1%82%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Echium_virescens0.jpg","page_title":"Синяк зеленоватый","context_page_description":"Синя́к зеленова́тый — травянистое двулетнее растение рода Синяк семейства Бурачниковые."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86_%D0%A5%D0%B0%D1%80%D0%B8%D1%82%D0%BE%D0%BD%D0%B5%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/uk/0/0a/Fasad_majetok_Har.JPG","page_title":"Палац Харитоненка","context_page_description":"Кияни́цький пала́ц — маєток, садиба-палац підприємця і філантропа Івана Герасимовича Харитоненка. Розташований у селищі Кияниці.\\nПалац двоповерховий, з оригінальною триповерховою вежею, прибудованою з тильного боку палацу. Головний фасад прикрашений ризалітом і вхідним портиком."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%B3%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C_(%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/%D0%A1%D0%B5%D0%BB%D0%BE_%D0%91%D0%BE%D0%B3%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C_%D0%9A%D0%B0%D0%B2%D0%B0%D0%BB%D0%B5%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B0.JPG","page_title":"Богополь (Приморский край)","context_page_description":"Богопóль — село Кавалеровского района Приморского края России. Расположено в долине реки Зеркальная, к юго-востоку от Кавалерово. В буквальном переводе Богополь означает «Божий город»."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D0%BB%D1%8C%D1%81%D1%96%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D1%96%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/It%C3%A4keskuksen_metroasema_24022018.jpg","page_title":"Гельсінський метрополітен","context_page_description":"Гельсінський метрополітен — це система метро в Гельсінкі, Фінляндія. Це найпівнічніше метро у світі і досі єдине у Фінляндії. Метро було відкрито для пасажирів 2 серпня 1982 після 27 років планування. Контроль над ним здійснюється організацією Helsinki City Transport — філією Helsinki Regional Transport Authority. Гельсінський метрополітен перевозить 50 мільйонів пасажирів щороку.\\nСистема складається з однієї роздвоєної лінії метро та розміщених на ній 25 станціях. Переважно вона обслуговує тісно побудовані передмістя східної частини Гельсінкі, проте також використовується в центрі міста. Розширення «Ленсіметро» продовжує лінію до західної частини Гельсінкі та до південної частини міста-супутника Еспоо, добратись до якого, на даний момент, можливо лише автобусами.\\nМісцева залізнична мережа, що надає послуги в північному та північно-західному напрямках не перетинається з системою метро, але пасажири можуть пересісти з потяга на потяг на Helsinki Central Railway Station."},{"page_url":"https://cs.wikipedia.org/wiki/Most_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Die_Bruecke_1959.jpg","page_title":"Most (film)","context_page_description":"Most je německý film z roku 1959. Film se odehrává v dubnu 1945, když sedm 16letých chlapců z jedné školy dostane povolávací rozkaz. Jelikož šlo vlastně ještě o děti a jejich učitel vysvětlil jejich veliteli, že by nedokázali na frontě přežít, dostali za úkol chránit most ve městě, kde žijí. Nakonec po bitvě s třemi americkými tanky, americkou pěchotou a po přestřelce s vlastními ženisty zůstane naživu jen jeden."},{"page_url":"https://it.wikipedia.org/wiki/McDonnell_Douglas_F-15E_Strike_Eagle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Afghanistan_Flyover%2C_F-15E_from_391st_Expeditionary_Fighter_Squadron_deploys_flares_during_a_flight_over_Afghanistan%2C_Nov._12%2C_2008.jpg","page_title":"McDonnell Douglas F-15E Strike Eagle","context_page_description":"Il McDonnell Douglas F-15E Strike Eagle è un cacciabombardiere biposto sviluppato a partire dall'F-15 Eagle e prodotto, sul finire degli anni ottanta, dall'azienda statunitense McDonnell Douglas.\\nProgettato per svolgere compiti d'interdizione aerea ed attacco al suolo, ha effettuato il suo primo volo l'11 dicembre 1986 entrando in servizio nell'USAF nel 1989. Utilizzato in tutti i conflitti a partire dalla prima Guerra del Golfo nel 1990, è in grado di operare autonomamente in territorio ostile; sostituisce, nelle file dell'United States Air Force, l'F-111 Aardvark."},{"page_url":"https://da.wikipedia.org/wiki/Hans_Adam_2._af_Liechtenstein","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Hans-Adam_II_von_und_zu_Liechtenstein.jpg","page_title":"Hans Adam 2. af Liechtenstein","context_page_description":"Fyrst Hans Adam 2. af og til Liechtenstein er den nuværende fyrste af Liechtenstein. Han tiltrådte ved sin fader, fyrst Franz Josef 2.'s død i 1989. Han er gift med fyrstinde Marie, med hvem han har fire børn. Siden 2004 har han overladt regeringen af landet til sin ældste søn, arveprins Alois, som prinsregent."},{"page_url":"https://fr.wikipedia.org/wiki/Lh%C3%B4pital","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/%C3%89glise_St_Jean_Baptiste_Lh%C3%B4pital_1.jpg","page_title":"Lhôpital","context_page_description":"Lhôpital est une ancienne commune française située dans le département de l'Ain en région Auvergne-Rhône-Alpes. Le 1ᵉʳ janvier 2019, elle devient commune déléguée et chef-lieu de Surjoux-Lhopital."},{"page_url":"https://af.wikipedia.org/wiki/Elizabeth_Taylor","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Taylor-Burton-Sandpiper.jpg","page_title":"Elizabeth Taylor","context_page_description":"Dame Elizabeth Rosemond Taylor, ook bekend as Liz Taylor, was ’n Engels-Amerikaanse aktrise, sakevrou en filantroop. Sy het haar loopbaan as aktrise in die vroeë 1940's begin en was een van die gewildste sterre van die klassieke Hollywood van die 1950's. Sy het tot in die 1960's ’n suksesvolle loopbaan gehad en vir die res van haar lewe ’n bekende openbare figuur gebly. In 1999 het die Amerikaanse Rolprentinstituut haar as die sewende grootste vroulike silwerdoeklegende van die klassieke Hollywood aangewys.\\nTaylor is in Londen gebore as die dogter van ryk, vooraanstaande Amerikaanse ouers. Die gesin het in 1939 teruggetrek na Los Angeles en sy het gou ’n kontrak by Universal Pictures gekry. Haar eerste fliekrol in 1942 was klein en haar kontrak is nie hernu nie. Sy het daarna by Metro-Goldwyn-Mayer aangesluit en haar deurbraak in National Velvet gemaak. Sy was een van die ateljee se gewildste tienersterre en het in die vroeë 1950's volwasse rolle begin vertolk. Die eerste was in die komedie Father of the Bride, en sy het goeie resensies gekry vir haar spel in die drama A Place in the Sun."},{"page_url":"https://hu.wikipedia.org/wiki/Nyitvaterm%C5%91k","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Cycas_platyphylla_Female_cone_1.jpg","page_title":"Nyitvatermők","context_page_description":"A nyitvatermők a virágos növények vagy magvas növények egyik nagy csoportja. A nyitvatermőket a legutóbbi időkig egységes törzsnek tartották, a legújabb genetikai alapú osztályozások azonban nem használják többé rendszertani kategóriaként, mivel a kihalt fajokat is figyelembe véve parafiletikus lenne. A nyitvatermőket jelenleg négy monofiletikus törzsbe sorolja. A nyitvatermők mintegy 300 millió évvel ezelőtt terjedtek el a Földön. Az osztályozás komoly problémája, hogy a „virágos növény” fogalom nem kellőképp tisztázott. Az angolszász botanikai irodalom a zárvatermőket tekinti virágos növények, nyitvatermőket nem. Ebben a felosztásban a magvaspáfrányok a nyitvatermőkével egyenrangú önálló főtörzs. Mi az alábbiakban a Magyarországon uralkodó felosztást követjük.\\nA törzs nevét onnan kapta, hogy a két magkezdemény szabadon fejlődik a termőlevelek tövében."},{"page_url":"https://fr.wikipedia.org/wiki/Fou_austral","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Cape_Kidnappers_Gannet_Colony.jpg","page_title":"Fou austral","context_page_description":"Le Fou austral est une espèce d'oiseaux marins de la famille des Sulidae."},{"page_url":"https://de.wikipedia.org/wiki/Erzbistum_Lecce","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Provincia_ecclesiastica_di_Lecce.png","page_title":"Erzbistum Lecce","context_page_description":"Das Erzbistum Lecce ist eine in Italien gelegene römisch-katholische Erzdiözese mit Sitz in Lecce."},{"page_url":"https://vec.wikipedia.org/wiki/Luigi_Pirandello","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Luigi_Pirandello_1934.jpg","page_title":"Luigi Pirandello","context_page_description":"Luigi Pirandello xe stà un scritor, dramaturgo e poeta itałian.\\nEl drama Sei personaggi in cerca d'autore, publicà 'ntel 1921, el gà dato fama mondiałe e in tel 1934 ricevù el premio Nobel.\\nWikimedia Commons el detien imàjini o altri file so Luigi Pirandello"},{"page_url":"https://pt.wikipedia.org/wiki/Af%C3%ADdio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Aphid-giving-birth.jpg","page_title":"Afídio","context_page_description":"Os afídios, afídeos, pulgões ou piolhos-das-plantas são insetos diminutos que se alimentam da seiva de plantas, da superfamília dos afidoídeos, ou Aphidoidea na divisão Homoptera da ordem dos Hemiptera. Cerca de 250 espécies constituem sérias pragas para a agricultura, floresta e jardinagem ao sugarem a seiva das plantas e servindo como vetor de transmissão de vírus.\\nA joaninha é um dos seus principais predadores. Existem por todo o mundo, embora a maioria prefira as regiões temperadas.\\nSão mais frequentes em regiões temperadas, onde também existem maior diversidade de espécies, ao contrário do que acontece com outros grupos taxonómicos de seres, que costumam apresentar maior biodiversidade em zonas tropicais. Podem migrar por grandes distâncias, principalmente através de dispersão passiva, levados pelo vento. Por exemplo, acredita-se que o piolho-da-alface ter-se-á dispersado a partir da Nova Zelândia para a Tasmânia desta forma. A sua dispersão a nível global deve-se também ao transporte, por parte de humanos, de materiais vegetais infectados."},{"page_url":"https://fi.wikipedia.org/wiki/Suomalainen_oopperamusiikki","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Emmy_achte.jpg","page_title":"Suomalainen oopperamusiikki","context_page_description":"Suomalaisen oopperamusiikin alku sijoittuu 1700-luvun loppupuolelle, jolloin maassa järjestettiin ensimmäiset oopperaesitykset. Varsinaisesti kiinnostus taidemuotoon heräsi kuitenkin vasta 1800-luvun jälkipuoliskolla. Ensimmäinen suomalainen oopperateos on Fredrik Paciuksen Sakari Topeliuksen librettoon säveltämä Kaarle-kuninkaan metsästys vuodelta 1852.\\nSuomalainen oopperataide alkoi 1970-luvulla saavuttaa kansainvälistä mainetta ennen kaikkea Joonas Kokkosen ja Aulis Sallisen niin kutsutuilla karvalakkioopperoilla kuten Punainen viiva ja Viimeiset kiusaukset. Suomen nousuun yhdeksi maailman johtavista oopperamaista vaikuttivat myös Savonlinnan oopperajuhlat ja monien suomalaisten laulajien kuten Martti Talvelan ja myöhemmin esimerkiksi Karita Mattilan ja Soile Isokosken saavuttama kansainvälinen maine.\\nVuonna 2000 Suomessa sai kantaesityksen yhteensä neljätoista oopperaa, jota voidaan pitää kansainvälisessä vertailussa ainutkertaisena määränä."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%AA%E3%83%BC%E3%83%BB%E3%82%AB%E3%83%AB%E3%83%9B%E3%83%BC%E3%83%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Rory_Calhoun_-_1961.jpg","page_title":"ロリー・カルホーン","context_page_description":"ロリー・カルホーンは、アメリカ合衆国の俳優。\\nロサンゼルス生まれ。幼少期は同じカリフォルニア州のサンタクルーズで送った。スコッチ・アイリッシュとスペイン人の血を引く。\\n主に西部劇映画の二枚目スターとして活躍、テレビの西部劇“The Texan”にも主演した。\\n1999年4月28日、肺気腫と糖尿病の合併症により死去、76歳。"},{"page_url":"https://lmo.wikipedia.org/wiki/Rio_Negro_(Amazonia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Negroamazonrivermap.png","page_title":"Rio Negro (Amazonia)","context_page_description":"El Rio Negro l'è on fium de l'America del Sud, in del basin amazzonegh. Cont ona lunghezza de 2250 km, a l'è l'affluent de manzina pussee longh del Rio di Amazzon e quell de cinquantun intra i fium pussee longh de la Terra. A l'è el segond fium del mond per volum d'acqua, domà dree del Rio di Amazzon.\\nEl nass in del dipartiment de Guainía in Colombia cont el nomm de Rio Guainía e 'l traversa di territori indigen in del nordest del paes, e el fa su on tocch de la frontera intra Colombia e Venezuela. Denanz de entrà in del staa brasilian de Amazonas, el ciappa el nomm de Rio Negro de la confluenza cont el canal de Casiquiare, connession naturala intra el basin amazzonegh e quell del fium Orinoco. I sò affluent prinzipaj a hinn el rio Vaupés e el rio Branco.\\nEl bagna la cittàa de Manaus, la pussee granda de l'Amazzonia, dove el va a finì in del Rio di Amazzon, ciamaa finn a chì Rio Solimões segond la nomencladura doperada in del Brasil.\\nEl Rio Negro a l'è staa e l'è anmò vun intra i fium pussee important del Brasil settentrional."},{"page_url":"https://en.wikipedia.org/wiki/History_of_New_Zealand","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Australian_ogre_1900.jpg","page_title":"History of New Zealand","context_page_description":"The history of New Zealand dates back approximately 700 years to when it was discovered and settled by Polynesians, who developed a distinct Māori culture. Like other Pacific cultures, Māori society was centred on kinship links and connection with the land but, unlike them, it was adapted to a cool, temperate environment rather than a warm, tropical one.\\nThe first European explorer known to sight New Zealand was Dutch navigator Abel Tasman on 13 December 1642. In 1643 he charted the west coast of the North Island, his expedition then sailed back to Batavia without setting foot on New Zealand soil. British explorer James Cook, who reached New Zealand in October 1769 on the first of his three voyages, was the first European to circumnavigate and map New Zealand. From the late 18th century, the country was regularly visited by explorers and other sailors, missionaries, traders and adventurers.\\nIn 1840 the Treaty of Waitangi was signed between representatives of the United Kingdom and various Māori chiefs, bringing New Zealand into the British Empire and giving Māori the same rights as British subjects."},{"page_url":"https://sh.wikipedia.org/wiki/Ubihi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Circassia_in_1750.png","page_title":"Ubihi","context_page_description":"Ubihi su bili narod koji je živio na zapadnom Kavkazu i govorio ubiški jezik. Putopisac Evlija Čelebija ih je spomenuo u svojoj knjizi 1667.\\nUbihi su bili nomadi i vješti konjanici, te je njihov jezik imao vrlo fin vokabular koji je pokrivao putovanja i konje.\\nStekli su značajnost 1864. nakon što je Rusko Carstvo u kavkaskom ratu izvršilo invaziju i osvojilo tu regiju Kavkaza u sklopu teritorijalnog ekspanzionizma. Adidži i Abhazi su ubijani i protjerani, dok je pokrenut masovni egzodus Čerkeza i Ubiha prema današnoj Turskoj. Točan broj Ubiha u tom razdoblju nije poznat, no prema procjenama je otišlo 95.000 Abhaza i Ubiha iz te regije. Prema drugim procjenama, oko 50.000 Ubiha je protjerano iz Kavkaza.\\nKako bi izbjegli diskriminaciju u novoj zemlji, starješine Ubiha su ohrabrivali svoje ljude da se asimiliraju u tursku kulturu. Tako su napustili svoju nomadsku kulturu i tradiciju i postali farmeri. Ubiški jezik je masovno padao u zaborav. Posljednji govornik tog jezika, Tevfik Esenç, umro je 1992. sa 88 godina.\\nDanas nema ljudi koji govore ubiškim kao materinskim jeizkom. Jedino šačica lingvista može komunicirati ubiškim."},{"page_url":"https://pl.wikipedia.org/wiki/Castrill%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Aytocastrillon.jpg","page_title":"Castrillón","context_page_description":"Castrillón – gmina w Hiszpanii, w prowincji Asturia, w Asturii, o powierzchni 55,34 km². W 2011 roku gmina liczyła 22 950 mieszkańców."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%AC%CF%80%CE%B1%CF%82_%CE%99%CE%BD%CE%BD%CE%BF%CE%BA%CE%AD%CE%BD%CF%84%CE%B9%CE%BF%CF%82_%CE%94%CE%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Innocent_IV_-_Council_of_Lyon_-_002r_detail.jpg","page_title":"Πάπας Ιννοκέντιος Δ΄","context_page_description":"Ο Ιννοκέντιος Δ΄ ήταν Πάπας της Ρώμης, διαδέχτηκε τον πάπα Κελεστίνο τον Δ'. Ανήκε σε ευγενή οικογένεια της Λιγουρίας, τους Φιέσκι, κόμητες της Λαβάνια.\\nΣτέφθηκε πάπας με την υποστήριξη του Γερμανού αυτοκράτορα Φρειδερίκου Β' που είχε μεγάλη επιρροή στους εκλέκτορες. Σύντομα όμως ήρθε σε σύγκρουση μαζί του αφού ο Φρειδερίκος Β΄, λόγω εξέγερσης του επισκόπου Ρανιέρι, αρνήθηκε να κρατήσει τον λόγο του για την απελευθέρωση των αιχμαλώτων επισκόπων από την εποχή του Γρηγορίου του Θ΄.\\nΚατέφυγε στη γαλλική Λυών όπου μετά από συμβούλιο ενός μηνός καταράστηκε τον Φρειδερίκο Β΄, τον κήρυξε «αντίχριστο εχθρό της εκκλησίας», «Σαρακηνό φίλο του σουλτάνου» και όρισε νέο αυτοκράτορα τον ευγενή Ερρίκο Ράσπε, με την εντολή να δολοφονήσει τον Φρειδερίκο Β΄. Είχε και σκληρές διαμάχες με τον βασιλιά της Νίκαιας Ιωάννη Γ΄ Βατάτζη, σύμμαχο του Φρειδερίκου Β΄.\\nΒρέθηκε σε δύσκολη θέση, αφού ο Φρειδερίκος Β΄ είχε κατακτήσει σχεδόν ολόκληρη την Ιταλία, αλλά η κατάσταση ανατράπηκε μετά την εξέγερση της Λομβαρδικής Πάρμας. Ο Φρειδερίκος Β΄, που είχε στρατοπεδεύσει έξω από αυτήν, έπαθε πανωλεθρία."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A7%CE%AF%CE%BF%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Mastic.jpg","page_title":"Χίος","context_page_description":"Η Χίος είναι νησί του Κεντρικού Αιγαίου και το πέμπτο μεγαλύτερο της Ελλάδας με έκταση 842 τετρ.χιλιόμετρα και μήκος ακτών 213 χιλιόμετρα. Διοικητικά αποτελεί την Περιφερειακή Ενότητα Χίου που ανήκει στην Περιφέρεια Βορείου Αιγαίου μαζί με τα Ψαρά και τα Αντίψαρα και τις Οινούσσες.\\nΟ πληθυσμός ανέρχεται σε 51.320 κατοίκους που ζει στην πόλη της Χίου, πρωτεύουσα και κύριο λιμάνι του νησιού, καθώς και στα 64 χωριά του νησιού. Ακόμα η Χίος έχει μεγάλη απόδημη κοινότητα σε Λονδίνο και Νέα Υόρκη. Η μικρότερη απόσταση του νησιού από τις απέναντι ακτές της Μικράς Ασίας, είναι 3,5 ναυτικά μίλια από το ακρωτήριο Πούντα ως τη χερσόνησο της Ερυθραίας, στο ύψος του Τσεσμέ.\\nΤα κύρια προϊόντα που εξάγει είναι η ονομαστή χιώτικη μαστίχα, το λάδι, τα σύκα και το κρασί, ενώ έχει διεθνή φήμη για το μέγεθος και την ποιότητα της ναυτιλίας της. Η πρωτεύουσα του νησιού, η πόλη Χίος, είναι γνωστή στου ντόπιους ως Χώρα. Ακόμη, ξεχωρίζουν αρκετοί οικισμοί που είναι γνωστοί για τα αρχιτεκτονικά τους χαρακτηριστικά."},{"page_url":"https://fr.wikipedia.org/wiki/Alpha-synucl%C3%A9ine","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Alfa-sinucleina.jpg","page_title":"Alpha-synucléine","context_page_description":"L'α-synucléine est une protéine de la famille des synucléines qui est abondante dans le cerveau humain. On en trouve aussi de petites quantités dans le cœur, les muscles et d'autres tissus. Dans le cerveau, l'α-synucléine se trouve essentiellement à l'extrémité des cellules nerveuses dans des structures spécialisées appelées terminaisons présynaptiques."},{"page_url":"https://nl.wikipedia.org/wiki/Tai_situ","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Tashi_Paljor%2C_3rd_Tai_Situ.jpg","page_title":"Tai situ","context_page_description":"De tai situ, ook tai situpa is een Tibetaans is een tulku, ofwel een lama, die uit mededogen is geïncarneerd om gelovigen te leiden op het pad naar verlichting. Zijn volledige titel is Kenting Naya Tang Nyontse Geshetse Tai Situpa die ook wordt afgekort tot Kuang Ting Tai Situ. Deze volledige titel betekent vertaald: verreikende, niet van streek te brengen, commandohoudende grote meester. De tai situ wordt beschouwd als een van de hoogste lama's van de karma kagyü-linie, maar ook van de kagyüsekte in het algemeen. De tai situ is een van de oudste reïncarnatielijnen in het Tibetaans boeddhisme.\\nChökyi Gyaltsen was de eerste reïncarnatie die de titel tai situ droeg. Deze werd hem in 1407 geschonken door de Chinese keizer Yongle uit de Ming-dynastie. Hij was een nabije discipel van de vijfde karmapa Deshin Shegpa die hem als abt van Goen benoemde, het voornaamste klooster van de karmapa in die tijd.\\nSinds 1954 is de twaalfde tai situ Pema Dönyö Nyinje. Hij werd geboren in het dorp Achog, dat deel uitmaakt van Palyul of het huidige arrondissement Baiyü in Sichuan, Volksrepubliek China. Dit deel maakte tijdens zijn geboorte deel uit van het koninkrijk Derge."},{"page_url":"https://sh.wikipedia.org/wiki/Novak_%C4%90okovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Novak_Djokovic_%40_BNP_Paribas_2012_Open.jpg","page_title":"Novak Đoković","context_page_description":"Novak \\"Nole\\" Đoković, po osvojenim turnirima, najbolji je srpski teniser svih vremena. Na prvom mestu ATP liste do sada je proveo 270 nedelja. Teniski stručnjaci, bivši igrači i saigrači smatraju Đokovića za jednog od najboljih tenisera u istoriji. Profesionalno igra od 2003. godine. Osvojio je šesnaest grand slam trofeja: Otvoreno prvenstvo Australije 2008, 2011, 2012, 2013, 2015, 2016. i 2019, Wimbledon 2011., 2014., 2015., 2018 i 2019., Otvoreno prvenstvo SAD 2011, 2015. i 2018, Otvoreno prvenstvo Francuske-Roland Garros 2016. i pet puta Masters kup 2008, 2012, 2013, 2014. i 2015. godine. Đoković je najmlađi igrač koji je dospeo do polufinala sva četiri grend slem turnira.\\nOsvojio je 33 turnira iz Masters serije i prvi kompletirao tzv. \\"Zlatni masters\\", odnosno osvajanje svih devet turnira iz Masters serije. Zajedno sa saigračima iz reprezentacije Srbije je došao do titule u Dejvis kupu 2010. godine.\\nSa Špancem Rafaelom Nadalom je ostvario jedno od najvećih rivalstava u istoriji tenisa. Odigrali su rekordan broj međusobnih duela u Open eri, kao i najveći broj mečeva na grend slemovima, uključujući i najduže finale."},{"page_url":"https://es.wikipedia.org/wiki/Altos_del_Sauce","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Escudo_altos_del_sauce.jpg","page_title":"Altos del Sauce","context_page_description":"Altos del Sauce es un barrio en la localidad de Sauce Viejo. Ubicado en el Departamento La Capital en la provincia de Santa Fe.\\nSe encuentra situado a 2,5 km en el sur de el Aeropuerto de Sauce Viejo y de el Parque Industrial Sauce Viejo. Distante 15,5 km al sur de su cabecera y capital provincial, Santa Fe de la Vera Cruz."},{"page_url":"https://de.wikipedia.org/wiki/Foron","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Bundesarchiv_Bild_183-G0923-0012-001%2C_VEB_DKK_Scharfenstein%2C_K%C3%BChlschrankproduktion.jpg","page_title":"Foron","context_page_description":"Foron war der Markenname eines Herstellers von Haushaltsgeräten in der Deutschen Demokratischen Republik und BRD."},{"page_url":"https://eu.wikipedia.org/wiki/Yes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Yes_concert_2010-12-01_%285252857378%29.jpg","page_title":"Yes","context_page_description":"Yes rock progresiboko talde bat da, Londresen 1968an sortua. 1970eko hamarkadan nazioarteko ospea lortu zuen, generoko zutabeetako bat bilakatuz, Rush, Pink Floyd, Camel, Genesis, King Crimson eta Emerson, Lake & Palmer taldeekin batera.\\nHastapenetan, The Beatles, The Who, The Moody Blues edo Crosby, Stills, Nash and Young bezalako taldeen eragina jaso zuten, baina berehala eboluzionatu zuten oso berea bihurtuko zen estilo baterantz, armonia konplexu eta arranditsuekin, jazza eta musika klasikoko elementuen fusioarekin, abesti melodikoekin eta Jon Anderson kantariak idatzitako hitz misteriotsu, esoteriko, oniriko eta poetikoekin.\\nGenesis taldearen aldean gogorragoak eta ez hain teatralak, baina Rush edo Jethro Tull baino progresiboagoak, Yesek Erresuma Batuko rock progresiboaren historian eragin nabarmena izango zuen The Yes Album, Fragile, Close to the Edge eta Relayer bezalako klasikoekin."},{"page_url":"https://hu.wikipedia.org/wiki/Eloszt%C3%B3_h%C3%A1l%C3%B3zat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Electricity_Grid_Schematic_Hungarian.svg","page_title":"Elosztó hálózat","context_page_description":"Az elosztó hálózat az elektromos áram továbbításának eszköze, a villamos energia végfelhasználóig tartó szállításának az utolsó előtti állomása, az átviteli hálózat része.\\nTöbbnyire az elosztó hálózathoz tartozónak tekintik a középfeszültségű hálózatokat is, továbbá elektromos alállomásokat, többfázisú transzformátorokat, kisfeszültségű elosztó vezetéket, és egyes esetekben az árammérőket is."},{"page_url":"https://en.wikipedia.org/wiki/Anglia_Regional_Co-operative_Society","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Co-op_clock%2C_Park_Road_-_geograph.org.uk_-_1618112.jpg","page_title":"Anglia Regional Co-operative Society","context_page_description":"Anglia Regional Co-operative Society Limited was the fifth largest consumer co-operative in the United Kingdom. It was formed by the merger of the Greater Peterborough Regional and Anglia co-operative societies in 1987. The Society had a wide-ranging and extensive portfolio with over 80 stores, principally trading in East Anglia. Head office was located at Westgate House, Peterborough until 2011.\\nThe Society was a registered Industrial and Provident Society, a member of the Co-operative Union, the Co-operative Retail Trading Group and a corporate member of The Co-operative Group, the largest consumer co-operative in the world.\\nOn 19 September 2013, it was announced that the boards of Anglia Co-operative Society and Midlands Co-operative Society had agreed merger terms. Approved by members on 4 and 18 November, legal completion of the merger took place on 1 December, with the Society transferring engagements to Midlands Co-operative. On 15 January 2014, members of the merged society approved a change of name to Central England Co-operative effective from 25 January 2014."},{"page_url":"https://it.wikipedia.org/wiki/Quarta_guerra_anglo-olandese","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Andries_Beeckman_-_The_Castle_of_Batavia.jpg","page_title":"Quarta guerra anglo-olandese","context_page_description":"La quarta guerra anglo-olandese durò dal 1780 al 1784. Il conflitto, sviluppatosi nell'ambito della guerra d'indipendenza americana, oppose il Regno Unito alla Repubblica delle Sette Province Unite, alleata al Regno di Francia ed al Regno di Spagna. La disastrosa impreparazione militare delle Province Unite permise al Regno Unito di guadagnare alcune concessioni territoriali nelle \\"Indie olandesi\\" e pose le condizioni per la Prima Rivoluzione batava."},{"page_url":"https://ms.wikipedia.org/wiki/Angkatan_Tentera_Rusia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/4thTankDivisionOpenDay17p2-06.jpg","page_title":"Angkatan Tentera Rusia","context_page_description":"Angkatan Tentera Persekutuan Rusia, lebih dikenali sebagai Angkatan Tentera Rusia adalah angkatan bersenjata bagi Persekutuan Rusia, ditubuhkan selepas pembubaran Kesatuan Soviet. Pada 7 Mei 1992, Boris Yeltsin menandatangani perintah presiden menubuhkan Kementerian Pertahanan Rusia dan meletakkan semua pasukan Angkatan Tentera Soviet di wilayah Republik Sosialis Persekutuan Soviet Rusia dibawah kawalan Rusia. Pemerintah Tertinggi Angkatan Tentera ialah Presiden Rusia. Angkatan Tentera Rusia telah dibentuk pada tahun 1992. Ia merupakan salah sebuah angkatan tentera terbesar di dunia. Menurut Credit Suisse, Rusia mempunyai tentera kedua paling kuat di dunia. Ia juga merupakan pengeksport senjata kedua terbesar dunia.\\nDibawah undang-undang persekutuan Rusia, ATRu bersama dengan Pasukan Sempadan Perkhidmatan Keselamatan Persekutuan, Pengawal Kebangsaan, Kementerian Dalam Negeri, Perkhidmatan Perlindungan Persekutuan, Perkhidmatan Perisikan Asing, dan pertahanan awam EMERCOM membentuk perkhidmatan tentera Rusia dan adalah dibawah kawalan langsung Majlis Keselamatan Rusia."},{"page_url":"https://pt.wikipedia.org/wiki/Richard_Lenski","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Richard_Lenski_with_Long-Term_Flasks_and_Incubator_on_May_26%2C_2016.jpg","page_title":"Richard Lenski","context_page_description":"Richard E. Lenski é um biólogo evolucionista, mais conhecido por seus 25 anos de experimentos sobre evolução da Escherichia coli."},{"page_url":"https://pt.wikipedia.org/wiki/Ponta_do_Arnel","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Farol_do_Arnel%2C_Ponta_o_Arnel%2C_Nordeste%2C_ilha_de_S%C3%A3o_Miguel%2C_A%C3%A7ores.JPG","page_title":"Ponta do Arnel","context_page_description":"A Ponta do Arnel é um promontório localizado no concelho de Nordeste, ilha de São Miguel, arquipélago dos Açores. Nele se localiza o Farol da Ponta do Arnel."},{"page_url":"https://no.wikipedia.org/wiki/Stettiner_Haff","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Zalewszczecinski.jpeg","page_title":"Stettiner Haff","context_page_description":"Stettiner Haff eller Oderlagunen er en strandsjø på grensen mellom Tyskland og Polen sørvest i Østersjøen. Den ligger ved munningen av elven Oder nord for byene Szczecin og Police.\\nMellom Stettiner Haff og Pommernbukten i Østersjøen ligger øyene Usedom/Uznam og Wolin, og tre sund knytter strandsjøen til resten av havet: Peenestrom, Świna og Dziwna. Den har et areal på 687 km² og et gjennomsnittlig dyp på 4 meter. På det dypeste er den bare 6 meter.\\nI 1880 åpnet kanalen Kaiserfahrt på Usedom, og en vannvei med dybde på 10 meter knyttet lagunen sammen med Østersjøen, slik at større skip kunne komme inn i strandsjøen og havnen i Stettin.\\nKanalen er omtrent 12 km lang og 10 meter dyp og ble gravd ut av Det tyske keiserdømmet mellom 1874 og 1880 i regjeringstiden til keiser Vilhelm I. Etter 1945 oppkalte Polen kanalen etter Piast-dynastiet."},{"page_url":"https://it.wikipedia.org/wiki/Nartece","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Narthex.png","page_title":"Nartece","context_page_description":"Il nartèce è una struttura tipica delle basiliche dei primi 6-7 secoli del Cristianesimo.\\nÈ uno spazio posto fra le navate e la facciata principale della chiesa e ha la funzione di un corto atrio, largo quanto la chiesa stessa.\\nIl termine deriva dal greco νάρθηξ, \\"bastone, flagello\\", simbolo di pentimento e punizione. Anticamente il nartece aveva infatti la funzione di ospitare catecumeni e soprattutto pubblici penitenti ma, una volta perse queste funzioni, è andato scomparendo a partire dal VII secolo.\\nSe è una struttura interna alla chiesa, si dice endonartece; se invece è un porticato esterno, il nome specifico è esonartece, a Ravenna detto anche àrdica.\\nIl nartèce ha trovato ampio utilizzo anche in periodo romanico e gotico, mentre nell'architettura bizantina viene usato sino alla fine, nel quindicesimo secolo. In particolare nello stile gotico, il nartece è ben visibile anche dall'esterno dell'edificio, poiché costituito da una torre centrale più grande e due laterali di dimensioni minori, o viceversa."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D9%84%D9%88%D8%B3_%D8%A2%D8%B3%D8%AA%D9%88%D8%B1%DB%8C%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Alonso_S%C3%A1nchez_Coello_-_Infant_Don_Carlos_of_Spain_-_Google_Art_Project.jpg","page_title":"کارلوس آستوریاس","context_page_description":"کارلوس آستوریاس فرزند ارشد فیلیپ دوم و وارث تاج و تخت آستوریاس بود."},{"page_url":"https://de.wikipedia.org/wiki/Serial_ATA","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/SATA_ports.jpg","page_title":"Serial ATA","context_page_description":"Serial ATA – üblich sind auch die Schreibweisen SATA und S-ATA – ist eine Computer-Schnittstelle für den Datenaustausch mit Festplatten und anderen Speichergeräten. ATA steht hierbei für das Übertragungsprotokoll „AT Attachment“ – im Unterschied dazu werden bei SATA die Daten jedoch seriell übertragen."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%8A%D8%A8%D8%B1%D8%AA%D9%8A_(%D9%85%D9%82%D8%A7%D8%B7%D8%B9%D8%A9_%D9%85%D8%A7%D9%86%D9%8A%D8%AA%D9%88%D9%88%D9%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/WIMap-doton-Liberty_b.png","page_title":"ليبرتي (مقاطعة مانيتووك)","context_page_description":"ليبرتي، مقاطعة مانيتووك ‏ هي بلدة تقع بولاية ويسكونسن في الولايات المتحدة. تبلغ مساحتها 91.7، وترتفع عن سطح البحر 253 م، بلغ عدد سكانها 1287 نسمة في عام 2000 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 14.1 نسمة/كم²."},{"page_url":"https://fr.wikipedia.org/wiki/Collection_de_peintures_du_mus%C3%A9e_Cond%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Napoleon_-_1.jpg","page_title":"Collection de peintures du musée Condé","context_page_description":"La collection de peinture du musée Condé à Chantilly, comprend 800 peintures datant du XVᵉ siècle au XIXᵉ siècle. Les tableaux sont répartis dans presque toutes les salles selon le goût et les volontés du duc d'Aumale. Ils sont présentés les uns contre les autres et superposés, comme le voulait la mode dans les musées au XIXᵉ siècle. Cette liste présente les principaux tableaux par écoles et par peintres, ordonnés par ordre chronologique."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D8%A8%D9%8A%D8%A7%D8%AA_%D8%A7%D9%84%D8%B4%D9%83%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Coyote_portrait.jpg","page_title":"كلبيات الشكل","context_page_description":"الكلبيات الشكل أو شبيهة الكلبيات هي رتيبة من الثدييات تتبع طائفة الثدييات من شعبة الحبليات."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%88%DA%A9%D8%B3%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bradley_Stoke_lake.jpg","page_title":"بوکستون","context_page_description":"بوکستون بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 22215 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Distinctive_unit_insignia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/United_States_Army_North_DUI.png","page_title":"Distinctive unit insignia","context_page_description":"A distinctive unit insignia is a metallic heraldic badge or device worn by soldiers in the United States Army. The DUI design is derived from the coat of arms authorized for a unit. DUIs may also be called \\"distinctive insignia\\" or, imprecisely, a \\"crest\\" or a \\"unit crest\\" by soldiers or collectors. The U.S. Army Institute of Heraldry is responsible for the design, development and authorization of all DUIs."},{"page_url":"https://fi.wikipedia.org/wiki/M/S_Adventure_of_the_Seas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Adventure_of_the_Seas_Wade_2012.JPG","page_title":"M/S Adventure of the Seas","context_page_description":"Adventure of the Seas on Royal Caribbean International -varustamon Suomessa vuonna 2001 valmistunut risteilyalus. Alus tekee risteilyjä Karibialla."},{"page_url":"https://nl.wikipedia.org/wiki/Vaux-sur-Morges","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Karte_Gemeinde_Vaux-sur-Morges.png","page_title":"Vaux-sur-Morges","context_page_description":"Vaux-sur-Morges is een gemeente en plaats in het Zwitserse kanton Vaud, en maakt deel uit van het district Morges."},{"page_url":"https://en.wikipedia.org/wiki/Philippe_Lioret","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Philippe_Lioret.jpg","page_title":"Philippe Lioret","context_page_description":"Philippe Lioret is a French film director, screenwriter and producer."},{"page_url":"https://pt.wikipedia.org/wiki/Centro_Mundial_Bah%C3%A1%27%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Panorama_Haifa.jpg","page_title":"Centro Mundial Bahá'í","context_page_description":"Centro Mundial Bahá'í é a designação dada ao centro espiritual e administrativo da Fé Bahá'í. O Centro Mundial consiste no Santuário de Bahá'u'lláh, perto de Acre, Israel, o Santuário do Báb e seus jardins no Monte Carmelo, em Haifa, além de vários outros edifícios na área, incluindo os edifícios d'O Arco.\\nGrande parte da governança e coordenação internacional da Fé Bahá'í ocorrem no Centro Mundial. Estas incluem decisões que afetam a religião em um nível global, bem como o estudo e a tradução dos escritos sagrados bahá'ís. A Casa Universal de Justiça, que representa o órgão supremo da Fé Bahá'í, está sediada em Haifa. O Centro Mundial Bahá'í também é o destino atual de peregrinação bahá'í.\\nO Centro Mundial Bahá'í tem suas origens históricas na área, que antes era parte da Síria Otomana. Isto remonta aos anos 1850 e 1860, quando o então Xá do Irã, Nasser al-Din Shah, e o sultão do Império Otomano, Abdulazize, exilaram Bahá'u'lláh do Irã para a fortaleza de Acre para viver no encarceramento."},{"page_url":"https://ca.wikipedia.org/wiki/Jamlitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Jamlitz_in_LDS.png","page_title":"Jamlitz","context_page_description":"Jamlitz és un municipi alemany que pertany a l'estat de Brandenburg. Forma part de l'Amt Lieberose/Oberspreewald. Comprèn els districtes de Leeskow, Ullersdorf i Mochlitz."},{"page_url":"https://fr.wikipedia.org/wiki/Oxyopes_shweta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Oxyopes_shweta_%282%29.jpg","page_title":"Oxyopes shweta","context_page_description":"Oxyopes shweta est une espèce d'araignées aranéomorphes de la famille des Oxyopidae."},{"page_url":"https://de.wikipedia.org/wiki/Kennung","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Fl%284%2915s.gif","page_title":"Kennung","context_page_description":"Als Kennung eines Leuchtfeuers bezeichnet man die Eigenschaften, die in der Nacht dessen Identifizierung ermöglichen.\\nDie Kennung eines Funkfeuers für Navigationszwecke wird durch Modulation des Trägers übermittelt, in der Regel durch Morsecode."},{"page_url":"https://en.wikipedia.org/wiki/Those_Magnificent_Men_in_their_Flying_Machines","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Alberto_Santos_Dumont_flying_the_Demoiselle_%281909%29.jpg","page_title":"Those Magnificent Men in their Flying Machines","context_page_description":"Those Magnificent Men in their Flying Machines; Or, How I Flew from London to Paris in 25 Hours 11 Minutes is a 1965 British period comedy film featuring an international ensemble cast including Stuart Whitman, Sarah Miles, Robert Morley, Terry-Thomas, James Fox, Red Skelton, Benny Hill, Jean-Pierre Cassel, Gert Fröbe and Alberto Sordi. The film, revolving around the craze of early aviation, was directed and co-written by Ken Annakin, with a musical score by Ron Goodwin.\\nBased on a screenplay entitled Flying Crazy, the fictional account is set in 1910, when Lord Rawnsley, an English press magnate, offers £10,000 to the winner of the Daily Post air race from London to Paris, to prove that Britain is \\"number one in the air\\"."},{"page_url":"https://cs.wikipedia.org/wiki/Al-Idr%C3%ADs%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Estatua_de_Al-Idrisi.jpg","page_title":"Al-Idrísí","context_page_description":"Abu Abd Alláh Muhammad al-Idrísí al-Kurtubí al-Hasaní as-Sabtí či jednoduše al-Idrísí byl andaluský geograf, kartograf, egyptolog a cestovatel, který žil a pracoval na Sicílii na dvoře krále Rogera II. Sicilského."},{"page_url":"https://en.wikipedia.org/wiki/Treyvaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Le_Pr%C3%A9_de_la_Maison_12_Treyvaux_Aug_2011.jpg","page_title":"Treyvaux","context_page_description":"Treyvaux is a municipality in the district of Sarine in the canton of Fribourg in Switzerland."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E5%9B%BD%E5%B4%9B%E8%B5%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Guangzhou_dusk_11-5-2008.png","page_title":"中国崛起","context_page_description":"中国崛起是指进入改革开放以来，中华人民共和国在经济、政治、军事及科技等方面实力的迅速增长。由于中国有稳定和庞大的人口，以及快速增长的经济和军事支出，因此经常被视为是一个潜在的超级大国。作为经济发展最快的发展中国家之一，中国在国际事务中扮演着重要的角色，并且在联合国安理会常任理事国中占有一席。\\n中国虽然被世界公认为是一个潜在的超级大国，但是仍然在经济、社会、环境与政治等方面存在许多不利因素有待克服。目前中国在联合国与世界上的影响力、综合国力仍与美国仍有较大差距。但经济与科技力方面发展速度颇快，以及许多方面都不断进步，逐渐已经在各方面领域追赶上欧美各国，因此中国的国际影响力不断扩展，产生中国在21世纪中期成为世界第二个超级大国的可能性。"},{"page_url":"https://hu.wikipedia.org/wiki/Hal%C3%A1sztelek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Hal%C3%A1sztelek-3.jpg","page_title":"Halásztelek","context_page_description":"Halásztelek város Pest megyében, a Szigetszentmiklósi járásban, a budapesti agglomerációban."},{"page_url":"https://fi.wikipedia.org/wiki/Asento","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Flickr_-_Official_U.S._Navy_Imagery_-_The_XO_of_Naval_Station_Norfolk_stands_at_attention_and_salute_during_national_anthem_at_a_Battle_of_Midway_wreath_laying_ceremony_at_Naval_Station_Norfolk..jpg","page_title":"Asento","context_page_description":"Asento on ihmisen tai eläimen keskikehon, pään ja raajojen muoto ja suunta. Yleisimpiä perusasentoja ovat seisoma-asennot, istuma-asennot ja makuuasennot. Erilaisten toimintojen kuten synnytyksen, seksin, ulostamisen ja joogan aikana hyödynnetään erilaisia tarkoitukseen sopivia asentoja. Asennolla on vaikutus ryhtiin ja sitä kautta etenkin selän terveyteen. Asennolla voi myös viestiä."},{"page_url":"https://nl.wikipedia.org/wiki/Andreu_Guerao","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Andreu_-_Luis_Henr%C3%ADquez.jpg","page_title":"Andreu Guerao","context_page_description":"Andreu Guerao Mayoral is een Spaans profvoetballer. Hij speelt als middenvelder bij Auckland City FC.\\nGuerao kwam in 1993 bij de jeugdopleiding van FC Barcelona. In 2002 won hij met de Juvenil A de Copa del Rey Juvenil ten koste van RCD Mallorca. De middenvelder speelde van 2003 tot 2005 voor het tweede elftal. In oktober 2004 speelde Guerao in een oefenwedstrijd tegen Olympique Marseille zijn eerste wedstrijd voor het eerste elftal. Na een seizoen bij het tweede team van Málaga CF, speelde Guerao vanaf 2006 bij Sporting Gijón, waarmee hij in 2008 promoveerde naar de Primera División. In januari 2010 vertrok hij naar Polonia Warschau, dat destijds werd getraind door José Mari Bakero. In september 2011 werd Guerao gecontracteerd door Auckland City FC."},{"page_url":"https://it.wikipedia.org/wiki/Alberto_Sordi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Targa_commemorativa_Alberto_Sordi_a_Trastevere.JPG","page_title":"Alberto Sordi","context_page_description":"Alberto Sordi è stato un attore, regista, comico, sceneggiatore, compositore, cantante e doppiatore italiano.\\nFra i più importanti attori del cinema italiano con circa 200 film, è considerato uno dei più grandi interpreti della commedia all'italiana con Ugo Tognazzi, Vittorio Gassman e Nino Manfredi, un quartetto al quale è generalmente accostato anche Marcello Mastroianni. Inoltre, insieme ad Aldo Fabrizi e Anna Magnani, fu tra i massimi esponenti della romanità cinematografica."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%B0%E8%A1%97%E5%8F%A3_(%E5%8D%97%E4%BA%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Jinling_Hotel.jpg","page_title":"新街口 (南京)","context_page_description":"新街口位於中國南京市新街口街道的中心區域，是一處著名的商業中心。「新街口」一詞可能用來指新街口廣場，也可能指以新街口廣場為中心的地區，有新街口商圈、新街口中央商務區等稱謂；廣義的新街口則指新街口街道，轄區總面積為2平方公里。新街口每逢節假日日均客流量峰值七十萬人次，七十九家世界五百強分支機構進駐，其商貿集中度超過北京王府井、上海徐家匯並翹首中國，成為中國商貿密集度最高的地區，因此有「中華第一商圈」的說法。"},{"page_url":"https://ca.wikipedia.org/wiki/La_Ville-%C3%A8s-Nonais","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Map_commune_FR_insee_code_35358.png","page_title":"La Ville-ès-Nonais","context_page_description":"La Ville-ès-Nonais és un municipi francès, situat a la regió de Bretanya, al departament d'Ille i Vilaine. L'any 2006 tenia 949 habitants."},{"page_url":"https://lb.wikipedia.org/wiki/NGC_1360","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/NGC_1360_-FORS2.2011-12-08RhaGBoiii.png","page_title":"NGC 1360","context_page_description":"Den NGC 1360 ass e planetareschen Niwwel am Stärebild Fornax. Den NGC 1360 huet eng visuell Magnitude vu +9,40 mag an eng Wénkelausdehnung vu 6,0'x 4,5'."},{"page_url":"https://en.wikipedia.org/wiki/Atlantis_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Atlantis_house_stairway.jpg","page_title":"Atlantis House","context_page_description":"The Atlantis House on Böttcherstraße in the old town of Bremen in the north of Germany is an interesting example of German architecture in the interwar period. Designed by Bernhard Hoetger, it was completed in 1931. After suffering serious war damage, it was rebuilt in 1965 with a new facade designed by Ewald Mataré."},{"page_url":"https://sv.wikipedia.org/wiki/Mer_%C3%A4n_bara_v%C3%A4nner%3F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Mer_%C3%A4n_bara_v%C3%A4nner_2011c.jpg","page_title":"Mer än bara vänner?","context_page_description":"Mer än bara vänner? är en skulpturgrupp av konstnären och formgivaren Thomas Nordström. Skulpturgruppen finns i Hammarby sjöstad, södra Stockholm, nära Förskeppsgatan.\\nFör konstnärlig utsmyckning av kvarteret Sjöfarten i Hammarby sjöstad beställde AB Familjebostäder 2008 en skulptur av Thomas Nordström. Det blev en ljusskulptur kallad Mer än bara vänner? och den står på en innergård mellan Heliosgatan och Hammarby allé. Skulpturen för tanken till två gigantiska skalbaggar med väldigt långa ben. Skalen är gjorda av fasetter i laminerat glas och stommen består av rostfritt stål. På undersidan/insidan finns en ljusramp av LED-ljus som tänds när det blir mörkt. Den ena \\"vännen\\" lyser rött, den andra gult."},{"page_url":"https://fr.wikipedia.org/wiki/Parasynarcualis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Parasynarcualis_longorostris.jpg","page_title":"Parasynarcualis","context_page_description":"Parasynarcualis est un genre éteint de poissons osseux. Il appartient à la famille des Parasynarcualidae, et à l'ordre des Syngnathiformes. C'est le seul genre de la famille des Parasynarcualidae à laquelle il a donné son nom.\\nUne seule espèce est rattachée au genre : Parasynarcualis longirostris, décrite par Henri-Marie Ducrotay de Blainville en 1818."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%98%D8%B1%D9%85%D9%86_%D8%AF%D9%88%D9%84%D8%A7%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Germaine_Dulac.jpg","page_title":"ژرمن دولاک","context_page_description":"ژرمن دولاک ‏‏ کارگردان فیلم فرانسوی و از نظریه‌پردازان متقدم سینما است.\\nمشهورترین فیلم او صدف و کشیش است که در سال ۱۹۲۸ براساس فیلم‌نامه‌ای از آنتونن آرتو ساخته است. این فیلم به عنوان نخستین فیلم سورئال کمی قبل از سگ اندلسی اثر لوئیس بونوئل و سالوادور دالی ساخته شده است، هرچند بعضی از پژوهش‌گران مانند آپرام کتز این کارگردان زن را بیشتر فیلم‌سازی امپرسیونیست می‌دانند.\\nفیلم مطرح دیگر این کارگردان لبخند مادام بودو است."},{"page_url":"https://de.wikipedia.org/wiki/Georg_Saal","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Georg_Saal_Selbstbildnis_1858.JPG","page_title":"Georg Saal","context_page_description":"Georg Eduard Otto Saal war ein deutscher Maler."},{"page_url":"https://en.wikipedia.org/wiki/Amanda_Palmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Amanda_Palmer_at_IFC_2016_-_IMG_0132_%2824075269118%29_%28cropped%29.jpg","page_title":"Amanda Palmer","context_page_description":"Amanda MacKinnon Gaiman Palmer is an American singer, songwriter, musician, and performance artist who was the lead vocalist, pianist, and lyricist of the duo The Dresden Dolls. She performs as a solo artist, and was also one-half of the duo Evelyn Evelyn, and the lead singer and songwriter of Amanda Palmer and the Grand Theft Orchestra."},{"page_url":"https://en.wikipedia.org/wiki/Maryland%E2%80%93Virginia_men%27s_soccer_rivalry","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Kl%C3%B6ckner_Stadium_%28Charlottesville%2C_Va.%29.jpg","page_title":"Maryland–Virginia men's soccer rivalry","context_page_description":"The Maryland–Virginia men's soccer rivalry, sometimes referred to as the Tydings Cup, is a rivalry between the University of Maryland Terrapins men's soccer team, and the University of Virginia Cavaliers men's soccer team. When both teams competed in the Atlantic Coast Conference, the rivalry was considered one of the most intense college soccer rivalries in the United States. Much of this is due to the program's long-standing rivalries across other sports and competing for recruits in the Mid-Atlantic, as both programs participated in the ACC for over 60 years before Maryland left for the Big Ten Conference.\\nBoth UVA and Maryland have NCAA Championship programs in men's soccer. The Cavaliers have won seven NCAA Championships while the Terrapins have won four. Both programs are also extremely consistent. As of 2019, Virginia has made the College Cup Tournament bracket an NCAA record 39 consecutive years. Maryland has made the tournament 19 consecutive years since 2001.\\nVirginia is 29–16–7 in the rivalry since 1978, but Maryland started 26–1–3 between 1941 and 1977, and still leads 42–30–10 overall."},{"page_url":"https://en.wikipedia.org/wiki/2008_Open_Championship","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Greg_Norman%2C_Open_2008.jpg","page_title":"2008 Open Championship","context_page_description":"The 2008 Open Championship was a men's major golf championship and the 137th Open Championship, played from 17–20 July at Royal Birkdale Golf Club in Southport, England. Pádraig Harrington successfully defended his Open Championship title, his second; he shot four under par over the final nine holes and was four strokes ahead of runner-up Ian Poulter. Harrington was the last golfer to win the same major back-to-back for a decade until Brooks Koepka won consecutive U.S. Opens in 2017 and 2018.\\nTelevision coverage was provided as usual by the BBC in the UK, and by ABC and TNT in the United States."},{"page_url":"https://vi.wikipedia.org/wiki/Trigonoptila_latimarginaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Trigonoptila_latimarginaria1.jpg","page_title":"Trigonoptila latimarginaria","context_page_description":"Trigonoptila latimarginaria là một loài bướm đêm trong họ Geometridae."},{"page_url":"https://hr.wikipedia.org/wiki/Miholjska_prevlaka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/MiholjskaPrevlaka.jpg","page_title":"Miholjska prevlaka","context_page_description":"Miholjska prevlaka je prvi od tri otoka u jedinstvenom nizu otoka u tivatskom zaljevu Boke kotorske, poznatijih kao krtoljski arhipelag. Ovaj otok se poslije pet metara širokog i plitkog tjesnaca nadovezuje na poluotok Brda. Stotinjak metara dalje je škoj Stradioti ili otok Sv. Marka, a još toliko je udaljeno Bogorodičin otok, Otok ili Gospe od Milosti.\\nNa ovaj dio zaljeva prostirala se zajednica samostana svetog arkanđela Mihaila. Istočna strana Boke kotorske bila je dio Travunije, odnosno Hercegovine, a grad Kotor sa Bokom kotorskom i Grbljem, u srednjem vijeku poznat kao \\"kraljevski grad\\", bio je poseban teritorij s vladarskim dvorcima. Miholjska prevlaka je imenovana po samostanu svetog arkanđela Mihaila, danas u ruševinama, koji je sveti Sava Nemanjić 1219. ustanovio kao sjedište Zetske episkopije. Dugo vremena jezgra Miholjskog zbora je bila Miholjska prevlaka.\\nNa Miholjskoj prevlaci se nalazi crkva Sv. Trojice. To je jednobrodna građevina sa polukružnom apsidom i trodjelnim zvonikom na preslicu. Na zapadnoj fasadi, iznad portala nalazi se rozeta, a ispod nje fragmenti plastike. Sagradila je 1883. godine Katarina Vlastelinović."},{"page_url":"https://ro.wikipedia.org/wiki/Superputere","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/NYSE127.jpg","page_title":"Superputere","context_page_description":"O superputere sau supraputere este un stat care are capacitatea de a influența evenimentele sau își exercită puterea la scară globală, situându-se la alt nivel decât toate celelalte puteri. În zilele noastre, asta implică o mare putere economică și științifico-tehnologică, o populație numeroasă și forțe armate puternice, inclusiv forțe aeriene, spațiale și un arsenal de arme de distrugere în masă."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_Huesca","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Castillo_de_Montearag%C3%B3n.jpg","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Huesca","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở Huesca."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_windmolens_in_Zuid-Holland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Warmond_Boterhuismolen.jpg","page_title":"Lijst van windmolens in Zuid-Holland","context_page_description":"Hier volgt een lijst van windmolens in Zuid-Holland. In Zuid-Holland staan ca. 226 complete windmolens."},{"page_url":"https://en.wikipedia.org/wiki/Wald,_Z%C3%BCrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Wald_IMG_4576.JPG","page_title":"Wald, Zürich","context_page_description":"Wald is a village and a municipality in the district of Hinwil in the canton of Zürich in Switzerland."},{"page_url":"https://fr.wikipedia.org/wiki/Cerro_de_Guadalupe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/GuadalupeBogota.jpg","page_title":"Cerro de Guadalupe","context_page_description":"Le cerro de Guadalupe, situé dans la cordillère Orientale, est l'un des plus remarquables cerros orientales environnant Bogota, la capitale de la Colombie. Tout comme le cerro de Monserrate, il semble protéger la ville. Ces deux cerros bordent, à l'est, la savane de Bogota.\\nLa colline de Guadalupe est située entre Bogota et le páramo de Cruz Verde."},{"page_url":"https://ceb.wikipedia.org/wiki/Venezillo_parvus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Venezillo_parvus.jpg","page_title":"Venezillo parvus","context_page_description":"Espesye sa krustaseo nga una nga gihulagway ni Gustav Budde-Lund ni adtong 1885 ang Venezillo parvus. Ang Venezillo parvus sakop sa kahenera nga Venezillo sa kabanay nga Armadillidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://la.wikipedia.org/wiki/Feni_perceptio_in_%C3%89ragny","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Hay_Harvest_at_%C3%89ragny_by_Camille_Pissarro_1901.png","page_title":"Feni perceptio in Éragny","context_page_description":"Feni perceptio in Éragny est pictura olearia a Camillo Pissaro artifice Francico anno 1901 facta, hodie in Pinacotheca Civica Canadensi servata.\\nPissarro ab anno 1884 usque ad mortem suam in Éragny-sur-Epte vixit, ubi hortum suum et naturam circumdantem saepe depinxit. Haec tabula describit homines, qui fenum secant et percipiunt.\\nPinacotheca Civica Canadensis Ottavia in urbe sita hoc opus anno 1946 adquisivit et adhuc exhibet."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CF%81%CE%BD%CE%AD%CF%83%CF%84%CE%BF%CF%82_%CE%92%CE%84_%CF%84%CE%B7%CF%82_%CE%A3%CE%B1%CE%BE%CE%BF%CE%BD%CE%AF%CE%B1%CF%82-%CE%93%CE%BA%CF%8C%CF%84%CE%B1-%CE%86%CE%BB%CF%84%CE%B5%CE%BD%CE%BC%CF%80%CE%BF%CF%85%CF%81%CE%B3%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Ernst-II_1775.jpg","page_title":"Ερνέστος Β΄ της Σαξονίας-Γκότα-Άλτενμπουργκ","context_page_description":"Ο Ερνέστος Β΄, γερμ. Ernst II από τον Οίκο των Βέττιν ήταν δούκας της Σαξονίας-Γκότα-Άλτενμπουργκ."},{"page_url":"https://pl.wikipedia.org/wiki/Rosyjski_podb%C3%B3j_Mand%C5%BCurii","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Troops_of_the_Eight_nations_alliance_1900.jpg","page_title":"Rosyjski podbój Mandżurii","context_page_description":"Rosyjski podbój Mandżurii, lub inaczej wojna rosyjsko-chińska – konflikt zbrojny mający miejsce w 1900 roku. W jego wyniku Rosjanie przez pięć lat, od 1900, do 1905, okupowali należącą do Chin Mandżurię."},{"page_url":"https://en.wikipedia.org/wiki/Philadelphia_Phillies","image_url":"https://upload.wikimedia.org/wikipedia/en/b/b3/Mike_Schmidt_plaque.jpg","page_title":"Philadelphia Phillies","context_page_description":"The Philadelphia Phillies are an American professional baseball team based in Philadelphia, Pennsylvania. They compete in Major League Baseball as a member of the National League East division. Since 2004, the team's home stadium has been Citizens Bank Park, located in South Philadelphia. The Phillies are the oldest continuous same-name, same-city franchise in American professional sports.\\nThe Phillies have won two World Series championships and seven National League pennants, the first of which came in 1915. Since the first modern World Series was played in 1903, the Phillies played 77 consecutive seasons before they won their first World Series—longer than any of the other 16 teams that made up the major leagues for the first half of the 20th century. They are one of the more successful franchises since the start of the Divisional Era in Major League Baseball. The Phillies have won 11 division titles, including five consecutive division titles from 2007 to 2011; these are ranked sixth among all teams and fourth in the National League. Hall of Fame third baseman Mike Schmidt is widely considered the franchise's greatest player of all time."},{"page_url":"https://eo.wikipedia.org/wiki/Erquelinnes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Erquelinnes_Hainaut_Belgium_Map.png","page_title":"Erquelinnes","context_page_description":"Erquelinnes estas municipo en Belgio. Komence de januaro 2016 ĝi havis 9 920 loĝantojn. La municipo apartenas al la distrikto Thuin.\\nEkde 1977 la municipoj Bersillies-l'Abbaye, Grand-Reng, Hantes-Wihéries, Montignies-St-Christophe kaj Solre-sur-Sambre apartenas al Erquelinnes, la ĉefa municipo."},{"page_url":"https://sco.wikipedia.org/wiki/Guadalajara_metropolitan_aurie","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Mapa_ZMG.svg","page_title":"Guadalajara metropolitan aurie","context_page_description":"The Guadalajara metropolitan aurie is the maist populous metropolitan aurie o the Mexican state o Jalisco an the seicont lairgest in the kintra efter Greater Mexico Ceety. It includes the core municipality o Guadalajara an the surroondin municipalities o Zapopan, Tlaquepaque, Tonalá, Tlajomulco de Zuñiga, El Salto, Ixtlahuacán de los Membrillos an Juanacatlán."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%99%EC%97%98%EB%9D%BC_%ED%9D%90%EB%A1%9C%ED%8A%B8%ED%95%98%EC%9C%84%EC%A0%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Angela_Groothuizen_Radio_Westerwolde.jpg","page_title":"앙엘라 흐로트하위전","context_page_description":"앙엘라 흐로트하위전은 네덜란드의 가수, 배우, 사회자이다."},{"page_url":"https://sq.wikipedia.org/wiki/Prades","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Prades_en_ardeche.jpg","page_title":"Prades","context_page_description":"Prades është një komunë franceze, e cila ndodhet në departamentin Ardèche të rajonit Auvernia-Rhône-Alpes. Prades ka një popullsi prej 1224 banorë dhe sipërfaqe 9.79 km², me një dendësi prej 125 banor/km²."},{"page_url":"https://lb.wikipedia.org/wiki/Frammersbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Frammersbach_vom_B%C3%A4ckersberg.JPG","page_title":"Frammersbach","context_page_description":"Frammersbach ass eng Maartgemeng am ënnerfränkesche Landkrees Main-Spessart."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1985/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Harry_ter_Heide_%281972%29.jpg","page_title":"Lijst van personen overleden in 1985/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1985.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ru.wikipedia.org/wiki/2PM","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/2_PM_Korean_band.jpg","page_title":"2PM","context_page_description":"2PM – южнокорейский бойбенд, сформированный в 2008 году компанией JYP Entertainment. Коллектив состоит из шести участников: Джун Кея, Никхуна, Тэкёна, Уёна, Чунхо и Чансона. Первоначально группа состояла из семи человек, но её первый лидер, Чжебом, ушёл из агентства в 2010 году.\\nИстория участников 2PM началась, когда известный музыкальный продюсер, основатель и директор JYP Entertainment, Пак Чин Ён, сформировал бойбенд One Day, состоящий из 11 участников. Однако вскоре он был разделён на две отдельные друг от друга группы: 2AM и 2PM соответственно. 2PM официально дебютировали в сентябре 2008 года с синглом «10점 만점에 10점», хореография содержала в себе акробатические элементы. Свой первый сингл № 1 группа заработала с песней «Again & Again». Официальный японский дебют состоялся в 2011 году с альбомом Republic of 2PM.\\n2PM являются единственной мужской группой JYP Entertainment, выступающей на сцене почти десять лет; они также стали единственными из One Day, продлившими контракты с JYP почти в полном своём составе."},{"page_url":"https://pl.wikipedia.org/wiki/Joris_van_Son","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Joris_van_Son_Fr%C3%BCchtestillleben_mit_Nautilusmuschel.jpg","page_title":"Joris van Son","context_page_description":"Joris van Son – flamandzki malarz okresu baroku.\\nW 1642/43 został mistrzem gildii św. Łukasza. Tworzył pod wpływem Daniela Seghersa i J. D. de Heema. Malował owoce, girlandy i festony, zastawione stoły. Ulubionym jego motywem był gotowany homar wśród owoców, zabitych ptaków lub kielichów. Zachowało się ok. 40 jego obrazów.\\nUczniami malarza byli, jego syn Jan Frans van Son oraz Jan Pauwel Gillemans II."},{"page_url":"https://cs.wikipedia.org/wiki/Jarom%C3%ADra_Strakov%C3%A1-Lipsk%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/V%C3%A1za_V_saun%C4%9B.jpg","page_title":"Jaromíra Straková-Lipská","context_page_description":"Akademická malířka Jaromíra Straková-Lipská byla česká sklářská výtvarnice, profesorka Střední průmyslové školy sklářské v Novém Boru."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%8F%E6%9D%BE%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Komatsu_Bus_120.jpg","page_title":"小松バス","context_page_description":"小松バス株式会社は、石川県小松市に本社を置くバス事業者。路線バスと観光バスを運営している。"},{"page_url":"https://en.wikipedia.org/wiki/Laser","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Aleksandr_Prokhorov.jpg","page_title":"Laser","context_page_description":"A laser is a device that emits light through a process of optical amplification based on the stimulated emission of electromagnetic radiation. The term \\"laser\\" originated as an acronym for \\"light amplification by stimulated emission of radiation\\". The first laser was built in 1960 by Theodore H. Maiman at Hughes Research Laboratories, based on theoretical work by Charles Hard Townes and Arthur Leonard Schawlow.\\nA laser differs from other sources of light in that it emits light which is coherent. Spatial coherence allows a laser to be focused to a tight spot, enabling applications such as laser cutting and lithography. Spatial coherence also allows a laser beam to stay narrow over great distances, enabling applications such as laser pointers and lidar. Lasers can also have high temporal coherence, which allows them to emit light with a very narrow spectrum, i.e., they can emit a single color of light. Alternatively, temporal coherence can be used to produce pulses of light with a broad spectrum but durations as short as a femtosecond."},{"page_url":"https://en.wikipedia.org/wiki/Karl_Theodor_Paschke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Diskussionsveranstaltung_%E2%80%9EDeutschlands_Rolle_in_den_Vereinten_Nationen_-_eine_Bilanz%E2%80%9C_im_K%C3%B6lner_Rathaus-5500.jpg","page_title":"Karl Theodor Paschke","context_page_description":"Karl Theodor Paschke is a former Under Secretary General for the United Nations. He was born in Berlin in 1935. He studied jurisprudence in Bonn and Munich before working for the Foreign Office. From 1994 to 1999, he served as head of the United Nations Office of Internal Oversight Services. Among other things, he also teaches seminars on the U.N. at the Willy Brandt School of Public Policy."},{"page_url":"https://gl.wikipedia.org/wiki/Ferreira_de_Pallares,_Gunt%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/FerreiraPallaresVistaCripta.jpg","page_title":"Ferreira de Pallares, Guntín","context_page_description":"Santa María de Fereira de Pallares é unha parroquia do concello de Guntín na comarca de Lugo, na provincia de Lugo. No ano 2007 tiña 131 habitantes, un menos ca en 2006."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gemeinden_in_der_Stadtregion_V%C3%B6cklabruck","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Puchkirchen_am_Trattberg_Kirche.jpg","page_title":"Liste der Gemeinden in der Stadtregion Vöcklabruck","context_page_description":"Die Stadtregion Vöcklabruck ist eine österreichische Agglomeration in Oberösterreich. Die Region besteht aus der Kernzone sowie der Außenzone."},{"page_url":"https://uz.wikipedia.org/wiki/Mswati_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/King_Mswati_III_2014.jpg","page_title":"Mswati III","context_page_description":"Mswati III Svazilend qirolidir."},{"page_url":"https://en.wikipedia.org/wiki/November_1982_Irish_general_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/MacGiolla_cropped.jpg","page_title":"November 1982 Irish general election","context_page_description":"The November 1982 Irish general election was held on Wednesday, 24 November, three weeks after the dissolution of the Dáil on 4 November. The newly elected 166 members of the 24th Dáil assembled at Leinster House on 14 December when a new Taoiseach and government were appointed.\\nThe general election took place in 41 parliamentary constituencies throughout Ireland for 166 seats in the lower house of parliament, Dáil Éireann."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D0%BC%D0%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Klamp_Wappen.png","page_title":"Кламп","context_page_description":"Кламп — општина во округот Плен, во Шлезвиг-Холштајн, Германија."},{"page_url":"https://en.wikipedia.org/wiki/Joiner,_Arkansas","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Joiner_AR_10_City_Hall.jpg","page_title":"Joiner, Arkansas","context_page_description":"Joiner is a city in Mississippi County, Arkansas, United States. The population was 576 at the 2010 census.\\nJoiner was the birthplace of record company executive Al Bennett, for whom the character Alvin of Alvin and the Chipmunks was named."},{"page_url":"https://en.wikipedia.org/wiki/Berthold_Lubetkin","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Lubetkin_Finsbury_Health_Centre.jpg","page_title":"Berthold Lubetkin","context_page_description":"Berthold Romanovich Lubetkin was a Soviet émigré architect who pioneered modernist design in Britain in the 1930s. His work includes the Highpoint housing complex, London Zoo penguin pool, Finsbury Health Centre and Spa Green Estate."},{"page_url":"https://fr.wikipedia.org/wiki/Hellsau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/2011-11-30-Mezlando_%28Foto_Dietrich_Michael_Weidmann%29_286.JPG","page_title":"Hellsau","context_page_description":"Hellsau est une commune suisse du canton de Berne, située dans l'arrondissement administratif de l'Emmental."},{"page_url":"https://en.wikipedia.org/wiki/Peder_Fredags_Gr%C3%A4nd","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Peder_Fredags_Gr%C3%A4nd_g%C3%A5rd_och_ankarslutar_mars_2007.JPG","page_title":"Peder Fredags Gränd","context_page_description":"Peder Fredags Gränd is a small blind alley in Gamla stan, the old town in central Stockholm, Sweden. Stretching north from Köpmangatan, it is located between Skeppar Olofs Gränd and Staffan Sasses Gränd, just south of the Tessin Palace.\\nThe inconspicuous alley remained nameless until the 20th century; it is included on a map from 1700, but completely left out on another dated 1733. The present name was given to the alley in 1939, presumably inspired by the two parallel alleys, both of which are named after men who served King Gustav Vasa during the ousting of Danish forces.\\nPeder Fredag was probably one of the burghers of Stockholm, who first appeared in historical records in 1520 when, confronted with Christian II of Denmark, he vehemently opposed the city's terms of surrender. Before the Danes marched into the city, he escaped to the north of Sweden where he began to amass people to revolt against the Danish king. He started to raid the Stockholm Archipelago with his yacht, and in 1521 he joined the party of Gustav Vasa who eventually gave him a letter of marque."},{"page_url":"https://de.wikipedia.org/wiki/Kempten_(Allg%C3%A4u)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Kempten_%28Allgau%29_Hbf.JPG","page_title":"Kempten (Allgäu)","context_page_description":"Kempten (Allgäu) ist eine kreisfreie Stadt mit über 70.000 Einwohnern im Allgäu im bayerischen Regierungsbezirk Schwaben. Sie ist das Ober-, Schul- und Verwaltungszentrum der umliegenden Wirtschafts-, Urlaubs- und Planungsregion Allgäu mit rund 470.000 Einwohnern. Kempten ist nach Augsburg die zweitgrößte Stadt des Regierungsbezirks und gilt als eine der ältesten Städte Deutschlands, da sie bereits in der Antike in einem schriftlichen Dokument genannt wurde. Kempten wird seit den 1930ern verstärkt als Allgäuer Ort genannt, dennoch wird dort mehr ein schwäbischer als ein Allgäuer Dialekt gesprochen, letzterer kann erst südlich von Immenstadt im Allgäu in erkennbarem Maße festgestellt werden.\\nDas Stadtbild ist durch das jahrhundertelange Nebeneinander zweier Stadtkerne geprägt: zum einen die sogenannte Stiftsstadt der Fürstabtei Kempten, zum anderen die Reichsstadt Kempten. Die noch heute erkennbare gegensätzliche Grund- und Aufrissstruktur macht Kempten zur Doppelstadt.\\nSeit 1977 befindet sich in Kempten die Hochschule Kempten, in der fast 6000 Studierende eingeschrieben sind. Sie ist damit eine der größten Fachhochschulen in Bayern."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D1%82%D0%B8%D0%BF%D0%B5_%D0%9F%D0%BB%D0%B5%D1%82%D0%B8%D0%BA%D0%BE%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Rostov-Zenit_%2810%29.jpg","page_title":"Стипе Плетикоса","context_page_description":"Стипе Плетикоса е бивш хърватски футболист роден на 8 януари 1979 г. в Сплит, Хърватия. Дългогодишен вратар на националния отбор на Хърватия, за който има 114 изиграни мача."},{"page_url":"https://de.wikipedia.org/wiki/Platte_Purchase","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Map_of_Missouri_highlighting_the_Platt_Purchase.gif","page_title":"Platte Purchase","context_page_description":"Der Platte Purchase war ein Landerwerb der Vereinigten Staaten von den Indianern im Jahr 1836. Dabei wurden 8.156 km² dem Staat Missouri hinzugefügt, sodass dessen Nordwestgrenze nun dem Verlauf des Missouri River entsprach.\\nNamensgebend für diesen Landerwerb war der Platte River, ein Nebenfluss des Missouri, der von Iowa kommend das Gebiet durchfließt.\\nDie Region umfasst die heutigen Countys Andrew, Atchison, Buchanan, Holt, Nodaway und Platte. Die nordwestlichen Stadtteile von Kansas City, die Städte Saint Joseph, Mound City und Maryville sowie der heutige Kansas City International Airport liegen auf dem Gebiet des Platte Purchase."},{"page_url":"https://ceb.wikipedia.org/wiki/Sko%C4%8Dice","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Sko%C4%8Dice_flag.jpg","page_title":"Skočice","context_page_description":"Lungsod ang Skočice sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Jihočeský kraj, sa sentro nga bahin sa nasod, 100 km sa habagatan sa Prague ang ulohan sa nasod. 455 metros ibabaw sa dagat kahaboga ang nahimutangan sa Skočice, ug adunay 189 ka molupyo.\\nAng yuta palibot sa Skočice kay patag sa amihanan, apan sa habagatan nga kini mao ang kabungtoran. Kinahabogang dapit sa palibot ang Hrad, 664 ka metros ni kahaboga ibabaw sa dagat, 2.0 km sa habagatan sa Skočice. Dunay mga 120 ka tawo kada kilometro kwadrado sa palibot sa Skočice medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Písek, 14.0 km sa amihanan sa Skočice. Hapit nalukop sa kaumahan ang palibot sa Skočice.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Disyembre, sa -6 °C. Ang kasarangang pag-ulan 1,018 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 142 milimetro nga ulan, ug ang kinaugahan Marso, sa 39 milimetro."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%AF%D9%88%D8%A7%D8%B1%D8%AF_%D8%A3%D8%B1%D9%86%D9%88%D9%84%D8%AF_%D9%85%D8%A7%D8%B1%D8%AA%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Eduard_Arnold_Martin.png","page_title":"إدوارد أرنولد مارتن","context_page_description":"إدوارد أرنولد مارتن ‏ هو طبيب توليد وطبيب ألماني، ولد في 1809 في هايدلبرغ في ألمانيا، وتوفي في 1875 في برلين في ألمانيا."},{"page_url":"https://en.wikipedia.org/wiki/Nuffield_Lodge","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Studio_stable_block_to_Nuffield_Lodge_1227159.jpg","page_title":"Nuffield Lodge","context_page_description":"Nuffield Lodge is a house on Prince Albert Road, Regent's Park, London, England. It is Grade I listed. Both the house and its gardens fall within Regent's Park, which is Grade I listed on the Register of Historic Parks and Gardens.\\nThe villa was built from 1822 to 1824 as Grove Lodge, and designed by the architect Decimus Burton as a bachelor residence for the geologist George Bellas Greenough. On the death of Greenough, the lease passed to Francis Smedley, the High Bailiff of Westminster, and then to his son the author Francis Edward Smedley and following his death in 1864 his cousin, Menella Bute Smedley, who had cared for him and acted as his private secretary continued to reside in the property until her death 1877.\\nThe family connection was maintained by the Thomas Greer who occupied the house from Christmas 1878 to his death in 1905. In 1907, the Greer family moved back to Ireland and sold the property by auction to Sigismund Goetze who painted the interior murals.\\nIn 1952, it was bought by the Nuffield Foundation, and renamed Nuffield Lodge. The Nuffield Foundation gave up the lease in 1986, and it became a private residence and reverted to the name Grove House."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Cotswold_(district)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Adlestrop_House.jpg","page_title":"Grade II* listed buildings in Cotswold (district)","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of Cotswold in Gloucestershire."},{"page_url":"https://en.wikipedia.org/wiki/Herculaneum_papyri","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Tesoro_letterario_di_Ercolano_p27.jpg","page_title":"Herculaneum papyri","context_page_description":"The Herculaneum papyri are more than 1,800 papyri found in the Herculaneum Villa of the Papyri, in the 18th century, carbonized by the eruption of Mount Vesuvius in AD 79.\\nThe papyri, containing a number of Greek philosophical texts, come from the only surviving library from antiquity that exists in its entirety. Most of the works discovered are associated with the Epicurean philosopher and poet Philodemus of Gadara."},{"page_url":"https://de.wikipedia.org/wiki/Langen_(Geestland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Langen_%28Geestland%29.jpg","page_title":"Langen (Geestland)","context_page_description":"Langen ist ein Ortsteil der Stadt Geestland im niedersächsischen Landkreis Cuxhaven. Bis zum 31. Dezember 2014 war Langen eine eigenständige Stadt, die sodann mit der Samtgemeinde Bederkesa zur Stadt Geestland fusionierte."},{"page_url":"https://lb.wikipedia.org/wiki/Rue_du_Fort-Neipperg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Luxembourg%2C_rue_du_Fort_Neipperg_%281%29.JPG","page_title":"Rue du Fort-Neipperg","context_page_description":"D'Rue du Fort Neipperg ass eng Strooss am Garer Quartier vun der Stad Lëtzebuerg. Se leeft vun der Aler Avenue fir d'éischt a Richtung Osten an dann - quasi parallel mat der Eisebunn - a Richtung Norde bis op d'Kräizung mam Boulevard d'Avranches an der Avenue Charles de Gaulle."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B7%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/%D0%A0%D0%BE%D1%81%D0%BE%D0%BC%D0%B0%D1%85%D0%B0_%D0%BF%D0%BE%D0%B4%D0%BE%D1%88%D0%BB%D0%B0_%D0%BA_%D1%81%D0%BB%D0%B5%D0%B4%D1%83_%D1%81%D0%BD%D0%B5%D0%B3%D0%BE%D1%85%D0%BE%D0%B4%D0%B0_%D0%B8_%D0%B2%D0%B5%D1%80%D0%BD%D1%83%D0%BB%D0%B0%D1%81%D1%8C.jpg","page_title":"Список заповедников России","context_page_description":"Государственные природные заповедники в соответствии с российским законодательством являются природоохранными, научно-исследовательскими и эколого-просветительскими учреждениями федерального значения, имеющими целью сохранение и изучение естественного хода природных процессов и явлений, генетического фонда растительного и животного мира, отдельных видов и сообществ растений и животных, типичных и уникальных экологических систем. Заповедники являются одним из типов особо охраняемых природных территорий.\\nПо состоянию на конец 2016 года на территории России действовало 103 государственных природных заповедника, суммарной площадью свыше 27 млн га."},{"page_url":"https://id.wikipedia.org/wiki/Giora_Eiland","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Msc_2004-Sunday_Morning-1100-1300-IMG_0020.jpg","page_title":"Giora Eiland","context_page_description":"Giora Eiland adalah Mayor Jenderal Pasukan Pertahanan Israel. Eiland adalah seorang mantan Dewan Keamanan Nasional Israel. Setelah ia pensiun dari sektor publik, ia menjadi anggota riset senior di Lembaga Studi Keamanan Nasional.\\nEiland adalah komentator dan kontributor meteri-materi keamanan internasional di media lokal dan luar negeri. Pada 2007, ia mendirikan perusahaan konsultasi keamanan negara dan pelayanan strategi untuk pemerintah dan organisasi antar-negara. Ia memegang gelar M.B.A. dan B.A. dalam bidang ekonomi dari Universitas Bar Ilan."},{"page_url":"https://ro.wikipedia.org/wiki/Paul_Karrer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Paul_Karrer.jpg","page_title":"Paul Karrer","context_page_description":"Paul Karrer a fost un chimist elvețian, laureat al Premiului Nobel pentru chimie."},{"page_url":"https://de.wikipedia.org/wiki/Schwedische_Fu%C3%9Fballnationalmannschaft_der_Frauen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Sweden_at_the_Women%27s_Algarve_Cup_2015_%2816708133912%29.jpg","page_title":"Schwedische Fußballnationalmannschaft der Frauen","context_page_description":"Die schwedische Fußballnationalmannschaft der Frauen ist eine vom verantwortlichen Trainer getroffene repräsentative Auswahl von schwedischen Fußballspielerinnen für ein internationales Spiel.\\nDie schwedische Frauenfußballnationalmannschaft gehört zu den erfolgreichsten Frauenfußballnationalmannschaften der Welt. Sie nahm an allen Welt- und Europameisterschaften sowie allen Olympischen Fußballturnieren der Frauen teil. Allerdings konnten sie bisher dort nur einen Titel gewinnen: 1984 wurden sie erster Europameister. Bei den folgenden Europameisterschaften gewannen sie dreimal Silber. 2003 verloren sie im Endspiel der Weltmeisterschaft gegen die deutsche Mannschaft erst durch ein Golden Goal. Sie pendelten in der offiziellen FIFA-Weltrangliste die meiste Zeit zwischen den Plätzen drei und sieben; im September 2017 belegten sie nach dem Viertelfinalaus bei der EM 2017 Rang 11, ihre bisher schlechteste Platzierung.\\nDie schwedischen Nationalspielerinnen spielen hauptsächlich in der heimischen Damallsvenskan, die lange Zeit neben der deutschen Frauenbundesliga als stärkste Liga Europas galt."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%85%E6%B0%B4%E7%94%BA_(%E5%8C%97%E6%B5%B7%E9%81%93)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/JR_Tokachi_Shimidu_sta_003.jpg","page_title":"清水町 (北海道)","context_page_description":"清水町は、北海道上川郡にある町。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_islands_of_County_Mayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Empetrum_nigrum_by_Maseltov_2.jpg","page_title":"List of islands of County Mayo","context_page_description":"This articles lists the islands of County Mayo, the mainland of which is part of the island of Ireland. Included in this list are named offshore and freshwater islands as recorded by Ordnance Survey Ireland or the Placenames Database of Ireland. Additionally, areas of ecological significance related to both offshore and freshwater islands, designated by the National Parks and Wildlife Service, are also listed.\\nAlthough County Mayo has hundreds of offshore and freshwater islands, only a handful of islands and island groups are large enough to be distinguishable on a typical map of the county, namely Achill Island, Clare Island and Inishturk, along with the island clusters of Duvillaun, Inishkea, Clew Bay and the major loughs. There are over 100 islands which are greater than 10 acres in area. The largest island is Achill, which extends to 148 km², making it Ireland's largest offshore island.\\nDue to its abundance of bays, inlets and offshore islands, Mayo has the longest coastline of any county in Ireland, at 1,168 km or approximately 21% of the total coastline of the State. The geology and geomorphology of the county and its islands is among the most varied and complex in Ireland."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%BE%D1%80%D0%B0_%D0%93%D0%B8%D0%B1%D1%80%D0%B0%D0%BB%D1%82%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Brassica_napus_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-169.jpg","page_title":"Флора Гибралтара","context_page_description":"Гибралтар является местом произрастания разнообразного растительного мира — пальмы и жакаранды, лаванда и жасмин, ломонос, жимолость, герани и бугенвиллея растут бок о бок со многими редкими видами, включая два эндемика — Iberis gibraltarica и Limonium emarginatum.\\nРастительность Гибралтара имеет, в основном, типичный средиземноморский характер. Она состоит преимущественно из плотных кустарниковых зарослей, известных как маки, но есть и другие области; более открытых и более низких кустарников, известных как гарига. Кроме кустарников являются растительные группировки крупных морских скал; ограничена, но важна скалистая береговая линия; уникальные большие песчаные склоны восточной стороны; скалистые известняковые выступления и трещины; степные условия на Мельничном холме и остатки песчаного перешейка, связывающего Гибралтар и Испанию. Гибралтар имеет как известняковую гору так и щелочную почву, в отличие от гор в близлежащий Испании, которые в значительной степени песчаниковые и грунт более кислый. В результате этого есть много видов, обитающих на Скале, которые являются редкими или их нет в окружающем регионе."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%9B%D0%B0%D0%BD%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Lahneck_Niederlahnstein_1900.jpg","page_title":"Замок Ланек","context_page_description":"Замок Ланек расположен в городе Ланштайн, Германия, в земле Рейнланд-Пфальц. Замок стоит на высоком холме у слияния реки Лан и Рейна, неподалёку от замка Марксбург.\\nЗамок, изначально упоминавшийся как Logenecke, в отличие от других рейнских крепостей никогда не выполнял таможенных функций. Построивший его в 1226 году майнцский архиепископ, курфюрст Зигфрид фон Эппштайн, таким способом защитил границы своих северных владений, в частности, расположенные поблизости серебряные копи, которые отошли к церкви в 1220 г.\\nВ 1245 в замке строится часовня, посвящённая Св. Ульриху Аугсбургскому.\\nВ 1298 король Германии Адольф Нассауский останавливается в замке перед битвой с королём Австрии Альбрехтом I.\\nВ 1332 папа Иоанн XXII предоставил 40 дневную индульгенцию каждому, кто помолится в замковой часовне.\\nВ 1633, в ходе Тридцатилетней войны, замок был занят и опустошён шведскими, а потом и императорскими войсками. С этого момента Ланек был заброшен, предоставляя лишь приют летучим мышам и бродягам.\\n18 июня 1774 года И.Гёте во время путешествия по реке Лан, вдохновлённый прекрасным романтическим видом руин замка Ланек, пишет стихотворение «Geistesgruß»."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_%D0%86%D0%BB%D0%BB%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Napoleon_I%C5%82%C5%82akowicz_selfportrait.PNG","page_title":"Наполеон Іллакович","context_page_description":"Наполеон Іллакович — польський художник і декоратор, який працював в Литві."},{"page_url":"https://pt.wikipedia.org/wiki/Nove_de_Julho_(escola_de_samba)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/G.R.C.E.S._9_DE_JULHO.jpg","page_title":"Nove de Julho (escola de samba)","context_page_description":"Grêmio Recreativo Carnavalesco Escola de Samba Nove de Julho é uma escola de samba da cidade de Bragança Paulista, no interior do estado de São Paulo. Foi fundada em 1 de Maio de 1962, suas cores são o vermelho e o branco. Já conquistou o carnaval de sua cidade 16 vezes."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B8%B2%E0%B8%A7%E0%B9%84%E0%B8%AD%E0%B8%A3%E0%B8%B4%E0%B8%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Aodh_M%C3%B3r_U%C3%AE_N%C3%A9ill_%28anglicis%C3%A9_comme%2C_Hugh_The_Great_O%27Neill%29.jpg","page_title":"ชาวไอริช","context_page_description":"ชาวไอริช เป็นกลุ่มชาติพันธุ์ชาวยุโรปตะวันตกที่มีถิ่นฐานดั้งเดิมอยู่ในไอร์แลนด์ทางตะวันตกเฉียงเหนือของยุโรป จากหลักฐานทางโบราณคดีไอร์แลนด์เป็นที่ตั้งถิ่นฐานของมนุษยชนมาราว 9,000 ปีโดยมีบรรพบุรุษของชาวไอริช ที่เป็นชนเนเมเดียน, ชนโฟโมเรียน, Fir Bolgs, Tuatha Dé Danann และ ชนมิเลเซียน —กลุ่มสุดท้ายกล่าวกันว่าเป็นกลุ่มที่เป็นบรรพบุรุษเกลลิคที่แท้จริง และยังคงใช้เป็นคำที่เรียกชนไอริชจนกระทั่งปัจจุบันนี้ กลุ่มชาติพันธุ์หลักที่มีการติดต่อกับชาวไอริชในยุคกลางก็ได้แก่ชาวสกอต และ ไวกิง และ ชาวไอซ์แลนด์โดยเฉพาะที่มีเชื้อสายไอริช การรุกรานของแองโกล-นอร์มันในยุคกลางตอนกลาง, การก่อตั้งดินแดนของอังกฤษ และต่อมาการปกครองโดยอังกฤษเป็นการนำกลุ่มชนนอร์มัน, เวลช์, เฟลมมิช, แองโกล-แซ็กซอน และ เบรทอน เข้ามาในไอร์แลนด์\\nชาวไอริชที่มีชื่อเสียงก็มีมาตลอดในประวัติศาสตร์ตั้งแต่คริสต์ศตวรรษที่ 6 เมื่อนักบวชไอริชและนักเผยแพร่ศาสนาโคลัมบานัสผู้ถือกันว่าเป็น “บิดาแห่งยุโรป” คนหนึ่ง ตามด้วยนักบุญคิลเลียน และ เวอร์กิลเลียสแห่งซอลซบวร์ก นักวิทยาศาสตร์โรเบิร์ต บอยล์ผู้ถือกันว่าเป็น “บิดาแห่งวิชาเคมี” นักสำรวจผู้มีชื่อเสียงที่เป็นชาวไอริชก็ได้แก่เบรนดันนักเดินเรือ, เอิร์นเนสต์ แช็คเคิลตัน และ ทอม ครีน"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B9%D1%86%D1%8F%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/ChinaPuyangTaiqian.png","page_title":"Тайцянь","context_page_description":"Тайця́нь — уезд городского округа Пуян провинции Хэнань."},{"page_url":"https://en.wikipedia.org/wiki/Presidency_of_Warren_G._Harding","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Warren_G._Harding_inauguration_cph.3b11806.jpg","page_title":"Presidency of Warren G. Harding","context_page_description":"The presidency of Warren G. Harding began on March 4, 1921, when Warren G. Harding was inaugurated as President of the United States, and ended when he died on August 2, 1923, a span of 881 days. Harding, the 29th United States president, presided over the country in the aftermath of World War I. A Republican from Ohio, Harding held office during a period in American political history from the mid-1890s to 1932 that was generally dominated by his party. He died of heart attack and was succeeded by Vice President Calvin Coolidge.\\nHarding took office after defeating Democrat James M. Cox in the 1920 presidential election. Running against the policies of incumbent Democratic President Woodrow Wilson, Harding won the popular vote by a margin of 26.2 percentage points, which remains the largest popular-vote percentage margin in presidential elections since the end of the Era of Good Feelings in the 1820s. Upon taking office, Harding instituted conservative policies designed to minimize the government's role in the economy. Secretary of the Treasury Andrew Mellon won passage of the Revenue Act of 1921, a major tax cut that primarily reduced taxes on the wealthy."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%B0_%D0%BD%D0%B0_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0_%D0%9A%D0%BE%D1%80%D0%B5%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Pyongyang_Movie_Theater.jpg","page_title":"Култура на Северна Корея","context_page_description":"Корейската цивилизация е една от най-старите в света, и съществува вече над 5000 години. Голяма част от културното наследство на КНДР и Република Корея се е формирало при съществуването на най-могъщата корейска държава – Чосон, царство от 1392 до 1897, и после империя до 1910. След края на Втората световна война Корейския полуостров е разделен на две части с различна идеологическа насоченост – комунистически север и капиталистически юг, вследствие на което днес се е оформила различна съвременна култура, но историческото наследство е запазено еднакво добре и в двете страни."},{"page_url":"https://ca.wikipedia.org/wiki/Juvign%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Map_commune_FR_insee_code_53123.png","page_title":"Juvigné","context_page_description":"Juvigné és un municipi francès, situat al departament de Mayenne i a la regió de País del Loira. L'any 2007 tenia 1.394 habitants."},{"page_url":"https://id.wikipedia.org/wiki/Kastil_Znojmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Znojmo_castle.jpg","page_title":"Kastil Znojmo","context_page_description":"Kastil Znojmo adalah sebuah kastil yang terletak di kota Znojmo di Moravia, Republik Ceko."},{"page_url":"https://it.wikipedia.org/wiki/Comuni_del_Bicol","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ph_locator_camarines_norte_paracale.png","page_title":"Comuni del Bicol","context_page_description":"I comuni del Bicol sono 114; per ciascuno è indicato il numero di abitanti risultante dal censimento del 2015."},{"page_url":"https://en.wikipedia.org/wiki/Armed_Forces_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/20120425_WN_S1015650_0041.jpg_-_Flickr_-_NZ_Defence_Force.jpg","page_title":"Armed Forces Day","context_page_description":"Many nations around the world observe some kind of Armed Forces Day to honor their military forces.\\nThis day is not to be confused with Veterans Day or Memorial Day."},{"page_url":"https://sv.wikipedia.org/wiki/Schienenzeppelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Bundesarchiv_Bild_102-10590%2C_Propeller-Eisenbahn_auf_der_Versuchsstrecke.jpg","page_title":"Schienenzeppelin","context_page_description":"Schienenzeppelin var en experimentell rälsbuss som konstruktionsmässigt påminner om ett luftskepp. Den utvecklades av flygingenjören Franz Kruckenberg 1929. Den framdrevs med skjutande propeller, och tillverkades bara i ett prototypexemplar. 1934 såldes det enda exemplaret till Deutsche Reichsbahn. 1939 skrotades prototypen och materialet användes i Tysklands rustningsindustri.\\nSchienenzeppelinaren kom upp i mycket höga hastigheter, som högst uppmätt 230 km/h vilket var ett världsrekord inom järnvägen ända fram till 1954. Nackdelarna med konstruktionen i form av begränsningar i möjlighet att koppla på vagnar, dålig förmåga att hantera motlut och faran med fritt roterande propellrar bland resenärerna på järnvägsstationer gjorde dock att konstruktionen hade svårt att hävda sig."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D1%85%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Tachina_magnicornis.jpg","page_title":"Тахины","context_page_description":"Тахи́ны, или ежемухи, — многочисленное семейство насекомых из подотряда короткоусых двукрылых, распространённых повсеместно. В него включают 8547 известных вида. Личинки большинства видов — внутренние паразитоиды насекомых."},{"page_url":"https://de.wikipedia.org/wiki/Beautiran","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Beautiran_%C3%89glise_Saint-Michel_01.jpg","page_title":"Beautiran","context_page_description":"Beautiran ist eine französische Gemeinde im Département Gironde in der Region Nouvelle-Aquitaine. Die Gemeinde liegt im näheren Einzugsgebiet der Stadt Bordeaux. Während Beautiran im Jahr 1962 über 1.014 Einwohner verfügte, zählt man aktuell 2222 Einwohner.\\nDie Gemeinde gehört zum Kanton La Brède im Arrondissement Bordeaux."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Bute%C8%99ti,_Teleorman","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Butesti_TR_bislemn.pridvor_crestaturi_fruntar.jpg","page_title":"Biserica de lemn din Butești, Teleorman","context_page_description":"Biserica de lemn din Butești se află în localitatea omonimă, comuna Siliștea, județul Teleorman, și poartă hramul „Sfântul Dumitru”. A fost ridicată în anul 7307 al erei bizantine, anii 1798-1799 ai erei noastre, și renovată în a doua jumătate a secolului 19. Se remarcă prin sculpturi decorative la pridvor, intrare, prin funia care încinge biserica și cea de pe tâmpla iconostasului, consolele interioare. Structura de lemn originală se păstrează în condiții bune. Biserica este înscrisă pe noua listă a monumentelor istorice, LMI 2004: TR-II-m-A-14307."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%9C%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/MD-2011-100lei-Independence.png","page_title":"Памятные монеты Молдавии","context_page_description":"Памятные и юбилейные монеты выпускаются Национальным банком Молдовы из драгоценных и недрагоценных металлов. Первыми, в 1996 году, были выпущены монеты, посвящённые 5-летию независимости Молдавии и первому участию молдавских спортсменов в Олимпийских играх.\\nВыпускаемые монеты отличаются консервативным оформлением, в частности, практически одинаковым дизайном аверса, на котором изображены герб и название государства, номинал и год выпуска, и незначительными тиражами, не превышающими, как правило, 2 тысяч экземпляров. Все монеты чеканятся в качестве proof.\\nБо́льшая часть памятных и юбилейных монет посвящена различным историческим и культурным деятелям, а также достопримечательностям Молдовы. НБМ по состоянию на 2015 год не участвовал в международных монетных программах и не выпускал инвестиционных монет.\\nВ связи с отсутствием в стране собственного монетного двора, все монеты чеканятся за рубежом: в 1996 году — на Королевском монетном дворе Великобритании, в 2000—2009 годах — на Чешском монетном дворе."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_o_Lw%C3%B3w_(1918%E2%80%931919)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Lw%C3%B3w_front_5_listopada_1918.JPG","page_title":"Bitwa o Lwów (1918–1919)","context_page_description":"Bitwa o Lwów, inaczej obrona Lwowa – polsko-ukraiński konflikt zbrojny o Lwów, trwający od 1 listopada 1918 do 22 maja 1919 roku, zakończony zniesieniem ukraińskiego okrążenia. Obrona Lwowa w 1918 była częścią wojny polsko-ukraińskiej (1918–1919).\\nWalki rozpoczęły się od opanowania 1 listopada przez żołnierzy austro-węgierskich pochodzenia ukraińskiego większości gmachów publicznych we Lwowie oraz proklamacji utworzenia Zachodnioukraińskiej Republiki Ludowej. Przeciw temu wystąpiły polskie organizacje konspiracyjne, polscy mieszkańcy Lwowa, w tym młodzież, nazwana później Orlętami Lwowskimi. W późniejszym okresie wsparcia udzieliło im powstające Wojsko Polskie. Pierwszy etap konfliktu 1918–1919 roku zakończył się w nocy z 22 na 23 listopada 1918 roku, gdy oddziały Armii Halickiej wycofały się ze Lwowa, rozpoczynając równocześnie jego oblężenie. Wobec ofensywy Wojska Polskiego wojska ukraińskie zakończyły oblężenie Lwowa i wycofały się 22 maja 1919."},{"page_url":"https://fr.wikipedia.org/wiki/Ramonville_(m%C3%A9tro_de_Toulouse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/M%C3%A9tro_Ramonville_P%2BR.jpg","page_title":"Ramonville (métro de Toulouse)","context_page_description":"La station Ramonville est le terminus sud de la ligne B du métro de Toulouse, situé sur la commune de Ramonville-Saint-Agne, au sud-est de Toulouse. C'est la seule station de la ligne B à être située en dehors de la ville de Toulouse."},{"page_url":"https://de.wikipedia.org/wiki/Helmuth_Schepp","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Aachen_Denkmal_am_Reiffmuseum.jpg","page_title":"Helmuth Schepp","context_page_description":"Helmuth Schepp war ein deutscher Bildhauer und Hochschullehrer."},{"page_url":"https://de.wikipedia.org/wiki/Kurve_kriegen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Entwicklung_des_Gesamt-Belastungsindex_in_Teilnehmer-_und_Kontrollgruppe.png","page_title":"Kurve kriegen","context_page_description":"Kurve kriegen – Dem Leben eine neue Richtung geben ist eine kriminalpräventive Initiative des Landes Nordrhein-Westfalen zur Verhinderung von Jugendkriminalität. Sie basiert auf den Handlungsempfehlungen der Enquetekommission zur Erarbeitung von Vorschlägen für eine effektive Präventionspolitik in Nordrhein-Westfalen, die im Antrag der Fraktionen von CDU, SPD, FDP und Bündnis 90/Die Grünen am 10. Juni 2008 eingesetzt wurde.\\n„Kurve kriegen“ fokussiert sich auf die Früherkennung soziobiografisch stark belasteter Mehrfachtatverdächtiger im Alter von acht bis fünfzehn Jahren, bei denen die Gefahr der Entwicklung zu sogenannten „Intensivtätern“ besteht. Die Kosten für einen solchen Intensivtäter belaufen sich zwischen seinem 14. und 25. Lebensjahr auf bis zu 1,7 Millionen Euro. Er hinterlässt dabei mehr als 100 Opfer, die teilweise – je nach Art und Schwere des Delikts – traumatisiert werden.\\nPolizei und Jugendhilfe untersuchen gemeinsam mittels einer abgestimmten und umfassenden Risikoanalyse die besonders kriminalitätsgefährdeten Kinder und jungen Jugendlichen."},{"page_url":"https://ro.wikipedia.org/wiki/Lw%C3%B3wek","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Parish_church_in_Lwowek_%281%29.jpg","page_title":"Lwówek","context_page_description":"Lwówek este un oraș în Polonia."},{"page_url":"https://hu.wikipedia.org/wiki/Santa_Maria_della_Grazia_(Lecce)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Santa_maria_lecce.jpg","page_title":"Santa Maria della Grazia (Lecce)","context_page_description":"A Santa Maria della Grazia egy templom Lecce történelmi központjában."},{"page_url":"https://pl.wikipedia.org/wiki/Centralny_Okr%C4%99g_Przemys%C5%82owy","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Henryk_Podd%C4%99bski_-_Stalowa_Wola_%28131-N-347-5%29.jpg","page_title":"Centralny Okręg Przemysłowy","context_page_description":"Centralny Okręg Przemysłowy, w skrócie COP – okręg przemysłowy przemysłu ciężkiego o powierzchni 60 000 km² i zamieszkany przez 6 mln ludzi, budowany w 1936–1939 w południowo-centralnych dzielnicach Polski. Był jednym z największych przedsięwzięć ekonomicznych II Rzeczypospolitej. Celem COP-u było zwiększenie ekonomicznego potencjału Polski, rozbudowa przemysłu ciężkiego i zbrojeniowego, a także zmniejszenie bezrobocia wywołanego skutkami wielkiego kryzysu. Zakłady COP zapewniły pracę na terenach dotkniętych największym bezrobociem, a budowa infrastruktury towarzyszącej podniosła poziom cywilizacyjny tych terenów. Na rozwój COP-u przeznaczono w latach 1937–1939 około 60% całości wydatków inwestycyjnych o łącznej wartości 1925 mln zł."},{"page_url":"https://en.wikipedia.org/wiki/President%27s_Dining_Room","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Private-dining-room-c1997.jpg","page_title":"President's Dining Room","context_page_description":"The President's Dining Room is a dining room located in the northwest corner of the second floor of the White House. It is located directly above the Family Dining Room on the State Floor and looks out upon the North Lawn. The Dining Room is adjacent to the Family Kitchen, a small kitchen designed for use by the First Family, and served by a dumbwaiter connected to the main kitchen on the ground floor.\\nThe space was originally occupied by a bedroom suite known as the Prince of Wales Room. From 1929 to 1948, this suite was known as the Lincoln Bedroom. The bedroom suite was structurally changed in 1961 to create a dining room and kitchen in the First Family's residence."},{"page_url":"https://zh.wikipedia.org/zh-cn/2019%E5%B9%B4%E6%AD%90%E6%B4%B2%E5%86%A0%E8%BB%8D%E8%81%AF%E8%B3%BD%E6%B1%BA%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Estadio_Wanda_Metropolitano_%282018%29.jpg","page_title":"2019年歐洲冠軍聯賽決賽","context_page_description":"2019年欧洲冠军联赛决赛是2018–19年欧洲冠军联赛的决赛，是由欧足联第64次举办以决出欧洲最佳球队的锦标，也是自从欧洲冠军俱乐部杯被改名为欧洲冠军联赛的第27次决赛。这场比赛于2019年6月1日马德里的万达大都会球场举行。。本届决赛由来自英超的热刺及利物浦争夺，是欧联改制后第二次于决赛出现英超内战。\\n本年度锦标获胜球队将与2018–19年欧洲联赛的冠军切尔西在2019年欧洲超级杯中对决。亦巧合地欧洲联赛决赛同样出现英超内战，故此本届欧洲三大杯提早落户英格兰。\\n在2018年3月，欧足联宣布将会在加时赛中增设第四替补球员名额，而球队的替补名额则会从7人上升至12人。比赛开始时间也从原本的21:45 改为21:00 。 这场比赛也是第一场使用视频助理裁判的欧冠决赛。\\n最终，利物浦凭借上下半场各入一球，以2-0击败首次晋级决赛的热刺，夺得队史第六座欧联奖杯，亦为2005年后再次称霸欧洲。"},{"page_url":"https://ro.wikipedia.org/wiki/Bremerhaven","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Panorama_Radarturm_Bremerhaven_25.jpg","page_title":"Bremerhaven","context_page_description":"Bremerhaven este unul din cele două orașe ale landului Bremen, Germania. Constituie în același timp și un district urban."},{"page_url":"https://it.wikipedia.org/wiki/Gwelup","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Gwelup_agricultural.jpg","page_title":"Gwelup","context_page_description":"Gwelup è un sobborgo situato nell'area metropolitana di Perth, in Australia Occidentale; esso si trova 12km a nord del centro cittadino. Al censimento del 2011 contava 3.924 abitanti.\\nIl nome \\"Gwelup\\" si riferisce a una piccola palude situata nella parte meridionale del sobborgo.\\nDeriva dalla parola Noongar \\"Gwelgannow\\" che significa \\"posizione mutevole\\".\\nIl nome appare per la prima volta nel 1878 come \\"Gwelup Swamp\\"."},{"page_url":"https://pl.wikipedia.org/wiki/Gromada_Otan%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Jezioro_Mysliborskie.jpg","page_title":"Gromada Otanów","context_page_description":"Gromada Otanów – dawna gromada, czyli najmniejsza jednostka podziału terytorialnego Polskiej Rzeczypospolitej Ludowej w latach 1954–1972.\\nGromady, z gromadzkimi radami narodowymi jako organami władzy najniższego stopnia na wsi, funkcjonowały od reformy reorganizującej administrację wiejską przeprowadzonej jesienią 1954 do momentu ich zniesienia z dniem 1 stycznia 1973, tym samym wypierając organizację gminną w latach 1954–1972.\\nGromadę Otanów z siedzibą GRN w Otanowie utworzono – jako jedną z 8759 gromad na obszarze Polski – w powiecie myśliborskim w woj. szczecińskim na mocy uchwały nr V/47/54 WRN w Szczecinie z dnia 5 października 1954. W skład jednostki weszły obszary dotychczasowych gromad Czułnów, Dąbrowa, Otanów i Sitno ze zniesionej gminy Myślibórz w tymże powiecie oraz obszar dotychczasowej gromady Derczewo ze zniesionej gminy Lipiany w powiecie pyrzyckim w tymże województwie. Dla gromady ustalono 13 członków gromadzkiej rady narodowej.\\n31 grudnia 1961 z gromady Otanów wyłączono jezioro Myślibórz, włączając je do miasta Myśliborza w tymże powiecie.\\n1 stycznia 1966 z gromady Otanów wyłączono sołectwo Dąbrowa, włączając je do gromady Myślibórz w tymże powiecie."},{"page_url":"https://en.wikipedia.org/wiki/Eric_Keast_Burke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/20555_Sapper_Eric_Keast_Burke_J02028.JPG","page_title":"Eric Keast Burke","context_page_description":"Eric Keast Burke was a New Zealand-born photographer and journalist."},{"page_url":"https://nl.wikipedia.org/wiki/Spoorlijn_aansluiting_Marne_-_Friedrichskoog_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/DB_1217_railway_map.png","page_title":"Spoorlijn aansluiting Marne - Friedrichskoog III","context_page_description":"De spoorlijn aansluiting Marne - Friedrichskoog III was een Duitse spoorlijn in Sleeswijk-Holstein en was als spoorlijn 1217 onder beheer van DB Netze."},{"page_url":"https://ro.wikipedia.org/wiki/Vitalie_Bordian","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Vitalie_Bordian.jpg","page_title":"Vitalie Bordian","context_page_description":"Vitalie Bordian este un fotbalist moldovean ce evoluează în acest moment pentru Metalist Harkiv și Echipa națională a Moldovei."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BA%D0%B0%D0%BC%D0%BF%D0%BE%D1%81,_%D0%9B%D1%83%D0%BA%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/River_Plate_2012_%28cropped%29.jpg","page_title":"Окампос, Лукас","context_page_description":"Лу́кас Ариэ́ль Ока́мпос — аргентинский футболист, вингер клуба «Севилья» и сборной Аргентины."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%DA%98%D9%88%D8%B4%DB%8C%D8%AA%D8%B3%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ko%C5%BEu%C5%A1ice%2C_n%C3%A1ves.jpg","page_title":"کوژوشیتسه","context_page_description":"کوژوشیتسه یک منطقهٔ مسکونی در جمهوری چک است که در ناحیه ویشکوو واقع شده‌است. کوژوشیتسه ۷٫۱۸ کیلومتر مربع مساحت و ۱۱۶ نفر جمعیت دارد و ۲۷۱ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Sports_car","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Lotus_Exige_-_001.jpg","page_title":"Sports car","context_page_description":"A sports car is designed to emphasise handling, performance, or thrill of driving. Sports cars originated in Europe in the early 1900s and are currently produced by many manufacturers around the world."},{"page_url":"https://tr.wikipedia.org/wiki/Cessna_172","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/GLFC9.jpg","page_title":"Cessna 172","context_page_description":"Cessna 172 Skyhawk 4 kişilik, yüksek kanatlı, tek motorlu cessna modelidir. Dünyanın en çok üretilen ayrıca en popüler eğitim uçağidir."},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_romane","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/F07.Broue.0002.JPG","page_title":"Architecture romane","context_page_description":"L'architecture romane est le premier grand style créé au Moyen Âge en Europe après le déclin de la civilisation gréco-romaine. Son développement est pleinement établi vers 1060 mais les premiers signes de mutation sont différents suivant les régions et il n'y a pas de consensus sur une date des débuts qui vont du VIᵉ au XIᵉ siècle. L'architecture gothique est le style qui lui succède progressivement à partir du XIIe siècle.Le dynamisme monastique, de profondes aspirations religieuses et morales, la spiritualité des routes de pèlerinages dans une Europe rendue à la paix président à la naissance de l'art roman et contribuent à en faire un style vraiment neuf et doué d'une profonde originalité. La volonté de libérer l'Église de la tutelle de pouvoirs séculiers, les croisades, la reconquête chrétienne en Espagne avec l'effondrement du califat de Cordoue, la disparition du mécénat royal ou princier font de l'art roman l'art de toute la chrétienté médiévale.\\nL'architecture romane s'est développée sur un vaste espace qui s'étend depuis la moitié nord de l'Espagne jusqu'à l'Irlande, l'Écosse et la moitié de la Scandinavie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_der_Gesamtanlage_Historische_Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/DE_WZ_Lahnstrasse_36_building.jpg","page_title":"Liste der Kulturdenkmäler in der Gesamtanlage Historische Altstadt","context_page_description":"Die Liste der Kulturdenkmäler in der Gesamtanlage Historische Altstadt führt die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler im Gebiet der Gesamtanlage historische Altstadt in der hessischen Kreisstadt Wetzlar auf. Die geschützten Objekte außerhalb dieser Gesamtanlage finden sich in der Liste der Kulturdenkmäler in Wetzlar."},{"page_url":"https://es.wikipedia.org/wiki/Publio_Cornelio_Escipi%C3%B3n_Nasica","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/SAG-famtree.png","page_title":"Publio Cornelio Escipión Nasica","context_page_description":"Publio Cornelio Escipión Nasica fue un político y militar romano, primo de Escipión el Africano, que alcanzó el consulado en el año 191 a. C. El sobrenombre «Nasica» hace referencia a una nariz puntiaguda."},{"page_url":"https://ca.wikipedia.org/wiki/Socialdemocr%C3%A0cia_i_Progr%C3%A9s_d%27Andorra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Logo_Progressistes_SDP.png","page_title":"Socialdemocràcia i Progrés d'Andorra","context_page_description":"Socialdemocràcia i Progrés d'Andorra és un partit polític d'Andorra d'ideologia socialdemòcrata i liberal, a favor del lliure mercat i igualtat. El partit està lidera per Víctor Naudi i Jaume Bartumeu. Es va presentar per primera vegada a les eleccions al Consell General d'Andorra de 2015 a 5 parròquies."},{"page_url":"https://ja.wikipedia.org/wiki/E-%E3%83%A1%E3%83%BC%E3%82%BF%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Scientology_e_meter_blue.jpg","page_title":"E-メーター","context_page_description":"E-メーターはサイエントロジー教会所有のゴールドベース製造の電子機器であり、専らサイエントロジー教会が使用している。E-メーターは電圧計を元に作られており、電気抵抗測定の為ホイートストンブリッジ回路を使用している。E-メーターはダイアネティックスとサイエントロジー教会のカウンセラー乃至は準カウンセラーがオーディティングの際に被治者の精神的な問題を明らかにする為に使用するとされる。この機器は正式にはサイエントロジー教会創立者L・ロン・ハバードに因んで『ハバードエレクトロメーター』と呼ばれている。\\nサイエントロジー教会はこの機器の使用を教会の訓練を受けた者に限っている。教会側は「E-メーターは宗教的な機器であり、サイエントロジー幹部乃至は準幹部のみに使用が許されている。この機器は如何なる種の疾患に対して原因を特定したり治療するものではない。この機器は被治者の精神状態やその移り変わりを計測し、計測者が被治者の問題点の発見を補助することを意図している」とコメントしている。\\n1971年、アメリカ合衆国コロンビア地方裁判所において「E-メーターは何ら病状の診断、治療、予防に役立つものではなく、医学的にも科学的にも全く身体機能の向上を期待することは出来ない 」との判決が下された。"},{"page_url":"https://hu.wikipedia.org/wiki/V%C3%ADzes%C3%A9sek_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Volcano_Osorno_and_Petrohu%C3%A9_waterfalls.JPG","page_title":"Vízesések listája","context_page_description":"A vízesések listája földrészek szerint rendezi a vízeséseket."},{"page_url":"https://de.wikipedia.org/wiki/Berliner_Au%C3%9Fenring","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Stamps_of_Germany_%28DDR%29_1976%2C_MiNr_2163.jpg","page_title":"Berliner Außenring","context_page_description":"Als Berliner Außenring wird ein 125 Kilometer langer, um das westliche Berlin verlaufender Eisenbahnring bezeichnet, eine zweigleisige, elektrifizierte Hauptbahn. Er wurde seit Anfang des 20. Jahrhunderts als Umgehungsbahn geplant und bis Anfang der 1940er Jahre zum Teil gebaut. Die DDR komplettierte ihn vor allem aus politischen und militärstrategischen Gründen zwischen 1951 und 1961, denn auf ihm ließ sich das nach dem Zweiten Weltkrieg selbständig gewordene West-Berlin umfahren. Ohne die Fertigstellung des Außenringes wäre es verkehrstechnisch nicht möglich gewesen, die Berliner Mauer zu errichten, d. h. den Zugang zum Westteil der Stadt zu unterbinden. Ein entsprechendes Straßenprojekt war die Schnellstraße Potsdam–Schönefeld.\\nDie Bezeichnung Außenring dient zur Unterscheidung von der älteren, im Inneren der Stadt gelegenen Berliner Ringbahn."},{"page_url":"https://ca.wikipedia.org/wiki/Friedrich_Wolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Bundesarchiv_Bild_183-14811-0013%2C_Berlin%2C_3._Deutscher_Schriftsteller-Kongress_cropped.jpg","page_title":"Friedrich Wolf","context_page_description":"Friedrich Wolf va ser un metge i escriptor alemany."},{"page_url":"https://fr.wikipedia.org/wiki/Eva_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Eva_Green_%28Headshot%29.jpg","page_title":"Eva Green","context_page_description":"Eva Gaëlle Green /eva gaɛl gʁeːn/ est une actrice française, née le 6 juillet 1980 à Paris.\\nElle commence sa carrière par le théâtre avec la pièce Jalousie en trois fax en 2001. Son interprétation lui vaut d'être nommée au Molière de la révélation théâtrale féminine l'année suivante. Plus attirée par le cinéma, elle se fait remarquer par la critique en 2003 pour sa performance difficile — elle apparaît nue à plusieurs reprises — dans Innocents: The Dreamers de Bernardo Bertolucci.\\nLauréate d'un Rising Star Award en 2007, elle alterne alors superproductions, telles que Kingdom of Heaven, Casino Royale — où elle interprète la James Bond girl Vesper Lynd —, À la croisée des mondes : La Boussole d'or ou 300 : La Naissance d'un empire, et films indépendants comme Dark World, Cracks, Womb, Perfect Sense ou encore White Bird.\\nElle joue également dans quelques séries, interprétant la fée Morgane dans Camelot en 2011 et Vanessa Ives dans Penny Dreadful de 2014 à 2016. Ce dernier rôle lui apporte d'excellentes critiques et de nombreuses récompenses et nominations."},{"page_url":"https://fr.wikipedia.org/wiki/Dirksen_Federal_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Dirksen_Federal_Building.jpg","page_title":"Dirksen Federal Building","context_page_description":"Le Dirksen Federal Building est un gratte-ciel situé dans le centre de la ville de Chicago, dans l'État de l'Illinois aux États-Unis. Son adresse est le 219 South Dearborn Street, dans le secteur financier du Loop, en plein centre-ville de Chicago.\\nLe Dirksen Federal Building a été conçu par l'architecte allemand Ludwig Mies van der Rohe et construit entre 1960 et 1964. D'une hauteur de 117 m, l'immeuble possède 30 étages et a été nommé en honneur à Everett Dirksen, représentant au Congrès et sénateur de l'Illinois.\\nIl abrite des bureaux fédéraux tels que le United States Court of Appeals for the Seventh Circuit, le United States District Court pour le District Nord de l'Illinois, le United States Bankruptcy Court, le United States Marshal pour le District Nord de l'Illinois, le United States Attorney pour le District Nord de l'Illinois, ainsi que des bureaux pour des agences fédérales variées.\\nIl est l'un des trois bâtiments qui composent le complexe moderne appelé Federal Plaza, également conçu par Ludwig Mies van der Rohe, avec l'US Post Office et le Kluczynski Federal Building."},{"page_url":"https://en.wikipedia.org/wiki/Red-eye_effect","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Shiro_200504-2.jpg","page_title":"Red-eye effect","context_page_description":"The red-eye effect in photography is the common appearance of red pupils in color photographs of the eyes of humans and several other animals. It occurs when using a photographic flash that is very close to the camera lens in ambient low light."},{"page_url":"https://pt.wikipedia.org/wiki/Geria","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Geria.jpg","page_title":"Geria","context_page_description":"Geria é um município da Espanha na província de Valladolid, comunidade autónoma de Castela e Leão, de área 18,02 km² com população de 478 habitantes e densidade populacional de 26,25 hab/km²."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%A6%E0%A5%80%E0%A4%B0%E0%A5%8D%E0%A4%98%E0%A4%BF%E0%A4%95%E0%A4%BE%E0%A4%82%E0%A4%9A%E0%A5%87_%E0%A4%B8%E0%A4%82%E0%A4%B0%E0%A4%9A%E0%A4%A8%E0%A4%BE%E0%A4%A7%E0%A4%BE%E0%A4%B0%E0%A4%BF%E0%A4%A4_%E0%A4%B5%E0%A4%B0%E0%A5%8D%E0%A4%97%E0%A5%80%E0%A4%95%E0%A4%B0%E0%A4%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Hubble-Vaucouleurs.png","page_title":"दीर्घिकांचे संरचनाधारित वर्गीकरण","context_page_description":"दीर्घिकांचे संरचनात्मक वर्गीकरण ही दीर्घिकांचे त्यांच्या दृश्य स्वरूपावरून विविध गटात वर्गीकरण करणारी पद्धत आहे. दीर्घिकांचे वर्गीकरण करणाऱ्या अनेक पद्धती आहेत. त्यातील सर्वात प्रसिद्ध पद्धत एडविन हबल याने बनवलेली हबल अनुक्रम ही आहे. पुढे जेरार्ड् डि वोकूला आणि ॲलन सॅंडेज यांनी तिचा विस्तार केला."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_Finist%C3%A8re_(A-O)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Tumulus_Kerelcun.jpg","page_title":"Liste des monuments historiques du Finistère (A-O)","context_page_description":"Cet article recense une partie des monuments historiques du Finistère, en France."},{"page_url":"https://fr.wikipedia.org/wiki/Hilda_Gobbi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Gobbi_Alajos_1906.jpg","page_title":"Hilda Gobbi","context_page_description":"Hilda Gobbi, née à 6 juin 1913 à Budapest et morte le 13 juillet 1988 dans la même ville, est une actrice hongroise connue pour ses rôles de femmes âgées. Membre de la Résistance hongroise pendant la Seconde Guerre mondiale, elle contribua aussi à des œuvres caritatives, comme une maison de retraite pour acteurs."},{"page_url":"https://mk.wikipedia.org/wiki/A%D0%BA%D1%83%D1%81%D1%82%D0%B8%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Rfel_vsesmer_front.png","page_title":"Aкустика","context_page_description":"Акустиката е гранка на физиката која се занимава со проучување на сите механички бранови на гасови, течности и цврсти материи вклучувајќи теми како што се вибрации, звук, ултразвук и инфразвук. Научник кој работи во областа на акустиката е акустичар, додека некој што работи во областа на акустичната технологија може да се нарече акустичен инженер. Примената на акустиката е присутна во речиси сите аспекти на современото општество, а најочигледна е индустријата за контрола на звукот и бучавата.\\nСлушањето е едно од најважните средства за преживување во животинскиот свет, а говорот е една од најрелигиозните карактеристики на човековиот развој и култура. Според тоа, науката за акустика се шири низ многу аспекти на човечкото општество - музика, медицина, архитектура, индустриско производство, војна и многу повеќе. Исто така, животинските видови, како што се птиците и жабите, го користат звукот и слухот како клучен елемент на ритуалите на парење или означување на териториите. Уметноста, занаетот, науката и технологијата се провоцираа меѓусебно да напредуваат како целина, како и во многу други области на знаење."},{"page_url":"https://fr.wikipedia.org/wiki/Nikola%C3%AF_Tana%C3%AFev","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%A2%D0%B0%D0%BD%D0%B0%D0%B5%D0%B2.jpg","page_title":"Nikolaï Tanaïev","context_page_description":"Nikolaï Timofeïevitch Tanaïev né le 5 novembre 1945 à Mikhaïlovka dans l'oblast de Penza en république socialiste fédérative soviétique de Russie et mort le 19 juillet 2020 à Moscou, est un homme politique de citoyenneté kirghize et de nationalité russe, ancien Premier ministre du Kirghizstan entre le 22 mai 2002 et le coup d'État du 24 mars 2005."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%A4%E5%B2%9B%E6%B5%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Bengtsk%C3%A4r_lighthouse.JPG","page_title":"群岛海","context_page_description":"群島海是波羅的海的一部份。位於波的尼亞灣和芬蘭灣之間的芬蘭領海。群島海中的島很小，而且聚集在一個細小的區域；但是以島的數量計，群島海是世界最大的多島海。群島海的地貌主要由冰川作用構造而成。\\n海域中較大的一些島嶼有居民居住，並有輪渡和橋樑連接。包括本海域中一些較大島嶼的奧蘭群島是芬蘭的一個自治區域。其它的島嶼則屬於西南芬蘭區管轄。群島海也是著名的旅遊勝地之一。"},{"page_url":"https://de.wikipedia.org/wiki/Dingdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/St._Josef_%28Dingdorf%29_10.jpg","page_title":"Dingdorf","context_page_description":"Dingdorf ist eine Ortsgemeinde im Eifelkreis Bitburg-Prüm in Rheinland-Pfalz. Sie gehört der Verbandsgemeinde Prüm an."},{"page_url":"https://eu.wikipedia.org/wiki/Montgaillard_(Ari%C3%A8ge)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Martinet_de_forge_%C3%A0_Montgaillard.JPG","page_title":"Montgaillard (Ariège)","context_page_description":"Montgaillard Okzitaniako udalerri bat da. Administratiboki Frantziako Ariège departamenduan dago, Okzitania eskualdean. 2013an 1461 biztanle zituen."},{"page_url":"https://en.wikipedia.org/wiki/Ferret","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Vinnie_the_Ferret_in_a_War_Dance_Jump.jpg","page_title":"Ferret","context_page_description":"The ferret is the domesticated form of the European polecat, a mammal belonging to the same genus as the weasel, Mustela, in the family Mustelidae. Their fur is typically brown, black, white, or mixed. They have an average length of 51 cm, including a 13 cm tail, weigh about between 0.7 and 2.0 kg, and have a natural lifespan of 7 to 10 years. Ferrets are sexually dimorphic predators, with males being substantially larger than females.\\nThe history of the ferret's domestication is uncertain, like that of most other domestic animals, but it is likely that they have been domesticated for at least 2,500 years. They are still used for hunting rabbits in some parts of the world, but increasingly they are kept only as pets.\\nBeing so closely related to polecats, ferrets easily hybridize with them, and this has occasionally resulted in feral colonies of polecat–ferret hybrids that have caused damage to native fauna, especially in New Zealand. As a result, New Zealand and some other parts of the world have imposed restrictions on the keeping of ferrets.\\nSeveral other mustelids also have the word ferret in their common names, including the black-footed ferret, an endangered species."},{"page_url":"https://de.wikipedia.org/wiki/Amtshof_Bad_Lauchst%C3%A4dt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Bad_Lauchst%C3%A4dt%2C_the_former_district_offices.jpg","page_title":"Amtshof Bad Lauchstädt","context_page_description":"Der Amtshof Bad Lauchstädt ist ein denkmalgeschützter Gebäudekomplex in der Stadt Bad Lauchstädt in Sachsen-Anhalt. Im örtlichen Denkmalverzeichnis ist er unter der Erfassungsnummer 094 20657 als Baudenkmal verzeichnet."},{"page_url":"https://pl.wikipedia.org/wiki/Peritiba","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Brasao_peritiba.png","page_title":"Peritiba","context_page_description":"Peritiba – miasto i gmina w Brazylii, w stanie Santa Catarina. Znajduje się w mezoregionie Oeste Catarinense i mikroregionie Concórdia."},{"page_url":"https://en.wikipedia.org/wiki/Shire_of_Mansfield_(former)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Old_lga_Mansfield.png","page_title":"Shire of Mansfield (former)","context_page_description":"The Shire of Mansfield was a local government area about 185 kilometres northeast of Melbourne, the state capital of Victoria, Australia. The shire covered an area of 3,919.10 square kilometres, and existed from 1865 until 1994."},{"page_url":"https://ceb.wikipedia.org/wiki/Lamoille_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Hyde_park_courthouse_20040313.jpg","page_title":"Lamoille County","context_page_description":"Kondado ang Lamoille County sa Tinipong Bansa. Nahimutang ni sa estado sa Vermont, sa sidlakang bahin sa nasod, 700 km sa amihanan-sidlakan sa Washington, D.C. Adunay 24,475 ka molupyo. Naglangkob kin og 1,201 ka kilometro kwadrado. Lamoille County mopakigbahin sa usa ka utlanan sa Orleans County, Caledonia County, Washington County, Chittenden County, ug Franklin County ang ulohan sa nasod.\\nAng yuta sa Lamoille County kay kasagaran kabungtoran.\\nLamoille County may sa mosunod nga mga subdibisyon:\\nBelvidere\\nCambridge\\nEden\\nElmore\\nHyde Park\\nJohnson\\nMorristown\\nStowe\\nWaterville\\nWolcott\\nMga lungsod sa Lamoille County:\\nMorristown\\nStowe\\nMorrisville\\nJohnson\\nJeffersonville\\nHyde Park\\nCambridge\\nSa mosunod nga mga natural nga mga bahin makita sa Lamoille County:\\nMga kalapukan:\\nBear Swamp\\nMga suba:\\nBahannan Brook\\nBaldin Brook\\nBarnes Brook\\nBarrows Brook\\nBasin Brook\\nBeaver Meadow Brook\\nBeaver Meadow Brook\\nBedell Brook\\nBelding Pond Brook\\nBell Brook\\nBoomhour Branch\\nBoulley Brook\\nBrewster River\\nBruce Brook\\nCalavale Brook\\nCenterville Brook\\nClark Brook\\nCodding Brook\\nCurrier Brook\\nDark Branch\\nElmore Pond Brook\\nFoot Brook\\nFrench Hill Brook\\nFryingpan Brook\\nGallup Branch\\nGihon River\\nGold Brook\\nGreen River"},{"page_url":"https://hu.wikipedia.org/wiki/Egyes%C3%ADtett_c%C3%ADmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Hedvig_kir%C3%A1lyn%C3%A9_pecs%C3%A9te.PNG","page_title":"Egyesített címer","context_page_description":"Az egyesített címer olyan összetett címer, mely nemcsak egy, hanem több pajzsból áll. Az egyesített címer általában több különálló címert egyesít több pajzson. Az egymástól eltérő pajzsok új címerviselő neve alatt szerepelnek tovább.\\nAz egyesítés történhet: a. a pajzsok összeállítása által, amikor kettőt egymás felé dőlve, hármat háromszögben, négyet egymás alá 1.2.1 sorrendben, ennél többet általában félkörben és körben állítanak össze, az utóbbi esetben a főcímer középen van; b. a pajzsok egymás mellé állításával úgy, hogy szélükkel érintik egymást; c. a pajzsok összekötése által."},{"page_url":"https://fr.wikipedia.org/wiki/Sundhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Reinkenhagen%2C_Dorfkirche%2C_von_der_Stra%C3%9Fe_aus_%282008-08-01%29.JPG","page_title":"Sundhagen","context_page_description":"Sundhagen est une commune de l'arrondissement de Poméranie-Occidentale-Rügen, dans la région de Poméranie occidentale, dans le Land de Mecklembourg-Poméranie occidentale en Allemagne."},{"page_url":"https://fr.wikipedia.org/wiki/Graphidaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Glyphis_cicatricosa_81672.jpg","page_title":"Graphidaceae","context_page_description":"Les Graphidaceae sont une famille de champignons ascomycètes. Il s'agit de lichens corticoles au thalle encroûtant le plus souvent immergé dans le substrat, et associés à des algues vertes de la famille des Trentepohliaceae. Les organes de reproduction sexuée sont des apothécies dont le disque est généralement de forme allongée, simple ou ramifiée, rappelant des signes d'écriture ancien, d'où le nom de Graphis. La famille comporte plus de 600 espèces valides, majoritairement tropicales, dont plus de 300 dans le seul genre Graphis et 150 pour Phaeographis."},{"page_url":"https://es.wikipedia.org/wiki/Staropramen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Staropramen.jpg","page_title":"Staropramen","context_page_description":"Pivovary Staropramen s.r.o. es una empresa cervecera checa, el segundo mayor fabricante de cerveza del país, situado en el distrito Smichov de Praga. Se fundó en 1869 y el nombre de la marca, que significa literalmente \\"fuente antigua\\" fue registrado en 1911. Es propiedad de Molson Coors y sus productos se exportan a 37 países, principalmente a Europa y Norte América. Se ha convertido en una de las lager favoritas en Irlanda, donde compite con la Guinness."},{"page_url":"https://eu.wikipedia.org/wiki/Boeing_B-47_Stratojet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/22d_Bombardment_Wing_Boeing_B-47E-55-BW_Stratojet_51-2394.jpg","page_title":"Boeing B-47 Stratojet","context_page_description":"Boeing B-47 Stratojet, AEBetako bonbaketaria eta miaketa-hegazkin bat da. Boeing hegazkinlaritza konpainiak ekoitzi eta 1947ko abenduaren 17an lehenbiziko hegaldia burutu zuen. AEBetako Aire Armadak erabili zuen. 2.032 unitate ekoitzi ziren.\\nAbiadura supersonikoan hegan egiteko gai zen, nagusiki Sobietar Batasunaren aire eremuan barneratzeko diseinatua izan zen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%BE%BE%E6%B4%9B%E5%B0%94%E7%81%AB%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/ET_Afar_asv2018-01_img43_Dallol.jpg","page_title":"达洛尔火山","context_page_description":"達洛爾火山是衣索比亞阿法爾州的一座火山渣錐，位於埃塔阿雷山脈東北部的達納基勒窪地。達洛爾火山海拔為負48米，是世界上海拔最低的火山口。"},{"page_url":"https://en.wikipedia.org/wiki/Hermann_Ungar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Hermann_Ungar.jpg","page_title":"Hermann Ungar","context_page_description":"Hermann Ungar was a Czech-Jewish writer and an officer in Czechoslovakia's Ministry of Foreign Affairs."},{"page_url":"https://en.wikipedia.org/wiki/Harnham","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Old_Mill%2C_Harnham_-_geograph.org.uk_-_1148457.jpg","page_title":"Harnham","context_page_description":"Harnham is a suburb of the city of Salisbury in Wiltshire, England, centred about 0.6 miles south of Salisbury Cathedral and across the River Avon. Harnham is split into the areas of West Harnham and East Harnham."},{"page_url":"https://hu.wikipedia.org/wiki/Williams_FW19","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Williams_FW19_front-left_2017_Williams_Conference_Centre_2.jpg","page_title":"Williams FW19","context_page_description":"A Williams FW19 egy Formula–1-es versenyautó, amelyet a WilliamsF1 tervezett az 1997-es Formula–1 világbajnokságra. Két pilótája a csapatnál második évét kezdő Jacques Villeneuve és a Sauber istállótól Damon Hill helyére igazolt Heinz-Harald Frentzen voltak.\\nAz autó az előző évi, rendkívül sikeres FW18-as továbbfejlesztése volt, amellyel megnyerték mindkét bajnoki címet. Ez volt az utolsó Williams, amit még Adrian Newey tervezett, aki már 1997 elején elhagyta a csapatot, így munkáját Geoff Willis fejezte be. Ugyancsak utolsó volt az autó a Renault-motoros Williamsek hosszú sorában, miután a Renault pár évre kivonult a Forma-1-ből. Az új kasztni könnyebb és tömzsibb lett, mint elődje.\\nAz 1997-es év izzasztóbb volt a Williams számára, mert Michael Schumacher és a Ferrari személyében komoly kihívót kaptak. A szezonzáró európai nagydíjon Schumacher sportszerűtlen módon ütközött Villeneuve-vel, így a kanadaié lett a világbajnoki cím, míg a csapat már az előző japán futamon bebiztosította a konstruktőri címet. Frentzen nem teljesített az elvárásoknak megfelelően, mert csak egy versenyt nyert Villeneuve hét győzelmével szemben."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%82%D9%84%D8%A7%D8%B9_%D8%A5%D9%8A%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Falakolaflak.jpg","page_title":"قائمة قلاع إيران","context_page_description":"القلاع في إيران تُعتبَر القلاع نوع من الأبنية المحصنة والتي كانت تُبنى في أوروبا والشرق الأوسط خلال العصور الوسطى من قبل طبقة النبلاء. نجدها دائماً في أماكن هامة مما يجعلها شاهدة على التأريخ، فنجدها خاضت المعارك، وحيكت حولها الأساطير. وأصبحت على مدى السنوات مصدر فخر وإلهام لشعوبها."},{"page_url":"https://nl.wikipedia.org/wiki/Havasu_Creek","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Dry_navajo_falls.JPG","page_title":"Havasu Creek","context_page_description":"Havasu Creek is een zijrivier van de Colorado, die loopt door Arizona. De benedenloop van de rivier loopt door een canyon in het Indianenreservaat van de Havasupais en mondt uit in de Colorado in Grand Canyon Nationaal Park."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%B0%D0%BC%D1%8B%D1%85_%D0%B2%D1%8B%D1%81%D0%BE%D0%BA%D0%B8%D1%85_%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B9_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%D0%9B%D0%B0%D1%85%D1%82%D0%B0-%D1%86%D0%B5%D0%BD%D1%82%D1%80_%28%D0%B8%D1%8E%D0%BD%D1%8C_2018_%D0%B3%D0%BE%D0%B4%D0%B0%29.jpg","page_title":"Список самых высоких зданий России","context_page_description":"Список самых высоких зданий России включает небоскрёбы и высотные здания высотой 130 и более метров. Для жилых зданий, высота которых неизвестна, но известна этажность, общая высота вычисляется по формуле, рекомендуемой специалистами Совета по высотным зданиям и городской среде: для жилых зданий и отелей высота этажа принимается равной 3,1 м, для офисных — 3,9 м, для многофункциональных — 3,5 м. Соответственно, критерий включения в список для зданий с неизвестной высотой является следующим: 42 этажа для жилых зданий, 37 этажей для многофункциональных, 33 этажа для офисных.\\nПод зданиями здесь понимаются наземные строительные сооружения с помещениями для проживания и деятельности людей, размещения производств, хранения продукции или содержания животных. Телебашни, мачты, трубы и прочие технические строения, предназначенные для отличных от вышеизложенных целей, в список не включаются.\\nСамым высоким в России, а также в Европе, является 462-метровый 88-этажный небоскрёб Лахта-центр в нестоличном Санкт-Петербурге."},{"page_url":"https://en.wikipedia.org/wiki/Jerry_Lucas","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Jerry_Lucas_1965.jpeg","page_title":"Jerry Lucas","context_page_description":"Jerry Ray Lucas is an American former basketball player. He was a nationally awarded high school player, national college star at Ohio State, and 1960 gold medal Olympian and international player before later starring as a professional player in the National Basketball Association.\\nAs a collegian, Lucas led the Ohio State Buckeyes to three straight NCAA finals, winning the national championship in 1960, and finishing as runner-up in 1961 and 1962. He is the only three-time Big Ten Basketball Player of the Year, and was named the NCAA Player of the Year in 1961 and 1962 by the United States Basketball Writers Association, the Associated Press, and the Sporting News.\\nAs a professional, Lucas was named All-NBA First Team three times, All-NBA Second Team twice, an NBA All-Star seven times, was the 1964 NBA Rookie of the Year, and was named Most Valuable Player of the 1965 NBA All-Star Game among other honors and awards. He was inducted to the Naismith Memorial Basketball Hall of Fame in 1980."},{"page_url":"https://ca.wikipedia.org/wiki/Craig_(Colorado)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Craig%2C_Colorado.JPG","page_title":"Craig (Colorado)","context_page_description":"Craig és una població dels Estats Units a l'estat de Colorado. Segons el cens del 2000 tenia una població de 9.189 habitants."},{"page_url":"https://nl.wikipedia.org/wiki/Kabinet-Wever-Croes_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/180531_Wever-Croes_Aruba_bij_Blok_%2828597045908%29_%28cropped%29.jpg","page_title":"Kabinet-Wever-Croes I","context_page_description":"Het kabinet Wever-Croes I is het kabinet van Aruba, dat werd geïnstalleerd op 17 november 2017. Evelyn Wever-Croes is de minister-president. Zij is de vierde premier van Aruba, de eerste vrouwelijke premier en de tweede premier namens de partij MEP. Het kabinet is een coalitie van de partijen MEP, POR en RED. Het is het eerste kabinet waarin POR en RED regeringsdeelname hebben."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A8%D0%B5%D0%B7-%D0%94%D1%8C%D0%B5-%D0%B4%D1%8E-%D0%A2%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Mairie_Chaise-Dieu-du-Theil.JPG","page_title":"Шез-Дье-дю-Тей","context_page_description":"Шез-Дье-дю-Тей — Францин гӀала-коммуна, лаьтта Норманди регионехь. Коммунан департамент — Эр. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://nl.wikipedia.org/wiki/Alfons_Hertogs","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Alfons_Hertogs.jpg","page_title":"Alfons Hertogs","context_page_description":"Petrus Josephus Alphonsus Hertogs was een Belgisch liberaal politicus en burgemeester van de stad Antwerpen.\\nHertogs stamde uit een ondernemersfamilie en was zelf aannemer van openbare werken. Hij behoorde tot de vrijzinnige strekking van de liberalen en werd in 1887 gemeenteraadslid. In 1891 werd Hertogs schepen van Openbare Werken. In 1895 werd hij echter niet herkozen en stapt daarom over naar de kerkelijke strekking van de liberalen.\\nBij het overlijden van Jan Van Rijswijck werd waarnemend burgemeester Victor Desguin door de liberalen naar voren geschoven als nieuwe burgemeester. De katholieke regering-De Trooz benoemde echter Hertogs, die goede contacten had met eerste minister Jules de Trooz, tot burgemeester.\\nZijn voornaamste verwezenlijking als burgemeester was het breken van de havenstaking van 1907, een van de zwaarste conflicten uit de Antwerpse geschiedenis. Hertogs speelde een cruciale rol als bemiddelaar.\\nIn 1908 stierf Alfons Hertogs tijdens het bijwonen van een turnfeest.\\nHertogs was ondervoorzitter van de Wereldtentoonstelling van 1894 in Antwerpen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Mississippian_sites","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Angel_Mounds_HRoe_2015_300px.jpg","page_title":"List of Mississippian sites","context_page_description":"This is a list of Mississippian sites. The Mississippian culture was a mound-building Native American culture that flourished in what is now the Midwestern, inland-Eastern, and Southeastern United States from approximately 800 CE to 1500 CE, varying regionally. Its core area, along the Mississippi River, stretched from sites such as Cahokia in modern Illinois, to Mound Bottom in Tennessee, to the Winterville site in the state of Mississippi. Temple mound complexes further extend from Aztalan in Wisconsin to Crystal River in Florida, and from Fort Ancient now in Ohio to Spiro in Oklahoma, while Mississippian cultural influences extended as far north and west, as modern North Dakota."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B2%D0%B0%D1%80%D0%BE%D0%B2,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Fedor_Petrovich_Uvarov.jpg","page_title":"Уваров, Фёдор Петрович","context_page_description":"Фёдор Петро́вич Ува́ров — старший генерал-адъютант в Свите Александра I, участник многих сражений Наполеоновских войн, генерал от кавалерии, первый шеф Кавалергардского полка."},{"page_url":"https://en.wikipedia.org/wiki/Naparaye","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Nubian-Queen.jpg","page_title":"Naparaye","context_page_description":"Naparaye was a Nubian queen dated to the Twenty-fifth Dynasty of Egypt.\\nNaparaye was the daughter of King Piye and the sister-wife of King Taharqa.\\nShe held several titles: Great of Grace, Great of Praises, Sweet of Love, King's Wife, Lady of the Two Lands, and King's Sister.\\nNaparaye's name is known from her tomb in el-Kurru. At her pyramid an alabaster offering table was found."},{"page_url":"https://en.wikipedia.org/wiki/Sn%C3%A6fellsj%C3%B6kull","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Sn%C3%A6fellsj%C3%B6kull_in_the_Morning_%287622876302%29.jpg","page_title":"Snæfellsjökull","context_page_description":"Snæfellsjökull is a 700,000-year-old glacier-capped stratovolcano in western Iceland. It is situated on the most western part of the Snæfellsnes peninsula in Iceland. Sometimes it may be seen from the city of Reykjavík over Faxa Bay, at a distance of 120 km.\\nThe mountain is one of the most famous sites of Iceland, primarily due to the novel Journey to the Center of the Earth by Jules Verne, in which the protagonists find the entrance to a passage leading to the center of the earth on Snæfellsjökull.\\nThe mountain is included in the Snæfellsjökull National Park.\\nIn August 2012 the summit was ice-free for the first time in recorded history."},{"page_url":"https://sv.wikipedia.org/wiki/Inimicus_filamentosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Inimicus_Filamentus.jpg","page_title":"Inimicus filamentosus","context_page_description":"Inimicus filamentosus är en fiskart som först beskrevs av Cuvier 1829. Inimicus filamentosus ingår i släktet Inimicus och familjen Synanceiidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_orgues_de_Basse-Normandie_prot%C3%A9g%C3%A9s_aux_monuments_historiques","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%C3%89glise_Saint-Martin_de_R%C3%A9ville_-_Orgue.JPG","page_title":"Liste des orgues de Basse-Normandie protégés aux monuments historiques","context_page_description":"Cet article recense les orgues protégés à titre d'objets monuments historiques des départements du Calvados, de l'Orne et de la Manche de la région Normandie, France.\\nLes orgues des départements de l'Eure et de la Seine-Maritime font l'objet de la liste des orgues de Haute-Normandie protégés aux monuments historiques."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BA%93%E9%9B%B7%E8%90%A8%E9%9B%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Kuressaare_Laurentiuse_kirik.jpg","page_title":"库雷萨雷","context_page_description":"库雷萨雷，或称阿伦斯堡，位于爱沙尼亚萨雷马岛南部里加湾畔，是萨雷县的首府。"},{"page_url":"https://ca.wikipedia.org/wiki/Nicolaus_Mameranus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Mameranus_Statu.jpg","page_title":"Nicolaus Mameranus","context_page_description":"Nicolaus Mameranus va ser un soldat i historiador luxemburguès sota el mandat de Carles V del Sacre Imperi Romanogermànic, per al que va viatjar molt, enregistrant fidelment la composició dels tribunals i els costums dels països estrangers. Tots els seus escrits estan en llatí. Mameranus va néixer a Mamer, probablement amb el nom de Nik Wagener. Probablement va morir a Augsburg, Alemanya, el 1567.\\nEll va aconseguir que Carles V es fes càrrec de les despeses per a la restauració de la seva Mamer nativa després que les tropes del duc Carles II d'Orleans la van saquejar el 1543.\\nEl 1555, Carles V el va nomenar poeta llorejat i comte palatí en reconeixement a la seva contínua fidelitat."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%B8%D0%B9_%D0%9B%D1%83%D0%BA%D0%B0_%D0%BC%D0%B0%D0%BB%D1%8E%D1%94_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Rogier_van_der_Weyden_-_St_Luke_Drawing_a_Portrait_of_the_Madonna_%28detail%29_-_WGA25584.jpg","page_title":"Святий Лука малює Богородицю","context_page_description":"Святий Лука малює Богородицю — картина нідерландського живописця французького походження Рогіра ван дер Вейдена."},{"page_url":"https://de.wikipedia.org/wiki/Explorer_7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Installing_Explorer_VII.jpg","page_title":"Explorer 7","context_page_description":"Explorer 7 ist ein Satellit des Explorer-Programms der NASA. Er wurde am 13. Oktober 1959 mit einer Juno II-Rakete von Cape Canaveral aus in seine Umlaufbahn geschossen. Er wurde gebaut, um Sonnenstrahlung im Röntgen- und Lyman-alpha-Bereich, sowie kosmische Teilchenstrahlung zu erfassen. Als weitere Ziele sollten Daten über die Entschläge von Mikrometeoriten, molekulares Sputtern sowie den Wärmeaustausch zwischen der Erde und ihrer Atmosphäre gesammelt werden. Insbesondere nahm er mithilfe eines von Verner E. Suomi und Robert Parent entwickelten Radiometers die ersten Daten zum Energiehaushalt der Erde auf und markierte damit den Anfang satellitengestützter Klimaforschung. Suomi und sein Team benutzten diese Daten unter anderem, um die Bedeutung der Wolken für das Weltklima zu untersuchen.\\nDer Satellit sendete bis zum Februar 1961 kontinuierlich Daten und fiel schließlich am 24. August 1961 aus. Er befindet sich noch immer in seinem Orbit."},{"page_url":"https://en.wikipedia.org/wiki/Chris_Morris_(satirist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Chris_Morris_2010.jpg","page_title":"Chris Morris (satirist)","context_page_description":"Christopher J Morris is an English comedian, writer, director, actor and producer. He is known for his black humour, surrealism, and controversial subject matter. He has been praised for his \\"uncompromising, moralistic drive\\" by the British Film Institute.\\nIn the early 1990s, Morris teamed up with his radio producer, Armando Iannucci, to create On the Hour, a satire of news programmes. This was expanded into a television spin off, The Day Today, which launched the career of Steve Coogan, and has since been hailed as one of the most important satirical shows of the 1990s. Morris further developed the satirical news format with Brass Eye, which lampooned celebrities whilst focusing on themes such as crime and drugs. For many, the apotheosis of Morris' career was a Brass Eye special, which dealt with the moral panic surrounding paedophilia. It quickly became one of the most complained about programmes in British television history, leading the Daily Mail to describe him as \\"the most loathed man on TV\\".\\nMeanwhile, Morris's postmodern sketch comedy and ambient music radio show Blue Jam, which had seen controversy similar to Brass Eye, helped him to gain a cult following."},{"page_url":"https://es.wikipedia.org/wiki/Reserva_natural_y_cultural_Cerro_Colorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Pintura_rupestre_de_Cerro_Colorado_05.jpg","page_title":"Reserva natural y cultural Cerro Colorado","context_page_description":"La Reserva cultural natural Cerro Colorado es uno de los volcanesarqueológicos más importantes de Argentina.​ Está situada en la intersección de los departamentos Río Seco, Sobremonte y Tulumba, en la provincia de Córdoba. Tiene una superficie de 3.000 hectáreas, ​ abarcando los cerros Colorado, Veladero e Intihuasi, en las últimas estribaciones de las sierras bajas del norte.\\nEs considerada la cuarta Maravilla Natural de Córdoba."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B5%D0%BD%D1%81%D0%B1%D1%83%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Am_Hafen_in_Flensburg.jpg","page_title":"Фленсбург","context_page_description":"Фле́нсбург — самый северный в Германии город земельного подчинения, расположен в земле Шлезвиг-Гольштейн. Фленсбург — третий по величине город земли после Киля и Любека и центр региона Южный Шлезвиг.\\nВ мае 1945 года Фленсбург был центром последнего в Германии нацистского правительства, так называемого Фленсбургского правительства, возглавляемого Карлом Дёницем. Оно просуществовало одну неделю с 1 мая 1945 года до капитуляции германской армии и оккупации города союзными войсками. Официально нацистское правительство в Фленсбурге было распущено только 23 мая 1945 года."},{"page_url":"https://es.wikipedia.org/wiki/Volkswagen_T-Cross","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/VW_T-Cross_Genf_2019_1Y7A5501.jpg","page_title":"Volkswagen T-Cross","context_page_description":"El Volkswagen T-Cross es un SUV del segmento B del fabricante alemán Volkswagen. Se construye sobre la plataforma de bloque de construcción transversal modular A0 y llegó en abril de 2019 al mercado. El vehículo se posiciona debajo del T-Roc en Europa o del Tarek en América, y es el modelo SUV más pequeño de Volkswagen.\\nA partir de la definición de Jato Dynamics, el T-Cross pertenece al segmento B-SUV, un segmento con la cuota de mercado más grande en India y Brasil, seguido de Europa."},{"page_url":"https://en.wikipedia.org/wiki/Mentholatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Mentholatum_%283093647342%29.jpg","page_title":"Mentholatum","context_page_description":"The Mentholatum Company, Inc. is a maker of non-prescription health care products founded in 1889 by Albert Alexander Hyde in the United States. It was bought out by Rohto Pharmaceutical Co., a Japanese health care company, in 1988. The Mentholatum Company is known for its top three products, Mentholatum Ointment, Mentholatum Deep Heating Rub, and Mentholatum Lip Care. The Mentholatum Building in Buffalo, New York was listed on the National Register of Historic Places in 2017."},{"page_url":"https://en.wikipedia.org/wiki/Han_Sai_Por","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/HanSaiPor-20Tonnes-NationalMuseumofSingapore-20090614-03.jpg","page_title":"Han Sai Por","context_page_description":"Han Sai Por is a Singaporean sculptor. A graduate of the Nanyang Academy of Fine Arts, East Ham College of Art, Wolverhampton College of Art and Lincoln University, New Zealand, she worked as a teacher and later as a part-time lecturer at NAFA, the LASALLE-SIA College of the Arts, and the National Institute of Education, Nanyang Technological University, before becoming a full-time artist in 1997.\\nHan has participated in exhibitions locally and abroad, including events in China, Denmark, Japan, Malaysia, New Zealand and South Korea. Her first solo exhibition, entitled Four Dimensions, was held at the National Museum Art Gallery in 1993. Her sculptures can be found around the world, in Osaka and Shōdoshima, Kagawa Prefecture, in Japan; Kuala Lumpur and Sarawak in Malaysia; and Washington, D.C. In Singapore, sculptures commissioned from her can be seen at Capital Tower, the Defence Science Organisation National Laboratories, the Esplanade – Theatres on the Bay, the National Museum of Singapore, Revenue House, Singapore Changi Airport Terminal 3, Suntec City Mall, and Woodlands Regional Library."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B4%D0%BC%D0%B0%D0%BD%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Gradmanci-MK.JPG","page_title":"Градманци","context_page_description":"Градманци — село во Општина Петровец во околината на градот Скопје."},{"page_url":"https://de.wikipedia.org/wiki/S%C5%BDD-Baureihe_%D0%A2%D0%93%D0%9C6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/TGM6D-0269-Novolipetskiy.jpg","page_title":"SŽD-Baureihe ТГМ6","context_page_description":"Die Lokomotiven der SŽD-Baureihe ТГМ6 der Sowjetischen Eisenbahnen sind Diesellokomotiven mit dieselhydraulischer Kraftübertragung vorrangig für den Rangierdienst. Sie sind ähnlich den Lokomotiven der Reihen SŽD-Baureihe ТГМ3, SŽD-Baureihe ТГМ4 und SŽD-Baureihe ТГМ5 und wurden in unterschiedlichen Spurweiten hergestellt. 1966 wurde die erste Lokomotive der Serie ausgeliefert, bis 1970 wurde diese Serie weitergefertigt. Mit weiteren Modifikationen wurden die Lokomotiven weitergebaut und insgesamt über 3100 Lokomotiven hergestellt."},{"page_url":"https://en.wikipedia.org/wiki/Waistcoat","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Vest_MET_CI39.13.150_B.jpg","page_title":"Waistcoat","context_page_description":"A waistcoat in BrE, or vest in AmE, is a sleeveless upper-body garment. It is usually worn over a dress shirt and necktie and below a coat as a part of most men's formal wear. It is also sported as the third piece in the traditional three-piece male lounge suit. Any given vest can be simple or ornate, or for leisure or luxury. Historically, the vest can be worn either in the place of or underneath a larger coat dependent upon the weather, wearer, and setting.\\nDaytime formal wear and semi-formal wear commonly comprises a contrastingly coloured waistcoat, such as in buff or dove gray, still seen in morning dress and black lounge suit. For white tie and black tie, it is traditionally white and black, respectively."},{"page_url":"https://it.wikipedia.org/wiki/Padula_(Cortino)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Fiume_Tordino_%28ansa_presso_Padula_%28TE%29.jpg","page_title":"Padula (Cortino)","context_page_description":"Padula è una frazione del comune di Cortino in provincia di Teramo, con 118 abitanti.\\nIl paese è situato ad un'altitudine di 928 m s.l.m. a circa 35 km da Teramo."},{"page_url":"https://en.wikipedia.org/wiki/Indian_Army_during_World_War_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/A_Universal_Carrier_and_mortar_team_of_the_Indian_6th_Royal_Frontier_Force_in_Italy%2C_13_December_1943._NA9785.jpg","page_title":"Indian Army during World War II","context_page_description":"The British Indian Army during World War II began the war, in 1939, numbering just under 200,000 men. By the end of the war, it had become the largest volunteer army in history, rising to over 2.5 million men in August 1945. Serving in divisions of infantry, armour and a fledgling airborne force, they fought on three continents in Africa, Europe and Asia.\\nThe British Indian Army fought in Ethiopia against the Italian Army, in Egypt, Libya, Tunisia and Algeria against both the Italian and German Army, and, after the Italian surrender, against the German Army in Italy. However, the bulk of British Indian Army was committed to fighting the Japanese Army, first during the British defeats in Malaya and the retreat from Burma to the Indian border; later, after resting and refitting for the victorious advance back into Burma, as part of the largest British Empire army ever formed. These campaigns cost the lives of over 87,000 Indian servicemen, while another 34,354 were wounded, and 67,340 became prisoners of war. Their valour was recognised with the award of some 4,000 decorations, and 18 members of British Indian Army were awarded the Victoria Cross or the George Cross."},{"page_url":"https://hu.wikipedia.org/wiki/Mirabeau_(Alpes-de-Haute-Provence)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Vue_de_Mirabeau_%28Alpes-de-Haute-Provence%29-3.JPG","page_title":"Mirabeau (Alpes-de-Haute-Provence)","context_page_description":"Mirabeau település Franciaországban, Alpes-de-Haute-Provence megyében. Lakosainak száma 501 fő. Mirabeau Aiglun, Barras, Le Chaffaut-Saint-Jurson, L’Escale, Malijai és Mallemoisson községekkel határos."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A8%D0%B2%D0%B0%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Schwaan_in_DBR.png","page_title":"Шван","context_page_description":"Шван град је у њемачкој савезној држави Мекленбург-Западна Померанија. Једно је од 59 општинских средишта округа Бад Доберан. Према процјени из 2010. у граду је живјело 5.206 становника. Посједује регионалну шифру 13051071."},{"page_url":"https://sv.wikipedia.org/wiki/La_Regrippi%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Map_commune_FR_insee_code_44140.png","page_title":"La Regrippière","context_page_description":"La Regrippière är en kommun i departementet Loire-Atlantique i regionen Pays de la Loire i nordvästra Frankrike. Kommunen ligger i kantonen Vallet som tillhör arrondissementet Nantes. År 2009 hade La Regrippière 1 528 invånare."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%A0%E0%B8%AA%E0%B8%B1%E0%B8%8A%E0%B8%A8%E0%B8%B2%E0%B8%AA%E0%B8%95%E0%B8%A3%E0%B9%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Techicy_farmaceutyczni.JPG","page_title":"เภสัชศาสตร์","context_page_description":"เภสัชศาสตร์ ตามความหมายของราชบัณฑิตยสถานเป็นวิทยาศาสตร์แขนงหนึ่งว่าด้วยกระบวนการต่างๆ เกี่ยวกับเรื่องยาบำบัด บรรเทา หรือป้องกันโรค โดยศึกษาตั้งแต่วัตถุดิบที่จะนำมาผลิตยา การปรุงยา การเก็บรักษา ตลอดจนกระบวนการกระจายยา โดยศึกษาตั้งแต่แหล่งของยา โครงสร้างทางเคมีของยา การผลิตเป็นรูปแบบยาเตรียมต่างๆ การควบคุมคุณภาพและการประกันคุณภาพยาและเภสัชภัณฑ์ การวิจัยและการพัฒนายาและเภสัชภัณฑ์ ฤทธิ์ทางเภสัชวิทยา เภสัชจลนศาสตร์ เภสัชพลศาสตร์ การใช้ยาทางคลินิกในโรคของระบบต่างๆ อาการไม่พึงประสงค์ของยา การติดตามผลของยา การประเมินการใช้ยา ไปจนถึงการบริหารจัดการเรื่องยาและกฎหมายเกี่ยวกับยา ทั้งนี้ยังครอบคลุมไปถึงเครื่องสำอาง ผลิตภัณฑ์เสริมอาหาร สารเสพติด สารพิษ และวัตถุหรือสารออกฤทธิ์ประเภทต่างๆ"},{"page_url":"https://uk.wikipedia.org/wiki/Astrophytum_ornatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Astrophytum_ornatum_001.JPG","page_title":"Astrophytum ornatum","context_page_description":"Astrophytum ornatum — рослина з роду Астрофітум родини Кактусових."},{"page_url":"https://fr.wikipedia.org/wiki/Nasi_goreng","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Fried_rice_in_Singapore.jpg","page_title":"Nasi goreng","context_page_description":"Le nasi goreng, qui signifie littéralement « riz frit » en indonésien et en malais est, comme son nom l'indique un plat de riz frit dans de l'huile, assaisonné de kecap manis, d'échalote, d'ail, de tamarin, accompagné d'autres ingrédients, comme de l'œuf, du poulet et des crevettes. Bien que ce plat soit très emblématique de la cuisine indonésienne, il est aussi très populaire en Malaisie, à Singapour et aux Pays-Bas.\\nLe nasi goreng est désigné comme « plat national » de l'Indonésie, mais n'est qu'une des nombreuses composantes de la cuisine indonésienne."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%9E%E1%83%9D%E1%83%9A%E1%83%9D%E1%83%9C%E1%83%94%E1%83%97%E1%83%98%E1%83%A8_%E1%83%9C%E1%83%9D%E1%83%A6%E1%83%94%E1%83%A4%E1%83%98%E1%83%A8_%E1%83%94%E1%83%A0%E1%83%99%E1%83%94%E1%83%91%E1%83%A3%E1%83%9A%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Lodz_-_ul_Piotrkowska_04.JPG","page_title":"პოლონეთიშ ნოღეფიშ ერკებული","context_page_description":"პოლონეთიშ ნოღეფი:\\n2019 წანაშ 1 ღურთუთაშო, პოლონეთის 940 ნოღა რდჷ."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%BA%AB%E7%88%BE%E5%A1%9E%E5%8B%92%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Courcelles-quai-rame.jpg","page_title":"庫爾塞勒站","context_page_description":"庫爾塞勒站是法國首都巴黎地鐵2號線的一個車站，地處巴黎8區和巴黎17區的界線。古賽爾站開業於1902年10月7日，是巴黎地鐵2號線延伸工程的一部分。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%88%D0%B5%D1%80_(%D0%A8%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Eglise_d%27Ach%C3%A8res.jpg","page_title":"Ашер (Шер)","context_page_description":"Ашер насеље је и општина у централној Француској у региону Центар, у департману Шер која припада префектури Бурж.\\nПо подацима из 2011. године у општини је живело 382 становника, а густина насељености је износила 29,96 становника/km². Општина се простире на површини од 12,75 km². Налази се на средњој надморској висини од 231 метар."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%85%E0%A8%B2%E0%A8%AE%E0%A9%87%E0%A8%B0%E0%A9%80%E0%A8%86_%E0%A8%A6%E0%A8%BE_%E0%A8%85%E0%A8%9C%E0%A8%BE%E0%A8%87%E0%A8%AC%E0%A8%98%E0%A8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/TinajaAlmohade.jpg","page_title":"ਅਲਮੇਰੀਆ ਦਾ ਅਜਾਇਬਘਰ","context_page_description":"ਅਲਮੇਰੀਆ ਦਾ ਅਜਾਇਬਘਰ ਅਲਮੇਰੀਅਨ ਪ੍ਰਾਂਤ ਵਿੱਚ ਇੱਕ ਬਹੁਤ ਮਹਤਵਪੂਰਣ ਅਜਾਇਬਘਰ ਹੈ। ਇਸ ਅਜਾਇਬਘਰ ਵਿੱਚ ਪੁਰਾਤਨ ਬਚਿਆ ਖੁਚਿਆ ਸਮਾਨ ਰੱਖਿਆ ਗਇਆ ਹੈ। ਇਹ ਅਜਾਇਬਘਰ ਅਲਮੇਰੀਆ, ਆਂਦਾਲੂਸੀਆ, ਸਪੇਨ ਵਿੱਚ ਕਰਤੇਰਾ ਦੇ ਰੋਦਾ 91 ਗਲੀ ਵਿੱਚ ਸਥਿਤ ਸੀ। 2006 ਵਿੱਚ ਇਹ ਇੱਕ ਨਵੀਂ ਇਮਾਰਤ ਵਿੱਚ ਚਲਿਆ ਗਇਆ ਜਿਸਦਾ ਨਿਰਮਾਣ ਇਗਨੇਕੋ ਦੇ ਗਾਰਸੀਆ ਨੇ ਕੀਤਾ ਸੀ। ਇਸ ਇਮਾਰਤ ਨੂੰ ਦੋ ਸਨਮਾਨ ਪ੍ਰਾਪਤ ਹੋਏ । 2008 ਵਿੱਚ ਇਸਨੇ ਯੂਰਪ ਦੇ ਅਜਾਇਬਘਰ ਮੁਕਾਬਲੇ ਵਿੱਚ ਇਸਨੇ ਯੂਰਪੀ ਅਜਾਇਬਘਰ ਫਰਮ ਵਿੱਚ ਸਥਾਨ ਪ੍ਰਾਪਤ ਕੀਤਾ। ਇਹ ਅਜਾਇਬਘਰ ਲਗਭਗ 1934 ਤੋਂ ਆਮ ਲੋਕਾਂ ਦੇ ਦੇਖਣ ਲਈ ਖੁੱਲਾ ਹੈ। 2014 ਵਿੱਚ ਇਸ ਦੀ 80ਵੀਂ ਸਾਲਗਿਰਾ ਮਨਾਈ ਗਈ।"},{"page_url":"https://pl.wikipedia.org/wiki/Olba_(Cylicja)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/UzuncaburcNordtor.jpg","page_title":"Olba (Cylicja)","context_page_description":"Olba lub Olbia – starożytne miasto greckie położone w Cylicji, na terenie współczesnej Turcji."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%B9%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Tillac_IMG_9903.JPG","page_title":"Тийак","context_page_description":"Тийа́к — коммуна во Франции, находится в регионе Юг — Пиренеи. Департамент — Жер. Входит в состав кантона Марсьяк. Округ коммуны — Миранд.\\nКод INSEE коммуны — 32446."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%96%D7%A8%D7%97_%D7%9E%D7%A7%D7%93%D7%95%D7%A0%D7%99%D7%94_%D7%95%D7%AA%D7%A8%D7%90%D7%A7%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Nestos_or_Mesta_River_-_Greece-Bulgaria.jpg","page_title":"מזרח מקדוניה ותראקיה","context_page_description":"מזרח מקדוניה ותראקיה הוא חבל מנהלי שמהווה אחד מ-13 המחוזות של יוון. המחוז מורכב מהחבל ההיסטורי של תראקיה, מחלקה המזרחי של מקדוניה היוונית וכן מהאיים תסוס וסמותרקי. זהו האזור המזרחי ביותר ביוון היבשתית. שטחו של המחוז הוא 14,157 קמ\\"ר ואוכלוסייתו הוערכה ב-2011 ב-608,182 איש. הוא גובל במדינת בולגריה בצפון, מדינת טורקיה במזרח, הים האגאי, ומחוז צפון הים האגאי בדרום, ומחוז מרכז מקדוניה במערב.\\nבירת המחוז היא העיר קומוטיני, העיר הרביעית בגודלה במחוז ובה גרים 66,580 איש, עיר הנמל המרכזית של מזרח מקדוניה היא קוואלה שאוכולוסיתה מונה 74,186 איש והיא גם העיר הגדולה במחוז. ערים גדולות יחסית נוספות הן קסנתי ואלכסנדרופולי.\\nהמחוז מורכב משש יחידות אזוריות: דרמה, אברוס, קוואלה, רודופי, קסנתי ותסוס.\\nבמחוז שוכנת אוכלוסייה מוסלמית גדולה יחסית, ממוצא טורקי ופומאקי. במפקד אוכלוסין ב-1991 מנו המוסלמים 98,000 נפש, שהיוו אז 29% מן התושבים. בניגוד לשאר מחוזות יוון, שברובה מתאפיינת כיום באוכלוסייה הומוגנית מבחינה דתית ואתנית, המוסלמים תושבי המחוז לא נאלצו לעזוב לטורקיה בהסכם חילופי האוכלוסין בין יוון וטורקיה ב-1923."},{"page_url":"https://de.wikipedia.org/wiki/Intercity-Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Karte_IC-%2C_EC-_und_ICE-Strecken_Deutschland.png","page_title":"Intercity-Express","context_page_description":"Der Intercity-Express ist die schnellste Zuggattung der Deutschen Bahn AG.\\nDer Intercity-Express gilt als das Flaggschiff im Schienenpersonenfernverkehr der Deutschen Bahn AG und ist darin der Nachfolger des Intercity. Er bedient, in einem weitgehend getakteten Liniennetz, annähernd 180 ICE-Bahnhöfe in Deutschland und fünf Nachbarländern.\\nEbenfalls als „ICE“ bezeichnet werden die rund 280 zwischen 1990 und 2019 produzierten Hochgeschwindigkeits-Triebzüge, die von verschiedenen Herstellern stammen. Die Triebzüge verteilen sich auf fünf hauptsächliche Varianten – 60 ICE 1, 44 ICE 2, 91 ICE mit Neigetechnik, 84 ICE 3 sowie etwa 25 Triebzüge der neuesten Generation ICE 4, die im Jahr 2017 begonnen hat und erst zwischen 2020 und 2025 abgeschlossen sein wird.\\nRund 60 ICE Triebzüge verkehren ins Ausland.\\nSie erreichen im Fahrgastbetrieb Höchstgeschwindigkeiten zwischen 200 und 300 km/h.\\nIm Jahr 2012 waren 76,6 Millionen Reisende im ICE unterwegs. Die durchschnittliche Reiseweite im ICE lag 2019 bei 335 Kilometern. Im Jahr 2019 beförderten die Züge etwa 99 Millionen Fahrgäste, was einem Tagesdurchschnitt von etwa 270.000 Reisenden entspricht."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%96%AC%E6%B2%BB%C2%B7%E8%8F%AF%E7%9B%9B%E9%A0%93%C2%B7%E5%8D%A1%E5%BC%97%E9%AB%98%E4%B8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/P-Phoenix_Union_Colored_High_School-1926.jpg","page_title":"喬治·華盛頓·卡弗高中","context_page_description":"喬治·華盛頓·卡弗高中，是一家已經永久關閉的公立高級中學。\\n卡弗高中是為了隔離鳳凰城聯合高中學區的非裔美國人學生而建的。校舍位於美國亞利桑那州鳳凰城。\\n卡弗高中的校舍是亞利桑那州唯一一間特別為非裔學生而興建的校舍。"},{"page_url":"https://en.wikipedia.org/wiki/Uniforms_of_the_Confederate_States_Armed_Forces","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Confederate_States_of_America_Sergeant-Marines.png","page_title":"Uniforms of the Confederate States Armed Forces","context_page_description":"Each branch of the Confederate States armed forces had their own service dress and fatigue uniforms and regulations regarding them during the American Civil War, which lasted from April 12, 1861 until May 1865.\\nThe uniform initially varied greatly due to a variety of reasons, such as location, limitations on the supply of cloth and other materials, State regulations that were different from the standard regulations, and the cost of materials during the war. Texas units, for example, had access to massive stocks of U.S. blue uniforms, which were acquired after Confederate forces captured a U.S. supply depot in San Antonio in 1861. These were worn as late as 1863. Early on, servicemen sometimes wore combinations of uniform pieces, making do with what they could get from captured United States Army soldiers, or from U.S. and Confederate dead, or just wear civilian clothing. There are some controversies about some of the exact details of a few of the uniforms, since some of the records were lost or destroyed after the Civil War ended."},{"page_url":"https://pl.wikipedia.org/wiki/Priez","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Priez_%2802%29_%C3%89glise_Saint-Jean-Baptiste.JPG","page_title":"Priez","context_page_description":"Priez – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Aisne.\\nWedług danych na styczeń 2014 roku gminę zamieszkiwało 55 osób, a gęstość zaludnienia wynosiła 10,7 osób/km²."},{"page_url":"https://it.wikipedia.org/wiki/Paolo_Ricca_(teologo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Paolo_Ricca_teologo.jpg","page_title":"Paolo Ricca (teologo)","context_page_description":"Paolo Ricca è un teologo italiano. Ha insegnato dal 1976 al 2002 Storia della Chiesa alla Facoltà valdese di teologia."},{"page_url":"https://hu.wikipedia.org/wiki/F%C3%A9mz%C3%B6ld_szitak%C3%B6t%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Somatochlora_1%28loz%29.jpg","page_title":"Fémzöld szitakötő","context_page_description":"A fémzöld szitakötő a sárkány-szitakötők családjába tartozó, Közép-, Észak- és Kelet-Európában elterjedt szitakötőfaj."},{"page_url":"https://en.wikipedia.org/wiki/GHC_Heavyweight_Championship","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/LEGEND....jpg","page_title":"GHC Heavyweight Championship","context_page_description":"The Global Honored Crown Heavyweight Championship is the professional wrestling world heavyweight championship in Japanese promotion Pro Wrestling Noah. The title was also defended on Impact Wrestling which has a working relationship with Pro Wrestling Noah. It was created on April 15, 2001 when Mitsuharu Misawa defeated Yoshihiro Takayama in a 16-man tournament final. Though its name implies a particular weight class, it has been periodically held by junior heavyweights, including Yoshinari Ogawa, Kenta, Naomichi Marufuji, Katsuhiko Nakajima and Kenoh. There have been a total of 18 recognized champions, who have had a combined 33 official reigns."},{"page_url":"https://es.wikipedia.org/wiki/Isefjord","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/DenmarkIsefjorden.png","page_title":"Isefjord","context_page_description":"El Isefjord es una entrante del Kattegat en el norte de la isla de Selandia, en Dinamarca. Es el principal fiordo de la isla, con 450 km² y con una longitud de 50 km hasta su parte más interna, unos de los fiordos más largos del país.\\nSu nombre significa \\"fiordo cubierto de hielo\\"."},{"page_url":"https://es.wikipedia.org/wiki/Familia_Fugger","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Urh1441_fuggerorum.jpg","page_title":"Familia Fugger","context_page_description":"Los integrantes de la Familia Fugger o Fúcares fueron un clan familiar de empresarios y financieros alemanes que llegaron a constituir uno de los mayores grupos empresariales de los siglos XV y XVI, siendo precursores del capitalismo moderno, junto con los Médicis y los Welser."},{"page_url":"https://de.wikipedia.org/wiki/SNCF_X_2400","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/X2403_%C3%A0_Pontivy.jpg","page_title":"SNCF X 2400","context_page_description":"Die Baureihe X 2400 der französischen Staatsbahn SNCF ist ein Dieseltriebwagen, der in einer Anzahl von 79 Stück zwischen 1951 und 1955 gebaut wurde. Die Fahrzeuge boten Platz für 12 Reisende in der 1. und 56 Reisende in der 2. Klasse, waren 27 m lang und erreichten eine Höchstgeschwindigkeit von 120 km/h. Die Triebwagen wurden oft mit Beiwagen anderer Einheiten zusammengekuppelt.\\nDie Inbetriebnahme der 2 × 300 PS starken Fahrzeuge ging einher mit der Inbetriebnahme der Baureihen X 5500 sowie X 5800 Mobylettes mit 150 PS und der Baureihe X 3800 Picasso mit 300 PS. So konnte nach dem Zweiten Weltkrieg der Fahrzeugpark an Schienenbussen und Verbrennungstriebwagen der SNCF aus der Vorkriegszeit grundlegend mit drei einheitlichen Baureihen verschiedener Leistungsklassen erneuert werden. Ebenso erleichterten diese Verbrennungstriebwagen die Ablösung der Dampftraktion.\\nDie Baureihe war zuerst in Limoges beheimatet und wurde, mit Beiwagen der Reihe XR 8000 gekuppelt, auf den Linien im Zentralmassiv eingesetzt. Dort gesellte sich bald die Reihe X 2800 hinzu, die zwar nur einen Motor besaß, dafür aber stärker war."},{"page_url":"https://fr.wikipedia.org/wiki/Lari_(monnaie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Ge-money-lari-coin-1-obv.jpg","page_title":"Lari (monnaie)","context_page_description":"Le lari est la monnaie nationale de la Géorgie. Il est divisé en 100 tetri.\\nLe mot lari en vieux géorgien signifie « trésor », tandis que le tetri était une unité monétaire géorgienne utilisée au XIIIᵉ siècle. Le mot tetri veut dire blanc et, donc, désignait les pièces en argent.\\nLes billets sont de 1, 2, 5, 10, 20, 50 et 100 lari et les pièces sont de 1, 2, 5, 10, 20 et 50 tetri, 1 et 2 lari.\\nLe lari a d'abord été émis sous forme de coupons en 1993 pour remplacer, à parité, le rouble russe. Cette forme du lari a cessé d'exister avec la fin de la période d'hyperinflation.\\nLe 2 octobre 1995, le gouvernement d'Edouard Chevardnadze remplaça le système des coupons par le lari, au taux de un million de coupons pour 1 lari. Depuis le cours est resté relativement stable.\\nLe taux de change officiel était de 2,42 GEL pour 1 EUR à l'automne 2010, de 2,02 GEL pour 1 EUR à l'été 2012, et de 3,25 GEL pour 1 EUR à l'été 2019."},{"page_url":"https://en.wikipedia.org/wiki/The_Christian_Guardian","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Nathanael_Burwash_%281839_%E2%80%93_1918%29.jpg","page_title":"The Christian Guardian","context_page_description":"The Christian Guardian was a Wesleyan Methodist journal founded in Upper Canada in 1829. The first editor was Egerton Ryerson. It ceased publication in 1925 when the Methodist Church of Canada merged with the Presbyterians and Congregationalists to form the United Church of Canada, and merged their journals to create The New Outlook, later renamed the United Church Observer."},{"page_url":"https://en.wikipedia.org/wiki/John,_King_of_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/RochesterCastle.JPG","page_title":"John, King of England","context_page_description":"John was King of England from 1199 until his death in 1216. He lost the Duchy of Normandy and most of his other French lands to King Philip II of France, resulting in the collapse of the Angevin Empire and contributing to the subsequent growth in power of the French Capetian dynasty during the 13th century. The baronial revolt at the end of John's reign led to the sealing of Magna Carta, a document sometimes considered an early step in the evolution of the constitution of the United Kingdom.\\nJohn was the youngest of the four surviving sons of King Henry II of England and Duchess Eleanor of Aquitaine. He was nicknamed John Lackland because he was not expected to inherit significant lands. He became Henry's favourite child following the failed revolt of 1173–74 by his brothers Henry the Young King, Richard, and Geoffrey against the King. John was appointed the Lord of Ireland in 1177 and given lands in England and on the continent. The war between Henry II and his eldest sons ended with the deaths of Henry the Young King and Geoffrey."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A3%D0%B1%D0%BE_%D0%9E%D0%BA%D0%B5%D0%BB%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Wubbo_Ockels.jpg","page_title":"Убо Окелс","context_page_description":"Убо Йоханес Окелс е холандски физик и бивш астронавт на ESA. През 1985 г. участва в полет на космическата совалка, което го прави първият холандски гражданин в космоса. Той не е първият роден холандец, защото е предшестван от натурализирания американец Лудвиг Ван Ден Берг. Oкелс е професор в Delft University of Technology."},{"page_url":"https://tr.wikipedia.org/wiki/Hyundai_modelleri_listesi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Hyundai_Tucson_.jpg","page_title":"Hyundai modelleri listesi","context_page_description":"Hyundai Motor Company firmasının geliştirdiği veya üretimini yaptığı otomobil modelleri:"},{"page_url":"https://en.wikipedia.org/wiki/T%C3%A1chira","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/FACHADA_DEL_ANTIGUO_HOSPITAL_VARGAS.jpg","page_title":"Táchira","context_page_description":"Táchira State is one of the 23 states of Venezuela. The state capital is San Cristóbal.\\nTáchira State covers a total surface area of 11,100 square kilometres and as of the 2011 census, had a population of 1,168,908. At the end of the 19th century, Táchira State was where oil was discovered in Venezuela. It was exploited for many years. Currently, its main economic revenues come from the production of coffee and pineapple. The cattle and agricultural activities play an important role in Táchira's economy. There is also a strong industrial sector which focuses on the processing of potato, sugar, milk, and cheese and the production of textiles.\\nTáchira State is one of the three Venezuelan Andean states. This state borders Zulia State to the north, Barinas and Mérida States to the east, Apure and Barinas States to the south, and Colombia to the west."},{"page_url":"https://sv.wikipedia.org/wiki/Silvervinda","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Convolvulus_cneorum_1.jpg","page_title":"Silvervinda","context_page_description":"Silvervinda är en vindeväxtart som beskrevs av Carl von Linné. Convolvulus cneorum ingår i släktet vindor, och familjen vindeväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%92%D1%8F%D0%BB%D1%96%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B0%D0%B3%D0%BE%D0%B7%D1%8C%D0%BD%D1%96%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/%D0%9A%D0%B0%D1%81%D1%86%D1%91%D0%BB_%D0%94%D0%B7%D0%B5%D0%B2%D1%8B_%D0%9C%D0%B0%D1%80%D1%8B%D1%96._%D0%92%D1%8F%D0%BB%D1%96%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B0%D0%B3%D0%BE%D0%B7%D0%BD%D1%96%D1%86%D0%B0.jpg","page_title":"Вялікая Рагозьніца","context_page_description":"Вялі́кая Раго́зьніца — вёска ў Мастоўскім раёне Гарадзенскай вобласьці. Уваходзіць у склад Пескаўскага сельсавету."},{"page_url":"https://br.wikipedia.org/wiki/Zierbena","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Bizkaia_municipalities_Zierbena.PNG","page_title":"Zierbena","context_page_description":"Zierbena zo ur gumun eus Bizkaia en Euskal Herria."},{"page_url":"https://de.wikipedia.org/wiki/Durlach","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Turmberg_v_sueden_2005_11_06.jpg","page_title":"Durlach","context_page_description":"Durlach ist mit rund 30.000 Einwohnern der größte Stadtteil von Karlsruhe. Die einstmals eigenständige Stadt war von 1565 bis 1718 Residenzstadt der Markgrafschaft Baden-Durlach. 1715 ging von hier die Gründung der neuen Residenzstadt Karlsruhe aus, in die Durlach 1938 zwangseingemeindet wurde."},{"page_url":"https://et.wikipedia.org/wiki/Berliini_blokaad","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/BerlinerBlockadeLuftwege.png","page_title":"Berliini blokaad","context_page_description":"Berliini blokaad oli esimesi suuremaid rahvusvahelisi kriise külma sõja ajal.\\nKülm sõda algas Berliini blokaadiga 1948. aastal ja see kestis kuni Berliini müüri langemiseni ja NSV Liidu lagunemiseni, kuigi nimetus ise sündis 1947. aastal – pärast Stalini kõnet veebruaris 1946 ja Churchilli kõnet märtsis 1946, kus räägiti vastuoludest kahe suurriigi vahel.\\nBerliini blokaadi ajendiks sai USA, Suurbritannia ja Prantsusmaa okupatsioonitsoonides läbi viidud rahareform."},{"page_url":"https://es.wikipedia.org/wiki/Argyroneta_aquatica","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Argyroneta_aquatica_Paar.jpg","page_title":"Argyroneta aquatica","context_page_description":"La araña de agua es una especie de araña araneomorfa de la familia Cybaeidae. Se encuentra en Europa y Asia."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%9C%82%E9%B8%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Campylopterus_hemileucurus_-Costa_Rica_-flying-8.jpg","page_title":"蜂鸟","context_page_description":"蜂鸟科是雨燕目一科，其下物种通称为蜂鸟，体型小，能够以快速拍打翅膀的方式而悬停在空中，也是唯一可以向后飞的鸟。蜂鸟的飞行本领高超，也被人们称为“神鸟”、“彗星”、“森林女神”和“花冠”等。\\n吸蜜蜂鸟仅重1.8公克，是世界上最小的鸟。还有一种典型的北美蜂鸟红喉北蜂鸟重量约三公克左右，身长7.6公分。蜂鸟中体型最大的是巨蜂鸟，其体重也仅20克。"},{"page_url":"https://it.wikipedia.org/wiki/Pieve_di_San_Floriano","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/PieveDiSanFlorianoCampanile.jpg","page_title":"Pieve di San Floriano","context_page_description":"La pieve di San Floriano è un'antica pieve situata nel comune di San Pietro in Cariano, nella frazione di San Floriano, nel cuore della Valpolicella. È considerata una delle più belle chiese romaniche della provincia di Verona."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D8%A7%D8%AF%D9%85_%D8%A7%D9%84%D8%AD%D8%B1%D9%85%DB%8C%D9%86_%D8%A7%D9%84%D8%B4%D8%B1%DB%8C%D9%81%DB%8C%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Barsbay_gold_ashrafi_1422_1438.jpg","page_title":"خادم الحرمین الشریفین","context_page_description":"خادم الحرمین الشریفین لفظی تاریخی و لقبی احترام‌آمیز، به معنای محافظ یا کلیددار دو مسجد از مقدس‌ترین مساجد اسلامی، مسجدالحرام در مکه و مسجدالنّبی در مدینه است. پادشاهان آل سعود، به صورت رسمی و در مکاتبات اداری با این لقب خطاب می‌شوند.\\nاین لفظ، اولین بار توسط سلاطین ایوبیان سلاطین مملوک مصر و سلاطین عثمانی به‌کار رفت. این لفظ امروزه توسط شاهان کنونی سعودی احیا شده‌است.\\nامروزه این لفظ بیش از همه یادآور پادشاه عربستان سعودی در نقش محافظ دو مسجد مقدس، یعنی مسجدالحرام در مکه و مسجدالنّبی در مدینه است. این نقش به‌طور سنتی از آنِ خلیفه بوده‌است.\\nملک فهد بن عبدالعزیز آل سعود، پادشاه عربستان سعودی، در سال ۱۹۸۶ برای اولین بار این لقب را اختیار کرد. او لفظ «والاحضرت» را با «خادم الحرمین الشریفین» جایگزین کرد. پس از وفات او در سال ۲۰۰۵، این لقب را نخستین بار به ترتیب ملک عبدالله، پادشاه پیشین عربستان سعودی، در ۵ اوت ۲۰۰۵ و شاه کنونی عربستان سعودی، ملک سلمان، در ۲۳ ژانویه ۲۰۱۵ برای خودشان به‌کار بردند."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%BF%CF%85%CE%BC%CE%B1%CE%BD%CE%B9%CE%AC%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Tumanyan_coll.%2C_Armenia.jpg","page_title":"Τουμανιάν","context_page_description":"Το Τουμανιάν είναι πόλη και αστική δημοτική κοινότητα στην επαρχία Λορί της Αρμενίας, που βρίσκεται 149 χλμ βόρεια της πρωτεύουσας Γερεβάν και 38 χλμ βόρεια του επαρχιακού κέντρου Βαναντζόρ. Από την απογραφή του 2011, ο πληθυσμός του Τουμανιάν ήταν 1.710, μειούμενος από τους 2.864 που αναφέρθηκαν το 1964. Επί του παρόντος, η πόλη έχει κατά προσέγγιση πληθυσμό 1.000 κατοίκων σύμφωνα με την επίσημη εκτίμηση του 2016. Τα κοντινά χωριά Κομπέρ καγιαράν, Σαμούτ, Λορούτ, Αχνιντζόρ, Ατάν, Μαρτς και Καρίντζ είναι επίσης μέρος της κοινότητας Τουμανιάν."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B0%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Poecilogale_albinucha_range_map.png","page_title":"Африканская ласка","context_page_description":"Африканская ласка, или полосатая ласка — вид семейства куньих, единственный в одноимённом роде."},{"page_url":"https://en.wikipedia.org/wiki/Solar_eclipse_of_July_31,_1962","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/SE1904Sep09T.png","page_title":"Solar eclipse of July 31, 1962","context_page_description":"An annular solar eclipse occurred on Tuesday, July 31, 1962. A solar eclipse occurs when the Moon passes between Earth and the Sun, thereby totally or partly obscuring the image of the Sun for a viewer on Earth. An annular solar eclipse occurs when the Moon's apparent diameter is smaller than the Sun's, blocking most of the Sun's light and causing the Sun to look like an annulus. An annular eclipse appears as a partial eclipse over a region of the Earth thousands of kilometres wide. Occurring only 4.7 days before apogee, the Moon's apparent diameter was larger. This solar eclipse occurred 44 days after the final game of 1962 FIFA World Cup.\\nPlaces inside the annular eclipse included Venezuela, northern Roraima in Brazil, Guyana, Dutch Guiana including the capital city Paramaribo, Senegal, Gambia Colony and Protectorate including the southern part of the capital city Banjul, Mali including the capital city Bamako, Upper Volta, Ghana, Togo, Dahomey, Nigeria, Cameroon including the capital city Yaoundé, Congo-Brazzaville, Congo-Léopoldville, Tanganyika, northeastern tip of Portuguese Mozambique, French Comoros, Mayotte, and the Malagasy Republic."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%D9%84%D9%88%D8%B1_%D8%B3%DB%8C%D8%AA%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Menara_as.jpg","page_title":"الور سیتار","context_page_description":"الور سیتار ملائیشیا کی ریاست قدح کا دار الحکومت ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Assyrian_sculpture","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Entrance_South_West_Palace_Nimroud.jpg","page_title":"Assyrian sculpture","context_page_description":"Assyrian sculpture is the sculpture of the ancient Assyrian states, especially the Neo-Assyrian Empire of 911 to 612 BC, which ruled modern Iraq, Syria, and much of Iran. It forms a phase of the art of Mesopotamia, differing in particular because of its much greater use of stone and gypsum alabaster for large sculpture.\\nMuch the best-known works are the huge lamassu guarding entrance ways, and Assyrian palace reliefs on thin slabs of alabaster, which were originally painted, at least in part, and fixed on the wall all round the main rooms of palaces. Most of these are in museums in Europe or America, following a hectic period of excavations from 1842 to 1855, which took Assyrian art from being almost completely unknown to being the subject of several best-selling books, and imitated in political cartoons.\\nThe palace reliefs contain scenes in low relief which glorify the king, showing him at war, hunting, and fulfilling other kingly roles. Many works left in situ, or in museums local to their findspots, have been deliberately destroyed in the recent occupation of the area by ISIS, the pace of destruction reportedly increasing in late 2016, with the Mosul offensive."},{"page_url":"https://ru.wikipedia.org/wiki/Saturn_(%D0%BA%D0%BE%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Saturn_Flextreme_NY.jpg","page_title":"Saturn (компания)","context_page_description":"Saturn — подразделение американского концерна General Motors, основанное 7 января 1985 года на волне успеха японских автомобилей в США. За свою недолгую историю Saturn была весьма независима от материнской компании — имела собственную сборочную линию в Спринг Хилл, штат Теннесси, а также отдельную сеть розничной торговли. Официальный слоган компании — «Different Kind of Car Company».\\nПосле срыва сделки о покупке Saturn группой компаний Penske в сентябре 2009 года, General Motors заявил о прекращении выпуска автомобилей этой марки. 31 октября 2010 года стал последним днём в истории компании."},{"page_url":"https://en.wikipedia.org/wiki/Phyciodes_phaon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Crescent_spot_%28Phyciodes_phaon%29.JPG","page_title":"Phyciodes phaon","context_page_description":"Phyciodes phaon, the Phaon crescent or mat plant crescent, is a species of butterfly found in Florida, neighboring states, west to New Mexico and south to Cuba and the Cayman Islands where it is known as the crescent spot."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A7%E8%A5%BF%E6%B4%8B%E5%A5%B4%E9%9A%B8%E8%B2%BF%E6%98%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Slave_ship_diagram.png","page_title":"大西洋奴隸貿易","context_page_description":"大西洋奴隸貿易，或稱為跨大西洋奴隸貿易。是指16世紀至19世紀時期，在環大西洋地區將非洲大陸人民作為廉價勞動力提供給美洲大陸殖民地地區的一種貿易。奴隸的來源主要是非洲西部和中部，黑人被歐洲人通過貿易或襲擊、綁架等手段抓獲販往美洲大陸。這一貿易活動在近代也被稱為黑奴貿易，然後實際上這一說法並不妥當，因為早在中世紀之前，就有黑奴的貿易活動出現了所以應當加上跨大西洋字樣。\\n奴隸貿易者包括：葡萄牙人、英國人、法國人、西班牙人、荷蘭人和美國人。部分貿易者在非洲的海岸擁有前哨，前哨有他們收買的當地的部落首領為他們提供奴隸。在長達約400年的帶有強烈殖民主義色彩的黑奴貿易中，目前估計約有1200萬人從非洲運到美洲的奴隸，部分學者得到的數據相對更高，尤其是從非洲得到的。將航運死亡的一千萬人計算入內後，非洲人口損失數據可以達到三千萬。"},{"page_url":"https://simple.wikipedia.org/wiki/Graettinger,_Iowa","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Palo_Alto_County_Iowa_Incorporated_and_Unincorporated_areas_Graettinger_Highlighted.svg","page_title":"Graettinger, Iowa","context_page_description":"Graettinger is a city in Iowa in the United States."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B9%E5%BD%A2%E8%9E%BA%E6%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Square_nuts_from_Ace_Hardware%2C_Concord_MA.jpg","page_title":"方形螺母","context_page_description":"方形螺母是一个四方形螺母。在反复松动/拧紧循环后，它们也不太可能变圆。方形螺母通常与方头螺栓配合。方形螺母与平垫圈一起使用，以避免其锋利边缘的损坏，并有助于增加紧固件的强度。方形螺母可以具有标准，细或粗的螺纹，表面具有铬酸盐转化镀层。大多数可以符合ASTM A194，ASTM A563或ASTM F594标准。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%AE%89%E6%80%9D%E6%8D%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Jan_Elizabeth_Adams.jpg","page_title":"安思捷","context_page_description":"安思捷澳大利亚外交官。前任澳大利亚驻华大使。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%91%D0%B0%D0%B1%D1%83%D1%88%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%D0%9E%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%91%D0%B0%D0%B1%D1%83%D1%88%D0%BD%D0%B8%D1%86%D0%B0_%282012%29.jpg","page_title":"Општина Бабушница","context_page_description":"Општина Бабушница је део Пиротског округа. Окружена је градом Пиротом и белопаланачком општином са севера, општином Димитровград и бугарском границом са истока, општинама Власотинце и Црна Трава са југа и општином Гаџин Хан са запада.\\nСедиште општине је Бабушница, а чине је још 52 села:\\nАлександровац,\\nБердуј,\\nБерин Извор,\\nБогдановац,\\nБратишевац,\\nБрестов Дол,\\nВава,\\nВалниш,\\nВелико Боњинце,\\nВојници,\\nВрело,\\nВучи Дел,\\nГорње Крњино,\\nГорњи Стрижевац,\\nГорчинци,\\nГрнчар,\\nДол,\\nДоње Крњино,\\nДоњи Стрижевац,\\nДрагинац,\\nДучевац,\\nЗавидинце,\\nЗвонце,\\nИзвор,\\nЈасенов Дел,\\nКалуђерово,\\nКамбелевци,\\nКијевац,\\nЛесковица,\\nЛиново,\\nЉуберађа,\\nМало Боњинце,\\nМасуровци,\\nМезграја,\\nМодра Стена,\\nНашушковица,\\nОстатовица,\\nПресека,\\nПроваљеник,\\nРадињинци,\\nРадосињ,\\nРадошевац,\\nРакита,\\nРаков Дол,\\nРаљин,\\nРесник,\\nСтол,\\nСтрелац,\\nСтудена,\\nСурачево,\\nЦрвена Јабука, и\\nШтрбовац."},{"page_url":"https://la.wikipedia.org/wiki/Severinus_Poletto","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Severino_Poletto%2C_2015.jpg","page_title":"Severinus Poletto","context_page_description":"Severinus Poletto est cardinalis Ecclesiae Catholicae ac archiepiscopus emeritus Taurini. Poletto mense Aprili 2005 et mense Martio 2013 conclavibus adfuit, quae Iosephum Ratzinger et Georgium Marium Bergoglio papas creaverunt."},{"page_url":"https://en.wikipedia.org/wiki/Jerwan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Jerwan_Aqueduct1.jpg","page_title":"Jerwan","context_page_description":"Jerwan is a locality north of Mosul in the Nineveh Province of Iraq. The site is clear of vegetation and is sparsely settled.\\nThe site is famous for the ruins of an enormous aqueduct crossing the Khenis River, constructed of more than two million dressed stones and using stone arches and waterproof cement. Some consider it to be the world's oldest aqueduct, predating anything the Romans built by five centuries."},{"page_url":"https://de.wikipedia.org/wiki/Moschee_Wesseling","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Wesseling%E2%80%93Mimar%E2%80%93Sinan-Camii-P1010027.JPG","page_title":"Moschee Wesseling","context_page_description":"Die Wesselinger Moschee wurde 1987 als achte baulich bedeutsame Moschee in Deutschland erbaut. Der Namensgeber Mimar Sinan war der bedeutendste osmanische Architekt im 16. Jahrhundert. Die endgültige Fertigstellung der Moschee wurde 1992 gefeiert. Der sie betreibende Verein ist Mitglied des türkischen Dachverbandes DITIB, damit untersteht sie indirekt dem türkischen Staatspräsidenten."},{"page_url":"https://no.wikipedia.org/wiki/Pasco","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Escudo_regional_Pasco.png","page_title":"Pasco","context_page_description":"Pasco er en region i Peru. Den grenser til regionen Huánuco i nord, til Ucayali i øst, Junín i sør og til Lima i vest. Regionens hovedstad er byen Cerro de Pasco."},{"page_url":"https://en.wikipedia.org/wiki/Memento_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Bust_of_Kalamar_Jozsef_at_Memento_Park_%28Gyenes_Tam%C3%A1s%2C_1957%29.JPG","page_title":"Memento Park","context_page_description":"Memento Park is an open-air museum in Budapest, Hungary, dedicated to monumental statues and sculpted plaques from Hungary's Communist period. There are statues of Lenin, Marx, and Engels, as well as several Hungarian Communist leaders. The park was designed by Hungarian architect Ákos Eleőd, who won the competition announced by the Budapest General Assembly in 1991. On public transport diagrams and other documents the park is usually shown as Memorial Park.\\nA quote by the architect on the project: \\"This park is about dictatorship. And at the same time, because it can be talked about, described, built, this park is about democracy. After all, only democracy is able to give the opportunity to let us think freely about dictatorship.\\"\\nMemento Park is divided into two sections: Statue Park, officially named \\"A Sentence About Tyranny\\" Park after a poem of the same name by Gyula Illyés, and laid out as 6 oval sections; and Witness Square, which lies east of the main park entrance and is visible without payment. Statue Park houses 42 of the statues/monuments that were removed from Budapest after the fall of communism."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A8%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%82%D0%B5%D1%88%D0%B2%D0%B0%D1%80%D0%B0_%D0%93%D1%8B%D0%B9%D0%B1%D0%B0%D0%B4%D3%99%D1%82%D1%85%D0%B0%D0%BD%D3%99%D1%81%D0%B5,_%D0%9D%D0%B0%D0%BD%D0%B4%D0%B6%D0%B0%D0%BD%D0%B3%D1%83%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Deity_sculpture_in_Srikanteshwara_temple_at_Nanjangud_5.JPG","page_title":"Шрикантешвара Гыйбадәтханәсе, Нанджангуд","context_page_description":"Шрикантешвара Гыйбадәтханәсе ул Көньяк Һиндстанда, Карнатака штатында Нанджангуд дини сәфәр шәһәрендә борынгы гыйбадәтханә. Ул борынгы Шрикантешвара Ходае өчен мәшһүр. Шрикантешвара гыйбадәтханәсе Кавериның кушылдыгы, Капиланың уң як ярында шәһәрдә урнашкан. Нанджангуд шулай ук \\"Дакшина Каши\\" дип атала. яки \\"Көньякның Варанаси/Праяг\\".\\nКаннада телендә Нанджу агу дигәнне аңлата; Нанджундешвара исеме \\"Агуны Эчкән Ходай\\" дигәнне аңлата, бу сүз Бөек Сөт Океанын Язу риваятеннән килеп чыккан; шулай итеп шәһәргә 'Нанганджуд' исеме кушылган, бу Нанджундешвара Ходае сыенган урынны аңлата.\\nВеда Брахма Т.С. Вишвешвара Дикхитх ул Ходайның Шри Шрикантешвара Супрабхата Стотрамның төзүчесе. Шри Т.С. Вишвешвара Дикшитх берничә Веда буенча өйрәнгән Санскрит галиме булган һәм Гхана Крамада специальләшкән - бу Ведаларның эссенциясе. Ул шулай ук Шри Шарада Гыйбадәтханәседә Шри Шарада Супрабхатаны һәм Шри Чандрамоулишвара Супрабхатаны һәм Майсорда, Махаллада Шри Чандрамоулишвара Гыйбадәтханәсендә Шрингерины уйлап чыгарган. Ул Гана Пати булган һәм Аланкара Шастра, Джйотиша Шастра, Тарка һәм Вьякарана Шастраларын язган. Ул Майсор Махараджасыннан Санскрит Әдәбиятына кертем өчен берничә бүләк алган."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%89%E5%A6%AE%C2%B7%E7%8E%9B%E4%B8%BD%C2%B7%E8%B7%AF%E6%98%93%E4%B8%9D%C2%B7%E5%BE%B7%C2%B7%E5%A5%A5%E5%B0%94%E8%89%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Anne_Marie_Louise_d%27Orl%C3%A9ans%2C_Duchess_of_Montpensier%2C_La_Grande_Mademoiselle_-_Versailles_MV_3476.jpg","page_title":"安妮·玛丽·路易丝·德·奥尔良","context_page_description":"安妮·玛丽·路易丝·德·奥尔良，蒙庞西耶女公爵，以 La Grande Mademoiselle为人所知，是法国国王亨利四世的第三子奥尔良公爵加斯东和他的妻子玛丽·德·波旁的大女儿。她是历史上最富有和伟大的女继承人之一，她去世时未婚且无子女，巨大财富留给了她的堂弟腓力。欧洲很多统治家族的成员都曾向她求婚，其中包括英格兰国王查理二世， 葡萄牙国王阿方索六世和萨沃伊的查尔斯·伊曼纽尔二世。她最终爱上了贫穷贵族洛赞公爵安托万·德·科蒙，当她向法国国王路易十四请求与洛赞公爵结婚时，遭到了法国朝臣的谴责，因为这种结合被看作“下嫁”。她在“投石党乱”中的表现、把作曲家让-巴普蒂斯特·吕利带入宫廷一事以及她的回忆录较为有影响力。"},{"page_url":"https://de.wikipedia.org/wiki/Eric_Clapton/Auszeichnungen_f%C3%BCr_Musikverk%C3%A4ufe","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Eric_Clapton_2.jpg","page_title":"Eric Clapton/Auszeichnungen für Musikverkäufe","context_page_description":"Dies ist eine Übersicht über die Auszeichnungen für Musikverkäufe des britischen Rocksängers und Gitarristen Eric Clapton. Die Auszeichnungen finden sich nach ihrer Art, nach Staaten getrennt in chronologischer Reihenfolge, geordnet sowie nach den Tonträgern selbst, ebenfalls in chronologischer Reihenfolge, getrennt nach Medium, wieder."},{"page_url":"https://de.wikipedia.org/wiki/Bernard_Panafieu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Mgrs_Bernard-Panafieu%26Nicolas-Brouwet.jpg","page_title":"Bernard Panafieu","context_page_description":"Bernard Louis Auguste Paul Kardinal Panafieu war ein französischer Geistlicher, Erzbischof von Marseille und Kardinal der Römisch-katholischen Kirche."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD-%D0%9C%D0%B5%D0%BB%D1%83%D0%B0%D1%80-%D0%B4%D0%B5%D0%B7-%D0%9E%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Saint-M%C3%A9loir-des-Ondes_mairie.jpg","page_title":"Сен-Мелуар-дез-Онд","context_page_description":"Сен-Мелуар-дез-Онд фр. Saint-Méloir-des-Ondes — коммуна на северо-западе Франции, находится в регионе Бретань, департамент Иль и Вилен, округ Сен-Мало, кантон Сен-Мало-1. Расположена в 11 км к востоку от Сен-Мало. В 3 км от центра коммуны находится железнодорожная станция Ла-Гуэньер – Канкаль – Сен-Мелуар-дез-Онд линии Ренн – Сен-Мало.\\nНаселение (2015) — 4 014 человек."},{"page_url":"https://cs.wikipedia.org/wiki/Opat%C5%99ilka_%E2%80%93_%C4%8Cerven%C3%BD_lom","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/V%C3%A1pencov%C3%A9_vrsvy_v_%C4%8Cerven%C3%A9m_lomu.JPG","page_title":"Opatřilka – Červený lom","context_page_description":"Opatřilka – Červený lom je přírodní památka o rozloze 8,2028 ha nacházející se na území hlavního města Prahy.\\nDůvodem ochrany jsou paleontologicky a stratigraficky významné výchozy v místech bývalých lomů\\na na ně vázaná společenstva teplomilných pastvin.\\nNa floru navazuje i fauna typická pro teplomilná stanoviště, zejména bezobratlí. Dále se zde vyskytuje několik druhů plazů, ptáků a savci jsou zde zastoupeni patnácti druhy."},{"page_url":"https://az.wikipedia.org/wiki/Dair%C9%99_m%C9%99hk%C9%99m%C9%99sinin_binas%C4%B1_(Taqanroq)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/2013_Taganrog_Dom_Djuricha.jpg","page_title":"Dairə məhkəməsinin binası (Taqanroq)","context_page_description":"Dairə məhkəməsinin binası — Taqanroqun mərkəzində tarixi qədim bina. Taqanroqun arxitektura abidələri siyahısına daxildir. Hal-hazırda binada Taqanroq metallurgiya kolleci yerləşir."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_s%C3%BAng_b%E1%BA%AFn_t%E1%BB%89a","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Sniper_Zastava_M93.jpg","page_title":"Danh sách súng bắn tỉa","context_page_description":"Súng bắn tỉa là loại súng trường có sát thương cao, thường được sử dụng để tác chiến tầm xa. Nó thường có độ chính xác cao hơn bất kỳ loại súng cầm tay nào khác. Súng bắn tỉa thường đi kèm với một kính ngắm quang học và chân chống chữ V. Nó thường sử dụng các cơ chế, chế độ bắn như nạp đạn không tự động, bán tự động hay tự động.\\nĐây là danh sách những súng bắn tỉa được chế tạo và sử dụng trên khắp thế giới. Trang này bao gồm các loại súng trường bắn tỉa, súng bắn tỉa bán tự động, súng trường thiện xạ và súng bắn tỉa công phá."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%BE%D0%B2%D0%BD%D1%8B%D0%B9_%D1%80%D0%BE%D0%BC%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Hammond-SS10.jpg","page_title":"Любовный роман","context_page_description":"Любовный роман — литературный жанр. В центре произведений этого жанра находятся отношения и романтическая любовь между двумя людьми, также предполагается «эмоционально удовлетворительный и оптимистичный финал». У любовного романа множество поджанров: фэнтези, исторический роман, научная фантастика, мистика.\\nПо мнению некоторых исследователей, источниками жанра являются произведения западноевропейской художественной литературы XVIII и XIX веков, в частности, сентиментальный роман «Памела, или вознаграждённая добродетель» Сэмюэла Ричардсона и романы Джейн Остин. Под впечатлением от Остин писала Джоржетт Хейер, британская писательница в жанре детектива и исторической романтики, действие книг которой происходит в период Джейн Остин. Первый любовный роман Хейер «Чёрный мотылек», события которого развиваются в 1751 году, был опубликован в 1921 году. В 1930-х года британская компания Mills and Boon начала издавать эскапистскую литературу для женщин. В США первым по-настоящему популярным любовным романом стала книга «Пламя и цветок» Кэтлин Вудивисс, опубликованная в 1972 году издательством Avon Books.\\nЖанр популярен в США, Европе, Австралии."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Rotherbaum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Stolperstein_Durchschnitt_8_%28Bella_Aron%29_in_Hamburg-Rotherbaum.JPG","page_title":"Liste der Stolpersteine in Hamburg-Rotherbaum","context_page_description":"Die Liste der Stolpersteine in Hamburg-Rotherbaum enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Rotherbaum verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die in Hamburg-Rotherbaum lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5897 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Roy_Brown_(ice_hockey)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Roy_Brown%2C_Canadian_Soo.jpg","page_title":"Roy Brown (ice hockey)","context_page_description":"Roy Townley Brown was a Canadian professional ice hockey defenseman who was active in the early 1900s. Amongst the teams Brown played for were the Brantford Indians and the Berlin Dutchmen of the OPHL, as well as the Canadian Soo Algonquins of the IPHL where he acted both as team captain and coach.\\nHe was born in Mitchell, Ontario."},{"page_url":"https://en.wikipedia.org/wiki/Agnieszka_Lukasiak","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/AgnieszkaLukasiakApr2011.jpg","page_title":"Agnieszka Lukasiak","context_page_description":"Agnieszka Lukasiak is a film director based in Los Angeles, Stockholm and London. She began her career directing cinema-released feature documentaries, and is now directing feature films.\\nLukasiak came to Sweden in 1984 with her parents as refugees.\\nShe graduated from the directing department of the Polish National Film School in Łódź in 2002."},{"page_url":"https://ja.wikipedia.org/wiki/POP%E5%BA%83%E5%91%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%E3%82%BB%E3%83%83%E3%83%88%E5%80%A4%E5%BC%95%E3%81%8D.jpg","page_title":"POP広告","context_page_description":"POP広告とは、「Point of purchase advertising」の頭文字から取った略語で、主に小売店の店頭プロモーションとして展開される広告媒体である。"},{"page_url":"https://it.wikipedia.org/wiki/Hum_(Trebigne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Selo_Hum.jpg","page_title":"Hum (Trebigne)","context_page_description":"Hum è un centro abitato della Bosnia ed Erzegovina, compreso nel comune di Trebigne."},{"page_url":"https://pl.wikipedia.org/wiki/Shell_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Shell_Beach_Western_Australia.jpg","page_title":"Shell Beach","context_page_description":"Shell Beach – plaża na wschodnim brzegu półwyspu Peron nad L’Haridon Bight w Zatoce Rekina, ok. 44 km od Denham w Australii Zachodniej.\\nPlaża zbudowana jest z muszelek Fragum erugatum z rodzaju sercówkowatych występującej licznie w wysoce zasolonych wodach L’Haridon Bight. Plaża rozciąga się przez 60 km a miejscami warstwa muszelek osiąga grubość 10 m i szerokość 1 kilometra.\\nShell Beach objęta jest ochroną i leży na terenie parku Shell Beach Conservation Park. Cała Zatoka Rekina wpisana jest na listę światowego dziedzictwa UNESCO."},{"page_url":"https://it.wikipedia.org/wiki/Terumah_(parashah)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Philon.jpg","page_title":"Terumah (parashah)","context_page_description":"Terumah o Trumah diciannovesima porzione settimanale della Torah nel ciclo annuale ebraico di letture bibliche dal Pentateuco, settima nel Libro dell'Esodo. Rappresenta il passo 25:1-27:19 di Esodo, che gli ebrei leggono durante il diciannovesimo Shabbat dopo Simchat Torah, generalmente a febbraio o ai primi di marzo.\\nLa parashah riporta le istruzioni di Dio per costruire il Tabernacolo e i suoi arredi."},{"page_url":"https://en.wikipedia.org/wiki/Little_blue_heron","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Little_blue_heron_%28Egretta_caerulea%29_juvenile.jpg","page_title":"Little blue heron","context_page_description":"The little blue heron is a small heron belonging to the family Ardeidae."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B9%D1%84%D0%B5%D0%BD%D1%88%D1%82%D0%B0%D0%B9%D0%BD_(%D0%B7%D0%B0%D0%BC%D0%BE%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%93%D1%80%D0%B0%D0%B9%D1%84%D0%B5%D0%BD%D1%88%D1%82%D0%B0%D0%B9%D0%BD.jpeg","page_title":"Грайфенштайн (замок)","context_page_description":"Замок Грайфенштайн — замок, расположенный в одноимённой местности в районе Лан-Дилль."},{"page_url":"https://lt.wikipedia.org/wiki/Maserati_Coup%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Maserati_Coupe_Vintage_-_blue.jpg","page_title":"Maserati Coupé","context_page_description":"Maserati Coupé ir Spyder - GT klasės sportiniai automobiliai gaminti Italijos autogamintojo Maserati nuo 2002 iki 2007 metų, kuomet buvo pakeisti Maserati GranTurismo modelio."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%99%AE%E9%87%8C%E7%93%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Piscine_de_Privas_-_ext%C3%A9rieur.JPG","page_title":"普里瓦","context_page_description":"普里瓦，法國東南部城市，奧弗涅-隆河-阿爾卑斯大區阿爾代什省的一個市鎮，同時也是該省的省會，下轄普里瓦區。普里瓦位於阿爾代什省中部，維瓦賴山區腹地，其市鎮面積為12.14 平方千米平方公里，2017年1月1日年人口數量為8,266人，在法國城市中排名第1,261位。\\n普里瓦是法國本土人口數量最少的省會城市，也是法國本土唯一一個未通鐵路的省會。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame_de_Taverny","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Taverny_%2895%29%2C_%C3%A9glise_Notre-Dame%2C_bas-c%C3%B4t%C3%A9_sud%2C_dalle_fun%C3%A9raire_du_chevalier_Philippe%2C_XIIIe_s.jpg","page_title":"Église Notre-Dame de Taverny","context_page_description":"L'église Notre-Dame est une église catholique située à Taverny, en France. Construite dans une seule et longue campagne sous Mathieu II de Montmorency et son fils Bouchard entre 1200 et 1240, elle se distingue par l'homogénéité de sa structure, l'élégance de son architecture gothique et l'importance des surfaces vitrées. L'élévation sur trois étages avec grandes arcades, triforium et fenêtres hautes est celle des plus grandes églises de l'époque et affiche les ambitions des seigneurs locales. Les vaisseaux sont plus larges et aussi plus élevés que d'ordinaire. De même, la décoration est très soignée et la sculpture est généralement d'une grande qualité, et l'on est loin de l'austérité qui prévaut sur de nombreuses églises contemporaines. Contrairement à la majorité des églises de la région, l'église Notre-Dame n'a jamais subi de remaniements affectant sa physionomie ou son plan. Des modifications y ont toutefois été apportées à la période flamboyante, à la fin du XVᵉ siècle, et dans une moindre mesure, sous la Renaissance."},{"page_url":"https://de.wikipedia.org/wiki/Johannes_Junck","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Junck-johannes-1912-s492.jpg","page_title":"Johannes Junck","context_page_description":"Moritz Johannes Junck war Jurist und Mitglied des Deutschen Reichstags."},{"page_url":"https://sq.wikipedia.org/wiki/Vadencourt,_Aisne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/%C3%89glise_Vadencourt.JPG","page_title":"Vadencourt, Aisne","context_page_description":"Vadencourt është një komunë franceze, e cila ndodhet në departamentin Aisne të rajonit Hauts-de-France. Vadencourt ka një popullsi prej 577 banorë dhe sipërfaqe 12.24 km², me një dendësi prej 47 banor/km²."},{"page_url":"https://de.wikipedia.org/wiki/Lichtbogenofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Fotothek_df_n-32_0000122_Metallurge_f%C3%BCr_H%C3%BCttentechnik.jpg","page_title":"Lichtbogenofen","context_page_description":"Der Lichtbogenofen ist ein Industrieofen, der unter anderem zum Einschmelzen von Stahlschrott zur erneuten Verwendung als Stahl-Neuprodukt eingesetzt wird. In Fachkreisen wird häufig vom EAF gesprochen.\\nStahl kann zum einen aus Eisenerz über die Route Hochofen und Konverter hergestellt werden. Die Erzeugung von Stahl in Lichtbogenöfen ist jedoch kostenintensiver als in der Hochofenroute. Mit Lichtbogenöfen können alle Stahlsorten hergestellt werden, sie werden aber auf Grund der hohen Kosten hauptsächlich zur Herstellung von Qualitäts- und Edelstählen benutzt. Energetisch günstig ist es, im Lichtbogenofen den Stahlschrott zu erschmelzen. 2017 wurden weltweit 1688 Mio. Tonnen Rohstahl produziert, davon 28 % mit Lichtbogenöfen. Der Anteil in Europa betrug 42 %, der von Deutschland 29 %."},{"page_url":"https://es.wikipedia.org/wiki/El_gatopardo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Donnafugata_02.jpg","page_title":"El gatopardo","context_page_description":"El gatopardo ​ es una novela escrita por Giuseppe Tomasi di Lampedusa, entre finales de 1954 y 1957. Rechazada en un principio por las editoriales Einaudi y Mondadori, fue publicada póstumamente por la editorial de Giangiacomo Feltrinelli con prólogo de Giorgio Bassani. En 1959 obtuvo el Premio Strega, y en 1963 Luchino Visconti la adaptó al cine."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BD%D1%82%D1%8D%D0%B9%D0%B4%D0%B6%D0%B5%D1%81,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/2009-0725-CA-Fresno-WarnorsTheatre.jpg","page_title":"Пантэйджес, Александр","context_page_description":"Алекса́ндр «А́лекс» Пантэ́йджес — греко-американский театральный импресарио, продюсер первых водевилей и раннего кинематографа, создатель знаменитых театров Pantages. Имел репутацию упрямого, неутомимого и жёсткого бизнесмена; в то же время был искусным и креативным предпринимателем, обладал невероятной деловой хваткой и интуицией. Называл себя Королём Греком, возможно, следуя примеру кинопродюсера Луиса Б. Майера, носившего прозвище Супер Еврей. Является классическим примером человека, реализовавшего американскую мечту, и легендой шоу-бизнеса.\\nПантэйджес — один из пионеров индустрии развлечений, выдающийся театральный и киномагнат Америки. В 1920-х годах он стал первым бизнесменом, начавшим заключать сделки с кинодистрибьюторами, содействуя тем самым появлению раннего прототипа современного кинотеатра. Долгое время считалось, что Пантэйджес был первым, кто начал показывать немые фильмы в театрах. С начала 1910-х годов и до начала Великой депрессии владел компанией Pantages Circuit — крупнейшей независимой сетью водевиль- и кинотеатров в Северной Америке.\\nВ 9-летнем возрасте Пантэйджес бросил школу, не научившись читать и писать."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Dahlem","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Faradayweg_16_Berlin-Dahlem.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Dahlem","context_page_description":"In der Liste der Kulturdenkmale von Dahlem sind die Kulturdenkmale des Berliner Ortsteils Dahlem im Bezirk Steglitz-Zehlendorf aufgeführt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BC%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%8F_%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Ymca_boys_jeru.jpg","page_title":"Демография Иерусалима","context_page_description":"Иерусалимцы относятся ко множеству национальных, этнических и религиозных деноминаций — к которым, среди прочих, относятся европейские, ближневосточные и африканские евреи, грузины, армяне, мусульмане, протестанты, греки, греко-православные, сирийско-православные и коптско-православные арабы. Многие из этих групп были когда-то иммигрантами или паломниками, которые с течением времени превратились в почти коренные группы населения, утверждающие, что значимость Иерусалима для их религии является той причиной, по которой они переехали в город и пребывают в нём.\\nДолгая история завоеваний Иерусалима различными соперничающими государствами привела к тому, что многие из различных групп, населяющих город, никогда полностью не отождествляли себя и не ассимилировались с конкретным государством, сколько бы времени ни длилось его правление. Хотя они могли быть гражданами данного конкретного царства и империи, вовлечёнными в гражданскую деятельность и выполнение обязанностей, эти группы часто воспринимали себя как отдельные национальные общности."},{"page_url":"https://en.wikipedia.org/wiki/Kalpa,_Himachal_Pradesh","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Stupa_in_Kalpa%2C_Himachal_Pradesh.jpg","page_title":"Kalpa, Himachal Pradesh","context_page_description":"Kalpa is a small village in the Sutlej river valley, above Reckong Peo in the Kinnaur district of Himachal Pradesh, Northern India, in the Indian Himalaya. Inhabited by Kinnauri people and known for its apple orchards. Apples are a major cash-crop for the region. The local inhabitants follow a syncretism of Hinduism and Buddhism, and many temples in Kalpa are dedicated to both Hindu and Buddhist gods and goddesses. The average literacy rate of Kalpa is around 83.75%. India's first ever voter Shyam Saran Negi also belongs to Kalpa."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%A8%E3%82%BF%E3%83%BB%E3%82%BB%E3%83%AA%E3%82%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Toyota_Celica_Coupe_A60.jpg","page_title":"トヨタ・セリカ","context_page_description":"セリカは、トヨタ自動車が1970年から2006年まで製造・販売していたハードトップおよびクーペ型の乗用車。日本国内の取り扱い販売店はトヨタカローラ店。\\nまた、この項目では以下のモデルについても記述する。\\nセリカリフトバック\\nセリカクーペ\\nセリカコンバーチブル"},{"page_url":"https://eo.wikipedia.org/wiki/Sinagogo_de_Michelstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Judaism_Symbol.png","page_title":"Sinagogo de Michelstadt","context_page_description":"La sinagogo de Michelstadt situas en la historia urbeto Michelstadt [Mihelŝtat] en la federacia lando en centra Germanio, centre de la arbaroriĉa mezalta montaro Odenvaldo. La loka juda komunumo starigis ĝin en 1791. La konstruaĵo situas en la historia urbocentro, rekte ĉe la mezepoka urba remparo."},{"page_url":"https://sl.wikipedia.org/wiki/Voja%C5%A1ka_galerija,_Zimski_dvorec","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Sabaneev_Ivan_Vasiljevich.jpg","page_title":"Vojaška galerija, Zimski dvorec","context_page_description":"Vojaška galerija je galerija portretov 332 generalov patriotske vojne leta 1812, ki se nahaja v Zimskem dvorcu v Sankt Peterburgu. Zbirko je ukazal izdelati car Aleksander I. z namenom počastitve generalov, ki so pomagali premagati Napoleona med njegovo invazijo na Rusijo ter nadaljnjimi vojnami."},{"page_url":"https://nl.wikipedia.org/wiki/Limours","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Map_commune_FR_insee_code_91338.png","page_title":"Limours","context_page_description":"Limours is een gemeente in het Franse departement Essonne en telt 6414 inwoners. De plaats maakt deel uit van het arrondissement Palaiseau."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_der_Deutschen_Akademie_der_Naturforscher_Leopoldina/1884","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Nord_s%C3%BCd_1903_Kurd_Lasswitz.png","page_title":"Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina/1884","context_page_description":"Die Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina für 1884 enthält alle Personen, die im Jahr 1884 zum Mitglied ernannt wurden. Insgesamt gab es 68 neu gewählte Mitglieder."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%B8_%D1%81%D0%BF%D0%BE%D0%BC%D0%B5%D0%BD%D0%B8%D1%86%D0%B8_%D0%BD%D0%B0_%D1%81%D0%B5%D0%BE%D1%81%D0%BA%D0%BE%D0%BC_%D0%B3%D1%80%D0%BE%D0%B1%D1%99%D1%83_%D1%83_%D0%93%D0%BE%D1%80%D1%9A%D0%BE%D1%98_%D0%A6%D1%80%D0%BD%D1%83%D1%9B%D0%B8_(%D0%BE%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%93%D0%BE%D1%80%D1%9A%D0%B8_%D0%9C%D0%B8%D0%BB%D0%B0%D0%BD%D0%BE%D0%B2%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Spomenici_u_Gornjoj_Crnu%C4%87i_kraj_Gornjeg_Milanovca_%28120%29.jpg","page_title":"Стари споменици на сеоском гробљу у Горњој Црнући (општина Горњи Милановац)","context_page_description":"Стари споменици на сеоском гробљу у Горњој Црнући (општина Горњи Милановац) представљају релативно добро очувану споменичку целину и важан извор података за проучавање историје овог краја."},{"page_url":"https://ckb.wikipedia.org/wiki/%DB%8C%DB%95%D9%86%D8%B3_%DA%AF%DB%95%D9%84%D8%B3%D8%B4%DB%8C%DB%86%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Voa_Jens_Galschiot_18may09.jpg","page_title":"یەنس گەلسشیۆت","context_page_description":"یەنس گەلسشیۆت خوێندنی پلێت و نەخشەسازی ئاسنگەری لە خوێندنگای کارگەی پۆڵایینی کەشتیسازی شاری ئۆدەنسە لە ساڵی دا تەواوکردووە. ئەو ھەر لەخۆیەوە لە پیشگە ی خۆی لە شاری ئۆدەنسە کە لە ساڵی دا دایمەزراندووە، فێری ئاسنگەری زیو و پەیکەرتاشی بووە. پیشگەی کاری ھونەری گەلسشیۆت پێکدێت لە برۆنزداڕشتن، پێشانگای ناو ھۆڵ، پیشگە و باخێکی پڕ لە پەیکەر.\\nیەنس گەلسشیۆت، ھونەرمەندێکی زۆر وردبینە کە لە ھەر دوو بواری ھونەری دامەزراندن و ھونەری سەر شەقام کار دەکات، کە پەیوەستە بە پەیکەرتاشی کۆمەڵایەتی، سومبۆلیزم و ھونەری نوێ. یەنس گەلسشیۆت بەشێوەیەکی بنچینەیی کاردەکات لەپێناو ڕووبەڕووبوونەوەی نادادپەروەری جیھانی بەوەی کە پەیکەرەکانی لەو شوێن و گۆڕەپانانە لەناو شارە گەورەکان لە سەرانسەری جیھان دادەنێت. زۆربەی زۆری پەیکەرەکانی لە برۆنز و بە کەرەستە و سامانی خۆی دروست دەکات.\\nیەنس گەلسشیۆت زۆر جار بەھۆی ەوە بە جیھان ناسێنراوە بەھۆی خۆپیشاندانەکان کە لەکاتی بۆنە گەورەکان ئەنجام دەدرێن. لەکاتی بەستنی کۆبوونەوەی لوتکەی کەشوھەوا لە کۆپنھاون لە ساڵی دا، یەنس گەلسشیۆت پەیکەرێکی دانا بەناوی مانەوە بۆ قەڵەوەکانە کە لەتەک پەری دەریا داینا.\\nگەلسشیۆت دامەزراوەی پەیکەری لە زۆر جێگادا دروست کردووە بۆ نموونە دامەزراندنی پەیکەری کە کێشەکەی ٢٢ تۆنە، لە ساڵی دا پەیکەری لە ئەور، وپا، پەیکەری لە ھۆنگ کۆنگ، مەکسیکۆ و بەرازیل."},{"page_url":"https://fr.wikipedia.org/wiki/Aranais","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Europe2005_bossost-aranes1.jpg","page_title":"Aranais","context_page_description":"L’aranais est le nom donné à la variété de la langue occitane parlé dans le Val d'Aran, en Catalogne.\\nIl est langue officielle du Val d'Aran depuis que ce territoire a reçu un statut de semi-autonomie en 1990. Depuis 2006, l'occitan aranais est langue officielle dans toute la Catalogne, selon le nouveau statut de cette communauté autonome : « la langue occitane, appelée aranais dans le Val d'Aran, est la langue propre de ce territoire, et elle est officielle en Catalogne, conformément à ce qu'établissent ce Statut et les lois de normalisation linguistique ».\\nC'est un parler occitan de dialecte gascon de montagne qui bénéficie d'une norme linguistique en accord avec la norme classique de l'occitan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D1%80%D0%B5%D0%B7%D0%B2%D1%8B%D1%87%D0%B0%D0%B9%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8_%D0%98%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5%D0%B7%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Susanto_Tirtoprodjo.jpg","page_title":"Чрезвычайное правительство Республики Индонезии","context_page_description":"Чрезвычайное правительство Республики Индонезии — правительство в изгнании, созданное сторонниками Республики Индонезии в ходе Войны за независимость, в условиях оккупации большей части страны голландскими войсками. Существовало в 1948—1949 годах и размещалось в городе Букиттинги. Главой ЧПРИ был Шафруддин Правиранегара."},{"page_url":"https://hu.wikipedia.org/wiki/Sveta_Nedelja_(Z%C3%A1gr%C3%A1b_megye)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Stari_%C5%BEupni_dvor%2C_Sveta_Nedelja.jpg","page_title":"Sveta Nedelja (Zágráb megye)","context_page_description":"Sveta Nedelja város és község Horvátországban Zágráb megyében. Közigazgatásilag Bestovje, Brezje, Jagnjić Dol, Kalinovica, Kerestinec, Mala Gorica, Novaki, Orešje, Rakitje, Srebrnjak, Strmec, Svetonedeljski Breg és Žitarka települések tartoznak hozzá."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BC%A0%E8%A1%A1%E4%B8%80%E5%8F%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/CSES_Satellite.jpg","page_title":"张衡一号","context_page_description":"張衡一號，是中華人民共和國的一顆人造地球衛星，亦是中國首顆電磁監測試驗衛星。該衛星品質為730公斤，設計壽命為五年。電磁監測試驗衛星專案由中國航天科技集團五院航天東方紅衛星有限公司抓總研製。張衡一號衛星於2018年2月2日15時51分在酒泉衛星發射中心由長征二號丁運載火箭發射升空，並在太陽同步軌道上執行。\\n張衡一號電磁監測試驗衛星是中國地球物理場探測衛星計劃的首發星，是中國天空地一體化地震立體監測體系下的首個空間觀測平台。該衛星將在高度約500公里的太陽同步軌道上，對全球規模7以上和中國6以上地震的電磁資訊進行分析，以此為地震機理研究、空間環境監測和地球系統科學研究提供天基平台和新技術手段。義大利太空總署和義大利國家核物理研究所透過「利瑪竇」計劃參與了張衡一號專案，星上傳荷也有奧地利機構參與研製。"},{"page_url":"https://en.wikipedia.org/wiki/Outline_of_the_Netherlands","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Netherlands_pol87.jpg","page_title":"Outline of the Netherlands","context_page_description":"The following outline is provided as an overview of and topical guide to the Netherlands.\\nThe Netherlands comprises the mainland located in Northwest Europe and several islands located in the Caribbean that, together with Aruba, Curaçao and Sint Maarten in the Caribbean Sea, constitute the sovereign Kingdom of the Netherlands. The Netherlands is a parliamentary democratic constitutional monarchy. Its European mainland is bordered by the North Sea to the north and west, Belgium to the south, and Germany to the east.\\nThe European Netherlands constitutes the vast majority of both the country and the Kingdom of the Netherlands, and as such 'the Netherlands' in common parlance often implicitly refers to this entity. Similarly, the articles linked to below predominately consider the European Netherlands."},{"page_url":"https://en.wikipedia.org/wiki/Mes_Aynak","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Mes_Aynak_archeologists.jpg","page_title":"Mes Aynak","context_page_description":"Mes Aynak, also called Mis Ainak or Mis-e-Ainak, is a site 40 km southeast of Kabul, Afghanistan, located in a barren region of Logar Province. Mes Aynak contains Afghanistan's largest copper deposit, as well as the remains of an ancient settlement with over 400 Buddha statues, stupas and a 40 ha monastery complex. Archaeologists are only beginning to find remnants of an older 5,000-year-old Bronze Age site beneath the Buddhist level, including an ancient copper smelter.\\nThe site of Mes Aynak possesses a vast complex of Buddhist monasteries, homes, and market areas. The site contains artifacts recovered from the Bronze Age, and some of the artifacts recovered have dated back over three thousand years. The site's orientation on the Silk Road has yielded a mixture of elements from China and India. The wealth of Mes Aynak’s residents has been well represented in the site's far-reaching size and well guarded perimeter. Afghanistan’s eagerness to unearth the copper below the site is leading to the site's destruction rather than its preservation. Archaeologists have photographed the site and the relics excavated."},{"page_url":"https://nl.wikipedia.org/wiki/Spoorlijn_Altst%C3%A4tten_-_Gais","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Saurer_Postbus_Altst%C3%A4tten_Schweiz.jpg","page_title":"Spoorlijn Altstätten - Gais","context_page_description":"De spoorlijn Altstätten - Gais is een Zwitserse spoorlijn die tussen 1911 tot 1949 door de spoorwegonderneming Altstätten–Gais-Bahn bediend werd. Sinds 2006 maakt deze spoorlijn deel uit van de Appenzeller Bahnen."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9C%D7%97%D7%9E%D7%AA_%D7%94%D7%90%D7%96%D7%A8%D7%97%D7%99%D7%9D_%D7%91%D7%A1%D7%A4%D7%A8%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/CA-Casamata_defensa_monte_Tolio.Mortera_10.jpg","page_title":"מלחמת האזרחים בספרד","context_page_description":"מלחמת האזרחים בספרד התרחשה בין השנים 1936 עד 1939. המלחמה פרצה כתוצאה ממרד של קציני צבא נגד הממשלה הנבחרת של הרפובליקה הספרדית, שאליו הצטרפו שורה של קבוצות פוליטיות וחברתיות שזוהו עם הימין הפוליטי וזכו לכינוי \\"הלאומנים\\". מולם עמדו \\"הרפובליקנים\\" ששמרו על נאמנות לרפובליקה ואיגדו את מרבית תומכי השמאל. המלחמה רוויית המאבקים האידאולוגיים עוררה עניין רב ברחבי העולם ומעורבות בינלאומית נרחבת, ולכן מתוארת לא פעם כחזרה הגנרלית של המעצמות לקראת מלחמת העולם השנייה. המלחמה נתפסה בספרד עצמה וברחבי העולם בין השאר כמלחמת מעמדות, מלחמה נגד פאשיזם, מלחמה נגד קומוניזם, עימות בין דמוקרטיה לדיקטטורה, מלחמת דת ומאבק בין מהפכה לריאקציה. היא הסתיימה בניצחון הלאומנים לאחר מלחמה ארוכה ועקובה מדם, ובהקמת דיקטטורה בראשותו של פרנסיסקו פרנקו.\\nאלימות פוליטית וחוסר יציבות רווחו בשנות ה-30 בספרד, באופן שבא לידי ביטוי בשביתות כלליות רבות, התנגשויות ברחובות, והתקוממויות כמו זו שאירעה באסטוריאס ב-1934. באביב 1936 הגיעה האלימות לשיאה, וביולי אותה השנה נכשל ניסיונם של כמה בכירים בצבא המזוהים עם הימין לתפוס את השלטון בהפיכה צבאית, וכתוצאה מכך פרצה מלחמת אזרחים. כוחות הצבא התחלקו בין שני הצדדים באופן שווה יחסית, אך רוב כוחות הצבא המיומנים והקצונה הבכירה הצטרפו למרד."},{"page_url":"https://ro.wikipedia.org/wiki/Joseph_Schr%C3%B6ter","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Joseph_Schr%C3%B6ter.png","page_title":"Joseph Schröter","context_page_description":"Joseph Schröter a fost un medic, medic militar în rang de colonel, bacteriolog, botanist, ficolog, foarte renumit micolog precum profesor universitar german. El a fost primul care a descris Salmonella typhi, bacteria care provoacă febra tifoidă. Abrevierea numelui său în cărți științifice este J.Schröt.."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D1%80%D1%8D%D0%BC%D1%8D%D0%BD%D1%8D%D1%86%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Kremenec_01.jpg","page_title":"Крэмэнэць","context_page_description":"Крэ́мэнэць, або Крэменец — горад у Цярнопальскай вобласці Украіны. Адміністрацыйны цэнтр Крэмэнэцкага раёна. Насельніцтва 23,9 тыс. чал.\\nЗнаходзіцца за 75 км ад Цярнопаля. Вузел аўтамабільных шляхоў, канцавая станцыя адгалінавання ад лініі Здалбунаў — Львоў."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_mit_dem_J%C3%BClicher_L%C3%B6wen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/JgBtl_533.png","page_title":"Liste der Wappen mit dem Jülicher Löwen","context_page_description":"Die Liste der Wappen mit dem Jülicher Löwen enthält amtliche Wappen und andere Wappen mit dem Jülicher Löwen als Wappentier."},{"page_url":"https://cs.wikipedia.org/wiki/Franz_Xaver_Gruber","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Gruber1.jpg","page_title":"Franz Xaver Gruber","context_page_description":"Franz Xaver Gruber byl rakouským skladatelem a autorem melodie světoznámé vánoční koledy Tichá noc."},{"page_url":"https://cs.wikipedia.org/wiki/Beton%C3%A1%C5%99sk%C3%A1_v%C3%BDztu%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/EpoxyTreatedReinforcement.jpg","page_title":"Betonářská výztuž","context_page_description":"Betonářská výztuž, výztužná vložka, betonářská ocel, měkká výztuž jsou pojmy, se kterými se lze setkat při označení plných, většinou kruhových ocelových tyčí, které se vkládají do betonu za účelem zvýšení jeho únosnosti a snížení deformací, tedy výroby železobetonu. Podmínkou pro vytvoření železobetonu je tzv. soudržnost, která zajistí spolupůsobení mezi výztuží a betonem. Soudržnost je u kruhových výztuží zajištěna mj. výstupky, které jsou tvarované.\\nŽivotnost železobetonové konstrukce je mj. ovlivněna hloubkou uložení výztuže pod povrchem, tzv. krycí vrstvou, která chrání ocelové vložky před masivní korozí. Pro snížení rizika vzniku koroze se vložky mohou opatřit povlakem nebo se mohou použít vložky z korozivzdorné oceli.\\nDruhů výztuží i betonářských ocelí se používalo za dobu stavění železobetonových konstrukcí nepřeberné množství. Výběr výztuží je ovlivněn nejenom výrobním sortimentem, ale také typem konstrukce, do kterých jsou výztuže zabudovány. Typickým příkladem jsou svařované sítě, tzv. kari sítě, které se používají pro vyztužování deskových nebo stěnových konstrukcí."},{"page_url":"https://no.wikipedia.org/wiki/Rothschildia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Rothschildia_erycina.jpg","page_title":"Rothschildia","context_page_description":"Rothschildia er en slekt av sommerfugler som hører til familien påfuglspinnere."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_L%C3%BCbeck","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Jenny_Ruben_%28geb.Hammerschlag%29.jpg","page_title":"Liste der Stolpersteine in Lübeck","context_page_description":"Die Liste der Stolpersteine in Lübeck gibt eine Übersicht über die vom Künstler Gunter Demnig verlegten Stolpersteine in der Stadt Lübeck. Grundlage dieser Liste sind die von der Initiative Stolpersteine für Lübeck zur Verfügung gestellten Daten.\\nDie 10 cm × 10 cm × 10 cm großen Betonquader mit Messingtafel sind in den Bürgersteig vor jenen Häusern eingelassen, in denen die Opfer einmal zu Hause waren. Die Inschrift der Tafel gibt Auskunft über ihren Namen, ihr Alter und ihr Schicksal. Die Stolpersteine sollen dem Vergessen der Opfer der nationalsozialistischen Gewaltherrschaft entgegenwirken.\\nDer erste Stolperstein in Lübeck wurde 2003 durch die Erich-Mühsam-Gesellschaft für Erich Mühsam vor dem Buddenbrookhaus verlegt, 2016 betrug die Zahl 193 Stück, weitere folgten 2017. Mit der Verlegung von 14 neuen Steinen am 27. September 2018 erhöhte sich die Gesamtzahl auf 214 Stolpersteine."},{"page_url":"https://zh.wikipedia.org/wiki/1962%E5%B9%B4%E5%9C%8B%E9%9A%9B%E8%B6%B3%E5%8D%94%E4%B8%96%E7%95%8C%E7%9B%83%E5%A4%96%E5%9C%8D%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Qualification_for_the_1962_FIFA_World_Cup.png","page_title":"1962年國際足協世界盃外圍賽","context_page_description":"1962年國際足總世界盃外圍賽，共產生 16 個出線名額，參加1962年國際足總世界盃。主辦國智利與衛冕冠軍巴西直接取得決賽周的參賽資格。"},{"page_url":"https://en.wikipedia.org/wiki/United_States_one-hundred-dollar_bill","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/US-%24100-LT-1863-Fr-167.jpg","page_title":"United States one-hundred-dollar bill","context_page_description":"The United States one-hundred-dollar bill is a denomination of United States currency. The first United States Note with this value was issued in 1862 and the Federal Reserve Note version was launched in 1914, alongside other denominations. Statesman, inventor, diplomat, and American founding father Benjamin Franklin has been featured on the obverse of the bill since 1914. On the reverse of the banknote is an image of Independence Hall in Philadelphia, which has been used since 1928. The $100 bill is the largest denomination that has been printed and circulated since July 13, 1969, when the denominations of $500, $1,000, $5,000, and $10,000 were retired. The Bureau of Engraving and Printing says the average life of a $100 bill in circulation is 90 months before it is replaced due to wear and tear.\\nThe bills are also commonly referred to as \\"Bens,\\" \\"Benjamins,\\" or \\"Franklins,\\" in reference to the use of Benjamin Franklin's portrait on the denomination, as \\"C-Notes,\\" based on the Roman numeral for 100, or as \\"blue faces,\\" based on the blue tint of Benjamin Franklin's face in the bill's current design."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%B1%AF%E9%96%80%E5%B8%82%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/New_Town_Mansion_Atrium_2014.jpg","page_title":"屯門市中心","context_page_description":"屯门市中心是香港新界屯门的中心及最繁华的地方，乃屯门新市镇以至整个屯门区的心脏地带，该区人流如鲫，商业活动频繁。市中心范围约为杯渡路以南、皇珠路以北及屯门河以东地区。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%98%81%EC%A3%BC_%EB%B6%80%EC%84%9D%EC%82%AC_%EC%A1%B0%EC%82%AC%EB%8B%B9_%EB%B2%BD%ED%99%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%EB%B6%80%EC%84%9D%EC%82%AC-%EC%A1%B0%EC%82%AC%EB%8B%B9-%EB%B2%BD%ED%99%94%28%E6%B5%AE%E7%9F%B3%E5%AF%BA-%E7%A5%96%E5%B8%AB%E5%A0%82-%E5%A3%81%E7%95%B5%29%28%EB%AA%A8%EC%82%AC%EB%8F%84%28%E6%A8%A1%E5%AF%AB%E5%9C%96%29%29.jpg","page_title":"영주 부석사 조사당 벽화","context_page_description":"영주 부석사 조사당 벽화는 경상북도 영주시 부석면 북지리 149, 부석사 조사당에 있었던 고려시대의 벽화이다. 1962년 12월 20일 대한민국의 국보 제46호로 지정되었다."},{"page_url":"https://it.wikipedia.org/wiki/La_notte_prima_di_Natale_(opera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Nikolai_Rimsky-Korsakov_-_Christmas_Eve_-_Yevgeniya_Mravina_as_Oxana%2C_1895.png","page_title":"La notte prima di Natale (opera)","context_page_description":"La notte prima di Natale, è un'opera lirica in quattro atti con musica e libretto di Nikolaj Andreevič Rimskij-Korsakov. Fu composta tra il 1894 ed il 1895 ed è basata sul racconto omonimo di Gogol', contenuto nella raccolta Veglie alla fattoria presso Dikan'ka."},{"page_url":"https://fr.wikipedia.org/wiki/Montagne_de_Lure","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Station_de_ski_de_la_Montagne_de_Lure.jpg","page_title":"Montagne de Lure","context_page_description":"La montagne de Lure est une montagne des Préalpes de Haute-Provence, située dans le département des Alpes-de-Haute-Provence. Elle appartient à la même formation géologique que le plateau d'Albion, qu'elle jouxte, et le mont Ventoux. Cette chaîne s'allonge sur 42 kilomètres de long, culmine au signal de Lure et présente un relief très contrasté entre l'adret calcaire, coupé de combes et de vallons, et l'ubac marneux, où s'accumulent monts et ravins.\\nL'étude de sa géologie, en 1888, a marqué un moment important dans l'avancée des connaissances des chaînes subalpines méridionales. Ce fut Wilfrid Kilian qui la réalisa dans une thèse novatrice où pour la première fois un géologue put dresser une échelle bio-stratigraphique pour le Jurassique et le Crétacé et qui utilisa le tout premier en France les clichés photographiques à l'appui de ses conclusions.\\nMontagne karstique, crevassée d'avens, aux cours d'eau à écoulement épisodique, où la moindre source est précieuse pour les hommes et les animaux, Lure est couverte majoritairement d'une forêt qui reconquiert, peu à peu, les anciens alpages."},{"page_url":"https://en.wikipedia.org/wiki/List_of_railway_bridges_and_viaducts_in_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Conisbrough_Viaduct_-_geograph.org.uk_-_925574.jpg","page_title":"List of railway bridges and viaducts in the United Kingdom","context_page_description":"This is a list of viaducts and significant bridges of the United Kingdom's railways, past and present."},{"page_url":"https://tt.wikipedia.org/wiki/NGC_2322","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/NGC_2322_DSS.jpg","page_title":"NGC 2322","context_page_description":"NGC 2322 — Томанлыклар һәм йолдыз тупланмалары яңа гомуми каталогында теркәлгән галактика."},{"page_url":"https://hu.wikipedia.org/wiki/Klauz%C3%A1l_Imre","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Klauz%C3%A1l_Imre-001.jpg","page_title":"Klauzál Imre","context_page_description":"Klauzál Imre mezőgazdász, Klauzál Gábor bátyja."},{"page_url":"https://ro.wikipedia.org/wiki/Epoca_victorian%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Thomas_B._Kennington_-_The_pinch_of_poverty_-_Google_Art_Project.jpg","page_title":"Epoca victoriană","context_page_description":"În istoria Regatului Marii Britanii, Epoca Victoriană a fost perioada domniei reginei Victoria a Regatului Unit, din 20 iunie 1837 până la moartea ei de pe 22 ianuarie 1901. Epoca Victoriană a fost precedată de Epoca Georgiană și a fost succedată de Epoca Eduardiană. Epoca Victoriană s-a suprapus cu o parte a Belle Époque din Franța. În termeni de sensibilități morale și reforme politice, perioada a început odată cu adoptarea Legii Reformei din 1832.\\nA existat o puternică forță religioasă pentru standardele morale superioare conduse de bisericile neconformiste, cum ar fi cea metodista și aripile evanghelice ale Bisericii Anglicane. Standardele morale s-au îmbunătățit foarte dramatic, în special pentru clasa de mijloc. Perioada a fost pașnică în cadrul relațiilor internaționale ale marilor puteri, cu doar un singur război din Crimeea. Marea Britanie s-a bucurat de o superioritate navală puternică, devenind liderul mondial în domeniul producției, finanțelor, căilor ferate, transportului maritim și antreprenoriatului. Marea Britanie s-a angajat într-o expansiune imperială globală, în special în Asia și Africa, imperiul britanic devenind cel mai mare imperiu din istorie."},{"page_url":"https://en.wikipedia.org/wiki/Ada-class_corvette","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Ada_Class_Corvette_K%C4%B1nal%C4%B1ada_%28F-514%29.jpg","page_title":"Ada-class corvette","context_page_description":"The Ada class is a class of corvettes, a part of the MILGEM project, developed primarily for the Turkish Navy. The Turkish Navy has commissioned all four Ada-class corvettes."},{"page_url":"https://de.wikipedia.org/wiki/Kamel_(Wappentier)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Z%C3%BCrich_-_Limmatquai_-_Zum_K%C3%A4mbel_IMG_1393.jpg","page_title":"Kamel (Wappentier)","context_page_description":"Das Kamel ist in der Heraldik eine gemeine Figur und als Wappentier schon seit dem frühen Mittelalter auf Wappen zu finden. Das seltene Wappentier tauchte etwa im 13. Jahrhundert erstmals auf.\\nOb ein Dromedar, ein Trampeltier oder ein Lama ins Wappen aufgenommen ist, klärt die Beschreibung. Vorrangig wird es in seiner natürlichen, oft braunen, Farbe und mit Reitgeschirr dargestellt. Andere Farben, wie Gold und Silber, gelten als edel für das Tier. Dieses hat eine abstechende Farbgebung. Die Hauptblickrichtung ist nach heraldisch rechts und schreitend ist die Standardstellung. Im Oberwappen ist seine Verwendung selten."},{"page_url":"https://eo.wikipedia.org/wiki/Ryu_Jun-yeol","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/160225_%EB%A5%98%EC%A4%80%EC%97%B4_%EB%A7%A5%EC%8A%A4%EB%AC%B4%EB%B9%84_%EC%B5%9C%EA%B3%A0_%EC%98%81%ED%99%94%EC%83%81_%EC%8B%A0%EC%9D%B8%EC%83%81_%EC%86%8C%EA%B0%90%EB%B0%9C%ED%91%9C.jpg","page_title":"Ryu Jun-yeol","context_page_description":"Ryu Jun-yeol estas sudkorea populara aktoro.\\nHangeul=류준열\\nHanja=\\nRr=Ryu Jun-yeol\\nMr=Ryu Chun-yŏl"},{"page_url":"https://de.wikipedia.org/wiki/Westhoven_(K%C3%B6ln)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Koeln-Westhoven_Engelshof.jpg","page_title":"Westhoven (Köln)","context_page_description":"Der Stadtteil Westhoven liegt im Südosten der Stadt Köln im Stadtbezirk Porz."},{"page_url":"https://ca.wikipedia.org/wiki/For%C3%A7a_A%C3%A8ria_de_M%C3%A8xic","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Bell2016FAM.jpg","page_title":"Força Aèria de Mèxic","context_page_description":"La Força Aèria Mexicana és una de les dues forces armades components de la Secretaria de la Defensa Nacional. El seu objectiu és defensar la integritat, independència i sobirania de Mèxic, garantir la seguretat interior, auxiliar a la població en cas de necessitats públiques, realitzar accions cíviques i obres socials que tendeixin al progrés del país i, en casos de desastre, prestar ajuda per al manteniment de l'ordre, auxili de les persones, els seus béns i la reconstrucció de les zones afectades.\\nEl terme Força Aèria Mexicana es refereix tant a l'equip aeri com al personal que ho vas agafar, que és utilitzat pel Col·legi de l'Aire, l'Exèrcit, l'Estat Major Presidencial, les Unitats Aèries i altres dependències. Al comandament suprem de la Força Aèria Mexicana es troba el President de la República.\\nLa FAM té la distinció d'haver-se emprat en observacions i combats aeris des de 1914. Des que va ser reorganitzada en 1920, el govern electe ja no ha estat destituït per la força, doncs la FAM va contribuir a sufocar múltiples rebel·lions d'origen territorial, militar i religiós."},{"page_url":"https://it.wikipedia.org/wiki/T%C3%A4gerig","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Karte_Gemeinde_T%C3%A4gerig_2014.png","page_title":"Tägerig","context_page_description":"Tägerig è un comune svizzero di 1 517 abitanti del Canton Argovia, nel distretto di Bremgarten."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BB%E3%82%A4%E3%83%A9%E3%83%A0%E9%AD%94%E5%A5%B3%E8%A3%81%E5%88%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Danvers_victims_memorial%2C_historical_marker.jpg","page_title":"セイラム魔女裁判","context_page_description":"セイラム魔女裁判とは、現在のアメリカ合衆国ニューイングランド地方のマサチューセッツ州セイラム村で1692年3月1日に始まった一連の裁判である。\\n200名近い村人が魔女として告発され、19名が刑死、1名が拷問中に圧死、2人の乳児を含む5名が獄死した。\\nこの事件より前に、17世紀にマサチューセッツ地域とコネチカット地域で12人の女性が処刑されていた。\\n「セイラム」の名を冠しているが、1692年の予備審問はセイラム村、セイラム町、イプスウィッチ、アンドーバーといった複数の町で行われた。最も悪名高い裁判は、1692年にセイラム町でオイヤー・アンド・ターミナー裁判所にて行われた。\\nこの事件は、植民地時代アメリカにおける集団パニックの最も深刻な事例の一つである。孤立主義、宗教過激主義、虚偽の告発、正当なプロセスの遂行が孕む危険性について、鮮明な警鐘を呼び掛ける題材として、政治的文脈や大衆文学に用いられている。ヨーロッパでも発生した近世の魔女裁判という広い範囲に及ぶ現象の植民地アメリカにおける例であり、多くの歴史家は、セイラム魔女裁判はその後の米国の裁判制度に対して非常に強い影響力を及ぼしたと考えている。歴史家のジョージ・リンカーン・バーは、「セイラムの魔法は、神権政治を崩壊させた」と評しており、無実とされる人々が次々と告発されて裁判にかけられたその経緯は、集団心理の暴走の例としても引用されることが多い。\\nセイラム魔女裁判はヨーロッパの魔女裁判と比べて犠牲者数は際立ったものではないが、現代では近世の魔女狩りの中で最も有名な事件であると考えられている。"},{"page_url":"https://es.wikipedia.org/wiki/Albert_Agarunov","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Albert_Aqarunovun_b%C3%BCst%C3%BC.jpg","page_title":"Albert Agarunov","context_page_description":"Albert Agarunovich Agarunov – héroe nacional de Azerbaiyán de origen judío; combatiente de la guerra de Karabaj."},{"page_url":"https://en.wikipedia.org/wiki/PeoplesBank_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Arch_nemesis_2007.jpg","page_title":"PeoplesBank Park","context_page_description":"PeoplesBank Park is a 5,200-seat baseball park in York, Pennsylvania that hosted its first regular season baseball game on June 16, 2007, as the tenants of the facility, the York Revolution, defeated the Newark Bears, 9–6. Located on Codorus Creek, the facility had been in the planning stages since 2003, but local politics and funding temporarily halted the plans. The city of York demolished 20 buildings in the Arch Street neighborhood in June 2006, with construction beginning in September 2006. Due to inclement weather, PeoplesBank Park opened one month later than originally planned. The naming rights were purchased by Sovereign Bank, a banking institution based in nearby Reading, for $2.7 million over ten years. The name was changed to \\"Santander Stadium\\" in October 2013 following the 2009 takeover of Sovereign Bank by Santander Bank. In December 2015, it was announced the park would be known as \\"PeoplesBank Park\\" under a new naming rights deal with locally owned PeoplesBank.\\nPeoplesBank Park was honored as the \\"Ballpark of the Year\\" by the Atlantic League of Professional Baseball following the end of its 2008 regular season."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%99%D0%BE%D1%85%D0%B0%D0%BD_%D0%92%D0%BE%D0%BB%D1%84%D0%B0%D1%80%D1%82_%D0%B2%D0%B0%D0%BD_%D0%91%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D0%BE%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/De_Ru%C3%AFne_van_Brederode.jpg","page_title":"Йохан Волфарт ван Бредероде","context_page_description":"Йохан Волфарт ван Бредероде е суверенен господар на Вианен, фрайхер на Бредероде и господар на Ноорделоос и Алмайде и др. Той е нидерлански държавник и главен командир на войската на Нидерландия по време на Републиката на Съединените провинции.\\nТой произлиза от стария най-знатен през Средновековието нидерландски благороднически род Бредероде, на която е предпоследният представител. Той е син на граф Флорис ван Бредероде, владетел на Клоетинге и съпругата му Теодора ван Хафтен. Той сменя дядо си Валравен IV ван Бредероде като владетел на всички собствености.\\nЙохан Волфарт ван Бредероде започва държавна служба и бързо прави кариера. Той става полковник на Компания ван Бредероде и през 1626 г. е номиниран на генерал-лейтенант. През 1630 г. той е бригада-генерал и губернатор на Хертогенбос. През 1642 г. е генерал на артилерията и става фелдмаршал на Републиката.\\nВан Бредероде не е привърженик на щатхалтера от фамилията Орания-Насау. Той се разбира като републиканец и е приятел с холандския политически вожд Йохан де Вит.\\nЙохан Волфарт ван Бредероде умира на 56 години на 3 септември 1655 г. в Петершем, Лимбург, Белгия, и е погребан във Вианен."},{"page_url":"https://fr.wikipedia.org/wiki/Op%C3%A9ration_Copperhead","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Lt._Clifton_James.jpg","page_title":"Opération Copperhead","context_page_description":"L'opération Copperhead est une opération de diversion menée par les Britanniques durant la Seconde Guerre mondiale.\\nC'est l'une des nombreuses diversions montées par les Alliés et regroupées sous le nom de code d'opération Fortitude pour cacher le lieu réel du débarquement Allié en Normandie.\\nLe colonel Dudley Clarke, spécialiste de ce genre d'opérations, contacte tout d'abord David Niven, qui travaille alors au service cinématographique des armées, pour que celui-ci, en parallèle du tournage d'un film de propagande de Carol Reed, The Way Ahead, forme un acteur dans le but de créer un sosie parfait du Field Marshal Bernard Montgomery. Un acteur australien, M. E. Clifton-James, est engagé pour ce rôle. Croyant d'abord participer à un vrai film, il est formé par Niven et son ordonnance, Peter Ustinov, au rôle de « Monty », qu'il joue déjà devant ses camarades - sa ressemblance physique avec le maréchal étant quasi parfaite. Niven a rencontré à de nombreuses reprises Montgomery, et ses conseils et le visionnage des images de l'armée sur le sujet aident à améliorer le jeu de Clifton-James."},{"page_url":"https://ro.wikipedia.org/wiki/Cronologia_descoperirilor_planetelor_%C8%99i_sateli%C8%9Bilor_naturali_din_sistemul_solar","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/The_Sun_by_the_Atmospheric_Imaging_Assembly_of_NASA%27s_Solar_Dynamics_Observatory_-_20100819.jpg","page_title":"Cronologia descoperirilor planetelor și sateliților naturali din sistemul solar","context_page_description":"Cronologia descoperirilor planetelor și sateliților naturali din sistemul solar arată procesul descoperirii corpurilor noi din sistemul solar de-a lungul timpului. Obiectele sunt listate în ordinea cronologică a descoperirii lor, fiind identificate prin diversele lor denumiri și enumerarea descoperitorilor.\\nIstoric, denumirea sateliților nu corespunde întotdeauna timpului când au fost descoperiți. În mod tradițional, descoperitorul se bucură de privilegiul de a da o denumire noului obiect; cu toate acestea, unii au neglijat să facă acest lucru sau au refuzat în mod deliberat. Problema denumirii a apărut aproape la fel de curând cu descoperirea însăși a sateliților planetari: Galileo s-a referit la cei patru sateliți principali ai lui Jupiter utilizând numerele, în timp ce denumirile sugerate de către rivalul său Simon Marius au devenit treptat unanim acceptate. Uniunea Astronomică Internațională a început, în cele din urmă, clarificarea chestiunii denumirilor la sfârșitul anilor 1970."},{"page_url":"https://pl.wikipedia.org/wiki/Palestyna_pod_panowaniem_Brytyjczyk%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/V01p249001_Rehoboth.jpg","page_title":"Palestyna pod panowaniem Brytyjczyków","context_page_description":"Palestyna pod panowaniem Brytyjczyków znajdowała się w okresie od 1917 do 1948 roku."},{"page_url":"https://es.wikipedia.org/wiki/Open_Source_World_Conference","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/OSWC_2008.jpg","page_title":"Open Source World Conference","context_page_description":"Open Source World Conference, es una conferencia internacional de Software Libre que se lleva realizando en España desde 2004. Es una conferencia orientada principalmente a las empresas que desarrollan y usan software libre."},{"page_url":"https://fr.wikipedia.org/wiki/Beatrice_Vio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Bebe_Vio_2014_IWAS_European_Championships_FFS-IN_t173138_%28cropped%29.jpg","page_title":"Beatrice Vio","context_page_description":"Beatrice Maria Adelaide Marzia Vio, fréquemment appelée Bebe Vio, née le 4 mars 1997 à Venise, est une escrimeuse handisport italienne qui pratique le fleuret, championne paralympique en 2016. Elle remporte le Laureus World Sports Awards \\"Sportif avec un handicap de l'année\\" en 2017."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_du_Sacr%C3%A9-C%C5%93ur-de-J%C3%A9sus_de_Futog","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Sacred_Heart_Catholic_Church_%28west_view%29_in_Futog%2C_Vojvodina%2C_Serbia_-_20060602.jpg","page_title":"Église du Sacré-Cœur-de-Jésus de Futog","context_page_description":"L'église du Sacré-Cœur-de-Jésus de Futog est une église catholique située à Futog, sur le territoire de la Ville de Novi Sad, en Serbie. L'église, dont l'origine remonte au XVIIIᵉ siècle, est inscrite sur la liste des monuments culturels de grande importance de la République de Serbie.\\nLa maison paroissiale, qui date de 1776, est elle aussi classée."},{"page_url":"https://es.wikipedia.org/wiki/Elecci%C3%B3n_presidencial_de_Chile_de_1932","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Marmaduque_Grove.jpg","page_title":"Elección presidencial de Chile de 1932","context_page_description":"La elección presidencial de Chile de 1932 se realizó el 30 de octubre de 1932. Ésta se llevó a cabo por orden del presidente interino, don Abraham Oyanedel Urrutia, quien había asumido el gobierno del país tras la renuncia del coronel Bartolomé Blanche, quien a su vez, había tomado el mando de Chile al derrocar a la República Socialista, una institucionalidad implementada por diversos miembros del socialismo chileno, hacia el 4 de junio de 1932 tras la caída de Montero, que tuvo una efímera existencia.\\nLas elecciones de 1932 fueron convocadas de urgencia para retornar la institucionalidad a Chile, perdida hacia la abdicación de Carlos Ibáñez del Campo, en 1931, que desde entonces no se había podido desempeñar un período presidencial completo y el último presidente elegido democráticamente había sido derrocado a mitad de año por el socialismo.\\nEl ganador fue el liberal Arturo Alessandri Palma, quien regresó a La Moneda tras gobernar entre 1920 y 1925."},{"page_url":"https://en.wikipedia.org/wiki/James_Gibbs","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/StBart.jpg","page_title":"James Gibbs","context_page_description":"James Gibbs was one of Britain's most influential architects. Born in Scotland, he trained as an architect in Rome, and practised mainly in England. He is an important figure whose work spanned the transition between English Baroque architecture and a Georgian architecture heavily influenced by Andrea Palladio. Among his most important works are St Martin-in-the-Fields, the cylindrical, domed Radcliffe Camera at Oxford University, and the Senate House at Cambridge University\\nGibbs very privately was a Roman Catholic and a Tory, because of this and his age had a somewhat removed relation to the Palladian movement which came to dominate English architecture during his career. The Palladians were largely Whigs, led by Lord Burlington and Colen Campbell, a fellow Scot who developed a rivalry with Gibbs. Gibbs' professional Italian training under the Baroque master Carlo Fontana also set him uniquely apart from the Palladian school. However, despite being unfashionable, he gained a number of Tory patrons and clients, and became hugely influential through his published works, which became popular as pattern books for architecture."},{"page_url":"https://ceb.wikipedia.org/wiki/Gaichtspitze","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Krinnenspitze_nach_Osten.JPG","page_title":"Gaichtspitze","context_page_description":"Tumoy sa bukid ang Gaichtspitze sa Ostriya. Nahimutang ni sa distrito sa Politischer Bezirk Reutte ug estado pederal sa Tirol, sa kasadpang bahin sa nasod, 400 km sa kasadpan sa Vienna ang ulohan sa nasod. 1,986 metros ibabaw sa dagat kahaboga ang nahimutangan sa Gaichtspitze, o 274 ka metros sa ibabaw sa naglibot nga tereyn. Mga 2.4 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Gaichtspitze kay kabukiran sa habagatang-kasadpan, apan sa amihang-sidlakan nga kini mao ang kabungtoran. Kinahabogang dapit sa palibot ang Köllenspitze, 2,238 ka metros ni kahaboga ibabaw sa dagat, 3.8 km sa amihanan sa Gaichtspitze. Dunay mga 26 ka tawo kada kilometro kwadrado sa palibot sa Gaichtspitze medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Reutte, 6.1 km sa sidlakan sa Gaichtspitze. Sa rehiyon palibot sa Gaichtspitze, kabukiran, ug mga lasang talagsaon komon.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Gaichtspitze. Ang klima klima sa kontinente. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 15 °C, ug ang kinabugnawan Enero, sa -8 °C. Ang kasarangang pag-ulan 1,698 milimetro matag tuig."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_gares_de_Basse-Normandie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Langrune_gare_3erail.jpg","page_title":"Liste des gares de Basse-Normandie","context_page_description":"La liste des gares de Basse-Normandie, est une liste des gares ferroviaires, haltes ou arrêts, situées en Région Basse-Normandie.\\nEntre parenthèses, l'année d'ouverture et, le cas échéant, de fermeture de la gare. Liste actuellement non exhaustive :"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BA%D0%B8%D0%BD,_%D0%A5%D0%B0%D1%80%D1%83%D0%BD_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D0%B8%D1%81%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/AUT_vs._TUR_2016-03-29_%28303%29.jpg","page_title":"Текин, Харун (футболист)","context_page_description":"Харун Текин — турецкий футболист, вратарь клуба «Фенербахче». Участник чемпионата Европы 2016 года."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%83%83%E3%82%AF%E3%83%BB%E3%82%AD%E3%83%AA%E3%82%AA%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Bad_Boy_Nick_%2820988576545%29.jpg","page_title":"ニック・キリオス","context_page_description":"ニコラス・ヒルミー・\\"ニック\\"・キリオスは、オーストラリア・キャンベラ出身の男子プロテニス選手。2014年ウィンブルドン選手権でラファエル・ナダルを破りベスト8に進出した。これまでにATPツアーでシングルス6勝、ダブルス1勝を挙げている。身長193cm。右利き、バックハンド・ストロークは両手打ち。自己最高ランキングはシングルス13位。ホップマンカップ2016優勝。"},{"page_url":"https://hu.wikipedia.org/wiki/Szeksz%C3%A1rd_Bad_Bones","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/BadBones_2013..jpg","page_title":"Szekszárd Bad Bones","context_page_description":"A Bad Bones Szekszárd városának amerikaifutball-csapata."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%B4%D0%B8%D0%BD%D0%BE,_%D0%90%D1%83%D0%B3%D1%83%D1%81%D1%82%D0%BE_%D0%A1%D0%B5%D1%81%D0%B0%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Stamp_Sandino.jpg","page_title":"Сандино, Аугусто Сесар","context_page_description":"Аугусто Сесар Сандино Кальдерон — никарагуанский революционер, лидер национально-освободительной революционной войны 1927—1934 годов."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%9B%E7%95%AA%E8%A1%97_(%E6%9C%AD%E5%B9%8C%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Chuo_Sapporo_S1W3_01s4s3200.jpg","page_title":"四番街 (札幌市)","context_page_description":"四番街は、札幌市中央区にある商店街。名称は、かつて「西四丁目通」と呼ばれていた通りを、市民に分かりやすく親しみやすいように「街」をつけたことに由来している。"},{"page_url":"https://de.wikipedia.org/wiki/Raissa_Nikolajewna_Kochanowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/%D0%A2%D1%8F%D0%B3%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BF%D0%BE%D0%B4%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%9A%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F.jpg","page_title":"Raissa Nikolajewna Kochanowa","context_page_description":"Raissa Nikolajewna Kochanowa war eine sowjetische Architektin."},{"page_url":"https://simple.wikipedia.org/wiki/Lake_Placid,_Florida","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Lake_Placid_FL_depot_museum08.jpg","page_title":"Lake Placid, Florida","context_page_description":"Lake Placid is a town in Florida, United States. It is in Highlands County."},{"page_url":"https://en.wikipedia.org/wiki/Algirdas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Algirdas_kunigaik%C5%A1tis.jpg","page_title":"Algirdas","context_page_description":"Algirdas was a ruler of medieval Lithuania. He ruled the Lithuanians and Ruthenians from 1345 to 1377. With the help of his brother Kęstutis he created an empire stretching from the present Baltic states to the Black Sea and to within fifty miles of Moscow."},{"page_url":"https://fy.wikipedia.org/wiki/Pyongyang","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Dprk_pyongyang_chuche_monument_05.jpg","page_title":"Pyongyang","context_page_description":"Pyongyang is de haadstêd en de sit fan it regear fan Noard-Koreä. De stêd leit yn it súdwesten fan it lân oan de rivier de Taedong. De stêd hat in lytse 3 miljoen ynwenners. De stêd is it politike-, ekonomyske- en kulturele sintrum fan it lân, mei tal fan teaters, museums en monuminten."},{"page_url":"https://eu.wikipedia.org/wiki/Loira_Atlantikoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/FBBP01_-_FCN_-_20151028_-_Coupe_de_la_Ligue_-_Yacine_Bammou_et_Jimmy_Nirlo.jpg","page_title":"Loira Atlantikoa","context_page_description":"Loira Atlantikoa Frantziako departamendua da, Loirerria eskualdean kokatua, Ozeano Atlantikoaren itsasertzean. Hiriburua Nantes da."},{"page_url":"https://en.wikipedia.org/wiki/BOSS_GP","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Phil_Stratford_Benetton_BOSS_GP.jpg","page_title":"BOSS GP","context_page_description":"The BOSS GP Series is a motor racing series in Europe. The category originated in 1995 as the BOSS Formula series and evolved into the EuroBOSS Series.\\nBOSS is an acronym that stands for Big Open Single Seaters."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D1%81%D0%BA%D1%80%D0%B5%D1%81%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%9D%D0%BE%D0%B2%D0%BE%D0%B4%D0%B5%D0%B2%D0%B8%D1%87%D0%B8%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Voskresensky_Novodevichy_monastery.JPG","page_title":"Воскресенский Новодевичий монастырь","context_page_description":"Воскресéнский Новодéвичий монастырь в Санкт-Петербурге — женский монастырь Санкт-Петербургской епархии Русской православной церкви близ Московской заставы по адресу Московский проспект, дом 100."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Burgwallen-Nieuwe_Zijde","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/RM5457_RM5458_RM5459_Sint_Luciensteeg_5-7-9.jpg","page_title":"Lijst van rijksmonumenten in Burgwallen-Nieuwe Zijde","context_page_description":"Dit is een overzicht van de 837 rijksmonumenten in de Burgwallen-Nieuwe Zijde"},{"page_url":"https://ceb.wikipedia.org/wiki/Ogljen%C5%A1ak","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Ogljen%C5%A1ak.jpg","page_title":"Ogljenšak","context_page_description":"Lungsod ang Ogljenšak sa Esklobeniya. Nahimutang ni sa munisipyo sa Slovenska Bistrica, sa amihanan-sidlakang bahin sa nasod, 90 km sa amihanan-sidlakan sa Ljubljana ang ulohan sa nasod. 323 metros ibabaw sa dagat kahaboga ang nahimutangan sa Ogljenšak, ug adunay 192 ka molupyo.\\nAng yuta palibot sa Ogljenšak kay kabungtoran sa amihang-kasadpan, apan sa habagatang-sidlakan nga kini mao ang patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 615 ka metro ug 1.9 km sa amihanan-kasadpan sa Ogljenšak. Dunay mga 58 ka tawo kada kilometro kwadrado sa palibot sa Ogljenšak medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Maribor, 13.8 km sa amihanan sa Ogljenšak. Hapit nalukop sa kaumahan ang palibot sa Ogljenšak. Sa rehiyon palibot sa Ogljenšak, kabukiran talagsaon komon.\\nAng klima boreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -3 °C. Ang kasarangang pag-ulan 1,489 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 201 milimetro nga ulan, ug ang kinaugahan Marso, sa 65 milimetro."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AD%D8%B1%D8%A8_%D8%A7%D9%84%D9%83%D8%B1%D8%AF%D9%8A%D8%A9_%D8%A7%D9%84%D8%B9%D8%B1%D8%A7%D9%82%D9%8A%D8%A9_%D8%A7%D9%84%D8%AB%D8%A7%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/1975_Algiers_Agreement.jpg","page_title":"الحرب الكردية العراقية الثانية","context_page_description":"الحرب الكردية العراقية الثانية هي هجوم بقيادة القوات العراقية ضد قوات الحزب الديمقراطي الكردستاني مصطفى البارزاني من خلال 1974-1975. وجاءت الحرب في أعقاب الحرب الكردية العراقية الأولى، وخطة السلام عام 1970 من أجل الحكم الذاتي الكردية قد فشلت."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Sites_of_Special_Scientific_Interest_in_Hampshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/River_Avon_-_geograph.org.uk_-_199260.jpg","page_title":"List of Sites of Special Scientific Interest in Hampshire","context_page_description":"In England, Sites of Special Scientific Interest are designated by Natural England, which is responsible for protecting England's natural environment. Designation as an SSSI gives legal protection to the most important wildlife and geological sites.\\nAs of April 2020, there are 118 SSSIs in Hampshire, of which 107 are designated for their biological interest, 5 for their geological interest, and 6 for both interests."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%AC%CE%B2%CE%B1_%CE%BD%CF%84%CE%B5_%CE%9C%CF%80%CE%AD%CF%87%CE%B1%CF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Nava_de_b%C3%A9jar_calle_pocillo.jpg","page_title":"Νάβα ντε Μπέχαρ","context_page_description":"Το Νάβα ντε Μπέχαρ είναι δήμος στην επαρχία της Σαλαμάνκα, στην Καστίλλη και Λεόν στην Ισπανία. Σύμφωνα με την απογραφή του 2004 που έγινε από την INE, ο δήμος έχει 113 κατοίκους."},{"page_url":"https://en.wikipedia.org/wiki/Centauro-class_fiscalization_boat","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/NRP_Centauro_P1155.JPG","page_title":"Centauro-class fiscalization boat","context_page_description":"The Centauro-class fiscalization boat is a class of patrol boats in service with the Portuguese Navy. It is an evolution of the previous Argos-class, which is why it was previously referred to as Argos class - 2nd Series. The main difference from the previous Argos is the naval, corrosion-resistant, aluminium hull.\\nThis class is meant for fisheries fiscalization and control duties mainly in the Mainland Portugal shores – with some sporadic presence in the Madeira Archipelago – up to 50 nautical miles.\\nThe Centauro class is Portuguese-designed and built at the Arsenal do Alfeite and Estaleiros Navais do Mondego.\\nIn 2007, one boat of this class, the NRP Sagitário, became the first Portuguese warship with a female commander, the second lieutenant Gisela Antunes."},{"page_url":"https://it.wikipedia.org/wiki/Marcin_Mo%C5%BCd%C5%BConek","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Marcin_Mo%C5%BCd%C5%BConek_2010-10-30.jpg","page_title":"Marcin Możdżonek","context_page_description":"Marcin Możdżonek è un pallavolista polacco.\\nGioca nel ruolo di centrale nell'Asseco Resovia."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0_%D1%81%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE_%D0%B2%D0%BE_%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0_%D0%90%D0%B7%D0%B8%D1%98%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Pasargadae_2.jpg","page_title":"Список на светско наследство во Западна Азија","context_page_description":"Ова е список на светско наследство под заштита на УНЕСКО во Западна Азија."},{"page_url":"https://nl.wikipedia.org/wiki/Andong_(Zuid-Korea)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Korea-Andong-Hahoe.Village-01.jpg","page_title":"Andong (Zuid-Korea)","context_page_description":"Andong is een stad in Zuid-Korea in de provincie Gyeongsangbuk-do."},{"page_url":"https://fr.wikipedia.org/wiki/Paul_Stevens","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Paul_Stevens_Beverlee_McKinsey_Another_World_1977.JPG","page_title":"Paul Stevens","context_page_description":"Paul Stevens est un acteur américain né le 17 janvier 1921 à Los Angeles, Californie, décédé le 4 juin 1986 à New York."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%8B%A5%E6%9D%BE%E6%B2%B3%E7%94%B0%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Toei-E03-Wakamatsu-kawada-station-platform.jpg","page_title":"若松河田駅","context_page_description":"若松河田駅は、東京都新宿区河田町にある、東京都交通局大江戸線の駅である。駅番号はE 03。"},{"page_url":"https://sv.wikipedia.org/wiki/Nockebybron","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Nockebybron_1920.jpg","page_title":"Nockebybron","context_page_description":"Nockebybron är en svängbro i Mälaren, mellan Kärsön i Ekerö kommun och Nockeby i Bromma, Stockholm."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A9%D1%83%D1%80%D0%BE%D0%B2%D0%BE_(%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Shur3.jpg","page_title":"Щурово (Донецкая область)","context_page_description":"Щу́рово — курортный посёлок в Лиманском районе Донецкой области. Расположен на реке Северский Донец возле Голубых озёр, в 12 км от города Лиман. Ближайшая железнодорожная станция — Брусин."},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%A1pai_Nepomuki_Szent_J%C3%A1nos-szobor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/St_John_of_Nepomuk_P%C3%A1pa.jpg","page_title":"Pápai Nepomuki Szent János-szobor","context_page_description":"A pápai Szent István úton álló rokokó Nepomuki Szent János-szobor 1753-ban készült Esterházy Ferenc gróf megbízásából, alkotója valószínűleg azonos a Szent Flórián-szobor készítőjével. Helye valaha a pápai tó partján volt, ma a Várkert téglakerítésétől közrefogva, az egykori Győri úti vámházzal szemben áll. Az 1990-es évek végén restaurálták.\\nA szoborcsoport kompozíciója eltér a megszokottól, a szent meggyilkolását örökíti meg: a kőhídon álló páncélos katona husánggal sújt le a hídról vízbe forduló Nepomuki Szent Jánosra. A híd tövében puttók ülnek. Az mértéktartó aranyozással díszített szobor magas talapzaton áll, rajta az Esterházy család koronás címerével; ezt négyszögű, rokokó stílusú áttört kőrács keretezi."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D1%81%D1%83%D0%BB%D1%82%D0%B0%D0%BD%D0%B0_%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B3_%D1%86%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Tughra_of_Mustafa_IV.JPG","page_title":"Списак султана Османског царства","context_page_description":"Ово је списак султанa Османског царства. Укупно их је било 36. Абдул Меџид II је био само калиф јер је 1. новембра 1922. Национална скупштина укинула султанат. Осман I и Орхан I су носили титуле бегова, а тек од Мурата I владари носе титулу султана. Од Селима I султани носе и титулу калифе. Сви владари сем Османа I су имали тугре, монограме султана."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B2%90%E9%98%9C%E7%9C%8C%E9%81%93%E3%83%BB%E9%95%B7%E9%87%8E%E7%9C%8C%E9%81%936%E5%8F%B7%E4%B8%AD%E6%B4%A5%E5%B7%9D%E7%94%B0%E7%AB%8B%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Gyokuzo_Bridge.jpg","page_title":"岐阜県道・長野県道6号中津川田立線","context_page_description":"岐阜県道・長野県道6号中津川田立線は、岐阜県中津川市と長野県木曽郡南木曽町田立を結ぶ県道である。"},{"page_url":"https://sco.wikipedia.org/wiki/Bir_el_Qutt_inscriptions","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Georgian_inscription_at_Bir_El-Qutt%2C_430_AD.jpg","page_title":"Bir el Qutt inscriptions","context_page_description":"The Bir el Qutt inscriptions are the Georgie leid Byzantine mosaic inscriptions written in the Georgie Asomtavruli script which war excavatit at a Georgie monastery in 1952 bi an Italian airchaeologist Virgilio Canio Corbo near Bir el Qutt, in the Judaean Desert, 6 km sooth-east o Jerusalem an 2 km north o Bethlehem."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_Nanebevzet%C3%AD_Panny_Marie_(Kyn%C5%A1perk_nad_Oh%C5%99%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Kyn%C5%A1perk_kostel_Nanebevzet%C3%AD_Panny_Marie_%285%29.jpg","page_title":"Kostel Nanebevzetí Panny Marie (Kynšperk nad Ohří)","context_page_description":"Kostel Nanebevzetí Panny Marie je římskokatolický filiální, v minulosti farní kostel v Kynšperku nad Ohří v okrese Sokolov. Od roku 1963 je kostel spolu s farou chráněn jako kulturní památka České republiky. V blízkosti kostela u fary stojí socha Panny Marie Immaculaty, rovněž prohlášená kulturní památkou."},{"page_url":"https://en.wikipedia.org/wiki/Isla_de_Isabel_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Isla_de_Isabel_II_desde_el_cabo_de_Agua.jpg","page_title":"Isla de Isabel II","context_page_description":"The Island of Isabel II is the central island of the Chafarinas Islands archipelago, in the Mediterranean Sea. The island belongs to Spain. It is located only 4 kilometres away from the North-African shore, in front of the Moroccan town of Ras Kebdana. Its area is 0.153 km², and there is a military base and a church."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-Baptiste_de_Lautenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Lautenbach_StMichel-Gangolphe_81.JPG","page_title":"Église Saint-Jean-Baptiste de Lautenbach","context_page_description":"L'église Saint-Jean-Baptiste est un monument historique situé à Lautenbach, dans le département français du Haut-Rhin."},{"page_url":"https://en.wikipedia.org/wiki/St_Mary%27s_Church,_Watford","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Tomb_of_Sir_Charles_Morison_the_elder%2C_Watford_St_Mary.jpg","page_title":"St Mary's Church, Watford","context_page_description":"St Mary's Watford is a Church of England church in Watford, Hertfordshire, in the United Kingdom. It is situated in the town centre on Watford High Street, approximately 25 kilometres outside London. St Mary's is the parish church of Watford and is part of the Anglican Diocese of St Albans. Thought to be at least 800 years old, the church contains burials of a number of local nobility and some noteworthy monumental sculpture of the Elizabethan and Jacobean eras."},{"page_url":"https://vi.wikipedia.org/wiki/Lemna_perpusilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Lemna_perpusilla_NRCS-1.jpg","page_title":"Lemna perpusilla","context_page_description":"Lemna perpusilla là một loài thực vật có hoa trong họ Ráy. Loài này được Torr. mô tả khoa học đầu tiên năm 1843."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B6%E3%83%B3%E3%82%AF%E3%83%88%E3%83%BB%E3%83%95%E3%82%A3%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/0_Saint-Vith_-_Ville_%281%29.jpg","page_title":"ザンクト・フィート","context_page_description":"ザンクト・フィートは、ベルギーのリエージュ州に属する基礎自治体。\\nAlfersteg、Amelscheid、Andler、Atzerath、Breitfeld、Crombach、Eiterbach、Galhausen、Heuem、 Hinderhausen、Hunnange 、Lommersweiler、Neidingen、Neubrück、Neundorf、Niederemmels、Oberemmels、Recht、Rödgen、 Rodt、Schlierbach、Schoenberg 、Setz、Steinebrück、Wallerode、Weppelerの各町から構成されている。\\n公用語はドイツ語で、ドイツ語共同体に属する9つの基礎自治体の1つである。"},{"page_url":"https://fr.wikipedia.org/wiki/Grande_Mosqu%C3%A9e_du_Vendredi_d%27H%C3%A9rat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/2009_Masjid-e_Jami_in_Herat_Afghanistan_4111458265.jpg","page_title":"Grande Mosquée du Vendredi d'Hérat","context_page_description":"La grande mosquée du vendredi appelée mosquée des Rois par Babur est une mosquée édifiée avant le XIᵉ siècle dans la ville d'Hérat en Afghanistan et plusieurs fois détruite et reconstruite.\\nL'esthétique de l'édifice, avec un riche décor de faïences émaillées, et son histoire, en font un élément majeur du patrimoine de l'Afghanistan."},{"page_url":"https://pl.wikipedia.org/wiki/G%C5%82og%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/G%C5%82og%C3%B3w-fortyfikacje-fosa.JPG","page_title":"Głogów","context_page_description":"Głogów – miasto w zachodniej Polsce, w województwie dolnośląskim, położone na Dolnym Śląsku, siedziba powiatu głogowskiego oraz gminy wiejskiej Głogów. Umiejscowione nad rzeką Odrą. Głogów jest szóstym co do wielkości miastem w województwie.\\nMiasto usytuowane jest na obszarze Legnicko-Głogowskiego Okręgu Miedziowego."},{"page_url":"https://sv.wikipedia.org/wiki/Botanisk_ordlista","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Cereus_peruvianus_monstruosus.jpg","page_title":"Botanisk ordlista","context_page_description":"Det här är en lista över ord som är vanligt förekommande inom botaniken. Denna lista ska förklara de vanligaste begreppen som används då växters utseende, förökning, växtplats och växtsätt beskrivs. En del ord förklaras i mer djupgående artiklar, medan andra förklaras i sin helhet här. Om något ord saknas så går det bra att ta upp det på diskussionssidan, eller helt enkelt lägga till det här. Denna artikel är dock under avveckling och planeras bli ersatt med fullständiga artiklar på alla ämnen. Bidra gärna!"},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A1%80%E3%82%92%E6%B5%81%E3%81%99%E3%82%AB%E3%83%B3%E3%82%B6%E3%82%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Bleeding_Kansas_Poster.jpg","page_title":"血を流すカンザス","context_page_description":"血を流すカンザス は、1854年から1861年のアメリカ合衆国カンザス準州および隣接するミズーリ州の町で起こった、政治がからむ一連の暴力的衝突である。対峙したのは自由州からカンザス準州に来た反奴隷制度を掲げる集団と、「ボーダー・ラフィアンズ」と呼ばれる隣接するミズーリ州から入ってきた奴隷制度擁護派の集団だった。この衝突の中心的な原因は、カンザスが自由州としてアメリカ合衆国に加入するか、奴隷州として加入するかという問題だった。この衝突は奴隷制度に関する北部と南部の代理戦争となった。「血を流すカンザス」という言葉は「ニューヨーク・トリビューン」紙のホレス・グリーリーが初めて使ったとされている。この衝突がもたらした結果は直接南北戦争の前兆となった。\\nそれまでのアメリカ合衆国は、奴隷所有者の利益と奴隷制度廃止運動家の抗議との平衡を取るためにもがいていた。血を流すカンザスが起きるきっかけは1854年に定められたカンザス・ネブラスカ法であり、これで1820年のミズーリ妥協を無効にし、住民主権の考え方を取り入れていた。住民主権は見かけ上民主主義的であり、各準州の住人が自由州を選ぶか奴隷州を選ぶかを決められるというものだった。しかし、結果としては両側の活動家が大挙して準州内に移住してくることになった。ある時点では、カンザス準州内に2つの政府ができ、それぞれが独自の憲法を持つことになったが、そのうちの1つだけが連邦政府に認知された。1861年1月29日、カンザスは自由州としてアメリカ合衆国への加入を認められた。それは南北戦争の始まりとなったサムター要塞の戦いが起きる3か月足らず前のことだった。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Turbenthal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Girenbad_Gasthof.JPG","page_title":"Liste der Kulturgüter in Turbenthal","context_page_description":"Die Liste der Kulturgüter in Turbenthal enthält alle Objekte in Turbenthal im Kanton Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://cs.wikipedia.org/wiki/Borovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Cronartium_ribicola_bialowieza_4_beentree.jpg","page_title":"Borovice","context_page_description":"Borovice je rod stálezelených jehličnatých stromů, popřípadě keřů, z čeledi borovicovité. Se zhruba 110 druhy jde o největší rod čeledi. Stejně jako ostatní zástupci čeledi borovicovitých se přirozeně vyskytují výhradně na severní polokouli. Areál rozšíření rodu je velikýː rostou od oblasti severských lesů přes mírný pás a subtropy až do hor tropů, někde vystupují až k horní hranici lesa či nad ní. Pochází pravděpodobně ze Starého světa, maxima druhového bohatství ovšem dosahuje v Severní a Střední Americe, další bohatou oblastí je východní Asie, Indočína a oblast Himálaje. V Evropě se vyskytuje 12–13 původních druhů, z toho 9–10 dvoujehličných a 3 pětijehličné. Vesměs jde o silně světlomilné, konkurenčně slabé stromy s velmi malými nároky na kvalitu půdy, které jsou schopny dobře snášet nejrůznější stanoviště; mnohé plní roli pionýrských dřevin. Některé severoamerické i středomořské druhy jsou velmi dobře adaptovány na lesní požáry, jak dokládají již fosilní nálezy. Mezi borovice patří i nejstarší žijící vyšší organismy na Zemiː některé exempláře borovice dlouhověké jsou prokazatelně staré více než 4 800 let."},{"page_url":"https://en.wikipedia.org/wiki/Samsung_Omnia_W","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Samsung_Omnia_W_Model_no.GT-I8350.jpg","page_title":"Samsung Omnia W","context_page_description":"The Samsung Omnia W is a slate device running Windows Phone operating system 7.5. The phone is manufactured by Samsung. The device features Qualcomm Snapdragon MSM8255 SoC clocked at 1.4 GHz, 3.7-inch Super AMOLED screen with a resolution of 480 x 800 and 8 GB of internal storage."},{"page_url":"https://en.wikipedia.org/wiki/Tourism_in_India_by_state","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Kaziranga_Rhinoceros_unicornis.jpg","page_title":"Tourism in India by state","context_page_description":"Tourism in India is economically very important and is growing rapidly. The World Travel & Tourism Council calculated that tourism generated ₹14.02 lakh crore or 9.6% of the nation's GDP in 2016 and supported 40.343 million jobs, 9.3% of its total employment. The sector is predicted to grow at an annual rate of 6.8% to ₹28.49 lakh crore by 2027. Various states and union territories of India attract tourists due to diversity among them."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%83%E8%91%89%E7%9C%8C%E3%81%AE%E5%B8%82%E7%94%BA%E6%9D%91%E6%97%97%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Flag_of_Ichinomiya_Chiba.JPG","page_title":"千葉県の市町村旗一覧","context_page_description":"千葉県の市町村旗一覧は、千葉県内の市町村に制定されている、あるいは制定されていた市町村旗の一覧である。なお、一覧の順序は全国地方公共団体コード順による。廃止された市町村旗は廃止日から順に掲載している。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D9%86%DA%AF%D9%84%E2%80%8C%D8%B3%D8%A7%D8%B2%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Marebilli_forest.jpg","page_title":"جنگل‌سازی","context_page_description":"جنگل سازی عبارتست از ایجاد جنگل یا بیشه در مناطقی که هیچ نوع پوشش قبلی درخت وجود نداشته‌است.\\nبسیاری از سازمانهای دولتی و غیردولتی به‌طور مستقیم درگیر برنامه‌های جنگل کاری برای ایجاد جنگلها جهت افزایش جذب کربن هستند.\\nبعضی اوقات از ابزارهای ویژه مانند میله کاشت درخت برای آسان‌تر و سریع تر کردن کاشت درختان استفاده می‌شود."},{"page_url":"https://en.wikipedia.org/wiki/Exposition_Internationale_du_Surr%C3%A9alisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/140%2C_Rue_du_Faubourg_St._Honor%C3%A9.jpg","page_title":"Exposition Internationale du Surréalisme","context_page_description":"The Exposition Internationale du Surréalisme was an exhibition by surrealist artists that took place from January 17 to February 24, 1938, in the generously equipped Galérie Beaux-Arts, run by Georges Wildenstein, at 140, Rue du Faubourg Saint-Honoré in Paris. It was organised by the French writer André Breton, the surrealists' brain and theorist, and Paul Éluard, the best known poet of the movement. The catalogue listed, along with the above, Marcel Duchamp as generator and arbitrator, Salvador Dalí and Max Ernst as technical advisers, Man Ray as head lighting technician and Wolfgang Paalen as responsible for the design the entrance and main hall with \\"water and foliage\\". The exhibition was staged in three sections, showing paintings and objects as well as unusually decorated rooms and mannequins which had been redesigned in various ways. With this holistic presentation of surrealist art work the movement wrote exhibition history.\\nBefore their first group exhibition in November 1925, which took place in Pierre Loeb's gallery \\"Pierre\\" in Paris, the surrealist artists had previously shown their works at solo exhibitions."},{"page_url":"https://ro.wikipedia.org/wiki/Filmografia_lui_Charlton_Heston","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Charlton_Heston_Civil_Rights_March_1963.jpg","page_title":"Filmografia lui Charlton Heston","context_page_description":"Aceasta este filmografia actorului Charlton Heston."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%AE%E6%96%AF%E5%9F%BA%E7%8E%AF%E5%BD%A2%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Jansky_crater_AS11-43-6451.jpg","page_title":"央斯基环形山","context_page_description":"央斯基环形山是位于月球正面东侧边沿的一座古老大撞击坑，约形成于39.2-38.5亿年前的酒海纪，其名称取自美国物理学家暨无线电工程师，无线电天文学先驱卡尔·央斯基，1964年被国际天文学联合会批准接受。"},{"page_url":"https://en.wikipedia.org/wiki/Anselmo_Fernandez","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Est%C3%A1dio_Jos%C3%A9_Alvalade_-_Antigo_-_01.jpg","page_title":"Anselmo Fernandez","context_page_description":"Anselmo Fernandez Rodrigues was a Portuguese architect and football manager who led Sporting Clube de Portugal to victory in the UEFA Cup Winners' Cup in 1964.\\nAnselmo Fernandez, of Spanish extraction, initially hoped for a career as football player with Lisbon's Sporting Clube de Portugal, however his health did not allow for it. He later engaged with Rugby at the club and emerged as a well regarded referee in that sport.\\nHis career focus then switched to architecture. His first major work was the original Estádio José Alvalade, which he built in conjunction with António Augusto Sá da Costa. The 61,000 capacity stadium of SCP opened in 1956. He was a major collaborator in many works of the architects Porfírio Pardal Monteiro and António Pardal Monteiro being involved with construction of the Lisbon hotel Tivoli, National Library of Portugal, the directorate of Lisbon University and the Faculty of Law. The Reitoria da Universidade, the university directorate was awarded with a Prémio Valmor, a major architectural prize.\\nIn 1962 he had a first brief stint as coach of Sporting's football team. His second stint at the helm of Sporting ended spectacular."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A0%97%E5%B1%B1%E5%88%A9%E7%AB%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Kuriyama_Toshiaki.jpg","page_title":"栗山利章","context_page_description":"栗山 利章は、安土桃山時代から江戸時代前期にかけての福岡藩士。一般には通称の栗山大膳の名で知られている。"},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AF%E0%A4%82%E0%A4%97%E0%A5%8D%E0%A4%B8_%E0%A4%A1%E0%A4%AC%E0%A4%B2_%E0%A4%B8%E0%A5%8D%E0%A4%B2%E0%A4%BF%E0%A4%9F_%E0%A4%AA%E0%A4%B0%E0%A5%80%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A4%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Single_slit_and_double_slit2.jpg","page_title":"यंग्स डबल स्लिट परीक्षण","context_page_description":"यंग्स डबल स्लिट परीक्षण, आधूनिक डबल स्लिट परीक्षण का मूल रूप है। यह प्रयोग थोमस यंग के द्वारा १९ वीं शताब्दी मे प्रदर्शित किया गया था। इस प्रयोग ने प्रकाश की तरंग सिद्धांत की स्वीकृति में एक प्रमुख भूमिका निभाई है। खुद थोमस यंग का कहना था कि यह उनकी सभी उपलब्धियों मे से अत्यंत महत्वपूर्ण सिद्धि है।"},{"page_url":"https://pt.wikipedia.org/wiki/Samseong-dong","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Samseongdong.png","page_title":"Samseong-dong","context_page_description":"Samseong-dong é um bairro afluente de Gangnam-gu em Seul, Coreia do Sul."},{"page_url":"https://en.wikipedia.org/wiki/Bell_Centennial","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/BellCenInk.svg","page_title":"Bell Centennial","context_page_description":"Bell Centennial is a sans-serif typeface in the industrial or grotesque style designed by Matthew Carter in the period 1975–78. The typeface was commissioned by AT&T as a proprietary type to replace their then current directory typeface Bell Gothic on the occasion of AT&T’s one hundredth anniversary. Carter was working for the Mergenthaler Linotype Company which now licenses the face for general public use."},{"page_url":"https://la.wikipedia.org/wiki/Berceria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/BerkshireBrit5.PNG","page_title":"Berceria","context_page_description":"Comitatus Berceriensis seu Berceria est comitatus Angliae. Oppida comitatus geographici et historici Berceriae potiora sunt Bracknell, Hungerford, Lambourn, Maidenhead, Neubiria, Radinga, Windesoria et Vetus Windesoria, Wokingham. Inter oppida et vici modestiora sunt Aldermaston, Ascot, Basildon, Bray, Catmore, Cookham, Crowthorne, East Garston, East et West Hendred, East et West Ilsley, Finchampstead, Kintbury, Marsh Benham, Pangbourne, Sandhurst, Sonning, Spinae, Stradleia, Sunningdale, Thatcham, Tilehurst, Twyford, Wargrave, Wickham, Wideneia, Yattendon. Locus huius comitatús excelsissimus est Walbury Hill.\\nOppida nonnulla comitatus geographici et historici Berceriae anno 1974 in comitatu sollemni Oxoniensi transposita sunt: potiora Abingdon, Didcot, Faringdon, Shrivenham, Wallingford, Wantage; minora Baulking, Hinton Waldrist, Kingston Lisle, Radelea, Shellingford, Stanford in the Vale, Uffington. Montes qui olim Anglosaxonice Æscesdun appellabantur, hodie Berkshire Downs, olim intra limites Berceriae comprehensi, hodie ex maiore parte in comitatu Oxoniensi iacent."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E4%B8%AD%E5%B8%82%E5%B0%9A%E6%9C%AA%E5%88%97%E5%85%A5%E4%BF%9D%E8%AD%B7%E7%9A%84%E6%96%87%E5%8C%96%E8%B3%87%E7%94%A2%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/%E4%B8%89%E4%BF%A1%E5%95%86%E9%8A%80.JPG","page_title":"臺中市尚未列入保護的文化資產列表","context_page_description":"臺中市尚未列入保護的文化資產列表，是羅列統計臺中市境內尚未依《文化資產保存法》列入保護的文化資產潛力點。尚待文化部文化資產局或臺中市文化資產處邀請專家學者、相關單位再行履勘，評估相關文化資產價值後，依文化資產保存法相關規定辦理。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D8%BA%E2%80%8C%D9%88%D8%AD%D8%B4_%D8%AA%D9%81%D9%84%DB%8C%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Tbilisi_Zoo_%282%29.jpg","page_title":"باغ‌وحش تفلیس","context_page_description":"باغ‌وحش تفلیس بزرگترین و قدیمی‌ترین باغ‌وحش در کشور گرجستان است که در شهر تفلیس قرار دارد.\\nاین باغ‌وحش که در سال ۱۹۲۷ تاسیس شده دارای ۱۲۰ هکتار وسعت و ۳۰۰ گونه جانوری است. سیل ۲۰۱۵ تفلیس خسارات زیادی به این باغ‌وحش وارد کرد."},{"page_url":"https://hu.wikipedia.org/wiki/Tastrup","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/St._Johanniskirche_Flensburg-Adelby.JPG","page_title":"Tastrup","context_page_description":"Tastrup település Németországban, Schleswig-Holstein tartományban. Lakosainak száma 417 fő. +/- Tastrup Hürup és Freienwill községekkel határos."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%83%B3%E3%83%89%E3%83%AB%E3%83%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Bendorf_in_MYK.png","page_title":"ベンドルフ","context_page_description":"ベンドルフは、ドイツ連邦共和国南西部のラインラント＝プファルツ州マイエン＝コブレンツ郡に存在する市。ライン川右岸沿い、コブレンツの北7kmに位置する。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%86%D8%B1%D9%8A_%D8%AA_%D9%8A%D9%83%D9%87%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Henry_T_Wickham.jpg","page_title":"هنري ت يكهام","context_page_description":"هنري ت يكهام ‏ هو سياسي من الولايات المتحدة الأمريكية.\\nوهو عضو في الحزب الديمقراطي الأمريكي."},{"page_url":"https://es.wikipedia.org/wiki/Madison_Grant","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Passing_of_the_Great_Race_-_Map_3.jpg","page_title":"Madison Grant","context_page_description":"Madison Grant fue un abogado estadounidense, conocido sobre todo por su trabajo como eugenesista y conservacionista. Como eugenesista, fue autor de uno de los más famosos trabajos del racismo científico y jugó un papel activo en el establecimiento de fuertes políticas restrictivas con la inmigración y el mestizaje en los Estados Unidos. Como conservacionista, le debemos la salvación de varias especies animales, la fundación de muchas organizaciones ambientales y filantrópicas, así como, en gran parte, el desarrollo como disciplina de la gestión de la vida salvaje."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%95%BF%E6%B1%9F%E6%A1%A5%E9%9A%A7%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Jiajiang_Bridge.JPG","page_title":"长江桥隧列表","context_page_description":"長江是亞洲第一長河，全長6,380多公里，其中從格拉丹冬源頭至當曲河口稱為沱沱河，長約358公里；從當曲河口至青海玉樹巴塘河口稱為通天河，長約813公里；從巴塘河口至四川宜賓岷江口，稱為金沙江，長2,308公里；岷江口至入海口，稱為長江，長約2,884公里。\\n長江幾乎是自西向東平分了整個中國本土，因此，每一條貫通南北的主要公路或鐵路通道，都必須跨越長江。時至今日，這些跨越長江的橋樑和隧道，已成為中國公路網和鐵路網中的重要組成部分。在岷江口以下的長江幹流上，於1957年建成了第一座大橋：武漢長江大橋；此後，長江上陸續建成了超過80座橋樑及6條隧道，而其中絕大多數是在1990年之後建成通車的。這些橋樑應用了種類繁多的設計，其中許多都代表著現代橋樑工程的卓越成就，躋身世界最長懸索橋、斜拉橋、拱橋及最高橋樑的行列。\\n目前，自石鼓鎮長江第一灣至出海口，長江幹流已建成和在建的橋樑合計超過150座，並且仍在持續快速增長中。數量因統計方法不同而多有出入，自源頭起算更無以計數。由於岷江口以上的長江幹流不稱長江，故這部分橋樑名稱中也沒有「長江」二字，名稱中不含任何江河名稱的橋樑也極為常見。\\n而隧道方面，至2018年10月1日已有10條長江隧道建成並投入使用，即武漢長江隧道、南京長江隧道、南京揚子江隧道、上海長江隧道、武漢地鐵2號線過江隧道、南京地鐵10號線過江隧道、武漢地鐵4號線過江隧道、南京地鐵3號線過江隧道、武漢地鐵8號線過江隧道和武漢長江公鐵隧道。"},{"page_url":"https://tg.wikipedia.org/wiki/%D0%9B-159","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/6067_II_%285661740813%29.jpg","page_title":"Л-159","context_page_description":"Л-159 Як ҳавопаймои ҷангии аст ки солҳои 1990-ум аз тарафи Чехия дар Аеро Водоходи сохта шудааст."},{"page_url":"https://gl.wikipedia.org/wiki/Orcaella_brevirostris","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Irrawaddy_Dolphin.jpg","page_title":"Orcaella brevirostris","context_page_description":"Orcaella brevirsotris é unha especie xénero de cetáceo odontoceto da familia dos delfínidos, coñecida na bibliografía internacional como golfiño do río Irrawaddy ou golfiño beluga, que durante moito tempo foi considerada como monotípica, pero en 2005, a análise xenética demostrou que existe unha segunda especie, Orcaella heinsohni estreitamente ligada e ela.\\nTrátase dun golfiño que habita nas costas e estuarios do sueste asiático."},{"page_url":"https://fr.wikipedia.org/wiki/Pouan-les-Vall%C3%A9es","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Tr%C3%A9sor_de_Pouan.jpg","page_title":"Pouan-les-Vallées","context_page_description":"Pouan-les-Vallées est une commune française, située dans le département de l'Aube en région Grand Est."},{"page_url":"https://de.wikipedia.org/wiki/Albedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Iapetus_as_seen_by_the_Cassini_probe_-_20071008.jpg","page_title":"Albedo","context_page_description":"Die Albedo ist ein Maß für das Rückstrahlvermögen von diffus reflektierenden, also nicht selbst leuchtenden Oberflächen. Sie wird als dimensionslose Zahl angegeben und entspricht dem Verhältnis von rückgestrahltem zu einfallendem Licht. Die Albedo hängt bei einer gegebenen Oberfläche von der Wellenlänge des einstrahlenden Lichtes ab und kann für Wellenlängenbereiche – z. B. das Sonnenspektrum oder das sichtbare Licht – angegeben werden. Vor allem in der Meteorologie ist sie von Bedeutung, da sie Aussagen darüber ermöglicht, wie stark sich eine Oberfläche erwärmt – und damit auch die Luft in Kontakt mit der Oberfläche.\\nIn der Klimatologie ist die so genannte Eis-Albedo-Rückkopplung ein wesentlicher, den Strahlungsantrieb und damit die Strahlungsbilanz der Erde beeinflussender Faktor, der relevant für den Erhalt des Weltklimas ist.\\nIn der 3D-Computergrafik findet die Albedo ebenfalls Verwendung; dort dient sie als Maß für die diffuse Streukraft verschiedener Materialien für Simulationen der Volumenstreuung.\\nIn der Astronomie spielt die Albedo eine wichtige Rolle, da sie mit grundlegenden Parametern von Himmelskörpern zusammenhängt."},{"page_url":"https://fi.wikipedia.org/wiki/Vuosaaren_peruskoulu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Vuosaaren_peruskoulu3.jpg","page_title":"Vuosaaren peruskoulu","context_page_description":"Vuosaaren peruskoulu oli peruskoulu Helsingin Vuosaaressa. Vuosaaren peruskouluun kuului Koukkusaarentien ja Venemestarintien toimipisteet. Koulun rehtorina toimi Janne Kettunen. Ensimmäinen päivä elokuuta 2017 Vuosaaren peruskoulu ja Heteniityn ala-aste yhdistyivät Vuoniityn peruskouluksi."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B8%E0%B0%BF%E0%B0%95%E0%B1%8D%E0%B0%95%E0%B1%81_%E0%B0%AE%E0%B0%A4%E0%B0%AE%E0%B1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/GuruNanakFresco-Goindwal.jpg","page_title":"సిక్కు మతము","context_page_description":"సిక్కు మతము, గురునానక్ ప్రబోధనల ఆధారంగా యేర్పడిన మతము. ఏకేశ్వరోపాసన వీరి అభిమతము. సిక్కు మతములో దేవుని పేరు \\"వాహే గురు\\". వీరి పవిత్ర గ్రంథము గురుగ్రంథ సాహిబ్ లేదా ఆది గ్రంథము లేదా ఆది గ్రంథ్. వీరి పవిత్ర క్షేత్రము అమృత్ సర్ లోని స్వర్ణ మందిరము. ఈ మతాన్ని అవలంబించేవారిని సిక్కులు అని సంబోధిస్తారు. వీరు ప్రధానంగా పంజాబు లలో నివసిస్తుంటారు., ప్రపంచమంతటా వ్యాపించియున్న సమూహం."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AC%D8%B2%D9%8A%D8%B1%D8%A9_%D8%A7%D9%84%D9%85%D9%86%D8%A8%D8%B3%D8%B7%D8%A9_(%D9%88%D9%87%D8%B1%D8%A7%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Ile_paloma.jpg","page_title":"الجزيرة المنبسطة (وهران)","context_page_description":"الجزيرة المنبسطة ‏ أو جزيرة الحمامة ‏ هي جزيرة جزائرية تبلغ مساحتها 4 هكتارات، تحيط بها إحدى عشر صخرة بحرية. تقع على بعد 25 كم شمال غرب وهران وحوالي 7 كم من شاطئ بوسفر بدائرة عين الترك، يسكنها النورس أصفر الساق، هي واحدة من أجمل الوجهات للقوارب في المنطقة وقاع البحر بها جميل جدا. للجزيرة رصيف صغير للقوارب الصغيرة وكذلك منارة صغيرة في الأعلى مهجورة في الخدمة.\\nإن وجود أنواع حيوانية ونباتية متوطنة في المنطقة جعلها مركز تنوع بيولوجي يبرر حتمية تصنيفها، فالجزيرة المنبسطة هي الأولى التي تم تصنيفها منطقة بحرية محمية من قبل لجنة محلية على المستوى الوطني في الجزائر بعد دراسة تصنيفية مقدمة من جمعية البيئة البحرية \\"بربروسا\\"."},{"page_url":"https://ar.wikipedia.org/wiki/NGC_4518","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/NGC4518_-_SDSS_DR14.jpg","page_title":"NGC 4518","context_page_description":"NGC 4518 في الفهرس العام الجديد، هي مجرة، تقع في كوكبة العذراء. اكتشفت في 27 ديسمبر 1827 بواسطة جون هيرشل."},{"page_url":"https://es.wikipedia.org/wiki/Cultura_de_Paraguay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Chipa_so%27o.jpg","page_title":"Cultura de Paraguay","context_page_description":"La cultura de Paraguay se remonta al matrimonio extenso de los hombres criollos y las mujeres guaraníes. La cultura paraguaya es una fusión de dos culturas y tradiciones, que son la europea y la guaraní del centro de Sudamérica. Se estima que el 63% de los paraguayos son mestizos y el grupo restante se reparte en criollos, sin embargo, Paraguay es uno de los países más homogéneos en términos culturales. Una característica de esta fusión cultural es el bilingüismo extensivo hasta nuestros días, pues alrededor del 85% de los paraguayos hablan el castellano y el guaraní.​ El yopará, mezcla de castellano con guaraní, también se habla extensamente.​\\nEsta fusión cultural está expresada en las artes como el bordado y el encaje. El patrimonio culinario de Paraguay está profundamente influenciado por esta fusión cultural, con varios platos populares que tienen a la mandioca como ingrediente base, un cultivo de origen prehispánico consumido en gran parte de Sudamérica, como también otros ingredientes indígenas, entre ellos, el maíz, del cual se elabora una guarnición popular conocida como sopa paraguaya."},{"page_url":"https://fr.wikipedia.org/wiki/Course_en_ligne_de_l%27Open_de_Su%C3%A8de_V%C3%A5rg%C3%A5rda_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Vargarda_short_circuit_1.png","page_title":"Course en ligne de l'Open de Suède Vårgårda 2011","context_page_description":"La 6ᵉ édition de la course en ligne de l'Open de Suède Vårgårda a eu lieu le 31 juillet 2011. Il s'agit de l'avant-dernière manche de la Coupe du monde de cyclisme sur route féminine."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%8A%AC%E9%A0%9C%E7%8D%B8%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Wegener_fossils-mapped.png","page_title":"犬頜獸屬","context_page_description":"犬頜獸屬是種三疊紀中期的肉食性犬齒獸類，身長約1公尺長。犬頜獸屬於真犬齒獸類，真犬齒獸類是最類似哺乳類的一群似哺乳爬行動物。犬頜獸屬幾乎分布於非洲、南美洲、南極洲發現化石。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B5%D9%81%D9%88%D9%81_%D8%A7%D9%84%D9%83%D9%8A%D9%84%D9%88%D9%85%D8%AA%D8%B1_%D8%A7%D9%84%D9%85%D8%B1%D8%A8%D8%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/SKA_Offset_Gregorian_dishes.jpg","page_title":"مصفوف الكيلومتر المربع","context_page_description":"مصفوف الكيلومتر المربع في الفلك هو مشروع تلسكوب كبير جدا تبلغ مساحته الكلية كيلومتر مربع، لقياس الأشعة الكهرومغناطيسية الآتية من أعماق السماء، بغرض زيادة معرفتنا عن نشأة الكون وعن المادة المظلمة والطاقة المظلمة.\\nسيكون استقبال التلسكوب أو التلسكوبات، حيث يتكون من مجاميع كبيرة من الهوائيات مختلفة الأحجام،سيكون في نطاقات محتلفة لتردد الموجات الكهرومغناطيسية.وسيعمل كبره على تقوية الاستقبال بنحو 50 مرة بالمقارنة بتسكوبات أخرى ترصد الأشعة الراديوية. ستعمل على تقييم البيانات حواسيب ذات قدرة فائقة متصلة بين بعضها البعض في شبكات كبيرة، تبلغ في مجموعها قدرة تخزين حميع الاتصالات المدنية التي تجري الآن في أوروبا بأكملها.\\nسيعمل هذا التلسكوب على مسح السماء أسرع 10.000 مرة عن إمكانياتنا حتى الآن. وسيكون توزيع مجاميع الهوائيات عبر مسافات تصل إلى 3000 كيلومتر من مركز جماعي لها. بذلك يتدعم تباين \\"الصور\\" التي يحصل عليها العلماء. من المخطط له أن ينشأ مصفوف الكيلومتر المربع في نصف الكرة الأرضية الجنوبي، ربما يكون في جنوب أفريقيا أو أستراليا ونيوزيلاند حيث من هناك تكون أحسن رؤية نحو مركز المجرة، وفي نفس الوقت تضمن أقل شوشرة قد تنتج عن الاتصالات اليومية الاسلكية المنشرة بيننا، فمعظمنا قد أصبح لديه محمولا للتواصل التليفوني، بالإضافة إلى كثرة الإذاعات ووسائل الإعلام الإلكترونية."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Salt_Lake_County,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Pugh_House_Millcreek_Utah.jpeg","page_title":"National Register of Historic Places listings in Salt Lake County, Utah","context_page_description":"This is a list of the National Register of Historic Places listings in Salt Lake County, Utah, except those in Salt Lake City. Listings for Salt Lake City can be found here.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Salt Lake County, Utah, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are more than 350 properties and districts listed on the National Register in the county, including 6 National Historic Landmarks. More than 200 of these sites, including 4 National Historic Landmarks, are located in Salt Lake City, and are listed separately; the 136 sites outside the city, including 2 National Historic Landmarks, are listed here. Six other sites in the county outside of Salt Lake City were once listed on the Register, but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted June 26, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Rinca","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Crab-eating_macaque_at_Rinca.JPG","page_title":"Rinca","context_page_description":"Rinca, also known as Rincah, Rindja, and Rintja, is a small island near Komodo and Flores island, East Nusa Tenggara, Indonesia, within the West Manggarai Regency. It is one of the three largest islands included in Komodo National Park. The island is famous for Komodo dragons, giant lizards that can measure up to 3 metres long. Rinca is also populated with many other species such as wild pigs, buffalos and many birds."},{"page_url":"https://ast.wikipedia.org/wiki/Eupatorium_chinense","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Eupatorium_chinense_var._sachalinense_05.jpg","page_title":"Eupatorium chinense","context_page_description":"Eupatorium chinense ye una planta yerbácea de la familia Asteraceae.\\nLa clasificación esacta d'esta especie definiéronse de manera distinta por distintos autores. King y Robinson en 1987 definir llargamente pa incluyila en Eupatorium japonicum, Eupatorium makinoi, delles variedaes de Eupatorium fortunei, y otres plantes dacuando consideraes como especies separaes."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_commemorative_coins_and_medals_(1970s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/1976-S_50C_Clad_Deep_Cameo_%28rev%29.jpg","page_title":"List of United States commemorative coins and medals (1970s)","context_page_description":null},{"page_url":"https://sv.wikipedia.org/wiki/Ipod_Shuffle","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Ipod-shuffle-usb-connector.jpg","page_title":"Ipod Shuffle","context_page_description":"Ipod Shuffle, i marknadsföringssyfte skrivet iPod Shuffle, är en bärbar mediaspelare i Ipod-produktserien från Apple. Den presenterades på Macworld Conference & Expo den 11 januari 2005 med slogan Life is random. Istället för att lagra informationen på en hårddisk använder sig Ipod Shuffle som första Ipod av flashminne. Den första generationen Ipod Shuffle väger 22 gram och finns i två modeller, med 512 megabyte respektive en gigabyte lagringsutrymme. I början av 2007 lanserades musikspelaren i en andra generation, som väger 15 gram och har en gigabyte minne. Den 11 mars 2009 lanserades en tredje generation, som är ännu mindre och har fyra gigabytes minne."},{"page_url":"https://en.wikipedia.org/wiki/Pic_de_Peguera","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/PIC_DE_PEGUERA_-_CABDELLA_-_IB-724.JPG","page_title":"Pic de Peguera","context_page_description":"Pic de Peguera is a mountain of Catalonia, Spain. Located in the Pyrenees, it has an elevation of 2,980 metres above sea level."},{"page_url":"https://de.wikipedia.org/wiki/Gegenbl%C3%A4ttriges_Milzkraut","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Chrysosplenium_240405.jpg","page_title":"Gegenblättriges Milzkraut","context_page_description":"Das Gegenblättrige Milzkraut ist eine Pflanzenart aus der Familie der Steinbrechgewächse."},{"page_url":"https://fi.wikipedia.org/wiki/Dominique_Kouas","image_url":"https://upload.wikimedia.org/wikipedia/fi/5/54/Dominique_Kouas_Unohduksen_puu_1993_Ouidah.JPG","page_title":"Dominique Kouas","context_page_description":"Dominique Kouas on beniniläinen vodoun-taiteilija. Hänen työnsä ovat saaneet vaikutteita perinteisiltä anonyymeiltä afrikkalaisilta taiteilijoilta aikaisempien vuosisatojen takaa.\\nHänet tunnetaan suurista metalliveistoksistaan, joita on esillä muun muassa Ouidahissa, Beninissä. Hänen ateljeensa on Porto-Novossa. Eräs hänen huomattavia teoksiaan on kolmipäinen, kolmijalkainen ja kolmikätinen veistos Mami Wata. Eräs kuvaa useita kasvoja, joilla on Fonien ja jorubojen arpeuttamismerkkejä, jotka osoittavat heidän kuulumistaan etniseen ryhmään.\\n1960-luvun lopulla Kouas toimii ranskalaisen ja salvadorilaisen valokuvaajan Pierre Vergerin tiedottajana ja avustajana. Kun Verger tuli Beniniin etsimään historiallisia kohteita Ouémé -joen laaksosta, Kouas innostui vanhoista esineistä. Tämän jälkeen taiteilija alkoi tehdä lukuisia perinteisiä puisia veistoksia.\\nDominique Kouasin taiteessa keskeinen osa on Beninin vodoun-uskonnolla ja hänen teoksissaan on myös useita muita uskonnollisia symboleja ja hengellisiä yhteyksiä. Hän on osa ensimmäistä Beninin itsenäisyyden jälkeistä sukupolvea."},{"page_url":"https://pt.wikipedia.org/wiki/Elek_Schwartz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/RC_Strasbourg_-_Finale_de_Coupe_de_France_1937.png","page_title":"Elek Schwartz","context_page_description":"Alexandru \\"Elek\\" Schwartz foi um futebolista e treinador romeno-francês, judeu nascido em Banat. Com o SL Benfica, seu clube de maior sucesso, ele ganhou os troféus do Campeonato e da Copa de 1965 e liderou o clube a final da Liga dos Campeões."},{"page_url":"https://no.wikipedia.org/wiki/Jay_Robert_Thomson","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Jay_Thomson_2016.jpg","page_title":"Jay Robert Thomson","context_page_description":"Jay Robert Thomson er en sørafrikansk landeveisyklist. Han sykler for det profesjonelle kontinentallaget MTN Qhubeka. Han har vært profesjonell syklist siden 2012, da for Unitedhealthcare."},{"page_url":"https://sv.wikipedia.org/wiki/N%C3%A4s_kyrka,_V%C3%A4sterg%C3%B6tland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/N%C3%A4s_kyrka_V%C3%A4sterg%C3%B6tland_Sweden_2.jpg","page_title":"Näs kyrka, Västergötland","context_page_description":"Näs kyrka är en kyrkobyggnad som sedan 2002 tillhör Yllestads församling i Skara stift. Den ligger i den sydöstra delen av Falköpings kommun."},{"page_url":"https://an.wikipedia.org/wiki/Radio_(medio_de_comunicaci%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Antenaderadio.jpg","page_title":"Radio (medio de comunicación)","context_page_description":"A radio ye a transmisión de sinyals a traviés d'a modulación d'ondas electromagneticas con freqüencias por debaixo d'a luz visible. A radiación electromagnetica viacha por medio de campos electromagneticos oscilatorios que trescruzan l'aire y o espacio vueito. Ta transportar a información, se fan cambiar bellas propiedatz d'as ondas radiatas, como l'amplitut, a freqüencia u a fase a consonant con o sinyal a transmitir. Quan as ondas de radio pasan por un conductor eletrico, os campos oscilatorios inducen una corrient alterna en o conductor. Ixa corrient conserva a modulación d'a onda radiata y por ixo, a información que carreya se puet desmodular y transformar en sonito u en atros sinyals que portían información."},{"page_url":"https://he.wikipedia.org/wiki/%D7%96%D7%A8%D7%99%D7%A2%D7%AA_%D7%A2%D7%A0%D7%A0%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/4X-CBV_Micha_Sender_14-12-2007.jpg","page_title":"זריעת עננים","context_page_description":"זריעת עננים היא שיטה מלאכותית להגברת ירידת גשמים והיא חלק מפעולות שינוי מזג אוויר. הדבר נעשה על ידי פיזור באמצעות תנורים או מטוסי ריסוס של החומרים יודיד הכסף הגורם לזירוז תהליך הקיפאון או אירוסולים המזרזים את יצירת טיפות המים."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D1%80%D1%83%D1%88%D1%82%D0%B2%D0%B5%D0%BD%D0%BE_%D1%80%D0%B0%D1%81%D0%BB%D0%BE%D1%98%D0%B0%D0%B2%D0%B0%D1%9A%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Pyramid_of_Capitalist_System.jpg","page_title":"Друштвено раслојавање","context_page_description":"У социолошком проучавању друштвене структуре вертикално раслојавање представља посебно значајан проблем, јер нема друштвена које би у том погледу било хомогено. У сваком друштву постоје неједнакости друштвених положаја:\\nпрема имовном стању- између богатих и соримашних\\nпрема друштвеној моћи- између оних који владају другима и оних којима други владају\\nпре угледу - неједнакости се изражавају у различитој оцени значаја и престижа оних који обављају различите послове Ове чињеницу су промишљали први социјални мислиоци. Оне су заокупљале пажњу свих социјалних утописта и идеолога грађанских и социјалистичких револуција, које су прокламовале начело друштвене једнакости. У савременој социологији још увек се воде расрпаве о узроцима, типовима и последицама друштвених неједнакости. Ако се искључи као превазиђена социјалдарвинистичка теорија о природним коренима друштвених неједнакости, остаје као општеприхваћено становиште да друштвене подела рада условљава класно-слојне разлике у друштву. Расправе се, међутим, воде око темељине категорије социолошке теорије стратификације и питања да ли је примарни основ друштвених неједнакости неједнака расподела својине или моћи."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_Sienas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Piramide_montaperti.jpg","page_title":"Geschichte Sienas","context_page_description":"Die Geschichte Sienas beginnt mit den Etruskern, von denen die Stadt wahrscheinlich gegründet und Saena genannt wurde. Einige Gräber jenes Zeitalters sind außerhalb der Porta Camollia gefunden worden. Siena wurde, nachdem es unter römische Herrschaft gefallen war, in der Regierungszeit des Augustus oder etwas früher eine römische Colonia. Die Stadt trug zu dieser Zeit den Namen Saena Iulia und dasselbe Wappen wie Rom: die Wölfin und die Zwillinge. Aber ihre eigentliche Bedeutung erlangte die Stadt im Mittelalter. Wenige Zeugnisse aus der römischen Epoche oder aus den ersten Jahrhunderten des Christentums sind erhalten, und überhaupt keine aus dem Zeitraum, der der langobardischen Periode vorausging."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%DA%A9%D9%87_%D9%BE%D9%87%D9%84%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/10000th_reign_of_Mohammad_Reza_Pahlavi_gold_medal.jpg","page_title":"سکه پهلوی","context_page_description":"سکّهٔ پهلوی به سکه‌های طلای رسمی ایران از سال ۱۳۰۵ تا سال ۱۳۵۷ خورشیدی اطلاق می‌گردد و عبارت «پهلوی» واحد پول این سکه‌ها بوده‌است. این سکه‌ها با روی کار آمدن رضاشاه پهلوی در سال ۱۳۰۴ خورشیدی و تغییر نظام پولی کشور در سال ۱۳۰۵ جایگزین سکه‌های طلای قاجار با واحد تومان گردیدند. پس از وقوع انقلاب ۱۳۵۷ خورشیدی در ایران، سکه بهار آزادی جایگزین سکه پهلوی شد."},{"page_url":"https://it.wikipedia.org/wiki/Torre_Lanfreducci","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Torre_Lanfreducci_01.JPG","page_title":"Torre Lanfreducci","context_page_description":"La Torre dei Lanfreducci è una delle antiche torri medievali meglio conservate di Pisa, situata nel cortile interno del Palazzo alla Giornata sul Lungarno Pacinotti."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9A%D0%B8%D1%80%D0%B8%D0%B5%D0%BD%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Sergei_Kirienko_-_World_Economic_Forum_Annual_Meeting_Davos_2000_%28cropped%29.jpg","page_title":"Сергей Кириенко","context_page_description":"Сергей Кириенко."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9A%E0%A6%BE%E0%A6%A8_%E0%A6%95%E0%A6%BE%E0%A6%95_%E0%A6%A6%E0%A7%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Ceinture_orange.png","page_title":"চান কাক দো","context_page_description":"চান কাক দো একটি কোরিয়ান-ভিত্তিক, আমেরিকান সংকর মার্শাল আর্ট। ১৯৯০ সালে চাক নরিস এটি প্রতিষ্ঠা করেন, তাংসুদো থেকে প্রসূত এবং বিভিন্ন যুদ্ধ শৈলী থেকে উপাদান সম্মিলিত এই মার্শাল আর্ট।"},{"page_url":"https://id.wikipedia.org/wiki/Wanita_dalam_Dewan_Perwakilan_Amerika_Serikat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Jane_Harman%2C_official_portrait%2C_111th_Congress.jpg","page_title":"Wanita dalam Dewan Perwakilan Amerika Serikat","context_page_description":"Women in Congress — Companion site to book produced by the Office of the Clerk of the U.S. House of Representatives\\nAssociated Press. \\"Husbands' deaths often propel widows to office\\". Columbia Daily Tribune, January 22, 2005. Retrieved February 15, 2005.\\nMaurer, Elizabeth. \\"Legislating History: 100 Years of Women in Congress\\". National Women's History Museum. 2017."},{"page_url":"https://eu.wikipedia.org/wiki/Salineno_(Texas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/TXMap-doton-Salineno.PNG","page_title":"Salineno (Texas)","context_page_description":"Salineno Ameriketako Estatu Batuetako erroldak esleitutako leku bat da. Starr konderrian kokatuta dago, Texas estatuan. 304 biztanle ditu, 0,176157 kilometro koadroko azaleran banatuta."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%99%D7%A8%D7%95%D7%A4%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/FMNH_Eryops.jpg","page_title":"אירופס","context_page_description":"אירופס הוא סוג נכחד של דו-חיים יבשתי מסדרת הטמנוספונדילים אשר חי בין סוף הקרבון לפרם לפני 278–299 מיליון שנה. מאובניו התגלו בטקסס ב-1887 וקיבלו את שמם בידי החוקר האמריקאי אדוארד דרינקר קופ.\\nיצור מוזר זה דמה במראהו לסלמנדרה שמנה והגיע לאורך 1.5-3 מטר ולמשקל 90 קילוגרם עם זנב רחב, ראש מגודל בעל לסתות גדולות וחזקות ורגליים מאוד קצרות. הגולגולת הייתה רחבה ושטוחה עם עיניים קטנות במרכז הגולגולת. מבנה הלסתות הזכיר לסת של תנין וייתכן שהיצור היה טורף בעל אורח חיים דומה.\\nהוא חי בביצות של טקסס לצידם של יצורים נכחדים אחרים כמו הסינאפסידים, שחלקם היו ענקיים כמו הדימטרודון. האירופס חי כנראה בביצות באורח חיים אמפיבי וטרף דגים ודו-חיים ששרצו במים. ייתכן שהיה בעל צורת ראשן, אך היה יכול לעלות ליבשה לזמן ממושך יותר מרוב הדו-חיים.\\nהוא נכחד סופית בהכחדת הפרם הגדולה שייתכן שבמהלכה התייבשו הביצות בהם חי."},{"page_url":"https://ro.wikipedia.org/wiki/Ellen_Corby","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Edgar_Bergen_Ellen_Corby_The_Homecoming_Waltons_1974.JPG","page_title":"Ellen Corby","context_page_description":"Ellen Corby a fost o actriță americană de film."},{"page_url":"https://pt.wikipedia.org/wiki/Jo%C3%A3o_Nepomuceno_Carlos_de_Liechtenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Johann_Nepomuk_Karl_v_Liechtenstein.jpg","page_title":"João Nepomuceno Carlos de Liechtenstein","context_page_description":"João Nepomuceno Carlos ou Johann Nepomuk Karl de Liechtenstein foi o 7º Príncipe do Liechtenstein, entre 1732 e 1748. Ele era o filho de João José Antônio de Liechtenstein.\\nQuando seu pai morreu, João Nepomuceno Carlos tinha apenas 8 anos e seu parente José Venceslau governou como regente. Em 1744 casou com Maria Josefina de Harrach, (20 de Novembro de 1727 - 15 de fevereiro de 1788), filha do conde Frederico Augusto de Harrach-Rohrau. O casal tinha duas filhas; Mariana (1745-1752) e Maria Antônia (13 de Junho de 1749 - 28 de maio de 1813).\\nJoão Nepomuceno Carlos morreu três anos mais tarde, aos 24 anos de idade não deixando descendentes masculinos."},{"page_url":"https://ceb.wikipedia.org/wiki/Ipidecla","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/BiologiaCentraliAmericanaRhopaloceraPlate_58.jpg","page_title":"Ipidecla","context_page_description":"Henero sa mga alibangbang ang Ipidecla. Ang Ipidecla sakop sa kabanay nga Lycaenidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://lv.wikipedia.org/wiki/Latvijas_zivju_sugu_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Misgurnus_fossilis_2009_G1.jpg","page_title":"Latvijas zivju sugu uzskaitījums","context_page_description":"Šajā uzskaitījumā ir apkopotas visas Latvijā savvaļā sastopamās zivju sugas."},{"page_url":"https://az.wikipedia.org/wiki/Tisa_g%C3%B6l%C3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Tisza-t%C3%B3%2C_szabadstrand.JPG","page_title":"Tisa gölü","context_page_description":"Тisa gölü- Macarıstan su anbarının yaxınlığında yerləşən göldür. Tisa çayı da buraya tökülür.\\nBu göl Böyük Macarıstan düzündə yerləşən Eger şəhərinin cənub-şərqində yerləşmişdir. Tisa gölü 3 medyenin sərhədində- Borşod-Abauy-Zemplen, Haydu-Bihar və Yas-Naqikun-Solnok arasında yerləşmişdir. Tisa gölü həm də 1999-cu ildə yaradılan Xortovad Milli Parkının bir hissəsidir. Avropanın Dünya mədəni irs siyahısına daxil edilmişdir.\\nTisa gölünün uzunluğu 27 km, sahəsi isə 127 km²-dir. Orta dərinliyi 1,3 m, maksimal dərinliyi isə 17m-dir. Yaxınlığındakı adaların ümümi sahəsi isə 43 km²-dir. Göl 3 əsas hissəyə bölünür."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B8%D0%B1%D1%81%D0%BE%D0%BD,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82_%D0%9B%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/USS_Enterprise_%28CVAN-65%29%2C_USS_Long_Beach_%28CGN-9%29_and_USS_Bainbridge_%28DLGN-25%29_underway_in_the_Mediterranean_Sea_during_Operation_Sea_Orbit%2C_in_1964.jpg","page_title":"Гибсон, Роберт Ли","context_page_description":"Ро́берт Ли Ги́бсон — астронавт НАСА. Совершил пять космических полётов: в качестве пилота на шаттле «Челленджер» — STS-41B и в качестве командира корабля на шаттлах: «Колумбия» — STS-61C, «Атлантис» — STS-27, «Индевор» — STS-47, «Атлантис» — STS-71, кэптен ВМС США. Является одним из трёх астронавтов, кому довелось пилотировать четыре разных корабля из серии Спейс Шаттл."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D1%84%D1%82_%D0%9D%D0%A5%D0%9B_2013","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Seth_Jones_Team_USA_2011.jpg","page_title":"Драфт НХЛ 2013","context_page_description":"Драфт НХЛ 2013 — 51-й драфт, прошёл на домашней арене «Нью-Джерси Девилз» — Пруденшал-центр, Ньюарк, штат Нью-Джерси 30 июня 2013 года. Под общим первым номером был выбран канадский форвард Натан Маккиннон клубом «Колорадо Эвеланш». Первым среди россиян под общим 10-м номером был выбран Валерий Ничушкин в «Даллас Старз». Всего на этом драфте было выбрано 8 российских хоккеистов."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%99%AE%E9%AD%AF%E5%A3%AB%E7%9A%84%E7%B4%A2%E8%8F%B2%C2%B7%E5%A4%9A%E8%98%BF%E8%A5%BF%E4%BA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Sophie_von_Preu%C3%9Fen_mit_ihrem_Gemahl_Markgraf_Friedrich_Wilhelm_von_Brandenburg-Schwedt_%28Pesne%29.jpg","page_title":"普魯士的索菲·多蘿西亞","context_page_description":"索菲·多蘿西亞，布蘭登堡-施韋特藩侯夫人，腓特烈大帝的妹妹。"},{"page_url":"https://hy.wikipedia.org/wiki/(291)_%D4%B1%D5%AC%D5%AB%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/291Alice_%28Lightcurve_Inversion%29.png","page_title":"(291) Ալիս","context_page_description":"(291) Ալիս, աստերոիդ աստերոիդների հիմնական գոտում։ Հայտնաբերվել է 1890 թվականի ապրիլի 25-ին Յոհան Պալիսայի կողմից Վիեննայում։\\nՄիջին հեռավորությունը Արեգակից կազմում է 2,222166 ա. մ., առավելագույնը մոտենում է 2,0179 ա. մ. հեռավորության վրա և հեռանում 2,4265 ա. մ.։ Արեգակի շուրջ մեկ ամբողջական պտույտ է կատարում 1209,94 երկրային օրվա ընթացքում, իր ուղեծրով շարժվելով միջինում 0,297536 աստիճան/օր արագությամբ։ Աստերոիդի ուղեծրի և խավարածրի հարթությունները իրար հետ կազմում են 1,85° անկյուն։\\nԱլիս աստերոիդը դասվում է Ֆլորայի աստերոիդների ընտանիքին, որի մեջ ներառված են այս պահին հայտնի ավել քան 7438 անդամներ։ Ընտանիքի ներքին սահմանը անցնում է 2,17 ա. մ. հեռավորության վրա Արեգակից, իսկ արտաքին սահմանը՝ 2,33։ Այս ընտանիքի աստերոիդների էքսցենտրիսիտետները ընկնում են 0,109-0,168 միջակայքում, իսկ ուղեծրի թեքումը՝ 2,4°-6,9°։\\nԸստ Տոլենի սպեկտրալ դասակարգման պատկանում է S դասին։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC_%D0%B4%D0%B2%D0%BE%D1%80%D1%8F%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D1%8F_(%D0%A2%D1%83%D0%BB%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/%D0%9C%D0%B5%D0%BC%D0%BE%D1%80%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%81%D0%BA%D0%B0_%D0%92.%D0%92._%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%BC%D1%83_%D0%B8_%D0%9D.%D0%9D._%D0%90%D1%81%D0%B5%D0%B5%D0%B2%D1%83.JPG","page_title":"Дом дворянского собрания (Тула)","context_page_description":"Дом Дворя́нского собра́ния — трёхэтажное кирпичное угловое здание, расположенное в историческом центре города Тулы по адресу проспект Ленина, 44 на пересечении улицы Гоголевской и проспекта Ленина. В настоящее время здание передано на баланс Тульской областной филармонии, которая планирует разместить в нём свою вторую концертную площадку."},{"page_url":"https://fr.wikipedia.org/wiki/Ornavik","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Maison_viking_de_S%C3%A4by_-Ornavik_-_septembre_2016.jpg","page_title":"Ornavik","context_page_description":"Ornavik est un chantier d'archéologie expérimentale situé dans le domaine boisé du château de Beauregard à Hérouville-Saint-Clair et ouvert au public depuis le 28 mai 2011. Les travaux d'aménagement sont prévus durer jusqu'en 2021. La démarche s'inspire directement du chantier de Guédelon, dans l'Yonne. Le projet consiste à présenter l'histoire de l'actuelle Normandie de 911, date de l'installation de Rollon à 1066, année de la conquête de l'Angleterre par Guillaume le Conquérant."},{"page_url":"https://pt.wikipedia.org/wiki/Cacipor%C3%A9_Torres","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Trilho%2C_Ritmo_e_Vibra%C3%A7%C3%A3o_02.jpg","page_title":"Caciporé Torres","context_page_description":"Caciporé de Sá Continho da Lamare Torres é um escultor, desenhista e professor brasileiro, agraciado com a Comenda Mário de Andrade pelo Governo do Estado de São Paulo, na gestão de Paulo Egydio Martins. Apesar de Caciporé ser um artista premiado pelas mais célebres instituições brasileiras, ter participado de importantes mostras internacionais e ser reconhecido como um dos mais relevantes artistas do Brasil pelos historiadores e críticos, ainda existe a necessidade de um estudo aprofundado que o eleve a sua verdadeira importância.\\nA ampla produção do escultor vem sido acompanhada com vasto interesse pela crítica, desde o final da década de 40. Além disso, a obra de Caciporé, frequentemente, torna-se tema de estudo e trabalho em cursos de graduação em Arquitetura e Artes Visuais. Como a bibliografia existente sobre ele é incompleta e dispersa, diversos pesquisadores, críticos, professores e estudantes buscam mais informações e tentam compreender melhor seu trabalho."},{"page_url":"https://fr.wikipedia.org/wiki/Germaine_Mornand","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Mornand_daisy.jpg","page_title":"Germaine Mornand","context_page_description":"Germaine Mornand, née le 27 mai 1888 dans le 16ᵉ arrondissement de Paris et morte le 27 septembre 1976 à Chantilly, est une femme de lettres et écrivain française."},{"page_url":"https://de.wikipedia.org/wiki/Schweinfurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Entwicklungszentrum_ZF_Sachs_-_panoramio.jpg","page_title":"Schweinfurt","context_page_description":"Schweinfurt ist eine kreisfreie Stadt im Regierungsbezirk Unterfranken des Freistaats Bayern. Die wichtigste Industriestadt Nordbayerns und Hafenstadt am Main ist Oberzentrum, Verwaltungssitz des Landkreises Schweinfurt, Teilstandort zweier Landesbehörden und Hochschulstadt. Schweinfurt besteht als deutsche Ausnahme fast nur aus der Kernstadt, weshalb die Einwohnerzahl keinen Vergleichsmaßstab bietet. Die Agglomeration hat 100.200 Einwohner und das Einzugsgebiet der Stadt 759.000 Einwohner. Zu ihm gehören die Region Main-Rhön und der mittlere Teil Südthüringens.\\nSchweinfurt war schon in vorgeschichtlicher Zeit besiedelt und wurde 791 erstmals urkundlich erwähnt. Die Markgrafen von Schweinfurt verloren bereits vor 1000 Jahren ihre überregionale Bedeutung. Vom 12. Jahrhundert bis 1802 war Schweinfurt Reichsstadt, in der Frühen Neuzeit ein humanistisches Zentrum und 1770 begann die Industrialisierung. Im Zweiten Weltkrieg war die Stadt wegen ihrer Schlüsselindustrie stark umkämpft, geriet durch die Deutsche Teilung ins Abseits und durch die Wiedervereinigung in die bundesdeutsche Mitte, als neuer Autobahnknoten."},{"page_url":"https://af.wikipedia.org/wiki/Harry_Houdini","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Harry_Houdini_by_LaPine_Studios%2C_1915.png","page_title":"Harry Houdini","context_page_description":"Harry Houdini was 'n Hongaarse-gebore Amerikaanse kulkunstenaar en waaghals, bekend vir sy sensasionele ontsnap pogings.\\nIn 1904 het duisende dopgehou terwyl hy probeer ontsnap uit spesiale handboeie. 'n Ander toertjie het gesien hoe hy lewend begrawe is en net in staat was om homself op die oppervlak te klou. Terwyl baie mense vermoed het dat hierdie ontsnapings vervals was, het Houdini homself voorgestel as die plaag van valse spiritualiste. As president van die Society of American Magicians was hy gretig om professionele standaarde te handhaaf en bedrieglike kunstenaars bloot te lê. Hy was ook vinnig om iemand te dagvaar wat sy ontsnappingstoertjies naboots.\\nHoudini het verskeie films gemaak, maar ophou optree toe hy nie geld kon inbring nie. Hy was ook 'n ywerige vlieënier en was daarop gemik om die eerste man te word wat 'n vliegtuig in Australië kon vlieg."},{"page_url":"https://nl.wikipedia.org/wiki/Veganisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Vegan_Buffalo_Tofu_Wrap_-_Vita_Caf%C3%A9%2C_Portland%2C_Oregon_%2822762900865%29.jpg","page_title":"Veganisme","context_page_description":"Veganisme is een levenswijze waarin gestreefd wordt naar het vermijden van het gebruik van dierlijke producten. Als zodanig gelden ten eerste delen van het dierenlichaam of producten die daarvan vervaardigd zijn en ten tweede door dieren voortgebrachte producten, zoals zuivel, eieren en honing. Vaak worden alternatieven gevonden in het gebruik van plantaardige voedingsmiddelen en materialen. De meeste veganisten keuren ook exploitatie van dieren en wreedheid jegens dieren af, zoals het vasthouden van dieren voor vermaak, zoals in een dierentuin of circus of gebruik als proefdier."},{"page_url":"https://en.wikipedia.org/wiki/Bangabandhu_Sheikh_Mujibur_Rahman_Agricultural_University","image_url":"https://upload.wikimedia.org/wikipedia/en/7/70/Begum_Sufiya_Kamal_Auditorium%2C_BSMRAU.jpg","page_title":"Bangabandhu Sheikh Mujibur Rahman Agricultural University","context_page_description":"Bangabandhu Sheikh Mujibur Rahman Agricultural University is a public agricultural university in Bangladesh, established in 1998. It is located at South Salna, in Gazipur District. It is 9.5 kilometres from Gazipur Chowrasta, just east of the Dhaka-Mymensingh Highway."},{"page_url":"https://en.wikipedia.org/wiki/Alexander_Coosemans","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Alexander_Coosemans_-_Still_life_with_fruit.jpg","page_title":"Alexander Coosemans","context_page_description":"Alexander Coosemans was a Flemish Baroque painter specialized in still lifes of flower pieces, fruit, and inanimate subjects. He painted vanitas still lifes, pronkstillevens and game pieces."},{"page_url":"https://de.wikipedia.org/wiki/Haus_und_Garten_Claude_Monet","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Giverny.jpg","page_title":"Haus und Garten Claude Monet","context_page_description":"Haus und Garten Claude Monet ist die gängige Bezeichnung für das von der Fondation Claude Monet in dem französischen Dorf Giverny im Département Eure verwaltete ehemalige Domizil des impressionistischen Malers Claude Monet.\\nDer Künstler mietete das Haus im Mai 1883 und legte dahinter zunächst den clos normand genannten Ziergarten an, den er mit einer wuchernden Blumenpracht überzog. Im November 1890 war es ihm möglich, das Haus und das Grundstück zu kaufen. 1893 erweiterte Monet den Garten, den mittlerweile sechs Gärtner pflegten, um ein Stückchen Land an der Epte. Dort entstand in den folgenden Jahren der sogenannte jardin d’eau oder Wassergarten mit dem von einer Brücke nach japanischem Vorbild überspannten Seerosenteich, der Monet sehr häufig als Motiv diente.\\nMonet liebte die Gartenkunst, las Fachliteratur und besuchte Gartenausstellungen. Der Garten diente ihm nicht nur zur Erholung, sondern inspirierte ihn auch für seine Gemälde.\\nDas Haus, der Garten und das Atelier kamen 1966 als Stiftung des Maler-Sohnes Michel Monet in den Besitz der Académie des Beaux-Arts. Nach entsprechenden Renovierungsarbeiten kann das Anwesen seit 1980 besichtigt werden."},{"page_url":"https://fr.wikipedia.org/wiki/Point_Pleasant_(Virginie-Occidentale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/WVMap-doton-PointPleasant.PNG","page_title":"Point Pleasant (Virginie-Occidentale)","context_page_description":"Point Pleasant est une ville des États-Unis, siège du comté de Mason, en Virginie-Occidentale, et située au confluent des rivières Kanawha et Ohio"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%90%A8%E8%8E%AB%E8%80%B6%E5%BE%B7%E4%BA%BA_(%E8%89%BA%E6%9C%AF%E5%93%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Samoyed_Man_MET_ES6550.jpg","page_title":"萨莫耶德人 (艺术品)","context_page_description":"萨莫耶德人是一个在1780年至1800年期间诞生于俄罗斯圣彼得堡的陶塑。1779年，圣彼得堡御瓷厂的吉恩·多米尼克·罗歇特制造了萨莫耶德人陶塑模具，使其成为工厂大规模生产的产品。该系列产品的生产工作从1780年一直持续至1804年为止，常作为礼物赠送给外国政要。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E7%9F%B3%E5%9E%A3%E6%A9%9F%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/%E6%96%B0%E7%9F%B3%E5%9E%A3%E7%A9%BA%E6%B8%AF.JPG","page_title":"新石垣機場","context_page_description":"新石垣機場是一座位於日本沖繩縣八重山群島石垣島上的一座機場，該機場取代舊有的石垣機場成為該區域的對外航空交通之機場，2013年3月6日起正式對外營運。其主要民航業務為往返日本本土以及沖繩地區的國內線航班，除此之外尚有營運往返臺北以及香港的定期國際航班。在波照間機場於2008年11月起停止定期航班後，新石垣機場成為日本仍有定期班機起降的最南端機場。\\n在機場的國內線及國際線正門，所用的名稱並不是稱為「新石垣機場」，而是「南方之島石垣機場」；當中「南ぬ」是採用八重山語，而非日語讀音「なんぽう」。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%99%D7%A7%D7%95%D7%9C%D7%90%D7%99_%D7%93%D7%95%D7%95%D7%99%D7%93%D7%A0%D7%A7%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Davydenko_Nikolay.jpg","page_title":"ניקולאי דווידנקו","context_page_description":"ניקולאי ולדימירוביץ' דווידנקו הוא טניסאי עבר רוסי.\\nהישגיו הבולטים ביותר הם זכייה באליפות סבב המאסטרס העולמי בשנת 2009 והגעה לשלבי חצי הגמר בתחרויות הגראנד סלאם אליפות ארצות הברית הפתוחה וברולאן גארוס. יש המכנים אותו \\"איש הברזל\\" משום שהוא לקח חלק ביותר טורנירים שנתיים מאשר כל טניסאי אחר, בדומה לטניסאי העבר הרוסי יבגני קפלניקוב. דווידנקו פרש ממשחק פעיל בשנת 2014."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%9A%E5%A4%AA%E7%A5%9E%E7%A4%BE_(%E5%B7%9D%E8%A5%BF%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Tabuto_Jinja_Hukurokuju.jpg","page_title":"多太神社 (川西市)","context_page_description":"多太神社は、兵庫県川西市平野にある神社。摂津国河辺郡の式内小社。旧社格は郷社。明治に入り神社に移行した多田院と区別するため地元では「たぶとじんじゃ」と呼ばれている。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%8A%D8%B1%D8%A7%D9%86%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Meringues_9027.jpg","page_title":"ميرانغ","context_page_description":"ميرانغ هو نوع من الحلوى، وغالبًا ما يرتبط بالمطبخ الإيطالي والسويسري والفرنسي، ويُصنع عادةً من بياض البيض المخفوق والسكر، و في بعض الأحيان مكون حمضي مثل الليمون أو الخل أو كريم الترتار. يمكن أيضًا إضافة عامل ربط مثل الملح أو الدقيق أو الجيلاتين إلى البيض. المفتاح لتشكيل مرينج جيد هو تشكيل قمم قاسية عن طريق تشويه بروتين البيض عن طريق القص الميكانيكي. غالبًا ما يتم تنكيه الميرانغ بالفانيليا، أو كمية صغيرة من عصير التفاح، أو عصير البرتقال.\\nتقدّم هذه الحلوى باردة مع المثلجات وتزيّن بالكريمة والفاكهة."},{"page_url":"https://id.wikipedia.org/wiki/Acacia_mangium","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Leaves_at_canopy_in_Kolkata_W_IMG_4578.jpg","page_title":"Acacia mangium","context_page_description":"Acacia mangium adalah tanaman kayu anggota dari marga Acacia yang banyak tumbuh di wilayah Papua Nugini, Papua Barat dan Maluku. Tanaman ini pada mulanya dikembangkan eksitu di\\nMalaysia Barat dan selanjutnya di Malaysia Timur, yaitu di Sabah dan Serawak, karena menunjukkan pertumbuhan yang baik maka Filipina telah mengembangkan pula sebagai tanaman hutan."},{"page_url":"https://eo.wikipedia.org/wiki/L%C3%B6wenbr%C3%A4u","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/M%C3%BCnchen%2C_Oktoberfest-Kutscher.jpg","page_title":"Löwenbräu","context_page_description":"Löwenbräu estas tradicia kaj renoma bierfarejo en Bavario, kun centra produktejo en Munkeno. Ekde la jaro 1997 ĝi kun la samurba bierfarejo Spatenbräu apartenas al komuna konzerno, kiu mem ekde 2008 apartenas al la belga-brazila konzerno Anheuser-Busch InBev. Probable la bierfarejo fondiĝis jam en 1383, la nomo \\"Löwenbräu\\" dokumente fiksiĝis ekde la jaro 1746: ĝi fontas de fresko pri la biblia sceno de Danielo en la fosaĵo de la leonoj, videbla en la historia bierfareja trinkejo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D1%83%D0%B3%D0%B3%D0%B5%D1%80,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Raymund_fuggerorum_portrait.jpg","page_title":"Фуггер, Антон","context_page_description":"Антон Фуггер — глава аугсбургского торгово-кредитного дома Фуггеров после смерти своего дяди Якова Богатого в 1525 году. Носил прозвище «князь купцов». Расширил обороты Фуггеров в Новом свете, выстроил замок Ротенштейн.\\nВ своих делах Антон был настолько же осторожен, насколько его дядя был смел и предприимчив. Он выстраивал отношения с Габсбургами на чисто коммерческой основе, и неизменно требовал верного обеспечения своим кредитам. Когда настал срок возобновления фуггеровского контракта по откупу доходов испанских рыцарских орденов, он поддался давлению испанских патриотов и уступил его генуэзцам.\\nВ 1530 году капиталы Антона Фуггера склонили выборщиков в пользу кандидатуры Фердинанда Габсбурга на престол Священной Римской империи. Во время Шмалькальденской войны он как добрый католик старался поддерживать Габсбургов, но совет Аугсбурга был на стороне протестантов, и самые крупные протестантские князья, ландграф гессенский и курфюрст саксонский, требовали, чтобы Фуггер помогал своими капиталами им, грозя в противном случае предать опустошению его земли."},{"page_url":"https://cs.wikipedia.org/wiki/Sony_Ericsson_K790","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/SonyEricssonK790.JPG","page_title":"Sony Ericsson K790","context_page_description":"K790 od Sony Ericssonu je jeden z modelů, který má fotoaparát od Cyber-shotu s rozlišením 3,2 megapixelů. Datové přenosy má přes Bluetooth a infračervený port. Je velmi podobný SE K800. Na rozdíl od něj má EDGE, ale nepodporuje 3G sítě, díky kterým lze uskutečňovat videohovory."},{"page_url":"https://eu.wikipedia.org/wiki/Puntu_urdin_margul_bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Pale_Blue_Dot.png","page_title":"Puntu urdin margul bat","context_page_description":"Puntu urdin margul bat 1990eko otsailaren 14an Voyager 1 espazio-zundak 6.000 milioi kilometroko distantziatik ateratako Lurraren argazki bat da. Espazioaren neurrigabetasunean eta eguzkiaren izpienpean Lurra puntu nimino baten antzera irudikatzen da. Behin bere misioa amaitu eta eguzki-sistema uztear zegoela, Carl Sagan zientzialariaren eskaerari jarraiki kamera biratu eta Lurrari argazkia atera zion. Ondoren, Saganek argazkilan honen izenburuan oinarriturik bere Puntu urdin margul bat: Gizakiaren Etorkizunaren ikuspegia Espazioan liburuari izena ipini zion.\\n2001an Space.com webguneak historia guztiko 10 zientzia-argazki onenetakoen artean aukeratu zuen."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Nishi-Shimmachi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Sanyo-nishishinnmachi_wicket2015.jpg","page_title":"Gare de Nishi-Shimmachi","context_page_description":"La gare de Nishi-Shimmachi est une gare ferroviaire localisée dans la ville d'Akashi, dans la préfecture de Hyōgo au Japon. La gare est exploitée par la compagnie Sanyo Electric Railway, sur la ligne principale Sanyō. Le numéro de la gare est SY 18."},{"page_url":"https://pl.wikipedia.org/wiki/Streptoprocne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Flickr_-_Rainbirder_-_Chestnut-collared_Swift_%28Streptoprocne_rutila%29_on_the_nest.jpg","page_title":"Streptoprocne","context_page_description":"Streptoprocne – rodzaj ptaka z podrodziny cierniosternikiów w rodzinie jerzykowatych."},{"page_url":"https://fr.wikipedia.org/wiki/Correspondance_des_toponymies_lorraines_en_fran%C3%A7ais_et_en_allemand","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Toponymes_romans_en_Moselle.svg","page_title":"Correspondance des toponymies lorraines en français et en allemand","context_page_description":"Les divers toponymes de Lorraine sont souvent connus par des noms très différents selon la langue dans laquelle on s'exprime. Cet article permet de comprendre l'origine linguistique et historique de cette diversité et liste un certain nombre de correspondances."},{"page_url":"https://en.wikipedia.org/wiki/Predominant_chord","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Ii-V-I_turnaround_in_C.png","page_title":"Predominant chord","context_page_description":"In music theory, a predominant chord is any chord which normally resolves to a dominant chord. Examples of predominant chords are the subdominant, supertonic, Neapolitan sixth and German sixth. Other examples are the secondary dominant and secondary leading tone chord. Predominant chords may lead to secondary dominants. Predominant chords both expand away from the tonic and lead to the dominant, affirming the dominant's pull to the tonic. Thus they lack the stability of the tonic and the drive towards resolution of the dominant. The predominant harmonic function is part of the fundamental harmonic progression of many classical works. The submediant may be considered a predominant chord or a tonic substitute.\\nThe dominant preparation is a chord or series of chords that precedes the dominant chord in a musical composition. Usually, the dominant preparation is derived from a circle of fifths progression. The most common dominant preparation chords are the supertonic, the subdominant, the V7/V, the Neapolitan chord, and the augmented sixth chords.\\nIn sonata form, the dominant preparation is in the development, immediately preceding the recapitulation."},{"page_url":"https://sv.wikipedia.org/wiki/Vanliga_delfiner","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Cetacea_range_map_Long-beaked_Common_Dolphin.PNG","page_title":"Vanliga delfiner","context_page_description":"Vanliga delfiner är ett släkte däggdjur av familjen delfiner som lever i haven. Trots namnet är vanliga delfiner inte de delfiner som människan mest förknippar med delfiner. Den rollen har istället flasknosdelfin eller öresvin som brukar hållas på delfinarier och som blev världskänd genom TV-serien Flipper."},{"page_url":"https://eu.wikipedia.org/wiki/Porru_(zigarroa)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Joint.jpg","page_title":"Porru (zigarroa)","context_page_description":"Porrua, txirria edo jointa kanabisa edo haxixa duen zigarroari ematen zaion lagunarteko izena da. Tamaina handiko porruari tronpeta ere esaten zaio."},{"page_url":"https://da.wikipedia.org/wiki/Ludovico_Bidoglio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ludovico_Bidoglio_1930.jpeg","page_title":"Ludovico Bidoglio","context_page_description":"Ludovico Bidoglio var en argentinsk fodboldspiller.\\nHan var en del af det argentinske landshold, der vandt guld ved Copa América i både 1925 og 1927, og sølv ved OL i 1928 i Amsterdam.\\nBidoglio spillede på klubplan primært hos Boca Juniors. Her var han med til at vinde det argentinske mesterskab i 1931."},{"page_url":"https://nl.wikipedia.org/wiki/Lioessens","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Dongeradiel_Ljussens_Geref_Tsjerke.JPG","page_title":"Lioessens","context_page_description":"Lioessens is een dorp in de gemeente Noardeast-Fryslân, in de Nederlandse provincie Friesland.\\nHet ligt ten ten oosten van Oosternijkerk, ten zuidoosten van Paesens en Moddergat, ten noordwesten van Anjum en ten noorden van Morra. De dorpskern ligt even ten noordwesten van de Dijkstervaart.\\nHet dorpsgebied loopt helemaal door tot de Waddenzee, incluis een buitendijksgebied. Het dorp werkt veel samen met Morra en zo vormen ze een tweelingdorp. In 2018 telde het dorp 350 inwoners."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%97%E1%83%90%E1%83%91%E1%83%90%E1%83%A8%E1%83%98%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Gypsum-47190.jpg","page_title":"თაბაშირი","context_page_description":"თაბაშირი — სულფატების კლასის მინერალი, რომელიც წარმოიქმნება კალციუმის სულფატზე წყლის დამატებით. რეაქცია მიმდინარეობს 20-25 °C ტემპერატურაზე და შედეგად იძენს სიმყარეს. დიდი გამოყენება აქვს ტრამვატოლოგიაში."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Kaiserslautern","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Kaiserslautern_Schillerplatz_5_3.jpg","page_title":"Liste der Kulturdenkmäler in Kaiserslautern","context_page_description":"In der Liste der Kulturdenkmäler in Kaiserslautern sind Kulturdenkmäler in der Kernstadt der rheinland-pfälzischen Stadt Kaiserslautern aufgelistet. Grundlage ist die Veröffentlichung die Denkmalliste des Landes Rheinland-Pfalz.\\nDie Kulturdenkmäler in den Stadtteilen werden in der Liste der Kulturdenkmäler in Kaiserslautern genannt."},{"page_url":"https://gl.wikipedia.org/wiki/Vienna_Capitals","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Peter_Casparsson_Vienna_Capitals.JPG","page_title":"Vienna Capitals","context_page_description":"Os Vienna Capitals son un equipo profesional de hóckey sobre xeo da cidade de Viena, Austria. O club foi fundado no ano 2000 e dende a tempada 2001-02 compite na máxima categoría do hóckey sobre xeo austríaco, a Erste Bank Hockey League, da que foron campións en 2005 e mais en 2017. Xogan os seus partidos como local no Albert-Schultz-Eishalle, un pavillón con capacidade para 7.000 espectadores.\\nDende o 2011 compite no European Trophy. O equipo é alcumado Caps."},{"page_url":"https://sv.wikipedia.org/wiki/Enoplognatha","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Enoplognatha.ovata.female.jpg","page_title":"Enoplognatha","context_page_description":"Enoplognatha är ett släkte av spindlar som beskrevs av Pietro Pavesi 1880. Enoplognatha ingår i familjen klotspindlar."},{"page_url":"https://fr.wikipedia.org/wiki/Caravans%C3%A9rail","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Kurshumli-An-Skopje-MK.JPG","page_title":"Caravansérail","context_page_description":"Un caravansérail, ou khan ou encore foundouk, est, au Proche et Moyen-Orient ainsi qu'au Maghreb, un lieu où les caravanes de marchands font halte et peuvent s'abriter.\\nLe caravansérail est un bâtiment qui accueille les marchands et les pèlerins le long des routes et dans les villes. Selon les endroits, le nom change : dans le monde iranien, il s'appellera plutôt khan alors qu'au Maghreb, c'est le mot funduq qui est le plus couramment employé. On pourrait comparer le caravansérail à un relais de poste en Europe ou à un ryokan au Japon.\\nUn caravansérail est toujours fortifié, et comporte à la fois des écuries pour les montures et les bêtes de somme, des magasins pour les marchandises et des chambres pour les gens de passage. Il est fréquent que les magasins se trouvent au rez-de-chaussée et les chambres au premier étage.\\nC'est aussi un lieu d'échange fréquenté par de nombreux étrangers et des voyageurs."},{"page_url":"https://ro.wikipedia.org/wiki/N%C3%B3lsoy,_N%C3%B3lsoy","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Nolsoy.jpg","page_title":"Nólsoy, Nólsoy","context_page_description":"Nólsoy este un oraș din Insulele Faroe."},{"page_url":"https://pt.wikipedia.org/wiki/Banco_do_Canad%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/BankofCanadabuilding.jpg","page_title":"Banco do Canadá","context_page_description":"O Banco do Canadá é o banco central do Canadá, fundado em 3 de julho de 1934 pelo Banco do Canadá Act. Em 11 de março de 1935 começa efetivamente as suas operações bancárias. É o banco que emite a moeda nacional, o dólar canadense. Sua sede fica em Ottawa.\\nO Banco do Canadá, sendo um banco central, é de criação recente. Ao longo da história do país não tinha, em princípio, necessidade de criar um banco central. O Banco de Montreal, de fato, cumprido essa tarefa, e do sistema bancário foi operado pelo Bankers Association canadense em colaboração com o governo. No entanto, esta situação mudou com a Grande Depressão de 1929. Muitos acusaram neste período, o sistema bancário de ser responsável por agravar a depressão, um momento de deflação e recessão econômica. Juntamente com os agricultores e pecuaristas, o Banco Royale do Canadá, que queria desmantelar parceria do governo com o Banco de Montreal, apelou à criação de um banco central.\\nO Primeiro-Ministro, R. B. Bennett, encomendou uma Comissão Real em 1933 para estudar a possibilidade de criar um banco central, emitindo essa uma resolução favorável. A fórmula utilizada foi a de uma empresa privada, sem influência do governo."},{"page_url":"https://eu.wikipedia.org/wiki/Phrynocephalus_maculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Phrynocephalus_maculatus.jpeg","page_title":"Phrynocephalus maculatus","context_page_description":"Phrynocephalus maculatus Phrynocephalus generoko animalia da. Narrastien barruko Agamidae familian sailkatuta dago."},{"page_url":"https://ro.wikipedia.org/wiki/Goelet%C4%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Smallschooner.jpg","page_title":"Goeletă","context_page_description":"O goeletă, din cuvântul din limba franceză, goélette este un tip de vas cu pânze, caracterizat prin prezența a, în general, două catarge, uneori trei, rareori mai multe, pe care se ridică pânze multiple aflate la diferite grade de înclinare față de axa de simetrie a navei.\\nParticularitatea distinctă a goeletelor este folosirea simultană a acestor pânze multiple la diferite grade de înclinare pentru a prinde cât mai complet forța vântului. În cazul celor mai eficiente și rapide goelete, pânzele sunt foarte rar orientate perpendicular pe direcția de înaintare a navei.\\nPrimele utilizări ale goeletelor se datoresc olandezilor în secolele al XV-lea și al XVI-lea fiind apoi perfecționate de francezi, englezi, americani și canadieni în secolelele următoare."},{"page_url":"https://fr.wikipedia.org/wiki/Perrine_Pelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Perrine_Pelen_%281978%29.png","page_title":"Perrine Pelen","context_page_description":"Perrine Pelen, née le 3 juillet 1960 à Boulogne-Billancourt, est une ancienne skieuse alpine française membre du Grenoble Université Club, triple médaillée aux Jeux olympiques d'hiver avec comme meilleur résultat une médaille d'argent en slalom à Jeux de Sarajevo 1984, et sacrée championne du monde de slalom à Bormio en 1985, la dernière françaises à gagner l'or dans cette discipline, à ce jour.\\nKinésithérapeute de formation, elle arrête la compétition en 1986 pour compléter son cursus universitaire à l'Institut supérieur des affaires, devenu MBA HEC.\\nResponsable marketing à Savoie Mont-Blanc Tourisme durant trente années, elle devient en avril 2019 directrice générale du comité d'organisation des Championnats du monde de ski alpin 2023 à Méribel et Courchevel."},{"page_url":"https://en.wikipedia.org/wiki/Initiative_on_Cities","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Initiative_on_Cities_logo.jpeg","page_title":"Initiative on Cities","context_page_description":"The Initiative on Cities is a Boston University affiliated institution seeking to \\"promote and advance the adaptive urban leadership strategies necessary to support cities as dynamic centers of economic growth and development in the 21st century.\\" Co-founded by Mayor Thomas Menino and Professor of Political Science Graham Wilson in 2014, the Initiative on Cities works with municipal leaders, academic professionals, and policy makers to plan and develop services, infrastructure, and programs to create sustainable cities."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%88%D8%A7%D8%AC%D9%8A_(%D8%AC%D8%B2%D9%8A%D8%B1%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Location-of-Awaji-island-en.png","page_title":"أواجي (جزيرة)","context_page_description":"جزيرة أواجي هي جزيرة في محافظة هيوغو، اليابان في الجزء الشرقي من البحر الداخلي بين جزيرتي هونشو وشيكوكو. كصلة عبور بين الجزيرتين فإن اسم الجزيرة جاء على معنى الطريق إلى أوا وهي مقاطعة سابقة في اليابان."},{"page_url":"https://de.wikipedia.org/wiki/Olympos_(Lykien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Olympos_Gesamtansicht.JPG","page_title":"Olympos (Lykien)","context_page_description":"Olympos ist eine antike Stadt an der Ostküste Lykiens – heute Deliktaş genannt. Der Name leitet sich von dem Berg Olympos ab, dem heutigen Tahtalı Dağı, an dessen Fuß die Stadt lag. Von der einst bedeutenden Stadt des Lykischen Bundes ist historisch nur Weniges greifbar und auch die Ruinen faszinieren mehr durch ihre malerische Lage an einem Bachlauf in Strandnähe."},{"page_url":"https://ca.wikipedia.org/wiki/Montesa_Cota_74/123/172","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Montesa_Cota_123_1972.JPG","page_title":"Montesa Cota 74/123/172","context_page_description":"Les Montesa Cota 74 i Cota 123 varen ser dos models de motocicleta de trial de la gamma Cota de Montesa que estigueren en producció entre 1972 i 1982. Ambdós models eren idèntics i es diferenciaven només per la cilindrada del motor, circumstància provocada pel límit legal vigent aleshores, que fixava en 75 cc la cilindrada màxima permesa a l'estat espanyol per als posseïdors de l'A1, mentre que a la resta del món aquest límit era de 125 cc. Paral·lelament a la comercialització d'aquests dos models, entre 1975 i 1980 Montesa va produir també la Cota 172, una senzilla evolució de la Cota 123 de la qual només se'n diferenciava per les rodes de major diàmetre i el motor, apujat a 157 cc. A banda, d'ençà de 1982 i durant un breu període la Cota 123 fou comercialitzada per Honda sota la denominació MH 123 a través de la seva xarxa de concessionaris a Europa. Finalment, el 1986 -pocs anys després d'haver abandonat la fabricació de les Cota 74, 123 i 172- Montesa presentà la Cota 125, un model nou de trinca que tenia poc a veure amb els seus antecessors, tret de la cilindrada."},{"page_url":"https://ceb.wikipedia.org/wiki/Shortia_galacifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Shortia_galacifolia_-_2013.jpg","page_title":"Shortia galacifolia","context_page_description":"Espesye sa tanom nga bulak ang Shortia galacifolia. Una ning gihulagway ni John Torrey ug Amp; Gray. Ang Shortia galacifolia sakop sa kahenera nga Shortia sa kabanay nga Diapensiaceae. Usa ka matang nga nahiubos niini atong makita S. g. brevistyla."},{"page_url":"https://es.wikipedia.org/wiki/Suicidio_en_animales","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Bucephala-albeola-010.jpg","page_title":"Suicidio en animales","context_page_description":"El suicidio en animales es la conducta autodestructiva de las especies animales que se asemeja al suicidio humano."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bisch%C3%B6fe_von_Rochester","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/JosephCottonWigram.jpg","page_title":"Liste der Bischöfe von Rochester","context_page_description":"Das Bistum wurde 604 von dem König von Kent Æthelberht gegründet. Augustinus setzte Justus im gleichen Jahr als ersten Bischof ein.\\nDie folgenden Personen waren Bischöfe von Rochester, bis 1535 gehörten sie der Römisch-katholischen Kirche an, danach der Church of England:"},{"page_url":"https://simple.wikipedia.org/wiki/Pablo_Aimar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Pablo_Aimar_playing_against.jpg","page_title":"Pablo Aimar","context_page_description":"Pablo Aimar is an Argentine football player. He plays for Benfica and Argentina national team."},{"page_url":"https://en.wikipedia.org/wiki/American_Bridge_Company","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Sears_tower_orthogonal.jpg","page_title":"American Bridge Company","context_page_description":"The American Bridge Company is a heavy/civil construction firm that specializes in building and renovating bridges and other large, complex structures. Founded in 1900, the company is headquartered in Coraopolis, Pennsylvania, a suburb of Pittsburgh. The firm has built many bridges in the U.S. and elsewhere; the Historic American Engineering Record notes at least 81. American Bridge has also built or helped build the Willis Tower, the Empire State Building, the Chrysler Building, launch pads, resorts, and more. During World War II, it produced tank landing ships for the United States Navy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%C2%AB%D0%93%D0%B5%D0%B9%D0%B4%D0%B0%D1%80_%D0%90%D0%BB%D0%B8%D0%B5%D0%B2%C2%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/%22Heyd%C9%99r_%C6%8Fliyev%22_ordeni.png","page_title":"Орден «Гейдар Алиев»","context_page_description":"Орден «Гейдар Алиев» — высшая награда Азербайджанской Республики. Учреждён Законом Азербайджанской Республики от 22 апреля 2005 года № 896-IIГ.\\nОрденом «Гейдар Алиев» награждаются граждане Азербайджана за выдающиеся заслуги в процветании, величии и славе Азербайджана; за мужество и отвагу, проявленные в деле защиты Родины и государственных интересов Азербайджанской Республики. Президенту Азербайджана орден вручается по статусу."},{"page_url":"https://ro.wikipedia.org/wiki/Paranapu%C3%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Bras%C3%A3o_de_Paranapu%C3%A3%2C_SP.jpg","page_title":"Paranapuã","context_page_description":"Paranapuã este un oraș în São Paulo, Brazilia."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_tempat_wisata_di_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Ngaraisianok.jpg","page_title":"Daftar tempat wisata di Indonesia","context_page_description":"Berikut adalah daftar tempat pariwisata di Indonesia berdasarkan provinsi. Untuk informasi lebih lengkap mengenai pariwisata di Indonesia.\\nJumlah tempat pariwisata yang tercatat di halaman ini adalah sebanyak 962."},{"page_url":"https://pt.wikipedia.org/wiki/Gotemburgo","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Departures_entrance_at_Landvetter.JPG","page_title":"Gotemburgo","context_page_description":"Gotemburgo ou Goteburgo é a segunda maior cidade da Suécia. É a capital do condado de Västra Götaland e a sede da comuna de Gotemburgo.\\nCom cerca de 533 000 habitantes na cidade, e 1 100 000 na área metropolitana, é a segunda maior cidade sueca depois de Estocolmo. Situa-se na foz do rio Gota, que deságua no estreito de Categate. O rio divide a cidade em duas partes, sendo a margem norte a ilha Hisingen. O porto de Gotemburgo é o maior da Suécia e dos países nórdicos.\\nA cidade é conhecida como Gotemburgo em português, espanhol e italiano histórico, Gothenburg em inglês, alemão e neerlandês e Gothenbourg em francês. Enquanto que em algumas línguas, há uma tendência para regressar à forma vernácula Göteborg, nos textos suecos em inglês há a tendência oposta de voltar à grafia Gothenburg."},{"page_url":"https://ceb.wikipedia.org/wiki/Gallinago_stricklandii","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Gallinago_stricklandii_Hullmandel.jpg","page_title":"Gallinago stricklandii","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Gray ni adtong 1845 ang Gallinago stricklandii. Ang Gallinago stricklandii sakop sa kahenera nga Gallinago sa kabanay nga Scolopacidae. Giklaseklase sa IUCN ang espesye sa duolang mibahad. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://it.wikipedia.org/wiki/Trasporti_in_Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Austria_1999_CIA_map.jpg","page_title":"Trasporti in Austria","context_page_description":"Questa voce raccoglie le principali tipologie di trasporti in Austria"},{"page_url":"https://ceb.wikipedia.org/wiki/Abengibre_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Albacete_Abengibre_Mapa_municipal.png","page_title":"Abengibre (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Abengibre sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Albacete ug rehiyon sa Castilla-La Mancha, sa sentro nga bahin sa nasod, 230 km sa habagatan-sidlakan sa Madrid ang ulohan sa nasod. 651 metros ibabaw sa dagat kahaboga ang nahimutangan sa Abengibre, ug adunay 991 ka molupyo.\\nAng yuta palibot sa Abengibre kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 689 ka metro ug 1.0 km sa sidlakan sa Abengibre. Dunay mga 9 ka tawo kada kilometro kwadrado sa palibot sa Abengibre may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Casas Ibáñez, 9.4 km sa amihanan-sidlakan sa Abengibre. Hapit nalukop sa kaumahan ang palibot sa Abengibre. Sa rehiyon palibot sa Abengibre, mga bungtod talagsaon komon.\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 16 °C. Ang kinainitan nga bulan Hulyo, sa 30 °C, ug ang kinabugnawan Disyembre, sa 4 °C. Ang kasarangang pag-ulan 456 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 70 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 14 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_North_Norfolk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/St_John_the_Baptist%27s_church%2C_Trimingham_-_geograph.org.uk_-_1555132.jpg","page_title":"Grade II* listed buildings in North Norfolk","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of North Norfolk in Norfolk."},{"page_url":"https://pl.wikipedia.org/wiki/Herb_Kostrzyna_nad_Odr%C4%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/POL_Kostrzyn_nad_Odr%C4%85_COA.svg","page_title":"Herb Kostrzyna nad Odrą","context_page_description":"Herb Kostrzyna nad Odrą przedstawia tarczę herbową, nad którą znajduje się korona z blankowanych murów miejskich z czerwonej cegły. Tarcza jest dwudzielna w słup. W polu heraldycznie prawym umieszczona jest połowa czerwonego orła brandenburskiego na białym tle. W polu heraldycznie lewym na błękitnym tle znajduje się srebrna ryba w słup.\\nPodobny herb ma dawna dzielnica Kostrzyna nad Odrą, niemiecka miejscowość Küstrin-Kietz."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%AD%A6%E9%9B%84%E6%BA%AB%E6%B3%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Takeo_Hot_Spring_from_Sakurayama_Park.jpg","page_title":"武雄溫泉","context_page_description":"武雄温泉是佐贺县武雄市的温泉，和嬉野温泉并称县内的二大温泉。"},{"page_url":"https://zh.wikipedia.org/wiki/2016%E5%B9%B4%E4%BA%8C%E5%8D%81%E5%9B%BD%E9%9B%86%E5%9B%A2%E6%9D%AD%E5%B7%9E%E5%B3%B0%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/201606_Miniscaping_for_G20_at_Hangzhoudong_Station.jpg","page_title":"2016年二十国集团杭州峰会","context_page_description":"2016年二十国集团杭州峰会是二十国集团第十一次领导人峰会。2016年9月4日至5日在浙江省杭州市举行。这是中国首次举办二十国集团领导人峰会，也是继韩国举办2010年二十国集团首尔峰会之后第二次在亚洲国家举办这项峰会。\\n中国把2016年峰会主题确为“构建创新、活力、联动、包容的世界经济”。中方从创新增长方式、完善全球经济金融治理、促进国际贸易和投资、推动包容联动式发展4个领域进行峰会筹备工作。"},{"page_url":"https://es.wikipedia.org/wiki/Etterbeek","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Etterbeek_-Cloches.jpg","page_title":"Etterbeek","context_page_description":"Etterbeek es uno de los 19 municipios que forman la región federal de la Región de Bruselas-Capital. El 1 de enero de 2019, contaba con 48.367 habitantes con una superficie de 3,1552 km² (o sea 15.173 habitantes/km²). Su código postal es el 1040.\\nLimita con los municipios de Bruselas, Ixelles, Auderghem, Woluwe-Saint-Pierre, Woluwe-Saint-Lambert y Schaerbeek."},{"page_url":"https://ja.wikipedia.org/wiki/155%E4%B8%81%E7%9B%AE%E9%A7%85_(IND%E3%82%B3%E3%83%B3%E3%82%B3%E3%83%BC%E3%82%B9%E7%B7%9A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/155_Sta_BD_jeh.jpg","page_title":"155丁目駅 (INDコンコース線)","context_page_description":"155丁目駅もしくは155丁目-8番街駅はニューヨーク市地下鉄INDコンコース線の駅である。マンハッタン区ハーレムとワシントンハイツに掛かる西155丁目とフレデリック・ダグラス・ブールバードの交差点付近、ポロ・グラウンズ・タワーズの地下に位置し、B系統がラッシュ時のみ、D系統がラッシュ時に混雑方向へ向かう列車以外の全ての列車が停車する。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_XVI","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Gregorius_XVI_-Franceso_Podesti.jpg","page_title":"Григорий XVI","context_page_description":"Григорий XVI — Папа Римский с 2 февраля 1831 года по 1 июня 1846 года."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D8%B1%DA%86_%D8%A7%D9%86%D8%AB%D9%88%D9%86%D9%89_%D8%AF%D9%88%D9%86%D8%AF%D9%8A%D8%B1%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/George_A._Dondero_%28Michigan_Congressman%29.jpg","page_title":"چورچ انثونى دونديرو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچورچ انثونى دونديرو كان محامى من امريكا."},{"page_url":"https://sk.wikipedia.org/wiki/M%C4%9Brunice","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Kostel_Merunice.jpg","page_title":"Měrunice","context_page_description":"Měrunice je obec v Česku v okrese Teplice v Ústeckom kraji. 1. januára 2012 tu žilo 325 obyvateľov, z toho 164 mužov a 161 žien, pričom priemerný vek v obci bol 39,9 roka."},{"page_url":"https://en.wikipedia.org/wiki/Underground_city","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Tenjin_Chikagai%28Tenjin_Underground_City%29_-_01.JPG","page_title":"Underground city","context_page_description":"An underground city is a series of linked subterranean spaces that may provide a defensive refuge; a place for living, working or shopping; a transit system; mausolea; wine or storage cellars; cisterns or drainage channels; or several of these.\\nThe term may also refer to a network of tunnels that connects buildings beneath street level that may house office blocks, shopping malls, metro stations, theatres, and other attractions. These passages can usually be accessed through the public space of any of the buildings connecting to them, and sometimes have separate entries as well. This latter definition encompasses many modern structures, whereas the former more generally covers tunnel systems from ancient times to the present day.\\nUnderground cities are especially functional in cities with very cold or hot climates, because they permit activities to be comfortably accessible year round without regard to the weather. Underground cities are similar in nature to skyway systems and may include some buildings linked by skyways or above-ground corridors rather than underground.\\nSome cities also have tunnels that have been abandoned."},{"page_url":"https://en.wikipedia.org/wiki/Great_Northern_Expedition","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Johann_Georg_Gmelin_%28Ausschnitt%29.jpg","page_title":"Great Northern Expedition","context_page_description":"The Great Northern Expedition or Second Kamchatka expedition was one of the largest exploration enterprises in history, mapping most of the Arctic coast of Siberia and some parts of the North American coastline, greatly reducing \\"white areas\\" on maps. It was conceived by Russian Emperor Peter I the Great, but implemented by Russian Empresses Anna and Elizabeth. The main organiser and leader of the expedition was Vitus Bering, who earlier had been commissioned by Peter I to lead the First Kamchatka expedition. The Second Kamchatka Expedition lasted roughly from 1733–1743 and later was called the Great Northern Expedition due to the immense scale of its achievements.\\nThe goal was to find and map the eastern reaches of Siberia, and hopefully the western shores of North America. Peter I had a vision for the 18th-century Russian Navy to map a Northern Sea Route from Europe to the Pacific. This far-reaching endeavour was sponsored by the Admiralty College in St. Petersburg.\\nWith over 3,000 people directly and indirectly involved, the Second Kamchatka Expedition was one of the largest such projects in history."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9giment_de_Brie_(licenci%C3%A9_en_1762)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/R%C3%A9g_de_Brie_1684.png","page_title":"Régiment de Brie (licencié en 1762)","context_page_description":"Le régiment de Brie est un régiment d’infanterie du Royaume de France créé en 1684."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%99%D7%98%D7%9C_%D7%A4%D7%95%D7%9C%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Fuller_projection_with_Tissot%27s_indicatrix_of_deformation.png","page_title":"היטל פולר","context_page_description":"היטל פולר או מפת פולר או מפת דימקסיון הוא מפת עולם בצורת היטל של כדור הארץ על שטחו של פאון. רוב שטח הפאון שומר על הפרופורציונליות שקיימת על פני הכדור. בכל פאה נמצא אזור ימי או יבשתי נרחב שצורתו וגודלו היחסי נשמרים. את הפאות ניתן לפתוח לצורות מישוריות שונות המאופיינות בקיטועים רבים כך שלמפה המתקבלת אין כיווני מעלה-מטה. בניגוד להיטלים אחרים, הוא נועד לייצג את כדור הארץ בשלמותו בלבד.\\nאת המפה המציא על האדריכל והפילוסוף האמריקאי ריצ'רד באקמינסטר פולר, מפתח הכיפה הגאודזית. היא פורסמה לראשונה ב-1 במרץ 1943 בכתב העת לייף כהיטל על קובוקטהדרון. המאמר שנקרא \\"עולם הדימקסיון של ר. באקמינסטר פולר\\" כלל דוגמאות וביניהן אחת לגזירה עם הוראות להכנת גלובוס, או מפה שטוחה המסודרת כרצון המכין כדי להאיר אספקטים מסוימים בגאוגרפיה. המפה נרשמה כפטנט ב-1946. ב 1954 יצר פולר גרסה עם היטל על עשרימון שפאותיו שונו מעט באופן שווה. גרסה זו כונתה בפי פולר 'מפת עולם אוויר-אוקיינוס' והיטל פולר מזוהה היום בעיקר איתה. 'השם 'דימקסיון', ראשי תיבות של 'דינאמיות מקסימום מתח', ניתן על ידי פולר למספר המצאות שונות: בית דימקסיון, מכונית דימקסיון, שנת דימקסיון ויומן דימקסיון בו רשם פולר את קורותיו."},{"page_url":"https://de.wikipedia.org/wiki/Pfannkuch_GmbH_%26_Co._Supermarkt_KG","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Kolossa_Zeichen.png","page_title":"Pfannkuch GmbH & Co. Supermarkt KG","context_page_description":"Die Pfannkuch GmbH & Co. Supermarkt KG war eine Tochtergesellschaft der Pfannkuch-Unternehmensgruppe in Karlsruhe mit über 200 Filialen in Süddeutschland und Sachsen. Sie wurde 1896 in Pforzheim gegründet und 1998 an die Spar Handelsgesellschaft verkauft."},{"page_url":"https://de.wikipedia.org/wiki/Jakub_Rze%C5%BAniczak","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Jakub_Rzezniczak_2009.jpg","page_title":"Jakub Rzeźniczak","context_page_description":"Jakub Rzeźniczak ist ein polnischer Fußballspieler."},{"page_url":"https://sv.wikipedia.org/wiki/Fenghuang,_Xiangxi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/1_fenghuang_ancient_town_hunan_china.jpg","page_title":"Fenghuang, Xiangxi","context_page_description":"Fenghuang är ett härad som är beläget i den autonoma prefekturen Xiangxi för tujia- och miao-folken i Hunan-provinsen i södra Kina.\\nHäradssätet i Fenghuang är känt för sin arkitektur från Mingdynastin och Qingdynastin och har tagits upp i Världsarvet av UNESCO. Ungefär hälften av invånarna i Fenghuang tillhör miao eller tujia-folken. Orten är också känd som författaren Shen Congwens hembygd, varifrån han ofta hämtat motiv till sitt författarskap."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Vancouver","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Melville_residential_tower.jpg","page_title":"List of tallest buildings in Vancouver","context_page_description":"Vancouver, British Columbia, in Canada has more high-rise buildings per capita than most North American metropolitan centres with populations exceeding 1,000,000. Vancouver's population density is the 4th-highest in North America and the city has more residential high-rises per capita than any other city on the continent.\\nThere are roughly 650 high-rise buildings that equal or exceed 35 m, and roughly 50 buildings that equal or exceed 100 metres. Vancouver has 27 protected view corridors which limit the construction of tall buildings which interfere with the line of sight to the North Shore Mountains, the downtown skyline, and the waters of English Bay and the Strait of Georgia. Almost all of Vancouver's buildings that exceed 100 metres in height are located within Downtown Vancouver.\\nThe tallest building in Vancouver is the 62-storey, 201 m Living Shangri-La and represents the city's efforts to add visual interest into Vancouver's skyline. The Private Residences at Hotel Georgia completed in 2012 at 157 m and 48 stories is currently the third-tallest in the city. One Wall Centre, at 150 m tall, with 48 storeys, is currently the city's fourth tallest building."},{"page_url":"https://id.wikipedia.org/wiki/Paros","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Paros_Panorama.png","page_title":"Paros","context_page_description":"Paros merupakan sebuah pulau di Yunani. Pulau ini terletak di bagian selatan. Tepatnya di region Aegean Utara. Pulau ini memiliki luas wilayah 196,3 km². Dengan memiliki jumlah penduduk sebesar 12.853 jiwa.\\nPulau ini memiliki kepadatan penduduk sebesar 65 jiwa/km²."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%BE%D1%80%D0%B0%D1%85_%D0%BD%D0%B0_%D1%80%D0%B0%D1%81%D0%BA%D1%80%D1%81%D0%BD%D0%B8%D1%86%D0%B8_(%D0%9C%D0%B0%D0%BB%D0%B8_%D0%9F%D0%BE%D0%BF%D0%BE%D0%B2%D0%B8%D1%9B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Zapis-0678-Mali-Popovic-orah_20160626_2016.jpg","page_title":"Запис орах на раскрсници (Мали Поповић)","context_page_description":"Запис орах на раскрсници (Мали Поповић) се налази на парцели чији је власник Град Јагодина."},{"page_url":"https://nl.wikipedia.org/wiki/Joep_Francotte","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Joep_Francotte.jpg","page_title":"Joep Francotte","context_page_description":"Wilhelm Joseph Francotte was een Nederlands verzetsstrijder.\\nDe dakdekker Joep Francotte uit Vaals was tijdens Duitse invasie in 1940 dienstplichtig soldaat bij het Depot Geneeskundige Troepen in Amsterdam. Hij werd in Duitsland verplicht te werk gesteld maar op 27 maart 1943 in Aken gearresteerd wegens Fernbleiben von der Arbeit en na zijn veroordeling overgebracht naar Düsseldorf. Tijdens een bombardement in de nacht van 11 op 12 juni 1943 wist hij te ontvluchten en kwam uiteindelijk weer in Amsterdam terecht. Daar heeft hij voor het verzetsblad Je Maintiendrai gewerkt voordat hij zich in de zomer van 1944 bij de Knokploeg Zuid-Limburg van het verzet aansloot.\\nNa de arrestaties in Weert, waarbij op 21 juni 1944 bijna de volledige top van de Limburgse L.O. was gearresteerd en de „klap van Wittem“, waarbij op van 21 juli 1944 tien mensen van het district Gulpen van de L.O. waren gearresteerd, was een van de resultaten van de daaropvolgende folterverhoren, dat de Sipo Maastricht onder leiding van Richard Nitsch en Max Strobel op 22 juli 1944 in Simpelveld een huis binnenvielen. Zij hoopten daar Francottes vriend Sjeng Coenen te arresteren. Op dat moment werd net diens oom begraven."},{"page_url":"https://bg.wikipedia.org/wiki/Conus_inscriptus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Conus_inscriptus_001.jpg","page_title":"Conus inscriptus","context_page_description":"Conus inscriptus е вид охлюв от семейство Conidae. Видът не е застрашен от изчезване."},{"page_url":"https://es.wikipedia.org/wiki/Worli","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Mumbai_03-2016_11_Haji_Ali_Dargah.jpg","page_title":"Worli","context_page_description":"Worli en marathi: मराठी, en el pasado también conocido como Varli, Worlée, Warli​ y por los portugueses Vorli o Varel, es un área urbana de la ciudad india de Bombay, que se encuentra en la parte noroeste de la península que forma la parte baja y centro de la ciudad. En el pasado fue una de las siete islas que a través de los aterramientos marítimos se unieron para formar el actual territorio de Bombay.\\nDesde finales de los años 1970, Worli es una de las áreas de oficinas más ocupadas de Bombay, donde muchas grandes empresas tienen sus sedes o sus representaciones."},{"page_url":"https://en.wikipedia.org/wiki/2003_NASCAR_Winston_Cup_Series","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/MattKenseth%26KevinHarvick.jpg","page_title":"2003 NASCAR Winston Cup Series","context_page_description":"The 2003 NASCAR Winston Cup Series was the 55th season of professional stock car racing in the United States and the 32nd modern-era Cup Series season. The season began on February 8 at the Daytona International Speedway with the Budweiser Shootout and ended on November 16 at Homestead-Miami Speedway with the Ford 400. Despite only winning one race throughout the whole season, Matt Kenseth, driving the No.17 Ford for Roush Racing, was strongly consistent following the lone win, and was crowned the Winston Cup champion. His only win came in the third race of the 36 race season. Chevrolet took home the NASCAR Manufacturers' Championship after capturing 19 wins and 264 points over second-place finisher Dodge, who had nine wins and 203 points. Ford finished the year third with seven wins and 200 points, and Pontiac finished fourth with one win and 125 points.\\nThis was the final year for Winston being the title sponsor of the Cup Series. Winston had been the title sponsor for NASCAR since 1971. After 33 years, Winston decided not to renew its sponsorship."},{"page_url":"https://hu.wikipedia.org/wiki/Asz%C3%B3_Tar%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Taro_Aso_in_World_Economic_Forum_Annual_Meeting_in_Davos_%28cropped%29.jpg","page_title":"Aszó Taró","context_page_description":"Aszó Taró japán politikus, a Liberális Demokrata Párt korábbi elnöke, Japán volt miniszterelnöke. A Japán Országgyűlés választotta meg kormányfőnek 2008. szeptember 24-én és Akihito császár még aznap feleskette őt és kormányát. A 2009-es japán parlamenti választásokon pártja vereséget szenvedett és így elvesztette többségét a parlament alsóházában, amely a miniszterelnök személyéről dönt. 2009. szeptember 16-án mondott le és az Országgyűlés azonnal ki is jelölte utódját, Hatojama Jukiót.\\nAszó politikai családban született. Iskoláit Japánban, az Egyesült Államokban és Angliában végezte. Politikai pályája 1979-ben indult, amikor képviselő lett a parlament alsóházában. Több posztot is betöltött: volt már bel- és külügyminiszter az Abe- és Koizumi-kormányokban, de az LDP főtitkára is. Aszó jelenleg Fukuoka prefektúra 8. kerületének képviselője.\\n2012. december 26-tól Abe Sinzó második kabinetjében miniszterelnök-helyettes és pénzügyminiszter."},{"page_url":"https://nl.wikipedia.org/wiki/Bellesguard","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Bellesguard0006.jpg","page_title":"Bellesguard","context_page_description":"Het herenhuis Bellesguard, ook wel Casa Figueras genoemd, werd gebouwd tussen 1900 en 1909 aan de Carrer de Bellesguard 16-20 in Barcelona voor Doña María Sagués volgens ontwerpen van de Spaans/Catalaanse architect Antoni Gaudí.\\nZoals vele van de bouwwerken van Gaudí werd het huis niet onder zijn leiding geheel voltooid. De architect Domènech Sugrañes nam van Gaudí de fakkel over en vervolmaakte in 1917 de bouw."},{"page_url":"https://vi.wikipedia.org/wiki/Karl_XII_c%E1%BB%A7a_Th%E1%BB%A5y_%C4%90i%E1%BB%83n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Mazepa2.JPG","page_title":"Karl XII của Thụy Điển","context_page_description":"Karl XII, còn được biết đến dưới tên gọi Carl XII, là một thành viên của Hoàng tộc Deux-Ponts, làm vua của Đế quốc Thụy Điển từ năm 1697 đến khi qua đời năm 1718. Tuy là một trong những vị thống soái lỗi lạc nhất của châu Âu trong cái thời đại xưng hùng xưng bá của vua Pháp Louis XIV, ông cũng bị oán ghét do chiến bại về sau và làm kiệt quệ Thụy Điển. Ông lên nắm quyền hành chuyên chế sau khi các quan Nhiếp chính trị vì Thụy Điển chỉ trong một thời gian ngắn.\\nLà một trong những vị anh hùng tiêu biểu trong lịch sử thế giới từ cổ chí kim, dưới triều đại của ông, quân đội Thụy Điển giành chiến thắng lẫy lừng trong một loạt cuộc chiến tranh đầu tiên, chẳng hạn như tại Narva. Ông đã đẩy đất nước vào cuộc Đại chiến Bắc Âu chống liên quân Nga - Đan Mạch - Ba Lan, tiến hành chinh phạt một số nước trong liên quân chống Thụy Điển với những chiến thắng vẻ vang, nhưng rồi thảm bại và Thụy Điển cuối cùng đã từ một cường quốc bị xuống dốc rõ rệt, mất nhiều đất đai, và tạo cơ hội cho Đế quốc Nga vươn lên. Cuối cùng, ông tử trận khi tiến hành vây hãm một pháo đài của quân Đan Mạch vào năm 1718.\\nChính ông đã hoàn thiện những cải cách củng cố chế độ quân chủ chuyên chế do vua cha đề xướng."},{"page_url":"https://sv.wikipedia.org/wiki/Euphorbia_caducifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Euphorbia_caducifolia.jpg","page_title":"Euphorbia caducifolia","context_page_description":"Euphorbia caducifolia är en törelväxtart som beskrevs av Henry Haselfoot Haines. Euphorbia caducifolia ingår i släktet törlar, och familjen törelväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B7%B4%E6%96%AF%E9%99%B6%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bastau_kanalisiert.jpg","page_title":"巴斯陶河","context_page_description":"巴斯陶河，是德國的河流，位於該國西部，處於北萊茵-威斯伐倫州，屬於威悉河的左支流，河道全長19.2公里，流域面積116.1平方公里。"},{"page_url":"https://en.wikipedia.org/wiki/Edward_Leo_Krumpelmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/2011_0830_monument_in_Maryknoll_Secondary_School.jpg","page_title":"Edward Leo Krumpelmann","context_page_description":"Father Edward Leo Krumpelmann was an American Maryknoll Catholic priest, missionary, relief worker, medical aid worker and educator working in Kongmoon, Guangdong Province, China and Hong Kong in the mid 20th century. He served as vice rector of Mountain View, California, and established the Catholic parish of Kwun Tong, Hong Kong, and the local Catholic school whose buildings hosted the parish church."},{"page_url":"https://en.wikipedia.org/wiki/Tourism_in_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Whitehaven_Beach%2C_Whitsunday_Island%2C_Queensland.jpg","page_title":"Tourism in Australia","context_page_description":"Tourism in Australia is an important component of the Australian economy, and consists of domestic and international components. In the financial year 2014/15, tourism represented 3.0% of Australia's GDP contributing A$47.5 billion to the national economy. In 2019, the contribution was a record $44.6 billion. Domestic tourism is a significant part of the tourism industry, representing 73% of the total direct tourism GDP.\\nIn calendar year 2015, there were 7.4 million international visitors in Australia, and 8.6 million in the year to June 2019, an increase of 3%. Tourism employed 580,800 people in Australia in 2014–15, 5% of the workforce. About 43.7% of persons employed in tourism were part-time. Tourism also contributed 8.0% of Australia's total export earnings in 2010–11.\\nPopular Australian destinations include the coastal cities of Sydney, Brisbane and Melbourne, as well as other high-profile destinations including regional Queensland, the Gold Coast and the Great Barrier Reef, the world's largest reef. Uluru and the Australian outback are other popular locations, as is the Tasmanian wilderness."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D9%87%D8%B1_%D9%BE%D8%B1%D9%8A%D8%AF%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Varangu_Siniallikad.JPG","page_title":"نهر پريدى","context_page_description":"پريدى هوا نهر فى استونيا"},{"page_url":"https://en.wikipedia.org/wiki/Mbaluko","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Mwaya_Beach%2C_Malawi.jpg","page_title":"Mbaluko","context_page_description":"Mbaluko is a village in central Malawi near Lake Malawi. It is located in Salima District in the Central Region approximately 1 mile north of Nkhotakota."},{"page_url":"https://en.wikipedia.org/wiki/List_of_palaces_in_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Viceregal_Palace%2C_Ananda_-_In_the_Himalayas%2C_Narendra_Nagar%2C_Uttarakhand.jpg","page_title":"List of palaces in India","context_page_description":"List of palaces in India"},{"page_url":"https://en.wikipedia.org/wiki/List_of_awards_and_nominations_received_by_G-Dragon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/G-Dragon_acrofan_crop.JPG","page_title":"List of awards and nominations received by G-Dragon","context_page_description":"G-Dragon is a South Korean rapper, singer-songwriter, record producer, and a member of South Korean boy band Big Bang formed by YG Entertainment in 2006. He has won numerous awards and recognitions for his work in both the music and fashion industry.\\nG-Dragon won Album of the Year at both the 2009 Mnet Asian Music Awards and Melon Music Awards for his debut studio album Heartbreaker. In 2013, he won Record of the Year at the Seoul Music Awards and Digital Bonsang at the Golden Disc Awards for his first extended play One of a Kind, and also Best Rap/Hip-hop Song at the Korean Music Awards for his single of the same name. At the 2013 Mnet Asian Music Awards, he was the most awarded and nominated act winning four out of six nominations including Artist of the Year, Best Male Artist, and Best Music Video.\\nG-Dragon won the Style Icon of the Year Award in 2013, and was also honored with the same award in 2016. In 2015, he was chosen by GQ Korea as their Man of the Year. In 2016, he was recognised by the Ministry of Culture, Sports and Tourism for his achievements in the entertainment industry and given the Korean Prime Minister Recognition Award."},{"page_url":"https://en.wikipedia.org/wiki/Jura%E2%80%93Simplon_Railways","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Jura-Simplon_-_Touristenkarte.jpg","page_title":"Jura–Simplon Railways","context_page_description":"The Jura–Simplon Railways, was a railway company that was formed in 1890. It was nationalised in 1903 as the largest railway company in Switzerland and integrated into the Swiss Federal Railways."},{"page_url":"https://ast.wikipedia.org/wiki/Hort_del_Cura","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Huerto_del_Cura%2C_Elche%2C_Espa%C3%B1a%2C_2014-07-05%2C_DD_31.JPG","page_title":"Hort del Cura","context_page_description":"El Güertu del Cura ye un Xardín botánicu allugáu na ciudá d'Elx, na provincia d'Alicante.\\nEl xardín tien unos 13.000 m² densamente pobláu de palmeres. Nél viven alredor de 1000 palmeres, na so mayoría datileres.\\nAmás de palmeres, crecen plantes de los güertos mediterráneos, como granaos, azofaifos, naranxales, higuera y llimoneros, a los que se fueron añediendo col tiempu plantes d'orixe subtropical y una coleición de cactus.\\nEsti Güertu debe'l so nome al capellán José Castaño Sánchez, que foi'l so propietariu hasta l'añu 1918.\\nYe'l xardín más importante del conxuntu denomináu Palmeral d'Elx, declaráu Patrimoniu de la Humanidá nel añu 2000."},{"page_url":"https://nl.wikipedia.org/wiki/Corica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Corica_soborna_Achilles_162.jpg","page_title":"Corica","context_page_description":"Corica is een geslacht van straalvinnige vissen uit de familie van haringen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%9F%D1%80%D0%B8%D0%BD%D1%86%D0%B5%D0%BD%D0%B3%D0%BE%D1%84_(%D0%94%D0%B5%D0%BB%D1%84%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Maria_of_Nassau.jpg","page_title":"Музей Принценгоф (Делфт)","context_page_description":"Музей Принценгоф — історично-меморіальний і художній музей в місті Делфт."},{"page_url":"https://tr.wikipedia.org/wiki/Al-Taghreba_al-Falastenya","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/J_S_%28cropped%29.jpg","page_title":"Al-Taghreba al-Falastenya","context_page_description":"El-Taghreba el-Falastenya, Filistin davasıyla ilgili en önemli eserlerden biri olarak kabul edilen, \\"Suriye Uluslararası\\" şirketinin yapımcılığını üstlendiği, 2004 Suriye TV dizisi. Dizi tamamen Suriye'de çekildi. Dizi, Filistin'deki İngiliz işgali sırasında fakir bir Filistinli ailenin çektiği acılar ve ardından 1930'lar ile 1960'lar arasında Yahudi çetelerinin katliamları etrafında dönen dramatik bir destan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%82%D0%B8%D0%BD%D0%B5%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Castineta_village.jpg","page_title":"Кастинета","context_page_description":"Кастинета — коммуна во Франции, находится в регионе Корсика. Департамент коммуны — Верхняя Корсика. Входит в состав кантона Голо-Морозалья. Округ коммуны — Корте.\\nКод INSEE коммуны — 2B082."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Wei%C3%9Fenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Saalstra%C3%9Fe_20_Wei%C3%9Fenfels_20180702_001.jpg","page_title":"Liste der Kulturdenkmale in Weißenfels","context_page_description":"In der Liste der Kulturdenkmale in Weißenfels sind alle Kulturdenkmale der Gemeinde Weißenfels und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BD%D1%86%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Menantol1.jpg","page_title":"Корнці","context_page_description":"Ко́рнці, ко́рнуольці, ке́рновці — народ кельтського походження, основне населення історичної області Корнвол на південному заході Великої Британії.\\nМешканці Кернова відокремлюють себе від англійців і, натомість, мають багато спільного з жителями інших кельтських частин Сполученого Королівства, насамперед Уельсу, а також із кельтськими націями Європи."},{"page_url":"https://en.wikipedia.org/wiki/History_of_U.S._foreign_policy,_1776%E2%80%931801","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Erkenning_onafhankelijkheid_Verenigde_Staten_foto2.JPG","page_title":"History of U.S. foreign policy, 1776–1801","context_page_description":"The history of U.S. foreign policy from 1776 to 1801 concerns the foreign policy of the United States during the twenty five years after the United States Declaration of Independence. For the first half of this period, the U.S. foreign policy was directed by the Second Continental Congress and the Congress of the Confederation. After the ratification of the United States Constitution in 1788, U.S. foreign policy was conducted by the presidential administrations of George Washington and John Adams. The inauguration of Thomas Jefferson in 1801 marked the start of the next era of U.S. foreign policy.\\nAfter the American Revolution began in 1775, the United States courted European powers for help in the war against the Kingdom of Great Britain. Benjamin Franklin negotiated an alliance with the Kingdom of France in 1778, and the French played a decisive role in the American victory in the war. Enlightenment-era Spain and the Dutch Republic also aided the U.S. cause, while other European countries joined the First League of Armed Neutrality to protect neutral shipping against the Royal Navy."},{"page_url":"https://nl.wikipedia.org/wiki/Liechtenstein_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Liechtenstein_Palais_Wien5.jpg","page_title":"Liechtenstein Museum","context_page_description":"Het Liechtenstein Museum is een museum in Wenen, Oostenrijk, vernoemd naar het vorstelijk huis van Liechtenstein, een van de oudste adellijke families van Europa.\\nHet museum heeft verschillende locaties, waaronder het Liechtenstein Garden Palace in Alsergrund en het Liechtenstein City Palace. Het Garden Palace werd gebouwd door prins Johan Adam Andreas van Liechtenstein, die de opdracht voor het ontwerp en de bouw aan Domenico Egidio Rossi gaf. Het gebouw werd voltooid in 1700."},{"page_url":"https://it.wikipedia.org/wiki/Damasco","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/200712_syria-6.jpg","page_title":"Damasco","context_page_description":"Damasco è la capitale della Siria. Città storica, nata nello stesso periodo delle civiltà mesopotamiche, in origine la sua popolazione era costituita da genti di stirpe semitica orientale, successivamente note come Aramei. È considerata, al pari di Gerico, la più antica città del mondo fra quelle abitate in maniera continuativa perché secondo gli archeologi le prime testimonianze di abitazioni a Damasco risalirebbe ad 11 000 anni fa. La capitale di questo Stato potrebbe quindi essere la città più antica del mondo tuttora esistente. Con 1 949 000 abitanti è la città più popolata, mentre l'area metropolitana, con oltre 5 000 000 di abitanti, è la più popolata della Siria, a seguito del declino della popolazione di Aleppo a causa della battaglia per la città.\\nCittà bizantina fino alla conquista araba, attuata dall'esercito musulmano guidato da Khālid b. al-Walīd, da Abū ʿUbayda b. al-Jarrāḥ, Yazīd b. Abī Sufyān, Shuraḥbīl b. Ḥasana e da ʿAmr ibn al-ʿĀṣ. Damasco si arrese per accordo, conservando così la libertà di culto e i titoli di proprietà dei suoi abitanti."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%86%D8%A7%D8%A8%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Annabella_in_Bridal_Suite_trailer.jpg","page_title":"آنابلا","context_page_description":"آنابلا یک هنرپیشه اهل فرانسه بود. وی بین سال‌های ۱۹۲۷ تا ۱۹۵۴ میلادی فعالیت می‌کرد.\\nاز فیلم‌ها یا برنامه‌های تلویزیونی که وی در آن نقش داشته است می‌توان به ناپلئون اشاره کرد."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Wawrzy%C5%84ca_w_Babimo%C5%9Bcie","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Babimost%2C_Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Wawrzy%C5%84ca_-_fotopolska.eu_%28120864%29.jpg","page_title":"Kościół św. Wawrzyńca w Babimoście","context_page_description":"Kościół św. Wawrzyńca w Babimoście – katolicka świątynia w Babimoście, siedziba parafii pod wezwaniem św. Wawrzyńca."},{"page_url":"https://is.wikipedia.org/wiki/B%C3%A6jarins_beztu_pylsur","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/B%C3%A6jarins_bestu.jpg","page_title":"Bæjarins beztu pylsur","context_page_description":"Bæjarins beztu pylsur eða einfaldlega Bæjarins beztu er pylsuvagn í miðbæ Reykjavíkur, Hafnarstræti 17.\\nBæjarins beztu hafa einnig verið eftirsóttar af þeim sem sækja borgina heim og meðal þeirra sem þar hafa stýft pylsu úr hnefa er til dæmis Bill Clinton, fyrrverandi forseti Bandaríkjanna, og hljómsveitin Metallica. Bæjarins beztu lentu á lista breska blaðsins The Guardian yfir bestu sölustanda skyndimats í Evrópu árið 2006 og lenti þar í öðru sæti. Í fyrsta sæti var skoskur hafragrauta­standur."},{"page_url":"https://pl.wikipedia.org/wiki/Nadwieprza%C5%84ski_Park_Krajobrazowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Starorzecze_Wieprza.jpg","page_title":"Nadwieprzański Park Krajobrazowy","context_page_description":"Nadwieprzański Park Krajobrazowy – park krajobrazowy położony w województwie lubelskim na Płaskowyżu Świdnickim oraz Obniżeniu Dorohuckim. Ciągnie się wzdłuż środkowego biegu Wieprza, od ujścia Giełczwi do ujścia Bystrzycy.\\nPoczątkowo zajmował powierzchnię 44,32 km², zaś jego otulina liczyła 130,59 km². Po powiększeniu liczy 62,28 km², a otulina 114,73 km².\\nWieprz częściowo płynie przełomami o stromych zboczach, których wysokość dochodzi niekiedy do 25 m. Miejscami na zboczach widać odsłonięte utwory kredowe.\\nWystępują tu bory sosnowe oraz lasy łęgowe. Na nasłonecznionych zboczach rosną rośliny kserotermiczne, m.in. miłek wiosenny i zawilec wielokwiatowy. Na licznych łąkach występują storczyk szerokolistny, czosnek kątowaty oraz kosaciec syberyjski.\\nPlanuje się utworzenie dwóch rezerwatów leśnych na terenie Parku oraz dwóch rezerwatów florystycznych na terenie otuliny – „Bilsko” i „Uroczysko Jezioro”."},{"page_url":"https://pt.wikipedia.org/wiki/Deli","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Jawaharlal_Nehru_Stadium1.jpg","page_title":"Deli","context_page_description":"Deli, Déli ou Delhi, conhecida localmente como Dilli, é a segunda maior e mais importante cidade da Índia, atrás apenas de Bombaim. Situada no norte do país, engloba a região de Nova Deli, a capital do país. Com uma população estimada em 2011 em pouco mais de 11 milhões de habitantes, a cidade de Deli figura a segunda maior cidade da Índia, e a oitava maior do mundo — porém se consideramos seu complexo metropolitano expandido, conhecido como a Região da Capital Nacional, que engloba partes dos estados de Haryana, Uttarakhand, Utar Pradexe e Rajastão, a população da cidade sobe para 23,2 milhões de habitantes, a maior do país e a segunda maior do mundo, distribuída por uma área estimada em 1 483 km².\\nDeli tornou-se a capital do Império Mogol em 1638. Quando o Império Britânico passou a dominar grande parte da Índia, com Deli conquistada em 1803, Calcutá se tornou a capital. Voltou a ser capital administrativa do Reino Unido de 1912."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mosques_in_the_Arab_League","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Egypt.Aswan.Mosque.02.jpg","page_title":"List of mosques in the Arab League","context_page_description":"This is a list of mosques in the Arab League.\\nGroup"},{"page_url":"https://en.wikipedia.org/wiki/Civil_parishes_in_Cumbria","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Thornleigh_Hotel%2C_The_Esplanade%2C_Grange-over-Sands_-_geograph.org.uk_-_1520749.jpg","page_title":"Civil parishes in Cumbria","context_page_description":"A civil parish in England is the lowest unit of local government. There are 284 civil parishes in the ceremonial county of Cumbria, with most of the county being parished, and Allerdale, Copeland, Eden and South Lakeland being entirely parished. At the 2001 census, there were 359,692 people living in those 284 parishes, accounting for 73.8 per cent of the county's population.\\nThe extent of modern Civil parishes are largely geographically based on historic Church of England parish boundaries, which were ecclesiastical divisions that had acquired civil administration powers managed by the Vestry committee."},{"page_url":"https://cs.wikipedia.org/wiki/Sia-men","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Xiamen_newmontage.png","page_title":"Sia-men","context_page_description":"Sia-men je přístavní město při Tchajwanském průlivu v provincii Fu-ťien v jihovýchodní Číně.\\nNa ploše 1640 km² čítá coby druhé největší město provincie Fu-ťien 4,4 milionu obyvatel. V minulých stoletích patřilo k nejdůležitějším přístavům Číny – od roku 1541 sem připlouvali Portugalci a další evropští obchodníci a přes Sia-men proudila většina obchodu s čínským čajem. Právě výslovnost jména pro tento nápoj ve zdejším nářečí jižní Min dala mnoha jazykům výraz pro čaj. Sia-men bylo mezi pěticí přístavních měst, která podle Nankingské smlouvy z roku 1842 musela Čína otevřít zahraničnímu obchodu. V roce 1981 se pak stalo jednou z prvních nově zřízených zvláštních hospodářských zón. V září 2017 se zde uskutečnilo setkání lídrů zemí BRICS.\\nPro svou evropskou architekturu, subtropické podnebí a uvolněnou atmosféru je město oblíbenou turistickou destinací. Místní Siamenská univerzita je jednou z nejlepších čínských vysokých škol a umisťuje se na nejvyšších příčkách v oblíbenosti mezi čínskými studenty. Její kampus, ležící v obvodě S’-ming, je považován za nejkrásnější v celé Číně."},{"page_url":"https://pl.wikipedia.org/wiki/Traczyska","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Traczyska%2C_m%C5%82yn.jpg","page_title":"Traczyska","context_page_description":"Traczyska – osada w Polsce położona w województwie kujawsko-pomorskim, w powiecie brodnickim, w gminie Górzno.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa toruńskiego.\\nW miejscowości zachował się stopień wodny i drewniane zabudowania dawnego młyna."},{"page_url":"https://hu.wikipedia.org/wiki/Benda_Iv%C3%A1n_(fotogr%C3%A1fus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Benda_Iv%C3%A1n.jpg","page_title":"Benda Iván (fotográfus)","context_page_description":"Benda Iván fotográfus, zenész."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D1%83%D1%80%D0%BC%D0%B0%D0%BD%D1%87%D0%B8%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/British_officers_conferring_decoration_for_bravery_upon_Polish_soldiers_of_Murmansk_Battalion_2.jpg","page_title":"Мурманчици","context_page_description":"Мурманчици е наименование за полските военни формирования, воювали против болшевиките в областта на Мурманск и Архангелск, Северна Русия през 1918 – 1919 г. Те се включват в т.нар. Интервенция на Антантата в Руската гражданска война."},{"page_url":"https://uk.wikipedia.org/wiki/Nissan_Pathfinder","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/2014_Nissan_Pathfinder_%28R52_MY14%29_Ti_4WD_wagon_%282015-07-09%29_03.jpg","page_title":"Nissan Pathfinder","context_page_description":"Nissan Pathfinder — позашляховик японської компанії Nissan, виробництво почалося в 1986 році. У багатьох країнах відомий як Nissan Terrano.\\nУсього було випущено три покоління автомобіля.\\nУ сучасній лінійці автобілей Nissan, Pathfinder за розміром займає місце між Murano та Armada або Patrol."},{"page_url":"https://hy.wikipedia.org/wiki/1000_%D6%87_%D5%A1%D5%BE%D5%A5%D5%AC%D5%AB_%D5%AD%D5%A1%D5%B2%D5%AB_%D5%B4%D5%A1%D5%BD%D5%B6%D5%A1%D5%AF%D6%81%D5%A1%D5%AE_NBA_%D5%A2%D5%A1%D5%BD%D5%AF%D5%A5%D5%BF%D5%A2%D5%B8%D5%AC%D5%AB%D5%BD%D5%BF%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Joe_Smith_Lakers1.jpg","page_title":"1000 և ավելի խաղի մասնակցած NBA բասկետբոլիստների ցանկ","context_page_description":"Ստորև ներկայացված ցանկում ներկայացված են այն բասկետբոլիստները, որոնք NBA-ի կարիերայի պարբերական առաջնությունների ընթացքում խաղացել են ավելի քան 1000 խաղ։ Այս անվանակարգի ներկայացուցիչների ամբողջական ցանկը հրապարակված է basketball-reference.com կայքում։"},{"page_url":"https://gl.wikipedia.org/wiki/Tratado_de_Lisboa_(1864)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Fronteira_entre_Galiza_e_Portugal_na_folha_n.%C2%BA_2%2C_parte_1.%C2%AA%2C_da_s%C3%A9rie_de_mapas_de_Jos%C3%A9_de_Castro_L%C3%B3pez_sobre_A_Raia_%281863%29.jpg","page_title":"Tratado de Lisboa (1864)","context_page_description":"No Tratado de Lisboa, tamén coñecido como Tratado de Lindes de Lisboa, asinado o 29 de setembro de 1864, establecéronse os lindes das fronteiras entre España e Portugal actualmente vixentes."},{"page_url":"https://nl.wikipedia.org/wiki/Janine_Turner","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Janine_Turner.jpg","page_title":"Janine Turner","context_page_description":"Janine Turner is een Amerikaanse actrice. Ze werd voor haar rol in Northern Exposure drie keer genomineerd voor een Golden Globe en één keer voor een Emmy Award.\\nTurner speelde zowel in films als vaste rollen in televisieseries. Zo was ze in Northern Exposure 110 afleveringen te zien en in Strong Medicine vijftig.\\nBegin jaren 80 verloofde Turner zich met Alec Baldwin, maar tot een bruiloft kwam het nooit. In november 1997 werd ze moeder. Ze bracht in 2008 het boek Holding Her Head High: 12 Single Mothers Who Championed Their Children and Changed History uit."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%9E%E6%AD%B7%E5%B1%B1%E5%A4%A7%E4%B8%B9%E5%B0%BC%E5%A3%ABEnviro_400","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/RW5136-ATSE46-63R.jpg","page_title":"亞歷山大丹尼士Enviro 400","context_page_description":"亞歷山大丹尼士Enviro 400是一款由英國亞歷山大丹尼士生產的兩軸雙層巴士，它也是亞歷山大丹尼士製造的其中一款Enviro系列巴士。於2005年面世的Enviro 400，主要取代兩車軸的丹尼士三叉戟二型及ALX400車身。"},{"page_url":"https://no.wikipedia.org/wiki/Colin_Kazim-Richards","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Colin_Kazim-Richards_%28Cropped%29.jpg","page_title":"Colin Kazim-Richards","context_page_description":"Colin Kazim-Richards, også kjent som Colin Kâzım eller Kâzım Kâzım i Tyrkia, er en engelskfødt tyrkisk fotballspiller, som spiller for den meksikanske klubben Tiburones Rojos de Veracruz. Kazim-Richards har også kamper for det tyrkiske landslaget."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BD_%D0%A5%D0%B5%D1%80%D1%82%D0%BE%D0%B3,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Fedor_den_Hertog%2C_Bestanddeelnr_920-4844.jpg","page_title":"Ден Хертог, Фёдор","context_page_description":"Фёдор Иван ден Хертог — нидерландский велогонщик, чемпион Олимпийских игр в Мехико в командной шоссейной гонке с раздельным стартом на 104 км."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%94%D6%80%D6%84%D5%BB%D5%A1%D5%B6_%D5%B8%D6%80%D5%B8%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Larus_cachinnans_young_bird.jpg","page_title":"Քրքջան որոր","context_page_description":"Քրքջան որոր, կամ տափաստանային որոր, խոշոր որոր, բնադրում են հիմնականում Ռուսաստանում և Ուկրաինայում՝ Սև և Կասպից ծովերին հարող տարածքներում, իսկ ավելի փոքր չափով՝ Ղազախստանում, Հունգարիայում, Բելառուսում և Լեհաստանում: Այն բնակվում է ծովային ավազոտ լողափերում, ծովային կղզիներում, տափաստանային լճերի և գետերի ափերին: Մինչև վերջերս այն սովորաբար համարվում էր ավելի տարածված արծաթափայլ որորի մեկ կամ մի քանի ենթատեսակ, որի հետ, ինչպես նաև արևելյան ենթատեսակի հետ, արտաքին տեսքի և վարքի մեջ շատ ընդհանրություններ ունի:"},{"page_url":"https://fr.wikipedia.org/wiki/C%C3%A9ramique_grecque_antique","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Aryballos_with_Lions_confronted_Lyon_MBA_X482-54.jpg","page_title":"Céramique grecque antique","context_page_description":"Né au Proche-Orient, l'art de la céramique atteint en Grèce antique un haut niveau de qualité artistique. Il est également un témoignage majeur sur la vie et la culture des anciens Grecs. Les vases grecs nous sont parvenus en grand nombre : même si cela ne représente probablement qu'une part infime de la production de l'époque, plus de 50 000 vases en provenance de la seule Athènes subsistent aujourd'hui.\\nLes vases peints étaient principalement utilisés dans la vie quotidienne des familles les plus aisées, voire aristocratiques, dans le cadre du banquet ou pour la toilette. Certains étaient aussi choisis pour honorer les dieux ou les morts. Une céramique commune a été utilisée au quotidien. Elle fait l'objet de recherches de plus en plus approfondies. Ces céramiques peintes constituent la part la plus importante de la peinture de la Grèce antique actuellement conservée."},{"page_url":"https://id.wikipedia.org/wiki/Orang_Samaria","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Gerizim2.jpg","page_title":"Orang Samaria","context_page_description":"Orang Samaria adalah penduduk wilayah Palestina bagian utara, yang dulunya menjadi wilayah kerajaan Israel Utara. Sejak abad ke-6 SM, ada pertentangan antara orang-orang Samaria dengan orang-orang Yahudi, yang berlangsung hingga masa Perjanjian Baru. Pertentangan tersebut terutama disebabkan alasan etnisitas, yang mana orang-orang Yahudi menganggap orang-orang Samaria tidak berdarah Israel murni karena merupakan hasil pernikahan campur orang Yahudi dengan non-Yahudi. Selain itu, dalam hal keagamaan juga ada perbedaan di antara keduanya sehingga orang-orang Yahudi menganggap ibadah orang-orang Samaria tidaklah benar. Di sisi lain, orang-orang Samaria juga melihat orang-orang Yahudi secara negatif. Orang-orang Samaria menganggap diri mereka sebagai bangsa Israel yang benar, dan memisahkan diri dari kalangan bangsa Israel yang telah dicemarkan oleh imam Eli pada zaman Samuel."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9B%A2%E5%BF%83%E7%8E%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Eccentricity.svg","page_title":"離心率","context_page_description":"離心率とは、円錐曲線の特徴を示す数値のひとつである。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E7%86%B1%E9%BB%9E_(%E5%9C%B0%E8%B3%AA%E5%AD%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Mauna_Loa_Volcano.jpg","page_title":"熱點 (地質學)","context_page_description":"热点在地质学上是指地球表面长期历经活跃的火山活动的地区。约翰·图佐·威尔逊在1963年时有了一种想法，认为像夏威夷群岛这样的火山链是板块缓慢地移动时经过地表下一个“固定的”热点而形成的。热点被认为是一股较热的、狭窄的地幔从地幔与地核之间的边界开始向上进行对流而形成的，这称为“地幔柱”。最新的地质学上的证据则把热点的成因指向了海洋地壳隐没至核幔边界, 海洋地壳因其密度较小而上升, 且过程中减压融熔。地质学家也确认出了全球40到50个热点，最活跃的热点包括夏威夷、留尼汪、黄石、加拉巴哥群岛、冰岛等地。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%8B%9F%E5%8D%97%E8%8A%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Arabidopsis_Thaliana_planted_in_Laboratory.JPG","page_title":"拟南芥","context_page_description":"阿拉伯芥，又名擬南芥、鼠耳芥、阿拉伯草，是一種原生於歐亞大陸的小型開花植物。阿拉伯芥被認為是一種雜草;它是在路邊和被擾動土地上被找到的。\\n阿拉伯芥是一個生命周期相對較短的冬季一年生植物，它是植物生物學和遺傳學領域的流行的模式生物。對於一個複雜的多細胞真核生物，阿拉伯芥有一個相對較小的基因組，大約135兆鹼基對。阿拉伯芥是第一個基因組被完整測序的植物。它是理解許多植物性狀的一種流行的分子生物學工具，包括花的發育和向光性。"},{"page_url":"https://vi.wikipedia.org/wiki/C%C3%A2y_l%E1%BB%A5c_b%C3%A1t","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Custard_Apple_%E0%B4%86%E0%B4%A4%E0%B5%8D%E0%B4%A4_012.JPG","page_title":"Cây lục bát","context_page_description":"Lục bát, còn gọi là cây nê /nê rừng, trong một số ngôn ngữ châu Âu gọi là tim bò, tiếng Hindi gọi là sitaphal, tức quả Sita, là một loài thực vật thuộc chi Na, có nguồn gốc từ khu vực nhiệt đới của Tân Thế giới."},{"page_url":"https://en.wikipedia.org/wiki/Golaghat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Gold_Cinema_Multiplex_Screen_%E2%80%93_Golaghat.png","page_title":"Golaghat","context_page_description":"Golaghat one of the largest subdivisions of the Indian state of Assam, later elevated to the position of a full–fledged district headquarter on 5 October 1987, is a city and a municipality and the seat of administrative operations of Golaghat district, besides being a twin city to Jorhat which is about 55 km away. It is one of the oldest urban areas in Assam that recently featured on the Smart Cities nominations list, along with Guwahati and four other prominent urban areas of the state; although losing out to Guwahati at the final stage. The Dhansiri, one of the tributaries of the Brahmaputra, passes through Golaghat and is the primary water source for its citizens.\\nOne of the earliest tea urban centres in Assam that has been the headquarters of the oldest subdivision for over 182–183 years since 1839, the local government body, Golaghat Municipal Board, was set up in 1920, becoming a long-established civic body of the state, formed before independent India. It is a historical body of 101–102 years of age in continuous operation dating as far back as the early 1920s.\\nGolaghat has the inceptive post/mail service and telegraphic communication systems in Assam going back to 1876."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B0%90%EB%81%84%EC%97%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Tr%E1%BB%8Bnh_C%C6%B0%C6%A1ng.png","page_title":"찐끄엉","context_page_description":"찐끄엉은 대월 후 레 왕조의 정치인, 찐 주의 제7대 왕이다. 봉호는 안도왕이다."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%A7%E0%B3%81%E0%B2%AE%E0%B3%81%E0%B2%95%E0%B3%81%E0%B2%95%E0%B3%8A%E0%B2%A1%E0%B3%86_%E0%B2%9C%E0%B2%BF%E0%B2%97%E0%B2%BF%E0%B2%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Parachuting_-_Russian_flag.jpg","page_title":"ಧುಮುಕುಕೊಡೆ ಜಿಗಿತ","context_page_description":"ಧುಮುಕುಕೊಡೆ ಜಿಗಿತ ವು ಆಕಾಶ ನೆಗೆತ ಎಂಬ ಹೆಸರಿನಿಂದಲೂ ಸುಪರಿಚಿತವಾಗಿದ್ದು, ಇದು ವಿಮಾನ ಅಥವಾ ವಾಯುನೌಕೆಯೊಂದರಿಂದ ನಿರ್ಗಮಿಸಿ ಧುಮುಕುಕೊಡೆಯೊಂದರ ನೆರವಿನಿಂದ ಭೂಮಿಗೆ ಹಿಂದಿರುಗುವ ಒಂದು ಸಾಹಸಕಾರ್ಯವಾಗಿದೆ. ಧುಮುಕುಕೊಡೆಯು ಇನ್ನೂ ಸಜ್ಜುಗೊಳಿಸಲ್ಪಡದಿರುವಿಕೆಯ ಅವಧಿಯಾದ, ಒಂದು ನಿಶ್ಚಿತ ಪ್ರಮಾಣದಲ್ಲಿನ ಸ್ವತಂತ್ರ ಪತನವನ್ನು ಹಾಗೂ ದೇಹವು ಕ್ರಮೇಣವಾಗಿ ಅಂತಿಮ ವೇಗಕ್ಕೆ ಹೆಚ್ಚಿಸಿಕೊಳ್ಳುವುದನ್ನು ಇದು ಒಳಗೊಂಡಿರಬಹುದು ಅಥವಾ ಒಳಗೊಳ್ಳದಿರಬಹುದು.\\nಆಕಾಶ ನೆಗೆತದ ಇತಿಹಾಸವು ಆಂಡ್ರೆ-ಜಾಕ್ವೆಸ್‌ ಗಾರ್ನರಿನ್‌ ಎಂಬಾತನೊಂದಿಗೆ ಆರಂಭವಾಗುತ್ತದೆ. ಈತ ೧೭೯೭ರಲ್ಲಿ ಒಂದು ಬಿಸಿ-ಗಾಳಿಯ ಆಕಾಶಬುಟ್ಟಿಯಿಂದ ಧುಮುಕುಕೊಡೆ ಜಿಗಿತಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಕೈಗೊಂಡಿದ್ದ. ಆಕಾಶಬುಟ್ಟಿಗಳ ಒಳಗಿರುವ ಮತ್ತು ಹಾರಾಟದಲ್ಲಿರುವ ವಿಮಾನದಲ್ಲಿರುವ ವಿಮಾನದ ಸಿಬ್ಬಂದಿವರ್ಗವನ್ನು ತುರ್ತುಸ್ಥಿತಿಗಳಿಂದ ಕಾಪಾಡುವ ಒಂದು ವಿಧಾನವಾಗಿ, ನಂತರದಲ್ಲಿ ಯುದ್ಧಭೂಮಿಗೆ ಯೋಧರನ್ನು ತಲುಪಿಸುವ ಒಂದು ವಿಧಾನವಾಗಿ ಧುಮುಕುಕೊಡೆ ಜಿಗಿತದ ತಂತ್ರಜ್ಞಾನವನ್ನು ಸೇನೆಯು ಅಭಿವೃದ್ಧಿಪಡಿಸಿತು. ಆರಂಭಿಕ ಅವಧಿಯಲ್ಲಿ ನಡೆದ ಸ್ಪರ್ಧೆಗಳು ೧೯೩೦ರ ದಶಕದಷ್ಟು ಹಿಂದಕ್ಕೆ ನಮ್ಮನ್ನು ಕರೆದೊಯ್ಯುತ್ತವೆ, ಮತ್ತು ಇದು ೧೯೫೨ರಲ್ಲಿ ಒಂದು ಅಂತರರಾಷ್ಟ್ರೀಯ ಕ್ರೀಡೆ ಎನಿಸಿಕೊಂಡಿತು.\\nಒಂದು ವಿನೋದ-ವಿಹಾರದ ಚಟುವಟಿಕೆಯಾಗಿ ಮತ್ತು ಒಂದು ಸ್ಪರ್ಧಾತ್ಮಕ ಕ್ರೀಡೆಯಾಗಿ ಧುಮುಕುಕೊಡೆ ಜಿಗಿತವು ಪ್ರದರ್ಶಿಸಲ್ಪಡುತ್ತದೆ; ಅಷ್ಟೇ ಅಲ್ಲ, ವಾಯುಗಾಮಿ ಪಡೆಗಳಿಗೆ ಸೇರಿದ ಸೇನೆ ಸಿಬ್ಬಂದಿ ಮತ್ತು ಸಂದರ್ಭಾನುಸಾರ ಬಳಕೆಯಾಗುವ ಅರಣ್ಯ ಅಗ್ನಿಶಾಮಕ ಪಡೆಗಳ ನಿಯೋಜಿಸುವಿಕೆ ಅಥವಾ ವ್ಯೂಹರಚನೆಗಾಗಿಯೂ ಧುಮುಕುಕೊಡೆ ಜಿಗಿತವು ಬಳಸಲ್ಪಡುತ್ತದೆ."},{"page_url":"https://en.wikipedia.org/wiki/Raritan_Bay","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Wpdms_usgs_photo_raritan_bay.jpg","page_title":"Raritan Bay","context_page_description":"Raritan Bay is a bay located at the southern portion of Lower New York Bay between the U.S. states of New York and New Jersey and is part of the New York Bight. The bay is bounded on the northwest by New York's Staten Island, on the west by Perth Amboy, New Jersey, on the south by the Raritan Bayshore communities of Monmouth County, New Jersey, and on the east by Sandy Hook Bay. The bay is named after the Raritans, a branch of the Lenape tribe who lived in the vicinity of the bay for thousands of years prior to the arrival of Dutch colonists in the 17th century."},{"page_url":"https://de.wikipedia.org/wiki/Perlboote","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Nautilus-JB-01.jpg","page_title":"Perlboote","context_page_description":"Die Perlboote sind eine Familie der Kopffüßer, die in den Gattungen Nautilus und Allonautilus die letzten fünf heute noch lebenden Arten der Überordnung der Nautiloideen zusammenfasst, eines Taxons, das fossil in einer ungeheuren Artenfülle nachgewiesen ist.\\nDie Perlboote unterscheiden sich von den anderen heute lebenden Kopffüßern, den Tintenfischen, durch eine Reihe von Merkmalen, die jedoch größtenteils als ursprüngliche Merkmale, also Merkmale der Stammart aller Kopffüßer, angesehen werden."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D1%8C%D0%B4%D0%B5%D1%80%D0%BE%D0%BD,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/George_Calderon.jpg","page_title":"Кальдерон, Джордж","context_page_description":"Джордж Лесли Кальдерон — английский драматург и литературовед, юрист, лингвист, этнограф и художник; один из первых исследователей и пропагандистов творчества А. П. Чехова."},{"page_url":"https://eo.wikipedia.org/wiki/Listo_de_kaktoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Echinocereus_pectinatus_pm_01.JPG","page_title":"Listo de kaktoj","context_page_description":"Tiu artikolo estas listo de kaktoj kun hortikultura gravo."},{"page_url":"https://de.wikipedia.org/wiki/G%C3%B6tzendorf_(Eggolsheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/G%C3%B6tzendorf_%28Eggolsheim%29_Kapelle.jpg","page_title":"Götzendorf (Eggolsheim)","context_page_description":"Götzendorf ist ein fränkisches Dorf, das zu Eggolsheim gehört."},{"page_url":"https://en.wikipedia.org/wiki/List_of_primary_state_highways_in_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Virginia_392.png","page_title":"List of primary state highways in Virginia","context_page_description":"Primary State Highways in the U.S. state of Virginia, are numbered and maintained by the Virginia Department of Transportation as a system of state highways. Primary State Routes receive more funding than Secondary State Routes and are numbered as U.S. Routes or State Routes with numbers from 1 to 599. State Route 785 and State Route 895 are also primary routes, numbered as Interstate Highway spurs. Former numbers are reused often; only 29 of the numbers from 1 to 421 are not in use, with only seven of these under 260."},{"page_url":"https://simple.wikipedia.org/wiki/Party_leaders_of_the_United_States_House_of_Representatives","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Steve_Scalise_official_portrait.jpg","page_title":"Party leaders of the United States House of Representatives","context_page_description":"Party leaders and whips of the United States House of Representatives are elected by their respective parties in an opened-door caucus by secret ballot and are also known as floor leaders.\\nThe U.S. House of Representatives does officially use the term \\"Minority Leader\\" and so does the media. The House uses the terms \\"Republican Leader\\" or \\"Democratic Leader\\" depending on which party holds a minority of seats.\\nThe current party leaders are: Majority Leader Steny Hoyer, and Majority Whip Jim Clyburn, Minority Leader Kevin McCarthy, and Minority Whip Steve Scalise."},{"page_url":"https://de.wikipedia.org/wiki/Nys%C3%A4ter","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Marknad_i_Nys%C3%A4ter.jpg","page_title":"Nysäter","context_page_description":"Nysäter ist ein kleiner Ort in der Gemeinde Säffle in der schwedischen Provinz Värmlands län. Er galt schon früh als wichtiger Knotenpunkt zwischen den Wasserwegen von Vänern und Glafsfjorden sowie der Landstraße Oslo−Karlstad. Bei Nysäter verläuft der Säfflekanal.\\nEs gibt um den Ort Bodendenkmäler aus der Eisenzeit und der Zeit nach Christi Geburt. Vier große Hügelgräber, wie den Olafshögen mit einem Durchmesser von 40 Metern, findet man hier am Ufer der Bräven. Unter dem Olafshügel soll das Grab des Sagenkönigs Olaf Trätälja liegen, was allerdings auch von zwei weiteren Hügeln in Högsäter und Säffle behauptet wird. Olaf war König von Värmland und der Stammvater des norwegischen Königsgeschlechtes. Er starb als Brandopfer für Odin.\\nZum ersten Mal erwähnt wurde der Ort 1758, und zwar als Ochsenmarkt. Bis zum offiziellen Ende als Marktplatz im Jahre 1869 standen in Nysäter 67 Marktbuden.\\nAm Ufer der Bräven gibt es seit den 2000er-Jahren das Wikingerdorf-Museum Värmlands Vikingacenter, betrieben vom Verein Vikingaleden. Nysäter ist auch Heimathafen des nachgebauten Wikingerschiffes Glad av Gillberga."},{"page_url":"https://de.wikipedia.org/wiki/Simuna","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Simuna_kirik.jpg","page_title":"Simuna","context_page_description":"Simuna ist ein Dorf im estnischen Kreis Lääne-Viru. Es gehört seit 2005 zur Gemeinde Väike-Maarja. Simuna hat 383 Einwohner."},{"page_url":"https://es.wikipedia.org/wiki/El_despertar_de_una_naci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Fa%C3%A7ade_du_Palais_Ksar_Said_11.jpg","page_title":"El despertar de una nación","context_page_description":"El despertar de una nación es una exposición de arte en Túnez a raíz de una asociación público-privada entre el Instituto Nacional de la Herencia y la Fundación Rambourg Túnez. Su objetivo es salvaguardar la colección de pinturas del Instituto Nacional del Patrimonio relacionadas con el reinado de los husseinitas, formar restauradores y conducir a esta exposición.\\nEste proyecto requirió el reclutamiento de veinte restauradores tunecinos y extranjeros, que trabajaron durante cinco meses para restaurar cerca de 300 obras de arte.​ Reconocida por su participación en trabajos de restauración, en la Galería de los Espejos del Palacio de Versalles o en la Galería Apollo del museo de Louvre, la italiana Cinzia Pasquali fue quien dirigió los talleres de restauración.​\\nObjetos arqueológicos y documentos históricos se añaden a la exposición, además de su faceta artística, un documento visual ilustra una era de reformas emprendidas por Túnez entre 1830 y 1881.​"},{"page_url":"https://nl.wikipedia.org/wiki/A%C3%AFn_T%C3%A9mouchent_(stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/A%C3%AFn_T%C3%A9mouchent.JPG","page_title":"Aïn Témouchent (stad)","context_page_description":"Aïn Témouchent is een stad in Algerije en is de hoofdplaats van de provincie Aïn Témouchent. Aïn Témouchent telde in 2010 75.558 inwoners."},{"page_url":"https://jv.wikipedia.org/wiki/Pulo_Morotai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Morotai_Topography.png","page_title":"Pulo Morotai","context_page_description":"Puou Morotai kanthi jembar ya iku jeneng salha sijiné pulo kang dianggo uga kabupatèn alternatif kang dumunung ing kapuloan Halmahera, Kapuloan Maluku, Indonésia. Kanggo péranganing Provinsi Maluku Lor, Pulo iki dumunung ing tlatah Indonésia sisih Lor.\\nKabupatèn Pulo Morotai diresmèkaké déning Mantri Dalam Negri Indonésia, Mardiyanto, ing tanggal 29 Oktober 2008, saka kasil pangembangan saka Kabupatèn Halmahera Lor."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A9%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/ROU_BH_Stei_CoA1.png","page_title":"Щей","context_page_description":"Щей е малък румънски град в жудец Бихор. От 1958 г. до 1990 г. носи името на румънския политик Петру Гроза. Разположен е на десния бряг по горното течение на река Кришул Негру. На 15 км северозападно е град Беюш, а като се продължи в същата посока на 60 км от Щей се намира окръжният център Орадя. На 6 км южно от Щей е град Вашкъу. Градът има жп гара по линията Вашкъу-Щей-Беюш-Орадя. Населението на града по данни от преброяването през 2002 г. е 8637 жители."},{"page_url":"https://it.wikipedia.org/wiki/Canyon_Pictures_Corporation","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Vanishing_Trails_%281920%29_-_Ad_1.jpg","page_title":"Canyon Pictures Corporation","context_page_description":"La Canyon Pictures Corporation è stata una piccola casa di produzione cinematografica statunitense che, specializzata nel genere western, produsse nei suoi tre anni di attività un ventina di pellicole, associandosi nella produzione, nel 1921, alla William N. Selig Productions. I film della Canyon furono distribuiti in gran parte dalla Aywon Film.\\nAttori di punta della compagnia furono i popolari attori-cowboy Franklyn Farnum e, in minor misura, Buck Jones."},{"page_url":"https://es.wikipedia.org/wiki/Acritarco","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Eisenackidium_orientalis.jpg","page_title":"Acritarco","context_page_description":"Los acritarcos, cuyo nombre significa de incierto origen, son pequeñas estructuras orgánicas encontradas como fósiles. Son un grupo artificial, pues cualquier pequeña estructura orgánica no soluble en ácido, que no pueda ser clasificada de otra manera es un acritarco. La mayoría de los acritarcos son probablemente restos de organismos unicelulares, especialmente de algas planctónicas. Se encuentran en rocas sedimentarias desde el Arcaico hasta el Cretácico. Se conocen acritarcos con una antigüedad de hasta 3200 millones de años, ​ pero los primeros que se consideran probables fósiles de eucariotas datan de hace 1630 millones de años.​\\nSe aíslan típicamente de rocas sedimentarias siliciclásticas usando ácido fluorhídrico, pero de vez en cuando se extraen de rocas ricas en carbonato. Se usan para fechar formaciones de rocas de la era Paleozoica. Puesto que la mayoría de los acritarcos son supuestamente marinos, son también útiles para interpretación paleoambiental."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%DB%8C%D8%B3%D8%AA%D9%BE%D9%88%D8%B1%D8%AA%D8%8C_%D9%85%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Water_Street%2C_Eastport%2C_ME.jpg","page_title":"ایستپورت، مین","context_page_description":"ااستپورت شهری در ایالت مین کشور ایالات متحده آمریکا است که جمعیت آن در سرشماری سال ۲۰۱۰ میلادی، ۱٬۳۳۱ نفر بوده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Nicky_Hayden","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Honda_RC211V_2006_NH.jpg","page_title":"Nicky Hayden","context_page_description":"Nicholas Patrick Hayden, dit « Nicky » Hayden, surnommé « l’enfant du Kentucky », né le 30 juillet 1981 à Owensboro et mort le 22 mai 2017 à Cesena percuté par un automobiliste, était un pilote de vitesse moto américain courant en championnat du monde FIM Superbike et auparavant en championnat du monde FIM MotoGP dont il fut couronné champion en 2006. Durant toute sa carrière, il arbora le numéro 69."},{"page_url":"https://eo.wikipedia.org/wiki/Ludoviko_la_9-a_(Bavario)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Codex_Vindobonensis_3069_38v.jpg","page_title":"Ludoviko la 9-a (Bavario)","context_page_description":"Ludoviko la 9-a, nomata Ludoviko la Riĉa estis Duko de Bavario-Landshut ekde 1450 ĝis sia morto. Li estis filo de Henriko la 16-a, la Riĉa kaj Margareta de Aŭstrio\\n."},{"page_url":"https://ca.wikipedia.org/wiki/Jard%C3%AD_bot%C3%A0nic","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Aswan%2C_Kitchener%27s_Island%2C_palm_alley%2C_Egypt%2C_Oct_2004.jpg","page_title":"Jardí botànic","context_page_description":"Un Jardí botànic és un terreny condicionat per una institució pública, privada o mixta que té com a objectiu l'exhibició d'espècies o varietats vegetals.\\nLes nombroses espècies i varietats de plantes silvestres i/o hortícoles presentades són estrictament identificades i reunides en col·leccions. Els quatre objectius principals pels quals es conreen són: la conservació, la recerca científica, l'educació, l'ensenyament i el turisme."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B1%D9%8A%D9%85%D8%A7%D9%86_%D9%88%D8%A7%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Freeman_White_%281964%29.png","page_title":"فريمان وايت","context_page_description":"فريمان وايت ‏ هو لاعب كرة قدم أمريكية ولاعب كرة القدم الكندية أمريكي، ولد في 17 ديسمبر 1943 في مونتغومري في الولايات المتحدة."},{"page_url":"https://it.wikipedia.org/wiki/La_Gorgona_(film_1915)","image_url":"https://upload.wikimedia.org/wikipedia/it/f/f8/Gorgona-1915-1.jpg","page_title":"La Gorgona (film 1915)","context_page_description":"La Gorgona è un film del 1915 diretto da Mario Caserini."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D0%B0%D0%B4%D0%B8_(%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Antoniadi_Crater_Stream_Channels.JPG","page_title":"Антониади (кратер)","context_page_description":"Антониади — 400-километровый марсианский ударный кратер, расположенный на Большом Сирте. Координаты центра — 21°30′ с. ш. 60°50′ в. д.21,5° с. ш. 60,83° в. д. Назван в честь французского астронома Эжена Мишеля Антониади.\\nЕсть доказательства того, что в кратере Антониади когда-то были реки и озёра. На фотографии ниже видны «инвертированные» каналы в этом кратере. История их образования такая. После того, как водные потоки прорезали эти каналы, часть грунта в этих местах была снесена эрозией. Но содержимое каналов было, по всей видимости, прочнее. Поэтому теперь бывшие каналы приподнимаются над поверхностью вместо того, чтобы врезаться в неё."},{"page_url":"https://en.wikipedia.org/wiki/Chilman_Arisman","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/H.E._Mr._Chilman_Arisman.jpg","page_title":"Chilman Arisman","context_page_description":"Chilman Arisman is an Indonesian diplomat. Since 1 February 2017, he was appointed as Senior Official in the Directorate for ASEAN Political Security Cooperation, Ministry Foreign Affairs of the Republic of Indonesia. Before stepping in his current position, he was Ambassador of the Republic of Indonesia to the Kingdom of Bahrain, from October 2012 –January 2017.\\nIn more than 30 years of service for the Indonesian Ministry of Foreign Affairs of the Republic of Indonesia, Mr. Chilman Arisman has been posted in Saudi Arabia, the United States of America, Malaysia and Bahrain. His earliest post was as Vice Consul at the Indonesian Consulate General in Jeddah, Kingdom of Saudi Arabia, from 1989-1993. He later headed off to Indonesian Consulate General in Los Angeles, the United States of America, in 1995-1999, as Consul for Economic Affairs. Then he was appointed as Counsellor, before becoming as Minister Counsellor, heading Economic Division at the Embassy of the Republic of Indonesia in Kuala Lumpur, Malaysia, from 2002 -2006. Before becoming the Indonesian Ambassador to the Kingdom of Bahrain, Mr."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%B2%E0%A9%88%E0%A8%A8%E0%A8%BF%E0%A8%A8_%E0%A8%87%E0%A8%A8%E0%A8%BE%E0%A8%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Lenin_Prize_Medal.JPG","page_title":"ਲੈਨਿਨ ਇਨਾਮ","context_page_description":"ਲੈਨਿਨ ਇਨਾਮ ਵਿਗਿਆਨ, ਸਾਹਿਤ, ਕਲਾ, ਆਰਕੀਟੈਕਚਰ, ਅਤੇ ਤਕਨਾਲੋਜੀ ਦੇ ਨਾਲ ਸਬੰਧਤ ਕੰਮ ਲਈ ਦਿੱਤਾ ਜਾਣ ਵਾਲਾ ਸੋਵੀਅਤ ਯੂਨੀਅਨ ਦਾ ਸਭ ਤੋਂ ਵਕਾਰੀ ਇਨਾਮ ਸੀ। ਇਹ 23 ਜੂਨ 1925 ਨੂੰ ਸਥਾਪਿਤ ਕੀਤਾ ਗਿਆ ਸੀ ਅਤੇ 1934 ਤੱਕ ਜਾਰੀ ਰੱਖਿਆ ਗਿਆ ਸੀ। 1935 ਤੋਂ 1956 ਤੱਕ ਦੇ ਅਰਸੇ ਦੌਰਾਨ, ਲੈਨਿਨ ਪ੍ਰਾਈਜ਼, ਨਹੀਂ ਦਿੱਤਾ ਗਿਆ ਸੀ, ਇਹਦੀ ਥਾਂ ਵੱਡੇ ਪੱਧਰ ਤੇ ਸਟਾਲਿਨ ਇਨਾਮ ਦਿੱਤਾ ਗਿਆ।\\n23 ਅਪਰੈਲ 2018 ਨੂੰ 2020 ਵਿਚ ਲੈਨਿਨ ਦੇ 150 ਵੇਂ ਜਨਮ ਦਿਹਾੜੇ ਨਾਲ ਜੋੜਨ ਲਈ ਉਲੀਆਨੋਵਸਕ ਓਬਲਾਸਟ ਦੇ ਮੁਖੀ, ਸੇਰਗੇਈ ਇਵਾਨੋਵਿਚ ਮੋਰੋਜੋਵ ਨੇ ਹਿਊਮੈਨਟੀਜ਼, ਸਾਹਿਤ ਅਤੇ ਕਲਾ ਵਿਚ ਪ੍ਰਾਪਤੀ ਲਈ ਲੈਨਿਨ ਪੁਰਸਕਾਰ ਦੁਬਾਰਾ ਸ਼ੁਰੂ ਕੀਤਾ\`।"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%8E%D1%80%D0%B4%D0%BE,_%D0%9E%D0%B3%D1%8E%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Auguste_Burdeau.jpg","page_title":"Бюрдо, Огюст","context_page_description":"Огю́ст Бюрдо́ — французский политический деятель и писатель; министр; переводчик на французский трудов Спенсера и Шопенгауэра."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDi%C5%BEelice_(okres_Louny)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%C5%BDi%C5%BEelice_Bo%C5%BE%C3%AD_muka.JPG","page_title":"Žiželice (okres Louny)","context_page_description":"Obec Žiželice se nachází v okrese Louny v Ústeckém kraji. Žije v ní 414 obyvatel."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_de_l%27Eau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Rue_de_l%27Eau_%28Colmar%29_%281%29.JPG","page_title":"Rue de l'Eau","context_page_description":"La rue de l'Eau est une voie de circulation de la ville de Colmar, en France."},{"page_url":"https://pl.wikipedia.org/wiki/Wie%C5%BCanka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Wie%C5%BCanka_PGR.jpg","page_title":"Wieżanka","context_page_description":"Wieżanka – wieś w Polsce położona w województwie podlaskim, w powiecie hajnowskim, w gminie Czyże.\\nWieś królewska w leśnictwie bielskim w ziemi bielskiej województwa podlaskiego w 1795 roku. W latach 1975–1998 miejscowość administracyjnie należała do województwa białostockiego. Przez miejscowość przepływa niewielka rzeka Łoknica, dopływ Narwi. Wieżanka jest przysiółkiem wsi Wólka. Nazwa pochodzi od rzeczki Wieżanki. Według miejscowych legend nazwa pochodzi od wieży."},{"page_url":"https://ast.wikipedia.org/wiki/Tsubasa_Yokotake","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Tsubasa_Yokotake.jpg","page_title":"Tsubasa Yokotake","context_page_description":"Tsubasa Yokotake, ye un futbolista xaponés."},{"page_url":"https://es.wikipedia.org/wiki/Crystal_Palace_(Nueva_York)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/New_York_Crystal_Palace.jpg","page_title":"Crystal Palace (Nueva York)","context_page_description":"El Palacio de Cristal de Nueva York fue un edificio de exposiciones construido para la Exposición Universal de Nueva York en 1853, bajo la presidencia del alcalde Jacob Aaron Westervelt. El edificio se encontraba en Reservoir Square, conocida actualmente como Bryant Park.\\nLa Exposición Universal de Nueva York, se llevó a cabo detrás del depósito Croton, entre la Quinta y la Sexta Avenida en la calle 42, en lo que hoy es el Bryant Park. El Crystal Palace de Nueva York fue diseñado por Georg Carstensen y el arquitecto alemán Charles Gildemeister, y su construcción estuvo inspirada por el Crystal Palace que ya existía en Londres, en el Hyde Park y que se construyó para albergar la Gran Exposición de 1851. El Crystal Palace de Nueva York tenía forma de cruz griega, y estuvo coronado por una cúpula de 100 pies de diámetro. Al igual que el Crystal Palace de Londres, fue construido en hierro y vidrio. La construcción estuvo a cargo del ingeniero Christian Edward Detmold. Horatio Allen fue el ingeniero consultor; y Edward Hurry, el arquitecto asesor.\\nEl presidente Franklin Pierce habló en la inauguración el 14 de julio de 1853."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D1%96%D0%BD%D1%8C%D1%91%D0%BB%D0%B5-%D0%9C%D0%B0%D0%BD%D1%84%D0%B5%D1%80%D0%B0%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Vignale_Monferrato-panorama2.jpg","page_title":"Віньёле-Манферата","context_page_description":"Він'яле-Манферата — камуна ў Італіі, размяшчаецца ў рэгіёне П'емонт, падпарадкоўваецца адміністрацыйнаму цэнтру Алесандрыя.\\nНасельніцтва складае 1096 чалавек, шчыльнасць насельніцтва складае 58 чал./км². Займае плошчу 19 км². Паштовы індэкс — 15049. Тэлефонны код — 0142.\\nЗаступнікам населенага пункта лічыцца святы Bartolomeo apostolo."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%98%89%E9%81%93%E7%90%86%E8%BE%B2%E5%A0%B4%E6%9A%A8%E6%A4%8D%E7%89%A9%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Resize_of_2008_04160225.JPG","page_title":"嘉道理農場暨植物園","context_page_description":"嘉道理农场暨植物园- KFBG前称嘉道理农业辅助会，是香港一个环境保育教育中心及植物园，位于新界大埔区大帽山北坡和山麓，林锦公路近林村白牛石以及元朗观音山一带，占地148公顷，范围横跨了大埔区和元朗区。"},{"page_url":"https://en.wikipedia.org/wiki/Maragheh_observatory","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Inside_Maragheh_observatory.jpg","page_title":"Maragheh observatory","context_page_description":"Maragheh observatory was an astronomical observatory established in 1259 CE under the patronage of the Ilkhanid Hulagu and the directorship of Nasir al-Din al-Tusi, a Persian scientist and astronomer. Located in the heights west of Maragheh, which is today situated in the East Azerbaijan Province of Iran, it was once considered \\"the most advanced scientific institution in the Eurasian world\\".\\nIt was financed by waqf revenues, which allowed it to continue to operate even after the death of its founder, and was active for more than 50 years. It served as a model for later observatories including the 15th-century Ulugh Beg Observatory in Samarkand, the 16th-century Taqi al-Din observatory in Constantinople, and the 18th-century Jai Singh observatory in Jaipur."},{"page_url":"https://vi.wikipedia.org/wiki/Tuy%C3%AAn_%C3%BAy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Zalman_Lipskier.jpg","page_title":"Tuyên úy","context_page_description":"Tuyên úy là chức vụ của các giáo sĩ thuộc các tôn giáo như Phật giáo, Kitô giáo, Thiên Chúa giáo, Do Thái giáo được bổ nhiệm làm đại diện, hướng dẫn tâm linh cho một tổ chức, đoàn thể thế tục như bệnh viện, nhà tù, đơn vị quân sự, cảnh sát, lính cứu lửa, trường đại học hoặc nhà nguyện tư nhân. Tuyên úy không có quyền quản trị như giáo sĩ giáo phẩm.\\nMặc dù ban đầu, Tuyên úy là hệ phái đại diện cho đức tin Kitô giáo, ngày nay, một vài tôn giáo khác cũng đã có thêm chức vụ tuyên úy như Kitô giáo. Ví dụ như trường hợp các tuyên úy đi nghĩa vụ lính tráng cho các lực lượng quân sự và ngày càng nhiều tuyên úy sinh sống tại các trường đại học Mỹ. Trong thời gian gần đây, nhiều giáo dân đã được đào tạo chuyên nghiệp về nghề nghiệp tuyên úy và bây giờ được bổ nhiệm làm tuyên úy ở các trường học, bệnh viện, công ty, trường đại học, nhà tù và những nơi khác để làm việc cùng hoặc thay vào đó là các thành viên chính thức của tầng lớp tăng lữ. Các khái niệm về tuyên úy đa sắc tộc, thế tục, chung chung và / hoặc nhân văn cũng đang được hỗ trợ ngày càng tăng, đặc biệt là trong các môi trường y tế và giáo dục."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%B9a_b%C3%A3o_T%C3%A2y_Nam_%E1%BA%A4n_%C4%90%E1%BB%99_D%C6%B0%C6%A1ng_2018-19","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Lorna_2019-04-28_0747Z.jpg","page_title":"Mùa bão Tây Nam Ấn Độ Dương 2018-19","context_page_description":"Mùa bão Tây Nam Ấn Độ Dương 2018-19 là một sự kiện đã diễn ra trong chu kỳ hàng năm về sự hình thành các xoáy thuận nhiệt đới. Mùa bão chính thức bắt đầu vào ngày 15 tháng 11 năm 2018 và sẽ kết thúc vào ngày 30 tháng 4 năm 2019, ngoại trừ Mauritius và Seychelles, sẽ kết thúc vào ngày 15 tháng 5 năm 2019. Những ngày này thường phân định giai đoạn mỗi năm khi nhiệt đới nhất và lốc xoáy cận nhiệt đới hình thành trong lưu vực, nằm ở phía tây 90 ° E và phía nam Xích đạo. Bão nhiệt đới và cận nhiệt đới trong lưu vực này được theo dõi bởi Trung tâm Khí tượng Chuyên ngành Khu vực ở Réunion."},{"page_url":"https://io.wikipedia.org/wiki/Listo_pri_chefministri_di_Laos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Thongloun_Sisoulith_with_Obamas_cropped.jpg","page_title":"Listo pri chefministri di Laos","context_page_description":"Yen la listo pri chefministri di Laos de 1945 til nun. Pos finir la monarkio la titulo dil chefo di guvernerio divenis Prezidanto di la Konsilistaro di Ministri di la Republiko Populala Demokratiala di Laos.\\nDe decembro 1959 til decembro 1960, Laos havis 6 diferanta chefministri, qui revokesis per stato-stroki."},{"page_url":"https://pl.wikipedia.org/wiki/MaSzyna_%E2%80%93_Symulator_pojazd%C3%B3w_szynowych","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Logo_MaSzyna.png","page_title":"MaSzyna – Symulator pojazdów szynowych","context_page_description":"MaSzyna – Symulator Pojazdów Szynowych – polski symulator pojazdów szynowych. W obecnej wersji pozwala na sterowanie wieloma polskimi lokomotywami i zespołami trakcyjnymi. Do wyboru są m.in.: EU07, EP07, EP08, EP09, ET22, ET41, EU43, EN57, SM42, ST44, SU45, SU46, jak również modele wycofane z ruchu liniowego, jak na przykład SN61. Dużo innych lokomotyw jest sterowanych przez AI. Ponadto dostępnych jest niemal sto rodzajów wagonów.\\nProgram tworzony jest przez grupę hobbystów. Z forum programu pobrać można dodatkowe dźwięki i modele pojazdów, modele budynków, trasy, tekstury wykonane przez innych użytkowników. Możliwe jest również tworzenie własnych dodatków. Modele można tworzyć za pomocą dowolnego programu zapisującego pliki w formacie 3ds max, gmax lub Blender. Od wersji 20.04 Oprócz startera Rainsted mamy jeszcze jeden starter. Pełni on taką samą funkcję jak Rainsted."},{"page_url":"https://fr.wikipedia.org/wiki/Genre_(math%C3%A9matiques)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Double_torus_illustration.png","page_title":"Genre (mathématiques)","context_page_description":"En mathématiques, le genre est un entier naturel associé à certains objets ; il représente en particulier le nombre d'anses d'une surface caractéristique de l'objet étudié, si cette surface est orientable."},{"page_url":"https://lv.wikipedia.org/wiki/Domino_princips","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Efeito_domin%C3%B3.gif","page_title":"Domino princips","context_page_description":"Domino princips — noteiktas parādības izplatība pa ķēdi kāda faktora, kas iedarbojas uz ķēdes pirmo elementu, ietekmē."},{"page_url":"https://en.wikipedia.org/wiki/Statue_of_Inoue_Masaru","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Masaru_Inoue_Bronze_statues_in_Tokyo_Station_Marunouchi_Square.jpg","page_title":"Statue of Inoue Masaru","context_page_description":"A statue of Inoue Masaru is installed in Marunouchi Central Plaza, outside Tokyo Station, in Tokyo, Japan."},{"page_url":"https://fi.wikipedia.org/wiki/Kylkiluu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Image122.gif","page_title":"Kylkiluu","context_page_description":"Kylkiluut ovat luita, jotka osallistuvat rintakehän muodostamiseen. Kylkiluiden tehtävä on suojella rintaontelon elimiä."},{"page_url":"https://es.wikipedia.org/wiki/Isis_(nave)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/ReliefPortaSanPaolo.jpg","page_title":"Isis (nave)","context_page_description":"La nave Isis fue un barco de carga romano que transportaba trigo desde el puerto de Alejandría hasta Italia.\\nSus dimensiones y su capacidad de transporte eran considerables. Y son conocidas gracias a uno de los diálogos de Luciano de Samosata, filósofo sofista griego."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B2%D8%A7%D9%83_%D8%A5%D9%8A%D9%81%D8%B1%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Zac_Efron_Cannes_2012.jpg","page_title":"زاك إيفرون","context_page_description":"زاكاري ديفيد ألكساندر إيفرون ‏ المعروف بـ، مغني وممثلٌ وراقص وعارض أزياء ومنتج أفلام وممثل مسرحي أمريكيٌّ.\\nبدأ إيفرون مسيرته بالظهور في الإعلانات التجارية قبل حصوله على أدوارٍ ثانويّةٍ في مسلسلات مثل فاير فلاي والمسلسل الهزلي صحيفة الغارديان في بداية عقد 2000. حصل إيفرون على أوّل دورٍ سينمائيٍّ له عام 2006 في سلسلة الأفلام الغنائية \\"هاي سكول ميوزيكال\\" التي قدمتها قناة ديزني، والذي حاز فيها على جائزة إيمي ونال شعبية هائلة بين أفلام قناة ديزني، إلّا أن أوّل ظهور كبيرٍ له في السينما كان سنة 2007 في فيلم الفيلم الموسيقي مثبتات الشعر الذي أنتجته شركة \\"نيو لاين سينما\\" إلى جانب الممثل جون ترافولتا. أشاد النقاد بموهبة إيفرون لأداءه بدورٍ ثانوي في فيلم 17 مرة أخرى عام 2009، الذي أهّله للترشح لجائزة إم تي في للأفلام لأفضل ممثلٍ. حاز إيفرون أيضاً على المزيد من الإشادة لأداءه بأدوارٍ رئيسيّةٍ في فيلم أنا واورسون ويلز عام 2009، وتشارلي سانت كلود في عام 2010، وعشيه رأس السنة الجديدة في عام 2011، وموزع الصحف في عام 2012، وباركلاند في عام 2013، وتلك اللحظة المحرجة في عام 2014، قبل أن يُحقق شهرةً عالميّةً من خلال فيلم جيران للمخرج نيكولاس ستولر سنة 2014، الفيلم الذي أصبح أعلى الأفلام حصولاً على إيراداتٍ حتى وقتٍ قريبٍ."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A0%D7%A8%D7%99_%D7%90%D7%99%D7%90%D7%9F_%D7%A7%D7%99%D7%95%D7%96%D7%99%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Henryiancusick.jpg","page_title":"הנרי איאן קיוזיק","context_page_description":"הנרי איאן קיוזיק הוא שחקן קולנוע, טלוויזיה ותיאטרון סקוטי-פרואני."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Moravsk%C3%A9_T%C5%99ebov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Sloup_se_souso%C5%A1%C3%ADm_-_Morov%C3%BD_sloup_%28Moravsk%C3%A1_T%C5%99ebov%C3%A1%29_detail.JPG","page_title":"Seznam kulturních památek v Moravské Třebové","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Moravská Třebová v okrese Svitavy vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9F%83%E5%8F%8A%E6%B3%95%E8%80%81%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/WoodenCoffinOfIntef-BritishMuseum-August21-08.jpg","page_title":"埃及法老列表","context_page_description":"這是一份古埃及統治者的列表。該表中列出的君主始自約前31世紀的第一王朝，結束於希臘人建立的托勒密王朝。這段時期中埃及的最高君主的稱號是人們熟知的法老。\\n同時請參見：\\n埃及前王朝時期統治者列表：前王朝時期上埃及和下埃及統治者列表\\n埃及統治者列表：阿拉伯征服埃及之後的統治者列表\\n埃及現代君主列表：拿破崙入侵埃及至今的君主列表\\n在使用此表時，請注意以下幾個問題：\\n表中沒有列出各法老的在位時期。這是因為第二十六王朝之前，法老的確切統治時期根本無法確定。關於古埃及歷史事件的年代問題，考古學界建立了許多不同的時間系統。例如，蘇聯考古學家和西方考古學家採取的時間體系相差約100年。\\n表中包含3位實際沒有採用法老稱號的女性統治者。\\n通常法老具有多個用途不同的名字。例如，第一王朝的法老有王銜和王名。在這個表中，只列出其中最通用的名字。如果您知道的某位法老在表中查不到，請嘗試在其所屬王朝的條目中查找，那裡列出了法老的所有名字。\\n很多法老名字的翻譯源自俄語資料，可能與其英語轉寫的讀音不符。"},{"page_url":"https://lb.wikipedia.org/wiki/Viaduc_de_l'Eau_Rouge","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Viaduc_de_l%27Eau_Rouge.jpg","page_title":"Viaduc de l'Eau Rouge","context_page_description":"De Viaduc de l'Eau Rouge ass eng Autobunnsbréck op der belscher A27 / E42 um P.K 29,3.\\nD'Bréck gouf 1993 a Betrib geholl a si ass 652,50 Meter laang."},{"page_url":"https://et.wikipedia.org/wiki/Pioneer_10","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Pioneer_10-11_-_P52a_-_fx.jpg","page_title":"Pioneer 10","context_page_description":"Pioneer 10 oli NASA kosmosesond, mis startis 1972. aastal uurima Jupiteri ning Päikesesüsteemi äärealasid. See oli esimene kosmosesond, mis läbis asteroidide vöö, tegi Jupiteri lähivaatlusi ning mõne määratluse järgi väljus Päikesesüsteemist. Pioneer 10 on esimene kosmosesond, mis on saavutanud Päikesesüsteemist lahkumiseks vajaliku paokiiruse.\\nPioneer 10 startis 2. märtsil 1972 Canaverali neemelt ja läbis 1973. aastal esimese kosmosesondina Asteroidide vöö. Jupiteri pildistamist alustati 6. novembril 1973, kui sond oli planeedist 25 miljoni kilomeetri kaugusel ning Jupiterist möödus sond 4. detsembril 1973. Missiooni ajal uuris kosmosesond Asteroidide vööd, Jupiteri ja selle ümbrust, päikesetuult, kosmilist kiirgust ja missiooni lõpul ka Päikesesüsteemi äärealasid ja heliosfääri.\\nViimane väga nõrk sondi signaal saadi 23. jaanuaril 2003, kui see oli 12 miljardi km kaugusel Maast ja pärast seda pole sellest enam midagi kuuldud. Pioneer 10 liigub Aldebarani suunas."},{"page_url":"https://sr.wikipedia.org/wiki/Istorija_Estonije","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/J%C3%BCri_Uluots.jpg","page_title":"Istorija Estonije","context_page_description":"Istorija Estonije je istorija prostora današnje Republike Estonije i naroda Estonaca od praistorije do danas."},{"page_url":"https://de.wikipedia.org/wiki/Overall","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/RV_Taille_Schritt.png","page_title":"Overall","context_page_description":"Ein Overall ist ein einteiliger Überanzug. Weitere Bezeichnungen sind Kombination, Ganzanzug oder Einteiler. In der Binnenschifffahrt wird der Overall auch Kesselpack genannt. Im Englischen wird das Wort Boilersuit oder Coveralls benutzt.\\nEntworfen wurde der Overall, um den Träger und seine Kleidung vor Schmutz zu schützen. Bei einem Overall sind die Öffnungen auf das nötigste reduziert, weshalb eine Dichtigkeit einfacher herzustellen ist als bei mehrteiligen Anzügen mit Trennstellen. Dichtigkeit ist das oberste Kriterium für Schutz- und Trockenanzüge.\\nEin Overall kann am Körper nicht verrutschen und benötigt keine Haltevorrichtungen wie Gürtel oder Hosenträger. Dadurch kann es auch keine Druckstellen geben.\\nWar der Overall ursprünglich als reine Arbeitskleidung konzipiert, ist er heute auch noch ein jugendlicher Modeanzug.\\nKulturgeschichtlich bekam der Overall bei den Konstruktivisten sowie bei der chinesischen Revolution besondere Bedeutung.\\nOveralls kommen in einer Vielzahl von Streitkräften als Spezialbekleidung zum Einsatz.\\nSiehe dazu auch"},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%AE%89%E6%81%AF%E6%97%A5","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Shabbat_Candles.jpg","page_title":"安息日","context_page_description":"安息日，係猶太教嘅休息日，喺每個禮拜嘅第七日。呢個安排係因為神用六日創造世界後，喺第七日休息。\\n現代社會多數人喺禮拜日休息，就係源自安息日嘅習俗。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Aussichtst%C3%BCrmen_in_%C3%96sterreich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Berndorf_Jubil%C3%A4umswarte.JPG","page_title":"Liste von Aussichtstürmen in Österreich","context_page_description":"Die Liste von Aussichtstürmen in Österreich enthält Bauwerke, welche über für den Publikumsverkehr zugängliche Aussichtsmöglichkeiten verfügen. Sie umfasst Aussichts-, Fernseh- und Wassertürme, Hochhäuser, stationäre Fahrgeschäfte und sonstige für den Publikumsverkehr geöffnete Aussichtsplattformen – auch ehemalige Türme. Die Listen enthalten keine reisenden Panoramafahrgeschäfte.\\nAnmerkung: Die Tabellenspalten sind sortierbar, dazu dienen die Symbole bei den Spaltenüberschriften. In der Ausgangsansicht sind die Türme nach Gesamthöhe, bei gleicher Höhe nach Name des Bauwerks sortiert."},{"page_url":"https://fr.wikipedia.org/wiki/Rap_East_Coast","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Drawing_The_Notorious_B.I.G..png","page_title":"Rap East Coast","context_page_description":"Le rap East Coast est une mouvance du rap américain née à New York dans le Bronx, sur la côte Est des États-Unis. Musicalement, le son est souvent plus sombre, plus influencé par le jazz et la soul, donc moins funky que son homologue West Coast."},{"page_url":"https://pt.wikipedia.org/wiki/Batalha_dos_Campos_Catal%C3%A1unicos","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Battaglia_dei_Campi_Catalaunici-pt.svg","page_title":"Batalha dos Campos Cataláunicos","context_page_description":"A batalha dos Campos Cataláunicos foi travada a 20 de junho de 451 entre o Império Romano do Ocidente, os visigodos e os alanos, sob o comando de Flávio Aécio e de Teodorico I, por um lado e os hunos, comandados por Átila, o Huno. Esta batalha foi a última grande campanha militar do Império Romano do Ocidente e o culminar da carreira de Aécio."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D9%83%D8%A7%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Carrito_cocadas.JPG","page_title":"كوكادا","context_page_description":"كوكادا أو كيجه جينيا هي سكاكر أو حلوى جوز هند تقليدية موجود في أجزاء كثيرة من أمريكا اللاتينية. وهي تحظى بشعبية خاصة في الأرجنتين وبوليفيا والبرازيل وكولومبيا وتشيلي والجمهورية الدومينيكية والمكسيك وفنزويلا. يتم خبزها في الفرن ولكن تُقدم بدرجة حرارة الغرفة لتعطي ملمساً صعب المضغ وناعماً. يتم إعداد الكوكادا من البيض وجوز الهند المبشور، وهي تأتي بألوان متنوعة بسبب الأستخدم الحديث للألوان الغذائية، ولكن الأنواع التقليدية تأت بلون بني-ذهبي. غالباً ما يتم تزينها باللوز سواء كان كاملاً أو مقطعاً. هنالك المئات من وصفات الكوكادا من التقليدية القاسية والكرات الحلوة للغاية إلى حلوى الكوكادا ذات القوام القشدي المشابه للكريم كراميل. يمكن إضافة فواكه أخرى، غالباً ما تكون مجففة إلى الكوكادا لإحداث تنوع والذي يوفر مجموعة واسعة من ألوان الكوكادا. تمت الإشارة إلى الكوكادا في وقت مبكر يعود إلى عام 1878 في البيرو."},{"page_url":"https://vi.wikipedia.org/wiki/Cambiemos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Macri_em_2015.jpg","page_title":"Cambiemos","context_page_description":"Cambiemos là một liên minh chính trị trung hữu Argentina thành lập năm 2015. Đây là liên minh của Republican Proposal, Radical Civic Union, và Civic Coalition.\\nNhững đại diện của ba đảng này là các ứng cử viên Mauricio Macri, Ernesto Sanz, và Elisa Carrió và cũng là đại diện trong cuộc bầu chọn đầu tiên vào tháng 8 năm 2015 trước khi chọn ra ứng cử viên cuối cùng chạy đua cho cuộc bầu chọn tổng thống vào ngày 25 tháng Mười.\\nNgày 9 tháng 8 năm 2015 các cử tri đã lựa chọn Mauricio Macri là ứng cử viên đại diện cho Cambiemos trong cuộc bầu chọn tổng thống. Ngày 22 tháng Mười một, Macri đắc cử Tổng thống."},{"page_url":"https://pl.wikipedia.org/wiki/Imset","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Egyptian_-_Figure_of_Imsety%2C_Son_of_Horus_-_Walters_481644.jpg","page_title":"Imset","context_page_description":"Imset – bóg egipski, jeden z synów Horusa, czczony już w Starym Państwie, a od czasów Nowego Państwa przedstawiany w postaci mężczyzny. Sprawował opiekę nad zmarłymi. Kanopa z Imsetem chroniła wątrobę zmumifikowanego człowieka. Ośrodek kultu znajdował się w Buto."},{"page_url":"https://en.wikipedia.org/wiki/Arc_de_Triomphe","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Paris_Arc_de_Triomphe_inscriptions_6.jpg","page_title":"Arc de Triomphe","context_page_description":"The Arc de Triomphe de l'Étoile is one of the most famous monuments in Paris, France, standing at the western end of the Champs-Élysées at the centre of Place Charles de Gaulle, formerly named Place de l'Étoile—the étoile or \\"star\\" of the juncture formed by its twelve radiating avenues. The location of the arc and the plaza is shared between three arrondissements, 16th, 17th, and 8th. The Arc de Triomphe honours those who fought and died for France in the French Revolutionary and Napoleonic Wars, with the names of all French victories and generals inscribed on its inner and outer surfaces. Beneath its vault lies the Tomb of the Unknown Soldier from World War I.\\nAs the central cohesive element of the Axe historique, the Arc de Triomphe was designed by Jean Chalgrin in 1806; its iconographic programme pits heroically nude French youths against bearded Germanic warriors in chain mail. It set the tone for public monuments with triumphant patriotic messages. Inspired by the Arch of Titus in Rome, Italy, the Arc de Triomphe has an overall height of 50 metres, width of 45 m and depth of 22 m, while its large vault is 29.19 m high and 14.62 m wide."},{"page_url":"https://en.wikipedia.org/wiki/Thyrotoxic_periodic_paralysis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Scheme_sodium-potassium_pump-en-2.svg","page_title":"Thyrotoxic periodic paralysis","context_page_description":"Thyrotoxic periodic paralysis is a condition featuring attacks of muscle weakness in the presence of hyperthyroidism. Hypokalemia is usually present during attacks. The condition may be life-threatening if weakness of the breathing muscles leads to respiratory failure, or if the low potassium levels lead to cardiac arrhythmias. If untreated, it is typically recurrent in nature.\\nThe condition has been linked with genetic mutations in genes that code for certain ion channels that transport electrolytes across cell membranes. The main ones are the L-type calcium channel α1-subunit and potassium inward rectifier 2.6; it is therefore classified as a channelopathy. The abnormality in the channel is thought to lead to shifts of potassium into cells, under conditions of high thyroxine levels, usually with an additional precipitant.\\nTreatment of the hypokalemia, followed by correction of the hyperthyroidism, leads to complete resolution of the attacks. It occurs predominantly in males of Chinese, Japanese, Vietnamese, Filipino, and Korean descent. TPP is one of several conditions that can cause periodic paralysis."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%85%E2%80%8C%D9%86%D9%88%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Artichokess.jpg","page_title":"دم‌نوش","context_page_description":"دَم‌نوش نوعی نوشیدنی است که در آن جزئی از گل، برگ، ساقه، ریشه، دانه، پوستِ میوه یا اجزای دیگر گیاهان دارویی که قابل حل در آب است، به صورت خشک یا تازه مورد استفاده قرار می‌گیرد. دم کردن یا گرفتن عصاره به وسیلهٔ آب متداول‌ترین و قدیمی‌ترین روش به کار بردن داروهای گیاهی است. روش تهیه به این صورت است که ابتدا گیاه را که به طرز صحیحی خرد شده در آب جوش می‌ریزند، سپس آن را به مدت ۵–۳ دقیقه در یک ظرف در بستهٔ شیشه‌ای یا چینی می‌گذارند و گاهی آن را هم می‌زنند و سپس مایع را از کاغذ صافی یا الک با شبکهٔ ریز عبور می‌دهند.\\nدر ایران در سال‌های اخیر دم‌نوش‌های گیاهی و میوه‌ای مورد استقبال و مصرف برخی خانوارها قرار گرفته‌است. این استقبال دلایل مختلفی دارد. برخی برای نفع درمانی از این دم‌نوش‌ها استفاده می‌کنند. تعدادی برای تنوع بخشیدن به نوشیدنی روزانه، آن را مصرف می‌کنند و بعضی هم به خاطر اینکه دم‌نوش را یک نوشیدنی شیک می‌دانند، برای پذیرایی از آن استفاده می‌کنند.\\nتاریخچهٔ دم‌نوش را نمی‌توان از تاریخچهٔ گیاهان دارویی جدا کرد."},{"page_url":"https://en.wikipedia.org/wiki/Bernard_Natan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Bernard_Natan.jpg","page_title":"Bernard Natan","context_page_description":"Bernard Natan was a Franco-Romanian film entrepreneur, director and actor of the 1920s and 1930s. He was once said by historians to be one of the earliest pornographic film directors and pornographic film actors, although there is now considerable doubt about this. Natan certainly worked in mainstream cinema from his youngest days, working his way up from projectionist and chemist to cinematographer and producer. He eventually acquired the giant French motion picture studio Pathé in 1929. Pathé collapsed in 1935, and Natan was convicted of fraud. However, he laid the foundation for the modern film industry in France and helped revolutionize film technology around the world. Natan died after being transported to Auschwitz concentration camp."},{"page_url":"https://no.wikipedia.org/wiki/Mac_Pro","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/New_Mac_Pro_%2812093123884%29.jpg","page_title":"Mac Pro","context_page_description":"Mac Pro er en serie Intel Xeon baserte arbeidsstasjoner produsert av maskinvare- og programvareprodusenten Apple. Når det kommer til hastighet og ytelse er Mac Pro, under de fleste konfigurasjoner er det den kraftigste datamaskinen som Apple tilbyr og er en av tre stasjonære datamaskiner i dagens Mac utvalg, de to andre er det iMac og Mac Mini.\\nDen originale Mac Pro ble lansert 7. august 2006 som arvtaker til Power Mac G5 og den første Intel baserte arbeidsstasjonen fra Apple. Maskinen retter seg hovedsakelig mot avanserte brukere, som grafisk arbeid eller lignende, grunnet et relativt høyt prisnivå.\\nAndre generasjons Mac Pro ble annonsert under Apple Worldwide Developers Conference den 10. juni 2013. Den nye maskinen omfattet en radikal redesigning fra tidligere Mac Pro maskiner, med en overgang fra det gamle rektangulære designet, til et nytt svart aluminiums-kabinett formet som en sylinder. Det nye designet, skal kun ta opp omtrent en åttendedel av volumet av tidligere modeller, og skal takket være ett mye mer effektivt viftedesign holde et volum på kun 12db i hvilemodus."},{"page_url":"https://fr.wikipedia.org/wiki/Bravo_(cha%C3%AEne_de_t%C3%A9l%C3%A9vision_am%C3%A9ricaine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Bravo_TV_%282017_Logo%29.png","page_title":"Bravo (chaîne de télévision américaine)","context_page_description":"Bravo est une chaîne de télévision américaine, disponible sur le câble et le satellite, appartenant au groupe NBCUniversal. Lancée le 1ᵉʳ décembre 1980 et à l'origine orientée cinéma et beaux-arts, la chaîne a aujourd'hui une programmation essentiellement composée de téléréalités et de talk-shows, et s'adresse à un public féminin sur une tranche d'âge 25-54 ans.\\nLe siège social de Bravo est situé dans le GE Building, dans la ville de New York. Andy Cohen, personnalité emblématique de la chaîne, animateur du late-night show Watch What Happens Live et créateur du concept The Real Housewives, est vice-président des programmes et de la production de la chaîne. Selon Nielson Ratings, la chaîne Bravo était accessible en juin 2013 dans 95 millions de foyers."},{"page_url":"https://it.wikipedia.org/wiki/Patrick_van_Aanholt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/20160604_AUT_NED_8883.jpg","page_title":"Patrick van Aanholt","context_page_description":"Patrick John Miguel van Aanholt è un calciatore olandese, difensore del Crystal Palace e della nazionale olandese con la quale è stato finalista nella UEFA Nations League 2018-2019."},{"page_url":"https://es.wikipedia.org/wiki/Martin_Luther_King_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/MLK_April4_rally.jpg","page_title":"Martin Luther King III","context_page_description":"Martin Luther King III, es un defensor de los derechos humanos y activista comunitario estadounidense. Es el hijo mayor de Dr. Martin Luther King y Coretta Scott King."},{"page_url":"https://ast.wikipedia.org/wiki/Villanueva_de_las_Peras","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Iglesiathumb.jpg","page_title":"Villanueva de las Peras","context_page_description":"Villanueva de las Peras ye un conceyu español perteneciente a la contornes de Benavente y Los Valles, na provincia de Zamora y la comunidá autónoma de Castiella y Llión."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%DB%8C%D8%AA%DA%A9%D9%88%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Kv%C3%ADtkov_vlajka.jpg","page_title":"کویتکوو","context_page_description":"کویتکوو یک منطقهٔ مسکونی در جمهوری چک است که در ناحیه تشسکا لیپا واقع شده‌است."},{"page_url":"https://pt.wikipedia.org/wiki/Khoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Khoya.JPG","page_title":"Khoa","context_page_description":"Khoa é um derivado do leite, feito de leite integral em pó ou evaporado, aquecidos em uma panela aberta.\\nSimilar à ricota, mas com menos umidade e feito com leite integral ao invés de soro de leite.\\nExistem três tipos de khoa - batti, chickna e daan-e-daar.\\nBatti significa \\"rocha\\", tem 50% de umidade e é o mais duro dos três. Pode ser curado por anos, durante os quais desenvolve um aroma único e uma superfície externa mofada.\\nChickna tem umidade de 80%\\nDaan-e-daar, o leite é coalhado com um ácido durante a fervura, tem uma umidade moderada\\nDiferentes tipos de khoa são usados em diferentes pratos."},{"page_url":"https://pl.wikipedia.org/wiki/Kormoran_okularowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Extinctbirds1907_P39_Carbo_perspicillatus0369.png","page_title":"Kormoran okularowy","context_page_description":"Kormoran okularowy – wymarły gatunek ptaka z rodziny kormoranów. Zamieszkiwał Wyspę Beringa wchodzącą w skład Wysp Komandorskich. Możliwe, że występował również na przyległym wybrzeżu Kamczatki.\\nZnanych jest 5 okazów muzealnych, odłowionych w latach 1840–1850.\\nGatunek po raz pierwszy opisany przez niemieckiego przyrodnika Georga Stellera w 1741 roku w trakcie drugiej ekspedycji na Kamczatkę Vitusa Beringa. Opisał gatunek jako duży, niezgrabny i prawie nielotny. Na temat trybu życia ptaka nic nie wiadomo, oprócz tego, że odżywiał się rybami. Ostatni przedstawiciel tego gatunku wyginął około roku 1850 na Ariy Rock. Główną przyczyną wyginięcia były polowania dla mięsa."},{"page_url":"https://ca.wikipedia.org/wiki/Overhalla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Namsen_sett_fra_Kvatningenfjell%2C_Namsos_i_bakgrunnen.jpg","page_title":"Overhalla","context_page_description":"Overhalla és un municipi situat al comtat de Trøndelag, Noruega. Té 3,636 habitants i té una superfície de 729.79 km². El centre administratiu del municipi és el poble de Ranemsletta.\\nEl municipi inclou part del llac d'Eidsvatnet, on neix el riu Namsen, que s'estén des de l'est cap a l'oest. En el moment en què arribi a la frontera amb Namsos, el Namsen ja és salobre i influenciat per les marees de l'oceà. El riu Nordelva també desemboca en un estuari al municipi. A la riba sud del Namsen, hi ha una zona muntanyosa que inclou diversos llacs, els quals marquen la frontera amb Snåsa.\\nLa població es concentra al centre de l'àmplia vall del riu Namsen. Els serveis públics, l'agricultura i el turisme són les principals fonts d'ingressos. Diverses empreses conegudes al país es troben en aquest municipi.\\nL'històric ferrocarril de la Línia de Namsos travessava el municipi en la seva ruta de Grong a Namsos. La línia va ser tancada al trànsit de passatgers el 1978, però el tràfic de mercaderies va continuar uns anys més, fins al seu tancament oficial el 2002. La Carrera Comtal Noruega 17 també travessa el municipi."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%99%D7%A4%D7%95%D7%AA_%D7%95%D7%99%D7%9E%D7%91%D7%9C%D7%93%D7%95%D7%9F_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Paris-FR-75-Roland_Garros-2_juin_2014-Nadal-23.jpg","page_title":"אליפות וימבלדון 2010","context_page_description":"אליפות וימבלדון 2010 הייתה תחרות טניס שנערכה על מגרשי הדשא של אצטדיוני הטניס בווימבלדון. התחרות התחילה ב-21 ביוני והסתיימה ב-4 ביולי. תוכנית התחרות כללה תחרויות גברים, תחרויות נשים ותחרויות זוגות גברים, זוגות נשים וזוגות מעורבים. לראשונה מאז שנות ה-60 אליזבת השנייה, מלכת הממלכה המאוחדת ביקרה בתחרויות."},{"page_url":"https://id.wikipedia.org/wiki/Kampung_nasi_kuning_Samarinda","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Kampung_naskun.jpg","page_title":"Kampung nasi kuning Samarinda","context_page_description":"Kampung Nasi Kuning merupakan julukan yang disematkan untuk Jalan Lambung Mangkurat, Kota Samarinda, Provinsi Kalimantan Timur, sebagai pusat berkumpulnya para penjual nasi kuning khas Samarinda yang beroperasi dari malam hingga dini hari. Kampung Nasi Kuning diresmikan oleh Wali kota Samarinda, Syaharie Jaang, pada tahun 2013."},{"page_url":"https://pl.wikipedia.org/wiki/Orla_Prze%C5%82%C4%85czka_Wy%C5%BCnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Buczynowe_Turnie_z_Wyzniej_Kopy.jpg","page_title":"Orla Przełączka Wyżnia","context_page_description":"Orla Przełączka Wyżnia – położona na wysokości około 2166 m przełęcz w długiej wschodniej grani Świnicy w polskich Tatrach Wysokich. Znajduje się w zachodniej grani Orlej Baszty i oddziela od siebie Orle Turniczki: Wielką Orlą Turniczkę na zachodzie i Małą Orlą Turniczkę na wschodzie. Południowe stoki Orlich Turniczek opadają do Dolinki Buczynowej, północne do doliny Pańszczycy. Przełęcz jest drobna, ale stosunkowo szeroka.\\nWierzchołki Orlich Turniczek oraz Orla Przełączka Wyżnia są niedostępne dla turystów. Z Granackiej Przełęczy szlak Orlej Perci prowadzi północnymi stokami Wielkiej i Małej Orlej Turniczki oraz Orlej Przełączki Wyżniej. Odcinek ten jest eksponowany i ubezpieczony łańcuchami, w jednym miejscu pionowy odcinek pokonuje się drabinką. Na drugą stronę grani Orla Perć przechodzi w sąsiedniej Orlej Przełączce Niżniej, oddzielającej Małą Orlą Turniczkę od szczytu Orlej Baszty."},{"page_url":"https://hu.wikipedia.org/wiki/Koppenh%C3%A1ga_f%C5%91p%C3%A1lyaudvar","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Copenhagen_H_street_side.JPG","page_title":"Koppenhága főpályaudvar","context_page_description":"Koppenhága főpályaudvar vasútállomás Dánia fővárosában, Koppenhágában.\\nA vasútállomásra egyaránt érkeznek elővárosi, regionális és nemzetközi járatok is."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%BA%CF%81%CE%B5%CE%B3%CE%BA_%CE%9B%CE%BF%CF%85%CE%B3%CE%BA%CE%AC%CE%BD%CE%B9%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Greglouganis.jpg","page_title":"Γκρεγκ Λουγκάνις","context_page_description":"Ο Γκρέγκορι Ευθύμιος \\"Γκρεγκ\\" Λουγκάνις είναι Αμερικανός Ολυμπιονίκης στις καταδύσεις, ΛΟΑΤ ακτιβιστής και συγγραφέας, που κέρδισε Ολυμπιακά μετάλλια στους Ολυμπιακούς αγώνες του 1984 και του 1988 τόσο στο αναπηδητήριο όσο και στην πλατφόρμα. Είναι ο μόνος άντρας αθλητής και ο δεύτερος καταδύτης στην ιστορία των Ολυμπιακών αγώνων, που σάρωσε τα μετάλλια στις καταδύσεις σε συνεχόμενες Ολυμπιάδες. Το 1984, έλαβε το βραβείο James E. Sullivan Award από την Ερασιτεχνική Αθλητική Ένωση ως ο πιο εξαιρετικός ερασιτέχνης αθλητής των Ηνωμένων Πολιτειών."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%84%D9%82%D9%8A%D8%A7%D8%AA_%D8%A7%D9%84%D9%85%D9%8A%D8%A7%D9%87_%D8%A7%D9%84%D8%B9%D8%B0%D8%A8%D8%A9_%D8%B9%D8%AF%D9%8A%D9%85%D8%A9_%D8%A7%D9%84%D9%81%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Placobdella_2013_001.jpg","page_title":"علقيات المياه العذبة عديمة الفك","context_page_description":"علقات المياه العذبة عديمة الفك، فصيلة حيوانات من الحلقيات من رتبة العلقيات الخرطومية. تتطفل معظمها على الفقاريات في المياه العذبة مثل البرمائيات والسلاحف المائية، ولكن بعضها يتطفل على اللافقاريات."},{"page_url":"https://pl.wikipedia.org/wiki/Danville_(New_Hampshire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/DanvilleNH_ElmFarm.jpg","page_title":"Danville (New Hampshire)","context_page_description":"Danville – miasto w Stanach Zjednoczonych, w stanie New Hampshire, w hrabstwie Rockingham."},{"page_url":"https://en.wikipedia.org/wiki/USS_Curtiss_(AV-4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/USS_Curtiss_%28AV-4%29_burning_7_Dec_1941.jpg","page_title":"USS Curtiss (AV-4)","context_page_description":"USS Curtiss (AV-4) was a seaplane tender of the United States Navy. The ship was launched on 20 April 1940 by the New York Shipbuilding Corporation of Camden, New Jersey, sponsored by Mrs H. S. Wheeler, and commissioned on 15 November 1940, with Commander S. P. Ginder as her first commanding officer."},{"page_url":"https://en.wikipedia.org/wiki/List_of_largest_census-designated_places_in_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Ladera_Ranch.jpg","page_title":"List of largest census-designated places in California","context_page_description":"California is the most populous and third largest U.S. state by area, located on the West Coast of the United States. According to the 2010 United States Census, California's population is 37,253,956 and has 155,779.22 square miles of land.\\nCalifornia is divided into 58 counties and contains 1,043 census designated-places. San Francisco is a consolidated city–county, which means that San Francisco County does not contain any CDPs.\\nThe census-designated places in this list have a population of 10,000 or higher. Eastvale, Glen Avon, Mira Loma, Pedley, and Rubidoux have incorporated since the 2010 Census and thus are omitted from this list."},{"page_url":"https://it.wikipedia.org/wiki/Immendingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Oberes_Schloss_Immendingen_%28NNE%29.jpg","page_title":"Immendingen","context_page_description":"Immendingen è un comune tedesco di 5.941 abitanti, situato nel land del Baden-Württemberg."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_im_Stadtbezirk_Wenden-Thune-Harxb%C3%BCttel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/BS_Thune_Ortskern.JPG","page_title":"Liste der Kulturdenkmale im Stadtbezirk Wenden-Thune-Harxbüttel","context_page_description":"Die Liste der Kulturdenkmale im Stadtbezirk Wenden-Thune-Harxbüttel umfasst einen Teil der Kulturdenkmale im Braunschweiger Stadtbezirk Wenden-Thune-Harxbüttel, basierend auf dem Braunschweiger Leit- und Informationssystem BLIK und Veröffentlichungen der Denkmalschutzbehörde Braunschweig."},{"page_url":"https://oc.wikipedia.org/wiki/Parad%C3%ADs","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Adam_and_Eve_by_Lucas_Cranach_%28I%29.jpg","page_title":"Paradís","context_page_description":"Lo paradís o jardin d'Edèn representa sovent lo luòc final ont los umans seràn recompensats de lor bon comportament. Es un concèpt important presentat al començament de la Bíblia, dins lo libre de la Genèsi. A donc un sens particular per las religions abraamicas.\\nDins un sens mai larg, lo concèpte de paradís es present dins gaireben totas las religions. Los cresents parlan tanben del « Reialme de Dieu » que serà manifestat a la fin del mond. Un concèpte semblable, lo nirvana, existí dins l'indoïsme, lo jaïnisme e lo bodisme, pasmens se seriá dins aquel cas mai d'un estat esperital qu'un luòc fisic."},{"page_url":"https://ru.wikipedia.org/wiki/Cycloramphidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Cycloramphus_eleutherodactylus01.jpg","page_title":"Cycloramphidae","context_page_description":"Cycloramphidae — семейство бесхвостых земноводных. До 2011 года входило в состав семейства свистуновых."},{"page_url":"https://nn.wikipedia.org/wiki/Papa_Stour","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Aesha_Head%2C_Papa_Stour.jpg","page_title":"Papa Stour","context_page_description":"Papa Stour er ei i Shetlandsøyane i Skottland. Ho ligg sør i St. Magnus Bay, på nordvestsida av Shetland Mainland. I dag bur det om lag 20 personar på øya med hovudvekta i landsbyen Biggins i aust. Frå Biggins går det passasjerbåt til West Burrafirth på Shetland Mainland. Det er òg ei flystripe nær Biggins. Øya har ei dramatisk kystlandskap med staurar, bogar, bruer og sjøholer som har kome til ved erosjon.\\nPå øya finn ein ruinar etter eit hus som skal ha høyrt til Hertug Håkon, seinare Kong Håkon V av Noreg, på 1200-talet."},{"page_url":"https://fr.wikipedia.org/wiki/Goulven_de_L%C3%A9on","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Saint-Didier_ancien_ermitage_de_Saint-Goulven_photo_d%27ensemble.jpg","page_title":"Goulven de Léon","context_page_description":"Goulven, Goulwen ou Golven, devenu saint Goulven, fut évêque de Saint-Pol-de-Léon au VIIᵉ siècle."},{"page_url":"https://en.wikipedia.org/wiki/Fort_McKinley_(Maine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/12-inch_Mortars_at_Battery_Meigs%2C_Fort_Washington%2C_MD.png","page_title":"Fort McKinley (Maine)","context_page_description":"Fort McKinley is a former United States Army coastal defense fort on Great Diamond Island, Maine in Casco Bay, which operated from 1873 to 1947. It was named for President William McKinley. It included a sub-post, Fort Lyon, on Cow Island, just north of Great Diamond Island. Fort Lyon was named for Nathaniel Lyon. Both forts were part of the Coast Defenses of Portland, renamed the Harbor Defenses of Portland in 1925, a command which protected Portland's port and naval anchorage 1895-1950. In 1946 Fort Lyon was closed and turned over to the City of Portland. After Fort McKinley's closure it was transferred to the United States Navy, which sold the site to private interests in 1961. The Fort McKinley Historic District was listed on the National Register of Historic Places in 1985."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%92%D0%B5%D1%80%D0%BE%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Agerola.jpg","page_title":"Ађерола","context_page_description":"Ађерола је насеље у Италији у округу Напуљ, региону Кампанија.\\nПрема процени из 2011. у насељу је живело 7348 становника. Насеље се налази на надморској висини од 670 м."},{"page_url":"https://pl.wikipedia.org/wiki/Henryk_Jerzy_Chmielewski","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Publiczna_Szko%C5%82a_Powszechna_nr_3_ul._Rybaki_32.jpg","page_title":"Henryk Jerzy Chmielewski","context_page_description":"Henryk Jerzy Chmielewski, ps. „Papcio Chmiel” – polski grafik, rysownik i publicysta, autor serii komiksowej „Tytus, Romek i A’Tomek”, uczestnik powstania warszawskiego."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B5%D9%86%D8%AF%D9%84_%D9%85%D8%A4%D9%86%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/QuongdongNut_2005_SeanMcClean.jpg","page_title":"صندل مؤنف","context_page_description":"صندل مؤنف هي نوع نباتي يتبع جنس الصندل من الفصيلة الصندلية.\\nوهو نوع نبات ينتشر في جنوب أستراليا. ثماره لها طعم ثمار الخوخ لذلك يسمى خَوْخ الصحراء أو الخوخ البري."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A4%D0%B8%D1%88%D0%B5%D1%80_%D0%9A%D0%B0%D1%80%D0%BB_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/%D0%9E%D1%80%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B6%D1%8C%D0%B5._%D0%91%D0%B0%D1%88%D0%BA%D0%B8%D1%80%D0%BA%D0%B0_-_5._1870-%D0%B5._%D0%90%D0%B2%D1%82%D0%BE%D1%80_%D0%9A._%D0%A4%D0%B8%D1%88%D0%B5%D1%80.jpg","page_title":"Фишер Карл Андреевич","context_page_description":"Карл Андреевич Фишер — билдәле фотограф, Пруссия подданныйы; Мәскәүҙәге «К.Фишер, бывшая Дьяговченко» тип аталған иң эре фотография төшөрөү оҫтаханалары хужаһы. Мәскәү сәнғәт яратыусылар йәмғиәте ағзаһы, Рәсәй фотографик йәмғиәтен ойоштороусыларының береһе һәм уның ағзаһы, Рус нәшер эше эшмәкәрҙәре йәмғиәтенең Мәскәү бүлексәһе советы ағзаһы."},{"page_url":"https://cs.wikipedia.org/wiki/Ghostlights","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/20160611_Loreley_RockFels_Avantasia_0039.jpg","page_title":"Ghostlights","context_page_description":"Ghostlights je sedmé studiové album metalové opery Avantasia. Vydáno bylo 29. ledna 2016 prostřednictvím společnosti Nuclear Blast. Příběhově jde o pokračování předchozího alba The Mystery of Time, tvůrce projektu a skladatel Tobias Sammet tedy formou metafor naráží na neustálé zrychlování společnosti. Skládání písní začalo prakticky hned po dokončení desky Space Police: Defenders of the Crown Sammetovy druhé skupiny Edguy, nahrávání poté postupně probíhalo od října 2014 do listopadu dalšího roku v německém studiu Gate Studio. Desku produkoval Sascha Paeth. Přestože se na albu stále objevují různé experimentální prvky jiných stylů, je Ghostlights oproti předchozím nahrávkám více metalové. Jako hostující zpěváci se na albu podíleli Michael Kiske, Bob Catley, Jørn Lande, Ronnie Atkins, Sharon den Adel, Geoff Tate, Marco Hietala, Dee Snider, Robert Mason a Herbie Langhans.\\nAlbum se setkalo převážně s kladnými recenzemi ze strany kritiků, chválen byl především Sammetům tvůrčí styl a jeho výběr hostujících zpěváků. Deska bodovala i v hitparádách, celkem v devíti z nich se umístila mezi nejlepšími deseti alby."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%96%A9%E6%9B%BC%E5%B0%BC%E5%BE%B7%E5%B8%9D%E5%9C%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Samanid_dynasty_%28819%E2%80%93999%29.GIF","page_title":"薩曼尼德帝國","context_page_description":"萨曼尼德帝国是一个为期从公元819年到999年的逊尼派伊朗人帝国。该帝国存续期间的疆域主要是集中在呼罗珊以及河中地区；帝国在版图最大时涵盖当今的阿富汗全境，伊朗的大部分区域，塔吉克斯坦，土库曼斯坦，乌兹别克斯坦，吉尔吉斯斯坦，以及哈萨克斯坦和巴基斯坦的部分地区。\\n萨曼尼德帝国是由四个兄弟建立的。努阿·伊本·阿萨德，艾哈迈德·伊本·阿萨德，耶海·伊本·阿萨德，和伊利亚斯·伊本·阿萨德- 每位都在阿拔斯王朝宗主权下统治自己的领地。公元892年，伊斯梅尔·本·艾哈迈德将萨曼尼德统一，只由一位统治者治理，从而有效地结束萨曼尼德的封建制度。在他的领导下，萨曼尼德帝国脱离阿拔斯王朝而独立。\\n萨曼尼德帝国是伊朗人中兴时期中的一部分，在这段期间里波斯化社会的文化和身份被创造，让伊朗的语言和传统进入伊斯兰世界之中，后来更导致突厥-波斯文化的形成。\\n萨曼尼德帝国促进艺术发展，推动科学和文学发展，因此能吸引像鲁达基，菲尔多西，和伊本·西那等学者前往。在萨曼尼德帝国的统治时，布哈拉和巴格达互争光辉。学者们注意到，萨曼尼德帝国在复兴波斯语及文化上，比白益王朝和萨法尔王朝的功劳更胜一筹，同时继续赞助阿拉伯语的科学和宗教研究。他们认为自己是萨珊王朝的后裔。萨曼尼德帝国朝廷在一项著名的勒令中宣布：“在这地区，使用的语言是波斯语，而统治的国王都是波斯人。”"},{"page_url":"https://tr.wikipedia.org/wiki/Nathan_(peygamber)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/NathanandDavid.JPG","page_title":"Nathan (peygamber)","context_page_description":"Nathan, Tanah'ta geçen bir peygamber."},{"page_url":"https://it.wikipedia.org/wiki/Maddalena_Claudia_del_Palatinato-Zweibr%C3%BCcken-Birkenfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Magdalena_Claudia_von_Pfalz-Birkenfeld.jpg","page_title":"Maddalena Claudia del Palatinato-Zweibrücken-Birkenfeld","context_page_description":"Maddalena Claudia del Palatinato-Zweibrücken-Birkenfeld, nota anche come Maddalena Claudina, contessa palatina del Palatinato-Zweibrücken-Birkenfeld-Bischweiler."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%AB%E3%83%89%E3%83%AA%E3%83%83%E3%83%92%E3%83%BB%E3%83%8D%E3%82%A4%E3%82%A8%E3%83%89%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Nejedly.JPG","page_title":"オルドリッヒ・ネイエドリー","context_page_description":"オルドジフ・ネイェドリーは、チェコスロバキア出身のサッカー選手。ポジションはFW。\\n1934年に行われた第2回ワールドカップ・イタリア大会でチェコスロバキアの決勝進出に貢献した。4得点を挙げアンジェロ・スキアビオ、エトムント・コーネンと並び得点王となったとされていたが、2006年11月10日、FIFAにより準決勝のドイツ戦でハットトリックを達成していたことが発表され、5得点で単独の得点王として認められた。\\n続く1938年フランス大会にも出場して2得点を挙げている。\\n代表デビューは1931年6月16日のポーランド戦。"},{"page_url":"https://ceb.wikipedia.org/wiki/Plenkovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Plenkovice_flag.jpg","page_title":"Plenkovice","context_page_description":"Lungsod ang Plenkovice sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Jihomoravský kraj, sa habagatan-sidlakang bahin sa nasod, 170 km sa habagatan-sidlakan sa Prague ang ulohan sa nasod. 315 metros ibabaw sa dagat kahaboga ang nahimutangan sa Plenkovice, ug adunay 341 ka molupyo.\\nAng yuta palibot sa Plenkovice kay medyo bungtoron. Ang kinahabogang dapit sa palibot dunay gihabogon nga 350 ka metro ug 1.2 km sa amihanan-sidlakan sa Plenkovice. Dunay mga 442 ka tawo kada kilometro kwadrado sa palibot sa Plenkovice nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Znojmo, 7.8 km sa habagatan sa Plenkovice. Hapit nalukop sa kaumahan ang palibot sa Plenkovice. Sa rehiyon palibot sa Plenkovice, mga bungtod talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Agosto, sa 22 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 824 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 107 milimetro nga ulan, ug ang kinaugahan Marso, sa 24 milimetro."},{"page_url":"https://nl.wikipedia.org/wiki/Caracanthus_maculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/FMIB_42557_Caracanthus_maculatus_%28Gray%29.jpeg","page_title":"Caracanthus maculatus","context_page_description":"Caracanthus maculatus is een straalvinnige vissensoort uit de familie van schorpioenvissen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1831 door John Edward Gray.\\nDe soort komt voor in tropische zeeën in de Indo-Pacifische gebieden, de Micronesische eilanden, tot het zuiden van Japan. Ze houdt zich vaak op tussen koraalriffen op geringe diepte\\nHet zijn kleine vissen; tot 5 cm lang met een bleek lichaam bedekt met talrijke rode stippen. Ze zijn ook populair als aquariumvissen."},{"page_url":"https://fi.wikipedia.org/wiki/Samnilaissodat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Roman_conquest_of_Italy.PNG","page_title":"Samnilaissodat","context_page_description":"Samnilaissodilla viitataan kolmeen roomalaisten ja samnilaisten heimojen väliseen sotaan, jotka käytiin vuosien 343 eaa. ja 290 eaa. välillä. Samnilaiset olivat roomalaisten sitkeimpiä vihollisia Italiassa. He taistelivat vielä esim. liittolaissodassa Sullaa vastaan. Sotiin osallistuivat lähes kaikki Italian ryhmät, kuten etruskit, umbrit ja galleja.\\nVarsinkin toisessa, pitkässä sodassa roomalaiset kärsivät raskaita tappioita ja häväistystä. Vasta sodat Pyrrhosta ja Karthagoa vastaan toivat yhtä vaikeita tilanteita. Toisaalta vaikeudet johtivat myös sotilaallisiin uudistuksiin, ja lopulta Rooma nousi voiton turvin keskisen Italian valtiaaksi. Tasavalta sai lisää alueita ja asukkaita mikä vaikutti siihen, että Rooma alkoi käydä sotia muuallakin eikä vain paikallisia taisteluja."},{"page_url":"https://it.wikipedia.org/wiki/Luigi_Bellotti_Bon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Benque%2C_Franz_%281841-1921%29_-_Luigi_Bellotti_Bon_%28ca._1875%29.jpg","page_title":"Luigi Bellotti Bon","context_page_description":"Luigi Bellotti Bon è stato un attore teatrale, patriota e capocomico italiano."},{"page_url":"https://en.wikipedia.org/wiki/2015_in_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Perayaan_HUT_RI_ke-66_%2870%29.JPG","page_title":"2015 in Indonesia","context_page_description":"The following lists events that happened during 2015 in Indonesia."},{"page_url":"https://cs.wikipedia.org/wiki/Kaysville","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Kaysville_Tabernacle_of_the_LDS_Church.jpeg","page_title":"Kaysville","context_page_description":"Kaysville je město v okresu Davis County ve státě Utah ve Spojených státech amerických. K roku 2000 zde žilo 20 351 obyvatel. S celkovou rozlohou 26,1 km² byla hustota zalidnění 778,4 obyvatel na km²."},{"page_url":"https://sl.wikipedia.org/wiki/Kozarska_Dubica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Kozarska_Dubica.JPG","page_title":"Kozarska Dubica","context_page_description":"Kozarska Dubica je naselje in središče istoimenske občine v Republiki srbski, Bosna in Hercegovina."},{"page_url":"https://et.wikipedia.org/wiki/%C5%BBabno","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%C5%BBabno._Ko%C5%9Bci%C3%B3%C5%82_par._p.w._%C5%9Bw.Ducha%2C_wie%C5%BCa_bramna1.jpg","page_title":"Żabno","context_page_description":"Żabno on linn Poolas Väike-Poola vojevoodkonnas Tarnówi maakonnas. Linn asub Dunajeci jõe kaldal, Tarnówist umbes 16 km põhjakirdes.\\nÜrikutes on Żabnot esmakordselt mainitud 12. sajandil. Magdeburgi linnaõigused sai Żabno 1385. aastal. 1501. aastal põletasid linna maha tatarlased ja 1655. aastal Rootsi sissetungi ajal hävitati linn peaaegu täielikult. Esimese Poola jagamise tulemusel läks Żabno 1772. aastal Habsburgide Austria keisririigi koosseisu. 1799. aastal hävitas tulekahju peaaegu kogu linna. Esimeses maailmasõjas oli rindejoon mõnda aega Dunajeci jõel ja Żabno sai tugevast kannatada.\\nŻabno kaotas linnaõigused 1909. aastal, kuid sai need tagasi 1934. aastal.\\nAastatel 1975–1998 kuulus Żabno Tarnówi vojevoodkonna koosseisu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B9%D0%B4%D0%B0%D0%B1%D0%BE%D0%BB_(%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/%D0%9A%D0%B0%D1%80%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D0%BC%D0%BC%D0%B0_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B4%D0%B0%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%83%D0%B5%D0%B7%D0%B4%D0%B0.jpg","page_title":"Айдабол (род)","context_page_description":"Айдабо́л — крупный казахский род, входящий в состав рода Сүйіндік племени Среднего жуза Аргын и включающий в себя отдельные подроды. Родоначальником рода является Айдабол бий, расселяется род Айдабол преимущественно на территории современной Павлодарской области. В источниках Императорской России род упоминается как Айдабул. Тамга рода, как и у всех аргынов — Көз. Уран рода — Төртуыл.\\nПредставители рода известны по всему Казахстану."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D1%8D%D1%9E%D0%BD%D1%8D_(%D0%91%D0%B0%D1%80%D1%8B%D1%81%D0%BF%D1%96%D0%BB%D1%8C%D1%81%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Revne_bor_gerb.png","page_title":"Рэўнэ (Барыспільскі раён)","context_page_description":"Рэўнэ — вёска ў Барыспільскім раёне Кіеўскай вобласці Украіны."},{"page_url":"https://af.wikipedia.org/wiki/Australi%C3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Lake-ParlHouse.JPG","page_title":"Australië","context_page_description":"Australië, amptelik die Gemenebes Australië, is 'n grondwetlike monargie in die Suidelike Halfrond. Australië is die sesde grootste land ter wêreld en die enigste wat 'n hele vasteland beslaan – die Australiese kontinent. Australië se staatsgebied sluit daarnaas die eiland Tasmanië en 'n aantal ander eilande in die Indiese Oseaan, die Stille Oseaan en die Suidelike Oseaan in. Australië se buurlande is Indonesië, Oos-Timor en Papoea-Nieu-Guinee in die noorde, die Salomonseilande, Vanuatu en Nieu-Kaledonië in die noordooste en Nieu-Seeland in die suidooste. Dit is 'n grondwetlike monargie en 'n lid van die Britse Statebond.\\n'n Groot deel van dié land is woestynagtig en plat. Die vrugbare deel is 'n vlakte in die suidooste, waar die meeste van sy inwoners die hoogs verstedelikte ooskus bevolk. Die Australiese vasteland word egter reeds vir meer as 42 000 jaar deur Australiese Inboorlinge bewoon."},{"page_url":"https://es.wikipedia.org/wiki/Game_of_Thrones","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ramin_Djawadi_performing_by_Gage_Skidmore.jpg","page_title":"Game of Thrones","context_page_description":"Game of Thrones —llamada Juego de Tronos en España— es una serie de televisión de drama y fantasía medieval creada por David Benioff y D. B. Weiss y producida por la cadena HBO. Su argumento está inspirado en la serie de novelas Canción de hielo y fuego, escrita por el estadounidense George R. R. Martin, y relata las vivencias de un grupo de personajes de distintas casas nobiliarias en el continente ficticio de Poniente para tener el control del Trono de Hierro y gobernar los siete reinos que conforman el territorio.​\\nEl desarrollo de la serie se remonta a 2006, cuando Benioff y Weiss tuvieron una reunión con Martin para discutir ideas en torno a una adaptación televisiva de su material literario.​​ Si bien los guiones del episodio piloto, «Winter is Coming», quedaron concluidos en 2008, ​​ las grabaciones tuvieron lugar en 2010 bajo la dirección de Tim Van Patten.​ A lo largo de ocho temporadas y más de sesenta episodios, Game of Thrones cubre el argumento de las primeras cinco novelas de Martin con ciertas modificaciones​ y la adición de material inédito a partir de una descripción del autor sobre los eventos futuros de su universo literario.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A2%D7%99%D7%99%D7%A8%D7%94_%D7%94%D7%95%D7%95%D7%99%D7%A7%D7%98%D7%95%D7%A8%D7%99%D7%90%D7%A0%D7%99%D7%AA_%D7%91%D7%9C%D7%99%D7%A1%D7%98%D7%A1_%D7%94%D7%99%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Reconstructed_colliery%2C_Blists_Hill_-_geograph.org.uk_-_260289.jpg","page_title":"העיירה הוויקטוריאנית בליסטס היל","context_page_description":"המוזאון הפתוח של בליסטס היל, הנקרא גם העיירה הוויקטוריאנית של בליסטס היל, נמצא בעיירה מָדֶלֶי במחוז שרופשייר שבאזור מערב המידלנדס במערב אנגליה. המוזיאון הוא חלק מאתר המורשת העולמית \\"עמק איירונברידג'\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Iossif_Grigoulevitch","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Josip_Broz_TIto_and_Iosif_Grigulevich.jpg","page_title":"Iossif Grigoulevitch","context_page_description":"Iossif Romualdovitch Grigoulevitch a été l'un des « illégaux » soviétiques les plus remarquables du XXᵉ siècle. Il est né au sein d'une famille juive karaïte de Crimée"},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%85%E0%A8%B0%E0%A8%9C%E0%A9%81%E0%A8%A8_%E0%A8%AC%E0%A8%BF%E0%A8%9C%E0%A8%B2%E0%A8%BE%E0%A8%A8%E0%A9%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Arjun_Bijlani_at_the_launch_of_Saumya_Shetty%27s_resto_bar_-_Hymus.jpg","page_title":"ਅਰਜੁਨ ਬਿਜਲਾਨੀ","context_page_description":"ਅਰਜੁਨ ਬਿਜਲਾਨੀ ਇੱਕ ਭਾਰਤੀ ਟੈਲੀਵਿਜ਼ਨ ਅਤੇ ਫ਼ਿਲਮ ਅਦਾਕਾਰ ਹੈ। ਉਸ ਦਾ ਡੈਬਿਉ ਟੈਲੀਵਿਜ਼ਨ ਸ਼ੋਅ ਬਾਲਾਜੀ ਟੈਲੀਫਿਲਮਜ਼ ਸ਼ੋਅ ਕਾਰਤਿਕਾ ਸੀ, ਜੋ ਹੰਗਾਮਾ ਟੀਵੀ 'ਤੇ ਦਿਖਾਇਆ ਗਿਆ ਸੀ, ਉਹ ਫਿਰ ਲਿਫਟ ਰਾਇਟ ਲਿਫਟ, ਮਿਲੇ ਜਬ ਹਮ ਤੁਮ, ਮੇਰੀ ਆਸਿਕੀ ਤੁਮ ਸੇ ਹੀ, ਨਾਗਿਨ, ਕਵਚ, ਪਰਦੇਸ ਮੈਂ ਹੈ ਮੇਰਾ ਦਿਲ ਅਤੇ ਇਸ਼ਕ ਮੈਂ ਮਰਜਾਵਾਂ ਸਮੇਤ ਹੋਰ ਬਹੁਤ ਸਾਰੇ ਸ਼ੋਅ ਵਿਚ ਦਿਖਾਈ ਦਿੱਤਾ।\\n2016 ਵਿੱਚ ਉਸਨੇ ਡਾਂਸ ਰਿਏਲਟੀ ਸ਼ੋਅ ਝਲਕ ਦਿਖਲਾ ਜਾ ਵਿੱਚ ਹਿੱਸਾ ਲਿਆ ਸੀ। 2016 ਵਿੱਚ ਉਸਨੇ ਫ਼ਿਲਮ 'ਡਾਇਰੈਕਟ ਇਸ਼ਕ' ਨਾਲ ਬਾਲੀਵੁੱਡ ਵਿੱਚ ਵੀ ਸ਼ੁਰੂਆਤ ਕੀਤੀ ਸੀ। 2018 ਵਿੱਚ ਉਸਨੇ ਕਲਰਜ ਟੀਵੀ ਤੇ ਡਾਂਸ ਰਿਏਲਟੀ ਸ਼ੋਅ ਡਾਂਸ ਦੀਵਾਨੇ ਦੀ ਮੇਜ਼ਬਾਨੀ ਕੀਤੀ।"},{"page_url":"https://sv.wikipedia.org/wiki/Cetkovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Cetkovice_vlajka.jpg","page_title":"Cetkovice","context_page_description":"Cetkovice är en ort i Tjeckien. Den ligger i länet Södra Mähren, i den östra delen av landet, 170 km öster om huvudstaden Prag. Cetkovice ligger 401 meter över havet och antalet invånare är 730.\\nTerrängen runt Cetkovice är varierad. Den högsta punkten i närheten är 596 meter över havet, 2,1 km öster om Cetkovice. Runt Cetkovice är det ganska tätbefolkat, med 52 invånare per kvadratkilometer. Närmaste större samhälle är Velké Opatovice, 4,8 km nordväst om Cetkovice. Trakten runt Cetkovice består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 6 °C. Den varmaste månaden är augusti, då medeltemperaturen är 18 °C, och den kallaste är januari, med -8 °C. Genomsnittlig årsnederbörd är 939 millimeter. Den regnigaste månaden är juni, med i genomsnitt 119 mm nederbörd, och den torraste är mars, med 40 mm nederbörd."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%DB%8C%D9%85%D9%86%D9%87%D8%A7%D9%88%D8%B2%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Hufeisenturm_5.jpg","page_title":"ایمنهاوزن","context_page_description":"test\\nایمنهاوزن آلمانین هسن ایالتینده یئر آلان بیر شهردیر و ۳۳۹ متر دنیز سئویه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۷۲۴۲ نفر دیر. بۇ شهرین ۲۸٫۵۳ کیلومتر موربّع ساحه سی وار."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%B8_%D0%9B%D1%96%D0%B2%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Libya_Montes_-_THEMIS_image.JPG","page_title":"Гори Лівії","context_page_description":"Гори Лівії — це високогірна область на планеті Марс, котра піднеслася внаслідок масштабного удару космічного тіла об поверхню планети — зіткнення, внаслідок якого утворився басейн Ісіди на північ звідси.\\n1999 року цей регіон став одним з двох найбільш ймовірних кандидатів, де мав здійснити посадку космічний апарат Mars Surveyor 2001 Lander, однак цю місію скасували. Басейн Ісіди — дуже древній. Таким чином, Libya Montes, що утворюють південний вал басейна Ісіди, містять чи не найстаріші породи, які тільки можна знайти на поверхні Марса, а тому висадка в цьому регіоні потенційно могла б забезпечити науковців інформацією щодо умов, які панували на планеті на ранній стадії її розвитку.\\nПісля того, як вони утворилися внаслідок зіткнення з космічним тілом, яке спричинило появу басейну Ісіди, гори Лівії з плином часу зазнали змін під впливом великого різноманіття процесів, серед яких — флювіальна активність, вітрова ерозія та імпактне кратероутворення."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%BB%91%E9%90%B5%E7%9B%A7%E5%8D%80%E8%BC%95%E9%90%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/ION_construction_Waterloo_Park_April_6_2015_photo1.jpg","page_title":"滑鐵盧區輕鐵","context_page_description":"滑铁卢区轻轨是加拿大安大略省滑铁卢区一条轻轨路线，全长约37公里，当中介乎滑铁卢市哥尼斯多加商场和基奇纳市费尔维公园商场的第一期路段占19公里，耗资8亿1800万加元，于2019年6月21日开通。余下南至剑桥市艾恩斯利总站的第二期路段则预料于第一期路段开通不久后动工兴建，完成之前则暂时以快速公交系统模式运行。系统将归入滑铁卢区政府旗下的公共交通机构葛兰河运输，为期10年的营运权与30年的维护权则由“GrandLinq”财团中标。"},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%80%E5%9B%BD%E7%A4%BE%E4%BC%9A%E4%B8%BB%E7%BE%A9%E8%AB%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Leon_trotsky.jpg","page_title":"一国社会主義論","context_page_description":"一国社会主義論とは、世界革命を経なくても一国で社会主義の建設が可能だとする考え方。1924年にヨシフ・スターリンが主張し、1928年のコミンテルン第六回大会で採択され、各国の共産党において支配的な見解となった。"},{"page_url":"https://it.wikipedia.org/wiki/Ucraini","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/1934-V_I_Vernadsky.jpg","page_title":"Ucraini","context_page_description":"Gli ucraini sono il gruppo etnico di maggioranza, di origine slava orientale, dell'Ucraina, con una popolazione totale compresa tra i 44 e i 47 milioni di individui di cui 37.541.700 stanziati in Ucraina."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D8%A7%D9%86%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Aragonese_castel_with_moat_%28Taranto%29.jpg","page_title":"تارانتو","context_page_description":"تارانتو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%A0%E7%BD%AE%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%E7%AC%A0%E7%BD%AE%E7%94%BA%E5%B8%83%E7%9B%AE%E5%B7%9D%E9%89%84%E6%A9%8B01.jpg","page_title":"笠置町","context_page_description":"笠置町は、京都府の南部に位置し、相楽郡に属する町。\\n郵便番号は619-1303。2019年10月1日現在の人口は1,178人。\\n「わかさぎのはばたくまち 美しい自然と史跡に恵まれた心ふれあう町」を町の標語に掲げている。町の特産品は、キジ肉、シイタケ。"},{"page_url":"https://cs.wikipedia.org/wiki/Piet_Oudolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/High_Line%2C_New_York_City_%282014%29_-_15.JPG","page_title":"Piet Oudolf","context_page_description":"Piet Oudolf je vlivný nizozemský zahradní architekt, školkař a spisovatel.\\nŽije a pracuje od roku 1982 v Hummelo v Gelderland. Je hlavní postavou z hnutí \\"New Perennial\\", používajícího záhony trvalek a travin, které byly vybrány pro jejich struktury a také jejich barvu květu. Zejména ve Švédsku, Velké Británii a ve Spojených státech si svou prací získal značný věhlas. je ho nejznámějším dílem je úprava památníku na počest osob kteří zemřeli při útocích 11. září 2001.\\nPiet Oudolf, Henk Gerritsen z Prionatuinen a malíř/návrhář Ton ter Linden jsou považováni za nejvýznamnější zástupce „holandské vlny“. Zdrojem jejich inspirace jsou přírodní rostlinná společenstva, umění a roční období.\\nSeznam projektů na jejichž úpravě se Piet Oudolf podílel, zahrnuje objekty v různých zemích po celém světě. Například navrhl úpravy High Line, Battery Park, ABN AMRO Bank, Hoogeland, Lurie Garden, gigantická zelená střecha v Millenium park a Scampston Hall. Je designérem interiéru zahrady Serpentine Gallery Pavilion v Londýně, kde spolupracoval se švýcarským architektem Peterem Zumthorem."},{"page_url":"https://sv.wikipedia.org/wiki/Cincinnati_Reds","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Joe_Morgan.jpg","page_title":"Cincinnati Reds","context_page_description":"Cincinnati Reds är en professionell basebollklubb i Cincinnati i Ohio i USA som spelar i National League, en av de två ligorna i Major League Baseball. Klubbens hemmaarena är Great American Ball Park."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D0%BA%D0%BE%D0%B4%D0%B8%D0%BB%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BA%D0%BE%D0%B6%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Bristol.zoo.crocskin.handbag.arp.jpg","page_title":"Крокодиловая кожа","context_page_description":"Кожа крокодилов, особенно аллигаторов, используется в кожевенной промышленности для изготовления различных галантерейных изделий. эти предметы носят эксклюзивный характер, являясь предметом роскоши. Из-за брюшных щитков-остеодерм кожа крокодилового каймана не идеальна для обработки; для выделки годится только кожа с боков. Интенсивно охотиться на этих кайманов стали, в основном, после истребления в 1950-х гг. других видов крокодилов. Кожу каймана часто выдают за кожу аллигатора. Кожа тупорылого крокодила считается низкокачественной и не пользуется большим спросом. Успешно действуют программы разведения крокодилов на специальных фермах, в основном с целью получения кожи."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%AD%E3%83%AA%E3%83%83%E3%82%AF%E8%AA%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Count_Rumford.jpg","page_title":"カロリック説","context_page_description":"カロリック説とは、物体の温度変化をカロリックという物質の移動により説明する学説。日本では熱素説とも呼ばれる。\\n物体の温度が変わるのは熱の出入りによるのであろうとする考えは古くからあったが、熱の正体はわからなかった。18世紀初頭になって、カロリックという目に見えず重さのない熱の流体があり、これが流れ込んだ物体は温度が上がり、流れ出して減れば冷える、とするカロリック説が唱えられた。カロリックはあらゆる物質の隙間にしみわたり、温度の高い方から低い方に流れ、摩擦や打撃などの力が加わることによって押し出されるものとされた。この考えは多くの科学者によって支持され、19世紀半ば過ぎまで信じられていた。"},{"page_url":"https://it.wikipedia.org/wiki/Serie_A_2018_(pallapugno)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/600px_Verde_e_Giallo_%28Bordato%29.png","page_title":"Serie A 2018 (pallapugno)","context_page_description":"La Serie A 2018, chiamata per ragioni di sponsorizzazione Serie A Trofeo Araldica, è stata la 97ª edizione del massimo campionato italiano di pallapugno maschile."},{"page_url":"https://en.wikipedia.org/wiki/Markus_U._Diethelm","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Markus-diethelm-ubs.jpg","page_title":"Markus U. Diethelm","context_page_description":"Markus U. Diethelm is a Swiss businessman. Currently, he serves as Group General Counsel of UBS Group AG, holding this position since 2014. Prior to that, he held the same position at UBS AG since September 2008, when Diethelm was initially appointed as a member of the Group Executive Board of UBS. Additionally, he served as an Executive Board member of UBS Business Solutions AG from 2015 to 2016."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2%D0%BD%D1%8B%D1%85_%D1%82%D1%80%D0%B5%D0%BD%D0%B5%D1%80%D0%BE%D0%B2_%D0%A4%D0%9A_%D0%A6%D0%A1%D0%9A%D0%90_(%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Valeriy_Gazzaev.jpg","page_title":"Список главных тренеров ФК ЦСКА (Москва)","context_page_description":"Ниже представлен список главных тренеров футбольного клуба ЦСКА и их главных достижений с 1936 года по настоящее время. За всю историю у клуба было 29 главных тренера, не считая временно исполняющих обязанности.\\nЦСКА — российский футбольный клуб из Москвы, в прошлом — часть Центрального спортивного клуба Армии. Один из старейших и самых титулованных клубов в постсоветской истории российского футбола, ведущий свою историю от команды ОЛЛС, основанной в 1911 году. Семикратный чемпион СССР, пятикратный обладатель Кубка СССР, шестикратный чемпион России, семикратный обладатель Кубка России и шестикратный обладатель Суперкубка России. Первый российский клуб, выигравший европейский клубный турнир.\\nСамым успешным в плане выигранных трофеев тренером в истории клуба является Валерий Газзаев, который выиграл 10 титулов для клуба. Дольше всех на посту главного тренера команды находился Борис Аркадьев, руководивший командой с 1944 по 1952 год, в общей сложности — 9 лет.\\nТренеры в данном списке отсортированы по дате подписания контракта с клубом."},{"page_url":"https://pl.wikipedia.org/wiki/Plac_Grunwaldzki_w_Katowicach","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Katowice_-_Karol_Stryja_02.JPG","page_title":"Plac Grunwaldzki w Katowicach","context_page_description":"Plac Grunwaldzki w Katowicach – plac znajdujący się w katowickiej dzielnicy Koszutka, w północnej części miasta. Usytuowany pomiędzy ulicą Sokolską, ulicą Gustawa Morcinka i ulicą Władysława Broniewskiego.\\nNa placu znajdują się zieleńce, alejki spacerowe z ławkami, rzeźba Jerzego Kwiatkowskiego „Rodzina” oraz fontanna Olimpijska, wykonana w kształcie koła o średnicy 5,5 m. Strumień wody dochodzi do wysokości 1,5 m; obiekt ma pięć dysz.\\nSkwer wytyczono w 1960 r. i zagospodarowano w ramach czynów społecznych. Wówczas nadano obowiązującą do dziś nazwę. Od strony zachodniej, przy ulicy Sokolskiej mieści się Centrum Sztuki Filmowej, w dawnym budynku kina „Kosmos”. Przy placu Grunwaldzkim znajduje się historyczny budynek biurowy, wzniesiony po 1950 w stylu konstruktywizmu. Jest to biurowiec Biura Studiów i Przemysłu Węglowego, zaprojektowany przez Janusza Ballenstedta. W obiekcie do niego dobudowanym mieści się siedziba Telewizji Silesia.\\nPlac został wyremontowany w 2003. Autorami nowej koncepcji zagospodarowania terenu z 2002 byli Alina i Andrzej Grzybowscy. Zlokalizowano na nim m.in. karuzelę, huśtawkę dwuosobową oraz zjeżdżalnię dla dzieci."},{"page_url":"https://no.wikipedia.org/wiki/Linbanan_Kristineberg-Boliden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Menstr%C3%A4sk.jpg","page_title":"Linbanan Kristineberg-Boliden","context_page_description":"Linbanan Kristineberg-Boliden var en taubane på 96 kilometer mellom gruvene ved Kristineberg og Boliden i Sverige. Banen ble satt i drift i 1943 og tatt ut av bruk i 1987. Den ble bygget for frakt av malm fra Skelleftefeltet og var da verdens lengste. Banen ble revet i 1987 bortsett fra en strekning på 13 km som drives som verdens lengste taubane for passasjertrafikk.\\nI Sverige var det under andre verdenskrig mangel på drivstoff og gummi. Boliden AB var derfor på jakt etter en alternativ måte å frakt sligmalmen fra sine gruver til smelteverket i Rönnskär. Mellom anrikningsverket i Boliden og Rönnskärsverket var det allerede jernbane. Lengst unna var gruven ved Kristineberg over 90 km i luftlinje. Den eneste kjøreveien var 140 km lang og gikk om Ruskträsk og Norsjö. Under krigen ble det også svært dyrt å kjøre lastebil.\\nPlanleggingen begynte i 1941 og vinteren ble 170 mann engasjert til forberedende arbeid. Lys fra luftvernets lyskastere ble brukt til å trekke en rett linje gjennom utmarken. En 40 meter bred gate ble hugget gjennom skogen.\\nI april 1942 begynte Nordströms Linbanor oppsetting av taubanen fra Kristineberg til Boliden."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B2%D9%85%D8%A9_%D8%B3%D8%B1%D9%8A%D9%84%D8%A7%D9%86%D9%83%D8%A7_%D8%A7%D9%84%D8%AF%D8%B3%D8%AA%D9%88%D8%B1%D9%8A%D8%A9_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/WEF_on_the_Middle_East_Arab_and_foreign_Ministers_Crop.jpg","page_title":"أزمة سريلانكا الدستورية 2018","context_page_description":"نشبت أزمة دستوريَّة في سريلانكا عام 2018 بعد إقدام رئيس البلاد مايتريبالا سيريسينا على تعيين رئيس الوزراء السابق والعضو البرلماني ماهيندا راجاباكشا رئيساً للوزراء يوم السادس والعشرين من شهر أكتوبر عام 2018 قبل إعفاءه لرئيس الوزراء رانيل ويكريمسينغه رسمياً من منصبه مما أدى إلى خلق وضع قانوني أصبح فيه للبلاد رئيسين للوزراء في الآن ذاته. اعتبر رئيس الوزراء ويكريمسينغه والحزب الوطني المتحد تعيين راجاباكشا مخالفاً للقانون رافضاً الاستقالة من منصبه."},{"page_url":"https://simple.wikipedia.org/wiki/Vend%C3%B4me","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Vendome03.jpg","page_title":"Vendôme","context_page_description":"Vendôme is a commune in central French, and is a subprefecture in the Loir-et-Cher department. It is also the capital of the arrrondissement of Vendôme and the administrative centre of the Vendôme canton.\\nVendôme is one of the main towns along the Loir river. It is the third largest city of the department after Blois and Romorantin-Lanthenay."},{"page_url":"https://nl.wikipedia.org/wiki/Seelandbrug","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Sjaellandsbroen.JPG","page_title":"Seelandbrug","context_page_description":"De Seelandbrug is een brug in Kopenhagen, de hoofdstad van Denemarken. De brug verbindt sinds 1 maart 1959 de Deense eilanden Seeland en Amager met elkaar. De Seelandbrug diende oorspronkelijk als inprikker van het landelijke wegennet naar het centrum van Kopenhagen.\\nIn 1983 werd de Amagermotorvejen geopend. Deze autosnelweg verbond de ringwegen van Kopenhagen met het centrum. Later werd de brug verbreed en werd er een spoorlijn overheen aangelegd. Dit werd gedaan voor de aanleg van de Sontbrug naar Zweden. Sindsdien is de Seelandbrug een belangrijke schakel in het wegennet van Scandinavië."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E7%8F%AD%E7%89%99%E5%BE%81%E6%9C%8D%E9%98%BF%E5%85%B9%E7%89%B9%E5%85%8B%E5%B8%9D%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Territorial_Organization_of_the_Aztec_Empire_1519.png","page_title":"西班牙征服阿兹特克帝国","context_page_description":"西班牙征服阿兹特克帝国，又称西班牙-阿兹特克战争，是西班牙殖民美洲的过程中最重要的战役之一。这一场战役之后西班牙殖民者成功镇压了阿兹特克人，并占领了今日墨西哥中部地区，但并未征服整个现代墨西哥地区。\\n自从哥伦布发现美洲大陆、并在那里建立了数个殖民据点之后，在西班牙王室的授权下，殖民者以殖民据点为根据地，四处派出远征队，发现、征服并且殖民新领地。1519年2月，西班牙殖民者在埃尔南·科尔特斯的率领下从墨西哥湾登陆，向阿兹特克前进，在此之前，科尔特斯没有任何军事经验。阿兹特克人却将他们请进了首都特诺奇蒂特兰。但西班牙人却软禁了皇帝蒙特祖马二世，向阿兹特克人勒索黄金。科尔特斯随后被愤怒的阿兹特克人击败，被迫逃亡到与阿兹特克敌对的国家特拉斯卡拉寻求庇护。一年之后，在特拉斯卡拉、森波阿拉等与阿兹特克敌对国家的帮助下，科尔特斯再次攻打阿兹特克，在1521年8月13日以沉重地代价攻陷了特诺奇提特兰，将其夷为平地，改建为墨西哥城。"},{"page_url":"https://fr.wikipedia.org/wiki/Rose_Selfridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Rose_Selfridge_and_familiy_1909.jpg","page_title":"Rose Selfridge","context_page_description":"Rose Amelia Selfridge était l'épouse du magnat du magasin Harry Gordon Selfridge. Elle faisait partie de la riche famille Buckingham de Chicago et avait hérité d'une grande quantité de biens et de l'argent de ses ancêtres. Elle a été bien éduquée et a beaucoup voyagé quand elle a rencontré Harry Selfridge à la fin des années 1880. Après ils se sont mariés, Rose a vécu quelque temps avec Harry à Chicago et apprécié la compagnie de sa famille. Plus tard, ils ont déménagé à Londres quand Harry a construit son nouveau magasin à Oxford Street. Son histoire a récemment été dépeinte dans la série télévisée Mr Selfridge."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen,_Pl%C3%A4tze_und_Br%C3%BCcken_in_Hamburg-Neustadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Pilatuspool.jpg","page_title":"Liste der Straßen, Plätze und Brücken in Hamburg-Neustadt","context_page_description":"Die Liste der Straßen, Plätze und Brücken in Hamburg-Neustadt ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Neustadt vorhandenen Straßen, Plätze und Brücken. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%9F%D0%B5%D1%82%D0%B0%D1%80_%D0%B8_%D0%9F%D0%B0%D0%B2%D0%BB%D0%B5%E2%80%9C_-_%D0%92%D0%B0%D1%80%D0%BE%D1%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Sv._Petar_i_Pavle_-_Varo%C5%A1.JPG","page_title":"Црква „Св. Петар и Павле“ - Варош","context_page_description":"Свети Петар и Павле — црква во селото Варош, непоссредно до Прилеп. Се смета дека е изградена некаде околу 14 век.Нејзината градба е најмногу споредувана со црквата Св.Никола. Таа е еднокорабна градба со полуобличест свод. Дел од старата црква кој бил срушен е обновен. Денешниот изглед и местополжба на храмот е од функционален карактер, со тоа што се наоѓа во источниот дел од населбата Варош, односно на патот кој води до останатите цркви. Во внатрешнота живописноста е делумно зачувана во неколку композиции. Црквата претставува регистриран споменик на културата."},{"page_url":"https://no.wikipedia.org/wiki/Parlamentsvalget_i_Hellas_september_2015","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Stavros_Theodorakis_2014a_cropped.jpg","page_title":"Parlamentsvalget i Hellas september 2015","context_page_description":"Parlamentsvalget i Hellas september 2015 var et valg til Hellas' parlament, avholdt 20. september 2015. Valget ble avholdt som et nyvalg før utløpet av den ordinære valgperiode i 2019. Det foregående parlamentsvalget i Hellas ble avholdt i januar 2015. Valget i september 2015 ble utskrevet etter at statsminister Alexis Tsipras 20. august 2015 kunngjorde sin avgang. Vassiliki Thanou ble da som første kvinne i denne stillingen, tilsatt som midlertidig statsminister i landet.\\nValget ble ifølge de første opptellinger vunnet av det venstreradikale partiet SYRIZA, som fikk ca. 35 % av stemmene, mens det konservative Nytt demokrati fikk ca. 28 %. Det høyreradikale Gyllent daggry ble det tredje største partiet.\\nValgreglene i Hellas innebærer at vinneren får en bonus på 50 medlemmer av parlamentet."},{"page_url":"https://sv.wikipedia.org/wiki/Mira_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Miraferry.jpg","page_title":"Mira River","context_page_description":"Mira River är ett vattendrag i Kanada. Det ligger i provinsen Nova Scotia, i den östra delen av landet, 1 200 km öster om huvudstaden Ottawa."},{"page_url":"https://la.wikipedia.org/wiki/Imperium_Ottomanicum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Peace-conference-memoranda-respecting-syria-arabia-palestine5.jpg","page_title":"Imperium Ottomanicum","context_page_description":"Imperium Ottomanicum plus quam sescentos annos fuit una ex maximis potentissimisque maris Mediterranei civitatibus."},{"page_url":"https://it.wikipedia.org/wiki/Alfa_Romeo_4C_Concept","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Alfa_Romeo_4C_Concept_%285488713442%29.jpg","page_title":"Alfa Romeo 4C Concept","context_page_description":"L'Alfa Romeo 4C Concept è una concept car realizzata da Alfa Romeo nel 2011. Presentata al salone dell'automobile di Ginevra, ha anticipato la 4C di serie messa in produzione nel 2013."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A6%27%D7%90%D7%A7%D7%94_%D7%A7%D7%90%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Chaka_Khan_in_Chris_March_01.jpg","page_title":"צ'אקה קאן","context_page_description":"צ'אקה קאן היא זמרת וכותבת שירים אמריקנית שזכתה בעשרה פרסי גראמי. קאן הייתה הסולנית של להקת רופוס. במדיה מיוחס לה מעמד של מלכת הפאנק. קאן מכרה יותר מ-200 מיליון עותקים של תקליטיה ברחבי העולם."},{"page_url":"https://hr.wikipedia.org/wiki/Zastava_Walesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Flag_of_Wales_%281959%E2%80%93present%29.svg","page_title":"Zastava Walesa","context_page_description":"Zastava Walesa nacionalna je velška zastava, sastoji se od crvenog koračajućeg zmaja, tj. \\"u prolazu\\", na zelenom i bijelom polju. Točan prikaz zmaja nije standardiziran. Službeno je priznata kao velška nacionalna zastava 1959. godine."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%8A%D8%AF%D9%86%D9%8A_%D9%88%D9%8A%D9%84%D8%B3%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Sydney_Wilson_PHC_2013-3.jpg","page_title":"سيدني ويلسون","context_page_description":"سيدني ويلسون ‏ هو لاعب سنوكر بريطاني، ولد في 6 أبريل 1990 في Southend-on-Sea في المملكة المتحدة."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B7%B4%E8%8E%B1%E9%87%8C%E4%BA%9A%E8%AF%BA%C2%B7%E8%B4%9D%E5%85%8B%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Retrato_de_Cecilia_B%C3%B6hl_de_Faber_%28Museo_del_Romanticismo_de_Madrid%29.jpg","page_title":"巴莱里亚诺·贝克尔","context_page_description":"巴萊里亞諾·多明格斯·貝克爾是19世紀西班牙風俗主義畫家。"},{"page_url":"https://fr.wikipedia.org/wiki/Peloton_de_gendarmerie_de_haute_montagne_de_La_R%C3%A9union","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/PGHM-R3_Domenjod_260217.jpg","page_title":"Peloton de gendarmerie de haute montagne de La Réunion","context_page_description":"Le Peloton de gendarmerie de haute montagne de La Réunion est une unité spécialisée de montagne de la Gendarmerie nationale basée sur l'île de La Réunion, département et région d'outre-mer français dans le sud-ouest de l'océan Indien. Composé de treize hommes lors de sa création le 1ᵉʳ octobre 1997, le PGHM a depuis lors secouru plus de 4 000 personnes. Il réalise actuellement plus de 400 interventions par an en s'appuyant sur ses propres moyens matériels ainsi que sur ceux de la Section aérienne de la gendarmerie de La Réunion. Le peloton est basé à Sainte-Marie au détachement air 181 La Réunion, d'où il rayonne sur tous les Hauts.\\nSeule unité de montagne de la Gendarmerie basée outre-mer, le PGHM est composé de personnels expérimentés qui ont tous été affectés au préalable dans un PGHM de métropole. L'effectif est complété par des gendarmes adjoints volontaires recrutés localement."},{"page_url":"https://hu.wikipedia.org/wiki/Pajzsos_cank%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Phryganea_grandis.jpg","page_title":"Pajzsos cankó","context_page_description":"A pajzsos cankó a madarak osztályának lilealakúak rendjébe, ezen belül a szalonkafélék családjába tartozó faj.\\nEz a közepes termetű parti madár Eurázsia északi mocsaraiban és láprétjein tölti a nyarat, illetve ott szaporodik. Vándorlásakor télen óriási csapatokba verődik. Legfőbb telelő helyei Dél- és Nyugat-Európa, Afrika, Dél-Ázsia és Ausztrália.\\nA madárnak jellegzetesen hosszú a nyaka és kidomborodó, csüngő begye van. Nemi kétalakúsága jelentős; a hím jóval nagyobb a tojónál. A nászidőszakban színes tollak nőnek a hímek fején, toll nélküli pofáján a bőre narancssárgává válik, begye megfeketedik, és nyaka körül a nyakfodorhoz hasonló gallér alakul ki. A tojó és a párzó időszakon kívül a hím tollazata is felül szürkésbarna, alul fehéres. Az udvarlás alatt a hímek a fej- és nyaktollakat felmeresztik. A nászruhás hím három különböző színű lehet; az egyik változat színe megegyezik a tojóéval. Dürgőhelye az úgynevezett lek. A hímek számos stratégiát vetnek be a sikeres párzás érdekében. A tojó évente csak egyszer párosodik, és a talajon jól elrejtett fészekbe általában négy tojást tojik. A tojó egyedül költi ki és neveli fel fészekhagyó fiókáit."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BC%D0%BE%D1%80%D0%B8%D1%98%D0%B0%D0%BB%D0%BD%D0%B8_%D0%BA%D0%BE%D0%BC%D0%BF%D0%BB%D0%B5%D0%BA%D1%81_%D0%91%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B0_%D0%B1%D0%B8%D1%82%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Batina4.jpg","page_title":"Меморијални комплекс Батинска битка","context_page_description":"Меморијални комплекс „Батинска битка“ отворен је 1976. године у знак сећања на учеснике Батинске битке новембра 1944. године."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%BA%D1%80%D0%B5%D0%BF%D0%BE%D1%81%D1%82%D0%B8%D1%82%D0%B5_%D0%B2_%D0%91%D1%8A%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Krepostni_steni.jpg","page_title":"Списък на крепостите в България","context_page_description":"Това е списък на някои от крепостите в България."},{"page_url":"https://de.wikipedia.org/wiki/Russische_Popmusik","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Sergei_Shnurov_3.jpg","page_title":"Russische Popmusik","context_page_description":"Russische Popmusik bzw. Popmusik aus Russland sind übergreifende Bezeichnungen für die populärmusikalischen Musikrichtungen, die in Russland beziehungsweise dem russischen Sprachraum gehört werden. Im Großen und Ganzen unterscheiden sich die Mechanismen der russischen Popmusik nur wenig von denjenigen anderer Industrieländer. Neben angelsächsisch dominierten, internationalen Popmusik-Produktionen, die auch im neuen Russland präsent sind, kommen spezielle landesspezifische Traditionen zum Tragen – etwa die landeseigene Folklore, die durch die Sowjet-Ära geprägte Unterhaltungsmusik, das russische Chanson sowie eine eigene Form landesorientierter Popmusik, die Popsa."},{"page_url":"https://it.wikipedia.org/wiki/Citt%C3%A0_Bianca_(Tel_Aviv)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Peltzman_%26_Wecht_House.JPG","page_title":"Città Bianca (Tel Aviv)","context_page_description":"32°04′40″N 34°46′26″E\\nLa Città Bianca fa riferimento alla presenza a Tel-Aviv di più di 4.000 edifici costruiti in stile Bauhaus o International Style negli anni trenta da architetti tedeschi ebrei immigrati nel Territorio britannico di Palestina a seguito della salita al potere del Nazionalsocialismo.\\nLa città è la maggiore al mondo per la presenza di edifici realizzati secondo i principi del Movimento Moderno.\\nNel 2003 l'Organizzazione delle Nazioni Unite per l'Educazione, la Scienza e la Cultura ha proclamato la Città Bianca di Tel-Aviv Patrimonio Culturale dell'Umanità, come «un sorprendente esempio dell'urbanistica e architettura di una nuova città del primo XX secolo».\\nLa citazione riconosce l'eccezionale adattamento di una tendenza architettonica moderna internazionale alle condizioni culturali e climatiche della città."},{"page_url":"https://de.wikipedia.org/wiki/Meister_des_Fischener_Vesperbildes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Schmerzensmutter_Frauenkapelle_Fischen.jpg","page_title":"Meister des Fischener Vesperbildes","context_page_description":"Als Meister des Fischener Vesperbildes wird der spätgotische Bildschnitzer bezeichnet, der um 1440/1450 ein Vesperbild geschaffen hat. Es stellt Maria als Schmerzensmutter dar und befindet sich heute in der 1667 erbauten Frauenkapelle in Fischen im Allgäu. Das Gnadenbild zählt zu den besonderen Sehenswürdigkeiten der reich ausgestatteten Kapelle.\\nDer Meister des Fischener Vesperbildes war wohl nur im engeren Raum um Fischen tätig."},{"page_url":"https://af.wikipedia.org/wiki/Arthur_Rimbaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Bateau_ivre_Rue_F%C3%A9rou_01.jpg","page_title":"Arthur Rimbaud","context_page_description":"Jean Nicolas Arthur Rimbaud was 'n Franse digter, avonturier en sakeman wat tans as een van die belangrikste persoonlikhede in die Franse digkuns beskou word en met sy werke invloed op die moderne literatuur en kunste uitgeoefen asook 'n verskeidenheid musikante geïnspireer het.\\nRimbaud, na wie dikwels as een van die voorlopers van surrealisme verwys word, het op 'n jong ouderdom begin om gedigte te skryf. Sy eerste werke het tydens sy laerskooljare ontstaan, maar nog voor sy 21ste verjaardag het hy sy pen neergelê. So het sy werke binne 'n kort tydperk van minder as vyf jaar ontstaan.\\nSy laat tienerjare word as Rimbaud se kreatiefste periode beskou. Sy genius, die bloeitydperk van sy digkuns, die ontploffing en skielike einde van sy digtersloopbaan word in biografieë as verrassend beskryf. Rimbaud het as vrygees en rustelose siel bekendgestaan. Hy het uitgestrekte reise op drie vastelande onderneem voordat hy kort ná sy 37ste verjaardag aan kanker oorlede is."},{"page_url":"https://hr.wikipedia.org/wiki/Kapela_Svetog_Ivana_Trogiranina","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Ceiling_of_Cathedral_of_St._Lovro_-_Trogir_-_Croatia.jpg","page_title":"Kapela Svetog Ivana Trogiranina","context_page_description":"Kapela Svetog Ivana Trogiranina je jedan je od najljepših renesansnih spomenika u Europi. Nalazi se uz sjeverni zid trogirske katedrale na mjestu gdje se do tada nalazila jedna kuća. Prema Radovanu Ivančeviću, kapela sv. Ivana Trogirskog je „najskladnija arhitektonsko- skulptoralna cjelina interijera što ju je umjetnost rane renesanse ostvarila u Europi“."},{"page_url":"https://sv.wikipedia.org/wiki/Allison_Williams","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Allison_Williams_July_2012.jpg","page_title":"Allison Williams","context_page_description":"Allison Williams, född 13 april 1988 i New Canaan i Connecticut, är en amerikansk skådespelare, komiker och musiker främst känd för rollen som Marnie i HBO-serien Girls. Hon har även framträtt på Funny or Die.\\nAllison Williams är utbildad på Yale University. Hon är dotter till Brian Williams som var nyhetsankare på NBC. Sedan 2015 är hon gift med Ricky Van Veen."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Domecy-sur-Cure","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Chateau-Domecy-2.JPG","page_title":"Château de Domecy-sur-Cure","context_page_description":"Le château de Domecy-sur-Cure est un château situé à Domecy-sur-Cure, en France."},{"page_url":"https://fr.wikipedia.org/wiki/Julien%27s_Restorator","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/JuliensRestorator_MilkSt_Snow_HistoryOfBoston_1828.png","page_title":"Julien's Restorator","context_page_description":"Le Julien's Restorator est l'un des premiers restaurants établis à Boston, dans le Massachusetts de 1793 à 1823, par le français Jean-Baptiste Gilbert Payplat, dit Julien. Auparavant, il n'existait que des « tavernes ou des pensions de famille »."},{"page_url":"https://en.wikipedia.org/wiki/4th_Alpini_Paratroopers_Regiment","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Nappina_rossa.png","page_title":"4th Alpini Paratroopers Regiment","context_page_description":"The 4th Alpini Paratroopers Regiment is a Ranger-type special forces regiment of the Italian Army, specializing in mountain combat. The regiment is one of four regiments of the Army Special Forces Command. The regiment is unit of the Italian Army's mountain infantry speciality, the Alpini, which distinguished itself in combat during World War I and World War II. The 4th Alpini Regiment is one of the most decorated units of the Italian Army, although its two Gold Medals of Military Valour were awarded to the regiment's currently inactive Alpini Battalion \\"Aosta\\", respectively the currently active Skiers Battalion \\"Monte Cervino\\"."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%88%D8%B1%D8%AA%D9%85%D9%88%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Dortmund_Oper_Kaufmann.jpg","page_title":"دورتموند","context_page_description":"دورتموند، هي مدينة مستقلة في شمال الراين-وستفاليا، ألمانيا. تقع في الجزء الأوسط من الولاية وتعتبر المركز الإداري والتجاري والثقافي لمنطقة الرور الشرقية، وعدد سكانها 601402 ممايجعلها ثامن أكبر مدينة في ألمانيا، وعلاوة على ذلك، تعتبر دورتموند أكبر مدينة من حيث المساحة والسكان في منطقة الرور، وهي منطقة حضرية يبلغ عدد سكانها 5.1 مليون نسمة وهي أكبر تجمع حضري في ألمانيا.\\nتأسست حوالي عام 882، وأصبحت دورتموند مدينة إمبراطورية حرة خلال القرن الثالث عشر إلى الرابع عشر، كانت هي \\"المدينة الرئيسية\\" في شمال الراين-وستفاليا\\nبعد حرب الثلاثين عام تم تدمير المدينة وتناقص أهميتها حتى بداية التصنيع. أصبحت المدينة بعد ذلك واحدة من أهم مراكز الفحم والصلب والبيرة في ألمانيا وبالتالي، كانت دورتموند واحدة من أكثر المدن التي تم قصفها في ألمانيا خلال الحرب العالمية الثانية. دمرت الغارات الجوية المدمرة في 12 مارس 1945 نسبة 98٪ من المباني في وسط المدينة. وهذه الغارات الجوية مع أكثر من 1110 طائرة فهي تملك الرقم القياسي لهدف واحد في الحرب العالمية الثانية.\\nوقد تكيفت المنطقة منذ انهيار صناعاتها من الفولاذ والفحم، وتحولت إلى التكنولوجيا الطبية الحيوية العالية، وتكنولوجيا الأنظمة الدقيقة والخدمات. في عام 2009، وتعد المدينة الأكثر استدامة في ألمانيا."},{"page_url":"https://ceb.wikipedia.org/wiki/Glossopsitta_porphyrocephala","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Purple-crowned_Lorikeet.png","page_title":"Glossopsitta porphyrocephala","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Lionel Dietrichsen ni adtong 1837 ang Glossopsitta porphyrocephala. Ang Glossopsitta porphyrocephala sakop sa kahenera nga Glossopsitta sa kabanay nga Psittacidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Glendale_Memorial_Park_Cemetery","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Glendale-Glendale_Memorial_Park-O_D_Betts.jpg","page_title":"Glendale Memorial Park Cemetery","context_page_description":"The Glendale Memorial Park Cemetery is a historic cemetery located at 7844 North 61st Avenue in Glendale, Arizona. The cemetery was originally called Glendale Memorial Park. It is the final resting place of various notable early citizens of Glendale. Among those who are interred in the cemetery are early pioneers, mayors, businessman and veterans who fought in every military conflict in which the United States has been involved starting from the American Civil War onward. Also, in the cemetery there is a memorial and 16 graves of immigrant farmers who perished in 1959, in a bus accident on Central Avenue."},{"page_url":"https://ms.wikipedia.org/wiki/Ikatan_ionik","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/NaF.gif","page_title":"Ikatan ionik","context_page_description":"Ikatan ionik adalah jenis ikatan kimia yang melibatkan daya tarikan elektrostatik antara ion bercas berlawanan. Ion-ion mewakili atom yang telah kehilangan satu atau lebih elektron dan atom yang telah mendapat satu atau lebih elektron. Pemindahan elektron dikenali sebagai electrovalence berbeza dengan covalence. Dalam kes yang paling mudah, kation ialah atom logam dan anion adalah atom bukan logam, tetapi ion ini boleh menjadi alam yang lebih kompleks, seperti ion molekul seperti NH4 ⁺ atau SO4²⁻. Dengan kata mudah, ikatan ionik adalah pemindahan elektron daripada logam kepada bukan logam agar kedua-dua atom untuk mendapatkan shell valens penuh\\nIa adalah penting untuk menyedari bahawa ikatan ionik bersih - di mana satu atom \\"mengambil\\" elektron daripada lain - tidak boleh wujud: Semua sebatian ionik mempunyai sedikit ikatan kovalen, atau perkongsian elektron. Oleh itu, istilah \\"ikatan ionik\\" diberikan apabila watak ionik adalah lebih besar daripada kovalen watak-iaitu, ikatan di mana perbezaan keelektronegatifan yang besar wujud di antara dua atom, menyebabkan ikatan menjadi lebih kutub berbanding ikatan kovalen di mana elektron dikongsi lebih sama rata."},{"page_url":"https://de.wikipedia.org/wiki/Stradling_(Familie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/St._Donats_Castle.jpeg","page_title":"Stradling (Familie)","context_page_description":"Die Familie Stradling war ein englisch-walisisches bzw. britisches Adelsgeschlecht."},{"page_url":"https://hu.wikipedia.org/wiki/Hindu_templom%C3%A9p%C3%ADt%C3%A9szet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Konark_sun_temple_01.JPG","page_title":"Hindu templomépítészet","context_page_description":"A hindu templomépítészet teológiai hagyományok által szabályozott, szigorú geometriai formák rejtett jelentésein alapuló építészeti stílus, amely az 5. századtól kezdve mind a mai napig meghatározza a hindu vallás legszentebb kegyhelyeinek kialakítását és azok építési munkálatait szerte a világon.\\nA buddhista, hindu és dzsainista tradíciók már évszázadok óta együtt élnek az indiai szubkontinensen. A különböző vallások követői között a legváltozatosabb hiedelmek, ezzel együtt a templomok formáinak bizonyos keveredése figyelhető meg. A buddhisták építették a legkorábbi fennmaradt szentélyeket Indiában, egyúttal létrehozták azt a modellt is, amelyen az 5. századtól kezdve a korai hindu építészet alapult, amikor már a hinduizmus lett az uralkodó vallás a szubkontinensen. A hindu építészet máig erőteljesen támaszkodik bizonyos ősi bennszülött hagyományokra, ezzel együtt az évszázadok folyamán fokozatosan kifejlesztett egy különleges építészeti önkifejezési stílust, amelyet a hindu befolyás alatt álló dél-ázsiai térség számos vidékén átvettek és a helyi jellegzetességekkel vegyítve továbbfejlesztettek."},{"page_url":"https://de.wikipedia.org/wiki/Lederfabrik_Sohre","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/2019_Freital_Abriss_der_Lederfabrik.jpg","page_title":"Lederfabrik Sohre","context_page_description":"Die Lederfabrik F. G. Sohre AG war ein Unternehmen im Stadtteil Deuben der sächsischen Stadt Freital. Die Produktion wurde 1991 eingestellt, das Werksgebäude wurde 2019 abgerissen. Es soll ein Stadtteilpark mit offenen Mühlgraben entstehen."},{"page_url":"https://pl.wikipedia.org/wiki/Emil_M%C5%82ynarski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Emil_M%C5%82ynarski.jpg","page_title":"Emil Młynarski","context_page_description":"Emil Szymon Młynarski herbu Belina – polski dyrygent, skrzypek, kompozytor, współzałożyciel i dyrektor Filharmonii Warszawskiej w latach 1901–1905."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E5%85%AC%E5%85%B1%E5%B1%8B%E9%82%A8%E4%B8%80%E8%A6%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Tak_Tin_Estate.jpg","page_title":"香港公共屋邨一覽","context_page_description":"呢個係香港資助出租公共屋邨嘅一覽表。去到2020年4月為止，香港總共有251個公共屋邨同超過85萬個單位。呢個表以地區劃分，再以首次入伙年份排（「一邨」、「二邨」等等有細分嘅屋邨會當係唔同屋邨同埋由原址分拆而成嘅，個表入面會放埋一齊，方便比較）。\\n公共屋邨，就係指由政府、志願團體或者私營企業興建，再以廉價租畀低收入居民嘅住宅。而家香港提供公共屋邨嘅機構有三間，分別係香港房屋委員會（房委會）、香港房屋協會（房協）同埋香港平民屋宇有限公司（平民屋宇）。另外重有兩間情況唔清楚嘅建屋團體，佢哋而家嘅情況就連房委會同房協都唔清楚：\\n香港模範屋宇會：原本起同管理鰂魚涌模範邨，之後喺1979年11月由房屋委員會接管。\\n香港經濟屋宇會：原本起同管理大角咀葛量洪夫人新村，之後因為起西九龍走廊，1977年1月1號開始部分單位要由政府接管同拆卸。直到1980年代淨低嘅單位都因應房協「市區改善計劃」而拆咗，呢啲單位而家嘅位置係喺房協頌賢花園，喺1988年落成。"},{"page_url":"https://fr.wikipedia.org/wiki/Pomitchna","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Ukraine_relief_location_map.jpg","page_title":"Pomitchna","context_page_description":"Pomitchna ou Pomochnaïa est une ville de l'oblast de Kirovohrad, en Ukraine. Sa population s'élevait à 9 210 habitants en 2013."},{"page_url":"https://nn.wikipedia.org/wiki/Velykyj_Kujalnik","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Velikyi_Kuyalnyk1.jpg","page_title":"Velykyj Kujalnik","context_page_description":"Velykyj Kujalnik, eller Bolshoj Kujalnik er ei elv i Podilsk, Ananjiv, Sjyrjajeve og Ivanivka rajon i Odessa oblast i Ukraina. Munningen er Kujalnikestuaret i Svartehavet. Elva er rundt 150 km lang, og har eit nedslagsfelt på 1860 km². Busetnadane Sjyrjajeve og Ivanivka ligg ved breidden av Velykyj Kujalnik.\\nHistorisk har elva vore farbar, og saman med Dnestr blei ho brukt til å transportera varer til Svartehavet, utanom stryka i Dnjepr. I 2007-2008 bygde ulovlege sandhaustarar ein demning ved munningen av elva, slik at Velykyj Kujalnik ikkje rann ut i havet meir. Demningen blei ikkje riven, slik at estuaret tørka ut."},{"page_url":"https://sv.wikipedia.org/wiki/Herman_Wrangel_(1859%E2%80%931938)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Gen._Herman_Wrangel.jpg","page_title":"Herman Wrangel (1859–1938)","context_page_description":"Herman Georg Waldemar Wrangel, född 30 mars 1859 i Stockholm, död 13 januari 1938, var en svensk sjömilitär och politiker. Han var general och chef för Kustartilleriet."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%88%D8%B1%D9%86_(%D8%B4%D9%87%D8%B1_%D8%A7%D8%AA%D8%B1%DB%8C%D8%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Doren_im_Bezirk_B.png","page_title":"دورن (شهر اتریش)","context_page_description":"دورن یک منطقهٔ مسکونی در اتریش است که در ناحیه برگنتس واقع شده‌است. دورن ۱۴٫۱۷ کیلومتر مربع مساحت دارد ۷۱۱ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://sl.wikipedia.org/wiki/Velika_nagrada_Nizozemske_1979","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Jones_at_1979_Dutch_Grand_Prix.jpg","page_title":"Velika nagrada Nizozemske 1979","context_page_description":"Velika nagrada Nizozemske 1979 je bila dvanajsta dirka Svetovnega prvenstva Formule 1 v sezoni 1979. Odvijala se je 26. avgusta 1979.\\nVodilni: Alan Jones; Gilles Villeneuve."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%80%A0%E5%B9%A3%E5%B1%80_(%E6%97%A5%E6%9C%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Japan_Mint_2005.jpg","page_title":"造幣局 (日本)","context_page_description":"独立行政法人造幣局は、硬貨の製造、勲章・褒章及び金属工芸品等の製造、地金・鉱物の分析及び試験、貴金属地金の精製、貴金属製品の品位証明などの事業を行う日本の独立行政法人。\\n職員の身分は国家公務員である。なお、紙幣の製造は行わず、これは独立法人国立印刷局で行われる。"},{"page_url":"https://ca.wikipedia.org/wiki/Enllumenat_p%C3%BAblic","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Luz_de_farola.jpg","page_title":"Enllumenat públic","context_page_description":"L'enllumenatge públic o lluminària o és el servei públic consistent en la il·luminació de les vies públiques, parcs públics i altres espais de lliure circulació que no es trobin a càrrec de cap persona natural o jurídica de dret privat o públic, diferent del municipi, per tal de permetre la visibilitat adequada per al normal desenvolupament de les activitats. En general l'enllumenatge públic a les ciutats o centres urbans és un servei municipal encara que en carreteres o infraestructures viàries importants correspon al govern central o regional."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D9%8A%D9%86%D9%88%D9%86_%D9%84%D9%88%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Lowe%27s_Mona_Monkey.JPG","page_title":"غينون لوي","context_page_description":"غينون لوي ‏ هو نوع من الحيوانات يتبع جنس السعدان الغينون من فصيلة سعادين العالم القديم."},{"page_url":"https://ca.wikipedia.org/wiki/Tossal_del_Mort%C3%B2rum","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/T%C3%BAmulo.jpg","page_title":"Tossal del Mortòrum","context_page_description":"El Tossal del Mortòrum és un jaciment arqueològic situat enfront de la plana litoral de la Ribera de Cabanes, Torreblanca i Orpesa, a la comarca de la Plana Alta i dins del terme municipal de Cabanes.\\nEls estudis arqueològics han identificat com en diferents parts del turó es conserven diverses restes del passat, entre les quals destaquen un poblat i un túmul funerari. Així, s'ha determinat que el poblat va ser ocupat aproximadament entre els anys 1950 i 550 abans de l'Era, és a dir, des de l'Edat del Bronze a la primera Edat del Ferro; per la seva banda, el túmul va ser usat en diferents moments de l'Edat del Bronze com a sepulcre funerari del poblat.\\nLes primeres excavacions al Mortòrum van ser efectuades en 1925 a la zona del poblat, no obstant això la metodologia de l'època va provocar la pèrdua de la major part dels resultats i materials obtinguts. Des de l'any 2002 les excavacions s'han anat efectuant regularment gràcies a la col·laboració de l'Ajuntament de Cabanes amb el Servei d'Arqueologia de la Diputació de Castelló.\\nDes de l'any 2015 el Tossal del Mortòrum és visitable mitjançant una ruta senyalitzada amb panells explicatius."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_Prix_automobile_de_Bahre%C3%AFn_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Anti-F1_protester.JPG","page_title":"Grand Prix automobile de Bahreïn 2013","context_page_description":"Le Grand Prix automobile de Bahreïn 2013, disputé le 21 avril 2013 sur le circuit international de Sakhir, est la 882ᵉ épreuve du championnat du monde de Formule 1 courue depuis 1950. Il s'agit de la neuvième édition du Grand Prix de Bahreïn comptant pour le championnat du monde de Formule 1 et de la quatrième manche du championnat 2013.\\nEn qualifications, le samedi, Fernando Alonso domine la première manche puis, en deuxième manche, Sebastian Vettel réalise la meilleure performance. Nico Rosberg, au volant de sa Mercedes, obtient finalement la deuxième pole position de sa carrière. Sur la grille de départ, il est accompagné par Vettel en première ligne, suivi des Ferrari d'Alonso et de Felipe Massa\\nLewis Hamilton, quatrième des qualifications, est pénalisé de cinq places sur la grille pour cause d'intervention technique sur sa monoplace après les essais libres; de la même façon, Mark Webber, cinquième des qualifications, est relégué en quatrième ligne, sanctionné à la suite de son accrochage avec Jean-Éric Vergne lors du Grand Prix de Chine. Les Force India de Paul di Resta et d'Adrian Sutil en bénéficient pour s'élancer de la troisième ligne."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D0%BD%D0%B0_(%D1%81%D0%B0%D0%BD%D1%82%D0%B5%D1%85%D0%BD%D1%96%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/USS_Pampanito_crew%27s_head_sink_1.JPG","page_title":"Раковина (сантехніка)","context_page_description":"Ра́ковина — чашеподібне санітарно-технічне обладнання для миття рук, для миття посуду та інших цілей.\\nНазву пристрій отримав завдяки схожості за формою з великою мушлею двостулкових молюсків, подібну ж аналогію можна спостерегти і в польській мові: muszla klozetowa означає в ній «унітаз». Раковини, призначені для умивання, ще називають умивальниками, для миття посуду — мийками."},{"page_url":"https://pl.wikipedia.org/wiki/Bochen_(herb_szlachecki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/POL_COA_Bochen_I_odmienny.svg","page_title":"Bochen (herb szlachecki)","context_page_description":"Bochen − kaszubski herb szlachecki, herb własny rodziny Bochen. Ze względu na specyficzną historię regionu, mimo przynależności do Rzeczypospolitej, rodzina i herb nie zostały odnotowane przez polskich heraldyków."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%BF%D0%BE%D1%80%D1%89%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/CzAF_2011_OR7-Praporcik_shoulder.jpg","page_title":"Прапорщик","context_page_description":"Пра́порщик — військове звання молодшого командного складу в армії багатьох країн.\\nБлизький еквівалент званню «прапорщик» — молодше офіцерське звання «енсайн», що існує у ряді країн. Зазначене військове звання в Україні має відповідний код у НАТО OR-9."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BD%D0%B3%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D1%88%D0%BA%D0%B0_(%D0%B4%D0%BE%D0%BC%D0%B0%D1%88%D0%BD%D1%8F%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Bengal_-_20150316_19h59_%2810019%29.jpg","page_title":"Бенгальская кошка (домашняя)","context_page_description":"Бенгальская кошка, бенгал — межродовой гибрид домашней кошки и собственно бенгальской кошки."},{"page_url":"https://fr.wikipedia.org/wiki/Ma%C3%AEche","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Ruines_du_Vieux_Ch%C3%A2teau_Ma%C3%AEche.jpg","page_title":"Maîche","context_page_description":"Maîche est une commune française située dans le département du Doubs en région Bourgogne-Franche-Comté. Elle est le chef-lieu du canton de Maîche et de la communauté de communes du pays de Maîche. Sa population s'élevait en 2016 à 4 296 habitants appelés les Maîchois et Maîchoises.\\nSituée à mi-chemin entre Montbéliard et Morteau et à une dizaine de kilomètres de la frontière franco-suisse, Maîche est une petite ville de moyenne montagne du massif du Jura."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D6%80%D5%A1%D5%B6%D5%BD%D5%AB%D5%BD%D5%AF%D5%B8_%D4%BF%D5%A1%D5%AC%D5%BE%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Francisco_Calvo_FCN.jpg","page_title":"Ֆրանսիսկո Կալվո","context_page_description":"Ֆրանսիսկո Կալվո Խավիեր Կեսադա, կոստառիկացի ֆուտբոլիստ, MLS «Մինեսոտա Յունայթեդ» ակումբի և Կոստա Ռիկայի հավաքականի պաշտպան։"},{"page_url":"https://pl.wikipedia.org/wiki/Sztandar_procesyjny","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Procesja_Wielkanocna_Wilamowice_2015_3.jpg","page_title":"Sztandar procesyjny","context_page_description":"Sztandar procesyjny – parament w kształcie prostokątnego kawałka materiału zdobionego haftem, używany podczas procesji kościelnych i nabożeństw.\\nSztandary przejęte zostały ze świata militarnego. W średniowieczu swoje sztandary zaczęły posiadać miasta, były to tzw. gonfalony. Następnie tradycja posiadania sztandaru przyjęta została przez bractwa i wspólnoty kościelne."},{"page_url":"https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_Trung_T%C3%A2y,_%C4%90%C3%A0i_Nam","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Jhongsi_TN.svg","page_title":"Quận Trung Tây, Đài Nam","context_page_description":"Quận Trung Tây là một khu của thành phố Đài Nam, Trung Hoa Dân Quốc. Đây là quận trung tâm của thành phố và được sáp nhập từ hai quận Tây và Trung từ ngày 1 tháng 4 năm 2004. Khu vực quận từng là thủ phủ của Đài Loan trong gần 200 năm.\\nQuận Trung Tây có diện tích 6,4486 km², dân số vào tháng 8 năm 2011 đạt 78.837 người thuộc 30.240 hộ gia đình, mật độ cư trú là 12225,4 người/km²."},{"page_url":"https://vi.wikipedia.org/wiki/Vi%C3%A7osa_do_Cear%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/05_12_2015_Vicosa_CE_%28146_1%29.JPG","page_title":"Viçosa do Ceará","context_page_description":"Viçosa do Ceará là một đô thị thuộc bang Ceará, Brasil. Đô thị này có diện tích 1311,592 km², dân số năm 2007 là 52368 người, mật độ 39,93 người/km²."},{"page_url":"https://no.wikipedia.org/wiki/Diego_de_Deza","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Diego_Deza.jpg","page_title":"Diego de Deza","context_page_description":"Diego de Deza var en katolsk biskop, teolog og inkvisitor i Spania. Han var en av de mer kjente innen den spanske inkvisisjon, og etterfulgte Tomás de Torquemada som storinkvisitor."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D1%96_%D1%87%D0%BE%D0%B2%D0%BD%D0%B8_%D0%BF%D1%80%D0%BE%D1%94%D0%BA%D1%82%D1%83_641%D0%91_%C2%AB%D0%A1%D0%BE%D0%BC%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/B-307%2C_Togliatti._Russia-1.JPG","page_title":"Підводні човни проєкту 641Б «Сом»","context_page_description":"Підводні човни проєкту 641Б «Сом» — тип підводних човнів СРСР. Є модернізацією проєкту 641. З 1973 по 1982 рік на суднобудівному заводі «Червоне Сормово» було побудовано 18 підводних човнів цього проєкту. Підводні човни проєкту 641Б призначені для ведення бойових дій на океанських комунікаціях і у віддалених військово-морських баз і пунктів базування сил противника. У число завдань човнів цих проєктів входить знищення надводних кораблів і засобів противника, ведення дальньої оперативної розвідки, прикриття своїх конвоїв та здійснення активних мінних виставлень."},{"page_url":"https://es.wikipedia.org/wiki/Nicholas_Throckmorton","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/St_Katharine_Cree%2C_Leadenhall_Street%2C_London_EC3_-_Monument_-_geograph.org.uk_-_1085139.jpg","page_title":"Nicholas Throckmorton","context_page_description":"Sir Nicholas Throckmorton fue un importante político y diplomático inglés, embajador en Francia y Escocia, jugó un papel clave en las relaciones entre la reina Isabel I de Inglaterra y la reina María I de Escocia."},{"page_url":"https://en.wikipedia.org/wiki/Katy_Perry","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Katy_Perry_performing.jpg","page_title":"Katy Perry","context_page_description":"Katheryn Elizabeth Hudson, known professionally as Katy Perry, is an American singer, songwriter, and television judge. After singing in church during her childhood, she pursued a career in gospel music as a teenager. Perry signed with Red Hill Records and released her debut studio album Katy Hudson under her birth name in 2001, which was commercially unsuccessful. She moved to Los Angeles the following year to venture into secular music after Red Hill ceased operations and she subsequently began working with producers Glen Ballard, Dr. Luke, and Max Martin. After adopting the stage name Katy Perry and being dropped by The Island Def Jam Music Group and Columbia Records, she signed a recording contract with Capitol Records in April 2007.\\nPerry rose to fame in 2008 with her second album, One of the Boys, a pop rock record containing the controversial U.S number one song \\"I Kissed a Girl\\" and \\"Hot n Cold\\". All subsequent albums have topped the U.S. Billboard 200. The disco-influenced Teenage Dream spawned five chart topping U.S. Billboard Hot 100 singles–\\"California Gurls\\", \\"Teenage Dream\\", \\"Firework\\", \\"E.T.\\", and \\"Last Friday Night\\" — a record tying her with Michael Jackson's Bad."},{"page_url":"https://id.wikipedia.org/wiki/J._Christopher_Stevens","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Ambassador_christopher_stevens.jpg","page_title":"J. Christopher Stevens","context_page_description":"John Christopher Stevens adalah pengacara dan diplomat asal Amerika Serikat yang menjadi Duta Besar Amerika Serikat untuk Libya dari Juni 2012 hingga September 2012. Stevens tewas ketika terjadi penyerangan terhadap Konsulat Amerika Serikat di Benghazi, Libya pada tanggal 11 September 2012."},{"page_url":"https://en.wikipedia.org/wiki/Erinyes","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Klytaimnestra_Erinyes_Louvre_Cp710.jpg","page_title":"Erinyes","context_page_description":"The Erinyes, also known as the Furies, were female chthonic deities of vengeance in ancient Greek religion and mythology. A formulaic oath in the Iliad invokes them as \\"the Erinyes, that under earth take vengeance on men, whosoever hath sworn a false oath\\". Walter Burkert suggests they are \\"an embodiment of the act of self-cursing contained in the oath\\". They correspond to the Dirae in Roman mythology. The Roman writer Maurus Servius Honoratus wrote that they are called \\"Eumenides\\" in hell, \\"Furiae\\" on earth, and \\"Dirae\\" in heaven.\\nAccording to Hesiod's Theogony, when the Titan Cronus castrated his father, Uranus, and threw his genitalia into the sea, the Erinyes emerged from the drops of blood which fell on the earth, while Aphrodite was born from the crests of sea foam. According to variant accounts, they emerged from an even more primordial level—from Nyx, or from a union between air and mother earth. Their number is usually left indeterminate. Virgil, probably working from an Alexandrian source, recognized three: Alecto or Alekto, Megaera, and Tisiphone or Tilphousia, all of whom appear in the Aeneid."},{"page_url":"https://cs.wikipedia.org/wiki/Vr%C5%A1ovick%C3%A1_vod%C3%A1rna_(Michle)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Michle%2C_vr%C5%A1ovick%C3%A1_vod%C3%A1rensk%C3%A1_v%C4%9B%C5%BE_%2803%29.jpg","page_title":"Vršovická vodárna (Michle)","context_page_description":"Vršovická vodárna v Michli v Praze 4 je vodárenský komplex, který vybudovalo město Vršovice v letech 1906 až 1907 jako součást svého vodárenského systému."},{"page_url":"https://en.wikipedia.org/wiki/Niello","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Brooch_in_the_Form_of_a_Panther_MET_sf47-100-18s3.jpg","page_title":"Niello","context_page_description":"Niello is a black mixture, usually of sulphur, copper, silver, and lead, used as an inlay on engraved or etched metal, especially silver. It is added as a powder or paste, then fired until it melts or at least softens, and flows or is pushed into the engraved lines in the metal. It hardens and blackens when cool, and the niello on the flat surface is polished off to show the filled lines in black, contrasting with the polished metal around it. It may also be used with other metalworking techniques to cover larger areas, as seen in the sky in the diptych illustrated here. The metal where niello is to be placed is often roughened to provide a key. In many cases, especially in objects that have been buried underground, where the niello is now lost, the roughened surface indicates that it was once there.\\nNiello was used on a variety of objects including sword hilts, chalices, plates, horns, adornment for horses, jewellery such as bracelets, rings, pendants, and small fittings such as strap-ends, purse-bars, buttons, belt buckles and the like. It was also used to fill in the letters in inscriptions engraved on metal."},{"page_url":"https://ca.wikipedia.org/wiki/Mallorca","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Jaume_Mateu_-_James_I_the_Conqueror_-_Google_Art_Project.jpg","page_title":"Mallorca","context_page_description":"Mallorca és una illa de la Mediterrània, la més gran de les Illes Balears —per això també se l'anomena la Balear Major—, i és lloc d'origen dels mallorquins i les mallorquines.\\nPel gran pes demogràfic de la capital, Palma, l'illa es va dividir tradicionalment entre Ciutat i la Part Forana. La Part Forana és la ruralia, la terra situada fora de població. A Mallorca, es fa servir aquest terme per denominar de forma global totes les poblacions que no són la capital, Palma."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%B7%E5%92%8C%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Tokuwa_Station_2.jpg","page_title":"德和站","context_page_description":"德和車站是位於三重縣松阪市下村町，東海旅客鐵道的紀勢本線車站。\\n在1942年前，為與關西急行鐵道伊勢線的轉乘站。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B8%D0%B7%D0%B5%D0%BB%D0%B0%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Wappen_Zeestow.png","page_title":"Бризеланг","context_page_description":"Бризеланг — коммуна в Германии, в земле Бранденбург.\\nВходит в состав района Хафельланд. Население составляет 10 854 человека. Занимает площадь 44,39 км². Официальный код — 12 0 63 036.\\nКоммуна подразделяется на 3 сельских округа."},{"page_url":"https://en.wikipedia.org/wiki/Canlubang","image_url":"https://upload.wikimedia.org/wikipedia/en/6/6b/Asia-2_Mainroad_2017.jpg","page_title":"Canlubang","context_page_description":"Canlubang is a major industrial zone located in the province of Laguna, southwest of Metro Manila in the Philippines. It was once a hacienda during the Spanish colonial period. Canlubang straddles two component cities of Laguna: Cabuyao, Calamba and the municipality of Silang in Cavite.\\nThe official political unit with the name Canlubang is a barangay in Calamba City, Laguna. It is the largest and most populated barangay in Calamba.\\nCanlubang covers major industrial zones. It extends as far as Cabuyao and Santa Rosa, Laguna where the Nuvali Evoliving development of Ayala Land is located."},{"page_url":"https://br.wikipedia.org/wiki/Passer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Saxaul_Sparrow.jpg","page_title":"Passer","context_page_description":"Passer a zo ur genad e rummatadur an evned, krouet e 1760 gant an evnoniour gall Mathurin Jacques Brisson.\\nAn evned-se a vez graet Golvan anezhe e brezhoneg dre vras."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%99%D7%AA%D7%95%D7%99%D7%95_%D7%A9%D7%9C_%D7%99%D7%A9%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Brooklyn_Museum_-_Jesus_Tempted_in_the_Wilderness_%28J%C3%A9sus_tent%C3%A9_dans_le_d%C3%A9sert%29_-_James_Tissot_-_overall.jpg","page_title":"פיתויו של ישו","context_page_description":"פיתויו של ישו הוא אירוע בחיי ישו, המתואר בשלוש מבשורות הברית החדשה. על פי המתואר, לאחר הטבלתו של ישו בנהר הירדן על ידי יוחנן המטביל, פנה ישו בעקבות רוח הקודש אל המדבר, שם הוא צם ארבעים יום וארבעים לילה. במהלך תקופה זו או לאחריה ניסה השטן לפתות אותו כמה פעמים, אך ישו עמד בכל הניסיונות. לאחר מכן פנה השטן מעליו וישו הלך לגליל.\\nהבשורה על-פי מרקוס מזכירה את האירוע במשפט אחד: \\"במדבר שהה ארבעים יום כשהשטן מנסה אותו. הוא היה שם עם החיות, והמלאכים שרתוהו.\\". לעומתה, הבשורה על-פי לוקאס והבשורה על-פי מתי מפרטות את ההתרחשות באריכות וכוללות את הדו-שיח שהתנהל בין ישו לשטן. הבשורה הרביעית, הבשורה על-פי יוחנן, אינה מזכירה את האירוע כלל. הרכב זה של תיאורים מעלה את הסברה שמקור הסיפור הוא במסמך ה-Q.\\nעל פי המסורת הנוצרית התקיימו המפגש בין ישו לשטן והפיתוים הראשון והשלישי על הר קרנטל, שנמצא מערבית ליריחו, ושם נבנה מנזר קרנטל שמקור שמו בארבעים ימי הצום. הפיתוי השני התרחש לפי המסורת על הר הבית, במקדש עצמו, או בפינה הדרום-מזרחית של ההר."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A8%B9%E7%8A%B6%E7%AA%81%E8%B5%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Gray628.png","page_title":"樹状突起","context_page_description":"樹状突起は、神経細胞の一部。\\n神経細胞が、外部からの刺激や他の神経細胞の軸索から送り出される情報を受け取るために、細胞体から樹木の枝のように分岐した複数の突起のこと。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_State_University_of_New_York_units","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/SUNY_Binghamton_SL.jpg","page_title":"List of State University of New York units","context_page_description":"There are a large variety of campus types and programs in the SUNY system; each site overlaps somewhat in specialties. SUNY divides its campuses into four categories: university centers / doctoral-granting institutions, comprehensive colleges, technology colleges, and community colleges. SUNY also has a unique relationship with its statutory colleges, which embed state-owned, state-funded colleges within other institutions such as Cornell University and Alfred University. Students at the statutory colleges pay tuition at a state-subsidized rate and are considered students of the private institutions in which the state-funded colleges are embedded.\\nSUNY and the City University of New York are different university systems, even though both are public institutions that receive funding from New York State. SUNY should not be confused with the University of the State of New York, which is the governmental umbrella organization for most education-related institutions and many education-related personnel in New York State, and which includes, as a component, the New York State Education Department."},{"page_url":"https://it.wikipedia.org/wiki/Lardizabalaceae","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Akebia_trifoliata1.jpg","page_title":"Lardizabalaceae","context_page_description":"Lardizabalaceae è il nome di una famiglia di angiosperme.\\nLa famiglia delle Lardizabalaceae è stata universalmente riconosciuta dai tassonomisti, compresa la classificazione APG II, che la pongono nell'ordine delle Ranunculales, clade delle Eudicotiledoni.\\nLa famiglia è composta di 8-9 generi con 35-50 specie di piante legnose. Sono tutte liane ad eccezione del genere Decaisinea, costituito da arbusti pachicauli.\\nLe foglie sono alternate, generalmente palmate, con foglioline pulvinare.\\nI fiori sono spesso composti da racemi pendenti.\\nSi trovano nell'Asia orientale, dall'Himalaya al Giappone, ad esclusione dei generi Lardizabala e Boquila, entrambe native della parte più meridionale del Sudamerica."},{"page_url":"https://en.wikipedia.org/wiki/Byzantine_Revival_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Newman_University_Church_Interior%2C_Dublin%2C_Ireland_-_Diliff.jpg","page_title":"Byzantine Revival architecture","context_page_description":"The Byzantine Revival was an architectural revival movement, most frequently seen in religious, institutional and public buildings. It incorporates elements of the Byzantine style associated with Eastern and Orthodox Christian architecture dating from the 5th through 11th centuries, notably that of Constantinople and the Exarchate of Ravenna.\\nNeo-Byzantine architecture emerged in the 1840s in Western Europe and peaked in the last quarter of the 19th century in the Russian Empire, and later Bulgaria. Neo-Byzantine school was active in Yugoslavia between World War I and World War II."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BB%D1%8C%D0%BA%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Morgoth_by_SpentaMainyu.jpg","page_title":"Мелькор","context_page_description":"Ме́лькор; Морґот Бауґлір — вигаданий персонаж у легендаріумі Дж. Р. Р. Толкіна. Головний суперник світлих сил у «Сильмариліоні». Також згадується у «Дітях Гуріна» та «Володарі Перснів».\\nВала-бунтівник, котрий породив зло і за походженням був наймогутнішим із Айнурів. Згодом його почали іменувати «Мо́рґотом», «Бауґліром», Темним Володарем, Ворогом тощо. Ім'я Мелькор означало «Той, хто зростає на Силі»; синдарська форма його імення — «Белеґур», однак її ніколи не вживали, використовуючи натомість зумисне змінену форму «Белеґурт» — «Страшна Смерть».\\nМелькор був найпотужнішим з айнурів, але навернувся на темряву, і став Морґотом, цілковитим антагоністом Арди, від кого походить будь-яке зло у світі Середзем'я. Саурон, один з майя Валара Ауле, зрадив його і став головним помічником, правою рукою Морґота.\\nМорґот був головним втіленням зла у «Сильмариліоні». Його вплив затримався в світі навіть після того як він був викинутий зі світу у зовнішню порожнечу."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%BF%CE%BD%CF%8C%CE%BA%CE%BF%CE%BA%CE%BA%CE%BF_%CF%83%CE%B9%CF%84%CE%AC%CF%81%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Triticum_monococcum0.jpg","page_title":"Μονόκοκκο σιτάρι","context_page_description":"Tο μονόκοκκο σιτάρι, είναι γνωστό διεθνώς σαν einkorn ή engrain. Σε αντίθεση με τα άλλα είδη σιταριού, συχνά επιβιώνει σε φτωχά εδάφη."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Thum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Kalkwerk_Herold.jpg","page_title":"Liste der Kulturdenkmale in Thum","context_page_description":"Die Liste der Kulturdenkmale in Thum enthält die Kulturdenkmale in Thum.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://en.wikipedia.org/wiki/Pietro_Ferrero_(anarchist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Pietro_Ferrero.jpg","page_title":"Pietro Ferrero (anarchist)","context_page_description":"Pietro Ferrero was an Italian anarchist and trade unionist.\\nPietro Ferrero was born in Grugliasco near Turin on 12 May 1892. In 1905 he joined the Social Studies Centre in the Barriera di Milano neighbourhood in Turin, which transformed itself into a Modern School along the principles developed by the Spanish libertarian Francesc Ferrer i Guàrdia. In 1918 he was hired at the Fiat automobile factory.\\nDuring World War I Ferrero was active in the General Confederation of Labour militating in the revolutionary current against the reformist wing of the union. Since 1915 and for the duration of the war, he worked as a militarized worker at the Turin Arsenal, carrying out an active propaganda against the participation of workers in the Industrial Mobilization Committees. In 1917, together with anarchist comrades of the Barriera di Milano neighbourhood, he took part in the riots in Turin against the employers and the war.\\nIn 1919 he was elected secretary of the Turin section of the Federation of Metal Workers Employees. Ferrero, who began collaborating with the journal L'Ordine Nuovo, headed by Antonio Gramsci, from 1919, became one of the most prominent dissidents at FIOM congresses."},{"page_url":"https://pl.wikipedia.org/wiki/Twardost_(herb_szlachecki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/POL_COA_Twardost.svg","page_title":"Twardost (herb szlachecki)","context_page_description":"Twardost – polski herb szlachecki, używany przez rodzinę Juszyńskich."},{"page_url":"https://ca.wikipedia.org/wiki/Octavio_Vicent","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Font_de_la_Pla%C3%A7a_del_Patriarca_de_Val%C3%A8ncia.JPG","page_title":"Octavio Vicent","context_page_description":"Salvador Octavio Vicent Cortina conegut com a Octavio Vicent va ser un escultor i tallador d'imatges valencià i ocasionalment també artista faller. Va nàixer el 25 de desembre de 1913 i va morir a València el 20 d'octubre de 1999."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%82%A6%E9%82%A6%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/TRACC_classroom_on_Pom_Pom_Island%2C_Near_Semporna%2C_Sabah.jpg","page_title":"邦邦島","context_page_description":"邦邦島，一個小珊瑚島，約在蘇祿海西側，東馬沙巴州仙本那鎮的東北方30公里處。\\n島上被包圍的海岸線有2.3公里長，周邊的珊瑚礁有4公里長。島上地勢平坦，最高海拔小於2公尺。西部的礁灘只有50-75公尺寬，而其周圍大多是相距幾百米寬的海島。 島上有白色的沙灘、珊瑚海灘，同時也是綠蠵龜與玳瑁的一個重大棲息築巢的位置。島上沒有村莊，最小的人類影響，沒有污染，是在Semporna區的受歡迎的潛水目的地之一。\\n島上目前有一個設施齊全的高檔渡假酒店，位於島南部靠近碼頭的位置。這個酒店最好的房間是座落在遠離海岸線的礁灘上的五座水屋，每一座水屋都有獨享的露台，從這裡就可以直接下海浮潛。邦邦島最吸引人的地方應該是這裡的海龜了。這些受到人們嚴格保護的海洋生物，悠閒地生活在海島四周。遊客在這裡可以很容易的看到巨大的海龜。\\n另外在島西部還有一個很小的潛客旅店，適合窮游一族。"},{"page_url":"https://de.wikipedia.org/wiki/Martinusweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Langenargen_St._Martin_schmal.jpg","page_title":"Martinusweg","context_page_description":"Der Martinusweg ist ein am 15. April 2011 eröffneter Pilgerweg. Er führt in einer Hauptstrecke und vier Nebenstrecken durch die Diözese Rottenburg-Stuttgart in Baden-Württemberg und soll in Zukunft über das Erzbistum Freiburg sowie die Bistümer Mainz und Trier nach Frankreich fortgeführt werden. Der Martinusweg ist an The Saint Martin of Tours Route, einem Kulturweg des Europarats, angeschlossen sowie eine Nebenstrecke zur Via Sancti Martini, die vom Geburtsort des Heiligen Martin von Tours im ungarischen Szombathely zu seiner Grablege im französischen Tours führt. Mit etwa 1200 Streckenkilometern gehört der Martinusweg zu den längsten zusammenhängenden Pilger- und Wanderwegen in Deutschland."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Haines_(condado_de_Centre,_Pensilvania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Map_of_Haines_Township%2C_Centre_County%2C_Pennsylvania_Highlighted.png","page_title":"Municipio de Haines (condado de Centre, Pensilvania)","context_page_description":"El municipio de Haines es un municipio ubicado en el condado de Centre en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 1.479 habitantes y una densidad poblacional de 9.9 personas por km².​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%94%E3%83%BC%E3%82%BF%E3%83%BC%E3%83%BB%E3%83%8A%E3%82%A6%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Peternaur.JPG","page_title":"ピーター・ナウア","context_page_description":"ピーター・ナウアはデンマークのコンピュータ科学者であり、チューリング賞受賞者。バッカス・ナウア記法に名前が使われている。バッカス・ナウア記法はプログラミング言語の文法を記述するのに使われている。ALGOL 60プログラミング言語の創造に貢献した。\\n1957年、天文学の博士号を取得したが、コンピュータと出会ったことでその後の進路が変わった。1959年から1969年までナウアはデンマークのコンピュータ企業 Regnecentralen に勤務し、同時にニールス・ボーア研究所やデンマーク工科大学で教鞭をとっている。1969年から1998年まで、ナウアはコペンハーゲン大学の計算機科学の教授を務めた。\\nナウアの主な研究分野はプログラムとアルゴリズムの構造、設計、性能などである。ナウアはソフトウェア工学やソフトウェアアーキテクチャといった分野でも先駆的な研究を行った。彼の著作 Computing: A Human Activityにはナウアの計算機科学での業績が集められているが、その中で彼は数学の一部としてプログラミングを捉えるような過度の形式化を拒絶する態度を表明している。同じ理由から、他にも近年はバッカス・ナウア記法についてもともとの呼び方であったBackus Normal Formと呼ぶべきだとしている。\\nまた「コンピュータ科学」 という用語を嫌い、datalogy と呼ぶことを提案している。このためデンマークとスウェーデンでは計算機科学に相当する分野を datalogi と呼ぶ。\\n後年、ナウアは科学全体について率直に語るようになった。ナウアは経験論者と言えるかも知れない。経験論では観測された事実を重んじる。ナウアは哲学と心理学の一部を経験論的観点で攻撃した。また2004年、人間の思考に関する理論 Synapse-State Theory of Mental Life を発表し、その後もこれを発展させようとしている。\\nナウアは ALGOL 60 プログラミング言語の定義に関する貢献に対して2005年のチューリング賞を授与された。特にバッカス・ナウア記法を最初に使った \\"Report on the Algorithmic Language ALGOL 60\\" では編集者の役割を果たした。2012年現在、デンマーク人としては唯一のチューリング賞受賞者である。\\n2016年1月3日に88歳で永眠。"},{"page_url":"https://az.wikipedia.org/wiki/Qo%C3%A7ba%C5%9F%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Assyrian_battering_ram.jpg","page_title":"Qoçbaşı","context_page_description":"Qoçbaşı - ümumilikdə bir neçə insan tərəfindən daşınan; vuraraq qapı qırmağa, aralamağa ya da divar dağıtmaq üçün istifadə edilən silah.. Keçmişdə düşmən atəşindən qorunmaq üçün daxmaya oxşayan taxta sığınacaqların içərisində daşınabilən versiyaları da mövcud olmuş qurğudur. Hal-hazırda əksəriyyəti metaldan düzəldilmiş qoçbaşları mühafizə və yanğınsöndürmə xidmətləri tərəfindən aktiv şəkildə istifadə edilir."},{"page_url":"https://ca.wikipedia.org/wiki/John_Cena","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/John_Cena_as_United_States_Champion.jpg","page_title":"John Cena","context_page_description":"John Felix Anthony Cena és un actor, cantant i lluitador professional nord-americà. Actualment treballa per la World Wrestling Entertainment, lluitant a la marca SmackDown!. Dins dels seus triomfs com a lluitador cal destacar 12 Campionats de la WWE, 3 Campionats Mundials de pes pesant de la WWE, 3 regnats com a Campió dels Estats Units de la WWE i 2 regnats com a Campió Mundial en Parelles de la WWE. És el guanyador del Royal Rumble 2008, la Royal Rumble 2013 i el Money in the Bank 2012, en el 2003 va obtenir el premi de Millor Personatge."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%99%E6%B8%AF%E4%BB%94%E6%B6%88%E9%98%B2%E5%B1%80%E6%9A%A8%E6%95%91%E8%AD%B7%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/HK_AberdeenFireStation.JPG","page_title":"香港仔消防局暨救護站","context_page_description":"香港仔消防局暨救护站是香港消防处一座消防局暨救护站，位于香港岛南区黄竹坑南风道1号，为了配合香港海洋公园扩建及黄竹坑的未来发展所可能带来的新增需求而迁址兴建，工程于2010年6月启动，耗资1亿7千2百20万港元，于2012年8月完成，于同年9月28日启用。香港仔消防局暨救护站为香港首座设置有缆车救援训练设施的消防局暨救护站。"},{"page_url":"https://pt.wikipedia.org/wiki/Urodelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Karaurus_BW.jpg","page_title":"Urodelos","context_page_description":"Os urodelos constituem uma ordem de anfíbios caudados, que compreende as salamandras e os tritões, com cerca de 515 espécies. Tais animais têm o corpo alongado, patas curtas e uma cauda relativamente longa. Superficialmente assemelham-se a lagartos, dos quais podem ser distinguidos pela ausência de escamas. Os caudados têm a capacidade de regenerar os membros e a cauda se estes forem decepados. As dez famílias limitam-se quase inteiramente ao Hemisfério Norte; sua ocorrência mais meridional ocorre na parte norte da América do Sul. A América do Norte e a América Central apresentam a maior diversidade de salamandras.\\nOs caudados têm uma pele nua e susceptível à secura. Por esse motivo, habitam zonas úmidas de florestas, perto de rios ou lagos. O seu ciclo de vida começa invariavelmente na água, mas podem depois passar a um modo de vida terrestre. Algumas espécies mantêm-se aquáticas durante toda a vida, conservando as brânquias comuns a todos os juvenis.\\nA maioria dos caudados são animais pequenos. A maior espécie conhecida é a salamandra-gigante, natural da China e Japão, que chega a medir 1,50 m de comprimento. Os caudados hibernam durante o Inverno."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%B1%D8%AF%D8%A7%D8%B4%D8%AA%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Bredstedt_Gemeinde_Wappen.png","page_title":"برداشتت","context_page_description":"شهر برداشتتدر ایالت اشلسویگ-هل‌اشتاین در کشور آلمان واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/La_Bisbal_d%27Empord%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Spain%2C_Catalonia%2C_La_Bisbal_d%27Empord%C3%A0_%283%29.JPG","page_title":"La Bisbal d'Empordà","context_page_description":"La Bisbal d'Empordà is the county seat of the comarca of Baix Empordà in Catalonia, Spain.\\nThe town lies 29 km southeast of Girona, 12 km west of Palafrugell and 19 km northwest of Palamós along road C-66 from Girona to Palafrugell/Palamós, where it becomes C-31. Two other roads branch off at La Bisbal, GI-660 to Calonge and Sant Feliu de Guíxols and GI-664 to Cassà de la Selva; both roads cross the hilly coastal range called the Gavarres, with many twists and turns. The municipality lies on the northern edge of the Gavarres, on either side of the Daró river-bed, a dry tributary of River Ter.\\nThe town's name is derived from the Catalan word for \\"bishop\\", 'bisbe', as the town was owned by the bishops of Girona from the Carolingian period onward. The town is built over the site of a Roman settlement named Fontanetum, and in Old Catalan was sometimes referred to as Fontanet. The\\nSpanish name of La Bisbal del Ampurdán is no longer in official use.\\nThe modern settlement can be dated back to no later than the consecration of the church of Santa Maria de la Bisbal in 901."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A9%D7%95%D7%A9%D7%9C%D7%AA_%D7%94%D7%A4%D7%90%D7%98%D7%9E%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Rectangular_green_flag.svg","page_title":"השושלת הפאטמית","context_page_description":"הפאטמים, השושלת הפאטמית או אלפאטמיון הייתה שושלת שליטים שיעים שהתקיימה מ-5 בינואר 909 עד 1171 ושלטה על אזורים שונים בצפון אפריקה ובמזרח התיכון לרבות מצרים. המונח \\"פאטמי\\" מתייחס לעיתים גם לנתיני הח'ליפות. העלית השלטת השתייכה לענף האסמאעילי של השיעה. הח'ליפים הפאטמים היו גם אימאמים שיעים, והייתה להם חשיבות דתית בעיני המאמינים האסמאעילים."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%BF%CE%BC%CF%80%CE%AD%CF%81%CF%84%CE%B1_%CE%A4%CF%8C%CF%81%CF%81%CE%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Roberta_la_fabbrica.jpg","page_title":"Ρομπέρτα Τόρρε","context_page_description":"Η Ρομπέρτα Τόρρε, είναι Ιταλίδα σκηνοθέτης και σεναριογράφος.\\nΤο 1997 κέρδισε το Βραβείο Νάστρο ντ' Αρτζέντο ως καλύτερη νέα σκηνοθέτης στην πρώτη της ταινία \\"Tano da morire\\". Η ταινία πήρε μέρος στο 54ο Διεθνές Φεστιβάλ Κινηματογράφου της Βενετίας, κερδίζοντας το βραβείο FEDIC, το βραβείο Kodak και το βραβείο Luigi De Laurentiis στη κατηγορία του νέου καλύτερου σκηνοθέτη."},{"page_url":"https://en.wikipedia.org/wiki/Sunk_cost","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Concorde_216_%28G-BOAF%29_last_flight.jpg","page_title":"Sunk cost","context_page_description":"In economics and business decision-making, a sunk cost is a cost that has already been incurred and cannot be recovered. Sunk costs are contrasted with prospective costs, which are future costs that may be avoided if action is taken. In other words, a sunk cost is a sum paid in the past that is no longer relevant to decisions about the future. Even though economists argue that sunk costs are no longer relevant to future rational decision-making, in everyday life, people often take previous expenditures in situations such as repairing a car or house into their future decisions regarding those properties."},{"page_url":"https://en.wikipedia.org/wiki/Princess_Alexandra_of_Saxe-Coburg_and_Gotha","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Coat_of_Arms_of_Alexandra_of_Edinburgh.svg","page_title":"Princess Alexandra of Saxe-Coburg and Gotha","context_page_description":"Princess Alexandra of Saxe-Coburg and Gotha, VA, CI was the fourth child and third daughter of Alfred, Duke of Saxe-Coburg and Gotha and Grand Duchess Maria Alexandrovna of Russia. As the wife of Ernst II, she was Princess consort of Hohenlohe-Langenburg. She was a granddaughter of both Queen Victoria of the United Kingdom and Tsar Alexander II of Russia."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_fornl%C3%A4mningar_i_Bergs_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Storsj%C3%B6_74_2_2.JPG","page_title":"Lista över fornlämningar i Bergs kommun","context_page_description":"Lista över fornlämningar i Bergs kommun är en förteckning av ett urval av de fornlämningar som finns i Bergs kommun."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1955","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Jan_van_den_Tempel.jpg","page_title":"Lijst van personen overleden in 1955","context_page_description":"Dit is een lijst van personen die zijn overleden in 1955."},{"page_url":"https://tr.wikipedia.org/wiki/Peygamberdevesi_cins_ve_t%C3%BCrleri_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Bristol.zoo.dead.leaf.mantis.arp.jpg","page_title":"Peygamberdevesi cins ve türleri listesi","context_page_description":"Peygamberdevesi cins ve türleri listesi, Mantodea takımından böcek cins ve türlerini listeler. Mantodea takımı 2.000 kadar türden oluşur"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B8%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%98%D0%B0%D0%BB%D0%BD%D0%B8_%D0%BF%D1%80%D0%B5%D1%81%D0%B5%D0%BA_%D1%80%D0%B0%D1%81%D0%B5%D1%98%D0%B0%D1%9A%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Differential_cross_section.svg","page_title":"Диференцијални пресек расејања","context_page_description":"Диференцијални пресек расејања се дефинише као број честица које се расеју у јединичном просторном углу у јединичном временском интервалу, подељен са флуксом упадног снопа и бројем центара расејања:\\nДиференцијални пресек расејања се односи на теорију расејања када се сноп идентичних честица усмери ка мети и на детектору се посматра расејање."},{"page_url":"https://sv.wikipedia.org/wiki/Svenska_Ords_skrivstuga","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Svenska_Ords_skrivstuga%2C_febr_2019c.jpg","page_title":"Svenska Ords skrivstuga","context_page_description":"Svenska ords skrivstuga ligger i kvarteret Flintan i parken Vita bergen på Södermalm i Stockholm. Det lilla trähuset från 1700-talet var under många år Hans Alfredsons och Tage Danielssons författarstuga. Fastigheten ägs av AB Stadsholmen och är blåmärkt av Stadsmuseet i Stockholm, vilket innebär \\"att bebyggelsen bedöms ha synnerligen höga kulturhistoriska värden\\"."},{"page_url":"https://en.wikipedia.org/wiki/List_of_military_flags","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Serbian_Air_Force_brigade_flag_%28reverse%29.jpg","page_title":"List of military flags","context_page_description":"This is a list of flags flown by military powers worldwide. All flags in this list are for specific use for a branch of or the whole national military of a given state."},{"page_url":"https://fr.wikipedia.org/wiki/Odyss%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Odysseus_and_Athena_at_the_meeting_with_Nausicaa%2C_Attic_red-figured_amphora_from_Vulci%2C_440_BC%2C_Staatliche_Antikensammlungen%2C_Munich_%288957437815%29_cropped_glare_reduced_white_bg.png","page_title":"Odyssée","context_page_description":"L’Odyssée est une épopée grecque antique attribuée à l’aède Homère, qui l'aurait composée après l’Iliade, vers la fin du VIIIᵉ siècle av. J.-C. Elle est considérée comme l’un des plus grands chefs-d’œuvre de la littérature et, avec l’Iliade, comme l'un des deux « poèmes fondateurs » de la civilisation européenne.\\nL’Odyssée relate le retour chez lui du héros Ulysse, qui, après la guerre de Troie dans laquelle il a joué un rôle déterminant, met dix ans à revenir dans son île d'Ithaque, pour y retrouver son épouse Pénélope, qu'il délivre des prétendants, et son fils Télémaque. Au cours de son voyage sur mer, rendu périlleux par le courroux du dieu Poséidon, Ulysse rencontre de nombreux personnages mythologiques, comme la nymphe Calypso, la princesse Nausicaa, les Cyclopes, la magicienne Circé et les sirènes. L'épopée contient aussi un certain nombre d'épisodes qui complètent le récit de la guerre de Troie, par exemple la construction du cheval de Troie et la chute de la ville, qui ne sont pas évoquées dans l’Iliade."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B9%9D%E5%85%AD%E5%BC%8F%E8%89%A6%E4%B8%8A%E6%88%A6%E9%97%98%E6%A9%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Kashimura%27s_A5M4.jpg","page_title":"九六式艦上戦闘機","context_page_description":"九六式艦上戦闘機は、日本海軍の艦上戦闘機である。海軍初の全金属単葉戦闘機。\\n略称は九六式艦戦または九六艦戦ないし九六戦。\\n試作機は「九試単座戦闘機」。アメリカ側のコードネームは“Claude”。後継機は零式艦上戦闘機。"},{"page_url":"https://br.wikipedia.org/wiki/Ar_Sal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Le_Sel-de-Bretagne_-_Chapelle_de_la_Briantais.jpg","page_title":"Ar Sal","context_page_description":"Ar Sal a zo ur gumun eus Breizh e departamant Il-ha-Gwilen. Penn-lec'h kanton ar Sal e oa betek 2015."},{"page_url":"https://simple.wikipedia.org/wiki/Salman_Khan_(educator)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Salman_Khan_TED_2011.jpg","page_title":"Salman Khan (educator)","context_page_description":"Salman Amin \\"Sal\\" Khan is a Bengali-American educator, entrepreneur, and former hedge fund analyst. He is the founder of the Khan Academy, a free online education platform and nonprofit organization."},{"page_url":"https://es.wikipedia.org/wiki/Chibu_(Shimane)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Flag_of_Chibu_Shimane.png","page_title":"Chibu (Shimane)","context_page_description":"Chibu es una villa localizada en la prefectura de Shimane, Japón. En junio de 2019 tenía una población estimada de 664 habitantes y una densidad de población de 48,5 personas por km². Su área total es de 13,70 km²."},{"page_url":"https://gl.wikipedia.org/wiki/Quela","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Centruroides_suffusus.jpg","page_title":"Quela","context_page_description":"Chámase quela á terminación en forma de pinza dun apéndice dun artrópodo.\\nO termo deriva do latín científico chela, e este á súa vez do grego antigo χηλή chēlḗ 'garra', 'uña curvada'.\\nA quela está constituída pola articulación de dous artellos, un basal prolongado por unha apófise, e outro distal.\\nNos artrópodos encontramos dous casos especialmente significativos en canto á presentación e o papel das quelas:\\nChámase quelípedo ou quelípodo a unha patra fortemente diferenciada para a función prénsil. Encontramos este tipo de extremidade en moitos crustáceos decápodos, como os cangrexos, as cigalas ou os lumbrigantes, e en algúns arácnidos, como os escorpións e os pseudoescorpións. Trátase, nos crustáceos, dunha diferenciación do primeiro par de patas locomotoras, e nas dúas ordes de arácnidos, dos pedipalpos, para unha función prénsil, usada na defensa, a captura de alimentos, os combates territoriais e o cortexo. Nos pseudoescorpións as quelas son, ademais as encargadas de inxectar o veleno.\\nChámase quelícero aos apéndices do primeiro par, anatomicamente preoral do amplo grupo de artrópodos chamados quelicerados, precisamente por teren quelíceros."},{"page_url":"https://en.wikipedia.org/wiki/Helsingborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Helsingborg_street.jpg","page_title":"Helsingborg","context_page_description":"Helsingborg is a town and the seat of Helsingborg Municipality, Scania, Sweden. It had 108,334 inhabitants in 2017. Helsingborg is the centre of the northern part of western Scania and Sweden's closest point to Denmark: the Danish city Helsingør is clearly visible about 4 km to the west on the other side of the Øresund. The HH Ferry route across the sound has more than 70 car ferry departures from each harbour every day.\\nFollowing the Swedish orthography reform of 1906 the spelling of many place names in Sweden was modernized. In 1912 it was decided to use the form Hälsingborg. In preparation for the local government reform in 1971, Hälsingborg city council proposed that the new, enlarged municipality should be spelled Helsingborg; this form was adopted by the government of Sweden from 1 January 1971.\\nHistoric Helsingborg, with its many old buildings, is a scenic coastal city. The buildings are a blend of old-style stone-built churches and a 600-year-old medieval fortress in the city centre, and more modern commercial buildings. The streets vary from wide avenues to small alley-ways."},{"page_url":"https://de.wikipedia.org/wiki/Lebkuchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Bundesarchiv_B_145_Bild-F007458-0009%2C_N%C3%BCrnberg%2C_Firma_Wolff_Lebkuchenfabrik.jpg","page_title":"Lebkuchen","context_page_description":"Lebkuchen ist ein süßes, kräftig gewürztes, haltbares Gebäck, das in vielfältigen Formen und Varianten vorkommt. In vielen Kulturen ist er ein fester Bestandteil des Weihnachtsgebäcks, nur wenige Sorten werden insbesondere auf Jahrmärkten und Volksfesten ganzjährig angeboten. Die Bäcker zählen Lebkuchen zu den Dauerbackwaren.\\nDie Lebkuchenherstellung hat eine lange Tradition und ist vielerorts Teil der lokalen Backkultur, wovon verschiedene geschützte Herkunftsbezeichnungen für regionale Lebkuchenspezialitäten zeugen wie beispielsweise Nürnberger Lebkuchen, Aachener Printen.\\nFrüher gehörten die Hersteller von Lebkuchen oftmals einem anderen Handwerk an als die übrigen Bäcker, sie nannten sich Lebküchler, Pfefferküchler, Lebzelter, Lebküchner – Ausdrücke, die heute noch gerne von Bäckern verwendet werden, die sich auf Lebkuchen spezialisiert haben, und teilweise auch noch offiziell in Gebrauch sind. Zum Beispiel war noch bis zur Deutschen Wiedervereinigung der Pfefferküchler ein Handwerksberuf in der DDR. Acht Jahre später wurde die Ausbildung zum auf Pfefferküchler spezialisierten Bäcker vom Wirtschaftsministerium wieder aufgenommen."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%99%E1%80%AE%E1%80%B8%E1%80%81%E1%80%AD%E1%80%AF%E1%80%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Ognisko_ubt_0126.jpeg","page_title":"မီးခိုး","context_page_description":"မီးခိုးသည် ကျောက်မီးသွေး၊ ထင်း၊ ရေနံဆီ စသော\\nလောင်စာများကို မီးရှို့ရာမှ ထွက်ပေါ်လာသော အခိုးအငွေ့ဖြစ်\\nသည်။ စက်ရုံကြီးများတွင် ရေနွးငွေ့အားကို ယူရာ၌ ဘွိုင်လာအိုး\\nမီးဖိုများတွင် ကျောက်မီးသွေးကိုထည့်၍ မီးရှို့ကြသည်။ ကျောက်\\nမီးသွေး မီးစွဲလောင်ရာ၌ လေကောင်းကောင်းရ၍\\nမီးအရှိန်ပြင်းပြင်း ဖြင့် ကောင်းကောင်းလောင်နေသည့်အခါ မီးခိုး\\nအနည်းငယ်သာ ထွက်သည်။ တစ်ခါတစ်ရံ မီးခိုးထွက်မှန်းကို\\nမသိရချေ။ သို့သော် လည်း ကျောက်မီးသွေး\\nအထည့်များပြီးလျှင် လေကောင်းကောင်း မရသည့်အခါ\\nထည့်လိုက်သော လောင်စာအားလုံးကို မီးအရှိန်\\nကောင်းကောင်းဖြင့် မလောင်နိုင်သဖြင့် ခေါင်းတိုင်မှ\\nမဲမှောင်သော မီးခိုးလုံးကြီးများ ထိုးထွက်လာလေသည်။\\nကျောက်မီးသွေးမှ ထွက်သော မီးခိုးတွင် အလွန်သေး\\nငယ်သော ကာဗွန်မှုန့်များပါရှိ၍ ထိုကာဗွန်မှုန့်များသည် ကျပ်ခိုး\\nအဖြစ်စုပေါင်းသွားကြသည်။ ရာသီဥတုခြောက်သွေ့၍\\nသာယာသော နေ့များတွင် ခေါင်းတိုင်မှ ထွက်သော မီးခိုးသည်\\nအပြာရောင်ရှိ၏။\\nသို့သော် စိုစွတ်ထိုင်းမှိုင်းသော နေ့များတွင်မူကား မှိုင်းမှုန်ကလေး\\nများသည် ရေခိုးရေငွေ့ကြောင့် ရေနှင့်လုံးမိသွားကာ အရွယ်\\nကြီးလာသဖြင့် ညိုမဲသောအရောင်သို့ ပြောင်းသွားကြသည်။\\nစက်မှုလုပ်ငန်း များ တည်ထောင်ဖွင့်လှစ်ထားသော မြို့ကြီး\\nပြကြီးများတွင် ကျောက်မီးသွေးမီးဖြင့် ရေနွေးငွေ့အားကို\\nယူကြသည့်အတွက် မီးခိုးခေါင်း တိုင်များမှ စူးရှသောအနံ့ရှိသည့်\\nမီးခိုးလုံးများသည် တစ်ရှိန်ထိုး ထွက်လာကြသည်။"},{"page_url":"https://en.wikipedia.org/wiki/Pietro_Foresti","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Pietro_Foresti.jpg","page_title":"Pietro Foresti","context_page_description":"Pietro Foresti is an Italian music producer, engineer, and manager. His production and engineering credits include work in Los Angeles, California, with numerous major label artists, including Tracii Guns, Scott Russo, and Marvin Etzioni. He has contributed to more than four dozen albums from artists and bands like Sylvia Massy Shivy, Michael C. Ross, Joe Gastwirt and Kaos India.\\nForesti is also producer, engineer, and manager for his wife, Italian pop superstar Valeria Rossi, whose hit \\"Tre Parole\\" climbed to number one in both the Italian and Spanish charts and was awarded a top prize at the 2002 Italian Music Awards. With Rossi, Foresti created the record label Tre Parole.\\nAs producer Foresti was nominated for two music awards in 2010 from the Union Fonografica Independiente for the album The Promise by the band Warrior Poet, featuring Scott Russo. The album was nominated for \\"Best Rock Album\\" and \\"Best Alternative Rock Album.\\" His production work has helped independent artists and bands gaining major contracts with Universal Music Italia, for example Kaos India, Lambstone, Hazan, Oscar from Statuto. Down To Ground, another band he has produced, toured with Skunk Anansie."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B4_(%D0%94%D0%B5%D0%BB%D1%87%D0%B5%D0%B2%D1%81%D0%BA%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/%D0%9F%D0%BE%D0%B3%D0%BB%D0%B5%D0%B4_%D0%BD%D0%B0_%D0%93%D1%80%D0%B0%D0%B4%D0%B8%D1%88%D1%82%D0%B5_%D0%B2%D0%BE_%D1%81%D0%B5%D0%BB%D0%BE%D1%82%D0%BE_%D0%93%D1%80%D0%B0%D0%B4.jpg","page_title":"Град (Делчевско)","context_page_description":"Град — село во Општина Делчево, во областа Пијанец, во околината на градот Делчево."},{"page_url":"https://fr.wikipedia.org/wiki/Lib%C4%9B%C5%A1ice_(district_de_Litom%C4%9B%C5%99ice)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Libesice_LT_CZ.png","page_title":"Liběšice (district de Litoměřice)","context_page_description":"Liběšice est une commune rurale du district de Litoměřice, dans la région d'Ústí nad Labem, en Tchéquie. Sa population s'élevait à 1 537 habitants en 2018."},{"page_url":"https://it.wikipedia.org/wiki/Mimas_(astronomia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Color_Near_Herschel_Crater.jpg","page_title":"Mimas (astronomia)","context_page_description":"Mimas, anche noto come Mima o Mimante, è uno dei principali satelliti naturali di Saturno. Con un diametro di 396 chilometri è il settimo satellite di Saturno e il ventunesimo del sistema solare per dimensione. Mimas è il corpo celeste più piccolo che si conosca ad avere forma sferica a causa del proprio campo di gravità."},{"page_url":"https://fr.wikipedia.org/wiki/Fort_des_Basses-Perches","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/14-32-14-fort-b-perches.jpg","page_title":"Fort des Basses-Perches","context_page_description":"Le fort des Basses-Perches, appelé brièvement fort Valmy, a été construit entre 1874 et 1877. C'est un ouvrage faisant partie des fortifications de l'Est de la France du type Séré de Rivières. Il fait partie intégrante de la place forte de Belfort. Il est situé sur les communes de Danjoutin et de Belfort dans le département du Territoire de Belfort en région Bourgogne-Franche-Comté."},{"page_url":"https://en.wikipedia.org/wiki/Bernhardt_E._Muller","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Opa_Locka_FL_Helms_House01.jpg","page_title":"Bernhardt E. Muller","context_page_description":"Bernhardt Emil Muller, usually known as Bernhardt E. Muller, was an American architect who worked chiefly in Florida, where he designed many buildings in the 1920s and 1930s that have been listed on the National Register of Historic Places.\\nHe is known for \\"the distinctive architecture loosely described as the 'Arabian Nights style,' or more specifically but still rather loosely, the Moorish Revival Style.\\" Many of his works are in the Opa-locka Thematic Resource Area, located in Miami-Dade County."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BD_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Captainarmbandfifa.jpg","page_title":"Капитан (футбол)","context_page_description":"В футболе капитан команды является официальным лидером среди её игроков. Обычно это старший или наиболее опытный член команды, или игрок, который может сильно повлиять на исход матча.\\nОбычно капитана команды можно отличить от других игроков по повязке на его левой руке.\\nПо правилам игры, официальными функциями капитана являются участие в жеребьёвке перед началом матча и перед серией послематчевых одиннадцатиметровых ударов. По правилам, капитан не имеет особых прав и привилегий, позволяющих ему оспаривать решения судьи, но вместе с тем он несёт ответственность за поведение игроков своей команды. Именно это позволяет судье переговорить с капитаном по поводу поведения игроков команды.\\nВ молодёжном или любительском футболе, капитан команды часто выполняет обязанности, которые в профессиональном футболе возложены на тренера команды. Капитан отвечает за моральный дух в команде: если боевой дух в команде понижен, то он должен всячески ободрять игроков, тем самым поднимая боевой дух.\\nКапитан команды обычно назначается руководством или выбирается игроками команды в начале сезона."},{"page_url":"https://es.wikipedia.org/wiki/Roberto_de_Courtenay","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Robertus_-Courtenay.jpg","page_title":"Roberto de Courtenay","context_page_description":"Roberto I de Constantinopla o también Roberto de Courtenay, fue emperador latino de Constantinopla desde 1221 hasta 1228. Fue tan ineficaz que el Imperio latino fue reducido enormemente al final de su reinado.\\nRoberto era un hijo de Pedro II de Courtenay y Yolanda de Flandes y Henao, que fue la emperatriz regente de sus hijos hasta su muerte en septiembre de 1219. Su hijo mayor, Felipe, rehusó abandonar Francia y renunció a la sucesión en favor de Roberto, un joven irresponsable, que fue coronado en Constantinopla el 25 de marzo de 1221. Roberto se comprometió con Eudoxia Lascarina, hija del emperador griego de Nicea, Teodoro I Láscaris. En 1225 el sucesor de Teodoro, Juan III Ducas Vatatzés, obligó a Roberto a ceder la mayor parte de los territorios orientales de su Imperio latino en Asia Menor, y para 1228 Teodoro Comneno Ducas, el déspota de Epiro, se apoderó de Tesalónica y fue coronado allí emperador. Mientras tanto Roberto había repudiado a Eudoxia y tomó una amante francesa, que fue mutilada en la revuelta que siguió por los propios barones de Roberto."},{"page_url":"https://de.wikipedia.org/wiki/Dorfkirche_Bellin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Bellin_Kirche_Fluegelaltar_2009-07-16_048.jpg","page_title":"Dorfkirche Bellin","context_page_description":"Die evangelische Dorfkirche Bellin ist eine spätromanisch-frühgotische Feldsteinkirche im Ortsteil Bellin von Krakow am See im Landkreis Rostock in Mecklenburg-Vorpommern. Sie gehört zur Kirchengemeinde Lohmen in der Propstei Rostock der Evangelisch-Lutherischen Kirche in Norddeutschland."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_G%C3%B6ttingen/Baukulturensemble_Innenstadt-Westteil","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Untere-Masch-Stra%C3%9Fe_6_G%C3%B6ttingen_20180115_001.jpg","page_title":"Liste der Baudenkmale in Göttingen/Baukulturensemble Innenstadt-Westteil","context_page_description":"In der Liste der Baudenkmale in Göttingen: Baukulturensemble Innenstadt-Westteil sind gegenwärtig alle denkmalgeschützten Bauten der niedersächsischen Stadt Göttingen im Baukulturensemble Innenstadt Göttingen mit dem Stand vom 19. August 2013 aufgelistet, die westlich der Nordsüd-Achse Weender Straße und Kurze Straße liegen. Grundlage dieser Liste sind die Veröffentlichen zur Nachinventarisierung der Baudenkmäler der Göttinger Innenstadt."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%AF%E6%B0%8F%E7%9E%AA%E7%BE%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Kuhertajagaselli_Korkeasaari.jpg","page_title":"斯氏瞪羚","context_page_description":"斯氏瞪羚是最小的瞪羚。仅分布于非洲东部，与G. gazella pelzini重叠。斯氏瞪羚曾经被看作山瞪羚的亚种。"},{"page_url":"https://de.wikipedia.org/wiki/Fulton_Ferry_(Brooklyn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/0351New_York_City_Brooklyn.jpg","page_title":"Fulton Ferry (Brooklyn)","context_page_description":"Fulton Ferry ist ein Viertel im New Yorker Stadtteil Brooklyn. Es liegt am East River, zwischen Dumbo und Brooklyn Heights direkt an der Brooklyn Bridge. Das Viertel hat seinen Namen nach dem Ingenieur Robert Fulton. Nach ihm ist auch die berühmte Fährverbindung Fulton Ferry über den East River, die vor dem Bau der Brooklyn Bridge hier Brooklyn mit Manhattan verbunden hat und die Fulton Street, die ehemalige Ferry Road benannt."},{"page_url":"https://bg.wikipedia.org/wiki/Rhinolophus_stheno","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Naturalis_Biodiversity_Center_-_RMNH.MAM.32722.b_ven_-_Rhinolophus_stheno_-_skin.jpeg","page_title":"Rhinolophus stheno","context_page_description":"Rhinolophus stheno е вид прилеп от семейство Подковоносови. Видът не е застрашен от изчезване."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D9%8A%D8%A9_%D8%A7%D9%84%D8%B7%D8%A8_%D8%A8%D8%A7%D9%84%D8%A8%D8%A7%D8%AD%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Curriculum_Map_-_Faculty_of_Medicine_2020.png","page_title":"كلية الطب بالباحة","context_page_description":"كلية الطب بجامعة الباحة هي إحدى كليات جامعة الباحة بالمدينة الجامعية في محافظة العقيق بـمنطقة الباحة.\\nأنشئت الكلية في عام 1429هـ الموافق لعام 2008، وبدأت الدراسة الفعلية في مطلع العام الدراسي 1430/1431هـ، وفي العام 1436 هـ تم افتتاح القسم الخاص بالطالبات.\\nحرصت إدارة جامعة الباحة على إنشاء كلية للطب ذات تميز ليس محلي أو إقليمي فقط بل عالمي، ومن هذا المنطلق عملت الكلية على تطبيق نظام حديث لم يطبق حتى الآن في كثير من كليات الطب في المملكة، وهو أو كما يسمى بـ الذي يسمح للطالب بفهم الموضوع الهدف وإدراكه ودراسته من جميع جوانبه في نفس الوقت ويتم دراسة نفس الموضوع مرة أخرى في مرحلة لاحقة مما يوفر فرصه كبيرة للاستيعاب الموضوع بشكل كامل على عكس مثيلاتها في المملكة التي تطبق نظام.\\nيجري حالياً إنشاء المستشفى الجامعي للكلية، كما تم انشاء وحدة الجودة والاعتماد الاكاديمي بالكلية وإنشاء وحدة التعليم الطبي وجودة الامتحانات والمشاركة في تنظيم العديد من المؤتمرات العلمية المحلية والدولية داخل المنطقة وخارجها"},{"page_url":"https://de.wikipedia.org/wiki/Gro%C3%9Fes_Mausohr","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Gro%C3%9Fes_Mausohr.jpg","page_title":"Großes Mausohr","context_page_description":"Das Große Mausohr oder auch nur Mausohr ist eine Fledermaus-Art aus der Gattung der Mausohren, die 1797 von Borkhausen unter der Bezeichnung Vespertilio myotis erstbeschrieben wurde. Man findet sie auch unter dem Namen Riesenfledermaus. Eine ähnliche Art ist das Kleine Mausohr. Das Große Mausohr wurde vom Verband der deutschen Höhlen- und Karstforscher zum Höhlentier des Jahres 2011 gewählt."},{"page_url":"https://es.wikipedia.org/wiki/Defensa_Civil_Duitama","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Voluntariostrabajandodefensacivilcolombiana.jpg","page_title":"Defensa Civil Duitama","context_page_description":"Defensa Civil Duitama denominada legalmente Junta Defensa Civil Duitama, es un organismo que forma parte de la Defensa Civil Colombiana, Seccional Boyacá.​ Es una institución sin animo de lucro dedicado a la gestión del riesgo, la acción social y protección del medio ambiente en la ciudad de Duitama, Boyacá.​"},{"page_url":"https://de.wikipedia.org/wiki/Synagoge_Kobersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Kobersdorf-ehemalige-Synagoge-%28041006%29-%28021016%29.jpg","page_title":"Synagoge Kobersdorf","context_page_description":"Die Synagoge Kobersdorf ist ein neuromanisches Gebäude in der Marktgemeinde Kobersdorf im Burgenland. Die ehemalige Synagoge bis 1938 wird heute als Kulturzentrum genutzt und steht unter Denkmalschutz."},{"page_url":"https://ast.wikipedia.org/wiki/Llista_de_pontes_m%C3%A1s_altes_del_mundu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Russki_Island_Bridge%2C_Russia1.jpg","page_title":"Llista de pontes más altes del mundu","context_page_description":"Nesti artículu recueyen los les pontes más altes del mundu atendiendo al so altor estructural, que mide la distancia vertical máxima dende'l puntu cimeru d'una ponte hasta'l puntu visible más baxu de la ponte, onde los sos estribos remanecen de la superficie del suelu, cimientu o agua. Ye distintu del altor del vanu o del tableru, que ye la distancia máxima en cayida vertical dende'l tableru de la ponte hasta'l suelu, o la superficie d'agua. L'altor estructural nun tien de confundir se col altor del tableru\\nLa clasificación de les pontes más altes y col vanu más alto difier en parte porque dalgunos de les pontes más altes constrúyense salvando valles fondos y quebraes. La ponte del Ríu Sidu, na provincia de Hubei de China, ye una ponte colgante que traviesa un fondu gargüelu d'un ríu. Los dos torres de la ponte, construyíes en cada cantu del gargüelu, nun son lo suficientemente altes como por que la estructura de la ponte cuntar ente les más altes del mundu, pero gracies a la fondura del gargüelu, l'altor del vanu de la ponte del ríu Sidu tien a lo menos 496 m sobre'l ríu, faciendo d'él la ponte de más altor del mundu."},{"page_url":"https://uk.wikipedia.org/wiki/Snipex_Rhino_Hunter","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Snipex_Rhino_Hunter.jpg","page_title":"Snipex Rhino Hunter","context_page_description":"Snipex Rhino Hunter — цивільний варіант гвинтівки Snipex M в калібрі .50 BMG. Розроблена для враження рухомих і нерухомих цілей, в тому числі на далеких дистанціях."},{"page_url":"https://simple.wikipedia.org/wiki/Philadelphia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/30th_Street_Station_Philadelphia_on_Memorial_Day.png","page_title":"Philadelphia","context_page_description":"Philadelphia is the sixth-largest city in the United States and the largest city in the U.S. state of Pennsylvania. In spoken English, the city is sometimes called Philly.\\nThe population of the city was 1,517,550 people in 2000, in 2010 census it was up to 1,526.006 people. Philadelphia was the capital of the United States from 1790 to 1800. It was replaced by Washington, D.C. in 1800 after the White House was built.\\nPhiladelphia is famous because it has many places tourists like to visit, like the Liberty Bell, Independence Hall, and Christ Church."},{"page_url":"https://de.wikipedia.org/wiki/Viktor_Bogdanovic","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Comiciade_2018_-_Viktor_Bogdanovic_-_1.jpg","page_title":"Viktor Bogdanovic","context_page_description":"Viktor Bogdanovic ist ein Schweizer Comiczeichner."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8A%E6%B5%B7%E5%B8%82%E4%BC%98%E7%A7%80%E5%8E%86%E5%8F%B2%E5%BB%BA%E7%AD%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Development_Building_%282%29.JPG","page_title":"上海市优秀历史建筑","context_page_description":"上海市優秀歷史建築是指上海市建成三十年以上，並有下列情形之一的建築：\\n建築樣式、施工工藝和工程技術具有建築藝術特色和科學研究價值；\\n反映上海地域建築歷史文化特點；\\n著名建築師的代表作品；\\n在中國產業發展史上具有代表性的作坊、商鋪、廠房和倉庫；\\n其他具有歷史文化意義的優秀歷史建築。\\n優秀歷史建築的初步名單，由上海市規劃管理部門和上海市房屋土地管理部門研究提出，並徵求上海市文物管理部門、建築所有人和所在區人民政府的意見，經專家委員會評審後報上海市人民政府批准確定。在上海市人民政府批准確定前，應當將優秀歷史建築的初步名單公示，徵求社會意見。經批准確定的優秀歷史建築，由上海市人民政府公布，並由市房屋土地管理部門設立標誌。\\n上海是中國首個將近現代建築單獨作為保護類別的城市。目前上海市人民政府已公布了五批優秀歷史建築共1058處，覆蓋全市17個區。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B5%BC%E0%B4%A6%E0%B5%8D%E0%B4%A6%E0%B4%BF%E0%B4%A4_%E0%B4%85%E0%B4%9A%E0%B5%8D%E0%B4%9A%E0%B5%81%E0%B4%B5%E0%B4%BE%E0%B5%BC%E0%B4%AA%E0%B5%8D%E0%B4%AA%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Low_pressure_permanent_mold_casting_schematic.svg","page_title":"മർദ്ദിത അച്ചുവാർപ്പ്","context_page_description":"ദ്രവീകൃത ലോഹത്തെ ഉന്നതമർദം ചെലുത്തി അച്ചുകളിൽ കടത്തി യന്ത്രസാമഗ്രികളും മറ്റും വാർത്തെടുക്കുന്ന യാന്ത്രികപ്രക്രിയയെ മർദ്ദിത അച്ചുവാർപ്പ് എന്നു വിളിക്കുന്നു. കുറഞ്ഞ ദ്രവണാങ്കം ഉള്ള ലോഹങ്ങളും ലോഹസങ്കരങ്ങളും ആണ് ഈ നിർമ്മാണരീതിക്ക് കൂടുതൽ യോജിച്ചത്. ഉരുപ്പടിയുടെ പ്രതിലോമരൂപം മുദ്രണം ചെയ്തിരിക്കുന്ന അച്ചുകളുടെ ഉള്ളിലേക്ക് വളരെ സമ്മർദത്തിൽ ഉരുക്കിയ ലോഹം കയറ്റി അതിനെ ഖരരൂപത്തിലാക്കുന്നു.\\nഈ നിർമ്മാണരീതി 20-ആം ശതകത്തിലെ കണ്ടുപിടിത്തമല്ലെങ്കിലും, മോട്ടോർവാഹനനിർമ്മാണത്തിലുണ്ടായ പുരോഗതിക്കുശേഷമാണ് ഇത് വർധമാനമായത്. രണ്ടാം ലോകയുദ്ധത്തിനുശേഷം ഈ രീതി മറ്റേതു വാർപ്പുരീതിയെക്കാളും കൂടുതൽ വികാസം നേടി. വളരെ ചെറുതും ലഘുവുമായ യന്ത്രസാമഗ്രികൾ മുതൽ 20-25 കി. ഗ്രാം വരെ ഭാരമുളള അലൂമിനിയം യന്ത്രഭാഗങ്ങൾവരെ ഈ രീതിയിൽ നിർമ്മിക്കപ്പെടുന്നു. വളരെ മിനുസത്തിലും കൃത്യമായ അളവിലും ഇവ നിർമ്മിക്കാൻ കഴിയുന്നതു കാരണം നിർമ്മാണാനന്തരം യാന്ത്രികമായ മിനുക്കുപണികൾ അധികം ചെയ്യാതെതന്നെ ഇവ ഉപയോഗിക്കാം. കൂടിയ നിർമ്മാണവേഗവും മികച്ച ശക്തിയും ഈ രീതിയുടെ സവിശേഷതകളാണ്.\\nഎന്നാൽ യന്ത്രങ്ങളുടെയും, അച്ചുകളുടെയും ഭാരിച്ച വില ഈ രീതിക്കുള്ള അച്ചുവാർക്കലിന്റെ ഒരു പ്രധാന ന്യൂനതയാണ്. ഇതുകാരണം വൻതോതിലുള്ള ഉത്പാദനത്തിൽ മാത്രമേ ഇത് ലാഭകരമാകൂ. ഉത്പന്നങ്ങളുടെ രൂപത്തിലും വലിപ്പത്തിലുമുള്ള പരിമിതികളാണ് മറ്റൊരു പ്രധാന ന്യൂനത."},{"page_url":"https://en.wikipedia.org/wiki/Greece","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Hagia_Sophia_Dome.png","page_title":"Greece","context_page_description":"Greece, officially the Hellenic Republic, known also as Hellas, is a country located in Southeast Europe. Its population is approximately 10.7 million as of 2018; Athens, the nation's capital, is its largest city, followed by Thessaloniki.\\nSituated on the southern tip of the Balkans, Greece is located at the crossroads of Europe, Asia, and Africa. It shares land borders with Albania to the northwest, North Macedonia and Bulgaria to the north, and Turkey to the northeast. The Aegean Sea lies to the east of the mainland, the Ionian Sea to the west, the Cretan Sea and the Mediterranean Sea to the south. Greece has the longest coastline on the Mediterranean Basin and the 11th longest coastline in the world at 13,676 km in length, featuring many islands, of which 227 are inhabited. Eighty percent of Greece is mountainous, with Mount Olympus being the highest peak at 2,918 metres. The country consists of nine traditional geographic regions: Macedonia, Central Greece, the Peloponnese, Thessaly, Epirus, the Aegean Islands, Thrace, Crete, and the Ionian Islands."},{"page_url":"https://fr.wikipedia.org/wiki/Konrad_Laimer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/20161011_U21_AUT_GER_9254.jpg","page_title":"Konrad Laimer","context_page_description":"Konrad Laimer est un footballeur international autrichien né le 27 mai 1997 à Salzbourg. Évoluant au poste de milieu relayeur, il joue depuis juillet 2017 pour le RB Leipzig, dans le championnat d'Allemagne."},{"page_url":"https://de.wikipedia.org/wiki/John_Carlson_(Eishockeyspieler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/John_Carlson_2016-04-07_1.JPG","page_title":"John Carlson (Eishockeyspieler)","context_page_description":"John Carlson ist ein US-amerikanischer Eishockeyspieler. Der Verteidiger steht seit 2009 bei den Washington Capitals aus der National Hockey League unter Vertrag steht, mit denen er in den Playoffs 2018 den Stanley Cup gewann."},{"page_url":"https://en.wikipedia.org/wiki/List_of_county_courthouses_in_Illinois","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/KaneCounty-Gov-Center.jpg","page_title":"List of county courthouses in Illinois","context_page_description":"This list of county courthouses in Illinois provides information about each current Illinois county courthouse: name, photograph, city, construction year, and further comments.\\nEach of the 102 county governments in the U.S. state of Illinois operates out of a building or complex of buildings known as the county's courthouse. The community in which the courthouse is located is known as the county seat. The oldest current courthouse is the Putnam County Courthouse, built in 1839, while other courthouses have been built since 2010. Many courthouses were built following the destruction of previous buildings, either planned or unplanned; however, some former courthouses still stand, many of which have been repurposed as museums or as offices for other governmental agencies.\\nFifty-seven of these courthouses were constructed between the end of the Civil War and American entry into the First World War; extant courthouses from this period tend to reflect the Romanesque Revival, Second Empire, and Neoclassical architectural styles, while several older courthouses are Greek Revival buildings, and many twentieth-century courthouses are modernist structures."},{"page_url":"https://bs.wikipedia.org/wiki/Gva%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Gouache.jpg","page_title":"Gvaš","context_page_description":"Gvaš je način slikanja vodenim bojama, gdje se pigment miješa s bijelom bojom i veže uz podlogu smolastim sredstvima otopljenim u vodi. Za razliku od transparentnog akvarela u kojem sama podloga papira ima ulogu bijele boje, gvaš je gust i neproziran. Njegov kasniji gornji namaz pokriva raniji donji, te je zahvalan jer omogućuje korigiranje ranijih površina."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%93%D7%93_%D7%94%D7%93%D7%9E%D7%95%D7%A7%D7%A8%D7%98%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Democracy_Index_2018.png","page_title":"מדד הדמוקרטיה","context_page_description":"מדד הדמוקרטיה הוא מדד שנערך ומפורסם על ידי קבוצת האקונומיסט, המוציאה לאור של מגזין האקונומיסט הבריטי. מטרת הדו\\"ח לנסות ולהציג מדד כמותי של רמת הדמוקרטיה ב-167 מדינות ברחבי העולם. המדד פורסם לראשונה בשנת 2006, תחילה עודכן בשנים 2008, 2010 ובהמשך החל להתעדכן בכל שנה. המדד לא פורסם במסגרת אקדמית, והוא לא נבדק בתהליך של ביקורת עמיתים."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%88%D9%85%D8%A7%D9%86%D8%B3%D9%8A%D8%A9_%D8%A7%D9%84%D9%85%D9%85%D8%A7%D9%84%D9%83_%D8%A7%D9%84%D8%AB%D9%84%D8%A7%D8%AB_(%D9%85%D8%B3%D9%84%D8%B3%D9%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Romance_of_the_Three_Kingdoms_1994_logo.png","page_title":"رومانسية الممالك الثلاث (مسلسل)","context_page_description":"الممالك الثلاث هو مسلسل تلفزيوني صيني بناء على الأحداث في أواخر عهد أسرة هان الشرقية وفترة الممالك الثلاث."},{"page_url":"https://hu.wikipedia.org/wiki/Bioetanol","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/UsinaSantaElisa.jpg","page_title":"Bioetanol","context_page_description":"A bioetanol kifejezés alatt olyan, nagyrészt etil-alkoholból álló üzemanyagot értünk, melyet biológiailag megújuló energiaforrások felhasználásával nyernek abból a célból, hogy benzint helyettesítő, vagy annak adalékaként szolgáló motor-üzemanyagot kapjanak Otto-motorokhoz."},{"page_url":"https://eu.wikipedia.org/wiki/Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Austria_K%C3%B6ppen.svg","page_title":"Austria","context_page_description":"Austria, ofizialki Austriako Errepublika Erdialdeko Europako estatu itsasgabea da. Iparraldean Alemania eta Txekiarekin du muga, ekialdean Eslovakia eta Hungariarekin, hegoaldean Eslovenia eta Italiarekin eta mendebaldean Suitza eta Liechtensteinekin. 83.879 kilometro koadroko eremua du eta 8,7 milioi biztanle. Oso herrialde menditsua da, Alpeek azaleraren % 62 hartzen baitute. 1995etik Europar Batasuneko kidea da eta 1999tik, Eurogunekoa. Hiriburua Viena da.\\nAustria-Hungariako Inperioaren botere zentrua izan zen, baina Lehen Mundu Gerrako porrotaren ostean, Austria errepublika federal bilakatu zen. Bederatzi estatuk osatzen dute: Burgenland, Karintia, Austria Beherea, Austria Garaia, Salzburg, Estiria, Tirol, Vorarlberg eta Viena. Munduko herrialde aberatsenetako bat da, 41.700 dolarreko per capita errentarekin. Alemana da hizkuntza ofiziala, baina zenbait eskualdetan kroaziera, esloveniera eta hungarierak ere dute estatus hori."},{"page_url":"https://en.wikipedia.org/wiki/Council_of_Ministers_of_S%C3%A3o_Tom%C3%A9_and_Pr%C3%ADncipe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Coa_S%C3%A3o_Tom%C3%A9_%26_Pr%C3%ADncipe.PNG","page_title":"Council of Ministers of São Tomé and Príncipe","context_page_description":"The São Tomé and Príncipe Council of Ministers consists of thirteen members appointed by the president with the advice of the prime minister.\\nThe Council of Ministers is chaired by the prime minister and is tasked with managing government operations. It is held accountable by the president and the National Assembly."},{"page_url":"https://es.wikipedia.org/wiki/Oro_precolombino_de_Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Costa_Rica_Archaeological_Areas.png","page_title":"Oro precolombino de Costa Rica","context_page_description":"El oro precolombino de Costa Rica es una de las manifestaciones artísticas más elaboradas y complejas de las sociedades indígenas que ocuparon el actual territorio costarricense antes de la llegada de los españoles. Las investigaciones y estudios arqueológicos y etnohistóricos han determinado que, entre los años 700 y 1550 d.C, en Costa Rica hubo una importante producción suntuaria de objetos de oro, con evidencia de la existencia de especialistas orfebres que habían alcanzado un importante manejo tecnológico, así como niveles de extraordinaria calidad y belleza en la elaboración de las piezas, mezcladas con un alto grado de simbolismo.\\nCosta Rica forma parte de la tradición metalúrgica del Área Intermedia, que incluye también a Panamá y el noroccidente de Colombia. Es precisamente desde Colombia de donde penetra el conocimiento en las técnicas metalúrgicas en Costa Rica, a través del establecimiento de rutas de intercambio terrestres, fluviales y marítimas."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Ferrovi%C3%A1ria_de_Barca_d%27Alva","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Barca_d%E2%80%99Alva_train_station_1.JPG","page_title":"Estação Ferroviária de Barca d'Alva","context_page_description":"A Estação Ferroviária de Barca d’Alva é uma interface terminal encerrada da Linha do Douro, que servia a localidade de Barca d’Alva, e que funcionava como estação fronteiriça entre Portugal e Espanha, através da Linha internacional de Barca d'Alva-La Fregeneda a La Fuente de San Esteban. Situa-se no Concelho de Figueira de Castelo Rodrigo, em Portugal."},{"page_url":"https://en.wikipedia.org/wiki/Adam_Ashley-Cooper","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Adam_Ashley-Cooper_2011_%28cropped%29.jpg","page_title":"Adam Ashley-Cooper","context_page_description":"Adam Ashley-Cooper is an Australian rugby union player. He plays for Kobelco Steelers in the Japanese Top League and has won 117 caps for Australia, the third most of any Australia player. He is nicknamed Mr Versatile."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Richmond,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Tredegar_Iron_Works.gif","page_title":"History of Richmond, Virginia","context_page_description":"The history of Richmond, Virginia, as a modern city, dates to the early 17th century, and is crucial to the development of the colony of Virginia, the American Revolutionary War, and the Civil War. After Reconstruction, Richmond's location at the falls of the James River helped it develop a diversified economy and become a land transportation hub."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2_%D1%87%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D1%82%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Cherkasy_Central_Stadium2.jpg","page_title":"Список стадионов чемпионата Украины по футболу","context_page_description":"Здесь приводится список футбольных стадионов, принимавших матчи высшего дивизиона украинского чемпионата с момента его первого сезона 1992 года.\\nС момента основания чемпионата Украины, матчи его высшего дивизиона принимало 62 футбольных стадиона. Первым стадионом высшего дивизиона стал Центральный стадион Черноморского морского пароходства в городе Одесса. 6 марта 1992 года на его поле был сыгран матч между местным «Черноморцем» и львовскими «Карпатами». В тот же день дебютировала еще одна арена — Центральный стадион города Николаева. На следующий день матчи высшей лиги были сыграны ещё на восьми стадионах: «Буковина», «Днепр», «Локомотив», «Металлург», «Метеор», «Республиканский», «СКА» и «Электрон». 18 марта, в третьем туре чемпионата, дебютировало ещё 6 арен. Последним стадионом, принимавшим матчи чемпионата Украины в сезоне 1992 в 12 туре стал киевский стадион «Динамо». Начиная со второго чемпионата реестр стадионов пополнялся двумя способами — либо при появлении в лиге команды из нового города, либо когда по тем или иным причинам один из клубов временно или постоянно менял прописку."},{"page_url":"https://hu.wikipedia.org/wiki/Novotni_Zolt%C3%A1n","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Novotni_Relief_Miskolc.jpg","page_title":"Novotni Zoltán","context_page_description":"Novotni Zoltán jogász, egyetemi tanár, a Miskolci Egyetem Állam- és Jogtudományi Karának egyik alapítója, 1991 és 1993 között dékánja."},{"page_url":"https://fr.wikipedia.org/wiki/Harry_Northrup","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Harry_Northrup_in_Party_Girl.jpg","page_title":"Harry Northrup","context_page_description":"Henri Stabo Wallace Northrup — né le 31 juillet 1875 à Paris, mort le 2 juillet 1936 à Los Angeles — est un acteur américain d'origine française, connu comme Harry Northrup."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0_%D0%B4%D0%B5%D0%BB%D0%B0_%D0%BD%D0%B0_%D0%9A%D0%BB%D0%BE%D0%B4_%D0%9C%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Monet_Bateaux_de_p%C3%AAche%2C_Honfleur_w74.jpg","page_title":"Список на дела на Клод Моне","context_page_description":"Ова е нецелосен список на делата, вклучувајќи ги скоро сите завршени слики, но без подготвителните црно-бели скици, на Клод Моне кој бил основач на француското импресионистичко сликарство и најдоследен и најплоден практичар на филозофијата на движењето за изразување на своите сфаќања пред природата, особено што се однесува на пејзажното сликарство пленер. Терминот „импресионизам“ е изведен од насловот на неговата слика Импресија, изгрејсонце.\\nОна што го прави Моне да се разликува од другите импресионистички сликари е неговата иновативна идеја да создава „серии слики“ посветени на единствена тема или субјект. Со повторливо проучување на темата во различни периоди од денот, сликите на Моне ги покажуваат ефектите на сончевата светлина, времето и метереолошта состојба преку бојата и контрастот. „Сериите слики“ на Моне се добро познати и забележителни и ги вклучуваат „Стогови“, „Водни лилии“, „Руански катедрали “, „Лондонски парламент“, „Мост Чаринг Крос“ и „Тополи“. Неговото огромно творештво од скоро 2000 слики било каталогизирано од Даниел Вилденштајн во „Моне: Каталог резоне“."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D1%96%D0%B9%D1%86%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/David_Lloyd_George.jpg","page_title":"Валійцы","context_page_description":"Валі́йцы, таксама уэ́льсцы, кембры́йцы, кі́мры — кельцкі народ, карэннае насельніцтва Уэльса. Жывуць пераважна ў Вялікабрытаніі, а таксама ў Ірландыіі, ЗША, Канадзе, Аўстраліі, Аргенціне і г. д. Агульная колькасць — 1 314 000 чал. Родная мова — валійская."},{"page_url":"https://en.wikipedia.org/wiki/Kangasniemi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/L%C3%A4s%C3%A4kosken_kanava_6.jpg","page_title":"Kangasniemi","context_page_description":"Kangasniemi is a municipality in the Southern Savonia region, Finland. The municipality has a population of 5,455 and covers an area of 1,326.75 square kilometres of which 256.86 km² is water. The population density is 5.1 inhabitants per square kilometre.\\nKangasniemi is located on the Finnish national road 13, 50 km northwest of Mikkeli and 63 km southeast of Jyväskylä. Distance to the national capital, Helsinki is 250 km. Its neighbour municipalities are Hankasalmi, Hirvensalmi, Joutsa, Mikkeli, Pieksämäki and Toivakka.\\nThere are almost 3600 summer houses, and summer guests redouble the number of inhabitants during the summer months.\\nThe municipality is unilingually Finnish."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89ducation_au_Burkina_Faso","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Woman_Walks_Past_Mosque_-_Dori_-_Sahel_Region_-_Burkina_Faso.jpg","page_title":"Éducation au Burkina Faso","context_page_description":"L'éducation au Burkina Faso, ou système éducatif burkinabè, concerne l'ensemble des institutions publiques et privées du Burkina Faso ayant pour fonction d'assurer et de développer le système éducatif sur l'ensemble du territoire national.\\nLe système scolaire burkinabè est en majorité public, laïc, et il est obligatoire de l'âge de 6 ans jusqu'à 16 ans."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2019/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Chel_Mertens%2C_Bestanddeelnr_932-3817.jpg","page_title":"Lijst van personen overleden in 2019/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2019.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/UR_(famille_de_lanceurs)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Kaluga_Wikiexpedition_%282016-06-11%29_0472.jpg","page_title":"UR (famille de lanceurs)","context_page_description":"UR est une famille de missiles balistiques et de lanceurs soviétique puis russe."},{"page_url":"https://ja.wikipedia.org/wiki/1%E5%8C%BA_(%E3%83%91%E3%83%AA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/St._Roch_Paris.jpg","page_title":"1区 (パリ)","context_page_description":"パリの1区 は、フランスの首都・パリ市を構成する20の行政区のひとつである 。第1区、パリ1区ともいう。市のほぼ中央に位置しており、セーヌ川の北岸に面している。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Seen_in_Polen","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Vietzker_See.jpg","page_title":"Liste von Seen in Polen","context_page_description":"Diese Liste von Seen in Polen gibt einen Überblick über Seen in Polen. Die Stillgewässer mit der größten Fläche und mit der größten Tiefe sind in eigenen Tabellen gesondert dargestellt. Der flächengrößte See auf polnischem Staatsgebiet ist der Śniardwy in der Seenplatte der Großen Masurischen Seen. Der tiefste See auf polnischem Staatsgebiet ist der Hańcza in der Östlichen Suwałki-Seenplatte."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B1%D9%88%D8%B3_%D8%AA%D8%B4%D8%B1%D8%B4%D9%84_%D9%85%D9%88%D8%B1%D8%A7%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Planetary_society.jpg","page_title":"بروس تشرشل موراي","context_page_description":"بروس تشرشل موراي ‏ فيزيائي وفلكي أمريكي متخصص في العلوم الكوكبية. مدير لمختبر الدفع النفاث وأحد مؤسسي الجمعية الكوكبية."},{"page_url":"https://de.wikipedia.org/wiki/Graffiti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/SBertalan_Harald_Naegeli_D%C3%BCsseldorf_2006.jpg","page_title":"Graffiti","context_page_description":"Graffiti, italienisch Singular Graffito, steht als Sammelbegriff für thematisch und gestalterisch unterschiedliche sichtbare Elemente, zum Beispiel Bilder, Schriftzüge oder Zeichen, die mit verschiedenen Techniken auf Oberflächen oder durch deren Veränderung im privaten und öffentlichen Raum erstellt wurden. Die Graffiti werden zumeist unter Pseudonym und illegal gefertigt.\\nErsteller von Graffiti, insbesondere wenn sie Sprühdosen verwenden, werden oft Sprayer genannt.\\nDie Akzeptanz und Definition von Graffiti ist unterschiedlich geprägt. Werden nicht genehmigte Graffiti in der öffentlichen Wahrnehmung, insbesondere in der westlichen Welt meist als Form des Vandalismus betrachtet, werden sie von anderer Seite auch als Form der Kunst anerkannt. Beides schließt sich jedoch nicht aus.\\nÖffentliche Einrichtungen treffen vielschichtige Maßnahmen, um das illegale Anbringen von Graffiti zu verhindern. Viele Gemeinden geben spezielle Flächen frei. Die gesetzliche Ahndung reicht bis zum Besitzverbot entsprechender Werkzeuge."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Saint-Patrick_de_Charlotte","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Cathedral_Church_of_Saint_Patrick_%28Charlotte%2C_North_Carolina%29_-_nave.JPG","page_title":"Cathédrale Saint-Patrick de Charlotte","context_page_description":"La cathédrale Saint-Patrick est le siège du diocèse de Charlotte de l'Église catholique aux États-Unis. La cathédrale, dédiée à saint Patrick, se trouve à\\nCharlotte."},{"page_url":"https://id.wikipedia.org/wiki/Ariel_Ortega","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Ariel_Ortega_%28cropped%29.jpg","page_title":"Ariel Ortega","context_page_description":"Arnaldo Ariel Ortega merupakan seorang pemain sepak bola berkebangsaan Argentina yang kini membela klub All Boys. Dia pernah bermain di klub utamanya seperti River Plate, Valencia, Sampdoria, Parma, River Plate, Fenerbahçe, Newell's Old Boys, River Plate dan Independiente Rivadavia.\\nDi timnas Argentina, dia bermain 87 kali dan mencetak 17 gol."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%94%D5%A5%D6%80%D5%B6%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Rainy_season_-_Cairns%2C_Queensland%2C_Australia.jpg","page_title":"Քերնս","context_page_description":"Քերնս, քաղաք Ավստրալիայի Քվինսլենդ նահանգի հյուսիսարևելյան մասում, տեղական ինքնակառավարման համանուն շրջանի կենտրոնն է։ Շրջանի բնակչությունը, ըստ 2008 թվականի տվյալների, կազմում է մոտ 159 հազար մարդ։ Քերնսը Ավստրալիայի տասնչորսերորդ քաղաքն է՝ ըստ բնակչության թվի։ Մոտակա խոշոր քաղաքը Թաունսվիլն է ։"},{"page_url":"https://es.wikipedia.org/wiki/Trayectoria_bal%C3%ADstica","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Quasi-parab-freefall2.png","page_title":"Trayectoria balística","context_page_description":"La trayectoria balística es la trayectoria de vuelo que sigue un proyectil sometido únicamente a su propia inercia y a las fuerzas inherentes al medio en el que se desplaza, principalmente la fuerza gravitatoria.\\nLa ciencia que estudia los fenómenos balísticos en general se denomina balística. La balistica exterior estudia la trayectoria balística bajo diversas condiciones.\\nCuando sobre el proyectil tan solo actúa la gravedad, la trayectoria balística es una parábola. Sin embargo, la presencia de otras fuerzas, tales como la resistencia aerodinámica, la fuerza de sustentación, la fuerza de Coriolis, etc. hace que la trayectoria real sea algo diferente de una parábola.\\nAlgunos proyectiles autopropulsados se denominan balísticos haciendo hincapié que no existe propulsión nada más que en la fase inicial de lanzamiento. Un ejemplo de ello son los misiles balísticos que en su fase de caída carecen de autopropulsión."},{"page_url":"https://en.wikipedia.org/wiki/Michele_Lee","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Michele_Lee.JPG","page_title":"Michele Lee","context_page_description":"Michele Lee is an American actress, singer, dancer, producer and director. She is known for her role as Karen Cooper Fairgate MacKenzie on the 1980s prime-time soap opera Knots Landing, for which she was nominated for a 1982 Emmy Award and won the Soap Opera Digest Award for Best Actress in 1988, 1991 and 1992. She was the only performer to appear in all 344 episodes of the series.\\nLee began her career on Broadway in Vintage 60 and How to Succeed in Business Without Really Trying. She made her movie debut in the film version of the latter in 1967. Her other film appearances include the Disney film The Love Bug, The Comic and Along Came Polly. She was nominated for the Tony Award for Best Actress in a Musical in 1974 for Seesaw, and for the Tony Award for Best Featured Actress in a Play in 2001 for The Tale of the Allergist's Wife. She also played the title role in the 1998 TV film Scandalous Me: The Jacqueline Susann Story, and Madame Morrible in the Broadway musical Wicked in 2015."},{"page_url":"https://vi.wikipedia.org/wiki/Lockheed_F-104_Starfighter","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Lockheed_F-104G_showing_full_external_stores_load.jpg","page_title":"Lockheed F-104 Starfighter","context_page_description":"Chiếc Lockheed F-104 Starfighter là một kiểu máy bay tiêm kích đánh chặn siêu thanh một động cơ có tính năng bay khá cao đã phục vụ cho Không quân Hoa Kỳ từ năm 1958 đến năm 1967. Nó tiếp tục phục vụ trong Không lực Vệ binh Quốc gia cho đến khi được loại bỏ vào năm 1975. Sau đó, cơ quan NASA tiếp tục bay một đội máy bay nhỏ. NASA đã sử dụng những chiếc F-104 bay hỗ trợ cho những kế hoạch X-15 và XB-70, và nó tiếp tục bay hỗ trợ những chương trình không gian cho đến khi chúng được nghỉ hưu vào năm 1995 và được thay thế bằng những chiếc F/A-18 Hornet. Chiếc Starfighter là máy bay đầu tiên đã giữ đồng thời kỷ lục thế giới chính thức về vận tốc, cao độ và tốc độ lên cao. Nhiều phiên bản huấn luyện hai chỗ ngồi được chế tạo, phiên bản có số lượng nhiều nhất là TF-104G.\\nChiếc F-104C đã được Không quân Hoa Kỳ sử dụng trong Chiến tranh Việt Nam, và chiếc F-104A cũng được bố trí trong các cuộc Chiến tranh Ấn Độ-Pakistan. Những chiếc F-104 của Không quân Trung Hoa Dân Quốc cũng từng đối địch cùng những chiếc MiG-19 của Không quân Quân giải phóng Trung Quốc bên trên bầu trời đảo Kim Môn."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD_%D0%BC%D0%B0%D1%81%D0%BE%D0%BD%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Coat_of_Arms_of_the_Icelandic_Order_of_Freemasons.png","page_title":"Исландский орден масонов","context_page_description":"Исландский орден масонов, также известный как Великая ложа Исландии, является руководящим органом регулярного масонства в Исландии."},{"page_url":"https://de.wikipedia.org/wiki/Werdenfelser_Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Werdenfelser_Land.png","page_title":"Werdenfelser Land","context_page_description":"Das Werdenfelser Land bezeichnet eine oberbayerische Region, die sich von Mittenwald im Süden bis hin nach Farchant erstreckt.\\nSie umfasst Teile der Bayerischen Alpen.\\nNamensgebend für die Region ist die mittelalterliche Burg Werdenfels nördlich von Garmisch-Partenkirchen. Die Burg diente vornehmlich zur Sicherung der Heeres- und Handelsstraße, die durch das Loisachtal führte und Handelsplätze in Italien und Oberbayern verband.\\nIm Jahr 2006 erfolgte die Aufnahme des Werdenfelser Landes in die Liste der 77 ausgezeichneten Nationalen Geotope Deutschlands."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%95%D7%A2%D7%A6%D7%94_%D7%9C%D7%91%D7%99%D7%98%D7%97%D7%95%D7%9F_%D7%9C%D7%90%D7%95%D7%9E%D7%99_%D7%95%D7%94%D7%92%D7%A0%D7%94_(%D7%90%D7%95%D7%A7%D7%A8%D7%90%D7%99%D7%A0%D7%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Pres-adm-ukraine-2008.jpg","page_title":"המועצה לביטחון לאומי והגנה (אוקראינה)","context_page_description":"המועצה לביטחון לאומי והגנה של אוקראינה, היא גוף ממלכתי מייעץ לנשיא אוקראינה בנושאי ביטחון לאומי והגנת המדינה.\\nזהו גוף ממשלתי שמטרתו לפתח את המדיניות בענייני ביטחון לאומי ומייעץ לנשיא נשיא אוקראינה. כל הפגישות של המועצה מתקיימות בבניין האדמיניסטרציה הנשיאותית בקייב.\\nמאז דצמבר 2014, ראש המועצה הוא אולכסנדר טורצ'ינוב."},{"page_url":"https://en.wikipedia.org/wiki/Religion_in_China","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Lords_Prayer_in_Chinese.jpg","page_title":"Religion in China","context_page_description":"The government of China officially espouses state atheism, though Chinese civilization has historically long been a cradle and host to a variety of the most enduring religio-philosophical traditions of the world. Confucianism and Taoism, later joined by Buddhism, constitute the \\"three teachings\\" that have shaped Chinese culture. There are no clear boundaries between these intertwined religious systems, which do not claim to be exclusive, and elements of each enrich popular or folk religion. The emperors of China claimed the Mandate of Heaven and participated in Chinese religious practices. In the early 20th century, reform-minded officials and intellectuals attacked all religions as \\"superstitious\\", and since 1949, China has been governed by the Communist Party of China, an atheist institution that prohibits party members from practicing religion while in office. In the culmination of a series of atheistic and anti-religious campaigns already underway since the late 19th century, the Cultural Revolution against old habits, ideas, customs and culture, lasting from 1966 to 1976, destroyed or forced them underground."},{"page_url":"https://fr.wikipedia.org/wiki/J%C3%A9r%C3%B4me_Pineau","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Jerome.pineau.jpg","page_title":"Jérôme Pineau","context_page_description":"Jérôme Pineau, né le 2 janvier 1980 à Mont-Saint-Aignan, est un coureur cycliste français. Professionnel de 2002 à 2015, il a notamment remporté une étape du Tour d'Italie 2010, la Polynormande, le Tour de l'Ain, et terminé troisième du Championnat de Zurich en 2004."},{"page_url":"https://ceb.wikipedia.org/wiki/Blue_Mountains_(kabukiran_sa_Tinipong_Bansa,_Oregon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Wpdms_nasa_topo_blue_mountains.jpg","page_title":"Blue Mountains (kabukiran sa Tinipong Bansa, Oregon)","context_page_description":"Kabukiran ang Blue Mountains sa Tinipong Bansa. Ang Blue Mountains nahimutang sa kondado sa Union County ug estado sa Oregon, sa sentro nga bahin sa nasod, 3,400 km sa kasadpan sa ulohang dakbayan Washington, D.C. Naglangkob kin og 10,500 ka kilometro kwadrado."},{"page_url":"https://en.wikipedia.org/wiki/Alpina","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/BMW_E28_mit_Tuner_Werbung.jpg","page_title":"Alpina","context_page_description":"Alpina Burkard Bovensiepen GmbH & Co. KG is an automobile manufacturing company based in Buchloe, in the Ostallgäu district of Bavaria, Germany that develops and sells high-performance versions of BMW cars.\\nAlpina works closely with BMW and their processes are integrated into BMW's production lines, thus Alpina is recognized by the German Ministry of Transport as an automobile manufacturer, in contrast to other performance specialists which are aftermarket tuners. For instance, the Alpina B7 is produced at the same assembly line in Dingolfing, Germany, as BMW's own 7 Series. The B7's twin-turbo 4.4-litre V8 is assembled by hand at Alpina's facility in Buchloe, Germany, before being shipped to BMW for installation, and the assembled vehicle is then sent back to Alpina for finishing touches.\\nThe firm was founded in 1965 by Burkard Bovensiepen, a member of the Bovensiepen family of industrialists."},{"page_url":"https://war.wikipedia.org/wiki/Angraecum_filicornu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Angraecum_viguieri.jpg","page_title":"Angraecum filicornu","context_page_description":"An Angraecum filicornu in uska species han Liliopsida nga ginhulagway ni Louis Marie Aubert Du Petit-Thouars. An Angraecum filicornu in nahilalakip ha genus nga Angraecum, ngan familia nga Orchidaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%90%E1%83%91%E1%83%90%E1%83%99%E1%83%90%E1%83%9C%E1%83%98_(%E1%83%A5%E1%83%90%E1%83%9A%E1%83%90%E1%83%A5%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Flag_of_Abakan_%28Khakassia%29.png","page_title":"აბაკანი (ქალაქი)","context_page_description":"აბაკანი — ქალაქი რუსეთში, კრასნოიარსკის მხარეში, ხაკასეთის ადმინისტრაციული ცენტრი. მდებარეობს მდინარე აბაკანისა და ენისეის შესართავთან. ქალაქში მდებარეობს სარკინიგზო კვანძი, აეროპორტი, უსის საავტომობილო გზა ტუვასთან აკავშირებს. ქალაქში 1939 წელს 37 ათასი, 1959 წელს 56 ათასი, 1970 წელს 90 ათასი მცხოვრები იყო. ქალაქში ასევე არის მექანიკური ქარხანა, ხორცკომბინატი, საფეიქრო, საკონდიტრო, ტანსაცმლისა და ფეხსაცმლის ფაბრიკები, ხაკასეთის ისტორიის, ენისა და ისტორიის სამეცნიერო-კვლევითი ინსტიტუტი, პოლიტექნიკუმი, სასოფლო-სამეურნეო ტექნიკუმი, სამედიცინო, პედაგოგიური და მუსიკალური სასწავლებლები, დრამატული თეატრი, მხარეთმცოდნეობის მუზეუმი, ტელეცენტრი."},{"page_url":"https://pl.wikipedia.org/wiki/Powiat_bi%C5%82gorajski","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Ksi%C4%99%C5%BCpol_Ko%C5%9Bci%C3%B3%C5%82.jpg","page_title":"Powiat biłgorajski","context_page_description":"Powiat biłgorajski – powiat w Polsce, w południowej części województwa lubelskiego, odtworzony w 1999 roku w ramach reformy administracyjnej. Jego siedzibą jest miasto Biłgoraj.\\nPowiat leży głównie na pograniczu Równiny Biłgorajskiej i Płaskowyżu Tarnogrodzkiego. Północne gminy powiatu tworzą specyficzne podłużne i wąskie pasmo, przebiegające na krótkich odcinkach przez szereg równoleżnikowych mezoregionów: Wzniesienia Urzędowskie, Roztocze Zachodnie, Padół Zamojski i Wyniosłość Giełczewską. Wschodnie krańce powiatu leżą w obrębie Roztocza Środkowego. Głównymi rzekami powiatu są Tanew, Łada i Por. Na terenie powiatu znajdują się złoża gazu ziemnego i ropy naftowej. Jest to region wybitnie rolniczy z dużymi obszarami leśnymi."},{"page_url":"https://de.wikipedia.org/wiki/Morgan_County_(Alabama)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/RailBr6.jpg","page_title":"Morgan County (Alabama)","context_page_description":"Morgan County ist ein County im Bundesstaat Alabama der Vereinigten Staaten. Der Verwaltungssitz ist Decatur. Das County gehört zu den Dry Countys, was bedeutet, dass der Verkauf von Alkohol eingeschränkt oder verboten ist."},{"page_url":"https://en.wikipedia.org/wiki/Dromayor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Dromayor_Organization.jpg","page_title":"Dromayor","context_page_description":"Dromayor was a pharmaceutical conglomerate specializing in the distribution of pharmaceutical and consumer products in Colombia. It became the largest distributor of pharmaceuticals in the country."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%88%D1%82%D0%B0%D0%BB%D0%B5%D0%B2%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Crystal_Cathedral_Tower.jpg","page_title":"Кришталевий собор","context_page_description":"Кришталевий собор — римо-католицький собор у місті Гарден Гроув, штат Каліфорнія. Архітектор - Філіп Джонсон. Будівля збудована у стилі постмодернізм. Для зведення використано приблизно 10 000 скляних блоків. Місткість храму - 2900 вірян.\\nБудівництво храму велося з 1977 до 1980 років. Первинно храм належав пресвітеріанській Реформатській Церкві Америки. 2010 року Реформатській Церкві стало загрожувати банкрутство, тому в середині листопада 2011 церква була продана за 57,5 млн. доларів римо-католицькій єпархії Оріндж. За планами храм буде переобладнаний для католиків до 2017 року та отримає нову назву - Собор Христа."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Adolf_II._zu_Schwarzenberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/F%C3%BCrst-Adolf-II-zu-Schwarzenberg.jpg","page_title":"Johann Adolf II. zu Schwarzenberg","context_page_description":"Johann Adolf II. Fürst zu Schwarzenberg war ein österreichischer Diplomat und Mitglied des Adelsgeschlechts der Schwarzenberg."},{"page_url":"https://pt.wikipedia.org/wiki/Ilha_de_S%C3%A3o_Vicente_(Cabo_Verde)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/2006.06.25.cv.sv.BaiadasGatas.transportes.png","page_title":"Ilha de São Vicente (Cabo Verde)","context_page_description":"São Vicente é a segunda ilha mais populosa de Cabo Verde, localizada no grupo do Barlavento, a noroeste do arquipélago. O canal de São Vicente separa-a da vizinha ilha de Santo Antão. O Aeroporto Internacional Cesária Évora localiza-se a sul da cidade do Mindelo, o principal centro urbano da ilha e a segunda maior cidade do país, onde se concentra grande parte da população da ilha, que no seu todo conta com 74 136 habitantes. Mindelo é frequentemente considerada ilha cultural de Cabo Verde.\\nA ilha, de aspecto úmido e árido, tem na pesca, no turismo e na exploração do seu movimentado porto de mar ― o Porto Grande ― as suas principais fontes de receita.\\nSão Vicente tem muitos pratos típicos, muitos deles tendo o marisco por base. Para além da célebre \\"cachupa\\", pontificam o \\"arroz de cabidela de marisco à Dadal\\" e o \\"guisado de percebes\\" a feijoada.\\nSão Vicente é também conhecida pelo Festival Internacional de Música da Baía das Gatas ― realizado no primeiro fim-de-semana de lua cheia do mês de Agosto ― e por ser a terra natal da célebre cantora Cesária Évora."},{"page_url":"https://it.wikipedia.org/wiki/Ortona","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Cattedrale-di-San-Tommaso.jpg","page_title":"Ortona","context_page_description":"Ortona è un comune italiano di 22 787 abitanti della provincia di Chieti in Abruzzo.\\nLa storia antichissima della città risale al popolo dei Frentani, che usava lo scalo commerciale come principale fonte economica del territorio.\\nCittà romana dagli inizi del III secolo a.C. fino al V secolo, fu occupata, dopo la caduta dell'Impero romano d'Occidente, prima dai Goti, poi dai Bizantini, dai Longobardi e infine dai Normanni che la incendiarono. Risorta in epoca sveva tornò a fiorire economicamente.\\nNel 1258 la città ospitò in maniera permanente nella Cattedrale le reliquie di San Tommaso Apostolo, diventando un punto di riferimento nel campo religioso. Dopo battaglie varie con la città rivale di Lanciano, Ortona passò in mano a Jacopo Caldora che ricostruì la cinta muraria. Fu città cara a Margherita d'Austria, che vi fece costruire Palazzo Farnese.\\nDurante l'Ottocento fu rappresentata culturalmente da Francesco Paolo Tosti e Gabriele D'Annunzio."},{"page_url":"https://id.wikipedia.org/wiki/Jalur_kereta_api_Sandringham","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Metro_Trains_Melbourne_Logo.png","page_title":"Jalur kereta api Sandringham","context_page_description":"Jalur kereta api Sandringham adalah jalur kereta api komuter Public Transport Victoria di Melbourne, Victoria. Jalur ini melewati daerah City of Bayside, sebagian kecil Cities of Glen Eira, Port Phillip, Stonnington, dan Yarra."},{"page_url":"https://zh.wikipedia.org/wiki/IMI_TAR-21%E7%AA%81%E6%93%8A%E6%AD%A5%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%D0%92_%D0%BE%D0%B4%D0%B5%D1%81%D1%8C%D0%BA%D1%96%D0%B9_%D0%92%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B2%D1%96%D0%B9_%D0%B0%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D1%96%D1%97_230_%D0%BA%D1%83%D1%80%D1%81%D0%B0%D0%BD%D1%82%D1%96%D0%B2_%D0%BD%D0%B0%D0%B1%D0%BE%D1%80%D1%83_2018_%D1%80%D0%BE%D0%BA%D1%83_%D0%BF%D1%80%D0%B8%D1%81%D1%8F%D0%B3%D0%BD%D1%83%D0%BB%D0%B8_%D0%BD%D0%B0_%D0%B2%D1%96%D1%80%D0%BD%D1%96%D1%81%D1%82%D1%8C_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D1%83_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_%2829506952547%29.jpg","page_title":"IMI TAR-21突擊步槍","context_page_description":"TAR-21是一款採用5.56×45mm NATO彈藥的以色列犢牛式突擊步槍。TAR-21的含義是「Tavor Assault Rifle - 21st Century」。其名字是來自他泊山。它曾是吉瓦提步兵旅、戈蘭尼步兵旅和納哈爾步兵旅等多個單位的制式武器。然而隨著最新型的MTAR-21／X95已成為以色列國防軍一線部隊的制式突擊步槍，舊版的TAR-21因此被降級為二線部隊的武器。\\n為了便捷起見，除了表示其型號，以下本文一律以塔沃爾之作為文章中的簡稱。"},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_fotbollstermer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Referee_Michael_Lerjeus.jpg","page_title":"Lista över fotbollstermer","context_page_description":"Fotbollstermer är dels relaterade till begrepp runt fotbollens regler samt uttryck myntade av spelare, ledare eller experter inom fotboll, exempelvis 6-poängsmatch. Detta är en lista över termerna och dessas innebörd. Ett antal av följande termer används även i många andra bollsporter.\\nFotboll är en lagsport som ofta benämns som världens populäraste sport Enligt en undersökning genomförd av FIFA som publicerades 2001 spelas fotboll regelbundet av över 240 miljoner människor från mer än 200 länder. Fotbolls-VM för herrar, som arrangeras vart fjärde år, är det mest beskådade sportevenemanget i världen där VM-finalen 2006 beräknas ha setts i direktsändning av 715 miljoner TV-tittare världen över."},{"page_url":"https://nl.wikipedia.org/wiki/Ronde_van_Lombardije","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/JoaquimRodriguez_Il_Lombardia_2013.jpg","page_title":"Ronde van Lombardije","context_page_description":"De Ronde van Lombardije is een eendaagse wielerklassieker die ieder najaar wordt verreden in en rond de Italiaanse regio Lombardije. Omdat de wedstrijd plaatsvindt aan het eind van het wielerseizoen, wordt hij ook wel \\"de koers van de vallende bladeren\\" genoemd. Samen met Milaan-San Remo, de Ronde van Vlaanderen, Parijs-Roubaix en Luik-Bastenaken-Luik behoort de Ronde van Lombardije tot de Vijf monumenten."},{"page_url":"https://de.wikipedia.org/wiki/Kameralamt_(W%C3%BCrttemberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Kameralamt_T%C3%BCbingen_von_der_M%C3%BChlstra%C3%9Fe_aus_%28AK_1900er%29.jpg","page_title":"Kameralamt (Württemberg)","context_page_description":"Die Kameralämter im Königreich Württemberg verwalteten den Besitz und das Einkommen des Staates und erfüllten die darauf beruhenden Verbindlichkeiten. Sie entstanden ab 1806, um die Staatsfinanzverwaltung neu und einheitlich zu ordnen."},{"page_url":"https://it.wikipedia.org/wiki/Sabu_(wrestler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Sabu.jpg","page_title":"Sabu (wrestler)","context_page_description":"Terry Michael Brunk, meglio conosciuto come Sabu, è un ex wrestler statunitense, di origini indiane.\\nÈ famoso per i suoi trascorsi nella Extreme Championship Wrestling negli anni novanta, nella Total Nonstop Action dal 2002 al 2006, nella World Wrestling Entertainment dal 2006 al 2007, dove ha militato nel roster della ECW ed un breve periodo nella World Championship Wrestling. Attualmente milita nei circuiti indipendenti."},{"page_url":"https://id.wikipedia.org/wiki/Ka%27bah","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Kaaba-plan.svg","page_title":"Ka'bah","context_page_description":"Ka'bah, juga merujuk pada Al Ka'bah Al Musyarrafah, adalah sebuah bangunan di tengah-tengah masjid paling suci dalam agama Islam, Masjidil Haram, di Mekkah, Hejaz, Arab Saudi. Tempat ini adalah tempat yang paling disucikan dalam agama Islam. Ka'bah dianggap \\"Rumah Allah\\" dan mirip selayaknya Bait Suci dalam keyakinan Yudaisme. Muslim dari seluruh dunia menghadap Ka'bah sebagai titik ketika melaksanakan salat. Perintah salat menghadap ke Ka'bah dikenal dengan nama kiblat.\\nBangunan suci sekitar Ka'bah dikenal sebagai Masjid al-Haram.\\nSalah satu dari Rukun Islam mewajibkan bagi setiap Muslim yang mampu untuk menunaikan ibadah haji satu kali seumur hidup. Bagian-bagian ritual haji yang mengharuskan tawaf, berputar tujuh kali mengelilingi Ka'bah dengan melawan arah jarum jam. Tawaf juga dilakukam oleh jamaah saat melaksanakan umrah. Namun, kebanyakan waktu ramai di Ka'bah adalah saat musim haji, ketika jutaan jamaah bersama-sama mengelilingi bangunan dengan sebuah periode dalam lima hari. Pada 2013, jamaah haji yang datang dari luar Kerajaan Arab Saudi untuk melaksanakan haji secara resmi dilaporkan sebanyak 1,379,531."},{"page_url":"https://lt.wikipedia.org/wiki/Sud%C4%97tis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Addition01.svg","page_title":"Sudėtis","context_page_description":"Sudėtis – vienas pagrindinių aritmetikos veiksmų.\\nPaprasčiausiu atveju sudėtis du skaičius paverčia vienu – suma. Sudedant daugiau nei du skaičius, sudėtis taikoma dviem skaičiams, tada rezultatas sudedamas su sekančiu ir t. t."},{"page_url":"https://af.wikipedia.org/wiki/Renosterveld","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Swartland-skalierenosterveld.svg","page_title":"Renosterveld","context_page_description":"Die renosterveld verwys oorspronklik na 'n streek in die Overberggebied van die Kaapkolonie wat 'n kenmerkende flora en fauna gehad het. Die Overbergse renosterveld het eens die golwende laagliggende landskap van die oorgrote Overbergstreek bedek, en was die tuiste van baie wildtroppe. Vandag is dit egter een van die mees bedreigde biome ter wêreld, aangesien die omvang daarvan weens landboupraktyke met 95% afgeneem het. Die vrugbare grond van hierdie ekostelsel is grotendeels omgeploeg, sodat vandag slegs fragmente oorbly, meestal in plekke wat te styl of rotsagtig is vir saaiboerdery. Meer onlangs word die term ook gebruik om dergelike plantegroei van 'n naasgeleë streek in die Wes-Kaap aan te dui, naamlik dié van die Swartland."},{"page_url":"https://es.wikipedia.org/wiki/Bogside","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Bloodsunmonum.jpg","page_title":"Bogside","context_page_description":"El Bogside es un vecindario situado más allá de los muros de la ciudad de Derry, en Irlanda del Norte. Dicho lugar es comúnmente conocido por haber sido escenario de numerosos sucesos durante el Conflicto de Irlanda del Norte durante los años 60 y 70 del siglo XX, tales como la Batalla del Bogside, el Domingo Sangriento, la Operación Motorman o el establecimiento del \\"área no-go\\" conocida como Free Derry.\\nEn la actualidad, los grandes murales alusivos a dicha época, realizados por los Artistas del Bogside, la esquina Free Derry y el Gasyard Feile son las atracciones turísticas más importantes."},{"page_url":"https://bar.wikipedia.org/wiki/460","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Ste_genevieve_st_etienne.jpg","page_title":"460","context_page_description":"Des is a Iwablick iwas Joar 460."},{"page_url":"https://it.wikipedia.org/wiki/The_Radio_Dept.","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/The_Radio_Dept._at_Sochi.jpg","page_title":"The Radio Dept.","context_page_description":"I The Radio Dept. sono un gruppo musicale svedese, formatosi a Lund nel 1995."},{"page_url":"https://hr.wikipedia.org/wiki/J%C3%A9r%C3%B4me_Fernandez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/J%C3%A9r%C3%B4me_Fernandez_%28BM_Ciudad_Real%29_-_Handball_player_of_France_%282%29.jpg","page_title":"Jérôme Fernandez","context_page_description":"Jérôme Fernandez, francuski rukometaš i reprezentativac.\\nFernandez je trenutno član njemački kluba THW Kiel. Klupsku karijeru je od 1985. do 2002. proveo u rodnoj Francuskoj, no 2002. prelazi u Barcelonu i akon toga ostaje u Španjolskoj.\\nZa reprezentaciju je debitirao u studenom 1997. protiv Češke. Danas ima 252 nastupa i 994 postignuta pogotka, a bio je i član momčadi koja je na OI u Pekingu 2008. osvojila zlatnu medalju. Trenutačno je najbolji strijelac Francuske reprezentacije u povijesti."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8D%A3%E6%98%8C%E4%B8%9C%E8%A1%97%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Rongchangdongjie_station_platform.jpg","page_title":"荣昌东街站","context_page_description":"荣昌东街站位于北京市大兴区，北京市经济技术开发区内，是北京地铁亦庄线的一座车站。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D0%BA%D1%83%D1%81%D1%81%D1%82%D0%B2%D0%BE_%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Piedra_del_sol_Porfirio_Diaz.png","page_title":"Искусство Мексики","context_page_description":"Искусство Мексики или Мексиканское искусство — искусство коренных народов Центральной Америки, которые жили на территориях, объединенных позднее в современное государство Мексика — колыбель двух крупных индейских цивилизаций.\\nМайя и ацтеки были единственными народами в Северной Америке, имевшими развитую письменность, математику и календарь. В доколумбов период искусство, письменность и архитектура имели синкретический, сакральный и пиктографический характер. Культура и искусство Мексики пережили трагический период разрушения испанскими захватчиками в XVI—XVII веках и частично были восстановлены в XIX—XX веках, как противопоставление колониальному периоду.\\nИскусство Мексики состоит из различных видов изобразительного искусства, кино, музыкального, театрального искусств, которые развивались в географической области, теперь известной как государство Мексика. Развитие этих искусств разделяется на эпоху доиспанской Мезоамерики, колониальный период, период после мексиканской войны за независимость."},{"page_url":"https://el.wikipedia.org/wiki/%CE%99%CF%83%CF%84%CE%BF%CF%81%CE%AF%CE%B1_%CF%84%CE%B7%CF%82_%CE%91%CF%86%CF%81%CE%B9%CE%BA%CE%AE%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Qirat_imperio_almor%C3%A1vide_tasfin_7986.jpg","page_title":"Ιστορία της Αφρικής","context_page_description":"Η Ιστορία της Αφρικής ξεκινά με την εμφάνιση των ανθρωπιδών, των αρχαϊκών ανθρώπων και – από τουλάχιστον 200.000 χρόνια πριν – των ανατομικά σύγχρονων ανθρώπων, στην Ανατολική Αφρική, και συνεχίζεται χωρίς διακοπή στο παρόν ως ένα συνονθύλευμα διαφορετικών και πολιτικά αναπτυσσόμενων εθνικών κρατών. Η πρώιμη γραπτή ιστορία πρωτοπαρουσιάστηκε στο Βασίλειο του Κους, και αργότερα στην Αρχαία Αίγυπτο, στο Σαχέλ, στο Μαγκρέμπ και στο Κέρας της Αφρικής.\\nΜετά την ερημοποίηση της Σαχάρας, η ιστορία της Βόρειας Αφρικής ήταν συνυφασμένη με εκείνη της Μέσης Ανατολής και της Νότιας Ευρώπης, ενώ οι Μπαντού εξαπλώθηκαν σαρωτικά από το σύγχρονο Καμερούν σε όλη την υποσαχάρια ήπειρο, σε κύματα κατά την 1η χιλιετία π.Χ., δημιουργώντας μια γλωσσική κοινότητα σε μεγάλο μέρος της κεντρικής και της νότιας ηπείρου.\\nΚατά τη διάρκεια του Μεσαίωνα το Ισλάμ εξαπλώθηκε δυτικά από την Αραβία προς την Αίγυπτο, διασχίζοντας το Μαγκρέμπ και το Σαχέλ."},{"page_url":"https://nl.wikipedia.org/wiki/Couzon-au-Mont-d%27Or","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Map_commune_FR_insee_code_69068.png","page_title":"Couzon-au-Mont-d'Or","context_page_description":"Couzon-au-Mont-d'Or is een gemeente in de Franse Métropole de Lyon en telt 2609 inwoners. De plaats maakt deel uit van het arrondissement Lyon.\\nDe kerk van Couzon-au-Mont-d'Or dateert uit 1855 en werd ontworpen door Pierre Bossan, de architect van Notre-Dame de Fourvière in Lyon."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC%D1%81%D1%85%D0%B0%D1%84%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Marinemuseum-wilhelmshaven-2007.jpg","page_title":"Вильгельмсхафен","context_page_description":"Вильгельмсха́фен — город окружного подчинения на северо-западе Германии, в Нижней Саксонии. Население: 75,9 тыс. человек.\\nОснован в 1869 королём Пруссии Вильгельмом I как база прусского флота. Был главной базой ВМС Германии в двух мировых войнах. В настоящее время — главная военно-морская база ФРГ на Северном море и третий по размеру порт, специализирующийся на перевалке нефтепродуктов.\\nДо 27 января 1889 года возглавлял управление портом вице-адмирал Барон фон дер Гольц. С 27.01.1889 г. главным командиром Вильгельмсхафенского порта назначен вице-адмирал Патен.\\nПолитехнический институт.\\nДостопримечательности: аквариум с североморскими животными; мост Короля Вильгельма — один из крупнейших в Европе вращающихся мостов; военно-морской музей."},{"page_url":"https://sk.wikipedia.org/wiki/Le_Vieil-Dampierre","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Map_commune_FR_insee_code_51619.png","page_title":"Le Vieil-Dampierre","context_page_description":"Le Vieil-Dampierre je francúzska obec, ktorá sa nachádza v departemente Marne, v regióne Champagne-Ardenne."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%B0%D0%B1%D1%80%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Ch%C3%A2teau_du_Pin.jpg","page_title":"Фабра","context_page_description":"Фабра насеље је и општина у источној Француској у региону Рона-Алпи, у департману Ардеш која припада префектури Ларжантјер.\\nПо подацима из 2011. године у општини је живело 390 становника, а густина насељености је износила 51,86 становника/km². Општина се простире на површини од 7,52 km². Налази се на средњој надморској висини од 450 метара."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%83%9E%E3%82%B5%E3%82%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Limonium_tetragonum_hamasagi11.jpg","page_title":"ハマサジ","context_page_description":"ハマサジ Limonium tetragonum はイソマツ科の植物の1つ。海岸の満潮時には海水につかる場所に生育する。硬い根の先端に厚いヘラ型の葉を多数付ける。"},{"page_url":"https://id.wikipedia.org/wiki/St._Moritz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/St._Moritz_Dorf_da_St._Moritz_Bad.JPG","page_title":"St. Moritz","context_page_description":"Sankt Moritz adalah sebuah kotamadya politik di Lembah Engadin, Distrik Maloja, Kanton Graubuenden, Swiss."},{"page_url":"https://sv.wikipedia.org/wiki/Callomyia_elegans","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Europ%C3%A4ischenZweifl%C3%BCgeligen1790TafCXCVIII.jpg","page_title":"Callomyia elegans","context_page_description":"Callomyia elegans är en tvåvingeart som beskrevs av Johann Wilhelm Meigen 1804. Callomyia elegans ingår i släktet Callomyia och familjen svampflugor. Arten är reproducerande i Sverige. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BD%A9%E6%B3%B0%E9%87%8C%C2%B7%E5%A5%A5%E5%B0%94%E6%B3%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Petteri_Orpo_2017_Kokoomus_03.jpg","page_title":"佩泰里·奥尔波","context_page_description":"安蒂·佩泰里·奧爾波是芬蘭政治家，自2007年起代表民族聯合黨的芬蘭議會議員，自2015年5月起芬蘭內務部長，2014-2015年間芬蘭農林部長。\\n在2016年6月11日舉行的民族聯合黨大會上奧爾波在第二輪投票中以55%的選票優勢領先現任黨主席亞歷山大·斯圖布而當選為新的民族聯合黨主席。2016年6月22日他被任命為芬蘭財政部長。"},{"page_url":"https://pt.wikipedia.org/wiki/Parque_Olhos_D%27%C3%81gua","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Parque_Olhos_D%27%C3%81gua_II.jpg","page_title":"Parque Olhos D'Água","context_page_description":"O Parque Ecológico e de Uso Múltiplo Olhos D'Água ou Parque Olhos D'água é um parque público, ecológico e de lazer brasileiro localizado no centro do Distrito Federal, na região administrativa de Brasília e possui 21 hectares."},{"page_url":"https://hsb.wikipedia.org/wiki/Alagir","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Relief_Map_of_North_Ossetia.png","page_title":"Alagir","context_page_description":"Alagir je město z 20.399 wobydlerjemi w juhoruskej republice Sewjernej Osetskej-Alanskej. Leži 54 kilometrow zapadnje wot Wladikawkaza při rěce Ardon pod Kawkazom.\\nAlagir je so w lěće 1850 jako wobhrodźene sydlišćo w bliskosći slěbrowych podkopkow załožiło."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_light_rail_systems_by_ridership","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/RTD_SD100_%26_SD160.jpeg","page_title":"List of United States light rail systems by ridership","context_page_description":"The following is a list of all light rail systems in the United States, ranked by ridership. Also included are those urban streetcar/trolley systems that are providing regular public transit service. This list does not include statistics for metro/rapid transit systems. Daily and annual ridership figures are based on \\"average weekday unlinked passenger trips\\". The annual ridership figures for 2019 and average weekday ridership figures for the fourth quarter of 2019 come from the American Public Transportation Association's Ridership Reports statistics for the fourth quarter of 2019, unless otherwise noted. References with supplementary ridership figures are included in the System column."},{"page_url":"https://cs.wikipedia.org/wiki/T%C3%A4rend%C3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/T%C3%A4r%C3%A4n%C3%B6n_kirkko%2C_Norrbotten.jpg","page_title":"Tärendö","context_page_description":"Tärendö je vesnice v severním Švédsku, kraji Norrbotten. Leží u ústí stejnojmenné řeky Tärendö do řeky Kalix. Žije zde asi 200 obyvatel."},{"page_url":"https://it.wikipedia.org/wiki/Citt%C3%A0_Proibita","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Forbidden_city_map_wp_1.png","page_title":"Città Proibita","context_page_description":"La Città Proibita è stata il palazzo imperiale delle dinastie Ming e Qing. Situata nel centro di Pechino, occupava il centro dell'antico sistema di fortificazioni della città e per quasi cinque secoli è servita come abitazione degli imperatori e delle loro famiglie, così come centro cerimoniale e politico del governo cinese.\\nCostruito tra il 1406 e il 1420, il complesso si compone di 980 edifici per un totale di 8.707 camere e 720.000 m², che ne fanno il più grande palazzo del mondo. Il complesso esemplifica la sontuosa architettura tradizionale cinese e ha influenzato gli sviluppi culturali e architettonici di tutta l'Asia orientale.\\nDal 1925 è diventata un museo, noto come \\"Museo del Palazzo\\", la cui vasta collezione di opere d'arte e manufatti è stata realizzata grazie alle collezioni imperiali delle dinastie Ming e Qing. Questo museo non va confuso con l'omonima istituzione di Taipei, il \\"Museo nazionale del palazzo\\": entrambi i musei derivano dalla stessa istituzione, ma furono divisi dopo la guerra civile cinese."},{"page_url":"https://es.wikipedia.org/wiki/Era_de_los_Descubrimientos","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Matadecacao.jpg","page_title":"Era de los Descubrimientos","context_page_description":"La Era de los Descubrimientos fue un período histórico que dio comienzo a principios del siglo XV, extendiéndose hasta comienzos del siglo XVII. Durante esta época los europeos, principalmente portugueses, españoles y británicos, recorrieron casi la totalidad del planeta, cartografiándolo y conquistándolo en buena medida. El motivo de dicha expansión vino por la necesidad de acceder a las riquezas de Asia, con las cuales contribuir al mercantilismo europeo, pero la causa o causas últimas siguen siendo discutidas.\\nMuchas tierras previamente desconocidas por los europeos fueron descubiertas por ellos en este período, aunque la mayoría ya estaban habitadas. Desde la perspectiva de muchos no europeos, la era de los descubrimientos marcó la llegada de invasores de continentes previamente desconocidos.\\nLa exploración global comenzó con los descubrimientos portugueses de los archipiélagos atlánticos de Madeira y las Azores, la costa de África y el descubrimiento de la ruta marítima a la India en 1498; y la Corona de Castilla los viajes transatlánticos de Cristóbal Colón a las Américas entre 1492 y 1502 y la primera circunnavegación del mundo en 1519–1522."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B9%D8%B1%D9%83%D8%A9_%D8%AA%D8%B3%D9%88%D8%AA%D8%B3%D9%88%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Ryszkiewicz_Tatars_in_the_vanguard.jpg","page_title":"معركة تسوتسورا","context_page_description":"معركة تسوتسورا هي معركة نشبت بين القوات العثمانية، وقوات الكومنولث البولندي الليتواني، استمرت المعركة من 17 أيلول حتى 7 تشرين أول من عام 1620 في تسوتسورا، قرب نهر بروت."},{"page_url":"https://sv.wikipedia.org/wiki/G%C3%B6teborgs_domkyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/S%C3%B6ndagsklockan_G%C3%B6teborg.jpg","page_title":"Göteborgs domkyrka","context_page_description":"Göteborgs domkyrka, Gustavi domkyrka eller Svenska kyrkan är en domkyrka i centrala Göteborg, omgärdad av Kungsgatan, Västra Hamngatan, Kyrkogatan och Korsgatan, inom Kvarteret 65 Domkyrkan. Nuvarande domkyrka är ritad av arkitekten Carl Wilhelm Carlberg.\\nGöteborgs domkyrka är både stiftskyrka i Göteborgs stift och församlingskyrka i Domkyrkoförsamlingen i Göteborg. Den är den tredje domkyrkan på samma plats. Den första invigdes 1633 i Gustav II Adolfs namn, året efter hans död i slaget vid Lützen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%B1%D9%84%D9%8A%D9%86%D9%83%D9%88%D8%B1%D8%AA_%D9%84%D9%8A_%D9%83%D8%A7%D9%88%D8%B1%D9%88%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Eglise_de_Berlencourt-le-Cauroy_-_Pas_de_Calais_-_France.JPG","page_title":"بيرلينكورت لي كاوروي","context_page_description":"بيرلينكورت لي كاوروي ‏ هي بلدية تقع في إقليم باد كاليه من منطقة نور با دو كاليه في شمال فرنسا. تبلغ مساحة هذه المدينة 7.48، وترتفع عن سطح البحر 110 م، يبلغ عدد سكانها 289 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس André Ansquin البلدية خلال فترة."},{"page_url":"https://fr.wikipedia.org/wiki/Stalag_II-B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Bundesarchiv_Bild_146-1990-009-27%2C_Stalag_II_B%2C_Hammerstein.jpg","page_title":"Stalag II-B","context_page_description":"Le Stalag II-B est un camp de prisonniers de guerre de la Seconde Guerre mondiale, situé à 2,4 km à l'est du village d'Hammerstein dans la province de Poméranie. Il est parfois désigné sous l'appellation de Stalag II-B Hammerstein."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1997","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Rebecca_Black_by_Gage_Skidmore.jpg","page_title":"Lijst van personen geboren in 1997","context_page_description":"Dit is een lijst van personen die geboren zijn in 1997.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D9%8A%D8%A9_%D8%B2%D9%83%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Maria_Zaki%2C_Bruxelles%2C_remise_du_Prix_Gros_Sel_du_Public_2009.jpg","page_title":"مارية زكي","context_page_description":"ماريا زكي هي شاعرة وكاتبة مغربية باللغة الفرنسية. ولدت في 6 ديسمبر 1964 بمدينة الجديدة. تحمل مارية الجنسية المغربية والبلجيكية."},{"page_url":"https://nl.wikipedia.org/wiki/Euroborg","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Euroborg121210.png","page_title":"Euroborg","context_page_description":"De Euroborg, is een multifunctioneel complex en het stadion waar de Groningse voetbalclub FC Groningen haar thuiswedstrijden speelt. Het stadion ligt aan de zuidoostkant van de stad langs de A7 richting Hoogezand. Vlak bij het stadion ligt het Station Europapark. Het stadion werd in 2006 geopend als Euroborg en heette ook NoordLease Stadion."},{"page_url":"https://en.wikipedia.org/wiki/Duke_of_York_Column","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Duke_of_York_J.Woods_after_a_picture_by_J.Salmon_publ_1837.jpg","page_title":"Duke of York Column","context_page_description":"The Duke of York Column is a monument in London, England, to Prince Frederick, Duke of York, the second eldest son of King George III. The designer was Benjamin Dean Wyatt. It is sited where Regent Street meets The Mall, a purposefully wide endpoint of Regent Street known as Waterloo Place and Gardens, in between the two terraces of Carlton House Terrace and their tree-lined squares. The three very wide flights of steps down to The Mall adjoining are known as the Duke of York Steps. The column was completed in December 1832 and the statue of the Duke of York, by Sir Richard Westmacott, was raised on 10 April 1834."},{"page_url":"https://sl.wikipedia.org/wiki/Julio_Cervera_Baviera","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Julio_Cervera_Baviera.jpg","page_title":"Julio Cervera Baviera","context_page_description":"‎\\nJulio Cervera Baviera, španski inženir, izumitelj, raziskovalec in častnik, * 26. januar 1854, † 24. junij 1927."},{"page_url":"https://fr.wikipedia.org/wiki/Ctenomys_brasiliensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Ctenomys_brasiliensis_1847_-_cropping.jpg","page_title":"Ctenomys brasiliensis","context_page_description":"Ctenomys brasiliensis est une espèce qui fait partie des rongeurs de la famille des Ctenomyidae. Comme les autres membres du genre Ctenomys, appelés localement des tuco-tucos, c'est un petit mammifère d'Amérique du Sud bâti pour creuser des terriers. Ce rongeur est endémique du Brésil où, d'après UICN, les populations sont peut-être en danger.\\nL'espèce a été décrite pour la première fois en 1826 par le zoologiste français Henri-Marie Ducrotay de Blainville."},{"page_url":"https://en.wikipedia.org/wiki/George_H._Widdows","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Chesterfield_-_St_Helena%27s_%28Geograph-2111081-by-Dave-Bevis%29.jpg","page_title":"George H. Widdows","context_page_description":"George H. Widdows was an English architect who pioneered changes to school building design to enhance the health of school children. He was also responsible for the design of about 80 schools in Derbyshire, where he became Chief Architect."},{"page_url":"https://it.wikipedia.org/wiki/Canada_Masters_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Rafael_Nadal_holding_the_2008_Rogers_Cup_trophy.jpg","page_title":"Canada Masters 2008","context_page_description":"Il Canada Masters 2008\\nè stato un torneo di tennis giocato sul cemento.\\nÈ stata la 119ª edizione del Canada Masters,\\nche fa parte della categoria ATP Masters Series nell'ambito dell'ATP Tour 2008,\\ne della categoria Tier I nell'ambito del WTA Tour 2008.\\nIl torneo maschile si è giocato al Rexall Centre di Toronto in Canada,\\ndal 19 al 27 luglio 2008, quello femminile all'Uniprix Stadium di Montréal, in Canada,\\ndal 26 luglio al 3 agosto 2008."},{"page_url":"https://br.wikipedia.org/wiki/Martina_Franca","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Martina_Franca_%28TA%29_-_piazza_XX_settembre.JPG","page_title":"Martina Franca","context_page_description":"Krogit e-barzh!\\nUn danvez pennad eo ar pennad-mañ ha labour zo d'ober c'hoazh a-raok e beurechuiñ.\\nGallout a rit skoazellañ Wikipedia dre glokaat anezhañ.\\nMartina Franca a zo ur gumun hag ur gêr eus Kreisteiz Italia e pleg-mor Taranto, gant 49 635 annezad."},{"page_url":"https://sv.wikipedia.org/wiki/Colchicum_doerfleri","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Colchicum_doerfleri_GotBot_2015.JPG","page_title":"Colchicum doerfleri","context_page_description":"Colchicum doerfleri är en tidlöseväxtart som beskrevs av Eugen von Halácsy. Colchicum doerfleri ingår i släktet tidlösor, och familjen tidlöseväxter. Inga underarter finns listade i Catalogue of Life.\\nColchicum doerfleri växer vilt på centrala Balkanhalvön."},{"page_url":"https://ceb.wikipedia.org/wiki/%C5%A2abaqat_Fa%E1%B8%A9l","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Byzantine_Basilica.jpg","page_title":"Ţabaqat Faḩl","context_page_description":"Lungsod ang Ţabaqat Faḩl sa Hordan. Nahimutang ni sa lalawigan sa Irbid, sa amihanang bahin sa nasod, 60 km sa amihanan-kasadpan sa Amman ang ulohan sa nasod. 11 metros ibabaw sa dagat kahaboga ang nahimutangan sa Ţabaqat Faḩl, ug adunay 1,000 ka molupyo.\\nAng yuta palibot sa Ţabaqat Faḩl kay kabungtoran sa sidlakan, apan sa kasadpan nga kini mao ang patag. Ang yuta palibot sa Ţabaqat Faḩl nga tinakpan sa ubos nga tungason kaayo sa kasadpan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 298 ka metro ug 2.3 km sa habagatan-sidlakan sa Ţabaqat Faḩl. Dunay mga 476 ka tawo kada kilometro kwadrado sa palibot sa Ţabaqat Faḩl nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang ‘Ajlūn, 18.7 km sa habagatan-sidlakan sa Ţabaqat Faḩl. Hapit nalukop sa kaumahan ang palibot sa Ţabaqat Faḩl. Sa rehiyon palibot sa Ţabaqat Faḩl, nga bato nga pormasyon talagsaon komon.\\nAng klima ugahon. Ang kasarangang giiniton 23 °C. Ang kinainitan nga bulan Hulyo, sa 34 °C, ug ang kinabugnawan Enero, sa 12 °C. Ang kasarangang pag-ulan 347 milimetro matag tuig. Ang kinabasaan nga bulan Enero, sa 96 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 1 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Prieur%C3%A9_Notre-Dame_de_Salagon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Prieur%C3%A9_Notre-Dame_de_Salagon_-_Oculus.JPG","page_title":"Prieuré Notre-Dame de Salagon","context_page_description":"Le prieuré Notre-Dame de Salagon est un prieuré roman situé sur le territoire de la commune de Mane dans le département français des Alpes-de-Haute-Provence en région Provence-Alpes-Côte d'Azur.\\nLe prieuré abrite depuis 1981 le musée départemental ethnologique de la Haute-Provence."},{"page_url":"https://pt.wikipedia.org/wiki/Megapnosaurus_rhodesiensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Coelophysis_rhodesiensis.JPG","page_title":"Megapnosaurus rhodesiensis","context_page_description":"O Megapnosaurus rhodesiensis foi uma espécie de dinossauro carnívoro e bípede que viveu no início do período Jurássico. Media 2,2 metros de comprimento e pesava aproximadamente 13 quilogramas.\\nO M. rhodesiensis viveu na África e seus fósseis foram encontrados no Zimbábue e possivelmente na África do Sul. O M. rhodesiensis aparentemente teve papel importante na longa escala de evolução dos dinossauros, a partir dele teriam surgifo mais tarde outros pequenos terópodes. Era muito parecido com o Coelophysis bauri, mas suas patas traseiras eram proporcionalmente mais longas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0_%D0%A3%D1%81%D1%81%D1%83%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BD%D1%87%D0%B0.JPG","page_title":"Архитектура Уссурийска","context_page_description":"Архитектура Уссурийска, в особенности его исторического центра, представляет собой созданный в XIX—XX веках один из примечательных архитектурных комплексов Дальнего Востока России.\\nУссурийск, основанный в 1866 году, до 2010 года входил в список исторических поселений Российской Федерации. В городе находится 157 объектов культурного наследия, из них 127 — это памятники градостроительства и архитектуры, в том числе 6 ансамблей застройки."},{"page_url":"https://en.wikipedia.org/wiki/Evangelical_Church_Centre_Kronsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Kirchenzentrum_Kronsberg%2C_Mai_2012_003.JPG","page_title":"Evangelical Church Centre Kronsberg","context_page_description":"The Evangelical Kronsberg Church Centre is a place of worship in the Kronsberg neighbourhood of Hanover, in Lower Saxony, Germany. The Church belongs to the St. Johannis-Kirchengemeinde Bemerode parish, within the Evangelical-Lutheran Church of Hanover. The church centre is a simultaneum, hosting Baptists as well as Lutherans for prayer services."},{"page_url":"https://it.wikipedia.org/wiki/Dianetics","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/L._Ron_Hubbard_conducting_Dianetics_seminar_in_Los_Angeles_in_1950.jpg","page_title":"Dianetics","context_page_description":"Dianetics è un libro del 1950 di L. Ron Hubbard; fu il primo libro dove Hubbard espose le idee che un anno e mezzo dopo portarono alla nascita di Scientology. Il testo illustra i principi fondamentali della mente e dello spirito elaborati da L. Ron Hubbard ed è considerato un testo base di Scientology.\\nIl libro, appena messo sul mercato statunitense, rimase per 28 settimane nella lista dei best seller del New York Times. A oggi ha venduto più di 20 milioni di copie. In Italia fu pubblicato da Gherardo Casini Editore nel 1951 col titolo Dianetica ed è pubblicato in altre 50 lingue da New Era Publications International.\\nLe tesi esposte non hanno avuto nessuna dimostrazione scientifica e sono ritenute un esempio di pseudoscienza.\\nPiù in generale Dianetics indica l'insieme di idee e di procedure che concernono lo spirito, la mente e il corpo elaborate da L. Ron Hubbard. La parola Dianetics è un marchio d'impresa registrato di proprietà del Religious Technology Center."},{"page_url":"https://fr.wikipedia.org/wiki/N%C3%A9buleuse_plan%C3%A9taire","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/NGC_7027HSTFull.jpg","page_title":"Nébuleuse planétaire","context_page_description":"Une nébuleuse planétaire est un objet astronomique qui ressemble à un disque d'aspect nébuleux lorsqu'il est observé à basse résolution. En raison de cet aspect, semblable à celui des planètes, l'adjectif « planétaire » lui a été attaché, et il a été depuis maintenu pour conserver l'uniformité historique. À partir d'observations plus détaillées, on sait maintenant que les nébuleuses planétaires n'ont en fait aucun rapport avec les planètes.\\nIl s'agit d'une nébuleuse en émission constituée d'une coquille de gaz en expansion éjecté d'une étoile en fin de vie, en transition de l'état de géante rouge à l'état de naine blanche pendant la branche asymptotique des géantes. Quand une petite étoile achève de consommer son hydrogène, puis son hélium, son cœur s'effondre pour former une naine blanche, tandis que les couches externes sont expulsées par la pression de radiation.\\nCes gaz forment un nuage de matière qui s'étend autour de l'étoile à une vitesse d'expansion de 20 à 30 kilomètres par seconde. Ce nuage est ionisé par les photons ultraviolets émis par l'étoile qui est devenue très chaude."},{"page_url":"https://pt.wikipedia.org/wiki/Recebedores_da_Cruz_de_Cavaleiro_da_Cruz_de_Ferro:_A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Hans-J%C3%BCrgen_von_Arnim.jpg","page_title":"Recebedores da Cruz de Cavaleiro da Cruz de Ferro: A","context_page_description":"A Cruz de Cavaleiro da Cruz de Ferro foi a maior condecoração militar concedida pela Alemanha Nazi durante a Segunda Guerra Mundial. Era concedida a militares de todas as patentes, deste um soldado até um Marechal de Campo e por diversos motivos que incluíam os atos de bravura de um soldado em batalha, um piloto de caça por ter abatido um número significativo de aeronaves inimigas e o hábil comando das tropas durante a batalha. Os condecorados eram enaltecidos pela propaganda alemã, tendo eles recebido grande atenção por parte da publicidade. Eram vendidos, por exemplo, porta retratos com as fotos dos últimos condecorados. Eles ainda eram convidados a discursar aos trabalhadores das fábricas envolvidas no esforço de guerra.\\nDesde a sua primeira condecoração concedida no dia 30 de setembro de 1939, até a sua última condecoração no dia 17 de junho de 1945, ela foi entregue a 7321 soldados. O número de condecorados é baseado na análise da comissão dos Recebedores da Cruz de Cavaleiro. Foi concedida para os três ramos da Wehrmacht: Heer, Luftwaffe e Kriegsmarine além da Waffen-SS, Reichsarbeitsdienst e Volkssturm."},{"page_url":"https://et.wikipedia.org/wiki/La_Dauphine","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Viaggioverrazzano.jpg","page_title":"La Dauphine","context_page_description":"La Dauphine oli kolmemastiline purjelaev, mida kasutas Prantsusmaa kuningriigi kuninga François I teenistuses olnud firenze maadeavastaja Giovanni da Verrazzano kui lipulaeva oma esireisil Uude Maailma, lootes leida meretee Euroopast otse Hiina. Karakktüüpi laev valmis 1518. aastal Le Havre kuninglikus laevadokis Normandia rannikul. Laeva nimetus viitas prantsuse kroonprintsi abikaasa tiitlile."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BE%D0%BD%D0%B0%D1%80%D0%B4%D0%BE_%D0%94%D0%B6%D0%B5%D0%BD%D0%BE%D0%BD%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Leonardo_Genoni.jpg","page_title":"Леонардо Дженоні","context_page_description":"Леонардо Дженоні — швейцарський хокеїст, воротар. Виступає за ХК «Давос» у Швейцарській національній лізі.\\nВихованець хокейної школи СЦ «Цюрхер». Виступав за «Кюснахт Лайонс», ХК «Давос».\\nУ складі національної збірної Швейцарії учасник чемпіонату світу 2011. У складі молодіжної збірної Швейцарії учасник чемпіонатів світу 2005 і 2006. У складі юніорської збірної Швейцарії учасник чемпіонату світу 2004 і 2005.\\nДосягнення\\nЧемпіон Швейцарії."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%83%E5%AD%90%E9%A5%BC%E8%8C%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Tong_of_pu%27er_tea_%282006_7742_recipe_by_Menghai_Tea_Factory%29.jpg","page_title":"七子饼茶","context_page_description":"七子饼茶，全称云南七子饼茶、又称七饼茶、七子茶，是指一类云南的普洱紧压茶。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B2%E0%AE%9F%E0%AE%BE%E0%AE%95%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/LK130030.jpg","page_title":"லடாக்","context_page_description":"லடாக் வடக்கில் குன்லுன் மலைத்தொடர்கள் மற்றும் தெற்கே மாபெரும் இமயமலை ஆகியவற்றிற்கிடையே இந்திய கட்டுப்பாட்டில் இருக்கும் சம்மு காசுமீர் மாநிலத்தி்ல் அமைந்திருந்தது. 2019 ஜம்மு காஷ்மீர் மறுசீரமைப்புச் சட்டத்தின்படி லடாக் ஒன்றியப் பகுதியின் முதல் துணைநிலை ஆளுநராக இராமகிருஷ்ணா மாத்தூர் என்பவர் 31 அக்டோபர் 2019 நள்ளிரவு அன்று பதவியேற்றார். இதனால் லடாக் ஒன்றியப் பகுதியானது. இது சட்டமன்றம் இல்லாத ஒன்றியப் பகுதியாகும். லடாக்கில் உள்ள லே மாவட்டம் மற்றும் கார்கில் மாவட்டங்களின் நிர்வாகத்தை மேற்கொள்வதற்கு லடாக் தன்னாட்சி மலை வளர்ச்சிக் குழு, லே மற்றும் லடாக் தன்னாட்சி மலை வளர்ச்சிக் குழு, கார்கில் உள்ள்து.\\nஜம்மு காஷ்மீர் ஒன்றியப் பகுதி மற்றும் லடாக் ஒன்றியப் பகுதிக்கான புதிய வரைபடங்கள் 2 நவம்பர் 2019 அன்று இந்திய அரசு வெளியிட்டது. புதிய வரைபடத்தில் பாக்கித்தான் ஆக்கிரமித்த வடக்கு நிலங்கள் லடாக் ஒன்றியப் பகுதியுடன் காட்டப்பட்டுள்ளது.\\nஇந்தப் பகுதி இந்தோ-ஆரியர் மற்றும் தொல்குடி திபெத்திய வம்ச மக்கள் ஆகியோரால் குடியேற்றம் செய்யப்பட்டிருக்கிறது என்பதுடன் இது இந்தப் பகுதியிலேயே மிகவும் அடர்த்தி குறைவான மக்கள்தொகை உள்ள பகுதியாகும்.\\nலடாக்கிய மொழி, சீன-திபெத்திய மொழிக்குடும்பத்தின் மேற்கு திபெத்திய பேச்சு வழக்கிற்கு சொந்தமானதாகும்."},{"page_url":"https://ru.wikipedia.org/wiki/2014_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%BC%D1%83%D0%B7%D1%8B%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Paco_de_Lucia_1.jpg","page_title":"2014 год в музыке","context_page_description":"1 января — группа «Король и Шут» прекратила существование.\\n26 января — 56-я церемония «Грэмми» — «Стэйплс-центр», Лос-Анджелес.\\n28 января — Mötley Crüe объявили о завершении музыкальной карьеры и о проведении прощального тура.\\n2 февраля — сопрано Рене Флеминг стала первой оперной певицей, исполнившей американский национальный гимн на открытии Суперкубка.\\n7 февраля — воссоединение группы «Тату» на церемонии открытия Зимней Олимпиады в Сочи.\\n9, 13, 15, 17 и 21 февраля — фестиваль «Red Rocks» — Олимпийский парк, Сочи.\\n19 февраля — 34-я церемония BRIT Awards — «O2 Арена», Лондон.\\n22 февраля — шотландский певец Линтон Осборн становится новым вокалистом группы Nazareth.\\n26 февраля — NME Awards — «O2 Арена», Лондон.\\n26 февраля—11 марта — фестиваль «Музыка Н. А. Римского-Корсакова» — Московский международный Дом музыки, Москва.\\n11 марта — Джеки Чан стал менеджером южнокорейской поп-группы «JJCC».\\n12 марта — Львовская национальная музыкальная академия лишила Юрия Башмета звания почётного профессора академии за то, что он поддержал позицию Президента России Владимира Путина во время политического кризиса на Украине и присоединения Крыма к России."},{"page_url":"https://pl.wikipedia.org/wiki/Chaudenay-la-Ville","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Chaudenay_032.JPG","page_title":"Chaudenay-la-Ville","context_page_description":"Chaudenay-la-Ville – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Côte-d’Or.\\nWedług danych na rok 1990 gminę zamieszkiwały 23 osoby, a gęstość zaludnienia wynosiła 4 osoby/km²."},{"page_url":"https://de.wikipedia.org/wiki/Transponder_Mandatory_Zone","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/RMZ_EDFE.png","page_title":"Transponder Mandatory Zone","context_page_description":"Eine Transponder Mandatory Zone ist ein Bereich des Luftraums, in dem für alle Luftfahrzeuge das Mitführen und Verwenden eines Transponders mit automatischer Höhenübermittlung vorgeschrieben ist. Bei Sichtflügen ist der Transponder auf Code 7000 zu setzen.\\nTMZ wurden in der Umgebung von Regionalflugplätzen festgelegt, um dort den an- und abfliegenden IFR und VFR-Verkehr zu schützen. Sie sind Teil des kontrollierten Luftraumes E, daher sind Freigaben der Flugverkehrskontrolle für VFR-Flüge am Tag nicht erforderlich.\\nAb April 2017 werden für die jeweilige TMZ Transpondercodes mit zugehörigen Funkfrequenzen auf der ICAO-Karte veröffentlicht. Für den Aufenthalt in der TMZ wird die Schaltung dieser Transpondercodes – verbunden mit Hörbereitschaft auf der zugehörigen Frequenz – dringend empfohlen."},{"page_url":"https://en.wikipedia.org/wiki/Doukhobors","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Doukhobor_women_pulling_a_plough_-_Thunder_Hill_Colony-Manitoba.jpg","page_title":"Doukhobors","context_page_description":"The Doukhobours or Dukhobors are a Spiritual Christian religious group of Russian origin. They are one of many non-Orthodox ethno-confessional faiths in Russia, often categorized as \\"folk-Protestants\\", Spiritual Christians, sectarians, or heretics. They are distinguished as pacifists who lived in their own villages, rejected personal materialism, worked together, and developed a tradition of oral history and memorizing and singing hymns and verses. Before 1886, they had a series of single leaders.\\nThe ancient origin of the Doukhobors is uncertain. The first written records of them are from 1701, although some scholars suspect earlier origins.\\nThey rejected the Russian Orthodox priesthood, the use of icons, and all associated church ritual. They came to believe that the Bible alone was not enough to reach divine revelation, and that doctrinal conflicts can interfere with their faith. Their goal was to internalize the living spirit of God so that God's spirit would be revealed within each individual. Bible teachings are evident in some published Doukhobor psalms, hymns, and beliefs."},{"page_url":"https://en.wikipedia.org/wiki/Electoral_vote_changes_between_United_States_presidential_elections","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/ElectoralCollege1924.svg","page_title":"Electoral vote changes between United States presidential elections","context_page_description":"The following is a summary of the electoral vote changes between United States presidential elections. It summarizes the changes in the Electoral College vote by comparing United States presidential election results for a given year with those from the immediate preceding election. It tracks those states which changed their support between parties as well as changes resulting from other factors, such as reapportionment."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%DB%8C%D9%84%D9%86_%D9%BE%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Dylan_Penn_Interview_Magazine.jpg","page_title":"دیلن پن","context_page_description":"دیلن پن مدل و هنرپیشه اهل ایالات متحده آمریکا است.\\nاو در فیلم الویس و نیکسون بازی کرده است."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%95%E0%B3%8A%E0%B2%AC%E0%B3%8D%E0%B2%AC%E0%B2%BF%E0%B2%A8_%E0%B2%86%E0%B2%AE%E0%B3%8D%E0%B2%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Palmitic-acid-3D-balls.png","page_title":"ಕೊಬ್ಬಿನ ಆಮ್ಲ","context_page_description":"'ಕೊಬ್ಬಿನ ಆಮ್ಲ ಅಥವಾ ಫ್ಯಾಟಿ ಆಸಿಡ್, ಅಥವಾ ಫ್ಯಾಟಿಆಮ್ಲಎನ್ನುವುದು ಸಸ್ಯಬೀಜದ ಎಣ್ಣೆಗಳಲ್ಲಿ ಮತ್ತು ಜಂತುಗಳ ಎಣ್ಣೆ/ಕೊಬ್ಬುಗಳಲ್ಲಿ ಇರುವ ಮೋನೋಕಾರ್ಬೊ‍ಲಿಕ್ ಅಮ್ಲ. ಗ್ಲಿಸೆರೋಲ್ / ಗ್ಲಿಜರಿನ್ ಮತ್ತು ಕೊಬ್ಬಿನ ಆಮ್ಲಗಳ ಸಂಯೋಗದಿಂದ ಎಣ್ಣೆಗಳು ಮತ್ತು ಕೊಬ್ಬುಗಳು ಉತ್ಪನ್ನವಾಗುತ್ತವೆ.ಕೊಬ್ಬಿನ ಆಮ್ಲವು, ಕಾರ್ಬೊನ್, ಹೈಡ್ರೊಜನ್, ಆಕ್ಸಿಜನ್ ಜೋಡಣೆ ಇರುವ, ಕೊಂಬೆಗಳಿಲ್ಲದ ಒಂದು ಸರಪಳಿ ತರಹ ಇರುವ ಕಾರ್ಬೋಲಿಕ್ ಆಮ್ಲ."},{"page_url":"https://fr.wikipedia.org/wiki/Ancien_tramway_de_Grenoble","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/GRENOBLE_-_La_Place_Grenette_et_le_Saint-Eynard.JPG","page_title":"Ancien tramway de Grenoble","context_page_description":"L'ancien tramway de Grenoble est un réseau de tramway urbain et suburbain métrique de la région grenobloise créé en 1894, exploité par la société grenobloise de tramways électriques, et qui a aujourd'hui totalement disparu. À cette époque de croissance industrielle et démographique, les anciens modes de transports hippomobiles, fiacres et omnibus, mis en place depuis la fin du XVIIIᵉ siècle, ne suffisent plus à assurer les dessertes urbaines. Les lignes urbaines et suburbaines vont se développer continûment jusque dans les années 1920.\\nOn compte alors trois exploitants majeurs : la Société grenobloise de tramways électriques qui exploite les lignes urbaines, les Voies ferrées du Dauphiné qui desservent, depuis Grenoble, la rive gauche de l'Isère jusqu'à Froges ainsi que la vallée de l'Oisans et enfin le tramway Grenoble - Chapareillan qui relie le centre de Grenoble à Chapareillan en desservant toute la rive droite dans la vallée du Grésivaudan.\\nPar la suite ce moyen de transport va lentement décliner avec la montée en puissance de nouveaux moyens de transport que sont l'autobus, le trolleybus et la voiture individuelle."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Mrovska12.jpg","page_title":"Мровска","context_page_description":"Мровска је насеље у Србији у општини Владимирци у Мачванском округу. Према попису из 2011. било је 418 становника. Налази се у близини манастира Каона и Текериша."},{"page_url":"https://pl.wikipedia.org/wiki/Christopher_Nolan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Memento_Timeline.png","page_title":"Christopher Nolan","context_page_description":"Christopher Edward Nolan – brytyjski reżyser, scenarzysta i producent filmowy. Jest jednym z najbardziej dochodowych reżyserów w historii, a także jednym z najbardziej cenionych filmowców XXI wieku.\\nPo swoim debiutanckim reżyserskim filmie Śledząc Nolan zyskał dużą uwagę na swoim drugim filmie, Memento, za który otrzymał nominację do Oscara za najlepszy scenariusz oryginalny. Aklamacja zdobyta przez niezależne filmy sprawiła, że Nolan miał okazję do zrobienia dużego thrillera Bezsenność i tajemniczego dramatu Prestiż. Zyskał popularność i dobre opinie krytyków dzięki trylogii o Batmanie; Incepcji, za którą otrzymał nominacje do Oscara za najlepszy film i najlepszy scenariusz oryginalny; Interstellar i Dunkierce. Jego dziesięć filmów zarobiło ponad 4,5 miliarda dolarów na całym świecie i zdobyło 26 nominacji do Oscara, przy czym wygrało siedem statuetek. Nolan jest współtwórcą kilku jego filmów z młodszym bratem, Jonathanem i prowadzi firmę produkcyjną Syncopy Inc. wraz ze swoją żoną Emmą Thomas."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D9%83%D9%84_%D9%87%D9%88%D9%81%D9%85%D8%A7%D9%86_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D9%88%D8%B1%D8%A9_%D9%82%D8%AF%D9%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Michl_Hofmann_1860_2009.JPG","page_title":"مايكل هوفمان (لاعب كورة قدم)","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمايكل هوفمان لاعب كورة قدم من المانيا."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%B1%D9%85%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Wappen_der_Ortsgemeinde_Bermel.png","page_title":"برمل","context_page_description":"برمل یک شهر در آلمان است که در ماین-کبلنتس واقع شده‌است. برمل ۳۷۹ نفر جمعیت دارد."},{"page_url":"https://de.wikipedia.org/wiki/Place_Charles-de-Gaulle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Etoile_en_1702.png","page_title":"Place Charles-de-Gaulle","context_page_description":"Die Place Charles-de-Gaulle ist einer der größten Plätze von Paris. Auf dem kreisrunden, etwa 240 m durchmessenden Platz stoßen das 8., das 16. und das 17. Pariser Arrondissement zusammen. Das Zentrum des Platzes bildet der Arc de Triomphe de l’Étoile."},{"page_url":"https://de.wikipedia.org/wiki/Christian_Kehrer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Christian_Kehrer_um_1800_Aquarell_Wp_10-32.jpg","page_title":"Christian Kehrer","context_page_description":"Christian Wilhelm Karl Kehrer war ein deutscher Jagd- und Tiermaler, Hofmaler und Archivar."},{"page_url":"https://es.wikipedia.org/wiki/Jap%C3%B3n_en_la_Copa_Mundial_de_Rugby","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Lineout_FRA_-_JPN_RWC_2011.jpg","page_title":"Japón en la Copa Mundial de Rugby","context_page_description":"La Selección de rugby de Japón participó en todas las ediciones de la Copa del Mundo de Rugby. Clasificó a través de eliminatorias a todos los torneos, con la excepción de la edición de 2019 que organizó.\\nLos Brave Blossoms consiguieron avanzar a Cuartos de final en Japón 2019 y esta es su mejor participación."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%83%88%E3%83%AB%E3%83%BB%E3%83%9F%E3%82%B9%E3%83%BB%E3%82%B5%E3%83%B3%E3%82%B7%E3%83%A3%E3%82%A4%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Abigail_Breslin.jpg","page_title":"リトル・ミス・サンシャイン","context_page_description":"『リトル・ミス・サンシャイン』は、2006年のアメリカ合衆国のコメディ・ドラマ、ロードムービーで、ジョナサン・デイトン及びヴァレリー・ファリス夫婦の監督デビュー映画である。脚本は本作が脚本家デビューとなるマイケル・アーントが執筆した。出演はグレッグ・キニア、スティーヴ・カレル、トニ・コレット、ポール・ダノ、アビゲイル・ブレスリン、アラン・アーキンであり、ビッグ・ビーチ・フィルムズが800万ドルの予算で製作した。撮影は2005年6月6日に始まり、アリゾナ州及び南カリフォルニアで約30日かけて行われた。\\n2006年1月20日にサンダンス映画祭にプレミア放映され、その後フォックス・サーチライト・ピクチャーズが同映画祭史上最高額の契約金を支払って配給権を獲得した。北アメリカでは2006年7月26日に限定公開が始まり、8月18日に拡大された。\\n『リトル・ミス・サンシャイン』は批評家に高く評価され、世界興行収入は1億ドルを超えた。第79回アカデミー賞では作品賞を含む4部門でノミネートされ、脚本賞と助演男優賞を獲得した。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AF%86%E0%AE%A9%E0%AF%8D%E0%AE%A9%E0%AF%88_%E0%AE%AA%E0%AF%81%E0%AE%B1%E0%AE%A8%E0%AE%95%E0%AE%B0%E0%AF%8D_%E0%AE%AA%E0%AF%87%E0%AE%B0%E0%AF%81%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AF%81_%E0%AE%A8%E0%AE%BF%E0%AE%B2%E0%AF%88%E0%AE%AF%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Chennai.cmbt1.jpg","page_title":"சென்னை புறநகர் பேருந்து நிலையம்","context_page_description":"சென்னை புறநகர் பேருந்து நிலையம் அல்லது பரவலாக கோயம்பேடு பேருந்து நிலையம் என்பது இந்தியாவின், சென்னை மாநகரின் கோயம்பேடு பகுதியில் அமைந்துள்ள ஒரு மிகப்பெரிய பேருந்து நிலையம் ஆகும். 37 ஏக்கர் பரப்பளவில் அமைந்துள்ள இப்பேருந்து நிலையம், ஆசியாவிலேயே இரண்டாவது மிகப்பெரியதாகும். ஐ. எஸ். ஓ 9001:2000 தரச் சான்றிதழும் இப்பேருந்து நிலையம் பெற்றுள்ளது.\\nகோயம்பேடு காய்கறிச் சந்தைக்கும் தெற்காசிய விளையாட்டுகளுக்காக கட்டப்பட்ட சிற்றூருக்கும் இடையே உள்வட்டச் சாலை யில் அமைந்துள்ள இப்பேருந்து நிலையம் 103 கோடி ரூபாய் செலவில் கட்டப்பட்டது. இதனை நவம்பர் 18, 2002இல் அன்றைய முதல்வர் ஜெ. ஜெயலலிதா திறந்து வைத்தார்.2002 ஆம் ஆண்டு நவம்பர் மாதம் 18 ஆம் நாளன்று, அப்போதைய தமிழக முதல்வராக இருந்த ஜெயலலிதாவால் நிறுவப்பட்டது. இப்பேருந்து நிலையம் ஒரே சமயத்தில் 270 பேருந்துகளையும், நாளொன்றுக்கு 2000 பேருந்துகளையும் 2 லட்சம் பயணிகளையும் கையாளும் திறன் கொண்டது.\\nஇந்தப் பேருந்து நிலையத்தின் பின்புறம் சென்னை மெட்ரோ தனது இருக்கைப் பெட்டிகள் பணிமனையை அமைக்கத் திட்டமிட்டுள்ளது."},{"page_url":"https://af.wikipedia.org/wiki/Fred_Niblo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Fredniblocrop.jpg","page_title":"Fred Niblo","context_page_description":"Fred Niblo was 'n Amerikaanse regisseur, akteur, en vervaardiger. Hy was bekend vir sy rolle in die rolprente The Mark of Zorro, The Red Lily, Ben-Hur: A Tale of the Christ, en The Artist."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%A1%E7%A9%82%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Miho-jinja_%28Shizuoka%29_honden.JPG","page_title":"御穂神社","context_page_description":"御穂神社は、静岡県静岡市清水区三保にある神社。式内社、駿河国三宮で、旧社格は県社。\\n三保の松原の「羽衣の松」に関係する神社として知られる。「みほ」の字は、「御穂」のほか「御廬」「三穂」「三保」にも作る。\\n神社境内と参道は、世界文化遺産「富士山-信仰の対象と芸術の源泉」の構成資産の1つ「三保の松原」の範囲に含まれる。"},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%BB%E0%B7%9A%E0%B6%9B%E0%B7%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Rekha_grace_Filmfare_Glamour_%26_Style_Awards_2016_%2822%29_%28cropped%29.jpg","page_title":"රේඛා","context_page_description":"රේඛා යන වෙදිකා නාමයෙන් බොහෝ දෙනා හඳුනන භානුරේඛා ගනේසන් ඇය, තමිල් නාඩුවෙන් ඉන්දීය බොලිවුඩ් සිනමාවට බිහි වූ නිළියක වේ.\\nරංගනයේ බහුශ්‍රැත වූ ඇය, ඛුබ්සූරත් චිත්‍රපටයේ පාසල් සිසුවියකගේ චරිතය සහ ඛූන් භාරි මාන්ග් චිත්‍රපටයේ තීරණාත්මක ප්‍රතිහිංසක චරිත වෙනුවෙන් දෙවතාවක් හොඳම නිළියට හිමි ෆිල්ම් ෆෙයා සම්මානයෙන් පිදුම් ලද්දීය. උම්‍රඔ ජාන් චිත්‍රපටයේ සාම්ප්‍රදායක වෙශ්‍යාවකගේ චරිත නිරූපණය වෙනුවෙන් හොඳම නිළියට හිමි ජාතික සම්මානයද හිමි කර ගත්තාය. 1970 දශකයේ සහ ඉන් පසුවද ඇය ඉන්දියාවේ සුප්‍රසිද්ධ සංකේතයක් ලෙස ඉන්දීය මාධ්‍යයන් විසින් සලකනු ලැබීය.\\n40 වසරක සිනමා දිවිය තුළ චිත්‍රපට 180කට වඩා ඇය රංගනයෙන් දායක වී ඇත. ඇයගේ සිනමා දිවිපෙවෙත තුළ ජනප්‍රියභාවය අවස්ථා කිහිපයකදීම ඔප්නැංවීමට සමත් වූ අතර ඇය හිමිකරගත් තත්ත්වය දිගින් දිගටම පවත්වා ගැනීමේ හැකියාවද ඇය සතු විය. ඉන්දියානුවන් සමාන්තර සිනමාව ලෙස හඳුන්වන, මුඛ්‍යධාරාව සහ කලාත්මක සිනමාව යන දෙවිදියෙහිම දස්කම් පෑ ඇය ආර්ථික වශයෙන් සාර්ථක වූ අතරම ඇයගේ සුවිශේෂී දක්ෂතා වෙනුවෙන් අවස්ථා කිහිපයකදීම දැඩි ප්‍රශංසාවට ලක් විය."},{"page_url":"https://pt.wikipedia.org/wiki/Peloridiidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Xenophyes_rhachilophus.jpg","page_title":"Peloridiidae","context_page_description":"Peloridiidae é uma família de Hemiptera que inclui 18 géneros e 34 espécies de insectos que se alimentam de briófitos, de hepáticas e de plantas. Considerados fósseis vivos, são pequenos animais, variando em comprimento de 2 a 4 mm, com distribuição natural alargada no Hemisfério Sul."},{"page_url":"https://en.wikipedia.org/wiki/%C5%A0koda_109E","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Lokomotiva_109_E2.jpg","page_title":"Škoda 109E","context_page_description":"The Škoda 109E locomotive was originally conceived in 2004 and designed for operation in Austria, Germany, Hungary, Poland and Slovakia as well as the Czech Republic. The 109E Škoda has a top speed of 200 km/h and is compatible with both AC and DC catenaries, meeting the basic characteristics of a modern multisystem locomotive."},{"page_url":"https://uk.wikipedia.org/wiki/Model-View-Presenter","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/MVP_1_2.jpg","page_title":"Model-View-Presenter","context_page_description":"Модель–Представлення–Пред'явник — шаблон проектування, похідний від MVC, що відділяє візуальне відображення та поведінку обробки подій у різні класи, а саме: Представлення та Пред'явник."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Andrassos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Capture_of_Berroia_by_the_Byzantines.png","page_title":"Battle of Andrassos","context_page_description":"The Battle of Andrassos or Adrassos was an engagement fought on 8 November 960 in an unidentified mountain pass on the Taurus Mountains, between the Byzantines, led by Leo Phokas the Younger, and the forces of the Hamdanid Emirate of Aleppo under the emir Sayf al-Dawla.\\nSayf al-Dawla had established an emirate based in Aleppo in 945, and quickly emerged as the main Muslim antagonist of the Byzantine Empire on its eastern frontier. Both sides launched raids and counter-raids with alternating success: the Hamdanids invading the Byzantine provinces of Asia Minor, and the Byzantines raiding Hamdanid possessions in Upper Mesopotamia and northern Syria.\\nIn mid-960, taking advantage of the absence of much of the Byzantine army on campaign against the Emirate of Crete, the Hamdanid prince launched another invasion of Asia Minor, and raided deeply and widely into the region of Cappadocia. On his return, however, his army was ambushed by Leo Phokas at the pass of Andrassos. Sayf al-Dawla himself barely escaped, but his army was annihilated."},{"page_url":"https://tr.wikipedia.org/wiki/Nodar_Kumarita%C5%9Fvili","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Stamps_of_Georgia%2C_2010-02.jpg","page_title":"Nodar Kumaritaşvili","context_page_description":"Nodar Kumaritaşvili Gürcü kızakçı.\\n2008–2009 Dünya Kızak Şampiyonası 'nı 55. olarak bitirdi. Vancouver'da düzenlenen 2010 Kış Olimpiyatları'nın ilk gününde yaptığı son antrenman sırasında tek kişilik sırtüstü sürat kızağıyla saatte 143,3 kilometre hızla kayarken, başını demir bir direğe çarptı. Sağlık ekiplerinin yaptığı kalp masajının ardından helikopterle hastaneye götürülmesine rağmen kurtarılamadı ve 21 yaşında hayatını kaybetti. Böylece Kış Olimpiyatları sırasında ölen 1964'te Kazimierz Kay-Skrzypeski, Ross Milne ve 1992'de Nicolas Bochatay'ın ardından dördüncü sporcu oldu.\\nKazadan hemen sonra Gürcistan olimpiyat takımının başkanı da oyunlardan çekilebileceklerini açıkladı."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8E%E3%83%BC%E3%83%99%E3%83%AB%E6%96%87%E5%AD%A6%E8%B3%9E","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Patrick_White_1973.jpg","page_title":"ノーベル文学賞","context_page_description":"ノーベル文学賞はノーベル賞6部門のうちの一つ。文学の分野において理念をもって創作し、最も傑出した作品を創作した人物に授与される。原則として定数1名のみ受賞されるが、これまでに1904年のフレデリック・ミストラル、ホセ・エチェガライ・イ・アイサギレや1917年のカール・ギェレルプ、ヘンリク・ポントピダン、1966年のシュムエル・アグノン、ネリー・ザックス、1974年のエイヴィンド・ユーンソン、ハリー・マーティンソンが2人同時受賞となっている。"},{"page_url":"https://nl.wikipedia.org/wiki/Voormalige_stadsdelen_van_Mainz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Mainz_AKK-Vororte_Luftbild_Mainz-Kastel_Kostheim_Rhein_Theodor-Heuss-Br%C3%BCcke_Foto_2008_Wolfgang_Pehlemann_Wiesbaden_IMG_0075.jpg","page_title":"Voormalige stadsdelen van Mainz","context_page_description":"De voormalige stadsdelen van Mainz waren stadsdelen op de rechterrijnoever die tussen 1908 en 1945 tot de stad Mainz behoorden. Het gaat om de stadsdelen Amöneburg, Kastel en Kostheim ten noorden van de monding van de Main en Bischofsheim, Gustavsburg en Ginsheim ten zuiden van de Mainmonding. In de zes stadsdelen woonde weliswaar het kleinere deel van de bevolking van Mainz, maar dit bedroeg wel 53% van de oppervlakte van de stad. Door de grens tussen de Amerikaanse en Franse bezettingszone na de Tweede Wereldoorlog werden deze bij de verdeling van de nieuwe deelstaten toebedeeld aan Groot-Hessen, het huidige Hessen, terwijl het linkergedeelte van de stad in de nieuwe deelstaat Rijnland-Palts kwam te liggen. De stadsdelen ten zuiden van de Mainmonding werden zelfstandige gemeentes in de Kreis Groß-Gerau en de stadsdelen ten noorden van de Mainmonding werden bij de stad Wiesbaden gevoegd."},{"page_url":"https://vi.wikipedia.org/wiki/Gi%E1%BA%A3i_v%C3%B4_%C4%91%E1%BB%8Bch_b%C3%B3ng_%C4%91%C3%A1_th%E1%BA%BF_gi%E1%BB%9Bi_1934","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Stadio_Olimpico_Torino_Italy.jpg","page_title":"Giải vô địch bóng đá thế giới 1934","context_page_description":"Giải bóng đá vô địch thế giới 1934 là giải bóng đá vô địch thế giới lần thứ hai và đã được tổ chức từ 27 tháng 5 đến 10 tháng 6 năm 1934 tại Ý. Đây là lần đầu tiên giải bóng đá vô địch thế giới được tổ chức tại châu Âu.\\nSau thành công của World Cup 1930, số đội tuyển đăng ký tăng vọt khiến giải lần đầu tiên có vòng loại. Đây là giải duy nhất mà đội chủ nhà cũng phải tham dự vòng loại và đội đương kim vô địch không tham dự. Đội tuyển Anh tiếp tục tẩy chay giải đấu. Thông tin nổi bật khác là đội tuyển Ai Cập là đội tuyển quốc gia đầu tiên thuộc châu Phi tham dự một kỳ World Cup.\\nKỳ World Cup này có sự tổ chức với quy mô vượt trội về điều kiện vật chất so với giải năm 1930 khi có 8 sân vận động được xây mới hay sửa chữa trên toàn nước Ý. Nhưng cũng như Thế vận hội 1936, giải được mang làm công cụ tuyên truyền cho chủ nghĩa Phát xít khiến có đôi chút làm giảm sự thành công của giải.\\nSau 15 ngày và 17 trận đấu, Ý lên ngôi vô địch."},{"page_url":"https://fr.wikipedia.org/wiki/Vignoble_de_Constantia","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Groot_Constantia_Cloete_Cellar.JPG","page_title":"Vignoble de Constantia","context_page_description":"Le vignoble de Constantia se situe en Afrique du Sud dans le quartier de Constantia, une banlieue résidentielle de la ville du Cap dans la province du Cap-Occidental."},{"page_url":"https://bs.wikipedia.org/wiki/%C4%8Cakovci","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/House_in_%C4%8Cakovci_1-Ku%C4%87a_u_%C4%8Cakovcima-%D0%9A%D1%83%D1%9B%D0%B0_%D1%83_%D0%A7%D0%B0%D0%BA%D0%BE%D0%B2%D1%86%D0%B8%D0%BC%D0%B0.JPG","page_title":"Čakovci","context_page_description":"Čakovci su naseljeno mjesto u sastavu općine Tompojevci, Vukovarsko-srijemska županija, Republika Hrvatska."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Kempener_Feld/Baackeshof","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Krefeld%2C_Kempener_Allee_9%2C_2018-07_CN-01.jpg","page_title":"Liste der Baudenkmäler in Kempener Feld/Baackeshof","context_page_description":"Die Liste der Baudenkmäler in Kempener Feld/Baackeshof enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Krefeld-Kempener Feld/Baackeshof, Stadtbezirk West, in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Krefeld eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://pl.wikipedia.org/wiki/Los_Angeles_Metro_Busway","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Van_Nuys_LACMTA_Orange_Line_station.jpg","page_title":"Los Angeles Metro Busway","context_page_description":"Los Angeles Metro Busway- sieć transportu publicznego typu bus rapid transit, której operatorem Los Angeles County Metropolitan Transportation Authority.\\nSystem złożony jest z dwóch linii, pierwszej noszącej nazwę linii pomarańczowej i drugiej o nazwie linii srebrnej, utworzonych w roku 2005, 2009 i wspierających już istniejące linie metra na obszarze hrabstwa Los Angeles."},{"page_url":"https://en.wikipedia.org/wiki/Nastapoka_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Nastapoka_River_Rapids.jpg","page_title":"Nastapoka River","context_page_description":"The Nastapoka River is a tributary of East coast of Hudson Bay, flowing in the administrative region of Nord-du-Québec, in Quebec, Canada. This river is one of the most important river of Nord-du-Québec, the 39th of Quebec because its watershed of 13,400 square kilometres."},{"page_url":"https://vi.wikipedia.org/wiki/Bucanetes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Trumpeter_Finches.jpg","page_title":"Bucanetes","context_page_description":"Bucanetes là một chi chim trong họ Fringillidae."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_najv%C3%A4%C4%8D%C5%A1%C3%ADch_miest_Eur%C3%B3pskej_%C3%BAnie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/BCN02.jpg","page_title":"Zoznam najväčších miest Európskej únie","context_page_description":"Toto je zoznam 84 najväčších miest Európskej únie v roku 2016, zoradený podľa počtu obyvateľov vnútri oficiálnych hraníc mesta.\\nHlavné mestá sú zobrazené tučným písmom."},{"page_url":"https://sv.wikipedia.org/wiki/Bodsj%C3%B6n_(%C3%85re_socken,_J%C3%A4mtland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Bodsj%C3%B6edet_-_KMB_-_16000300024128.jpg","page_title":"Bodsjön (Åre socken, Jämtland)","context_page_description":"Bodsjön är en sjö i Åre kommun i Jämtland och ingår i Indalsälvens huvudavrinningsområde. Sjön har en area på 5,3 kvadratkilometer och ligger 438,2 meter över havet. Bodsjön ligger i Åreälven Natura 2000-område. Sjön avvattnas av vattendraget Indalsälven."},{"page_url":"https://en.wikipedia.org/wiki/%C3%89gliseneuve-des-Liards","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Notre-Dame_d%27Eglisneuve_des_Liards.JPG","page_title":"Égliseneuve-des-Liards","context_page_description":"Égliseneuve-des-Liards is a commune in the Puy-de-Dôme department in Auvergne in central France."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D8%A7%D9%87%E2%80%8C%D9%BE%D8%B3%D9%86%D8%AF_%D8%AF%D8%B1%D8%AE%D8%AA%DA%86%D9%87%E2%80%8C%D8%A7%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Lantana_camara_0003.jpg","page_title":"شاه‌پسند درختچه‌ای","context_page_description":"شاه‌پسند درختچه‌ای گونه‌ای گیاه چندساله و درختچه‌ای است. از بین ۱۵۰ گونه موجود در میان شاه‌پسندیان، شاه‌پسند درختچه‌ای جزو معدود گونه‌های دارای ارزش زینتی است. این گونه به دلیل ماهیت سخت و مقاوم خود، به عنوان گیاهی زینتی در جامعه باغبانی از محبوبیت ویژه‌ای برخوردار شده است. شیره‌ای که از برگ‌های شاه پسند درختچه‌ای خارج می‌شود دارای خصوصیات درمانی است. شاه پسند یکی از گونه‌های جاذب پروانه هاست و در ایالات متحده از آن در باغ ویژه پروانه‌ها استفاده می‌شود."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D0%BE%D0%B7%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/2006-12-18Helleborus_niger09.jpg","page_title":"Морозник","context_page_description":"Моро́зник, или Зимо́вник — род многолетних травянистых растений семейства Лютиковые."},{"page_url":"https://nl.wikipedia.org/wiki/Pyh%C3%A4j%C3%A4rvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Vaskikello_Pyh%C3%A4j%C3%A4rvi.jpg","page_title":"Pyhäjärvi","context_page_description":"Pyhäjärvi is een gemeente en stad in de Finse provincie Oulu en in de Finse regio Noord-Österbotten. De gemeente heeft een totale oppervlakte van 1312 km² en telde 6445 inwoners in 2003."},{"page_url":"https://es.wikipedia.org/wiki/Cinco_W","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/5W_%2B_how.jpg","page_title":"Cinco W","context_page_description":"Las Cinco W son una técnica con la que se consigue transmitir un mensaje eficazmente. Es la manera más sencilla y completa de presentar información.​ Los orígenes de las 5W se remontan a hace por lo menos 28 siglos.​\\nQué: son los acontecimientos, acciones o ideas que constituyen una noticia. Por ejemplo: un accidente de moto.\\nQuién/Quiénes: son los protagonistas, los personajes que aparecen en la noticia. Por ejemplo: dos jóvenes de 16 y 17 años.\\nCuándo: sitúa la acción en un tiempo concreto. Se debe indicar su inicio, duración y fin. Por ejemplo: el sábado a las 3 de la madrugada.\\nDónde: el espacio o lugar dónde han ocurrido los hechos. Por ejemplo: en el kilómetro 18 de la A-6 a la altura de Las Rozas.\\nPor qué: son las razones por las que ha ocurrido un acontecimiento. En ocasiones es necesario incluir los antecedentes. Por ejemplo: Según las fuentes locales, el conductor había ingerido alcohol.\\nCómo: circunstancias en las que se desarrollan los hechos. Por ejemplo: la moto se salió de la calzada en una curva.\\nEstas preguntas son la esencia de una noticia.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%86%D8%A7%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Celebrating_gold.jpg","page_title":"عناق","context_page_description":"العناق أو الحضن ‏ هو صورة من صور الحميمية الجسدية، معروف لدي الجنس البشري كله، حيث يقوم فيه شخص أو أكثر بلف ذراعيه حول رقبة أو وسط شخص آخر، ويتمسك كل منهما بالآخر مع وجود قدر من التقارب الجسدي."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A4%D1%8D%D0%BB%D1%96%D0%BA%D1%81_%D0%B4%D1%8D_%D0%91%D0%BB%D1%91%D1%85%D0%B0%D1%9E%D0%B7%D1%8D%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Felix_de_Blochausen.jpg","page_title":"Фэлікс дэ Блёхаўзэн","context_page_description":"Фэлікс дэ Блёхаўзэн — люксэмбурскі палітычны й дзяржаўны дзяяч. Шосты прэм’ер-міністар Люксэмбургу."},{"page_url":"https://sv.wikipedia.org/wiki/Catocala_junctura","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Catocala_stretchii.JPG","page_title":"Catocala junctura","context_page_description":"Catocala junctura är en fjärilsart som beskrevs av Walker 1857. Catocala junctura ingår i släktet Catocala och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BE%B7%E5%9C%8B%E5%8D%81%E5%AD%97%E6%88%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Mensch.jpg","page_title":"德國十字戲","context_page_description":"德國十字戲，為德國人Josef Friedrich Schmidt約1907年或1908年推出的十字戲類遊戲。\\n1907年冬天，Josef Friedrich Schmidt用這套自己改造的遊戲成功的平息了自己三個小孩的抱怨。後來就連鄰居家小孩也對這遊戲著迷，這讓他倍受鼓舞，並在1914年推出商業產品。但第一次世界大戰爆發讓他的生意一蹶不振。部分出於同情，部分出於銷售戰略，他產生了一個絕妙的想法。他生產了3000套德國十字戲，無償贈送給野戰醫院裡的傷兵。戰爭結束後，該遊戲迅速熱銷：因為那些從戰場返回的士兵，由於脫離社會、自我封閉，或是處於康復階段，都需要一種打發時間的辦法，到了1920年，此遊戲的銷量已經突破100萬套。\\n德國十字戲以7000萬套的銷量成為德語國家人民最喜愛的遊戲之一。"},{"page_url":"https://simple.wikipedia.org/wiki/Benrath","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/St._C%C3%A4cilia_Benrath.JPG","page_title":"Benrath","context_page_description":"Benrath is a part of Düsseldorf. It belongs to Düsseldorf since 1929."},{"page_url":"https://it.wikipedia.org/wiki/Dagnente","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Dagnente_Chiesa_di_San_Giovanni_Battista_1.jpg","page_title":"Dagnente","context_page_description":"Dagnente è una frazione del comune italiano di Arona. Fu comune autonomo fino al 1928.\\nLa località è divenuta famosa soprattutto per il suo piccolo cimitero, luogo di sepoltura di due illustri personaggi:\\nil popolare presentatore televisivo Mike Bongiorno, la moglie del quale è originaria della frazione. La salma di Mike Bongiorno fu però trafugata e dopo il ritrovamento non fu riportata a Dagnente;\\nil \\"Bardo della Democrazia\\", lo scrittore ed uomo politico Felice Cavallotti, padre del radicalismo italiano e fondatore dell'originario Partito Radicale Italiano.\\nIn memoria di Felice Cavallotti nel cimitero di Dagnente fu eretto un monumento ad opera di Troubetskoj e di Conconi. Nel luglio del 2008 il comune di Arona ha patrocinato un'iniziativa realizzata in collaborazione con l'associazione Pro Dagnente \\"Felice Cavallotti\\" e l'azienda Red Tronics di Castelletto Ticino, per la rivalorizzazione del monumento. Il monumento è stato illuminato con un impianto a led di ultima generazione, donando così al monumento ed alla memoria del \\"Bardo\\" nuova vita."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%81%D0%B0%D1%84_%D0%94%D0%B6%D0%B0%D1%85_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Mir_Nizam_Ali_Khan.jpg","page_title":"Асаф Джах II","context_page_description":"Мір Нізам Алі-хан Сіддікі Бейефенді Багадур Асаф Джах II — нізам Хайдарабаду від 1762 до 1803 року."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1863","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/John_charles_fields.jpg","page_title":"Lijst van personen geboren in 1863","context_page_description":"Dit is een lijst van personen die geboren zijn in 1863.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%96%D0%B8%D1%82%D0%BD%D1%96%D0%B9_%D1%85%D0%BB%D1%96%D0%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Dark_rye_bread.JPG","page_title":"Житній хліб","context_page_description":"Житній хліб — різновид хлібу, випікають з житнього обойного, обдирного і просіяного борошна. Простий житній хліб з обойного борошна випікається формовим і череневим. Він має вологість 46..53%, кислотність 13°, пористість не менше 44%. Це найнижча пористість серед хлібних виробів.\\nПротягом століть житній хліб був їжею для простого люду. Жито, бувши морозостійкою та невибагливою до умов вирощування культурою, давало більші врожаї, аніж пшениця. Тому хліб з пшеничного борошна завжди був дорожчим за житній, та дозволити його собі могли тільки заможні люди.\\nВ залежності від пропорцій пшеничного та житнього борошна розрізняють:\\nжитньо-пшеничним — житнього борошна у складі хліба понад 50%;\\nпшенично-житнім — навпаки, житнього менш як 50%."},{"page_url":"https://nl.wikipedia.org/wiki/Serpentine_(feestartikel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Luftschlangen.JPG","page_title":"Serpentine (feestartikel)","context_page_description":"Een serpentine is een kleurrijk feestartikel dat bestaat uit een smalle ring van dun opgerold papier. De ring kan door deze te werpen, terwijl men het binnenste uiteinde vasthoudt, worden afgerold om een luchtige en vrolijke stemming te creëren.\\nHet gebruik van serpentines heeft vooral een decoratief doel tijdens feestelijkheden. Het feestartikel wordt vooral gebruikt tijdens carnaval en nieuwjaar maar is ook een populaire versiering voor allerlei andere feesten en partijen.\\nSerpentines zijn te koop in winkels voor feestbenodigdheden en worden veelal geleverd in pakketjes met meerdere rolletjes in verschillende kleuren.\\nBij een ticker-tape parade worden gebruikte ponsbanden als serpentine gebruikt. Dit materiaal is meestal niet gekleurd."},{"page_url":"https://pt.wikipedia.org/wiki/Igreja_de_Nossa_Senhora_Vitoriosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Kostel_Panny_Marie_V%C3%ADt%C4%9Btn%C3%A9_z_Vrtbovsk%C3%A9_zahrady.JPG","page_title":"Igreja de Nossa Senhora Vitoriosa","context_page_description":"A Igreja de Nossa Senhora Vitoriosa, ou Santuário do Menino Jesus de Praga, é uma igreja católica situada em Malá Strana, na cidade de Praga, na República Checa. É um templo de carmelitas onde se encontra a famosa imagem religiosa conhecida como Menino Jesus de Praga.\\nUma capela dedicada à Santíssima Trindade foi construída no local em 1584. Com a Batalha da Montanha Branca a 8 de novembro de 1620, a Contrarreforma obteve a recatolização de Praga e igreja foi entregue à Ordem dos Carmelitas Descalços em setembro de 1624. A peça central do altar, a triunfal Nossa Senhora da Vitória foi presenteada por Roma, pelo Papa Papa Gregório XV. Em 3 de junho de 1784, as Carmelitas receberam ordem de entregar a posse da igreja para José II do Sacro Império Romano-Germânico.\\nEm 26 de setembro de 2009, o Papa Bento XVI declarou a igreja e o Menino Jesus de Praga como a primeira estação da Via Apostólica na República Checa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Distanzsteine_im_Landkreis_B%C3%B6rde","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Sandbeiendorf_Preussischer_Rundsockelstein-01.jpg","page_title":"Liste der Distanzsteine im Landkreis Börde","context_page_description":"Die Liste der Distanzsteine im Landkreis Börde umfasst alle Distanzsteine im Landkreis Börde."},{"page_url":"https://ar.wikipedia.org/wiki/Calumenin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/PBB_GE_CALU_200756_x_at_fs.png","page_title":"Calumenin","context_page_description":"Calumenin‏ هوَ بروتين يُشَفر بواسطة جين Calumenin في الإنسان."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%98%AD%E5%B8%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Plaza_Grau_de_Lampa.jpg","page_title":"蘭帕","context_page_description":"蘭帕，是秘魯的城鎮，位於該國東南部普諾大區，是蘭帕省的首府，海拔高度3,892米，始建於1825年6月21日，居民使用奇楚瓦語和西班牙語。"},{"page_url":"https://fi.wikipedia.org/wiki/Jieyang","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Jieyang_Xuegong_2013.10.27_15-12-27.jpg","page_title":"Jieyang","context_page_description":"Jieyang on prefektuuritason kaupunki Kiinan Guangdongin maakunnan itäosassa. Kaupungin keskusta sijaitsee linnuntietä 320 kilometriä maakunnan pääkaupunki Kantonista itään. Kaupungin väkiluku on 5,884 miljoonaa ja pinta-ala 5 240 neliökilometriä.\\nKaupunki rajoittuu pohjoisessa Meizhoun, idässä Chaozhoun ja Shantoun, sekä lännessä Shanwein prefektuuritason kaupunkeihin. Etelässä naapurina on Etelä-Kiinan meri.\\nPiirikuntatasolla prefektuuri jaetaan viiteen osaan:\\n1. Rongcheng, kaupunkipiiri,\\n2. Puning, piirikuntatason kaupunki,\\n3. Jiedong, kaupunkipiiri,\\n4. Jiexi, piirikunta ja\\n5. Huilai, piirikunta.\\nVuoden 2011 lopulla avattu Jieyang Chaoshanin kansainvälinen lentoasema on maakunnan kolmanneksi suurin lentoasema. Tämä Jiedongin piirikunnassa sijaitseva lentoasema palvelee muun muassa Jieyangin ohella esimerkiksi Shantoun ja Chaozhoun kaupunkeja."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B9%D0%BB%D0%B0%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Neyland_High_Street_Town_Hall.jpg","page_title":"Нийланд","context_page_description":"Нѝйланд е град в Югозападен Уелс, графство Пембрукшър. Разположен е около десния бряг на устието на река Кледай в Ирландско море на около 150 km на северозапад от столицата Кардиф. На около 10 km на север от Нийланд се намира главният административен център на графството Хавърфордуест. На около 8 km на запад по крайбрежието на устието на река Кледай е най-големият град в графството Милфорд Хейвън. Има малко пристанище. Имал е жп гара от 15 април 1856 г. до 1964 г. Населението му е 3276 жители според данни от преброяването през 2001 г."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D0%B0%D1%83%D1%80%D0%B5%D0%B0%D1%82%D1%96%D0%B2_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BF%D1%80%D0%B5%D0%BC%D1%96%D1%97_%D0%B7_%D1%84%D1%96%D0%B7%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Jack-Steinberger-2008.JPG","page_title":"Список лауреатів Нобелівської премії з фізики","context_page_description":"Нобелівська премія з фізики — вища нагорода за наукові досягнення в області фізики, щорічно присуджується Шведською королівською академією наук у Стокгольмі."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%92%8C%E5%AF%92%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/JR_Soya-Main-Line_Wassamu_Station-name_signboard.jpg","page_title":"和寒駅","context_page_description":"和寒駅は、北海道上川郡和寒町字北町にある北海道旅客鉄道宗谷本線の駅である。駅番号はW38。電報略号はワサ。事務管コードは▲121810。\\n和寒町の代表駅で、特急「宗谷」・「サロベツ」など全列車が停車する。"},{"page_url":"https://nl.wikipedia.org/wiki/Nederlands_Hervormde_Kerk_(Venhuizen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Venhuizen1.jpg","page_title":"Nederlands Hervormde Kerk (Venhuizen)","context_page_description":"De Nederlands Hervormde Kerk van Venhuizen is een eenbeukige kruiskerk met een vijfzijdig gesloten koor en een ingebouwde toren met drie geledingen."},{"page_url":"https://vi.wikipedia.org/wiki/Euryptila_subcinnamomea","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Euryptila_subcinnamomea_-near_Kamassies%2C_Kamiesberg%2C_Northern_Cape%2C_South_Africa-8.jpg","page_title":"Euryptila subcinnamomea","context_page_description":"Euryptila subcinnamomea là một loài chim trong họ Cisticolidae."},{"page_url":"https://en.wikipedia.org/wiki/Caf%C3%A9_Tortoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Cafe_Tortoni_Peluqueria.jpg","page_title":"Café Tortoni","context_page_description":"The Café Tortoni is a coffeehouse located at 825 Avenida de Mayo in Buenos Aires, Argentina. Inaugurated in 1858 by a French immigrant whose surname was Touan, it was named Tortoni after the Parisian café of the same name located on Boulevard des Italiens. The café itself was Inspired by Fin de siècle coffee houses. Café Tortoni was selected by UCityGuides as one of the ten most beautiful cafes in the world."},{"page_url":"https://nl.wikipedia.org/wiki/Joost_van_Vollenhoven_(gouverneur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Buste-Joost-van-Vollenhoven.JPG","page_title":"Joost van Vollenhoven (gouverneur)","context_page_description":"Joost van Vollenhoven was een Frans koloniaal van Nederlandse afkomst."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%BF%E0%AE%AF%E0%AF%82_%E0%AE%A4%E0%AE%BE%E0%AE%B5%E0%AE%B0%E0%AE%B5%E0%AE%BF%E0%AE%AF%E0%AE%B1%E0%AF%8D_%E0%AE%AA%E0%AF%82%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Kew_Gardens_Palm_House%2C_London_-_July_2009.jpg","page_title":"கியூ தாவரவியற் பூங்கா","context_page_description":"கியூ தாவரவியற் பூங்கா உலகின் மிகப் பெரிய தாவரவியற் உள்ளடக்கங்களைக் கொண்ட பூங்காவாகும். இது இங்கிலாந்தின் சுரே பிரதேசத்தில் அமைந்துள்ள கியூ கார்டன் என்றழைக்கப்படும் அரச தாவரவியற் பூங்காவாகும். சுமார் 300 ஏக்கர் பரப்பளவுள்ள இப்பூங்கா, தேம்ஸ் நதியோரத்தில் ரிச்மண்ட், கியூ ஆகிய ஊர்களுக்கிடையே அமைந்திருக்கின்றது."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%B8%E5%B9%B3%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Eiheiji_IMG_20161017_121301.jpg","page_title":"永平寺","context_page_description":"永平寺は、福井県吉田郡永平寺町にある曹洞宗の仏教寺院。總持寺と並ぶ日本曹洞宗の中心寺院である。山号を吉祥山と称し、開山は道元、本尊は釈迦如来・弥勒仏・阿弥陀如来の三世仏である。寺紋は久我山竜胆紋。"},{"page_url":"https://es.wikipedia.org/wiki/Hermandad_Penitencial_del_Sant%C3%ADsimo_Cristo_del_Esp%C3%ADritu_Santo_(Zamora)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Procesion_Espiritu_Santo_2014_024.jpg","page_title":"Hermandad Penitencial del Santísimo Cristo del Espíritu Santo (Zamora)","context_page_description":"La Hermandad Penitencial del Santísimo Cristo del Espíritu Santo es una cofradía religiosa católica de la ciudad de Zamora, España. Tiene su sede en la Iglesia del Espíritu Santo, parroquia del barrio del mismo nombre. Forma parte de la Semana Santa de Zamora con su procesión del Viernes de Dolores."},{"page_url":"https://de.wikipedia.org/wiki/Weltmeister_im_Fischer-Random-Schach","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Wesley_So%2C_2015.jpg","page_title":"Weltmeister im Fischer-Random-Schach","context_page_description":"Den Titel Weltmeister im Fischer-Random-Schach verleiht die FIDE erst seit 2019. Die erste Weltmeisterschaft im Fischer-Random-Schach wurde unter verschiedenen Turniermodi und verschiedene Zeitbegrenzungen ausgetragen, beginnend mit Qualifikationsrunden im Schweizer System und einer Bedenkzeit \\"langsamen Blitzschachs\\" bis hin zum K.o.-System, wo auch stärker gewichtete Partien in der Bedenkzeit \\"langsamem Schnellschachs\\" gespielt wurden. Wesley So gewann und ist nun der erste offizielle Weltmeister in dieser Disziplin, die auch Chess960 genannt wird, da es bei dieser Schachvariante insgesamt 960 mögliche Aufstellungen der Schachfiguren auf der Grundreihe jeder Partei gibt.\\nBereits seit 2001/03 trug die Chess Classic in Mainz inoffizielle Chess960-Weltmeisterschaften unter einer Schnellschach-Zeitkontrolle aus. Den Titel holten sich Pjotr Swidler, Lewon Aronjan und Hikaru Nakamura. Danach endete diese Serie."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B3%B6%E5%B6%BC%E5%B7%A8%E5%9E%8B%E5%8C%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Porphyrio_hochstetteri_-Tiritiri_Matangi_Island-8b-3c.jpg","page_title":"島嶼巨型化","context_page_description":"島嶼巨型化是指孤島上動物變得巨大化的生態現象。當人類或是其他掠食者來到這些島嶼時，這些巨型動物與島嶼上的特有種往往會因此絕種。"},{"page_url":"https://ca.wikipedia.org/wiki/Oscar_al_millor_gui%C3%B3_adaptat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Peter_O%27Toole_-_Lion.jpg","page_title":"Oscar al millor guió adaptat","context_page_description":"L'Oscar al millor guió adaptat és un premi atorgat per l'Acadèmia de les Arts i les Ciències Cinematogràfiques, cada any, que es dóna a un guió cinematogràfic provinent d'una altra font."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A7%D9%88%DB%8C_%D8%AA%D8%A7%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Ph_locator_map_tawi-tawi.png","page_title":"تاوی تاوی","context_page_description":"تاوی تاوی یکی از استان‌های کشور فیلیپین است. این استان در جنوب جزیرهٔ میندانائو قرار گرفته است. مرکز این استان شهر پانگلیما سوگالا است. جمعیت آن حدود سیصد و بیست هزار نفر است. مساحت این استان هزار و هشتاد کیلومتر مربع است."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%92%D7%95%D7%A1%D7%98%D7%94_%D7%95%D7%99%D7%9C%D7%94%D7%9C%D7%9E%D7%99%D7%A0%D7%94,_%D7%A0%D7%A1%D7%99%D7%9B%D7%AA_%D7%94%D7%A1%D7%9F-%D7%93%D7%A8%D7%9E%D7%A9%D7%98%D7%90%D7%93%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Auguste_Wilhelmine_Maria_Hessen-Darmstadt.jpg","page_title":"אוגוסטה וילהלמינה, נסיכת הסן-דרמשטאדט","context_page_description":"אוגוסטה וילהלמינה, נסיכת הסן-דרמשטאדט, הייתה נסיכה גרמנית, ואשתו הראשונה של מקסימיליאן הראשון יוזף, מלך בוואריה."},{"page_url":"https://it.wikipedia.org/wiki/Tranvia_Toden_Arakawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Toden-Arakawa-Line_Asukayama.jpg","page_title":"Tranvia Toden Arakawa","context_page_description":"La tranvia Toden Arakawa, brandizzata anche come Tokyo Sakura Tram è una tranvia circolante a Tokyo e gestita dalla Toei. La linea è l'unica superstite della vasta rete di tram di Tokyo ma non è l'unica presente nella città. Di fatto, la linea Setagaya, gestita dalla Tokyu, è definita anche essa come una tranvia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B1%B3%E5%B0%94%E7%A6%8F%E5%BE%B7_(%E7%89%B9%E6%8B%89%E5%8D%8E%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/DEMap-doton-Milford.png","page_title":"米尔福德 (特拉华州)","context_page_description":"米爾福德是美國德拉瓦州肯特縣和蘇塞克斯縣的一個城市，為米斯皮林河分為南北兩部份。面積14.5平方公里。根據美國2000年人口普查，人口6,732人。\\n1807年2月5日設市。"},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E5%B3%BD%E7%82%AD%E7%A4%A6A0%E5%9E%8B%E8%92%B8%E6%B1%BD%E6%A9%9F%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%E4%B8%89%E5%B3%BD%E7%82%AD%E7%A4%A6A1%E8%99%9F%E8%92%B8%E6%B1%BD%E6%A9%9F%E8%BB%8A%E8%83%8C%E9%9D%A2.jpg","page_title":"三峽炭礦A0型蒸汽機車","context_page_description":"三峽炭礦A0型蒸汽機車是服役於台北縣三峽鎮三峽炭礦的蒸汽機車。昭和十七年3月由台灣鐵工所製造，製造番號為11號。車軸配置為「0-6-0」，重5噸，軌距610mm，屬水櫃式蒸汽機車。\\n三峽炭礦位於新北市三峽區金圳里，經營人為林開郡、林先達父子，於大正六年開工，是日據時期台灣八大礦場之一。當時該蒸汽機車被編為「A1」號。1986年炭礦停止開採，機車被棄置於荒煙蔓草中。直到1995年10月台北縣三峽鎮拓寬文化路，意外於草叢中挖出兩輛同型機車。其中A1號由原業主林繼成轉交於徐安讚保存，經過工程師林永仁整修後，陳列於新北市中和區德光路綠大郡社區內。同時出土的A2號機車被送至台南市新營區新聯興鐵木工廠進行整修。"},{"page_url":"https://da.wikipedia.org/wiki/Slesvigske_hertuger","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Christoph_Wilhelm_Wohlien_-_Portr%C3%A6t_af_Frederik_VI.jpg","page_title":"Slesvigske hertuger","context_page_description":"Listen viser de slesvigske eller sønderjyske jarler og hertuger frem til 1864. Hertugdømmet Sønderjylland var før et jarledømme, som med Knud Lavard skiftede navn til hertugdømmet. Efter 1386 blev begrebet Hertugdømmet Slesvig i stedet for Hertugdømmet Sønderjylland mere og mere almindelig."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D9%86%DB%8C%D8%AA%DB%8C%D8%8C_%D8%B3%D8%A7%D8%B3%DA%A9%D8%A7%DA%86%D9%88%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Unity_Express_ShedSRM.jpg","page_title":"یونیتی، ساسکاچوان","context_page_description":"یونیتی، ساسکاچوان یک منطقهٔ مسکونی در کانادا است که در ساسکاچوان واقع شده‌است. یونیتی ۲٬۵۷۳ نفر جمعیت دارد."},{"page_url":"https://fr.wikipedia.org/wiki/Lloret_de_Mar","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Lloret%2C_Puig_de_Castellet%2C_Grundmauern.JPG","page_title":"Lloret de Mar","context_page_description":"Lloret de Mar est une commune de la comarque de La Selva dans la province de Gérone en Catalogne. Elle est dotée d’excellentes plages de sable et possède une vue magnifique sur le château et le monument de « La Dona Marina »."},{"page_url":"https://en.wikipedia.org/wiki/Water_of_crystallization","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Copper_sulfate_anhydrous.jpg","page_title":"Water of crystallization","context_page_description":"In chemistry, water of crystallization or water of hydration are water molecules that are present inside crystals. Water is often incorporated in the formation of crystals from aqueous solutions. In some contexts, water of crystallization is the total mass of water in a substance at a given temperature and is mostly present in a definite ratio. Classically, \\"water of crystallization\\" refers to water that is found in the crystalline framework of a metal complex or a salt, which is not directly bonded to the metal cation.\\nUpon crystallization from water or moist solvents, many compounds incorporate water molecules in their crystalline frameworks. Water of crystallization can generally be removed by heating a sample but the crystalline properties are often lost. For example, in the case of sodium chloride, the dihydrate is unstable at room temperature.\\nCompared to inorganic salts, proteins crystallize with large amounts of water in the crystal lattice. A water content of 50% is not uncommon for proteins."},{"page_url":"https://pl.wikipedia.org/wiki/I_liga_polska_w_pi%C5%82ce_no%C5%BCnej_pla%C5%BCowej_(2016)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/I_liga_pla%C5%BCowa_grupa_p%C3%B3%C5%82nocna_2016.png","page_title":"I liga polska w piłce nożnej plażowej (2016)","context_page_description":"I liga piłki nożnej plażowej 2016 – 5. edycja rozgrywek drugiego poziomu ligowego piłki nożnej mężczyzn w Polsce, przy czym jest to 4. edycja z podziałem na dwie grupy."},{"page_url":"https://ca.wikipedia.org/wiki/Sal%C3%B3_Internacional_del_C%C3%B2mic_de_Barcelona_de_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Josep_Mar%C3%ADa_Blanco._Barcelona_Comic_Con_2017.jpg","page_title":"Saló Internacional del Còmic de Barcelona de 2017","context_page_description":"El 35è Saló Internacional del Còmic de Barcelona es va celebrar entre el dijous 30 de març i el diumenge 2 d'abril de 2017 a la Fira de Barcelona de Montjuïc.\\nLa gran mostra de la 35a edició fou dedicada a l'aviació i comptà amb diversos avions reals, pertanyents a diferents èpoques, que han aparegut dibuixats en còmics. Els avions anaven acompanyats d'uns plafons amb il·lustracions de còmic on hi apareixien els clàssics del gènere més destacats, com per exemple el còmic d'aventures Steve Canyon de Milton Caniff, el còmic d'aviació militar Buck Danny de Jean-Michel Charlier i Victor Hubinon, el còmic dels aventurers Tanguy et Laverdure de Charlier i Uderzo, el clàssic Hazañas Bélicas de Boixcar, la sèrie argentina As de Pique de Ricardo Barreiro i Juan Giménez o les batalles aèries del còmic Le Pilote à l'Edelweiss de Yann i Romain Hugault.\\nL'altra gran exposició central va estar dedicada a la revista TBO, que el 2017 celebrà el seu centenari. La mostra va incloure cent originals amb les sèries més populars, com Los grandes inventos del TBO, La familia Ulises, Eustaquio Morcillón y Babali, Josechu el vasco o Altamiro de la cueva."},{"page_url":"https://sv.wikipedia.org/wiki/Jametz","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Map_commune_FR_insee_code_55255.png","page_title":"Jametz","context_page_description":"Jametz är en kommun i departementet Meuse i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Montmédy som tillhör arrondissementet Verdun. År 2009 hade Jametz 259 invånare."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B9%D1%81%D0%BB%D0%B5%D1%80,_%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_%D0%90%D1%85%D0%B8%D0%BB%D0%BB%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Johann_Philipp_Achilles_Leisler_%281771-1813%29.jpg","page_title":"Лейслер, Иоганн Филипп Ахиллес","context_page_description":"И́оганн-Фи́липп-Ахиллес Лейслер — немецкий врач и зоолог."},{"page_url":"https://es.wikipedia.org/wiki/Pijnacker-Nootdorp","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Nootdorp_-_Dorpsstraat_36.jpg","page_title":"Pijnacker-Nootdorp","context_page_description":"Pijnacker-Nootdorp es un municipio de la provincia de Holanda Meridional en los Países Bajos. El municipio fue creado en 2002 por la fusión de los antiguos municipios de Pijnacker y Nootdorp. Cuenta con una superficie de 37,36 km², de los que 1,25 km² corresponden a la superficie ocupada por el agua. En abril de 2015 tenía una población de 51.401 habitantes.​ Forma parte del área metropolitana de La Haya y de la región metropolitana de Róterdam-La Haya. Los núcleos de población que forman el municipio son Delfgauw, Nootdorp y Pijnacker, y las aldeas de Oude Lede dentro del núcleo de Delfgauw y Vlieland en Pijnacker."},{"page_url":"https://en.wikipedia.org/wiki/Persoonia_linearis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Persoonia_linearis_habit_grnp.jpg","page_title":"Persoonia linearis","context_page_description":"Persoonia linearis, commonly known as the narrow-leaved geebung, is a shrub native to New South Wales and Victoria in eastern Australia. It reaches 3 m, or occasionally 5 m, in height and has thick, dark grey papery bark. The leaves are, as the species name suggests, more or less linear in shape, and are up to 9 cm long, and 0.1 to 0.7 cm wide. The small yellow flowers appear in summer, autumn and early winter, followed by small green fleshy fruit known as drupes. Within the genus Persoonia, it is a member of the Lanceolata group of 58 closely related species. P. linearis interbreeds with several other species where they grow together.\\nFound in dry sclerophyll forest on sandstone-based nutrient-deficient soils, P. linearis is adapted to a fire-prone environment; the plants resprout epicormic buds from beneath their thick bark after bushfires. The fruit are consumed by vertebrates such as kangaroo, possums and currawongs. As with other members of the genus, P. linearis is rare in cultivation as it is very hard to propagate by seed or by cuttings, but once propagated, it adapts readily, preferring acidic soils with good drainage and at least a partly sunny aspect."},{"page_url":"https://cs.wikipedia.org/wiki/Milly-la-For%C3%AAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Milly-la-Foret_IMG_5069.jpg","page_title":"Milly-la-Forêt","context_page_description":"Milly-la-Forêt je francouzská obec v departementu Essonne v regionu Île-de-France. Je chef-lieu kantonu Milly-la-Forêt."},{"page_url":"https://it.wikipedia.org/wiki/Ferdinand_von_Trauttmansdorff","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Durig_%28inc.%29_Le_g%C3%A9n%C3%A9ral_Van_der_Mersch.JPG","page_title":"Ferdinand von Trauttmansdorff","context_page_description":"Ferdinando Trauttmansdorff-Weinsberg, conte dell'Impero, poi principe dell'Impero, Ferdinand von und zu Trauttmansdorff-Weinsberg; spesso scritto Trautmansdorff o Trautmannsdorff o Trautmannsdorf o Trauttmannsdorff, è stato un diplomatico e politico austriaco."},{"page_url":"https://ca.wikipedia.org/wiki/Ermita_de_Sant_Pau_d%27Arbol%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ermita_d_SantPau_800x600.jpg","page_title":"Ermita de Sant Pau d'Arbolí","context_page_description":"L'Ermita de Sant Pau d'Arbolí és una ermita d'Arbolí, al serrat dels Colls per sobre del poble d'Arbolí."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AE%E0%AE%BE%E0%AE%B2%E0%AF%88%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AF%80%E0%AE%B5%E0%AF%81%E0%AE%95%E0%AE%B3%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Coat_of_arms_of_Maldives.png","page_title":"மாலைத்தீவுகள்","context_page_description":"மாலைத்தீவுகள் அல்லது மாலைத்தீவுகள் குடியரசு இந்தியப் பெருங்கடலில் உள்ள பல சிறிய தீவுகளாலான தீவு நாடாகும். இது இந்தியாவின் இலட்சத்தீவுகளுக்கு தெற்கேயும் இலங்கையிலிருந்து சுமார் 700 கிமீ தென்மேற்காகவும் அமைந்துள்ளது. 90,000 ச.கி.மீ. பரப்பளவுள்ள இத்தீவின் மக்கள் தொகை 3 இலட்சத்து 13 ஆயிரத்து 920 ஆகும். மொத்தம் 26 பவளத்தீவுகளில் 1,192 தீவுகள் காணப்படுவதோடு இவற்றில் சுமார் 200 இல் மட்டும் மனித குடியேற்றங்கள் காணப்படுகிறன. தீவுகளால் அமைந்த மாலைபோல் காணப்படுவதால் தமிழில் மாலைத்தீவுகள் என்றும் சமஸ்கிருத மொழியில் \\"மாலத்வீப\\"என்றும் குறிப்பிடப்படுகிறது. வேறு சிலரின் கருத்துப்படி இது \\"மகால்\\" என்ற அரபு மொழிச் சொல்லின் மரூஉ ஆகும். சோழர்கள் காலம் வரை அவர்களது ஆட்சியில் இருந்த இந்தத் தீவுகள் பின்னர் சிங்களர்கள் ஆட்சிக்குட்பட்டது. 1153இல் இசுலாம் மதம் இங்கு கொண்டுவரப்பட்டது. பின்னர் மாலைத்தீவுகள் 1558 இல் போர்த்துக்கேயரிடமும், 1654 டச்சுக் கிழக்கிந்தியக் கம்பனியிடமும் பின்பு 1887 முதல் பிரித்தானியரிடமும் அடிமைப்பட்டது. 1965ஆம் ஆண்டு மாலைத்தீவுகள் ஐக்கிய இராச்சியத்திடம் இருந்து விடுதலை பெற்றது. 1968 இல் சுல்தான் ஆட்சியிலிருந்து குடியரசாக மாறியது. குடியரசான மாலைத் தீவுகளின் முதல் குடியரசுத் தலைவர் சுல்தான் ஆட்சியில் பிரதமராக இருந்த இப்ராகிம் நசீர் ஆவார்."},{"page_url":"https://en.wikipedia.org/wiki/Wild_Cub","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Wild_Cub_2014.jpg","page_title":"Wild Cub","context_page_description":"Wild Cub is a Nashville-based indie rock band led by songwriter-composer Keegan DeWitt and multi-instrumentalist Jeremy Bullock. Its supporting members are drummer Dabney Morris, bassist Harry West, and keyboardist and synthesist Eric Wilson. Their song \\"Thunder Clatter\\" charted at No. 59 in the UK in August 2013."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80_%D0%92%D0%B8%D1%82%D0%BE%D0%B2%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Spomenik_Arhimandritu_Had%C5%BEi-Stefanu.jpg","page_title":"Манастир Витовница","context_page_description":"Манастир Витовница је православни манастир који припада Епархији браничевској Српске православне цркве. Он је део Кучаја, ван граница старог Браничева. Манастирска црква је посвећена Успењу Богородице. Манастир је смештен на десној обали истоимене реке, десетак километара источно од Петровца на Млави. Представља непокретно културно добро као споменик културе од великог значаја."},{"page_url":"https://ast.wikipedia.org/wiki/Tephrosia_vogelii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Tephrosia_vogelii--_the_Fish_Poison_Bean_%2826805852961%29.jpg","page_title":"Tephrosia vogelii","context_page_description":"Tephrosia vogelii, o barbasco guineanu, ye una especie de planta con flores del xéneru Tephrosia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BD%D0%B4%D0%B5%D1%80%D0%BC%D0%BE%D0%BD%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/DendermondeAkademie.JPG","page_title":"Дендермонде","context_page_description":"Дендермонде — город и коммуна в Бельгии, в провинции Восточная Фландрия. Расположен при впадении реки Дандр в Шельду.\\nКоммуна Дендермонде (коммуна в Бельгии — низшая административная единица) состоит из собственно города Дендермонде (Dendermonde-stad) и посёлков Аппелс, Синт-Гиллис-бэй-Дендермонде, Гремберген, Басроде, Меспеларе, Аудегем и Схонарде. Общее население коммуны составляет 42 955 жителей, площадь — 55,67 кв. км."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5_%D0%A6%D0%B7%D0%B5%D1%88%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Xie_Jieshi_1932.jpg","page_title":"Се Цзеши","context_page_description":"Се Цзеши — политический деятель первой половины XX века, занимал различные министерские посты в Маньчжоу-го."},{"page_url":"https://az.wikipedia.org/wiki/Trogon_viridis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Trogon-viridis-002.jpg","page_title":"Trogon viridis","context_page_description":"Trogon viridis — troqon cinsinə aid quş növü."},{"page_url":"https://es.wikipedia.org/wiki/Buenos_Aires","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Luna_Park_de_Noche.jpg","page_title":"Buenos Aires","context_page_description":"Buenos Aires, oficialmente Ciudad Autónoma de Buenos Aires o Ciudad de Buenos Aires, ​​ es la capital y ciudad más poblada de la República Argentina. Esta metrópolis es una ciudad autónoma que constituye uno de los 24 distritos, o «jurisdicciones de primer orden»​, que conforman el país. Tiene sus propios poderes ejecutivo, legislativo y judicial. Está situada en la región centro-este del país, sobre la orilla sur del Río de la Plata, en la región pampeana. La Ciudad de Buenos Aires fue cedida por la provincia de Buenos Aires para que fuera la capital federal del país; pero en virtud de la Constitución Nacional es una ciudad autónoma.\\nSu tejido urbano se asemeja a un abanico que limita al sur, oeste y norte con la lindante Provincia de Buenos Aires y al este con el Río de la Plata. Oficialmente la ciudad se encuentra dividida en 15 comunas que agrupan a 48 barrios. Desde 1880 hasta el presente se la llama también Capital Federal, ​​​ aunque desde 1996 no figura oficialmente con ese nombre ni en su Constitución propia​ ni en la Constitución Nacional.​"},{"page_url":"https://nn.wikipedia.org/wiki/Jablonovyjfjella","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Location_Yablonoi_Mountains.PNG","page_title":"Jablonovyjfjella","context_page_description":"Jablonovyjfjella er ei fjellkjede i Sibir i Russland. Ho strekkjer seg om lag 1600 km nordaustover frå Mongolia og går like aust for Bajkalsjøen. I nordaust går ho over i Stanovojfjella. Fjellkjeda utgjer ein del av vasskiljet mellom Nordishavet og Stillehavet. Fjellkjeda er ikkje særleg høg, men lang og tynn. Den høgaste toppen er Sokhondo på 2500 meter over havet.\\nDen isolerte fjellkjeda er tynt busett og dei fleste busetnadane ligg rundt gruver. Området er særleg rikt på tinn. Den transsibirske jarnvegen går parallelt til fjellkjeda før han går gjennom ein tunnel under fjella."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%88%91%E3%81%8C%E5%AE%B6%E3%81%AE%E6%A5%BD%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/1938_-_Midway_Theater_Ad_-_17_Nov_MC_-_Allentown_PA.jpg","page_title":"我が家の楽園","context_page_description":"『我が家の楽園』は、1938年のアメリカ映画。コロンビア映画製作。第11回アカデミー賞の作品賞、監督賞を受賞した。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%9B%D1%83%D0%B3%D0%B0%D0%BD%D0%B0_(%D0%B2%D0%BE%D0%B7%D0%B5%D1%80%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Lake_Lugano.jpg","page_title":"Лугана (возера)","context_page_description":"Лугана — возера, 271 м над узроўнем мора, разам з возерам Орта самае высокае з італьянскіх азёр; адна частка належыць швейцарскаму кантону Тычына, іншая - італьянскай правінцыі Кома."},{"page_url":"https://cy.wikipedia.org/wiki/Glas_y_dorlan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Alcedo_atthis_MHNT_ZOO_2010_11_160_Arcy-sur-Cure.jpg","page_title":"Glas y dorlan","context_page_description":"Rhywogaeth o adar yw Glas y Dorlan sy'n gyffredin trwy'r rhan fwyaf o Ewrop a rhannau o Asia ac Affrica. Nid yw'n aderyn mudol fel rheol, ond yng ngogledd Ewrop mae'n symud tua'r de yn y gaeaf. Mae'n perthyn i deulu'r Alcedinidae o fewn urdd y Coraciiformes.\\nFel yr agryma'r enw, mae'r rhan fwyaf o'r aderyn yn las. Mae'n aderyn gweddol fach, gyda hyd o tua 19 cm. Mae'n byw ar bysgod bach ac anifeiliad bychan eraill sy'n cael eu dal trwy blymio i mewn i'r dŵr a dal y pysgod yn ei big. Fel rheol mae'n eistedd ar frigyn neu rywle cyfleus arall uwchben y dŵr i ddisgwyl am gyfle i blymio. Bydd wedyn yn dychwelyd gyda'r pysgodyn i'r brigyn, ei daro amryw o weithiau yn erbyn y brigyn neu rywbeth caled arall i'w ladd os yw'n bysgodyn gweddol fawr, ac yna ei lyncu. Mae'n hoffi afonydd sy'n llifo'n weddol araf neu byllau, ond mae'n rhaid i'r dŵr fod yn weddol glir iddo fedru gweld ei brae.\\nMae'n nythu mewn twll yn y dorlan, sy'n cael ei wneud gan yr adar eu hunain fel rheol, er y gall ddefnyddio hen dwll aderyn neu anifail arall os bydd un ar gael. Nid yw'n adeiladu nyth, dim ond dodwy wyau ym mhen pellaf y twll."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A6%99%E6%9E%97%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Oishi_Riku_Ihatsuzuka_Toyooka.jpg","page_title":"香林院","context_page_description":"香林院、りくは、江戸時代前期の女性。赤穂藩家老大石良雄の妻。当時用いられた名乗りではないが、現代では大石りくとも呼ばれることもある。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%83%D0%BB%D0%B8%D1%86%D0%B0_(%D0%A0%D0%BE%D1%81%D1%82%D0%BE%D0%B2-%D0%BD%D0%B0-%D0%94%D0%BE%D0%BD%D1%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/%D0%94%D0%BE%D1%85%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%94%D0%BE%D0%BC_%D0%91%D0%BE%D1%81%D1%82%D1%80%D0%B8%D0%B3%D0%B8%D0%BD%D1%8B%D1%85%2C_1914_%D0%B3%D0%BE%D0%B4.jpg","page_title":"Пушкинская улица (Ростов-на-Дону)","context_page_description":"Пу́шкинская у́лица — улица в центре Ростова-на-Дону.\\nЗдесь расположено много старинных зданий, памятников, необычных деревьев, искусно оформленных клумб. Улица представляется небольшим бульваром посередине. Начинается от Доломановского переулка. До Будённовского проспекта бульвар небольшой. До Ворошиловского проспекта бульвар уже занимает половину всей улицы. После Ворошиловского проспекта бульвар занимает три четверти всей улицы. После улицы Чехова бульвар занимает всю улицу и она до самого конца имеет статус пешеходной. Улица зелёная и тенистая по сравнению с другими в центре города, на ней находятся две библиотеки, факультет филологии и журналистики ЮФУ, музей. Имеет статус парковой зоны."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%B3%E3%82%BF%E3%83%83%E3%82%AD%E3%83%BC%E5%B7%9E%E9%81%B8%E5%87%BA%E3%81%AE%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E4%B8%8A%E9%99%A2%E8%AD%B0%E5%93%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Martin_D_Hardin.jpg","page_title":"ケンタッキー州選出のアメリカ合衆国上院議員","context_page_description":"以下は、ケンタッキー州選出のアメリカ合衆国上院議員の一覧である。\\nケンタッキー州は、 1792年6月1日に連邦に加わった。ケンタッキー州は第2部と第3部に属する上院議員を選出している。現在のケンタッキー州選出の上院議員はミッチ・マコーネルとランド・ポールである。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D8%A7%D9%84%D8%B2%D9%8A%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Kidron_jerusalem_%2810%29.JPG","page_title":"جبل الزيتون","context_page_description":"يقع جبل الزيتون أو قرية الطور والتسمية قديمة جداً من قبل أيام يسوع، وأصلها \\" طور زيتا\\" أي جبل الزيتون حيث طور بمعنى جبل؛ إلى الشرق من البلدة القديمة في القدس إذ تعتبر واحدة من أقدم القرى في مدينة القدس، وموطن للعديد من المواقع الدينية والأثرية التي حولتها إلى وجهة سياحية معروفة."},{"page_url":"https://ja.wikipedia.org/wiki/TV2_(%E3%83%8E%E3%83%AB%E3%82%A6%E3%82%A7%E3%83%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Tv-2-norway.png","page_title":"TV2 (ノルウェー)","context_page_description":"TV2は、ノルウェーのベルゲンに拠点を置くテレビ局。1992年開局。欧州放送連合の正会員。\\nTV2グループを構成する会社の一つ。"},{"page_url":"https://id.wikipedia.org/wiki/Rahsaan_Roland_Kirk","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Roland-Kirk.jpg","page_title":"Rahsaan Roland Kirk","context_page_description":"Rahsaan Roland Kirk adalah seorang pemusik jazz multi-instrumentalist yang memainkan saksofon tenor, seruling, dan banyak instrumen lainnya. Ia terkenal karena vitalitasnya di atas panggung, di mana improvisasi virtuoso diiringi oleh olok-olok komik, ocehan politik, dan kemampuan memainkan beberapa instrumen secara bersamaan."},{"page_url":"https://tr.wikipedia.org/wiki/Alyaksandr_Hleb","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Hleb_arsenal.jpg","page_title":"Alyaksandr Hleb","context_page_description":"Alyaksandr Paulaviç Hleb, Beyaz Rus eski futbolcudur. Genellikle hücuma dönük orta saha futbolcusu olarak görev yapmıştır."},{"page_url":"https://et.wikipedia.org/wiki/Uus-Meremaa_Kuninglik_Selts","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Eccles_lab.jpg","page_title":"Uus-Meremaa Kuninglik Selts","context_page_description":"Uus-Meremaa Kuninglik Selts on Uus-Meremaa teaduse edendamisega tegelev liikmesorganisatsioon.\\nSelts asutati 1867. aastal algse nimetusega Uus-Meremaa Instituut. 1933. aastast tegutseb see Uus-Meremaa Kuningliku Seltsina. 2010. aastast laienes seltsi teadusvaldkondade arv: lisandusid humanitaar- ja sotsiaalteadused. Selts on Rahvusvahelise Akadeemiate Liidu liige.\\nSeltsi liikmeks saab astuda iga huviline. Teadustöös silmapaistnud teadlasi valib seltsi akadeemiline nõukogu 1919. aastast seltsi valitud liikmeteks. Väljapaistvaid välisteadlasi hakati seltsi auliikmeteks valima kohe pärast seltsi loomist.\\nSeltsi poolt väljaantavatest auhindadest on tähtsamad Rutherfordi medal, Pickeringi medal, Flemingi auhind ja Hectori medal."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%83%AD%E3%83%BC%E3%83%89%E3%83%BB%E3%83%A2%E3%83%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Georges_Clemenceau_et_Claude_Monet.jpg","page_title":"クロード・モネ","context_page_description":"クロード・モネは、印象派を代表するフランスの画家。代表作『印象・日の出』は印象派の名前の由来になった。"},{"page_url":"https://en.wikipedia.org/wiki/Yellowhead_jawfish","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Opistognathus_aurifrons.jpg","page_title":"Yellowhead jawfish","context_page_description":"The yellowhead jawfish is a species of jawfish native to coral reefs in the Caribbean Sea. It is found at depths of from 3 to 40 metres. The head and upper body are a light, but brilliant, yellow color slowly fading to a pearlescent blue hue. It can reach a length of 10 centimetres TL. Yellowhead jawfishes are usually found in Florida. They are usually found in shallow areas where materials are available for burrow construction. The Jawfishes live in rubble areas and sand in groups of up to 70 species.\\nIt remains near its relatively small territory, and is typically seen with only the head and upper section of its body protruding from its burrow, although it sometimes can be found hovering nearby. It is able to arrange material using its mouth, carrying sand, shells, or small rocks from one location to another.\\nIt is a mouthbrooder, with the male carrying the eggs in its mouth until they hatch."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Pob%C4%9B%C5%BEovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/PobezoviceMarienSaeule_06.JPG","page_title":"Liste der denkmalgeschützten Objekte in Poběžovice","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte in Poběžovice ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt.\\nDie folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalbehörde."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Green_Valley_Log_Cabin.JPG","page_title":"National Register of Historic Places","context_page_description":"The National Register of Historic Places is the United States federal government's official list of districts, sites, buildings, structures and objects deemed worthy of preservation for their historical significance. A property listed in the National Register, or located within a National Register Historic District, may qualify for tax incentives derived from the total value of expenses incurred in preserving the property.\\nThe passage of the National Historic Preservation Act in 1966 established the National Register and the process for adding properties to it. Of the more than one million properties on the National Register, 80,000 are listed individually. The remainder are contributing resources within historic districts.\\nFor most of its history, the National Register has been administered by the National Park Service, an agency within the United States Department of the Interior. Its goals are to help property owners and interest groups, such as the National Trust for Historic Preservation, as well as to coordinate, identify and protect historic sites in the United States."},{"page_url":"https://fi.wikipedia.org/wiki/La_Plata","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/La_Plata_-_Plaza_Moreno_-_20061207a.jpg","page_title":"La Plata","context_page_description":"La Plata on Buenos Airesin maakunnan pääkaupunki Argentiinassa, noin 50 kilometriä maan pääkaupungin Buenos Airesista kaakkoon. Vuonna 2010 kaupungin asukasluku oli noin 624 000, ja koko suurkaupunkialueen 786 000. La Plata toimii samannimisen partido-hallintoalueen kaupunkikeskuksena. Vuosina 1952–1955 kaupunki tunnettiin nimellä Ciudad Eva Perón.\\nVuonna 1882 maakunnan hallinto päätettiin siirtää sinne pois Buenos Airesista, josta tuli erillinen valtakunnan pääkapunkialue. La Plataan rakennutettiin tuolloin kirjasto, tähtitorni, goottilainen katedraali ja museo."},{"page_url":"https://en.wikipedia.org/wiki/Finial","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Finial-Pineapple.jpg","page_title":"Finial","context_page_description":"A finial or hip-knob is an element marking the top or end of some object, often formed to be a decorative feature. In architecture it is a decorative device, typically carved in stone, employed to emphasize the apex of a dome, spire, tower, roof, or gable or any of various distinctive ornaments at the top, end, or corner of a building or structure. Where there are several such elements they may be called pinnacles. Smaller finials in materials such as metal or wood are used as a decorative ornament on the tops or ends of poles or rods such as tent-poles or curtain rods or any object such as a piece of furniture. These are frequently seen on top of bed posts or clocks. Decorative finials are also commonly used to fasten lampshades, and as an ornamental element at the end of the handles of souvenir spoons. The charm at the end of a pull chain is also known as a finial.\\nDuring the various dynasties in China, a finial was worn on the top of the hats civil or military officials wore during formal court ceremonies. The finial was changed to a knob for other daily usage. The Pickelhaube is a Central European military helmet with a finial topped by a spike."},{"page_url":"https://ja.wikipedia.org/wiki/VRC_IV","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/VRCIV_2-TYPE_01.jpg","page_title":"VRC IV","context_page_description":"VRC IV はコナミが開発したファミリーコンピュータ 用のROMバンクコントロールチップである。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%92%E1%83%94%E1%83%9D%E1%83%A0%E1%83%92%E1%83%98%E1%83%9D%E1%83%A1_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Greek_Crown_Prince_George.jpg","page_title":"გეორგიოს II","context_page_description":"გიორგიოს II მეფობდა საბერძნეთის მეფედ 1922 წლიდან 1924 წლამდე და 1935 წლიდან 1947 წლამდე. იგი იყო პრინცი ფილიპეს, ედინბურგის ჰერცოგის ბიძაშვილი მამის მხრიდან და ვილჰელმ II- ის, გერმანიის უკანასკნელი იმპერატორის, დისშვილი."},{"page_url":"https://ca.wikipedia.org/wiki/Kassina_maculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Kassina_maculuata.jpg","page_title":"Kassina maculata","context_page_description":"Kassina maculata és una espècie de granota de la família dels hiperòlids que viu a Kenya, Malawi, Moçambic, Sud-àfrica, Swazilàndia, Tanzània i Zimbabwe.\\nEstà amenaçada d'extinció per la pèrdua del seu hàbitat natural."},{"page_url":"https://pl.wikipedia.org/wiki/B%C5%82%C4%99kitek_(ryba)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Prl2.jpg","page_title":"Błękitek (ryba)","context_page_description":"Błękitek, putasu – gatunek ryby z rodziny dorszowatych."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9C%A1%EA%B5%B0%ED%9B%88%EB%A0%A8%EC%86%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Winter%27s_ROKATC_Hogukyeonmusa_Main_gate%28Ilju_gate%29.jpg","page_title":"육군훈련소","context_page_description":"육군훈련소는 대한민국 국군의 가장 큰 교육 부대이다. 충청남도 논산시 연무읍에 있는 이 부대는 대한민국 육군의 기초군사교육을 실시하는 교육 부대로서 1951년 11월 '육군 제2훈련소'라는 이름으로 창설되었다. 논산시 연무읍에 있기 때문에 흔히 논산 훈련소 또는 연무대라고 불린다."},{"page_url":"https://ca.wikipedia.org/wiki/Ermita_de_la_Consolaci%C3%B3_(Llutxent)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Ermita_de_la_Consolaci%C3%B3_de_Llutxent.JPG","page_title":"Ermita de la Consolació (Llutxent)","context_page_description":"L'ermita de la Consolació situada al camí de la Costa al terme municipal de Llutxent, a la comarca de la Vall d'Albaida va ser fundada el 1772, per uns pelegrins catalans que freqüentaven el Monestir en el paratge on ja havia existit una ermita sota l'advocació de Sant Cosme i Sant Damià i en el lloc en què el \\"Camí de Costa\\" fa una pujada, davant d'una de les creus votives del segle XIV i a mig camí entre la població i el convent.\\nAl simbolisme del lloc es suma la concepció de temple oratori en creu grega i cúpula interior de mitja taronja, amb tots els atributs i riqueses ornamentals, en clau popular, de la seva adscripció barroca, inserit en una austera edificació envoltant d'ordre cúbic relacionable amb la més funcional arquitectura rural de la seva època i el seu pati associat.\\nS'ha d'afegir com a elements d'interès, la imatgeria, fusteries, taulells de Manises, frescos i vidrieres - atributs, en part, d'encertada factura moderna, dels anys 70 del segle xx. Els vitralls de la capella són de l'artista francès Alfred Manessier."},{"page_url":"https://hu.wikipedia.org/wiki/Liancourt-Saint-Pierre","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Population_-_Municipality_code_60361.svg","page_title":"Liancourt-Saint-Pierre","context_page_description":"Liancourt-Saint-Pierre település Franciaországban, Oise megyében. Liancourt-Saint-Pierre Boubiers, Chaumont-en-Vexin, Fay-les-Étangs, Lavilletertre, Lierville, Loconville, Reilly és Tourly községekkel határos."},{"page_url":"https://eu.wikipedia.org/wiki/V%C4%9B%C5%BEky_(P%C5%99erov_barrutia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/V%C4%9B%C5%BEky_%28PR%29%2C_hlavn%C3%AD_ulice.jpg","page_title":"Věžky (Přerov barrutia)","context_page_description":"Věžky Txekiar Errepublikako udalerri bat da. 211 biztanle ditu eta 2,4 kilometro koadroko azalera. Přerov barrutian dago."},{"page_url":"https://en.wikipedia.org/wiki/Chile%E2%80%93Venezuela_relations","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Chile_Venezuela_Locator.png","page_title":"Chile–Venezuela relations","context_page_description":"Chile–Venezuela relations refers to the diplomatic relations between the Republic of Chile and the Bolivarian Republic of Venezuela. Both nations are members of the Community of Latin American and Caribbean States, Group of 77, Latin American Integration Association, Organization of American States, Organization of Ibero-American States and the United Nations."},{"page_url":"https://zh.wikipedia.org/wiki/2007%E5%B9%B4%E4%B8%96%E7%95%8C%E8%81%BD%E9%9A%9C%E6%B8%B8%E6%B3%B3%E9%8C%A6%E6%A8%99%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/WDSC2007_Day1_Awards_Men100Breaststroke_Champion.jpg","page_title":"2007年世界聽障游泳錦標賽","context_page_description":"2007年世界聽障游泳錦標賽是一項由台北市政府與中華民國聽障者體育運動總會聯合主辦，2009年聽障奧運籌委會基金會承辦的競賽，於2007年8月12日－8月16日在國立體育學院游泳池舉行，參賽者以聽障游泳選手為主，且因為台北市將在2009年舉辦台北聽障奧運的關係，而被視為一項前哨戰，更成為國際「聾人文化」交流的一項重要指標。\\n這項比賽是台灣舉辦世界級比賽以來，第一次承辦聽障運動相關的競賽，也是國際聽障運動總會停辦12年之後，再度恢復的比賽。本次比賽誕生了部分新的紀錄，被認為是台灣成功宣傳國際「聾人文化」的一項重要創舉。"},{"page_url":"https://de.wikipedia.org/wiki/Steinkohle-Bergbau_im_Deister","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Gute-Hoffnung-Stollen_-_Halde.jpg","page_title":"Steinkohle-Bergbau im Deister","context_page_description":"Der Steinkohle-Bergbau im Deister war über mehrere Jahrhunderte ein bedeutender Wirtschaftszweig rings um den Deister. Abgebaut wurde Steinkohle, die aus der Unteren Kreidezeit stammt und in Flözen von maximal 100 cm Mächtigkeit angetroffen wurde. Wegen mangelnder Wirtschaftlichkeit wurde der Bergbau im Jahr 1956 bzw. 1960 eingestellt."},{"page_url":"https://pl.wikipedia.org/wiki/Ken_Ishii","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Ken_Ishii_at_Maniac_Beach_20070819.jpg","page_title":"Ken Ishii","context_page_description":"Ken Ishii – japoński DJ i producent muzyki techno.\\nPoza sygnowaniem wydań własnymi personaliami, artysta posługuje się również takimi pseudonimami jak FLR, Flare, UTU, Yoga i Rising Sun. Jego pierwsza płyta, stworzona pod silnym wpływem detroit techno, wydana została nakładem wydawnictwa Plus 8 Records należącego do Richie Hawtina. Kenowi Ishii powierzono zadanie skomponowania muzyki na ceremonię otwarcia Zimowych Igrzysk Olimpijskich w 1998 r. Napisał on również utwór Creation The State Of Art do gry Rez z 2001 r. Z kolei Let It All Ride został wykorzystany w grze Lumines II na konsolę PSP."},{"page_url":"https://tr.wikipedia.org/wiki/Odigitria","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Berlinghiero_Berlinghieri_005.jpg","page_title":"Odigitria","context_page_description":"Odigitria, Hristiyan ikonografisinde bir sahne. Meryem'in çocuk İsa'yı kucağında tutar halde ve yol gösterici bir rol biçilerek tasvir edildiği sahne olan odigitria Hristiyan sanatında en çok kullanılan sahnelerden biridir."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Selim_1-s%C3%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Yavuz_Selim.jpg","page_title":"Selim 1-sè","context_page_description":"Selim 1-sè sī Osman Tè-kok ê tē-9 tāi Sultan; tī 1512 nî kàu 1520 nî chāi-ūi."},{"page_url":"https://simple.wikipedia.org/wiki/House_of_Orl%C3%A9ans","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Coat_of_arms_of_the_Duke_of_Orl%C3%A9ans_%28as_prince_of_the_blood%29.png","page_title":"House of Orléans","context_page_description":"The House of Orléans was a French noble and royal family. It descends from Louis XIV of France and his only brother Philippe, Duke of Orléans. The families main traditional home was the Palais Royal in Paris. The family later became very powerful during the reign of Louis Philippe I. He ruled France under the title King of the French. The king successfully married his children into other royal families of Europe.\\nThe present head of the house is Prince Henri of Orléans. He is known as the Count of Paris. He also claims the title King of the French, but is known simply as His Royal Highness The Count of Paris and sometimes the Duke of France. However, the titles are not officially recognised because France is no longer a monarchy. Henri has been a claimant to the throne since 1999. The Count was married to Duchess Marie Thérèse of Württemberg. She is herself a daughter of a one-time claimant to the throne of Württemberg."},{"page_url":"https://de.wikipedia.org/wiki/Zwinger_(Dresden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Dresden_Luftbild_Postplatz_Zwinger.jpg","page_title":"Zwinger (Dresden)","context_page_description":"Der Zwinger ist ein Gebäudekomplex mit Gartenanlagen in Dresden. Das unter der Leitung des Architekten Matthäus Daniel Pöppelmann und des Bildhauers Balthasar Permoser errichtete Gesamtkunstwerk aus Architektur, Plastik und Malerei gehört zu den bedeutenden Bauwerken des Barocks und ist neben der Frauenkirche das bekannteste Baudenkmal Dresdens. Sein Name Zwinger geht auf die im Mittelalter übliche Bezeichnung für einen Festungsteil zwischen der äußeren und inneren Festungsmauer zurück, obschon der Zwinger bereits bei Baubeginn keine dem Namen entsprechende Funktion mehr erfüllte.\\nDer Zwinger entstand ab 1709 als Orangerie und Garten sowie als repräsentatives Festareal. Seine reich verzierten Pavillons und die von Balustraden, Figuren und Vasen gesäumten Galerien zeugen von der Prachtentfaltung während der Regentschaft des Kurfürsten Friedrich August I. und seines dadurch ausgedrückten Machtanspruchs. In der ursprünglichen Konzeption des Kurfürsten war der Zwinger als Vorhof eines neuen Schlosses vorgesehen, das den Platz bis zur Elbe einnehmen sollte; daher blieb der Zwinger zur Elbseite hin zunächst unbebaut."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%BF%E0%AE%B1%E0%AF%88%E0%AE%B8%E0%AF%8D%E0%AE%9F%E0%AF%8D%E0%AE%9A%E0%AF%87%E0%AE%B0%E0%AF%8D%E0%AE%9A%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Peacock_Fountain%2C_New_Zealand.jpg","page_title":"கிறைஸ்ட்சேர்ச்","context_page_description":"கிறைஸ்ட்சேர்ச் என்பது நியூசிலாந்தின் தெற்குத் தீவின் மிகப் பெரிய நகரம் ஆகும். இது நியூசிலாந்தின் இரண்டாவது பெரிய நகரப் பகுதியும் ஆகும். இதனைப் பூங்கா நகரம் என அழைப்பர்."},{"page_url":"https://fr.wikipedia.org/wiki/Utah_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Monument_Utah_Beach_Manche%2C_France.jpg","page_title":"Utah Beach","context_page_description":"Utah Beach est l'appellation d'une des cinq plages du débarquement de Normandie le 6 juin 1944. Plage la plus à l'ouest des zones du débarquement allié et la seule située dans le département de la Manche sur la côte nord-est du Cotentin, à l'ouest de l'estuaire de la Vire, Utah Beach s'étend de Sainte-Marie-du-Mont jusqu’à Quinéville sur environ 5 km de long, avec une zone d'assaut principal à hauteur de Varreville.\\nElle fut ajoutée aux plans initiaux du débarquement, du fait d'un plus grand nombre de chalands de débarquement finalement disponibles et permettait ainsi d'avoir une tête de pont plus proche du port de Cherbourg.\\nLa 2ᵉ DB, commandée par le général Leclerc, y débarqua 30 juillet 1944.\\nLe débarquement à Utah Beach fut certainement le moins coûteux en vies humaines et celui avec les résultats, à la fin de la première journée, les plus proches des objectifs initiaux des Alliés. La 4ᵉ division d'infanterie américaine n'y rencontra qu'une relativement faible résistance ennemie, en contraste avec Omaha Beach l'autre plage du secteur américain."},{"page_url":"https://sv.wikipedia.org/wiki/Rhododendron_caucasicum","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Turkish_Rhododendron_caucasicum.jpg","page_title":"Rhododendron caucasicum","context_page_description":"Rhododendron caucasicum är en ljungväxtart som beskrevs av Pall.. Rhododendron caucasicum ingår i släktet rododendron, och familjen ljungväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/1959_Pacific_typhoon_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Sally_1959_track.png","page_title":"1959 Pacific typhoon season","context_page_description":"The 1959 Pacific typhoon season was regarded as one of the most devastating years for Pacific typhoons on record, with China, Japan and South Korea sustaining catastrophic losses.\\nThe scope of this article is limited to the Pacific Ocean, north of the equator and west of the International Date Line. Storms that form east of the Date Line and north of the equator are called hurricanes; see 1959 Pacific hurricane season. All typhoons were assigned a name and number. Tropical storms and tropical depressions formed in the entire west Pacific basin were assigned a name and number by the Joint Typhoon Warning Center, but the latter was not added if no reconnaissance missions were assigned. Systems handled by the responsibility of the USWB and FWB featured no number.\\nThe 1959 Pacific typhoon season featured 24 tropical cyclones, though operationally 59 total areas of investigation were classified by the Joint Typhoon Warning Center; three systems were handled by the responsibility of FWB at Pearl Harbor and the USWB at Honolulu. Three systems were questionable due to lack of reconnaissance aircraft use."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%B0%D0%B3%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Sophia_panorama_2.jpg","page_title":"Волагда","context_page_description":"Во́лагда — горад у Расеі, заснаваны ў 1147 годзе, адміністрацыйны, культурны і навуковы цэнтар Валагодзкай вобласьці. Разьмешчаны на рацэ Волагдзе. Важнейшы транспартны вузел Паўночна-Захаду Расеі. Уваходзіць у лік гарадоў, якія валодаюць асабліва каштоўнай гістарычным спадчынай: на тэрыторыі гораду выяўлена 224 помніка гісторыі, архітэктуры, культуры; 128 зь іх узятыя пад ахову дзяржавы."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%97%A5%E6%9A%AE%E9%87%8C%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/JR_Nippori_Station_Platform_9%E3%83%BB10.jpg","page_title":"日暮里站","context_page_description":"日暮里站是位于日本东京都荒川区西日暮里二丁目，属于东日本旅客铁道、京成电铁、东京都交通局的铁路车站。此站是荒川区最南端车站，有一部分跨到台东区。而月台位于区界上。"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%B5%D5%B8%D6%82%D6%84%D5%BD%D5%A5%D5%B4%D5%A2%D5%B8%D6%82%D6%80%D5%A3%D5%AB_%D5%B4%D5%A5%D5%AE_%D5%A4%D6%84%D5%BD%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D5%B8%D5%BD%D5%BF%D5%AB%D5%AF%D5%A1%D5%B6%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Luxembourg_Stolzembourg_Police_Motorcycle.jpg","page_title":"Լյուքսեմբուրգի մեծ դքսության ոստիկանություն","context_page_description":"Լյուքսեմբուրգի մեծ դքսության ոստիկանություն, Լյուքսեմբուրգի հիմնական իրավապաշտպան օրգանը:\\nՈստիկանությունը գտնվում է Լյուքսեմբուրգի ներքին գործերի նախարարության իրավասության ներքո, սակայն վերահսկվում է Լյուքսեմբուրգի պետական մարմիների կողմից: Լյուքսեմբուրգի ոստիկանությունը իր այսօրվա ձևով գոյություն ունի 2000 թվականի հունվարի 1-ից, երբ Լյուքսեբուրգ եկավ ժանդարմերիան:\\nՈստիկանությունը պարտական է ապահովել դքսության ներքին անվտանգությունը, պահպանել հասարակական կարգը և ղեկավորել Մեծ դքսության կողմից հրապարակված հրամանների իրականացումը: Համաձայն դքսության կանոնակարգի՝ ոստիկանությունը պարտավոր է օգնություն ցուցաբերել զինված ուժերին:"},{"page_url":"https://it.wikipedia.org/wiki/Mattias_Ekstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/World_RX_-_2018_-_RD1_Barcelona_%2839641410570%29.jpg","page_title":"Mattias Ekström","context_page_description":"Mattias Ekström è un pilota automobilistico svedese.\\nÈ stato campione dello Swedish Touring Car Championship nel 1999, del World Rallycross nel 2016, due volte del DTM e tre volte vincitore della Race of Champions: nel 2006, nel 2007 e nel 2009. Dal 2001 al 2018 ha corso nel DTM per il team Audi e, sempre per la medesima casa, anche nel rallycross."},{"page_url":"https://fr.wikipedia.org/wiki/Robert_Keller","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Plaque_Comm%C3%A9morative_en_l%27honneur_de_l%27Ing%C3%A9nieur_des_PTT_Robert_Keller_%26_ses_compagnons_R%C3%A9sistants.jpg","page_title":"Robert Keller","context_page_description":"Robert Keller est un résistant français de la Seconde Guerre mondiale."},{"page_url":"https://no.wikipedia.org/wiki/Geirangervegen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/0906_Kreuzfahrt_Norwegen_1571.jpg","page_title":"Geirangervegen","context_page_description":"Geirangervegen er en bilvei åpnet i 1889 og fjellovergang mellom Skjåk og Geiranger. Veien er en del av fylkesvei 63 mellom Geiranger og kryss med riksvei 15 ved Langvatn på Strynefjellet. Høyeste punkt ligger 1038 moh. Veien er en ferdselsvei mellom Sunnmøre og Østlandet. Frem til 1977 var traseen helt til Grotli der den opprinnelige Strynefjellsvegen ble knyttet til i 1894. Mellom Langvatn og Opplendskedal øverst i Geiranger er veien vinterstengt. Strekningen Maråk og Grotli var riksveg fra 1928.\\nVeien ble foreslått vernet i Nasjonal verneplan for veger, bruer og vegrelaterte kulturminner. Riksantikvaren fredet veien i 2010.\\nVed Flydal ble det i juli 2017 talt 2000 kjøretøy daglig i gjennomsnitt, 25 % av trafikken var tunge kjøretøy. I september ligger døgntrafikken på rundt 500 kjøretøy, i desember-april om lag 40 kjøretøy daglig."},{"page_url":"https://fi.wikipedia.org/wiki/Taija_Tuominen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Taija_Tuominen_Tre_2012_C_IMG_1942.JPG","page_title":"Taija Tuominen","context_page_description":"Taija Tuominen on suomalainen kirjailija ja luovan kirjoittamisen opettaja.\\nTuominen on opiskellut Tampereen yliopistossa kotimaista kirjallisuutta sekä luovaa kirjoittamista Oriveden opistossa. Hänet on palkittu kahdesti J.H. Erkon novellikilpailussa: Vuonna 1990 hän sai kolmannen palkinnon ja vuonna 1992 voitti koko kilpailun. Tuomisen läpimurtoteos oli hänen esikoisromaaninsa Tiikerihai, joka perustui kirjailijan omiin lapsuuden ja nuoruuden kokemuksiin.\\nTiikerihai on kiinnostanut myös teatterintekijöitä. Vuonna 2007 romaanista valmistui peräti kaksi näyttämösovitusta. Asialla olivat tamperelaiset harrastajateatterit, Teatteri Unda ja Teatteri Sininen tiikeri. Ensimmäisen ohjauksesta ja dramatisoinnista vastasi Sari Lilliestierna, jälkimmäisen puolestaan Virva Itäranta. Myöhemmin myös Oulun taidekoulu on dramatisoinut romaanin.\\nVuosina 1997–2002 Tuominen toimi Hämeen Hämeen taidetoimikunnan kirjallisuuden läänintaiteilijana. Tuominen on toiminut myös Hämeen taidetoimikunnan jäsenenä ja pääsihteerinä sekä Lukukeskuksen vt. toiminnanjohtajana Nykyisin Taija Tuominen toimii Suomen Kulttuurirahaston Hämeen rahaston asiamiehenä."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A8%BA%E5%A4%AA%E3%81%AE%E6%88%A6%E3%81%84_(1945%E5%B9%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Military_Training_for_Policemen_in_Karafuto.JPG","page_title":"樺太の戦い (1945年)","context_page_description":"樺太の戦いは、太平洋戦争末期の1945年8月11日から8月25日にかけ、日本の内地であった樺太南部で、日本とソビエト連邦の間で行われた戦闘である。\\n1945年8月9日に対日参戦したソ連は、8月11日に南樺太の占領作戦を開始した。その目的は南樺太の獲得と、次に予定された北海道侵攻の拠点確保だった。ソ連軍は北樺太から陸上侵攻する歩兵師団・歩兵旅団・戦車旅団各1個が攻撃の中心で、補助攻勢として北太平洋艦隊と歩兵旅団1個による上陸作戦が実施された。日本軍は、歩兵師団1個を中心に応戦し、国境地帯ではソ連軍の拘束に成功した。\\n8月15日に日本のポツダム宣言受諾が布告されて、太平洋戦争は停戦に向かったが、樺太を含めてソ連軍の侵攻は止まらず、自衛戦闘を命じられた日本軍との戦闘が続いた。樺太での停戦は8月19日以降に徐々に進んだものの、ソ連軍の上陸作戦による戦線拡大もあった。8月23日頃までに日本軍の主要部隊との停戦が成立し、8月25日の大泊占領をもって樺太の戦いは終わった。\\n当時、南樺太には40万人以上の日本の民間人が居住しており、ソ連軍侵攻後に北海道方面への緊急疎開が行われた。自力脱出者を含めて10万人が島外避難に成功したが、緊急疎開船3隻がソ連軍に攻撃されて約1,700名が死亡した。陸上でもソ連軍の無差別攻撃がしばしば行われ、約2,000人の民間人が死亡した。"},{"page_url":"https://en.wikipedia.org/wiki/Dovercourt_(provincial_electoral_district)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/1934TorontoRidings.jpg","page_title":"Dovercourt (provincial electoral district)","context_page_description":"Dovercourt was the name of a provincial riding in Ontario, Canada. It existed from the 1926 election to the 1999 election. When it was established, it bordered Brockton on to the west, York South to the north, and Bracondale on the east. Lake Ontario was its southern border for most of its existence. At its abolition in 1999, it consisted of that part of the city of Toronto bounded on the north by the former city limits, on the east by Bathurst Street, on the south by Bloor Street and on the west by the CN Railway and St. Clair Avenue. It was redistributed into Davenport, St. Paul's and Trinity—Spadina ridings."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%BA%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Volkonsky_mausoleum.JPG","page_title":"Волконский, Дмитрий Михайлович","context_page_description":"Князь Дми́трий Миха́йлович Волко́нский — российский командир эпохи наполеоновских войн, генерал-лейтенант."},{"page_url":"https://pl.wikipedia.org/wiki/Blurton","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/St._Bartholomew%2C_Blurton_-_geograph.org.uk_-_534622.jpg","page_title":"Blurton","context_page_description":"Blurton – dzielnica w Anglii, w hrabstwie ceremonialnym Staffordshire, w dystrykcie Stoke-on-Trent. Leży 20 km na północ od miasta Stafford i 215 km na północny zachód od Londynu."},{"page_url":"https://eu.wikipedia.org/wiki/Villanueva_de_la_Condesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Villanueva_de_la_Condesa.jpg","page_title":"Villanueva de la Condesa","context_page_description":"Villanueva de la Condesa Valladolideko udalerria da, Tierra de Campos eskualdean dagoena.\\n2009ko urtarrilaren 1eko erroldaren arabera 76 biztanle zituen."},{"page_url":"https://ca.wikipedia.org/wiki/Jacob_Christoph_Le_Blon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/LeBlon_Fleury_1738.jpg","page_title":"Jacob Christoph Le Blon","context_page_description":"Jacob Christoph Le Blon va ser un pintor i gravador de Frankfurt que va inventar el sistema d'impressió en tres i quatre colors, utilitzant el model de color RYBK, similar al modern sistema CMYK. Va utilitzar el mètode mezzotint per gravar tres o quatre plats metàl·lics per fer impressions amb una àmplia gamma de colors. Els seus mètodes van ajudar a formar la base per a la impressió en color moderna."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D0%BD%D0%B2%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Invar_800.jpg","page_title":"Инвар","context_page_description":"Инвар е феромагнитна сплав на желязо с 36% никел. Има много малък коефициент на топлинно разширение при температура от -80 до 100 °С. Създадена е през 1896 г. от швейцарския учен Шарл Едуар Гийом, за което той получава Нобелова награда за физика през 1920 г. Инвар намира приложение при изработването на физически уреди, измервателни инструменти и др.\\nС подобни свойства са суперинварът и неръждясващият Инвар."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%83%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Hevosia_Turun_saaristossa.jpg","page_title":"ウマ","context_page_description":"ウマは、ウマ目のウマ科のノウマの亜種である。\\n社会性の強い動物で、野生のものも家畜も群れをなす傾向がある。北アメリカ大陸原産とされるが、北米の野生種は、数千年前に絶滅している。欧州南東部にいたターパンが家畜化したという説もある。古くから中央アジア、中東、北アフリカなどで家畜として飼われた歴史がある。\\n運搬用、農耕、乗用、軍用、競技用などに使われるほか、食用にもされる。\\n学名は Equus caballus。equus も caballus ともにラテン語で「馬」の意。"},{"page_url":"https://sv.wikipedia.org/wiki/Carinariidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bonite-mollusques-pl22.jpg","page_title":"Carinariidae","context_page_description":"Carinariidae är en familj av snäckor. Carinariidae ingår i ordningen Neotaenioglossa, klassen snäckor, fylumet blötdjur och riket djur. Enligt Catalogue of Life omfattar familjen Carinariidae 6 arter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://af.wikipedia.org/wiki/Pieter_Wenning","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Pieter_Wenning_Buddha_with_two_vases.jpeg","page_title":"Pieter Wenning","context_page_description":"Pieter Willem Frederik Wenning was 'n Suid-Afrikaanse kunstenaar en die vader van die Kaapse Impressionisme.\\nHy is in Nederland gebore en was weens gesondheidsredes op jeugdige ouderdom na Suid-Afrika gebring. Hy het eers by J.H. de Bussy se boekhandel gewerk. Hy begin skilder en sy talent kom onder die aandag van D.C. Boonzaier. Dié oorreed hom om na die Kaap te verhuis. Hy was arm en sy gesondheid swak en het sy skilderye goedkoop verkoop. Sy werk, hoewel onder die invloed van Impressioniste, is as heeltemal oorspronklik beskou. Hy is in Pretoria oorlede."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%AD%D0%B4%D0%B8%D1%81%D0%BE%D0%BD_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81_%D0%90%D0%BB%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/DMM_18326_Edison-Dynamomaschine.jpg","page_title":"Эдисон Томас Алва","context_page_description":"То́мас А́лва Э́дисон — бар донъяға билдәле Америка уйлап табыусыһы һәм эшҡыуары.\\nЭдисон АҠШ-та 1093 һәм башҡа илдәрҙә 3 меңгә яҡын патент алған. Ул телеграфты, телефонды, киноаппаратураны камиллаштырған, электр ҡыҙҙырма лампаһының табышлы төрөн уйлап сығарған, фонограф уйлап сығарған. Тап ул телефондан һөйләшә башлағанда «алло» һүҙен ҡулланырға тәҡдим итә..\\n1928 йылда АҠШ-тың юғары бүләге АҠШ Конгресының алтын миҙалына лайыҡ була. 1930 йылда СССР Фа-ның сит ил Почетлы гражданы тип таныла."},{"page_url":"https://hu.wikipedia.org/wiki/R%C3%B3zsa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Rosa_sp.75_%27Climbing_Schneewittchen%27.jpg","page_title":"Rózsa","context_page_description":"A rózsa, a rózsafélék családjába tartozó egyik növénynemzetség, illetve az ide tartozó cserjék virága.\\nKb. 200 rózsafajt tart számon a tudomány, ezeknek a többsége az északi félgömbre, főleg a mérsékelt égövre jellemző növény, néhány faj Mexikóban, a Fülöp-szigeteken és Etiópiában honos. A botanikai fajok hajtásai tüskések, szőrösek vagy ritkán kopaszak; cserje vagy kúszónövény alkatúak. Magasságuk a 2–5 m, a kúszó fajoké 20 m is lehet.\\nFajaik nagyon változékonyak, könnyen kereszteződnek egymással, ami nagyon megnehezíti elkülönítésüket.\\nA név a latin rosa főnévből eredeztethető, amelyet az ógörög nyelv hagyatékait is őrző oszk nyelvből kölcsönzött, ezen kívül a szó gyökerei lelhetők fel az arámi, az asszír wurtinnu, az óiráni *warda nyelvben."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B2%A0%ED%8A%B8%EB%82%A8%EC%9D%98_%EC%A3%BC%EC%84%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Mrs._Dang_Thi_Ngoc_Thinh.jpg","page_title":"베트남의 주석","context_page_description":"베트남 사회주의 공화국 주석 은 베트남 사회주의 공화국의 국가 원수이다. 약칭은 국가주석 이다.\\n국회의원중에서 국회가 선출한다. 임기는 5년 중임제이다. 덧붙여 임기만료 후도 국회가 차기 국가주석을 선출할 때까지 그 직무를 수행한다.\\n국가주석이 장기간에 걸쳐 직무 수행 불능 시에는 국가부주석이 국가주석의 직무를 대행한다. 국가 주석이 임기 도중에 사망할 경우에 국회가 새로운 국가주석을 선출할 때까지 국가부주석이 국가주석대행이 된다."},{"page_url":"https://en.wikipedia.org/wiki/Statue_of_Joseph_Stalin,_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Bundesarchiv_Bild_183-20145-0015%2C_Berlin%2C_Bau_Karl-Marx-Allee%2C_Strausberger_Platz.jpg","page_title":"Statue of Joseph Stalin, Berlin","context_page_description":"The Berlin Stalin statue was a bronze portrayal of the Soviet leader Joseph Stalin. A Komsomol delegation had presented the sculpture to the East Berlin government on the occasion of the Third World Festival of Youth and Students in 1951. The monument was formally dedicated on 3 August 1951 after temporarily placement at a location on a newly designed and impressive boulevard, Stalinallee, being constructed at the time in what was then the Berlin district of Friedrichshain. Stalin monuments were generally removed from public view by the leadership of the Soviet Union and other associated countries, including East Germany, during the period of De-Stalinization. In Berlin the statue and all street signs designating Stalinallee were hastily removed one night in a clandestine operation and the street was renamed Karl-Marx-Allee and Frankfurter Allee. The bronze sculpture was smashed and the pieces were recycled."},{"page_url":"https://en.wikipedia.org/wiki/Thereus_lomalarga","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Thereus_lomalarga_male.jpg","page_title":"Thereus lomalarga","context_page_description":"Thereus lomalarga is a species of butterfly of the family Lycaenidae. It is found from Costa Rica to the western slope of the Andes in Ecuador. It occurs in the great variety of forested habitats.\\nThe larvae feed on Oryctanthus alveolatus."},{"page_url":"https://es.wikipedia.org/wiki/Expedici%C3%B3n_Polaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/The_Polaris_and_Congress_at_Godhaven%2C_Disco_Island.jpg","page_title":"Expedición Polaris","context_page_description":"La Expedición Polaris fue dirigida por el estadounidense Charles Francis Hall, su objetivo era alcanzar el Polo Norte siendo así los primeros en lograrlo. Fue patrocinada por el gobierno de los Estados Unidos, y se trató de uno de los primeros intentos serios por llegar al Polo, tras el logro de un oficial naval británico, William Edward Parry, que alcanzó en 1827 la latitud 82°45'Norte. La expedición fracasó en su objetivo principal al haber tenido graves problemas de insubordinación, incompetencia y de falta de liderazgo durante todo el viaje.\\nBajo el mando de Hall, el Polaris zarpó de Nueva York en junio de 1871. En octubre, los miembros de la expedición se detuvieron para pasar el invierno en la costa del norte de Groenlandia, haciendo los preparativos para el viaje al Polo. Hall, tras volver al Polaris de un viaje en trineo, enfermó. Antes de morir acusó a los miembros de la tripulación de haberle envenenado. La autopsia realizada tras exhumar su cuerpo en 1968 reveló que había ingerido una gran cantidad de arsénico en las dos últimas semanas de su vida."},{"page_url":"https://ms.wikipedia.org/wiki/Bangunan_Empire_State","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/NYC_Empire_State_Building.jpg","page_title":"Bangunan Empire State","context_page_description":"Bangunan Empire State adalah bangunan pencakar langit setinggi 381 meter atau 1,250 kaki dan mempunyai 102 tingkat di bandar raya New York. Nama bangunan ini diambil dari nama gelaran New York. Bangunan ini pernah menjadi bangunan tertinggi di dunia dan di New York selama hampir empat tahun sejak 1931 mengalahkan Bangunan Chrysler hingga 1974 setelah dikalahkan oleh Menara Sears di Chicago. Semenjak keruntuhan Menara Berkembar World Trade Center pada serangan 11 September 2001, bangunan ini kembali menjadi bangunan tertinggi di New York. Kini, bangunan ini adalah bangunan ketiga tertinggi di Amerika Syarikat, di belakang Menara Sears dan One World Trade Center."},{"page_url":"https://pl.wikipedia.org/wiki/Szawkoty","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/BZN_Saukotas_church_front_1.JPG","page_title":"Szawkoty","context_page_description":"Szawkoty - miasteczko na Litwie, położone w okręgu szawelskim w rejonie radziwiliskim, 12 km na południe od Szawlan, 583 mieszkańców. Siedziba starostwa Szawkoty.\\nZnajduje się tu kościół, szkoła, poczta i biblioteka. Kościół drewniany wybudowany z fundacji Szymona Herubowicza w 1733 roku, przebudowany w 1863. W kościele znajdują się trzy iluzjonistyczne malowane ołtarze i barokowe organy, przy kościele drewniana dzwonnica z XVIII wieku i spichlerz plebański.\\nOd 2004 roku miasteczko posiada własny herb."},{"page_url":"https://cy.wikipedia.org/wiki/Gwyfyn_y_cadno","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Chenille_chevrefeuille.jpg","page_title":"Gwyfyn y cadno","context_page_description":"Gwyfyn sy'n perthyn i urdd y Lepidoptera yw gwyfyn y cadno, sy'n enw gwrywaidd; yr enw lluosog ydy gwyfynod y cadno; yr enw Saesneg yw Fox Moth, a'r enw gwyddonol yw Macrothylacia rubi. Gellir canfod gwyfyn y lliflys yng ngorllewin Ewrop a chanol Asia.\\n40–65 m ydy lled adenydd yr oedolyn ac mae nhw'n hedfan rhwng Mai a Gorffennaf."},{"page_url":"https://et.wikipedia.org/wiki/Loodi_m%C3%B5isa_kalmistu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Loodi_m%C3%B5isa_kalmistu_02.JPG","page_title":"Loodi mõisa kalmistu","context_page_description":"Loodi mõisa kalmistu on kalmistu Paistu kihelkonnas Viljandimaal, tänapäevase haldusjaotuse järgi Loodi külas Viljandi vallas Viljandi maakonnas."},{"page_url":"https://cs.wikipedia.org/wiki/Bo%C5%BEejov_(%C5%BD%C3%A1r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Bozejov7.jpg","page_title":"Božejov (Žár)","context_page_description":"Božejov je malá vesnice, část obce Žár v okrese České Budějovice. Nachází se asi 1,5 km na jih od Žáru. V současnosti je zde evidováno 24 adres. V roce 2011 zde trvale žilo 13 obyvatel.\\nBožejov leží v katastrálním území Božejov u Nových Hradů o rozloze 3,52 km². V tomto katastrálním území se nachází i poutní místo Hasenbrunn na východním svahu Kamenské hory"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8B%9C%EA%B2%8C_%EC%87%BC%EA%B3%A0%EB%A1%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Shige_Shogoro-from_Kenchiku_Zasshi27-317%281913-5%29.jpg","page_title":"시게 쇼고로","context_page_description":"시게 쇼고로는 메이지 시대의 간사이에서 활약한 일본의 건축가이다. 간사이의 건축설계사무소를 설립하였고, 공장 건축을 많이 다룬 것으로 알려졌다."},{"page_url":"https://it.wikipedia.org/wiki/Maria_(nome)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Disderi%2C_Adolphe_Eug%C3%A8ne_%281810-1890%29_-_Alboni%2C_Marietta_%281826-1894%29%2C_contralto_2.jpg","page_title":"Maria (nome)","context_page_description":"Maria è un nome proprio di persona italiano femminile."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pers%C3%B6nlichkeiten_aus_Brooklyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Lorraine_Bracco.jpg","page_title":"Liste von Persönlichkeiten aus Brooklyn","context_page_description":"Diese Liste enthält Persönlichkeiten, die in Brooklyn geboren wurden. Brooklyn ist seit 1898 ein Stadtbezirk von New York City."},{"page_url":"https://vi.wikipedia.org/wiki/Mecistogaster_amalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Mecistogaster_amalia_%28Burmeister%29_%2810981543553%29.jpg","page_title":"Mecistogaster amalia","context_page_description":"Mecistogaster amalia là một loài chuồn chuồn kim thuộc họ Pseudostigmatidae. Đây là loài đặc hữu của Brasil. Môi trường sống tự nhiên của chúng là rừng ẩm vùng đất thấp nhiệt đới hoặc cận nhiệt đới. Chúng hiện đang bị đe dọa vì mất môi trường sống."},{"page_url":"https://nn.wikipedia.org/wiki/Tingvollfjorden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Tingvollfjorden2-Norway.jpg","page_title":"Tingvollfjorden","context_page_description":"Tingvollfjorden er ein fjord i Tingvoll, Gjemnes og Nesset kommune på Nordmøre og i Romsdal. Fjorden strekkjer seg 35 km søraustover til Sunndalsfjorden, og til botn av Sunndalsfjorden er lengda 52 km.\\nFjorden har innløp mellom Bergsøysundet, som ligg mellom Bergsøya og Aspøya i nord, og Vorpskjeret ved Ranem i sør. Vest for innløpet går Bergsøyfjorden inn til Batnfjorden. På nordsida av Bergsøysundet ligg Freifjorden. Riksveg 70 går langs fjorden over desse øyane og innover fjorden på austsida. Det er fleire mindre grender langs fjorden som Bogsaspa på Aspøya, Eikrem, Gyl og Bergem på austsida og Hoem, Flemma, Angvika, Raudsand og Eidsøra på vestsida. Tvers over fjorden for Angvika ligg Tingvollvågen og tettstaden og kommunesenteret Tingvoll.\\nVed kommunegrensa til Sunndal endrar fjorden namn til Sunndalsfjorden.\\nRiksveg 62 går på vestsida av fjorden frå Sunndalsfjorden til Eidsøra. Frå her går riksveg 666 vidare nordover og etter Kvalvåg på sørsida av fjorden."},{"page_url":"https://vi.wikipedia.org/wiki/Phalaenopsis_deliciosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Phalaenopsis_deliciosa_Orchi_2012-09-14_005.jpg","page_title":"Phalaenopsis deliciosa","context_page_description":"Phalaenopsis deliciosa là một loài lan có mặt từ tiểu lục địa Ấn Độ cho đến Malesia."},{"page_url":"https://es.wikipedia.org/wiki/L%C3%ADnea_de_bajo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Latin_bass_line.jpg","page_title":"Línea de bajo","context_page_description":"Una línea de bajo es la sucesión de las notas más graves de un pasaje o composición. Cumple una función de soporte al resto de los elementos y establece la base de la progresión armónica.​ En la música popular la línea de bajo suele ser ejecutada por el bajo eléctrico o el contrabajo, pero otros instrumentos como la tuba, el trombón o el órgano entre otros, pueden cumplir la misma tarea.​"},{"page_url":"https://en.wikipedia.org/wiki/Thiersheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Thiersheim_-_Kriegerdenkmal_-_01.jpg","page_title":"Thiersheim","context_page_description":"Thiersheim is a municipality in the district of Wunsiedel in Bavaria in Germany.\\nGrafenreuth, now a part of Thiersheim, was the seat of the noble family Gravenreuth for centuries."},{"page_url":"https://de.wikipedia.org/wiki/Staatsbauschule_M%C3%BCnchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/M%C3%BCnchen_Karlstra%C3%9Fe_4_S%C3%BCdwest_q.JPG","page_title":"Staatsbauschule München","context_page_description":"Die Staatsbauschule München war eine praxisorientierte Studieneinrichtung in München."},{"page_url":"https://ca.wikipedia.org/wiki/Unitat_auxiliar_de_pot%C3%A8ncia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/APIC-APU-for-A320-family.jpg","page_title":"Unitat auxiliar de potència","context_page_description":"Una unitat auxiliar de potència és una unitat auxiliar que serveix per produir energia a bord dels avions per alimentar els diferents sistemes de bord a terra quan els motors principals estan aturats per estalviar combustible, així com per arrancar els motors. Es pot utilitzar també durant el vol. Els APU generalment es troben al darrere de l'avió, al con de cua, i funcionen amb querosè dels dipòsits de l'avió.\\nEn cas de fallada de l'APU, a terra es poden fer servir grups i un grup d'arrancada amb aire anomenat ASU.\\nGairebé tots els avions de reacció disposen d'una APU, a part d'algunes turbohèlices i certs avions de negocis."},{"page_url":"https://ceb.wikipedia.org/wiki/Vidua_purpurascens","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Male_Purple_Indigobird_%28Vidua_purpurascens%29.jpg","page_title":"Vidua purpurascens","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Reichenow ni adtong 1883 ang Vidua purpurascens. Ang Vidua purpurascens sakop sa kahenera nga Vidua sa kabanay nga Viduidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%8C%E4%BA%80%E5%B1%B1%E5%A4%A9%E7%9A%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Emperor_Go-Kameyama.jpg","page_title":"後亀山天皇","context_page_description":"後亀山天皇は、日本の第99代天皇および南朝第4代天皇。諱は熙成。\\n北朝を擁護する将軍足利義満が提示した講和条件を受諾して、三種の神器を北朝・後小松天皇に伝えて譲位し、南北朝合一を実現した。\\n1911年に南朝が正統とされたため、歴代天皇として公認されるようになった。"},{"page_url":"https://pt.wikipedia.org/wiki/Jing-Jin-Ji","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Farviewshijiazhuang.jpg","page_title":"Jing-Jin-Ji","context_page_description":"A chamada Região Metropolitana de Jingjinji ou Jing-Jin-Ji, também Beijing-Tianjin-Hebei, anteriormente \\"Zona Econômica Capital\\", é a região da capital nacional da República Popular da China. É a maior região megalópole urbanizada do norte da China. Refere-se a uma região econômica que compreende os municípios de Pequim e Tianjin, ao longo da costa do Mar de Bohai. A região está sendo construída como uma zona metropolitana ao norte que rivaliza com a região do Delta do Rio das Pérolas no sul e do Delta do Rio Yangtzé ao leste. Em 2016, Jing-Jin-Ji tinha uma população total de 112 milhões de habitantes, sendo tão populosa quanto a província de Cantão."},{"page_url":"https://es.wikipedia.org/wiki/Nicosia_del_Norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Rock_n_Cyprus_north_nicosia_2014.jpg","page_title":"Nicosia del Norte","context_page_description":"Nicosia del Norte​​ ​ o norte de Nicosia es la capital y ciudad más grande del estado de facto de la República Turca del Norte de Chipre. Es la parte norte de la ciudad dividida de Nicosia y se rige por el municipio metropolitano turcochipriota de Lefkoşa. A partir de 2011, Nicosia del norte tenía una población de 61.378 y un área metropolitana con una población de 82.539.\\nA raíz de la violencia entre comunidades de la década de 1960, la capital de la República de Chipre se dividió entre grecochipriotas y turcochipriotas; comunidades en el sur y norte, respectivamente, en 1963. Un golpe por la junta militar griega en un intento para unir la isla con Grecia en 1974 condujo a la invasión turca de Chipre, y la comunidad internacional considera a Nicosia del Norte bajo la ocupación turca desde entonces.\\nLa ciudad es el centro económico, político y cultural de la República del Norte de Chipre, con muchas tiendas, restaurantes y centros comerciales. Es el hogar de una ciudad histórica fortificada, centrada en la Plaza Atatürk, y un área metropolitana moderna, con la Avenida Mehmet Akif, la región en su centro de negocios y entretenimiento."},{"page_url":"https://it.wikipedia.org/wiki/Duomo_di_Monreale","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Monreale_BW_2012-10-09_10-27-49.jpg","page_title":"Duomo di Monreale","context_page_description":"La cattedrale di Santa Maria Nuova è il principale luogo di culto cattolico di Monreale, nella città metropolitana di Palermo, sede arcivescovile dell'arcidiocesi omonima.\\nCostruita a partire dal 1174 per volere di Guglielmo II d'Altavilla, re di Sicilia dal 1166 al 1189, è famosa per i ricchi mosaici bizantini che ne decorano l'interno. Nell'agosto del 1926 papa Pio XI l'ha elevata alla dignità di basilica minore. Dal 3 luglio 2015 fa parte del Patrimonio dell'umanità nell'ambito dell'Itinerario arabo-normanno di Palermo, Cefalù e Monreale."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8A%97%E6%88%B0%E8%BB%8D%E4%BA%BA%E5%BF%A0%E7%83%88%E9%8C%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/%E5%94%90%E8%81%9A%E4%BA%94.jpg","page_title":"抗戰軍人忠烈錄","context_page_description":"抗戰軍人忠烈錄，中華民國國防部史政局編，曾國傑編輯，戰史叢刊第十二種，民國37年3月出版。此書內容主要是介紹抗戰中壯烈成仁的烈士的事蹟。"},{"page_url":"https://sl.wikipedia.org/wiki/Rebek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Rebac.jpg","page_title":"Rebek","context_page_description":"Rebek eno najstarejših godal. Nastal je v 10. stoletju, prišel pa je iz Srednjega vzhoda. Še dandanes ga najdemo v arabskih deželah in drugod po svetu."},{"page_url":"https://oc.wikipedia.org/wiki/Stryker","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Stryker_FSV_front_q.jpg","page_title":"Stryker","context_page_description":"L'IAV Stryker es un veïcul de combat d'infantariá estatsunidenc desvolopat per leis Estats Units d'America a la fin dau sègle XX e intrat en servici en 2002. S'inspira dau LAV III, veïcul canadenc. Dirigit per un equipatge de dos òmes, pòu transportar fins a 9 combatents equipats segon lei versions e pòu recebre d'armaments variats. De mai, es estat concebut coma una generacion novèla d'equipaments connectats militarament entre elei.\\nParticipèt a la Segonda Guèrra d'Iraq onte sei performàncias recebèron d'avejaires mitigats. Certanei soudats an presat lo veïcul, especialament en zònas urbanas. Pasmens, sa manca de blindatge en fàcia deis armaments anticarris utilizats per lei guerilhas iraquianas a necessitat d'adaptacions malaisadas per melhorar sa proteccion."},{"page_url":"https://de.wikipedia.org/wiki/Kreis_G%C3%BCtersloh","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Kreis_G%C3%BCtersloh_-_nature_reserves.png","page_title":"Kreis Gütersloh","context_page_description":"Der Kreis Gütersloh ist eine Gebietskörperschaft mit 364.938 Einwohnern im Regierungsbezirk Detmold im Nordosten des Landes Nordrhein-Westfalen. Der Kreis weist die höchste Einwohnerzahl im Regierungsbezirk Detmold auf. Kreisstadt ist Gütersloh."},{"page_url":"https://pt.wikipedia.org/wiki/Mosteiro_de_Santo_Domingo_de_Silos","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Santo_Domingo_de_Silos_Monasterio_2114.jpg","page_title":"Mosteiro de Santo Domingo de Silos","context_page_description":"O Mosteiro de Santo Domingo de Silos é uma abadia beneditina localizada no município de Santo Domingo de Silos, na província de Burgos. Seu claustro é uma das obras-primas do românico espanhol.\\nO mosteiro, ainda que não em sua atual configuração, remonta à época visigótica, no século VII. No século X, chamado ainda de San Sebastián de Silos, e em especial durante o período em que o conde Fernão Gonçalves governou Castela, de 930 a 970, a comunidade monástica voltou a ressurgir, alcançando uma pujante atividade, para novamente decair nos anos seguintes.\\nEm 1002, o mosteiro se encontrava arruinado e maltratado.\\nEm 1041, São Domingo de Silos, o prior do mosteiro de San Millán de la Cogolla, se refugiou em Castela, fugindo do rei de Navarra, e foi bem recebido pelo monarca castelano Fernando I, que lhe confiou a missão de restabelecer o antigo esplendor do mosteiro. Foi nomeado abade de Silos e, em trinta e dois anos, ajuda a levantar os edifícios do mosteiro. São Domingo de Silos morreu em 20 de dezembro de 1073 e foi canonizado em 1076. Sua tumba, em Silos, imediatamente vira centro de peregrinação."},{"page_url":"https://en.wikipedia.org/wiki/Pothigai","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Courtallam.jpg","page_title":"Pothigai","context_page_description":"The Pothigai Hills, also known as the Shiva Jothi Parvath, Agasthiyar Mountain, Southern Kailash is a 1,866-metre-tall peak within Kalakkad Mundanthurai Tiger Reserve, Tamil Nadu is in the southern part of the Western Ghats of South India. However, peak lies in the border of Kerala and Tamil Nadu. Ancient tradition holds the mountains of Pothigai to be where the sage Agastya provided the first grammar for the Tamil language. This grammar was further fine-tuned by one of his disciples in the Tolkāppiyam.\\nThe area contains several important natural habitats for in-situ conservation of biological diversity, including forests containing threatened species of significant value to science and conservation."},{"page_url":"https://war.wikipedia.org/wiki/Pyronia_bathseba","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Pyronia_bathseba_MHNT_CUT_2013_3_32_Muret_female_ventral.jpg","page_title":"Pyronia bathseba","context_page_description":"An Pyronia bathseba in uska species han Lepidoptera nga ginhulagway ni Fabricius hadton 1793. An Pyronia bathseba in nahilalakip ha genus nga Pyronia, ngan familia nga Nymphalidae. Waray hini subspecies nga nakalista."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Ho%C5%99ic%C3%ADch_na_%C5%A0umav%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/H%C3%B6ritz-Pranger.jpg","page_title":"Seznam kulturních památek v Hořicích na Šumavě","context_page_description":"Tento seznam nemovitých kulturních památek v obci Hořice na Šumavě v okrese Český Krumlov vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Landschaftsschutzgebiete_in_Oberbayern","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Waldfriedhof_Neuer_Teil_GO12.jpg","page_title":"Liste der Landschaftsschutzgebiete in Oberbayern","context_page_description":"Die Liste der Landschaftsschutzgebiete in Oberbayern bindet folgende Listen der Landschaftsschutzgebiete in oberbayerischen Landkreisen und Städten aus dem Artikelnamensraum ein:"},{"page_url":"https://simple.wikipedia.org/wiki/Galgenen","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Galgenen_148.JPG","page_title":"Galgenen","context_page_description":"Galgenen is a municipality in March District in the canton of Schwyz in Switzerland."},{"page_url":"https://es.wikipedia.org/wiki/Anastasia_de_Kiev","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Orlai-salamon.jpg","page_title":"Anastasia de Kiev","context_page_description":"Anastasia de Kiev Reina Consorte de Hungría, esposa del rey Andrés I de Hungría."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9E%D0%B4%D0%B0%D0%B4%D0%B6%D1%8F%D0%BD_%D0%A8%D0%B0%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/System_Of_A_Down_%40_Claremont_Showgrounds_%285_3_2012%29_%286859500592%29.jpg","page_title":"Одаджян Шаво","context_page_description":"Шаво Одаджян — әрмән сығышлы Америка музыканты, System of a Down Америка рок, шулай уҡ Achozen хип-хоп төркөмөнөң бас-гитарала уйнаусыһы."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%94%E1%83%92%E1%83%A3%E1%83%A0%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Tokyo_Route_317_-01.jpg","page_title":"მეგურო","context_page_description":"მეგურო — რაიონი ტოკიოს 23 სპეციალური რაიონთაგან. შედის ტოკიოს პრეფექტურაში. კანტოს რეგიონში.\\n2008 წლის აღწერის მონაცემებით, მოსახლეობა 261 033 ადამიანს შეადგენდა. სიმჭიდროვე 17 757 კაცი/კმ².\\nფართობი 14,70 კმ²."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CF%81%CF%87%CE%B1%CE%AF%CE%BF_%CE%B8%CE%AD%CE%B1%CF%84%CF%81%CE%BF_%CE%95%CF%80%CE%B9%CE%B4%CE%B1%CF%8D%CF%81%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Epidaurus_Theater.jpg","page_title":"Αρχαίο θέατρο Επιδαύρου","context_page_description":"Το αρχαίο θέατρο της Επιδαύρου βρίσκεται στο νοτιοανατολικό άκρο του ιερού που ήταν αφιερωμένο στον θεραπευτή θεό της αρχαιότητας, τον Ασκληπιό, στο Ασκληπιείο Επιδαύρου. Είναι χτισμένο στη δυτική πλαγιά του Κυνόρτιου όρους. Βρίσκεται κοντά στο σημερινό Λυγουριό της Αργολίδας και ανήκει στον Δήμο Επιδαύρου.Θεωρείται το τελειότερο αρχαίο ελληνικό θέατρο από άποψη ακουστικής και αισθητικής."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%82%98%EC%9D%B4%EC%96%BC_%EB%A7%A4%ED%84%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Niall_Matter_2013_Leo_Awards_%28cropped%29.jpg","page_title":"나이얼 매터","context_page_description":"나이얼 매터는 캐나다의 배우이다."},{"page_url":"https://ro.wikipedia.org/wiki/Steinbrunn-le-Bas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Steinbrunn-le-Bas%2C_Mairie.jpg","page_title":"Steinbrunn-le-Bas","context_page_description":"Steinbrunn-le-Bas este o comună în departamentul Haut-Rhin din estul Franței. În 2009 avea o populație de 632 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Religion_in_Egypt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Assouan_cathedrale_copte.jpg","page_title":"Religion in Egypt","context_page_description":"Religion in Egypt controls many aspects of social life and is endorsed by law. The state religion of Egypt is Islam. Although estimates vary greatly in the absence of official statistics. Since the 2006 census religion has been excluded, and thus available statistics are estimates made by religious and non-governmental agencies. The country is majority Sunni Muslim, with the next largest religious group being Coptic Christians. The exact numbers are subject to controversy, with Christians alleging that they have been systemically under-counted in existing censuses.\\nEgypt hosts two major religious institutions. Al-Azhar Mosque, founded in AD 970 by the Fatimids as the first Islamic university in Egypt and the Coptic Orthodox Church of Alexandria established in the middle of the 1st century by Saint Mark.\\nIn Egypt, Muslims and Christians share a common history, national identity, ethnicity, race, culture, and language."},{"page_url":"https://en.wikipedia.org/wiki/Bristol_Boxkite","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Zodiac-Olympia.jpg","page_title":"Bristol Boxkite","context_page_description":"The Boxkite was the first aircraft produced by the British and Colonial Aeroplane Company. A pusher biplane based on the successful Farman III, it was one of the first aircraft types to be built in quantity. As the type was used by Bristol for instruction purposes at their flying schools at Larkhill and Brooklands many early British aviators learned to fly in a Boxkite. Four were purchased in 1911 by the War Office and examples were sold to Russia and Australia. It continued to be used for training purposes until after the outbreak of the First World War."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_St._Johann_(Saar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Campus_Geb.A5.4.jpg","page_title":"Liste der Baudenkmäler in St. Johann (Saar)","context_page_description":"In der Liste der Baudenkmäler in Sankt Johann (Saar) sind alle Baudenkmäler des Saarbrücker Ortsteils St. Johann aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste vom 16. Februar 2011 und die aktuelle Teildenkmalliste der Landeshauptstadt Saarbrücken in der Fassung vom 9. August 2017."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_oktober_2017","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Danielle_Darrieux_Five_Fingers_2.jpg","page_title":"Lijst van personen overleden in oktober 2017","context_page_description":"Dit is een lijst van bekende personen die zijn overleden in oktober 2017."},{"page_url":"https://en.wikipedia.org/wiki/Willy_Marckwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Vorlesungsank%C3%BCndigung_11101899_Marckwald.jpg","page_title":"Willy Marckwald","context_page_description":"Willy Marckwald was a German chemist. He was nominated for the Nobel Prize in Chemistry in 1922 by Gustav Tammann and again in 1929 by Niels Bohr, Dirk Coster and George de Hevesy."},{"page_url":"https://da.wikipedia.org/wiki/Hornemansgade","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Hornemansgade_03.jpg","page_title":"Hornemansgade","context_page_description":"Hornemansgade er en gade Strandvejskvarteret på Østerbro i København. Den knap 250 meter lange gade går først et kort stykke fra Østerbrogade, før den drejer 90 grader ved Kong Oscars Gade og krydser efterfølgende Kildevældsgade for senere at ende i et skævt kryds med Edvard Griegs Gade og Sibeliusgade."},{"page_url":"https://pt.wikipedia.org/wiki/La_Jolla","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/090207-LaJollaCove.jpg","page_title":"La Jolla","context_page_description":"La Jolla é uma estância balneária localizada na cidade californiana de San Diego, Estados Unidos. Atualmente conta com aproximadamente 43 mil residentes."},{"page_url":"https://es.wikipedia.org/wiki/Els_Orriols","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Monasterio_de_San_Miguel_de_los_Reyes..jpg","page_title":"Els Orriols","context_page_description":"Els Orriols es un barrio de la ciudad de Valencia, perteneciente al distrito de Rascaña. Está situado al norte de la ciudad y limita al norte con Pueblo Nuevo, al este con Sant Llorenç, al sur con Sant Antoni y al oeste con Torrefiel. Fue un municipio independiente hasta 1882, en que fue anexionado a la ciudad de Valencia.​ Su población en 2009 era de 18.009 habitantes.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D1%8F_(%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Berlin_view_from_Park_Inn_01.jpg","page_title":"Церковь Благословения (Берлин)","context_page_description":"Церковь Благослове́ния, расположенная на Шёнхаузер-аллее в районе Пренцлауэр-Берг и входящая в пробство центрального Берлина, относится к охраняемым государством архитектурным памятникам Берлина.\\nНачиная с 2007 года, церковная община включилась в совместный проект с «Communauté Don Camillo» из швейцарской коммуны Ла-Тен, где с 1977 года практикуется монастырский образ жизни.\\nВ настоящее время церковь Благословения преобразована в городской монастырь Благословения."},{"page_url":"https://eu.wikipedia.org/wiki/Kr%C5%88any","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Kr%C5%88any%2C_vlajka.jpeg","page_title":"Krňany","context_page_description":"Krňany Txekiar Errepublikako udalerri bat da. 429 biztanle ditu eta 12,24 kilometro koadroko azalera. Benešoveko barrutian dago."},{"page_url":"https://ca.wikipedia.org/wiki/Hist%C3%B2ria_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Con%C3%ADmbriga_cavaleiros.jpg","page_title":"Història de Portugal","context_page_description":"La història de Portugal com a nació europea remunta a la baixa edat mitjana, quan el comtat de Portugal -portucalense- es fa autònom del Regne de Lleó. No debades, la presència humana en territori portuguès és més vella que la situació que presenta el país durant l'edat mitjana. Durant la prehistòria els primers homínids trepitjaren el país. Les datacions realitzades sobre restes ens apropen a prop de 500.000 anys arrere. El territori fou visitat per diversos pobles: fenicis, que hi fundaren factories, més tard esdevinguts cartaginesos. Els pobles celtes s'hi establiren durablement, tot barrejant-se amb els nadius.\\nAl segle iii aC l'actual Portugal era, doncs, habitat per diversos pobles. Llavors Roma envaïx la península Ibèrica i hi estableix les bases per a una nova etapa. El país és romanitzat, és a dir, aculturat i reorganitzat. Esdevé una província perifèrica i s'hi desenvolupa notablement la vida urbana. La religió romana substituïx progressivament les antigues creences. La romanització deixà marques duradores com ara en la llengua, la llei o la religió."},{"page_url":"https://ceb.wikipedia.org/wiki/Anaphyllum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/ArumWynaad.jpg","page_title":"Anaphyllum","context_page_description":"Henero sa mga tanom nga bulak ang Anaphyllum. Ang Anaphyllum sakop sa kabanay nga Araceae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://hr.wikipedia.org/wiki/The_Undertaker","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Undertaker_with_Fire.jpg","page_title":"The Undertaker","context_page_description":"Mark William Calaway, poznatiji pod nazivom The Undertaker, američki je profesionalni hrvač koji je trenutno potpisan za WWE."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AF%D8%B4%D8%A7%D8%B4%D9%88%D9%85%DB%8C%D8%AF%DA%BE_%DA%AF%DA%BE%D8%A7%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Incense_aarti_at_Dashaswamedh_ghat%2C_Varanasi.jpg","page_title":"دشاشومیدھ گھاٹ","context_page_description":"دشاشومیدھ گھاٹ کاشی وشوناتھ مندر کے قریب واقع ہے اور سب سے شاندار گھاٹ ہے۔ اس سے متعلق دو افسانوی کہانیاں ہیں: ایک کے مطابق برہما جی نے اس کی تعمیر شیو جی کے استقبال کے لیے کی تھی۔ دوسری کہانی کے مطابق برہماجی نے یہاں دشاشومیدھ یگ کیے تھے۔ ہر شام پجاریوں کے ایک گروہ یہاں اگنی پوجا کرتا ہے جس میں بھگوان شو، گنگا دریا، سوریا دیو، اگنیدیو اور پوری کائنات کو آہوتیاں سمان کی جاتی ہیں۔ یہاں دیوی گنگا کی بھی خوبصورت آرتی کی جاتی ہے۔"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BA%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Kirche_Pfarrhaus_Bockau.jpg","page_title":"Бокау","context_page_description":"Бокау — община в Германии, в земле Саксония. Подчиняется административному округу Кемниц. Входит в состав района Рудные Горы. Население составляет 2467 человек. Занимает площадь 19,15 км². Официальный код — 14 1 91 080."},{"page_url":"https://sh.wikipedia.org/wiki/Le_Mort_qui_tue_(film,_1913)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Le_Mort_qui_tue.png","page_title":"Le Mort qui tue (film, 1913)","context_page_description":"Le Mort qui tue je francuski nijemi igrani film snimljen 1913. u režiji Louisa Feuillaudea. Predstavlja treći dio filmske serije o superkriminalcu Fantomasu čiji lik tumači René Navarre. Radnja prikazuje kako novinar Fandor nastoji razriješiti slučaj misterioznih ubistava iza kojih bi mogao stajati Fantomas. Predstavlja najduži, i prema mišljenju upućenih, najbolji od pet filmova iz serije."},{"page_url":"https://tg.wikipedia.org/wiki/%D2%B6%D1%83%D2%93%D1%80%D0%BE%D1%84%D0%B8%D1%8F%D0%B8_%D0%A0%D1%83%D1%81%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Russia_edcp_relief_location_map.jpg","page_title":"Ҷуғрофияи Русия","context_page_description":"Ҷуғрофияи Русия — дар ду қитъаи олам Аврупо ва Осиё ҷойгир буда 1/3 масоҳаташ дар Аврупо ва 2/3 дар Осиё воқеъ гардидасст. Қисми шимоли онро баҳрҳои Уқёнуси яхбастаи шимолӣ, қисми шимолу шарқившро обҳои Уқёнуси Ором иҳота намудааст. Дар Русия се қаламрави фаррох Аврупои Шарқӣ, Сибири Ғарбӣ ва паҳнкӯҳҳои Сибири Миёна ҷудо шуда меистанд. Иқлими Русия хело гуногун буда, минтақаҳои иқлимиаш аз шимол ба ҷануб чунин иваш мешаванд: минтақаи иқлими артикӣ, субарктикӣ, муътадил ва субтропикӣ. Муддати сол дар тамоми қаламрави он ҳавои артикӣ, атлантикӣ ва антисиклни Сибири Шарқӣ мебошад. Тобистон бошад сатҳи Русия гарм, фишор паст ва массаҳои ҳавоӣ аз уқёнус ба хушкӣ ҳаракаткунанда ҳукмрони мекунанд. Боришот дар фаслҳои баҳору тобистон, дар тирамоҳу зимистон барф меборад. Дар қаламрави Русия миқдори зиёди дарёҳо ҷорӣ мешаванд, ки онҳо манбаи бузургӣ энергетикӣ мебошанд. Калонтарини онҳо Объ, Иртиш, Амур, Волга, Енисей Лена мебошанд. Захираҳои обию энергетикӣ мамлакат беҳамто мебошад, ки дар қисмати зиёди дарёҳо Неругоҳҳои барқию обӣ сохта шудааст."},{"page_url":"https://es.wikipedia.org/wiki/Marcescente","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Marasmius_rotula_-_Lindsey.jpg","page_title":"Marcescente","context_page_description":"Marcescente es un término utilizado en botánica para describir a aquellas hojas de árboles y arbustos caducifolios, que, tras haber finalizado el periodo vegetativo y con el cambio de color del follaje, permanecen en el árbol en su gran mayoría durante toda la estación fría hasta prácticamente la salida de las nuevas hojas en la siguiente primavera. Los árboles que suelen ser característicos por este fenómeno, son los robles​ como el melojo, el quejigo, numerosos pies de haya y los carpes\\nEn el roble palustre americano se completa la abscisión de las hojas marcescentes en primavera.​ En algunas especies el peciolo se puede mantener vivo durante el invierno, mientras que en otras las hojas son marcescentes porque las heladas o las plagas secan las hojas antes de que se complete la abscisión."},{"page_url":"https://de.wikipedia.org/wiki/Russland","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Tu2006_fact.jpg","page_title":"Russland","context_page_description":"Russland bzw. die Russische Föderation ist ein föderativer Staat im nordöstlichen Eurasien und mit etwa 17 Millionen Quadratkilometern flächenmäßig der größte Staat der Erde. Russland umfasst mehr als ein Achtel der bewohnten Landmasse der Erde und steht mit 144,5 Millionen Einwohnern an 9. Stelle der bevölkerungsreichsten Länder; es ist zugleich eines der am dünnsten besiedelten. Der europäische Teil des Staatsgebiets ist viel dichter besiedelt und verstädtert als der über dreimal so große asiatische Teil: Etwa 77 % der Bevölkerung leben westlich des Urals. Die Hauptstadt Moskau ist eine der größten Städte und Metropolregionen der Welt; als weiteres wichtiges Zentrum gilt Sankt Petersburg, das zwischen 1712 und 1918 Hauptstadt war und eine Brücke für Kunst und Kultur aus Westeuropa bildete.\\nDie nächstgrößten Millionenstädte Russlands sind Nowosibirsk in Sibirien, Jekaterinburg am Ural und Nischni Nowgorod an der Wolga. Weitere Großstadtregionen sind Tscheljabinsk, Ufa und Kasan. Insgesamt gibt es in Russland 15 Millionenstädte und fast 70 Agglomerationen mit mehr als 500.000 Einwohnern."},{"page_url":"https://fi.wikipedia.org/wiki/Pant%C3%A1nassan_luostari","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Mistra_1.jpg","page_title":"Pantánassan luostari","context_page_description":"Pantánassan luostari on bysanttilaisaikainen ortodoksinen luostari Mystraksessa Spártin kunnassa Kreikassa. Se on osa Mystraksen arkeologista aluetta, joka on Unescon maailmanperintökohde.\\nLuostari on omistettu Neitsyt Marialle ”Kaiken kuningattarelle”. Sen rakennutti Johannes Frangopulos, joka oli Konstantinos XI Palaiologoksen prostrator. Luostarin pääkirkko eli katholikon vihittiin käyttöön vuonna 1428. Luostarirakennus sijaitsee Mystraksen linnavuoren itärinteessä.\\nLuostarin katholikon edustaa Mystraksen kirkoille tyypillistä sekatyyliä: se on alaosassaan nartheksilla varustettu basilika, ja yläosassaan viisikupolinen ristinmuotoinen kirkko. Kirkossa on myös suuri kellotorni. Ulkoasussa on goottilaista tyyliä, mikä kertoo länsivaikutteista. Kirkko on koristeltu seinämaalauksin vuonna 1430. Osia alkuperäisistä maalauksista on säilynyt muun muassa yläkerroksessa ja kirkon katossa. Vuodelta 1445 kirkossa on Manuel Laskaris Khatzikoksen hautajaiskuva. Alaosien seinämaalaukset ovat 1600- ja 1700-luvuilta.\\nNykyisin luostari on nunnaluostari ja koko Mystraksen ainoa edelleen toiminnassa oleva luostari."},{"page_url":"https://de.wikipedia.org/wiki/David_Cicilline","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/DavidCicillineJohnRatzenberger08RIIFF.jpg","page_title":"David Cicilline","context_page_description":"David Cicilline ist ein US-amerikanischer Politiker der Demokratischen Partei. Er vertritt den Bundesstaat Rhode Island seit dem 3. Januar 2011 im US-Repräsentantenhaus."},{"page_url":"https://tr.wikipedia.org/wiki/Retrogaming","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Akihabara_-_Super_Potato_Retro_Game_Shop.jpg","page_title":"Retrogaming","context_page_description":"Klasik oyun ve eski okul oyunları olarak da bilinen Retrogaming, eski bilgisayar oyunu, video oyunu konsolu veya arcade video oyunlarını çağdaş zamanlarda oynamak veya toplamaktır. Bazen bu, eski mobil oyun'lar için de geçerli olur.\\nRetrogaming ve retrocomputing aktivitesi nostalji, retro ve remiks kültürünün bir yönü olarak tanımlanmıştır.\\nRetrogaming üç ana faaliyete sahiptir: Vintage retrogaming, retrogaming emülatör ve netleştirilmiş retrogaming. Vintage Retrogaming, orijinal donanımda oynanan oyunları içerir."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%90%D0%B7%D0%B8_%D0%B4%D0%B0%D1%85%D1%8C_%D0%B4%D1%8D%D0%BB%D1%85%D0%B8%D0%B9%D0%BD_%D3%A9%D0%B2%D0%B8%D0%B9%D0%BD_%D0%B6%D0%B0%D0%B3%D1%81%D0%B0%D0%B0%D0%BB%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/TajMahalbyAmalMongia.jpg","page_title":"Ази дахь дэлхийн өвийн жагсаалт","context_page_description":"Энэ жагсаалт нь ЮНЕСКО-гийн Дэлхийн өвд бүртгэгдсэн Азийн орнуудын өвүүдийн жагсаалт юм."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_evanghelic%C4%83_din_T%C4%83t%C3%A2rlaua","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/BisericaEvanghelicaTatarlauaAB_%2816%29.JPG","page_title":"Biserica evanghelică din Tătârlaua","context_page_description":"Biserica evanghelică din Tătârlaua este un monument istoric aflat pe teritoriul satului Tătârlaua; comuna Cetatea de Baltă."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BD%D0%B5%D0%B6%D0%BD%D0%B8_%D0%BB%D0%B5%D0%BE%D0%BF%D0%B0%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/SnowLeopard_distribution.jpg","page_title":"Снежни леопард","context_page_description":"Снежни леопард је велика мачка која настањује планинске крајеве централне и јужне Азије. Раније су снежне леопарде сврставали у род Panthera са још неколико великих мачака, али су их касније сврстали у сопствени род, Uncia. Заједно са облачастим леопардом представља средину између такозваних великих мачака и мањих врста, с обзиром на то да снежни леопарди не ричу, иако имају хрскавичаву подјезичну кост која се сматра да омогућава великим мачкама да ричу.\\nСнежни леопарди имају мекано и дебело сиво крзно са кружним тачкама и црним мрљама по којем су познати. У зиму оно постане бело. Реп је дебео, а шапе прекривене густом длаком као изолација против хладноће и снега. Животни век снежних леопарда износи од 15 до 18, док у заточеништву и до 20 година."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%95%D7%98%D7%A4%D7%A8%D7%99%D7%93_%D7%95%D7%99%D7%9C%D7%94%D7%9C%D7%9D_%D7%9C%D7%99%D7%99%D7%91%D7%A0%D7%99%D7%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Leibnizstrasse_street_sign_Berlin.jpg","page_title":"גוטפריד וילהלם לייבניץ","context_page_description":"גוטפריד וילהלם פון לייבניץ היה מתמטיקאי, פילוסוף, פיזיקאי ואיש אשכולות גרמני שהשפעתו בולטת הן בהיסטוריה של המתמטיקה והן בהיסטוריה של הפילוסופיה. לייבניץ כתב בעיקר בלטינית ובצרפתית.\\nבמתמטיקה, הוא פיתח את החשבון הדיפרנציאלי והאינטגרלי באופן בלתי תלוי באייזק ניוטון, וכן כיום, שיטת הסימון שלו היא זו הנמצאת בשימוש רווח בשל פשטותה. כמה מהעקרונות הפילוסופיים שלו מצאו ביסוס מתמטי רק במאה ה-20. היה מהפוריים שבממציאי ומפתחי המחשבים המכניים, ובעבודתו על הוספת פונקציות של כפל וחילוק לפסקלין הוא המציא את \\"התוף המדורג\\", שבו עשה שימוש כדי לבנות את מחשב הפסיעות שלו, ש-150 שנה מאוחר יותר שימש בסיס לאריתמומטר, המחשב המכני הראשון בייצור סדרתי. כמו כן היה הראשון לתאר את מנגנון \\"מחשבון החוגה\\" ב-1685. בשנות ה-1670 הוא פיתח את מכונת ההצפנה המורכבת הראשונה בהיסטוריה, והציע לרתום אותה לצורכי הממלכה בפני לאופולד הראשון, קיסר האימפריה הרומית הקדושה. בנוסף הגה ופיתח את השיטה הבינארית, בהמשך לרעיונותיהם של פילוסופים כמו רמון ליול, העומדת בבסיסה של כתיבת התוכנה במחשבים האלקטרוניים.\\nבפילוסופיה, הוא נודע במיוחד בשל קביעתו האופטימית שהיקום הוא הטוב ביותר שאלוהים היה יכול ליצור, והפך בשל קביעה זו למושא לעג בידי מחברים מאוחרים יותר כמו וולטר."},{"page_url":"https://pl.wikipedia.org/wiki/73_Pu%C5%82k_Piechoty_(II_RP)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Sztandar_73_Pu%C5%82ku_Piechoty_rewers.jpg","page_title":"73 Pułk Piechoty (II RP)","context_page_description":"73 Pułk Piechoty – oddział piechoty Wojsk Wielkopolskich i Wojska Polskiego w II Rzeczypospolitej.\\nZorganizowany 2 października 1919 roku jako 1 pułk rezerwowy Wojsk Wielkopolskich z samorzutnie sformowanych kompanii strzeleckich: bukowskiej, szamotulskiej, wolsztyńskiej i kościańskiej. Uczestniczył w powstaniu wielkopolskim. 26 stycznia 1920 przemianowany na 155 pułk piechoty wielkopolskiej. Brał udział w wojnie z bolszewikami. Toczył boje nad Autą, Dzisną oraz pod Grodnem. Najcięższą bitwę stoczył 23 lipca 1920 pod Indurą.\\nW marcu 1921, po reorganizacji Wojska Polskiego, 155 pułk piechoty przemianowany został na 73 pułk piechoty, a 20 czerwca 1922 przeniesiony na Górny Śląsk.\\nW okresie pokoju stacjonował w Katowicach. W kampanii wrześniowej walczył w składzie 23 Dywizji Piechoty."},{"page_url":"https://en.wikipedia.org/wiki/International_Harvester","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/International_Eagle_car_carrying_trailer_1.jpg","page_title":"International Harvester","context_page_description":"The International Harvester Company was an American manufacturer formed from the 1902 merger of McCormick Harvesting Machine Company and Deering Harvester Company. The business lines of the company included agricultural equipment, automobiles, commercial trucks, lawn and garden products, household equipment, and other entities. Along with the Farmall and Cub Cadet tractors, International is also known for the Scout and Travelall vehicle nameplates.\\nFollowing years of financial and economic decline, International began selling its separate equipment divisions, starting with the sale of the construction division to Dresser Industries in 1982. In November 1984 IH finalized a deal with Tenneco to sell the farm equipment division to its subsidiary, J.I Case. Henceforth IH became a truck and engine manufacturer, reorganized as Navistar International in 1986. Throughout its existence International Harvester was headquartered in Chicago, Illinois."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%84%D9%88%D9%85%DB%8C%D9%86%DB%8C%D9%85_%D9%87%DB%8C%D8%AF%D8%B1%D9%88%DA%A9%D8%B3%DB%8C%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Hydroxid_hlinit%C3%BD.PNG","page_title":"آلومینیم هیدروکسید","context_page_description":"آلومینیوم هیدروکسید نوعی باز است."},{"page_url":"https://el.wikipedia.org/wiki/FIFA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/FIFA-Headquarter.jpg","page_title":"FIFA","context_page_description":"Η Διεθνής Ποδοσφαιρική Ομοσπονδία είναι ο οργανισμός που διοικεί παγκόσμια το ποδόσφαιρο και αποτελεί τον μεγαλύτερο αθλητικό οργανισμό στον κόσμο. Η έδρα της είναι στη Ζυρίχη της Ελβετίας. Η FIFA έχει την ευθύνη για τη διεξαγωγή των κυριοτέρων διεθνών ποδοσφαιρικών διοργανώσεων, από τις οποίες το πιο γνωστό είναι το Παγκόσμιο Κύπελλο Ποδοσφαίρου που διεξάγεται από το 1930."},{"page_url":"https://hu.wikipedia.org/wiki/Cully_(Calvados)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Cully%2C_fa%C3%A7ade_sud_de_l%27%C3%A9glise_St_Martin.JPG","page_title":"Cully (Calvados)","context_page_description":"Cully település Franciaországban, Calvados megyében. Lakosainak száma 192 fő. Cully Coulombs, Le Fresne-Camilly, Lantheuil, Sainte-Croix-Grand-Tonne, Saint-Gabriel-Brécy és Secqueville-en-Bessin községekkel határos."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B7%D0%B5%D0%BB%D1%8C%D0%B1%D0%B0%D1%85%D1%82%D0%B0%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Wappen_Haselbachtal.png","page_title":"Хазельбахталь","context_page_description":"Хазельбахталь — Германиялағы, Саксония ерендәге коммуна. 2010 йылғы халыҡ иҫәбен алыу буйынса коммунала 4259 кеше йәшәй. Майҙаны — 37,47 км². Диңгеҙ кимәленән 234 метр бейеклектә һәм UTC +1 ваҡыт бүлкәтендә урынлашҡан. Был коммунаның почта индексы 1920 һәм автомобиль коды BZ."},{"page_url":"https://id.wikipedia.org/wiki/Park_Ji-yeon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Ji-yeon_at_Love_Jinx_vip_premiere%2C_February_2014_03.jpg","page_title":"Park Ji-yeon","context_page_description":"Park Ji-yeon, lebih dikenal dengan mononim Jiyeon, adalah penyanyi dan aktris Korea Selatan. Ia adalah anggota girlband T-ara dan subgrupnya, T-ara N4."},{"page_url":"https://de.wikipedia.org/wiki/Wasabi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Wasabia_japonica_4.JPG","page_title":"Wasabi","context_page_description":"Wasabi, auch Japanischer Meerrettich oder Wassermeerrettich genannt, ist eine Pflanzenart aus der Familie der Kreuzblütengewächse. Die Rhizome werden in der japanischen Küche als scharfes Gewürz verwendet. Als Wildpflanze ist die Art in sumpfigem Gelände am Rand von Fließgewässern in Japan heimisch. Als Kulturpflanze wird sie auch in anderen Erdteilen angebaut, vor allem in Taiwan, Korea, Israel, Thailand und Neuseeland."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%91%99%E9%B2%81%E6%80%BB%E7%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Baron_Waqa.jpg","page_title":"瑙鲁总统","context_page_description":"瑙鲁总统是瑙鲁的国家元首和政府首脑。"},{"page_url":"https://zh.wikipedia.org/zh-hk/NGC_4394","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Hubble_spies_NGC_4394.jpg","page_title":"NGC 4394","context_page_description":"NGC 4394是SBb型棒旋星系，在天球上位於后髮座，距離地球約3950萬光年。NGC 4394由威廉·赫歇爾發現於1784年3月14日。NGC 4394的核心區域是典型的低電離星系核。並且NGC 4394是透鏡狀星系M85的假定伴星系，兩者在天球上相距8角分。NGC 4394也是室女座星系團的成員星系。"},{"page_url":"https://en.wikipedia.org/wiki/Rotary_engine","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Oberursel_U.III.jpg","page_title":"Rotary engine","context_page_description":"The rotary engine was an early type of internal combustion engine, usually designed with an odd number of cylinders per row in a radial configuration, in which the crankshaft remained stationary in operation, with the entire crankcase and its attached cylinders rotating around it as a unit. Its main application was in aviation, although it also saw use before its primary aviation role, in a few early motorcycles and automobiles.\\nThis type of engine was widely used as an alternative to conventional inline engines during World War I and the years immediately preceding that conflict. It has been described as \\"a very efficient solution to the problems of power output, weight, and reliability\\".\\nBy the early 1920s, the inherent limitations of this type of engine had rendered it obsolete."},{"page_url":"https://fr.wikipedia.org/wiki/1950_en_musique_classique","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Misa_Sert.jpg","page_title":"1950 en musique classique","context_page_description":"6 janvier : Concerto pour piano de Francis Poulenc, créé par l'Orchestre symphonique de Boston sous la direction de Charles Munch avec le compositeur au piano.\\n10 février : la Symphonie nᵒ 3 de Karl Amadeus Hartmann, créée par Eric Schmid à Munich.\\n15 mars : The Consul, opéra de Gian Carlo Menotti, créé à New York.\\n15 avril : Numance, tragédie lyrique d'Henry Barraud, créée à Paris.\\n12 mai : Bolivar, opéra de Darius Milhaud, créé à l'Opéra de Paris sous la direction d'André Cluytens.\\n18 mai : The Jumping Frog of Calaveras County opéra de Lukas Foss, créé à Bloomington.\\n20 mai : Il prigioniero, opéra de Luigi Dallapiccola, créé sur scène au Maggio Musicale Fiorentino.\\n22 mai : Vier letzte Lieder de Richard Strauss, créés par Kirsten Flagstad et l'orchestre Philharmonia.\\n12 août : Quatuor à cordes de John Cage, créé au Black Mountain College.\\n27 août : Variazioni canoniche sulla serie dell’op.41 di A. Schönberg de Luigi Nono, créé à Darmstadt.\\n6 novembre : Quatre études de rythme d'Olivier Messiaen, créées à Tunis par le compositeur.\\n29 décembre : Intermezzo de Bohuslav Martinů, créé au Carnegie Hall.\\nDate indéterminée"},{"page_url":"https://de.wikipedia.org/wiki/Altstadt_(Schwerin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Bundesarchiv_Bild_183-1988-1006-005%2C_Schwerin%2C_Gro%C3%9Fer_Moor%2C_Burgstra%C3%9Fe.jpg","page_title":"Altstadt (Schwerin)","context_page_description":"Die Schweriner Altstadt ist ein Stadtteil und der historische Kern der mecklenburg-vorpommerschen Landeshauptstadt Schwerin."},{"page_url":"https://en.wikipedia.org/wiki/Colley_Township,_Sullivan_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Map_of_Sullivan_County_Pennsylvania_Highlighting_Colley_Township.png","page_title":"Colley Township, Sullivan County, Pennsylvania","context_page_description":"Colley Township is a township in Sullivan County, Pennsylvania, United States. The population was 694 at the 2010 census. The village of Lopez is located in the township."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B5%D0%BA%D1%81%D0%BF%D0%B8%D1%80,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Cobbe_portrait_of_Shakespeare.jpg","page_title":"Шекспир, Уильям","context_page_description":"Уи́льям Шекспи́р — английский поэт и драматург, зачастую считается величайшим англоязычным писателем и одним из лучших драматургов мира. Часто именуется национальным поэтом Англии. Дошедшие до нас работы, включая некоторые, написанные совместно с другими авторами, состоят из 38 пьес, 154 сонетов, 4 поэм и 3 эпитафий. Пьесы Шекспира переведены на все основные языки и ставятся чаще, чем произведения других драматургов.\\nШекспир родился и вырос в городе Стратфорд-апон-Эйвоне. В 18 он женился на Энн Хатауэй, в браке с которой имел трёх детей: дочь Сюзанну и двойняшек Хемнета и Джудит. Карьера Шекспира началась между 1585 и 1592 годами, когда он переехал в Лондон. Вскоре он стал успешным актёром, драматургом, а также совладельцем театральной компании под названием «Слуги лорда-камергера», позже известной как «Слуги короля». Около 1613 года, в возрасте 48 лет он вернулся в Стратфорд, где умер тремя годами позже."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B8%D0%BB%D0%BC%D0%B0%D1%80%D0%BA_(%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Chilmark_Town_Hall%2C_Martha%27s_Vineyard.jpg","page_title":"Чилмарк (Массачусетс)","context_page_description":"Чилмарк — місто в США, в окрузі Дюкс штату Массачусетс. Населення — 866 осіб."},{"page_url":"https://pt.wikipedia.org/wiki/Faj%C3%A3_de_Vasco_Martins","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Faj%C3%A3_de_Vasco_Martins%2C_forma_tradicional_de_beber_%C3%A1gua_usando_uma_folha_de_Hedychium_gardnerianum_Conteira%2C_Toledo%2C_Velas%2C_ilha_de_S%C3%A3o_Jorge.JPG","page_title":"Fajã de Vasco Martins","context_page_description":"A fajã de Vasco Martins, possivelmente uma das mais bonitas e maiores fajãs da ilha de São Jorge, e também uma das de mais difícil acesso. Situa-se na costa Norte da ilha de São Jorge, entre a Fajã do Meio e da Fajã Rasa, próxima à Fajã da Vereda Vermelha, pertence praticamente na sua totalidade aos habitantes do Toledo, freguesia de Santo Amaro e Concelho de Velas.\\nPara chegar a esta fajã deve-se partir do Toledo pelo Caminho Velho e após uma caminhada através das pastagens, por um caminho pedestre, chega-se à beira da rocha. Transposta uma cancela inicia-se a descida que os levará, a quem seguir pela bifurcação da esquerda, após uma dezena de metros, até junto a uma queda de água denominada Fonte Velha onde. Fonte esta cuja água tem origem num dos aquíferos do Norte da ilha e é ainda um dos poucos lugares da ilha de São Jorge onde se podem encontrar eiróses.\\nAo seguir-se pela direita, após alguns minutos, chega-se a um local, autêntico miradouro que se debruça sobre uma falésia e de onde se pode ver a fajã de Vasco Martins."},{"page_url":"https://ro.wikipedia.org/wiki/%C5%A0entvid_pri_Planini","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/%C5%A0entvid_pri_Planini_-_cerkev_sv._Vida.jpg","page_title":"Šentvid pri Planini","context_page_description":"Šentvid pri Planini este o localitate din comuna Šentjur, Slovenia, cu o populație de 109 locuitori."},{"page_url":"https://no.wikipedia.org/wiki/Villsvin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Wild_boar_in_the_winter.jpg","page_title":"Villsvin","context_page_description":"Villsvin er et altetende klovdyr som tilhører svinefamilien og kan være både primærkonsument og sekundærkonsument i næringskjeden. Arten, som regnes som tamgrisens progenitor, er naturlig utbredt i Eurasia og Nord-Afrika, herunder også i deler av Fennoskandia. I Norge er arten nå observert å ha fått levedyktige unger i Halden kommune, og den vil trolig spre seg videre siden den svenske bestanden har hatt en eksplosiv utvikling. Villsvin er også innført til mange andre steder, som til Nord-Amerika og Australia."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%A6%E0%B2%BF%E0%B2%A8%E0%B2%9A%E0%B2%B0%E0%B2%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/The_Diary_of_a_Young_Girl_at_the_Anne_Frank_Zentrum.jpg","page_title":"ದಿನಚರಿ","context_page_description":"ದಿನಚರಿಯು ದಿನಾಂಕವನ್ನು ಆಧರಿಸಿ ಕ್ರಮವಾಗಿರಿಸಿದ ಪ್ರತ್ಯೇಕವಾದ ನಮೂದುಗಳನ್ನು ಹೊಂದಿರುವ ದಾಖಲೆ. ಇದು ಒಂದು ದಿನ ಅಥವಾ ಇತರ ಸಮಯದ ಅವಧಿಯಲ್ಲಿ ಏನು ನಡೆಯಿತು ಎಂಬುದನ್ನು ವರದಿ ಮಾಡುತ್ತದೆ. ವೈಯಕ್ತಿಕ ದಿನಚರಿಯು ಬರಹಗಾರನ ನೇರ ಅನುಭವದ ಹೊರಗಿನ ಪ್ರಸ್ತುತ ಘಟನೆಗಳ ಮೇಲಿನ ಟಿಪ್ಪಣಿಗಳನ್ನು ಹೊರತುಪಡಿಸಿ, ಒಬ್ಬ ವ್ಯಕ್ತಿಯ ಅನುಭವಗಳು, ಯೋಚನೆಗಳು, ಮತ್ತು/ಅಥವಾ ಅನಿಸಿಕೆಗಳನ್ನು ಒಳಗೊಳ್ಳಬಹುದು. ದಿನಚರಿ ಇಡುವವನನ್ನು ದಿನಚರಿಗಾರನೆಂದು ಕರೆಯಲಾಗುತ್ತದೆ. ಸಾಂಸ್ಥಿಕ ಉದ್ದೇಶಗಳಿಗಾಗಿ ಆರಂಭಿಸಲಾದ ದಿನಚರಿಗಳು ಮಾನವ ನಾಗರೀಕತೆಯ ಅನೇಕ ಅಂಶಗಳಲ್ಲಿ ಪಾತ್ರವನ್ನು ವಹಿಸುತ್ತವೆ, ಉದಾಹರಣೆಗೆ ಸರ್ಕಾರಿ ದಾಖಲೆಗಳು, ವ್ಯವಹಾರ ಖಾತೆ ಪುಸ್ತಕಗಳು, ಮತ್ತು ಸೇನಾ ದಾಖಲೆಗಳು."},{"page_url":"https://hu.wikipedia.org/wiki/Old%C5%99i%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Old%C5%99i%C5%A1_flag.jpg","page_title":"Oldřiš","context_page_description":"Oldřiš település Csehországban, a Svitavyi járásban. Oldřiš Lubná, Borová, Kamenec u Poličky, Telecí, Široký Důl és Sádek településekkel határos. Lakosainak száma 653 fő."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%BE%D1%82%D1%80_%D0%94%D0%B0%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Notre_dame_de_paris%2C_statua_della_nostra_signora_di_parigi.JPG","page_title":"Нотр Дам","context_page_description":"Нотр Дам je катедрала посвећена Богородици Марији саграђена у готичком стилу на реци Сени. Налази се на југоистоку острва Сите у средишту Париза на реци Сени. Вековима је била највиша париска грађевина, те данас у граду и у целој Француској представља симбол највише вредности.\\nИзградња је започела на подстицај бискупа Мориса де Салија, те се протегнула кроз више од два века, од 1163. године све до половине 14. века. Након револуционарних немира на катедрали су предузети значајни и често оспорени реновациони подухвати које је водио архитект Ежен Виоле ле Дик и током којих су у структуру и архитектуру катедрале уведени нови елементи и мотиви. Ови подувати су разлог што уметнички стил катедрале није јединствен, иако су превладавајући елементи ране и класичне готике. Две розете које се налазе на крајевима трансепта највеће су розете у Европи.\\nКатедрала Нотр Дам грађевина је снажног симболичног значења како за Католичку цркву у Француској тако и за свеукупно француско друштво. Била је место бројних значанијх догађаја француске историје. Током средњег века била је жупна црква те је 1239. године у њу пристигла реликвија која се према традицији сматра Христовом трновом круном."},{"page_url":"https://ast.wikipedia.org/wiki/Saturnales","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Lawrence_Alma-Tadema_06.jpeg","page_title":"Saturnales","context_page_description":"Les Saturnales yeren unes importantes festividaes romanes. La fiesta celebrar con un sacrificiu nel Templu de Saturnu, nel Foru Romanu, y una llacuada pública, siguíu pol intercambiu de regalos, continuu festexu, y un ambiente d'antroxu nel que se producía una relaxación de les normes sociales. El poeta Catulo llamar \\"el meyor de los díes.\\" Yeren Navidá y Antroxu a un mesmu tiempu y el cristianismu de l'antigüedá tardida tuvo fuertes problemes p'acabar con esta fiesta pagana, intentando sustituyila.\\nLes Saturnales celebrar por dos motivos:\\nN'honor a Saturno, dios de l'agricultura.\\nComo homenaxe al trunfu d'un victoriosu xeneral.\\nLes primeres celebrar del 17 al 23 d'avientu, a la lluz de veles y antorches, pol fin del periodu más escuru del añu y la nacencia del nuevu periodu de lluz, o nacencia del Sol Invictus, 25 d'avientu, coincidiendo cola entrada del Sol nel signu de Capricorniu. Probablemente les Saturnales fueren les fiestes de la finalización de los trabayos del campu, celebrada tres la conclusión de la llantadera d'iviernu, cuando'l ritmu de les estaciones dexaba a tola familia llabradora, incluyíos los esclavos domésticos, tiempu pa folgar del esfuerciu cotidianu."},{"page_url":"https://pt.wikipedia.org/wiki/Avia%C3%A7%C3%A3o_do_Ex%C3%A9rcito_Brasileiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Eurocopter_AS565_Panther_Brazilian_Army.jpg","page_title":"Aviação do Exército Brasileiro","context_page_description":"A Aviação do Exército é o segmento aéreo do Exército Brasileiro e foi recriada com o objetivo primaz de proporcionar aeromobilidade ao mesmo. Além disso, ela carrega consigo o desígnio de ser um vetor de modernidade para, com isso, constituir-se num pólo de absorção, domínio e difusão de tecnologia e doutrina deste segmento da guerra moderna. Para tanto, a cada dia, a Aviação do Exército vem se desenvolvendo pelo constante aprimoramento técnico-profissional de seus integrantes, pelo adestramento operacional de seus elementos orgânicos e pelo aperfeiçoamento das doutrinas atinentes ao emprego da aviação em prol da força terrestre."},{"page_url":"https://it.wikipedia.org/wiki/Bam_Margera","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Bam_Margera_%22Rampa_en_el_fuego%22.png","page_title":"Bam Margera","context_page_description":"Brandon Cole Margera, detto Bam Margera, è uno skater, attore e personaggio televisivo statunitense."},{"page_url":"https://eu.wikipedia.org/wiki/Topo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Logotipo_euskotren_trena.png","page_title":"Topo","context_page_description":"Euskotren Trenaren E2 eta E5 lineak, Topo izenez ezagutzen den zerbitzua osatzen dutenak, Donostialdea eta Gipuzkoako Bidasoa eskualdeetan ustiatzen den hiriarteko tren zerbitzua da. Lasarte-Oriako geltokian hasi eta Hendaiako geltokian bukatzen da, geltoki nagusia Donostia hiriburuko Amarako geltokia izanik, eta bidetik Lasarte-Oria, Donostia, Pasaia, Errenteria, Oiartzun, Irun eta Hendaia udalerriak zeharkatzen ditu. Lineak 28,370 km eta 21 geltoki ditu, bi gehiago eraikitzen hasiko direla.\\nEuskal Trenbide Sarea jabe den Bilbo-Donostia eta Donostia-Hendaia trenbideak erabiltzen ditu, eta tarte amankomuna dauka E1 linearekin, Errekalde eta Amarako geltokien artean. Elkarbanatutako tarteak lau geltoki hartzen ditu bere gain.\\nGaur egun, trenbideotan hainbat lan egiten ari dira, hala nola trenbide bikoizketak eta geltoki berriak eraikitzea. Proiektuaren ardatz nagusia Lugaritz eta Amarako geltokien arteko saihesbidean datza, 2017ko udazkenean saihesbidea eraikitzeko lanak hasita, trena Donostia erdialdera hurbilduz eta Amarako geltoki terminala geltoki pasante batez ordezkatuz. Pasantea 2022rako amaitzea aurreikusten da."},{"page_url":"https://en.wikipedia.org/wiki/Mendon_Center_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/First_Church_Mendon.JPG","page_title":"Mendon Center Historic District","context_page_description":"The Mendon Center Historic District is a historic district encompassing the village center of Mendon, Massachusetts, and some of its surrounding rural areas. It is roughly bounded by Main, Hastings, Maple, North, Washington & George Streets. The village is centered on the triangle defined by Main, Hastings, and Maple Streets, with dwellings built up on the roads that radiate away from this area. Founders' Park, located at the junction of Main, Hastings, North and Milford Streets, is the site of the original town center, where the first meeting house was located. The district has residential buildings dating from the 18th to the mid-20th centuries, in a wide variety of styles. The focal point of the town center is the Second Unitarian Church, an 1820 building designed by Worcester architect Elias Carter.\\nThe district was listed on the National Register of Historic Places in 2003."},{"page_url":"https://nl.wikipedia.org/wiki/Het_Kerkje","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Budel_-_Dr._Anthonie_Mathijssenstraat_7_Nederlands_Hervormde_kerk.JPG","page_title":"Het Kerkje","context_page_description":"Het Kerkje is een oorspronkelijke Nederlands hervormd kerkgebouw in Budel in de Nederlandse provincie Noord-Brabant.\\nDe kerk, gelegen aan de Doctor Ant. Mathijsenstraat nr 7, werd gebouwd in 1812 gedurende de Franse tijd. Bij de bouw werd gebruik gemaakt van afbraakmateriaal van de kerk van de zusters Franciscanessen van Achel. Het kerkgebouw is een driezijdig gesloten zaalkerk. Op het dak bevindt zich een torentje in de vorm van een dakruiter met een in 1751 door de Amsterdamse klokkengieter Cyprianus Crans Jansz gegoten klok.\\nKenmerkende elementen in het interieur zijn een preekstoel met een door Claude Demeny in 1734 vervaardigde koperen lezenaar, een doophek en een doopbekkenhouder met bekken.\\nDe kerk werd op 5 mei 1967 als rijksmonument ingeschreven in het monumentenregister."},{"page_url":"https://fr.wikipedia.org/wiki/P%C3%AD%C5%A1%C5%A5_(district_d%27Opava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/P%C3%AD%C5%A1%C5%A5_OP_flag.jpg","page_title":"Píšť (district d'Opava)","context_page_description":"Píšť est une commune du district d'Opava, dans la région de Moravie-Silésie, en République tchèque. Sa population s'élevait à 2 138 habitants en 2017."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82%D0%BE%D0%B2_%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D0%B0_%D0%A1%D0%A1%D0%A1%D0%A0_1-%D0%B3%D0%BE_%D1%81%D0%BE%D0%B7%D1%8B%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Saladze_VE.jpg","page_title":"Список депутатов Верховного Совета СССР 1-го созыва","context_page_description":"Ниже приведён список депутатов I созыва Верховного Совета СССР, избранных 12 декабря 1937 года, а также доизбранных позднее с 24 марта 1940 года по 22 июня 1941 года и 29 апреля 1945 года."},{"page_url":"https://cy.wikipedia.org/wiki/Cornbig_daear_y_Gogledd","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Bird_Wreathed_Hornbill_Rhyticeros_undulatus_DSCN9018_13.jpg","page_title":"Cornbig daear y Gogledd","context_page_description":"Aderyn a rhywogaeth o adar yw Cornbig daear y Gogledd a adnabyddir hefyd gyda'i enw gwyddonol Bucorvus abyssinicus; yr enw Saesneg arno yw Abyssinian ground hornbill. Mae'n perthyn i deulu'r Cornbigau sydd yn urdd y Coraciiformes.\\nTalfyrir yr enw Lladin yn aml yn B. abyssinicus, sef enw'r rhywogaeth. Mae'r rhywogaeth hon i'w chanfod yn Affrica."},{"page_url":"https://lv.wikipedia.org/wiki/Dereks_Stepans","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Derek_Stepan_Rangers.png","page_title":"Dereks Stepans","context_page_description":"Dereks Stepans ir amerikāņu hokejists, centra uzbrucējs. Pašlaik Stepans spēlē Nacionālās hokeja līgas kluba Arizonas \\"Coyotes\\" sastāvā."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%B1%D1%80%D0%BE%D1%88%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Qui%C3%A9vrain_French_border.jpg","page_title":"Заброшенная железная дорога","context_page_description":"Заброшенная железная дорога — железнодорожный путь, который более не используют по прямому назначению."},{"page_url":"https://en.wikipedia.org/wiki/Alangium_salviifolium","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Sage-Leaved_Alangium_06.JPG","page_title":"Alangium salviifolium","context_page_description":"Alangium salviifolium, commonly known as sage-leaved alangium, is a flowering plant in the Cornaceae family. It is also commonly known as Ankolam in Malayalam, Ankola in Kannada, Akola or Ankol in Hindi and Alanji in Tamil. In India, Its mostly found in dry regions in plains and low hills and also found on roadsides."},{"page_url":"https://es.wikipedia.org/wiki/Sacramento_Republic_Football_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Tower_bridge_battalion.JPG","page_title":"Sacramento Republic Football Club","context_page_description":"El Sacramento Republic FC es un equipo profesional de fútbol de la ciudad de Sacramento, California en los Estados Unidos. Fue fundado en 2012 e hizo su debut en la ahora USL Championship, la segunda división del fútbol estadounidense."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%BE%DB%8C%DA%A9%D8%B1%DB%8C%D9%86%D9%82%D8%8C_%D9%82%D9%88%D8%B2%D8%A6%DB%8C_%DB%8C%D9%88%D8%B1%DA%A9%E2%80%8C%D8%B4%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Pickering_MMB_15.jpg","page_title":"پیکرینق، قوزئی یورک‌شر","context_page_description":"پیکرینق، قوزئی یورک‌شر بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 6830 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Sport","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Youth-soccer-indiana.jpg","page_title":"Sport","context_page_description":"Sport includes all forms of competitive physical activity or games which, through casual or organized participation, at least in part aim to use, maintain or improve physical ability and skills while providing enjoyment to participants, and in some cases, entertainment for spectators. Sports can bring positive results to one's physical health. Hundreds of sports exist, from those between single contestants, through to those with hundreds of simultaneous participants, either in teams or competing as individuals. In certain sports such as racing, many contestants may compete, simultaneously or consecutively, with one winner; in others, the contest is between two sides, each attempting to exceed the other. Some sports allow a \\"tie\\" or \\"draw\\", in which there is no single winner; others provide tie-breaking methods to ensure one winner and one loser. A number of contests may be arranged in a tournament producing a champion. Many sports leagues make an annual champion by arranging games in a regular sports season, followed in some cases by playoffs."},{"page_url":"https://fr.wikipedia.org/wiki/100_paysages_du_Japon_(%C3%A8re_Sh%C5%8Dwa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Mt_Chokai_from_Yashima_Town.jpg","page_title":"100 paysages du Japon (ère Shōwa)","context_page_description":"Les 100 paysages du Japon (ère Shōwa) constituent une liste de célèbres sites pittoresques au Japon. Les cent paysages ou vues ont été sélectionnés avec un ensemble de huit vues et vingt-cinq sites gagnants en 1927, une année après que Hirohito est devenu Empereur. Le but de la sélection est de « refléter le nouveau goût de la nouvelle ère ». L'initiative a été parrainée par le Tokyo Nichi Nichi Shimbun et le Osaka Mainichi Shimbun.\\nLes paysages ou sites sont répartis en huit classes Côtes Lacs Montagnes Cours d'eau Gorges Chutes d'eau Onsen Plaines. Nombre de ces paysages font à présent partie de la liste des parcs nationaux du Japon."},{"page_url":"https://ca.wikipedia.org/wiki/Paco_Tous","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Paco_Tous_-_Seminci_2016_%28cropped%29.jpg","page_title":"Paco Tous","context_page_description":"Paco Tous és un actor espanyol nascut a Sevilla l'any 1964 i criat a El Puerto de Santa María.\\nLligat des dels seus inicis al teatre, és membre fundador de la companyia Los Ulen, sorgida a finals dels 80. En l'actualitat és una de les companyies andaluses de major prestigi. Figura popular de la televisió a Espanya pel seu paper a la sèrie Los hombres de Paco. El 2008 participà en l'especial de nadal de La familia Mata."},{"page_url":"https://en.wikipedia.org/wiki/Dan%27l_Webster_(train)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/New_Haven_Railroad_Daniel_Webster.JPG","page_title":"Dan'l Webster (train)","context_page_description":"The Dan'l Webster was a named train of the New York, New Haven and Hartford Railroad, between Grand Central Terminal, New York, New York, and South Station, Boston, Massachusetts. The Dan'l Webster was an attempt by the New Haven to modernize rail travel and lure people out of their cars. The train was built by Pullman to their lightweight Train-X design, and was powered by two Baldwin RP-210 diesel-hydraulic locomotives, connected by multiple unit control, through the train.\\nThe train, introduced in 1957, consisted of nine, short, all-aluminum cars articulated together. The center car had two axles, with the remaining cars having a single axle each, being supported by adjacent cars at the end opposite the axle. The ride was rough, as with most of the other lightweight trains of the period, and the train was not a success.\\nThe train was retired in 1960, and was sold in 1964 to Jones Tours, for excursion service. After a long period of storage in South Carolina, the train and locomotives were scrapped around 1970."},{"page_url":"https://de.wikipedia.org/wiki/Wohnhaus_Hinter_der_Holzpforte_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Schnoor_Bremen.jpg","page_title":"Wohnhaus Hinter der Holzpforte 4","context_page_description":"Das Wohnhaus Hinter der Holzpforte 4 befindet sich in Bremen, Stadtteil Mitte im Schnoorviertel, Hinter der Holzpforte 4 Ecke Wüstestätte. Es entstand 1963 nach Plänen von Karl Dillschneider.\\nDas Gebäude steht seit 1973 unter Bremer Denkmalschutz."},{"page_url":"https://nl.wikipedia.org/wiki/Landgoed_De_Raephorst","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Horsten2.JPG","page_title":"Landgoed De Raephorst","context_page_description":"Landgoed De Raephorst is een landgoed in Wassenaar. Vroeger heeft hier een kasteel gestaan.\\nKasteel Raephorst bestaat niet meer en Landgoed de Raephorst is samengegaan met Landgoed ter Horst en wordt nu De Horsten of Landgoed de Horsten genoemd. Ook Eikenhorst, het landgoed waar in 1986 prinses Christina ging wonen, en waar tot 2019 koning Willem Alexander met zijn gezin woonde, maakt deel uit van De Horsten."},{"page_url":"https://az.wikipedia.org/wiki/Lui_Reno","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/LouisRenault.jpg","page_title":"Lui Reno","context_page_description":"Lui Reno — Fransız hüquqşünası və müəllim. 1907-ci ildə Ernesto Moneta ilə birlikdə Nobel sülh mükafatına layiq görülmüşdür.\\nLui Reno 1843-cü il mayın 21-də Fransanın Autun şəhərində anadan olmuşdur. 1868-73-cü illər arasında Dijon Universitetində Roma və ticarət hüququ professoru, 1873-cü ildən ölümünə qədər isə Paris Hüquq Fakultəsində professor kimi fəaliyyət göstərmişdir. 1890-cı ildə Fransa Xarici İşlər Nazirliyinin hüquq məsləhətçiliyinə təyin edilmişdir. Bu vəzifə əsnasında Fransanın xarici siyasətini beynəlxalq hüququn işığında diqqətlə araşdırdı. Aralarında 1899 və 1907-ci illərdəki Lahey sülh konfransı ilə London dəniz konfransının yer aldığı bir sıra konfranslarda iştirak etmişdir.\\nMüvəffəqiyyətli bir hakim də olan Reno 1905-ci ildəki Yapon Mülk Vergisi, 1909-cu ildə Kasablanka, 1911-ci ildə Savarkar və 1913-cü ildə Karfagen ilə Manouba iddiaları kimi bir çox problemin həllinə kömək etdi. Bu vaxt beynəlxalq hüququn xüsusi məsələlərinə dair çox sayda məqalə və monoqrafiya yazdı. C.Lyon-Caen ilə birlikdə iki cildlik bir ticarət hüququ və səkkiz cildlik bir araşdırma kitabı çap etdirmişlər."},{"page_url":"https://de.wikipedia.org/wiki/STS-97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Iss-solarpanel.jpg","page_title":"STS-97","context_page_description":"STS-97 ist die Missionsbezeichnung für einen Flug des US-amerikanischen Space Shuttle Endeavour der NASA. Der Start erfolgte am 1. Dezember 2000. Es war die 101. Space-Shuttle-Mission, der 15. Flug der Raumfähre Endeavour und der sechste Flug eines Shuttles zur Internationalen Raumstation."},{"page_url":"https://it.wikipedia.org/wiki/Hydrornis_gurneyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Gurney%27s_Pitta.jpg","page_title":"Hydrornis gurneyi","context_page_description":"La pitta di Gurney è un uccello passeriforme della famiglia dei Pittidi."},{"page_url":"https://pt.wikipedia.org/wiki/Sucy-en-Brie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/L%27%C3%A9glise_de_Sucy_En_Brie_dans_le_Val_de_Marne.jpg","page_title":"Sucy-en-Brie","context_page_description":"Sucy-en-Brie é uma comuna francesa na região administrativa da Ilha-de-França, no departamento de Val-de-Marne. Estende-se por uma área de 10,43 km². Em 2010 a comuna tinha 25 820 habitantes."},{"page_url":"https://lt.wikipedia.org/wiki/Brandon_Flowers","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Brandon_Flowers.jpeg","page_title":"Brandon Flowers","context_page_description":"Brandon Flowers – JAV roko grupės „The Killers“ vokalistas ir klavišininkas, paraleliai vystantis ir solinę karjerą. 2010 m. išleido debiutinį albumą „Flamingo“, 2015 m. – „The Desired Effect“. Kartu su grupės albumais 6 kartus pasiekė Jungtinės Karalystės albumų topo 1-ą vietą."},{"page_url":"https://la.wikipedia.org/wiki/Leonhartus_Fuchsius","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/LeonardFuchsMiall.png","page_title":"Leonhartus Fuchsius","context_page_description":"Leonhartus Fuchsius fuit medicus et botanista Germanicus qui Latine scripsit et opera nonnulla e lingua Graeca Latine vertit. Ad eius honorem Fuchsia nominata est."},{"page_url":"https://nl.wikipedia.org/wiki/Berryz_Kobo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Berryz_Kobo_at_AnimeNEXT_20120609_15.39.17.jpg","page_title":"Berryz Kobo","context_page_description":"Berryz Kobo is een Japanse meidengroep geproduceerd door de songwriter en muziekproducer Tsunku. De groep maakt deel uit van Hello! Project. De groep werd opgericht in 2004 en heeft sindsdien meer dan 30 singles uitgebracht."},{"page_url":"https://en.wikipedia.org/wiki/Anchor_Point,_Alaska","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Anchor_Point%2C_Alaska.JPG","page_title":"Anchor Point, Alaska","context_page_description":"Anchor Point is an unincorporated community and census-designated place in Kenai Peninsula Borough, in the U.S. state of Alaska. As of the 2010 census the population was 1,930, up from 1,845 in 2000. The community is located along the Sterling Highway, part of Alaska State Route 1. Anchor Point is the westernmost point in the North American highway system."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1945","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Jean_Van_Hout_en_ao%C3%BBt_1933.jpg","page_title":"Lijst van personen overleden in 1945","context_page_description":"Dit is een lijst van personen die overleden zijn in 1945.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Knight_(publisher)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Knight-1867.JPG","page_title":"Charles Knight (publisher)","context_page_description":"Charles Knight was an English publisher, editor and author. He published and contributed to works such as The Penny Magazine, The Penny Cyclopaedia, and The English Cyclopaedia, and established the Local Government Chronicle."},{"page_url":"https://ast.wikipedia.org/wiki/Congresu_de_Viena","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Talleyrand_02.jpg","page_title":"Congresu de Viena","context_page_description":"El Congresu de Viena foi un alcuentru internacional celebráu na capital austriaca, convocáu coles mires de restablecer les fronteres d'Europa tres la derrota de Napoleón Bonaparte y reorganizar les ideoloxíes polítiques del Antiguu Réxime.\\nCon éses la so intención yera retornar Europa a la situación anterior a la Revolución francesa non yá pa restablecer les fronteres nacionales trastornadas faía cuasi 20 años, sinón amás p'asegurar un equilibriu de poder qu'evitara otra serie de conflictos armaos a gran escala, como fueron; primero les Guerres revolucionaries franceses y dempués les Guerres Napoleóniques."},{"page_url":"https://en.wikipedia.org/wiki/Southern_Norway","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Mandal._gjestehavn_og_bryggegata.JPG","page_title":"Southern Norway","context_page_description":"Southern Norway is the geographical region along the Skagerrak coast of southern Norway. The region is an informal description since it does not have any governmental function. It roughly corresponds to the old petty kingdom of Agder as well as the two former counties of Vest-Agder and Aust-Agder. From New Year 2020, the two counties have been merged into one county, Agder. The total combined area of Vest-Agder and Aust-Agder counties is 16,493 square kilometres. The name is relatively new, having first been used in Norway around 1900.\\nThe region includes coastal areas along the Skagerrak and extends inland to the Setesdalsheiene mountains. There are many large valleys running from the mountains to the south and east to the sea. The highest point in the region is Sæbyggjenuten at 1,507 m."},{"page_url":"https://sv.wikipedia.org/wiki/Carl_Rammelsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Carl_Rammelsberg_1891.jpg","page_title":"Carl Rammelsberg","context_page_description":"Carl Friedrich August Rammelsberg, född 1 april 1813 i Berlin, död där 28 december 1899, var en tysk kemist och mineralog.\\nRammelsberg var under åren 1846–1891 professor vid Berlins universitet. Han utförde ett högst betydligt antal undersökningar inom den oorganiska kemins, mineralogins och kristallografins områden samt utgav åtskilliga förtjänstfulla och mycket använda hand- och läroböcker. Rammelsberg blev 1855 ledamot av Preußische Akademie der Wissenschaften i Berlin och 1859 korresponderande ledamot av Bayerische Akademie der Wissenschaften. Han invaldes 1862 i Leopoldina, 1870 i Akademie der Wissenschaften zu Göttingen, 1872 i American Academy of Arts and Sciences och 1893 i National Academy of Sciences samt 1889 som korresponderande ledamot av Geologiska Föreningen i Stockholm."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9F%D1%80%D1%8D%D0%B7%D1%8B%D0%B4%D1%8D%D0%BD%D1%86%D0%BA%D1%96%D1%8F_%D0%B2%D1%8B%D0%B1%D0%B0%D1%80%D1%8B_%D1%9E_%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D1%96%D1%96_2016_%D0%B3%D0%BE%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/RK_Eiki_Nestor.jpg","page_title":"Прэзыдэнцкія выбары ў Эстоніі 2016 году","context_page_description":"Прэзыдэ́нцкія вы́бары ў Эсто́ніі адбываліся ў жніўні-кастрычніку 2016 году, паколькі ў пяці папярэдніх турах пераможцу вызначыць не атрымалася. Выбары непрамыя: галасаваньне адбывалася ў парлямэнце. Дзейны прэзыдэнт Тоомас Хэндрык Ільвэс ня мог узяць удзелу ў выбарах, паколькі знаходзіўся на сваёй пасадзе два тэрміны.\\nПасьля галасаваньня ў Рыйгікогу і ў калегіі выбарцаў паўторным галасаваньнем парлямэнту пасаду прэзыдэнта ўпершыню заняла жанчына — Керсьці Кальюляйд."},{"page_url":"https://en.wikipedia.org/wiki/Enlargement_of_NATO","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Nato_poster_tbilisi.jpg","page_title":"Enlargement of NATO","context_page_description":"Enlargement of the North Atlantic Treaty Organization is the process of including new member states in NATO. NATO is a military alliance of twenty-eight European and two North American countries that constitutes a system of collective defense. The process of joining the alliance is governed by Article 10 of the North Atlantic Treaty, which allows only for the invitation of \\"other European States\\", and by subsequent agreements. Countries wishing to join have to meet certain requirements and complete a multi-step process involving political dialogue and military integration. The accession process is overseen by the North Atlantic Council, NATO's governing body.\\nAfter its formation in 1949 with twelve founding members, NATO grew by including Greece and Turkey in 1952 and West Germany in 1955, and then later Spain in 1982. After the Cold War ended, and Germany reunited in 1990, there was a debate in NATO about continued expansion eastward. In 1999, Poland, Hungary, and the Czech Republic joined NATO, amid much debate within the organization and Russian opposition."},{"page_url":"https://tr.wikipedia.org/wiki/Pindus_Da%C4%9Flar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Pindus_Mountains_02_bgiu.jpg","page_title":"Pindus Dağları","context_page_description":"Pindus Dağları, Yunanistan'ın kuzeyinde ve Arnavutluk'un güneyinde bulunan bir sıradağdır. En yüksek zirvesi ise Smolikas Dağı'dır."},{"page_url":"https://es.wikipedia.org/wiki/Reino_de_Sajonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Coat_of_Arms_of_the_Kingdom_of_Saxony_1806-1918.svg","page_title":"Reino de Sajonia","context_page_description":"El reino de Sajonia, que existió entre 1806 y 1918, fue un miembro independiente de la Confederación del Rin, la Confederación Germánica, la Confederación Alemana del Norte y, por último, uno de los 25 estados del Imperio alemán. Tenía una superficie de 14.993 km² y su población era de 2.556.244 habitantes en 1871 y de 4.202.216 en 1900. Su capital era Dresde, llamada la Florencia del Elba.\\nSu forma de gobierno era la monarquía constitucional hereditaria, con dos cámaras que se reunían cada dos años. La segunda cámara contaba con 82 diputados. El reino de Sajonia tenía cuatro portavoces en el Consejo Federal. Su constitución databa del 4 de septiembre de 1831, modificada posteriormente el 20 de abril de 1892. El reino de Sajonia se adhirió a la Confederación Alemana del Norte el 21 de octubre de 1866 y formó parte del Segundo Reich. Desaparece como Estado en 1918 a consecuencia del Tratado de Versalles, pasando su territorio a formar parte de la República de Weimar."},{"page_url":"https://fi.wikipedia.org/wiki/Tutkimusmatkat_Etel%C3%A4mantereelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/James_Clark_Ross.jpg","page_title":"Tutkimusmatkat Etelämantereelle","context_page_description":"Tutkimusmatkat Etelämantereelle olivat tutkimusmatkoja, jotka perustuivat oletukseen, että eteläisillä leveyksillä olisi suuri, mahdollisesti asuttava manner Terra Australis Incognita, etelän tuntematon maa. 1500-luvulta 1800-luvuille purjehdittiin maata etsien, ja manner löytyikin 1800-luvun alkuvuosikymmeninä. Kiinnostus kuitenkin hiipui, kun ymmärrettiin, että alue oli kylmä ja elämälle epäystävällinen. Lisäksi sinne oli vaikea purjehtia myrskyisen meren, jäävuorten ja lauttajään läpi.\\nMyöhemmin 1890-luvulla luvun lopuilla tutkijat – erityisesti maantieteilijät – kiinnostuivat Etelämantereesta. Yleisön kiinnostuksen myötä syntyi Etelänaparetkien sankariaika, jolloin erityisesti kilpailtiin Etelänavan valloituksesta. Tutkimusretket vaativat lukuisia kuolonuhreja, mutta etelänapa valloitettiin vuonna 1911.\\n1930-luvulla useiden maiden kiinnostus Etelämannerta kohtaan heräsi ja eri maat vaativat itselleen alueita mantereelta. Etelämantereelle perustettiin useita tutkimusasemia ja mantereella liikuttiin koirien, traktorien ja lentokoneiden avulla. Tutkimus voimistui 1950-luvulla, jolloin muun muassa Ranska ja Neuvostoliitto perustivat omat asemansa."},{"page_url":"https://vi.wikipedia.org/wiki/Isabella_I_c%E1%BB%A7a_Castilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/La_emperatriz_Isabel_de_Portugal%2C_por_Tiziano.jpg","page_title":"Isabella I của Castilla","context_page_description":"Isabella I của Castilla, còn được gọi là Isabel the Catholic, là Nữ vương của Vương quốc Castilla và León và là một trong những quân chủ vĩ đại nhất của lịch sử Tây Ban Nha. Cùng với chồng, Fernando II của Aragon, bà đã có công trong việc mang lại sự ổn định cho các vương quốc này, làm cơ sở cho việc thống nhất Tây Ban Nha bởi người cháu ngoại của họ, Karl V của đế quốc La Mã Thần thánh.\\nSau khi giành được quyền kế vị, bà đã cải tổ lại bộ máy hành chính của Castilla, đem tỉ lệ tệ nạn xuống mức thấp nhất trong nhiều năm qua. Bà cũng cố gắng xoay trở xóa đi số nợ quốc gia khổng lồ mà người anh của bà, Henry IV của Castilla, đã để lại khi qua đời. Sự cải cách của bà cùng chồng mình, Fernando II xứ Aragon, đã giúp sự liên minh giữa Castilla và Aragon thêm lớn mạnh, mở rộng thêm tầm ảnh hưởng ra bên ngoài. Bà cùng chồng mình được biết đến nhiều vì công cuộc khép tội những người Do Thái và người Hồi giáo trên liên bang 2 vương quốc, buộc tội họ trước Tòa án dị giáo hoặc là phải cải đạo Cơ-đốc, hoặc là bị trục xuất khỏi vùng đất này."},{"page_url":"https://en.wikipedia.org/wiki/Margaret_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Vir%C3%A1gok_a_Margitszigeten.jpg","page_title":"Margaret Island","context_page_description":"Margaret Island is a 2.5 km long island, 500 metres wide, in the middle of the Danube in central Budapest, Hungary. The island is mostly covered by landscape parks, and is a popular recreational area. Its medieval ruins are reminders of its importance in the Middle Ages as a religious centre. The island spans the area between the Margaret Bridge and the Árpád Bridge. Before the 14th century the island was called Insula leporum. Administratively Margaret Island used to belong to the 13th district, but now is directly under the control of the city.\\nIts appearance today was developed through the connection of three separate islands, the Festő, the Fürdő and the Nyulak, during the end of the 19th century, to control the flow of the Danube. Originally, the island was 102.5 metres above sea level, but now has been built up to 104.85 metres above sea level to control flooding."},{"page_url":"https://es.wikipedia.org/wiki/Cubo_de_Bureba","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Cubo_de_Bureba_03.JPG","page_title":"Cubo de Bureba","context_page_description":"Cubo de Bureba es una localidad y un municipio​ en la provincia de Burgos, comunidad autónoma de Castilla y León."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Mal%C3%A9_Mor%C3%A1vce","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Mala-Moravka-164.jpg","page_title":"Seznam kulturních památek v Malé Morávce","context_page_description":"Tento seznam nemovitých kulturních památek v obci Malá Morávka v okrese Bruntál vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Dolianova","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Dolianova-Serdiana_station_2018_6.jpg","page_title":"Stazione di Dolianova","context_page_description":"La stazione di Dolianova, già stazione di Sicci e stazione di Dolianova-Serdiana, è una stazione ferroviaria posta nel comune di Dolianova."},{"page_url":"https://en.wikipedia.org/wiki/Radial_engine","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Packard_DR-980_USAF.jpg","page_title":"Radial engine","context_page_description":"The radial engine is a reciprocating type internal combustion engine configuration in which the cylinders \\"radiate\\" outward from a central crankcase like the spokes of a wheel. It resembles a stylized star when viewed from the front, and is called a \\"star engine\\" in some languages. The radial configuration was commonly used for aircraft engines before gas turbine engines became predominant."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B0%D0%B4_%D0%9B%D0%B0%D1%81%D1%84%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Bad_Laasphe_Panorama.jpg","page_title":"Бад Ласфе","context_page_description":"Бад Ласфе град је у њемачкој савезној држави Северна Рајна-Вестфалија. Једно је од 11 општинских средишта округа Зиген-Витгенштајн. Према процјени из 2010. у граду је живјело 14.687 становника. Посједује регионалну шифру 5970028, NUTS и LOCODE код."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Middlesex_County_(Massachusetts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/First_Parish_in_Lincoln%2C_MA.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Middlesex County (Massachusetts)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Middlesex County führt alle Bauwerke, National Historic Landmarks und Historic Districts im Middlesex County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%81%98%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/NADA-01.jpg","page_title":"灘駅","context_page_description":"灘駅は、兵庫県神戸市灘区岩屋北町七丁目にある、西日本旅客鉄道東海道本線の駅である。駅番号はJR-A60。「JR神戸線」の愛称区間に含まれている。"},{"page_url":"https://en.wikipedia.org/wiki/Westonbirt_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Westonbirthouse.JPG","page_title":"Westonbirt House","context_page_description":"Westonbirt House is a country house in Gloucestershire, England, about 3 miles southwest of the town of Tetbury. It belonged to the Holford family from 1665 until 1926. The first house on the site was an Elizabethan manor house. The Holfords replaced it first with a Georgian house, and then Robert Stayner Holford, who inherited Westonbirt in 1839, replaced that house between 1863 and 1870 with the present mansion which was designed by Lewis Vulliamy. He also remodelled the gardens, diverted the main road and relocated the villagers.\\nThe house is constructed of high quality ashlar masonry on a grand scale. The exterior is in an Elizabethan style, with a symmetrical main block and asymmetric wings, one of them containing a conservatory. The interiors are in a sumptuous classical style. The house was fitted with the latest technology such as gas lighting, central heating, fireproof construction and iron roofs. It is now a Grade I listed building.\\nExtensive formal terrace gardens were created around the house and 25 acres of ornamental woodlands were planted in the 19th century. Since 1928, the house has been occupied by the girls' boarding school Westonbirt School."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%A2%85%E8%A5%BF%E8%80%B6%E5%A4%A9%E4%BD%93%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Messier_073_2MASS.jpg","page_title":"梅西耶天体列表","context_page_description":"梅西耶天体，指由法国天文学家查尔斯·梅西耶所编的《星云星团表》中列出的一组天体。该作最早出版于1774年，而后于1780年和1781年增补。最后一次基于梅西耶的观察资料的增补则是在1966年。\\n梅西耶本人只对寻找彗星感兴趣，他一直找到一些容易误认成彗星的固定天体，但却找不到一颗真正的彗星。梅西耶对此感到很沮丧，于是他与自己的助手皮埃尔·梅尚一起创建了一个非彗星天体的列表以分辨容易与彗星混淆的固定天体，是为梅西耶目录。梅西耶天体列表是天文学中较为常用与重要的天体列表之一，也是第一份较为详尽而正确的星体目录，同时亦促使星云和星团总表与NGC星表等其他星表的诞生。许多梅西耶天体的编码仍然在今日天文学界广泛使用，作为天体的代号。\\n初版发行时，该作列出了45个天体，到了最终版本时，列出的天体增加至103个。但M102目前仍未能确认对应的实际天体，因此当时的梅西耶目录中的天体实际上可能只有102个。之后其他天文学家根据梅西耶的文本旁注加上一些由梅西耶或梅尚发现但没有加上去的天体。1921年，卡米伊·弗拉马利翁加入M104，使目录列出的天体数增加至104个，26年后，海伦·索耶·霍格加入M105至M107，M108和M109于1960年被欧文·金格里奇加入。最后的M110则是于1966年加入，加入者为肯尼斯·格林·琼斯。此后再没有其他天体被列入，令梅西耶天体总数定格于110个。"},{"page_url":"https://en.wikipedia.org/wiki/Alcaeus_of_Mytilene","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Alkaios_Sappho_Staatliche_Antikensammlungen_2416_n1.jpg","page_title":"Alcaeus of Mytilene","context_page_description":"Alcaeus of Mytilene was a lyric poet from the Greek island of Lesbos who is credited with inventing the Alcaic stanza. He was included in the canonical list of nine lyric poets by the scholars of Hellenistic Alexandria. He was a contemporary and an alleged lover of Sappho, with whom he may have exchanged poems. He was born into the aristocratic governing class of Mytilene, the main city of Lesbos, where he was involved in political disputes and feuds."},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Europameisterschaften_1954/10.000_m_Gehen_der_M%C3%A4nner","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Louis_Chevalier_1948.jpg","page_title":"Leichtathletik-Europameisterschaften 1954/10.000 m Gehen der Männer","context_page_description":"Das 10.000-m-Gehen der Männer bei den Leichtathletik-Europameisterschaften 1954 wurde am 26. August 1954 im Stadion Neufeld in Bern ausgetragen. Der Wettbewerb stand letztmals auf dem Programm der Europameisterschaften und wurde ab 1958 vom 20-km-Gehen abgelöst.\\nIn diesem Wettbewerb gab es mit Silber und Bronze zwei Medaillen für die Sowjetunion. Europameister wurde der Tschechoslowake Josef Doležal. Er gewann vor Anatoli Jegorow und Sergei Lobastow."},{"page_url":"https://cy.wikipedia.org/wiki/Helyglys_p%C3%AAr","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Epilobium_hirsutum_jfg.jpg","page_title":"Helyglys pêr","context_page_description":"Planhigyn blodeuol sy'n frodorol o Hemisffer y De yw Helyglys pêr sy'n enw gwrywaidd. Mae'n perthyn i'r teulu Onagraceae. Yr enw gwyddonol yw Epilobium hirsutum a'r enw Saesneg yw Great willowherb. Ceir enwau Cymraeg eraill ar y planhigyn hwn gan gynnwys Helyglys Pêr, Helyglys Blewog Mawr, Helyglys Pannog, Helyglys Pêr Blewog Mwyaf.\\nFe'i ceir yn rhannau deheuol Hamisffer y De: o'r Isartig i rannau deheuol Affrica, De America ac Awstralia. Mae'n perthyn yn agos i'r olewyddan, yr onnen, jasmin, a'r leilac. Mae'r dail wedi'u gosod bob yn ail."},{"page_url":"https://en.wikipedia.org/wiki/Eric_Alexander_(jazz_saxophonist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Eric_Alexander_2008.jpg","page_title":"Eric Alexander (jazz saxophonist)","context_page_description":"Eric Alexander is an American jazz saxophonist."},{"page_url":"https://de.wikipedia.org/wiki/Heinrich_Heintzmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Johann_Heinrich_Heintzmann.jpg","page_title":"Heinrich Heintzmann","context_page_description":"Heinrich Heintzmann, vollständiger Name Johann Heinrich Heintzmann, war ein deutscher Bergbeamter, Stadtrat der Stadt Essen und Direktor der Gesellschaft Verein."}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],R={key:0},N={key:1};function H(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",T,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",F,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),f(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",G,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",N,"Loading...")):(t(),n("span",R,"See more"))],8,I)):p("",!0)])}const K=g(L,[["render",H],["__scopeId","data-v-13e54267"]]),W=JSON.parse('{"title":"","description":"","frontmatter":{"page":true},"headers":[],"relativePath":"chatai/1.md","filePath":"chatai/1.md"}'),q={name:"chatai/1.md"},V=Object.assign(q,{setup(a){return(e,s)=>(t(),n("div",null,[D(K)]))}});export{W as __pageData,V as default};
